import{_ as g,o as t,c as n,a as i,t as u,C as h,M as _,U as k,f as p,F as w,p as b,e as f,q as v}from"./chunks/framework.B1z0IdBH.js";const D={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(a){a.target.src="/images/logo.svg"}}},y={class:"entry-container"},B={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(a,e,s,m,o,r){return t(),n("div",y,[i("div",B,[i("div",A,[i("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),i("div",z,[i("h2",C,[e[1]||(e[1]=i("span",{class:"title-icon"},null,-1)),i("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),i("p",S,u(s.poem.context_page_description),1)])])])}const M=g(D,[["render",x],["__scopeId","data-v-93f96ad4"]]),P=JSON.parse(`[{"page_url":"https://it.wikipedia.org/wiki/Fu%C3%9Fballclub_Carl_Zeiss_Jena","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Bundesarchiv_Bild_183-N0414-0008%2C_Leipzig%2C_FDGB-Pokal%2C_Endspiel%2C_SG_Dynamo_Dresden_-_FC_Carl_Zeiss_Jena_1-3.jpg","page_title":"Fußballclub Carl Zeiss Jena","context_page_description":"Il Fußballclub Carl Zeiss Jena e.V. è una società calcistica tedesca con sede nella città di Jena, in Turingia. Nella stagione 2019-2020 gioca nella 3. Liga, la terza divisione del calcio tedesco.\\nFondato nel 1903, il club ha giocato in campionati regionali fino alla Seconda guerra mondiale, al termine della quale Jena divenne parte della Repubblica Democratica Tedesca; la squadra, inserita nel massimo campionato di questa nazione, riuscì a vincerlo per tre volte, conquistando inoltre per quattro volte la Coppa nazionale. A seguito della riunificazione tedesca, il Carl Zeiss non è mai riuscito a partecipare al massimo campionato, gravitando costantemente tra la seconda e la quarta divisione.\\nA livello internazionale il successo più alto ottenuto dal club è costituito dal raggiungimento della finale della Coppa delle Coppe 1980-1981, ove venne poi sconfitto dalla Dinamo Tbilisi."},{"page_url":"https://en.wikipedia.org/wiki/Armida","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Rinaldo_and_Armida_by_Gerard_Hoet.jpg","page_title":"Armida","context_page_description":"Armida is a fictional character created by the Italian late Renaissance poet Torquato Tasso. She is a Saracen sorceress."},{"page_url":"https://hu.wikipedia.org/wiki/Hastings_Banda","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Hastings_Kamuzu_Banda-Denkmal_Lilongwe.jpg","page_title":"Hastings Banda","context_page_description":"Hastings Kamuzu Banda afrikai politikus, 1964 és 1994 között Malawi első elnöke. Egyetemi éveit az Amerikai Egyesült Államokban és Nagy-Britanniában töltötte, Londonban nyitott háziorvosi praxist. 1958-ban visszatért a brit fennhatóság alatt álló Nyaszaföldre és megalapította a Malawi Kongresszus Pártot. Az MCP, Banda vezetésével, a kibontakozó függetlenségi mozgalom élére állt: 1963-ban a britek kinevezték Nyaszaföld miniszterelnökének és egy évvel később, 1964-ben megadták az ország függetlenségét.\\nKét évvel később, 1966-ban Banda kikiáltotta a köztársaságot és magát köztársasági elnöknek nevezte ki. A demokratikus intézmények mellőzésével Malawit hamarosan egypártrendszerré alakította át az MCP vezetésével, amely 1970-ben életfogytiglani köztársasági elnöknek kiáltotta ki.\\nKülpolitikáját tekintve egyike volt a kevés Nyugat-barát afrikai vezetőknek a függetlenséget követő években, ezért a hidegháborúra való tekintettel jelentős támogatást kapott az Egyesült Államoktól és más nyugati hatalmaktól. Az afrikai országok közül elsőként választójogot adott a nőknek, fejlesztette Malawi infrastruktúráját és afrikai viszonylatban meglehetősen jó oktatási rendszert épített ki."},{"page_url":"https://it.wikipedia.org/wiki/Samurai","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Satsuma-samurai-during-boshin-war-period.jpg","page_title":"Samurai","context_page_description":"Il samurai era il nome con il quale erano conosciuti i membri della casta militare del Giappone feudale; simili sotto certi aspetti ai cavalieri dell'Europa medievale, questi guerrieri giocarono per diversi secoli un ruolo fondamentale nella storia giapponese. Il loro declino coincise con l'inizio dello Shogunato Tokugawa, che con la fine dell'epoca dei conflitti vide fortemente ridimensionata la loro figura, per poi essere completamente accantonata durante il Rinnovamento Meiji nel XIX in favore di un esercito regolare di stampo europeo."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_de_Bordils","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Can_Sastre_%28Bordils%29.jpg","page_title":"Llista de monuments de Bordils","context_page_description":"Llista de monuments de Bordils inclosos en l'Inventari del Patrimoni Arquitectònic Català pel municipi de Bordils. Inclou els inscrits en el Registre de Béns Culturals d'Interès Nacional amb la classificació de monuments històrics, els béns culturals d'interès local de caràcter immoble i la resta de béns arquitectònics integrants del patrimoni cultural català."},{"page_url":"https://lb.wikipedia.org/wiki/Haaptasteroidenceinture","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Main_belt_i_vs_a.png","page_title":"Haaptasteroidenceinture","context_page_description":"An der Haaptasteroidenceinture, och Planetoidenceinture oder Haaptceinture, sinn Asteroiden oder Klengplanéiten tëscht de Bunne vu Mars a Jupiter. Déi meescht Asteroiden oder Planetoiden an eisem Sonnesystem sinn an dësem Beräich ze fannen. Den totale Beräich vun den eenzelen Ëmlafbunne gëtt haut mat ongeféier 2,0 bis 3,4 AE uginn."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Odoyevsky_Ko%C4%81n","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Tulskaya_oblast_Odoevsky_rayon.png","page_title":"Odoyevsky Koān","context_page_description":"Odoyevsky Koān sī Lō͘-se-a Tula Chiu ê chi̍t ê koān.\\nPang-bô͘:Tula Chiu"},{"page_url":"https://pl.wikipedia.org/wiki/Fogars_de_la_Selva","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Esgl%C3%A9sia_de_Sant_Cebri%C3%A0_de_Fogars_de_la_Selva_2.JPG","page_title":"Fogars de la Selva","context_page_description":"Fogars de la Selva – gmina w Hiszpanii, w prowincji Barcelona, w Katalonii, o powierzchni 32,28 km². W 2011 roku gmina liczyła 1529 mieszkańców."},{"page_url":"https://de.wikipedia.org/wiki/Gitarre","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Oud_total.JPG","page_title":"Gitarre","context_page_description":"Die Gitarre, auch Guitarre, ist ein Musikinstrument aus der Familie der Kastenhalslauten, bei der Tonerzeugung ein Saiteninstrument, spieltechnisch ein Zupfinstrument.\\nBei der Tonverstärkung wird zwischen akustischen und elektrischen Gitarren unterschieden. Dieser Artikel legt den Schwerpunkt auf die akustische Gitarre und die Gemeinsamkeiten mit ihrer elektrischen Verwandten."},{"page_url":"https://sq.wikipedia.org/wiki/Kosa","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/NIE_Reapers_Cradle_Scythes.png","page_title":"Kosa","context_page_description":"Kosa është një mjet metalik me një bisht druri i cili përdoret për punët bujqësore, për të kositur barin në livadhe, fusha, kullosa dhe drithërat nëpër ara."},{"page_url":"https://en.wikipedia.org/wiki/Anthony_Henday_Drive","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/2019-05-30_Anthony_Henday_Drive_south_approaching_Callingwood_Road_exit_%28exit_16%29_9545.jpg","page_title":"Anthony Henday Drive","context_page_description":"Anthony Henday Drive is a 78-kilometre freeway that encircles Edmonton, Alberta. It is a heavily travelled commuter and truck bypass route with the southwest quadrant serving as a portion of the CANAMEX Corridor that links Canada to the United States and Mexico. Henday is one of the busiest highways in Western Canada, carrying over 108,000 vehicles per day in 2019 at its busiest point near West Edmonton Mall. Rush hour congestion is common on the four-lane section in southwest Edmonton where traffic levels have doubled Alberta Transportation estimates due to rapid suburban development. Work began in fall 2019 to widen this section to six lanes by the end of 2022.\\nCalgary Trail in south Edmonton is designated as the starting point of the ring, with exit numbers increasing clockwise as the freeway proceeds across the North Saskatchewan River to the Cameron Heights neighbourhood, then north past Whitemud Drive, Stony Plain Road and Yellowhead Trail to St. Albert. It continues east past 97 Street to Manning Drive, then south across the North Saskatchewan River a second time."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Friedrichsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Friedrichsdorf%2C_Hugenottenstra%C3%9Fe_36.jpg","page_title":"Liste der Kulturdenkmäler in Friedrichsdorf","context_page_description":"Die folgende Liste enthält die in der Denkmaltopographie ausgewiesenen Kulturdenkmäler auf dem Gebiet der Stadt Friedrichsdorf, Hochtaunuskreis, Hessen.\\nHinweis: Die Reihenfolge der Denkmäler in dieser Liste orientiert sich zunächst an Stadtteilen und anschließend der Anschrift, alternativ ist sie auch nach der Bezeichnung, der vom Landesamt für Denkmalpflege vergebenen Nummer oder der Bauzeit sortierbar.\\nGrundlage ist die Veröffentlichung der hessischen Denkmalliste, die auf Basis des Denkmalschutzgesetzes vom 5. September 1986 erstmals erstellt und seither laufend ergänzt wurde."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_c%C3%A1c_c%E1%BB%99t_m%E1%BB%91c_v%E1%BB%81_K%E1%BB%B9_thu%E1%BA%ADt_X%C3%A2y_d%E1%BB%B1ng_L%E1%BB%8Bch_s%E1%BB%AD_Qu%E1%BB%91c_gia_Hoa_K%E1%BB%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Pennsylvania_Turnpike_1942_LOC.jpg","page_title":"Danh sách các cột mốc về Kỹ thuật Xây dựng Lịch sử Quốc gia Hoa Kỳ","context_page_description":"Sau đây là Danh sách các cột mốc về Kỹ thuật Xây dựng Lịch sử Quốc gia Hoa Kỳ theo chỉ định của Hiệp hội các kỹ sư xây dựng kể từ khi chương trình bắt đầu vào năm 1964. Việc chỉ định được cấp cho các dự án, công trình, và các địa điểm trong nước Mỹ và phần còn lại của thế giới. Tính đến năm 2012, có 256 điểm mốc nằm trong danh sách. Mục hoặc chương của Hiệp hội Kỹ sư dân dụng cũng có thể chỉ định cột mốc tiểu bang hay địa phương trong khu vực của họ, nhưng những điểm mốc này không được liệt kê ở đây."},{"page_url":"https://eo.wikipedia.org/wiki/Linia_skribo_A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Linear_A_cup.png","page_title":"Linia skribo A","context_page_description":"La skribo Linia A estas – krom la kreta hieroglifa skribo – unu el la du skribosistemoj de minoa kulturo de Kreto. Ĝi estis uzata de la 17-a ĝis la 15-a jarcentoj a.K. kaj oni povis deĉifri nur ete. El ĝi evoluis la skribo linia skribo B same kiel la kipro-minoa skribo. Ĉar Linia B estas silabskribo, oni supozas, ke ankaŭ Linia A estas same silabskribo.\\nLa nomo \\"linia\\" devenas de la fakto, ke la skribo konsistas el strekoj de konstanta larĝo, ne el kojnoj."},{"page_url":"https://nl.wikipedia.org/wiki/Monteils_(Gard)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Eglise_Monteils_fr30.jpg","page_title":"Monteils (Gard)","context_page_description":"Monteils is een gemeente in het Franse departement Gard en telt 399 inwoners. De plaats maakt deel uit van het arrondissement Alès."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9C%D0%B8%D1%80%D1%87%D0%B5_%D0%90%D1%86%D0%B5%D0%B2_(%D1%81%D0%B5%D0%BB%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/North_Macedonia_relief_location_map.jpg","page_title":"Мирче Ацев (село)","context_page_description":"Мирче Ацев — село во Општина Кривогаштани, во околината на градот Прилеп."},{"page_url":"https://eo.wikipedia.org/wiki/Arnold_Syen","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Joh_Anton_v_d_Linden.jpg","page_title":"Arnold Syen","context_page_description":"Arent Seyen estis nederlanda kuracisto kaj botanikisto, profesoro pri medicino, aŭtoro de sennombraj verkoj pri medicino kaj botaniko, lernanto de Jan van der Linden kaj Adolphus Vorstius. Li estis filo de Joris Pietersz. Sijen kaj Marijtge Bosch, filino de la komercisto Arent Dirksz. Bosch kaj ties edzino Elisabeth Jansdr. de Vogel."},{"page_url":"https://es.wikipedia.org/wiki/Historia_de_Hungr%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Fireworks_in_brussel_1686_in_conmemoration_of_the_liberation_of_hungary.jpg","page_title":"Historia de Hungría","context_page_description":"Historia de Hungría a partir de la llegada de los magiares a Europa."},{"page_url":"https://de.wikipedia.org/wiki/Pelzzurichtung","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Pelz-Zurichterei%2C_Endkontrolle_von_Rotfuchsfellen._Pelz_Meinelt%2C_R%C3%B6tha.jpg","page_title":"Pelzzurichtung","context_page_description":"Die Überführung der rohen Haut in Leder, also einen gegerbten, vor Fäulnis geschützten Zustand, wird in der Rauchwarenbranche als Zurichtung oder Rauchwarenzurichtung, österreichisch Rauwarenzurichtung, bezeichnet, der ähnliche Prozess in der Lederindustrie als Gerbung. Ein seltener, wohl nicht mehr gebräuchlicher Begriff hierfür war lidern.\\nDie weiterverarbeitenden Prozesse wie Färben, Scheren usw. werden unter dem Begriff Veredlung oder Rauchwarenveredlung zusammengefasst. Die Pelzzurichtung besteht im Entfleischen der Felle und einer anschließenden Behandlung mit Gerbstoffen und Fetten."},{"page_url":"https://de.wikipedia.org/wiki/Blauhai","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Prionace_glauca_dis.png","page_title":"Blauhai","context_page_description":"Der Blauhai gehört innerhalb der Haie zur Familie der Requiemhaie und stellt die einzige Art der Gattung Blauhaie dar. Neben dem Weißspitzen-Hochseehai und dem Seidenhai gehört er zu den drei häufigsten Hochseehaiarten."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A0%CE%B1%CE%BD%CE%B5%CF%80%CE%B9%CF%83%CF%84%CE%AE%CE%BC%CE%B9%CE%BF_%CF%84%CE%BF%CF%85_%CE%A3%CE%B1%CE%B9%CE%BD%CF%84_%CE%86%CE%BD%CF%84%CF%81%CE%B9%CE%BF%CF%85%CF%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/St_Andrews_Quad.jpg","page_title":"Πανεπιστήμιο του Σαιντ Άντριους","context_page_description":"Το Πανεπιστήμιο του Σαιντ Άντριους είναι δημόσιο πανεπιστήμιο στη μικρή πόλη Σαιντ Άντριους της Σκωτίας. Είναι το αρχαιότερο πανεπιστήμιο της Σκωτίας και το τρίτο αρχαιότερο της Μεγάλης Βρετανίας αλλά και ολόκληρου του αγγλόφωνου κόσμου. Ιδρύθηκε μεταξύ του 1410 και του 1413, όταν ο Πάπας της Αβινιόν Βενέδικτος ΙΓ΄ εξέδωσε μία παπική βούλλα σε μία μικρή ιδρυτική ομάδα Αυγουστινιανών ιερομονάχων.\\nΤο Πανεπιστήμιο του Σαιντ Άντριους αξιολογήθηκε το 2013 ως το τέταρτο καλύτερο πανεπιστήμιο στο Ηνωμένο Βασίλειο από τον Guardian University Guide και τον Times Good University Guide το 2014. Το Τμήμα Φυσικής και Αστρονομίας του κατατάχθηκε δεύτερο στο Ηνωμένο Βασίλειο μετά από αυτό του Πανεπιστημίου του Κέμπριτζ. Αντίστοιχα, το Πανεπιστήμιο του Σαιντ Άντριους απαιτεί την τρίτη υψηλότερη βαθμολογία για εισαγωγή ανάμεσα σε όλα τα βρετανικά ΑΕΙ.\\nΤο πανεπιστήμιο κυριαρχεί στη ζωή της μικρής ιστορικής πόλεως του Σαιντ \`Αντριους: Κατά την περίοδο των μαθημάτων, πάνω από το 1/3 του πληθυσμού της είναι είτε φοιτητές, είτε εργαζόμενοι σε αυτό. Το σώμα των φοιτητών είναι αξιοσημείωτα πολυεθνικό: πάνω από το 30% αυτών προέρχεται από 100 και πλέον ξένες χώρες, με το 15% από τη Β. Αμερική."},{"page_url":"https://sw.wikipedia.org/wiki/Maggie_Laubser","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Maggie_Laubser%2C_Pink_Blossoming_Tree%2C_undated_%281920%E2%80%931921%29%2C_oil_on_cardboard%2C_340_x_400_mm.jpg","page_title":"Maggie Laubser","context_page_description":"Maggie Laubser alikuwa mchoraji na mchapaji wa Afrika Kusini. Pamoja na Irma Stern alihusika kutambulisha sanaa ya \\"expressionism\\" katika Afrika Kusini. Mwanzoni alikosolewa sana, lakini baadaye alikubaliwa na kutazamwa kuwa msanii muhimu katika historia ya sanaa nchini."},{"page_url":"https://hu.wikipedia.org/wiki/Skorbut","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/John_Woodall_by_George_Glover_detail.jpg","page_title":"Skorbut","context_page_description":"A skorbut a C-vitamin hiánya miatt kialakuló súlyos táplálkozási betegség. Az egyoldalú étkezés miatt főleg a tengerészek körében fordult elő.\\nMár az ókorban ismerték; az Ószövetség is említi. Először Hippokratész írta le. Megfigyelték, hogy elsősorban tél végén és tavasz elején szedi áldozatait: a betegek fáradtságról, vérzékenységről panaszkodtak, testükön fekélyek keletkeztek, végtagjaik felduzzadtak.\\nA nagy földrajzi felfedezések korában a „tengeri pestis”-nek nevezett kór tömegesen irtotta a hajók legénységét. Vasco da Gama 1499-es indiai útján legénységének csaknem felét, Magellán több mint felét vesztette el e hiánybetegség miatt."},{"page_url":"https://sv.wikipedia.org/wiki/Mathiasella_bupleuroides","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Mathiasella_bupleuroides.jpg","page_title":"Mathiasella bupleuroides","context_page_description":"Mathiasella bupleuroides är en flockblommig växtart som beskrevs av Lincoln Constance och Charles Leo Hitchcock. Mathiasella bupleuroides ingår i släktet Mathiasella och familjen flockblommiga växter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Neubrunn_(Turyngia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Neubrunn_in_SM.png","page_title":"Neubrunn (Turyngia)","context_page_description":"Neubrunn – miejscowość i gmina w Niemczech, w kraju związkowym Turyngia, w powiecie Schmalkalden-Meiningen, wchodzi w skład wspólnoty administracyjnej Dolmar-Salzbrücke. Do 31 grudnia 2011 gmina należała do wspólnoty administracyjnej Salzbrücke."},{"page_url":"https://pl.wikipedia.org/wiki/Infiniti_M","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/1991_M30_conv_rv.jpg","page_title":"Infiniti M","context_page_description":"Infiniti M – samochód osobowy klasy średniej-wyższej produkowany przez koncern Nissan pod marką Infiniti od 1989 roku. Od 2010 roku produkowana jest czwarta generacja pojazdu, która w 2013 roku zmieniła nazwę z M na Q70."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B4%9E%E5%AF%9F%E5%8F%B7%E7%81%AB%E6%98%9F%E6%8E%A2%E6%B5%8B%E5%99%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/NASA-TeamCheers-InSight-LandsOnThePlanetMars-20181126.jpg","page_title":"洞察号火星探测器","context_page_description":"洞察號是一顆用於研究火星行星內部結構的火星無人著陸探測器。著陸器由洛克希德馬丁公司製造。洞察號名字來自其全名「運用地震調查、測地學與熱傳導對火星內部進行探測」的首字母縮寫。\\n洞察號的任務是將一個裝載有地震儀及熱流偵測器的固定式登陸載具發射到火星表面，這個固定式登陸器SEIS是由法國國家太空研究中心生產，並利用德國航空太空中心製造的HP³熱傳感探頭來測量火星地質結構的導熱，以此研究火星的地質演化。這可以帶來對太陽系的類地行星的新認識。為了降低洞察號的成本和風險，洞察號將使用與2008年登陸火星的鳳凰號相同的設計和技術。\\n洞察號最初計劃於2016年3月發射。然而，在發射前SEIS儀器發生故障失效，發射窗口也存在著問題，洞察號被送回位於科羅拉多州丹佛市的洛克希德馬丁公司工廠進行調整。之後，NASA官方決定將額外花費約1.5億美元對洞察號進行調整，洞察號的成本將從之前的6.75億美元增加到8.3億美元，並於2018年5月5日11:05在美國加州中部的范登堡空軍基地成功發射。 在2018年11月26日19:52:59，洞察號經過近3億英里的旅程，成功降落在火星表面的埃律西昂平原上，它將部署地震計與熱挖掘探頭，並展開無線電科學實驗裝置，以補充對火星內部結構的研究。該任務由NASA的噴氣推進實驗室進行管理。"},{"page_url":"https://en.wikipedia.org/wiki/Wharf_Theatre","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/The_Wharf_Theatre_at_The_Rocks.jpg","page_title":"Wharf Theatre","context_page_description":"The Wharf Theatre is a theatre in Sydney, New South Wales, Australia. This theatre is part of the Sydney Theatre Company and located on Pier 4/5 of the former Sydney port facility in Walsh Bay at Dawes Point."},{"page_url":"https://de.wikipedia.org/wiki/Zeitleiste_der_Erkundung_des_Weltraums","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Mariner_2.jpg","page_title":"Zeitleiste der Erkundung des Weltraums","context_page_description":"Dies ist eine Zeitleiste der Erkundung des Weltraums, geordnet nach Startdatum des Raumschiffs beziehungsweise der Raumsonde. Sie enthält:\\nAlle Raumfahrzeuge, die den Erdorbit mit dem Ziel der Erforschung des Sonnensystems verlassen haben, eingeschlossen Raumfahrzeuge, welche zum Mond geflogen sind.\\nEine gewisse Zahl wegweisender oder besonders hervorzuhebender Raumfahrzeuge, die den Erdorbit nicht verließen.\\nErstflüge bemannter Raumschiffe.\\nSie enthält nicht:\\nDen Großteil an Satelliten im Erdorbit.\\nRaumfahrzeuge, welche vor Verlassen des Erdorbits verunglückt sind.\\nDie eingetragenen Daten sind Startzeitpunkte, die beschriebenen Leistungen der Raumfahrzeuge können zu deutlich späteren Zeitpunkten stattgefunden haben."},{"page_url":"https://hu.wikipedia.org/wiki/York_megye_(D%C3%A9l-Karolina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/York_County_Courthouse.jpg","page_title":"York megye (Dél-Karolina)","context_page_description":"York megye az Amerikai Egyesült Államokban, azon belül Dél-Karolina államban található. Megyeszékhelye York, legnagyobb városa Rock Hill. Lakosainak száma 239 363 fő. +/- York megye Gaston, Mecklenburg, Lancaster, Chester, Union, Cherokee és Cleveland megyékkel határos."},{"page_url":"https://oc.wikipedia.org/wiki/Beneset_IX","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Benoit_IX.jpg","page_title":"Beneset IX","context_page_description":"Beneset IX foguèt lo 145ᵉⁿ papa dau 21 d'octòbre de 1032 au 1èr de setembre de 1044, dau 10 de març au 1èr de mai de 1045 e dau 8 de novembre de 1047 au 16 de julhet de 1048. Succediguèt a Joan XIX e foguèt definitivament remplaçat, après un periòde trebolat, per Leon IX.\\nFiu dau còmte Alderic III de Tusculum, foguèt elegit papa gràcias a l'influéncia de son paire que son ostau contraròtlava Roma dempuei leis ans 1010-1020. En Roma, contunièt la politica d'amaisament de Joan XIX. Regardant leis afaires intèrnes de la Glèisa, sostenguèt leis òrdres monastics còntra leis ordinaris e esitèt pas de depausar dos evesques considerats coma simoniacs. Acceptèt tanben divèrsei demandas de part de l'emperaire Conrad II lo Salic.\\nPasmens, en setembre de 1044, Beneset IX deguèt s'enfugir de Roma après una esmoguda populara organizada per lo clan dei Stephani. Lei Stephani organizèron l'eleccion d'un papa novèu, Silvèstre III, que foguèt rapidament excomunicat. Beneset IX retrobèt son tròne lo 10 de març de 1045 mai abandonèt sa carga lo 1èr de mai seguent au profiech de son oncle que venguèt lo papa Gregòri VI.\\nAquelei trèbols entraïnèron una reaccion de l'emperaire."},{"page_url":"https://sv.wikipedia.org/wiki/Falu_Kuriren","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Falu-Kuriren_1894-07-02_1.jpg","page_title":"Falu Kuriren","context_page_description":"Falu-Kuriren, som är Dalarnas största dagstidning och en del av Dalarnas Tidningar, är en sexdagarstidning med huvudsaklig spridning i Falun, Siljanstrakten och Västerdalarna. Tidningen är oberoende liberal.\\nUpplaga: 29 000 exemplar"},{"page_url":"https://cv.wikipedia.org/wiki/%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D1%81%D0%B5%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Mehdi_Huseynzade.jpg","page_title":"Азербайджансем","context_page_description":"Азербайджа́нсем — тĕрĕк чĕлхиллĕ Азербайджан Республикинчи тĕп, çурçĕр-анăç Иранăн чылай йыш халăх. Пур йышĕ — 24 миллион çын. Антропологи енĕпе чылай азербайджан каçпи тĕсĕ шутне кĕрет."},{"page_url":"https://nds.wikipedia.org/wiki/Sokrates","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Socrates_Louvre.jpg","page_title":"Sokrates","context_page_description":"Sokrates weer en vun de gröttsten antike Philosophen. Sokrates weer ut Grekenland un leev in Athen. Nich veel is vun hem bekannt. Sien wichtigsten Schöler is Platon ween. Veel Lüde meent, dat weer wichtigste Philosoph vun de Historie. Platon hett ok allerhand vun Sokrates opschreven. De Wohrheit weer för Sokrates wichtiger, as dat Leven. Dat Daimonion weer för Sokrates wichtig. Dor hannelt sik dat nah Sokrates um de innere Stimm bi, de den Minsch to ethisch gaudet Hanneln brengt. De Apologie vun Sokrates weer een vun de bekanntesten Warke vun Platon. In düt Book beschrifft he den Dood vun Sokrates as Unrecht. De Ironie is en wichtig Teken vun Sokrates sien Wark. Sokrates is in de demokraatsche Tied to'n Dood veroordeelt wurrn. Gegen de Tyrannen in de nich-demokraatsche Tied hett he sik up de Achterbeen stellt. En bekannten Snack vun Sokrates is: Gnothi seauton!. En anner Snack weer: ik weet, dat ik nich weet!. Dor hannelt sik dat um en bannig wichtigen Snack bi för dat Verstahn vun Sokrates siene Philosophie."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%93%D7%A8%D7%99%D7%90%D7%9F_%D7%95%D7%90%D7%9F_%D7%90%D7%95%D7%A1%D7%98%D7%93%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Peasants_dancing_in_a_tavern%2C_by_Adriaen_van_Ostade.jpg","page_title":"אדריאן ואן אוסטדה","context_page_description":"אדריאן ואן אוסטדה היה צייר הולנדי בתקופת תור הזהב של הציור ההולנדי, ויצר יצירות המתארות את חיי היומיום."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%B7%D8%A7%D8%B1_%D8%B3%D9%88%D9%84%D8%AA_%D8%B3%D8%A7%D9%86%D8%AA_%D9%81%D9%89_%D8%A8%D9%84%D8%AF%D9%8A%D9%87_%D9%85%D8%A7%D8%B1%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Sault_ste_marie_municpal_airport.jpg","page_title":"مطار سولت سانت فى بلديه مارى","context_page_description":"مطار سولت سانت فى بلديه مارى هوا مطار فى امريكا."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B4%D0%B0%D0%BB%D1%8C_%D0%9F%D0%BE%D1%88%D0%B0%D0%BD%D0%B8_(%D0%A1%D0%A8%D0%90)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/Gary_Gordon.jpg","page_title":"Медаль Пошани (США)","context_page_description":"Меда́ль Поша́ни (США) — найвища військова нагорода США, що присвоюється федеральним урядом Сполучених Штатів Америки військовослужбовцям Збройних сил США за проявлену особисту мужність під час ведення бойових дій. Відповідно до положення про медаль нагородження нею здійснюється за\\nЧерез даний статус медаль дуже часто присвоюється посмертно.\\nКожен вид збройних сил США має право на свій дизайн медалі, але на практиці Корпус морської піхоти і Берегова охорона використовують дизайн ВМС.\\nПрезидент США особисто вручає Медаль Пошани героєві, що здійснив подвиг, а в разі загибелі військовослужбовця — найближчим членам його родини. Нагорода має особливий статус і охороняється спеціальним законом, затвердженим Конгресом США.\\nМедаль Пошани — одна з двох військових нагород США, що призначена для носіння на шиї."},{"page_url":"https://en.wikipedia.org/wiki/Protea_nana","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Protea_nana_1DS-II_1-9805.jpg","page_title":"Protea nana","context_page_description":"Protea nana, also known as the mountain rose or mountain-rose sugarbush, is a flowering shrub which belongs within the genus Protea."},{"page_url":"https://pt.wikipedia.org/wiki/Le%C3%B4ncio_Correia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Leoncio_Correia_livro.jpg","page_title":"Leôncio Correia","context_page_description":"|imagem = Leoncio Correia Foto.JPG\\n|imagem_legenda = Foto de Leôncio Correia\\n|imagem_tamanho =\\n|nascimento_data = 1 de setembro de 1865\\n|nascimento_local = Paranaguá, PR\\n|morte_data = 19 de junho de 1950\\n|morte_local = Rio de Janeiro, RJ\\n|nacionalidade = brasileiro\\n|ocupação = Advogado, escritor, jornalista e político\\n}}\\nLeôncio Correia foi um advogado, escritor, jornalista e político brasileiro.\\nFilho de João Ferreira Correia e Carolina Pereira Correia, ficou órfão aos seis anos, já que seu pai faleceu, em 1865, aos 33 anos de idade. Logo acolhido pelos tios, personagens célebres do campo político local e nacional, tendo tido como patrono o Comendador Ildefonso Pereira Correia, principal empresário ervateiro do estado e irmão do Senador Correia, alto funcionário do Império e com ampla inserção na Corte.\\nExerceu os cargos de diretor da Instrução Pública do Rio Janeiro, diretor do colégio Dom Pedro II, diretor da Imprensa Nacional, diretor do Instituto de Educação do Rio de Janeiro, deputado federal e deputado estadual pelo Paraná."},{"page_url":"https://it.wikipedia.org/wiki/Paralepidotus_ornatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Paralepidotus_sp_Vertova.JPG","page_title":"Paralepidotus ornatus","context_page_description":"Il paralepidoto è un pesce osseo estinto, appartenente ai semionotiformi. Visse nel Triassico superiore e i suoi resti fossili sono stati ritrovati in Europa."},{"page_url":"https://es.wikipedia.org/wiki/Monasterio_de_Nuestra_Se%C3%B1ora_de_Cogullada","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Monasterio_Cogullada_Zaragoza_6.jpg","page_title":"Monasterio de Nuestra Señora de Cogullada","context_page_description":"El monasterio de Nuestra Señora de Cogullada es un monasterio situado a 4 km de la ciudad de Zaragoza.\\nEn los tiempos en que gobernaba la iglesia cesaraugustana el obispo San Braulio, se supone la aparición de la imagen de la Virgen de Cogullada, debido su descubrimiento a una milagrosa avecilla. En ese sagrado punto, edificó la basílica, donde se expuso a la pública veneración en el año 637 y en el mismo punto fundaron los capuchinos su convento en 1657. A media legua de la ciudad, a la izquierda de la carretera de Barcelona y margen derecha del río Gállego en un terreno frondosísimo, rodeado de vegas bien cultivadas y de sombrías y frescas arboledas.\\nHabiendo sido suprimidos los frailes en 1835, su iglesia actual, construida a expensas de la cofradía de la referida virgen, ha quedado bajo su cuidado y dirección, la que celebra todos los años su festividad el día segundo de Pascua de Pentecostés y aumentada la concurrencia con tal motivo, sus frondosas arboledas, fecundadas por el Gállego, prestaban aliciente a solitarios paseos y bulliciosas romerías. La mayor parte de las familias de Zaragoza pasaban en este sitio días de campo."},{"page_url":"https://eo.wikipedia.org/wiki/Banto","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Pink_Bow.jpg","page_title":"Banto","context_page_description":"Banto estas ornamcela nodo en rubando aŭ alia aĵo. Ĝi havas du buklojn. Fakte ĝi estas sama kiel ŝunodo. Ĝi estas uzata interalie en bantokravato kaj hararanĝoj. Knabinoj havis dum la 1950-aj jaroj ofte banton en la hararo."},{"page_url":"https://pl.wikipedia.org/wiki/Paulo_Roberto_Falc%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Paulo_Roberto_Falc%C3%A3o%2C_Roma_1983-84.jpg","page_title":"Paulo Roberto Falcão","context_page_description":"Paulo Roberto Falcão, brazylijski piłkarz, grający na pozycji pomocnika.\\nFalcão rozpoczął karierę jako gracz SC Internacional, gdzie grał od 1973 do 1980, zdobywając trzy Mistrzostwa Brazylii. Falcão grał też we włoskim klubie AS Roma, gdzie zdobył Mistrzostwo Włoch oraz przegrał mecz finałowy Pucharu Mistrzów. Grał także w drużynie São Paulo FC od 1985 do 1986.\\nJako pomocnik grał w reprezentacji Brazylii na mistrzostwach świata w Hiszpanii 1982 i mistrzostwach świata w Meksyku 1986.\\nUznany za jednego ze 100 Najlepszych Żyjących Piłkarzy FIFA.\\nOd 1990 do 1991 był selekcjonerem reprezentacji Brazylii."},{"page_url":"https://sl.wikipedia.org/wiki/Miran_Zupan%C4%8Di%C4%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Miran_Zupan%C4%8Di%C4%8D_2013.jpg","page_title":"Miran Zupančič","context_page_description":"Miran Zupančič, slovenski smučarski skakalec, * 11. november 1989.\\nZupančič je član kluba SK Zagorje. V celinskem pokalu je dosegel deset uvrstitev na stopničke, zmagal je na dveh tekmah, 16. januarja 2015 v Sapporu in 15. januarja 2017 v Garmisch-Partenkirchnu. V svetovnem pokalu je prvič nastopil na tekmi v smučarskih poletih v Harrachovu, ko je zasedel 39. mesto."},{"page_url":"https://fr.wikipedia.org/wiki/Matthew_Stevens_(snooker)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/89/Matthew_Stevens_PHC_2012.jpg","page_title":"Matthew Stevens (snooker)","context_page_description":"Matthew Stevens est un joueur de snooker gallois, né le 11 septembre 1977 à Carmarthen.\\nProfessionnel depuis 1994, ses principales performances sont une victoire au championnat du Royaume-Uni en 2003, contre Stephen Hendry et au Masters 2000, contre Ken Doherty.\\nStevens fait partie des joueurs dits « malheureux finalistes » des championnats du monde de snooker, avec deux finales perdues en 2000 contre Mark Williams et en 2005 contre Shaun Murphy, également 18-16. Il a par ailleurs perdu deux finales de suite au championnat du Royaume-Uni, en 1998 et 1999, contre John Higgins et Mark Williams. Il compte ainsi une seule victoire en tournoi classé pour huit finales disputées.\\nAu cours de la saison 2005-2006, Stevens s'est propulsé au 4ᵉ échelon du classement mondial ; son meilleur en carrière."},{"page_url":"https://it.wikipedia.org/wiki/Storia_della_Sardegna_bizantina","image_url":"https://upload.wikimedia.org/wikipedia/it/0/03/Iscrizione_bizantina_Porto_Torres.png","page_title":"Storia della Sardegna bizantina","context_page_description":"L'età bizantina nella storia sarda si fa iniziare convenzionalmente con la riconquista da parte di Giustiniano nel 534 che mise fine dopo circa ottant'anni all'età vandalica. A quella data, però, si mantenne una continuità sostanziale con la fase romana. L'invasione dei Longobardi, che mutò il volto dell'Italia, non toccò la Sardegna anche se vi sono nell'isola tracce della loro presenza documentate dal ritrovamento di diversi oggetti. L'Impero bizantino era uno Stato autocratico ed intorno alla figura dell'imperatore ruotava tutta l'amministrazione. Oltre che capo supremo dell'esercito era anche capo della Chiesa, il suo trono però non era ereditario ma elettivo per acclamazione del senato, dell'esercito e del popolo che se tradito aveva il diritto legale a ribellarsi. Molte di queste istituzioni saranno fatte proprie dai regni giudicali."},{"page_url":"https://sv.wikipedia.org/wiki/K%C5%99t%C4%9Bnov","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/K%C5%99t%C4%9Bnov_vlajka.jpg","page_title":"Křtěnov","context_page_description":"Křtěnov är en ort i Tjeckien. Den ligger i länet Södra Mähren, i den östra delen av landet, 160 km öster om huvudstaden Prag. Křtěnov ligger 527 meter över havet och antalet invånare är 211.\\nTerrängen runt Křtěnov är huvudsakligen kuperad, men den allra närmaste omgivningen är platt. Den högsta punkten i närheten är [[Kopaniny [Olešnice]]], 688 meter över havet, 2,1 km nordväst om Křtěnov. Runt Křtěnov är det ganska glesbefolkat, med 31 invånare per kvadratkilometer. Närmaste större samhälle är Boskovice, 18,5 km öster om Křtěnov. I omgivningarna runt Křtěnov växer i huvudsak blandskog.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 7 °C. Den varmaste månaden är juli, då medeltemperaturen är 18 °C, och den kallaste är december, med -8 °C. Genomsnittlig årsnederbörd är 896 millimeter. Den regnigaste månaden är juni, med i genomsnitt 110 mm nederbörd, och den torraste är mars, med 33 mm nederbörd."},{"page_url":"https://en.wikipedia.org/wiki/Jack_Rodwell","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Jack_Rodwell_2013_%28cropped%29.jpg","page_title":"Jack Rodwell","context_page_description":"Jack Christian Rodwell is an English professional footballer who plays as a defender or defensive midfielder for Premier League club Sheffield United.\\nRodwell joined Everton's academy at the age of seven, and made his debut in 2007. He spent five years in the first team before he transferred to Premier League champions Manchester City in 2012. After making only 16 league appearances in two seasons, Rodwell was sold to Sunderland in August 2014. After his contract with Sunderland was terminated in June 2018, Rodwell joined Blackburn Rovers in August on a one-year deal. He left Blackburn the following year, later joining Sheffield United in January 2020.\\nRodwell has represented England at all levels from under-16 to the senior team. He made his senior international debut as a substitute in a 1–0 win over Spain at Wembley Stadium in November 2011."},{"page_url":"https://eo.wikipedia.org/wiki/Br%C3%A9ville-sur-Mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/FranceNormandieBrevilleSurMerEglise.jpg","page_title":"Bréville-sur-Mer","context_page_description":"Bréville-sur-Mer estas franca komunumo situanta en departemento Manche, regiono Normandio.\\nĜiaj enloĝantoj nomiĝas Brévillais."},{"page_url":"https://vi.wikipedia.org/wiki/Tomopterna_cryptotis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Tomopterna_cryptotis.jpeg","page_title":"Tomopterna cryptotis","context_page_description":"Tomopterna cryptotis là một loài ếch trong họ Ranidae.\\nNó được tìm thấy ở Angola, Botswana, Cameroon, Djibouti, Eritrea, Ethiopia, Kenya, Lesotho, Malawi, Mali, Mauritanie, Mozambique, Namibia, Niger, Nigeria, Senegal, Somalia, Nam Phi, Sudan, Swaziland, Tanzania, Uganda, Zambia, Zimbabwe, có thể cả Bénin, có thể cả Burkina Faso, có thể cả Cộng hòa Trung Phi, có thể cả Chad, và có thể cả Guinea.\\nCác môi trường sống tự nhiên của chúng là xavan khô, vùng đất có cây bụi nhiệt đới hoặc cận nhiệt đới, đồng cỏ khô nhiệt đới hoặc cận nhiệt đới vùng đất thấp, đồng cỏ nhiệt đới hoặc cận nhiệt đới vùng đất cao, đầm nước ngọt có nước theo mùa, và suối nước ngọt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%BB%D1%81%D0%B1%D0%BE%D1%80%D0%B8_(%D0%BE%D0%B1%D1%89%D0%B8%D0%BD%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Karlsborg_Municipality_in_V%C3%A4stra_G%C3%B6taland_County.png","page_title":"Карлсбори (община)","context_page_description":"Община Карлсбори е разположена в лен Вестра Йоталанд, югозападна Швеция с обща площ 801 km² и население 6757 души. Административен център на община Карлсбори е едноименния град Карлсбори."},{"page_url":"https://en.wikipedia.org/wiki/Calgary_Hitmen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Hitmenwalloffame.jpg","page_title":"Calgary Hitmen","context_page_description":"The Calgary Hitmen are a major junior ice hockey team based in Calgary, Alberta, Canada. The Hitmen play in the Central Division of the Western Hockey League. They play their home games at the Scotiabank Saddledome. Bret \\"The Hitman\\" Hart, a local-born professional wrestler, was a founding owner as well as the inspiration for the team's name. Established in 1994, the team has been owned by the Calgary Flames hockey club since 1997. They are the third WHL team to represent Calgary, preceded by the Centennials and Wranglers.\\nThe Hitmen have finished with the best record in the WHL four times, and qualified for the playoffs for thirteen consecutive seasons between 1998 and 2010. In 1999, they became the first Calgary team to win the President's Cup as league champions, and the first to represent the city in the Memorial Cup since the Calgary Canadians won the national junior title in 1926. The Hitmen hold numerous WHL attendance records, and in 2004–05 became the first team in Canadian Hockey League history to average 10,000 fans per game. Thirty-nine former Hitmen players have gone on to play in the National Hockey League."},{"page_url":"https://en.wikipedia.org/wiki/Nakano_Station_(Nagano)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Ueda-Nakano-Sta.JPG","page_title":"Nakano Station (Nagano)","context_page_description":"Nakano Station is a railway station in the city of Ueda, Nagano, Japan, operated by the private railway operating company Ueda Electric Railway."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%84%D9%85_%D8%A7%D9%84%D9%83%D9%88%D8%A7%D9%83%D8%A8_%D8%AE%D8%A7%D8%B1%D8%AC_%D8%A7%D9%84%D9%85%D8%AC%D9%85%D9%88%D8%B9%D8%A9_%D8%A7%D9%84%D8%B4%D9%85%D8%B3%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Dopspec-inline.gif","page_title":"علم الكواكب خارج المجموعة الشمسية","context_page_description":"علم كواكب خارج المجموعة الشمسية أو علم كواكب خارج نظام الشمسي، هو حقل متكامل من العلوم الفلكية مخصص للبحث ودراسة الكواكب الخارجية. ويشمل حقول متداخلة منهجية من عدة تخصصات التي تشمل علم الأحياء الفلكي والفيزياء الفلكية وجيولوجيا كوكبية، الكيمياء الفلكية، الجيوكيمياء، وعلم الكواكب."},{"page_url":"https://es.wikipedia.org/wiki/Iv%C3%A1n_Frank%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Iv%C3%A1n_Frank%C3%B3_y_su_esposa%2C_Olha_Khoruzhynska.jpg","page_title":"Iván Frankó","context_page_description":"Iván Yákovych Frankó nació en Nahuiévychi, Reino de Galitzia y Lodomeria, Imperio austrohúngaro - ahora distrito de Drogóbich, región de Leópolis, Ucrania - el 27 de agosto de 1856 y falleció en Leópolis, Imperio austrohúngaro, el 28 de mayo de 1916. Era a la vez prosista, poeta y dramaturgo; crítico literario, editor y periodista; lingüista, folklorista, etnógrafo, historiador y filósofo, publicista en algunos ámbitos de economía, derecho, psicología, estudios bíblicos y otras ramas del conocimiento.\\nFue también un político destacado y activista cívico, una de las personalidades más influyentes, junto con Tarás Shevchenko, en la configuración de la nación política ucraniana a partir de tesis integradoras.\\nUno de los traductores ucranianos más importantes del s.XIX, considerado padre de la traductología ucraniana moderna.​ Tradujo al ucraniano y adaptó a más de 200 autores de 37 literaturas nacionales y que escribieron en 14 idiomas, entre los que constan grandes personalidades de la literatura como Shakespeare, Byron, Cervantes, Calderón de la Barca, Dante, Victor Hugo, Mickiewicz, Dostoyevski, Goethe o Schiller, clásicos del Antiguo Egipto, la India, etc."},{"page_url":"https://vi.wikipedia.org/wiki/Poly(vinyl_clorua)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/JiminyPicketVinylFence.jpg","page_title":"Poly(vinyl clorua)","context_page_description":"Polyvinylclorua là một loại nhựa nhiệt dẻo được tạo thành từ phản ứng trùng hợp vinylclorua."},{"page_url":"https://ru.wikipedia.org/wiki/The_Purple_Album","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/WhitesnakeliveNewHavenConnecticut.JPG","page_title":"The Purple Album","context_page_description":"The Purple Album — двенадцатый студийный альбом британо-американской хард-рок группы Whitesnake, состоящий из по-новому исполненных песен группы Deep Purple, которые были написаны составами Mark III and Mark IV, когда лидер Whitesnake Дэвид Ковердейл был вокалистом этой группы."},{"page_url":"https://de.wikipedia.org/wiki/Auguste_Distave","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Auguste_Distave_Vuurtoren.jpg","page_title":"Auguste Distave","context_page_description":"Auguste Distave war ein belgischer Kunstlehrer und Graphiker der ersten Hälfte des zwanzigsten Jahrhunderts. Er wirkte in den Jahren zwischen den Weltkriegen in der Stadt Oostende."},{"page_url":"https://hu.wikipedia.org/wiki/Ursula_Andress","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Ursula_Andress_1950s.jpg","page_title":"Ursula Andress","context_page_description":"Ursula Andress svájci színésznő."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%95%D7%A1%D7%A3_%D7%91%D7%A8%D7%A0%D7%A8%D7%93_%D7%91%D7%95%D7%A8%D7%9E%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Jbborman.jpg","page_title":"יוסף ברנרד בורמן","context_page_description":"יוסף ברנרד בּוֹרמן היה רופא וחוקר ישראלי בתחום כירורגיית לב-חזה, פרופסור בבית הספר לרפואה של האוניברסיטה העברית בירושלים, מחלוצי ניתוחי הלב הפתוח והשתלות הלב בישראל. ניהל במשך 22 שנה את מחלקת ניתוחי לב וחזה במרכז הרפואי הדסה, ייסד את המכון לחקר כירורגיית הלב במרכז הרפואי הדסה ועמד בראשו, והקים את מחלקת ניתוחי הלב בבית החולים ביקור חולים. מורם וחונכם של רבים ממנתחי הלב הבכירים בישראל. מחקריו ועבודותיו הקליניות זכו להכרה בינלאומית רחבה, והוא כיהן כנשיא האגודה הבינלאומית של מנתחי לב-חזה."},{"page_url":"https://de.wikipedia.org/wiki/V%C3%A4in%C3%B6_Tanner","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Ministers_-_martures.jpeg","page_title":"Väinö Tanner","context_page_description":"Väinö Alfred Tanner war ein finnischer Politiker und Ministerpräsident."},{"page_url":"https://it.wikipedia.org/wiki/Chicago_Bears","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Gale_Sayers.jpg","page_title":"Chicago Bears","context_page_description":"I Chicago Bears sono una squadra professionistica di football americano della National Football League, con sede a Chicago, nell'Illinois. Competono nella North Division della National Football Conference. La squadra ha vinto nove campionati. I Bears detengono i record per il maggior numero di membri indotti nella Pro Football Hall of Fame, 27, e di numeri di maglia ritirati, 15. Inoltre hanno vinto più partite nella stagione regolare di qualsiasi altra squadra della NFL, oltre 850. Al 2019, secondo la rivista Forbes, il valore dei Bears è di circa 3,45 miliardi di dollari, sesti tra le franchigie della NFL"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9F%E3%83%89%E3%83%AB%E3%83%BB%E3%83%91%E3%83%83%E3%82%BB%E3%83%BC%E3%82%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Slave_ship_diagram.png","page_title":"ミドル・パッセージ","context_page_description":"ミドル・パッセージとは、大西洋間奴隷貿易において、アフリカの黒人奴隷たちを奴隷船に乗せて南北両アメリカ大陸へと運んだ道筋を指す言葉である。何百万人ものアフリカの人々が「ミドル・パッセージ」を通って、南北両アメリカ大陸へと船上輸送された。\\n奴隷船における黒人奴隷たちへの扱いが苛酷を極めたため、その15％がミドル・パッセージで死亡した。さらに多くの者がアフリカを発つ前、奴隷商人に拉致されるときや奴隷船への乗船を強制されるときなどに殺害された。最高で200万人のアフリカ人がミドル・パッセージ中に死亡したと考える歴史研究者もいる。それでも940万人から1200万人までの間のいずれかの数のアフリカ人がミドル・パッセージを生き延び、奴隷として南北両アメリカ大陸に到着した。"},{"page_url":"https://uk.wikipedia.org/wiki/Dodge","image_url":"https://upload.wikimedia.org/wikipedia/uk/c/c0/Dodge_Brothers.jpg","page_title":"Dodge","context_page_description":"Dodge — американська автомобілебудівна компанія в складі корпорації Крайслер, яка спеціалізується на випуску легкових автомобілів, пікапів, мінівенів та спортивних автомобілів. Штаб-квартира розташована в Гайленд-парку.\\nСьогодні, разом з легковими автомобілями, під маркою Dodge випускаються також позашляховики, мінівени і пікапи. Логотип компанії Dodge регулярно мінявся, але найчастіше, як і в наш час в емблемі фігурувала голова барана. По одній з версій, причиною цьому була одна з моделей Dodge, зігнутий вихлопний колектор якої нагадував виті роги гірського барана.\\nУ складі корпорації Chrysler, Dodge виділяється своїм спортивно-позашляховим іміджем. Легковий асортимент Dodge повністю копіює такі від компаній Chrysler і Plymouth, зате позашляховики фірми випускаються лише під однією маркою.\\nОчевидно, завдяки цьому факту, а також безперечній зовнішній привабливості моделей Dakota, Durango і Ram, ім'я Dodge асоціюється з позашляховиками і, звичайно ж, спортивний суперавтомобіль Viper, що випускається як спортивне купе"},{"page_url":"https://simple.wikipedia.org/wiki/Abigail_Adams","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Abigail-adams.jpg","page_title":"Abigail Adams","context_page_description":"Abigail Smith Adams was the wife of John Adams, the second President of the United States. Later on, people started to address the wife of the president as the First Lady. So, she became the second First Lady of the United States. She was born in Weymouth, Massachusetts. She belonged to a famous family of Massachusetts.\\nIn 1801, the couple retired and lived in Quincy. Abigail died in 1818, at age 74 of typhoid fever."},{"page_url":"https://en.wikipedia.org/wiki/Andy_Abraham","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Andy_Abraham_-_ESC_2008.jpg","page_title":"Andy Abraham","context_page_description":"Andrew Abraham is a British singer. He was the runner-up in the second UK series of TV talent show The X Factor in 2005 to Shayne Ward, and also represented the United Kingdom in the Eurovision Song Contest 2008.\\nBefore applying for The X Factor, Abraham was a refuse collector. Prior to this, he worked as a bus driver for Arriva London North based at Palmers Green bus garage. Abraham has two children by his wife Denise, a daughter called Tara and a son called Jacob. He is of Grenadian descent."},{"page_url":"https://sco.wikipedia.org/wiki/Cloud_computing","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Cloud_computing.svg","page_title":"Cloud computing","context_page_description":"Cloud computing is an information technology paradigm that enables ubiquitous access tae shared pools o configurable system resources an higher-level services that can be rapidly provisioned wi minimal management effort, often iver the Internet. Cloud computing relies on sharing o resoorces tae achieve coherence an economies o scale, similar tae a public utility."},{"page_url":"https://ms.wikipedia.org/wiki/Yenny_Rachman","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Yenny_Rachman_with_Citra_Award%2C_Festival_Film_Indonesia_%281982%29%2C_1983%2C_p61.jpg","page_title":"Yenny Rachman","context_page_description":"Jenny Rosyeni Rachman atau lebih dikenali sebagai Yenny Rachman merupakan seorang pelakon wanita Indonesia yang kerjayanya telah melangkau hampir 4 dekad. Antara filem-filem lakonannya ialah Akibat Pergaulan Bebas, Kabut Sutra Ungu dan biopik R.A. Kartini. Kemunculan beliau di industri filem Indonesia sezaman dengan Christine Hakim."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%88%D8%B4%DB%8C%D8%A8%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/TOSHIBA_EMI_2007.jpg","page_title":"توشیبا","context_page_description":"توشیبا شرکت خوشه‌ای ژاپنی و چندملیتی است، که در حوزه‌های تجهیزات ارتباطاتی، قطعات الکترونیکی، سیستم‌های برق، زیرساخت‌های شهری و صنعتی، لوازم خانگی، تجهیزات پزشکی، لوازم اداری و دفتری، ابزارهای روشنایی، تجهیزات نورپردازی و نیز ارائه خدمات لجیستیک فعالیت می‌نماید.\\nریشه‌های تأسیس این شرکت به سال ۱۸۷۵ و راه‌اندازی شرکت تاناکا سیزو-شا توسط تاناکا هیساشیگ بازمی‌گردد. فرم کنونی توشیبا در سال ۱۹۳۹ با ادغام شرکت‌های تاناکا سیزو-شا و توکیو دنکی شکل گرفت. هم‌اکنون توشیبا، پس از شرکت‌های اچ‌پی، دل، ایسر و لنوو، در رتبه پنجم از بزرگترین تولیدکنندگان رایانه‌های شخصی قرار دارد. این شرکت همچنین پس از شرکت‌های اینتل، سامسونگ و تگزاس اینسترومنتس، به‌عنوان چهارمین تولیدکننده نیم‌رساناها در جهان، شناخته می‌شود.\\nدفتر مرکزی شرکت توشیبا در شهر توکیو، ژاپن قرار دارد و بخشی از سهام آن در بازارهای بورس توکیو، بورس لندن، بورس ناگویا و بورس اوساکا معامله می‌شود و جزئی از شاخص نیکی ۲۲۵ و شاخص تاپیکس بشمار می‌آید."},{"page_url":"https://en.wikipedia.org/wiki/Logos_(Christianity)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/God_the_Geometer.jpg","page_title":"Logos (Christianity)","context_page_description":"In Christology, the Logos is a name or title of Jesus Christ, derived from the prologue to the Gospel of John \\"In the beginning was the Word, and the Word was with God, and the Word was God\\", as well as in the Book of Revelation, \\"And he was clothed with a vesture dipped in blood: and his name is called The Word of God.\\" These passages have been important for establishing the doctrine of the divinity of Jesus since the earliest days of Christianity.\\nAccording to Irenaeus of Lyon a student of John's disciple Polycarp, John the Apostle wrote these words specifically to refute the teachings of Cerinthus, who both resided and taught at Ephesus, the city John settled in following his return from exile on Patmos. Cerinthus believed that the world was created by a power far removed from and ignorant of the Father, and that the Christ descended upon the man Jesus at his baptism, and that strict adherence to the Mosaic Law was absolutely necessary for salvation. Therefore, Irenaeus writes,"},{"page_url":"https://no.wikipedia.org/wiki/Casiokids","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Casiokids_011.jpg","page_title":"Casiokids","context_page_description":"Casiokids er et norsk indie-/popband som ble stiftet i 2005. Bandmedlemmene er fra Stavanger og Bergen. Det er et av få norske band som har oppnådd internasjonal anerkjennelse selv om de synger på norsk.\\nNavnet kommer av at gruppen siden starten i 2005 har brukt gamle Casio-keyboards som en viktig del av lydbildet.\\nSommeren 2009 turnerte bandet både i USA og England.\\nCasiokids var et av fire artister/band som mottok «a-ha-stipendet» i forkant av a-has avskjedsturné i 2010. Stipendet er på en million norske kroner og ble delt ut for å hjelpe unge og lovende norske artister som ønsker å satse internasjonalt."},{"page_url":"https://cs.wikipedia.org/wiki/Nad%C4%9B%C5%BEda_Kaval%C3%ADrov%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Nad%C4%9B%C5%BEda_Kaval%C3%ADrov%C3%A1.jpg","page_title":"Naděžda Kavalírová","context_page_description":"Naděžda Kavalírová, rozená Morávková byla předsedkyně Konfederace politických vězňů České republiky a od prosince 2007 do prosince 2012 předsedkyně Rady Ústavu pro studium totalitních režimů."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_du_patrimoine_immobilier_class%C3%A9_de_Spa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Pavillon_de_Hesse-Rhinfels_%C3%A0_Spa.JPG","page_title":"Liste du patrimoine immobilier classé de Spa","context_page_description":"Cette page regroupe l'ensemble du patrimoine immobilier classé de la ville belge de Spa."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%81%D0%BB%D0%BE%D1%87%D0%BD%D1%8B%D0%B5_%D1%83%D0%BA%D1%80%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/%D0%95%D0%BB%D0%BE%D1%87%D0%BD%D0%BE%D0%B5_%D1%83%D0%BA%D1%80%D0%B0%D1%88%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BA%D1%83%D1%81%D1%82%D0%B0%D1%80%D0%BD%D0%BE%D0%B9_%D1%80%D0%B0%D0%B1%D0%BE%D1%82%D1%8B.JPG","page_title":"Ёлочные украшения","context_page_description":"Ёлочные украшения — шары, фигурки и иные украшения, которыми наряжают новогоднюю ёлку, а также интерьер и экстерьер помещения к празднику Рождества и Нового года."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B2%D0%B8%D1%82-%D0%91%D1%80%D0%BE%D1%83%D0%BD,_%D0%91%D0%BE%D1%80%D0%B8%D1%81_%D0%9B%D0%B5%D0%BE%D0%BD%D0%B8%D0%B4%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Levit-Broun%2C_Boris.JPG","page_title":"Левит-Броун, Борис Леонидович","context_page_description":"Борис Левит-Броун, русский поэт, прозаик, художник."},{"page_url":"https://la.wikipedia.org/wiki/Litterae_Hispaniae","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/JRJimenez.JPG","page_title":"Litterae Hispaniae","context_page_description":"Litterae Hispaniae plerumque sunt litterae Hispanice scriptae intra terras quae hodie civitatem Hispaniam constituit. Cuius evolutio congruit cum et saepe intersecat alias traditiones litterarum ex regionibus intra eandem terram, praecipue litteras Cataloniae, Galiciae, et nuper Vasconiae. Primae litterae Hispanicae etiam cum litterariis paeninsulae Ibericae traditionibus Latina, Iudaica, et Arabica communicant. Praeterea, litterae Americae Hispanicae est ramus litterarum Hispanicarum magni momenti, suas proprietates habens ex primis annis colonizationis Americae Hispanicae ortas.\\nRomana paeninsulae Ibericae ex saeculo terio a.C.n. victoria et possessio culturam Latinam ad terras Ibericas tulit. territories. Adventus invasorum Islamicorum anno 711 culturas Orientis Medii et Asiae Orientalis attulit. In litteris Hispanicis medii aevi, prima nota litterarum in litteris Romanicis fundata exempla culturas Islamicam, Iudaeicam, et Christianam miscent. Unum ex notissimis operibus est Cantar de mio Cid, poema epicum, anno 1140 scriptum. Prosa Hispanica populo magis magisque grata medio saeculo tertio decimo facta est."},{"page_url":"https://ceb.wikipedia.org/wiki/East_Tintic_Mountains","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Provo_skyline_winter.jpg","page_title":"East Tintic Mountains","context_page_description":"Kabukiran ang East Tintic Mountains sa Tinipong Bansa. Ang East Tintic Mountains nahimutang sa kondado sa Juab County ug estado sa Utah, sa sentro nga bahin sa nasod, 3,000 km sa kasadpan sa ulohang dakbayan Washington, D.C.\\nEast Tintic Mountains mihatag alang sa 42 km sa usa ka amihanan-habagatan nga direksyon. Ang labing taas nga punto mao ang Boulter Peak, 2,530 metros ibabaw sa dagat nga lebel.\\nAng mosunod nga mga bukid sa mga bahin sa East Tintic Mountains:\\nBig Hill\\nBismark Peak\\nBluebird Spur\\nBoulter Peak\\nBuckhorn Mountain\\nCounty Line Ridge\\nDry Ridge\\nEureka Peak\\nEureka Ridge\\nFitchville Ridge\\nGardison Ridge\\nGodiva Mountain\\nHannifin Peak\\nKeystone Ridge\\nLatite Ridge\\nLime Peak\\nLittle Hill\\nMammoth Peak\\nNorth Hill\\nOld Baldy\\nPackard Peak\\nPinyon Peak\\nQuartzite Ridge\\nRattlesnake Peak\\nRound Knoll\\nSioux Peak\\nSunrise Peak\\nTeutonic Ridge\\nThe Summit\\nTintic Mountain\\nTreasure Hill\\nVolcano Ridge"},{"page_url":"https://de.wikipedia.org/wiki/Hermann_Wasserschleben","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Hermann_Wasserschleben_Ludoviciana_1907.jpg","page_title":"Hermann Wasserschleben","context_page_description":"Friedrich Wilhelm August Hermann Wasserschleben war ein Rechtshistoriker, der sich insbesondere auf das kanonische Recht des frühen Mittelalters spezialisiert hatte. Seine kritischen Ausgaben und Analysen der kirchenrechtlichen Texte der vorgratianischen Zeit haben teilweise bis heute Bestand."},{"page_url":"https://en.wikipedia.org/wiki/Westland_Row","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Westland_Row%2C_Dublin.jpg","page_title":"Westland Row","context_page_description":"Westland Row is a street on the south side of Dublin city, Ireland, dating from the year 1776. It was originally known as Westlands after William Westland who owned property in the area in the 18th century.\\nThe street runs along the east end of Trinity College Dublin. Many research departments and Schools associated with Trinity, such as the Hitachi Dublin Laboratory and the Trinity School of Pharmacy, maintain administrative offices on the west side of the street. The eastern side of the street is dominated by Pearse Station, formerly called Westland Row Station, and the Church of St. Andrew. The Royal Irish Academy of Music is also based on the street.\\nThe Free State Intelligence Department was based at Oriel House.\\nWriter Oscar Wilde was born at 21 Westland Row, and future President of Ireland Mary Robinson and her four brothers lived there during their time as students. It is now home of the Oscar Wilde Centre.\\nThe eponymously named CBS Westand Row backs on to street, although the school entrance is on Cumberland Street."},{"page_url":"https://de.wikipedia.org/wiki/Hanns_Johst","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Bundesarchiv_Bild_183-2007-1010-501%2C_Hanns_Johst.jpg","page_title":"Hanns Johst","context_page_description":"Hanns Johst war ein deutscher Schriftsteller, Dramatiker, nationalsozialistischer Kulturfunktionär und seit 1935 Präsident der Reichsschrifttumskammer."},{"page_url":"https://pl.wikipedia.org/wiki/Lutocin_(gmina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Piramida_wieku_Gmina_Lutocin.png","page_title":"Lutocin (gmina)","context_page_description":"Lutocin – gmina wiejska w województwie mazowieckim, w powiecie żuromińskim. W latach 1975–1998 gmina położona była w województwie ciechanowskim.\\nSiedziba gminy to Lutocin.\\nWedług danych z 30 czerwca 2004 gminę zamieszkiwało 4656 osób. Według danych z 31 grudnia 2017 roku gminę zamieszkiwało 4331 osób. Natomiast według danych z 31 grudnia 2019 roku gminę zamieszkiwało 4419 osób."},{"page_url":"https://ms.wikipedia.org/wiki/Burung_Gagak_Gunung","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Cissa-chinensis-National-Zoo-2010.jpg","page_title":"Burung Gagak Gunung","context_page_description":"Burung Gagak Gunung adalah salah satu daripada haiwan yang boleh didapati di Malaysia. Nama sainsnya ialah Cissa chinensis. Ia merupakan ahli keluarga gagak."},{"page_url":"https://pt.wikipedia.org/wiki/Bouyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Bouyon.jpg","page_title":"Bouyon","context_page_description":"Bouyon é uma comuna francesa na região administrativa da Provença-Alpes-Costa Azul, no departamento Alpes Marítimos. Estende-se por uma área de 12,29 km², com 352 habitantes, segundo os censos de 1999, com uma densidade de 28 hab/km²."},{"page_url":"https://es.wikipedia.org/wiki/Lamashtu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Lamashtu_plaque_9162.jpg","page_title":"Lamashtu","context_page_description":"Lamashtu o Labartu, llamada también Dimme era un demonio femenino en la mitología de los pueblos mesopotámicos. Era un demonio sumamente maligno, y por tanto muy temido.​"},{"page_url":"https://nl.wikipedia.org/wiki/Alexandrine_Tinne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Gezicht_op_het_Tournooiveld_vanaf_de_Hoge_Nieuwstraat_naar_de_Korte_Vijverberg%2C_door_Alexine_Tinne.jpg","page_title":"Alexandrine Tinne","context_page_description":"Alexandrine \\"Alexine\\" Pieternella Françoise Tinne was een Nederlandse ontdekkingsreizigster die in 1862 en 1863 als eerste westerse vrouw in Centraal-Afrika doordrong en vervolgens in 1868/69 ook als de eerste westerse vrouw ver in de Sahara reisde. Ook was ze Nederlands eerste belangrijke fotografe. Van locaties in Den Haag en het interieur van haar huis aan het Lange Voorhout maakte ze in de zomer 1860 en winter 1860/61 een veertigtal foto's van groot formaat.\\nIn het World Museum te Liverpool wordt een belangrijke verzameling etnografische voorwerpen uit Centraal- en Noord-Afrika van haar bewaard."},{"page_url":"https://fr.wikipedia.org/wiki/Prinzenmoor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Prinzenmoor_Wappen.png","page_title":"Prinzenmoor","context_page_description":"Prinzenmoor est une commune allemande de l'arrondissement de Rendsburg-Eckernförde, Land de Schleswig-Holstein."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%96%E0%A4%B0%E0%A4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Muntic_ladonja.jpg","page_title":"खरक","context_page_description":"खरक या खर्ग या खिर्क या रोकू एक पतझड़ी वृक्ष है जो २० से २५ मीटर तक उग सकता है। यह रेतीली ज़मीन में और समशीतोष्ण इलाक़ों में तेज़ी से उगता है। इसका निवास क्षेत्र भारत, पाकिस्तान, तुर्की, बाल्कन क्षेत्र, इटली और फ़्रांस है, हालांकि यह दुनिया की अन्य जगहों पर भी फैल गया है। इसे पंजाबी भाषा में ब्रमजी और कश्मीरी भाषा में ब्रिमिज भी कहा जाता है। यह पेड़ छाया में नहीं उग सकता और केवल सूरज की सीधी रोशनी में ही पनपता है। भारत में यह हिमालय के मंझले क्षेत्रों में तो उगता ही है, लेकिन साथ ही साथ दिल्ली जैसे क्षेत्रों में भी मिलता है, हालांकि कुछ जीववैज्ञानिकों के अनुसार या वृक्ष दिल्ली की गर्मियों को नहीं झेल सकता और वहाँ मिलने वाला पेड़ 'सेल्टिस ऑस्ट्रालिस' जाति का नहीं बल्कि उस से मिलती-जुलती 'सेल्टिस टेट्रान्ड्रा' जाति का है।"},{"page_url":"https://hu.wikipedia.org/wiki/Beuzeville-au-Plain","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Population_-_Municipality_code_50051.svg","page_title":"Beuzeville-au-Plain","context_page_description":"Beuzeville-au-Plain település Franciaországban, Manche megyében. Beuzeville-au-Plain Ravenoville, Foucarville, Saint-Germain-de-Varreville, Sainte-Mère-Église és Turqueville községekkel határos."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BB%D0%BE%D0%BD%D0%B4%D0%B5%D0%BB%D1%8C,_%D0%A4%D1%80%D0%B0%D0%BD%D1%81%D1%83%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Frontispiz_Cours_d%27architecture_Francois_Blondel_1698.jpg","page_title":"Блондель, Франсуа","context_page_description":"Никола-Франсуа Блондель Старший, «Великий» — французский архитектор и дипломат, бригадный генерал. Военный и гражданский инженер, математик, строитель фортификационных сооружений. Автор знаменитого «Курса архитектуры». Один из крупнейших теоретиков классицистической архитектуры эпохи «большого стиля» короля Людовика XIV. Один из участников «Спора о древних и новых». Франсуа Блонделя называли «Великим Блонделем», дабы отличать его от других членов выдающейся династии французских архитекторов."},{"page_url":"https://de.wikipedia.org/wiki/Haus_Rothenberge","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Rothenberge-Wettringen.jpg","page_title":"Haus Rothenberge","context_page_description":"Das Haus Rothenberge ist ein denkmalgeschütztes Profangebäude in Rothenberge, einem Ortsteil von Wettringen, im Kreis Steinfurt."},{"page_url":"https://es.wikipedia.org/wiki/Ermita_de_Santa_Mar%C3%ADa_(Chalamera)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Chalamera_-_Ermita_de_Santa_Mar%C3%ADa_-_Portada.jpg","page_title":"Ermita de Santa María (Chalamera)","context_page_description":"La ermita de Santa María es una ermita románica de Chalamera, situada a medio camino entre Chalamera y Alcolea de Cinca, cerca de la confluencia de los ríos Cinca y Alcanadre.​ Antiguamente era un priorato que se encontraba en el Camino de Santiago, en el ramal que salía de Cataluña y se dirigía a Sigena, en Aragón.\\nAparece documentada antes de la conquista cristiana, por lo que se supone que ya debía de existir en tiempos islámicos o incluso antes. Después perteneció al obispado de Roda y al monasterio de Santa María de Alaón.​ El edificio actual conservado es uno de los monumentos más importantes de la comarca del Bajo Cinca. Fue construida por los templarios de Monzón hacia finales del siglo XII.\\nLa planta es de cruz latina, con una única nave de tres tramos y triple cabecera, rematada en ábsides semicirculares visibles sólo desde el interior. La puerta principal, que se abre a los pies de la nave, tiene seis arquivoltas sostenidas por seis pares de columnas con capiteles con figuras humanas y animales que representan temas bíblicos y simbólicos. Encima hay un ventanal con arco de medio punto."},{"page_url":"https://fr.wikipedia.org/wiki/Biodiversit%C3%A9_marine_des_lagons_de_La_R%C3%A9union","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Cuthona_sp.jpg","page_title":"Biodiversité marine des lagons de La Réunion","context_page_description":"L'île de La Réunion est un département d'outre-mer français situé dans le sud-ouest de l'océan Indien.\\nC'est une île volcanique relativement jeune en forme caractéristique de cône, dont la base se situe directement sur le plancher océanique, ce qui explique son isolement. Sa jeunesse est la cause de la faible surface occupée par les formations coralliennes, âgées de 8 000 ans, se présentant pour la plupart sous la forme de récifs frangeants.\\nCes formations délimitent des « lagons » peu profonds dont le plus grand ne dépasse pas 500 m de large, pour 1 à 2 m de fond environ. Ces lagons, qui forment une ceinture récifale discontinue de 25 km de long pour une surface totale de 12 km², sont situés sur la côte ouest et sud-ouest de l’île.\\nLes plus importants sont ceux de L’Hermitage, St Leu, L'Étang-Salé et St Pierre.\\nMais il existe aussi des plates-formes récifales attenantes à ces lagons ou isolées, de taille plus modeste et dont la barrière est souvent rocailleuse.\\nLes platiers sont étroits et les tombants en arrière des barrières coralliennes plongent rapidement à des profondeurs importantes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D1%81%D0%B0%D0%BC%D0%BF%D1%80%D0%BE%D0%BD-%D0%9B%D1%96%D0%B1%D0%BE%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Mairie_Monsempron-Libos.JPG","page_title":"Монсампрон-Лібос","context_page_description":"Монсампро́н-Лібо́с — муніципалітет у Франції, у регіоні Нова Аквітанія, департамент Лот і Гаронна. Населення — 2045 осіб.\\nМуніципалітет розташований на відстані близько 500 км на південь від Парижа, 130 км на схід від Бордо, 45 км на північний схід від Ажена."},{"page_url":"https://tl.wikipedia.org/wiki/Pambansang_Unibersidad_ng_Malaysia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Ukm2.jpg","page_title":"Pambansang Unibersidad ng Malaysia","context_page_description":"Ang Pambansang Unibersidad ng Malaysia ay isang pampublikong unibersidad na matatagpuan sa Bangi, Selangor na 35 kilometro sa timog ng Kuala Lumpur. Ang ospital sa pagtuturo ng unibersidad, ang Pusat Perubatan Universiti Kebangsaan Malaysia ay matatagpuan sa Cheras at meron ding sangay na campus sa Kuala Lumpur. Merong 17,500 undergraduate na mag-aaral na nakaenrol, at 5,105 postgraduate na mag-aaral na kung saan 1,368 ay mga banyagang mag-aaral mula sa 35 bansa.\\nAng Universiti Kebangsaan Malaysia ay isa sa limang mga unibersidad sa pananaliksik sa bansa. Ito ay nararanggo bilang ika-259 sa mundo ng QS World University Rankings para sa taong 2014. Ito ay nararanggong ika-98 sa 100 mga pinakamahusay na bagong unibersidad na itinatag sa loob ng huling 50 taon sa mundo. Ito ay ang tanging unibersidad mula sa Malaysia na nakapasok sa 2012 Quacquarelli Symonds Top 50 Universities Under 50 Years Old na may ranggong ika-31. Ito ay nairanggong ika-56 at ika-56 sa QS Top 500 Asian University Rankings para sa taong 2014 at 2015, ayon sa pagkakabanggit."},{"page_url":"https://pl.wikipedia.org/wiki/Rejon_krasnokutski","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Krasnokutskyi-Raion.png","page_title":"Rejon krasnokutski","context_page_description":"Rejon krasnokutski – rejon na Ukrainie, znajdujący się w północno-zachodniej części obwodu charkowskiego.\\nRejon utworzono w 1923, jego powierzchnia wynosi 1011 km², ludność w 2004 liczyła 31 354 osoby. Siedzibą władz rejonowych jest Krasnokutśk.\\nW skład rejonu wchodzą 2 osiedla typu miejskiego i 11 rad wiejskich, w których skład wchodzi 48 wsi i 16 przysiółków."},{"page_url":"https://en.wikipedia.org/wiki/The_Mystic_Marriage_of_St_Catherine_(Annibale_Carracci)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Annibale_Carracci_-_The_Mystic_Marriage_of_St_Catherine_-_WGA4423.jpg","page_title":"The Mystic Marriage of St Catherine (Annibale Carracci)","context_page_description":"The Mystic Marriage of St Catherine is a c.1585 oil on canvas painting by Annibale Carracci, now in the Gallerie Nazionali di Capodimonte in Naples, Italy. The composition and sfumato effect owe much to Corregio, particularly the latter's painting of the same subject now in the Louvre.\\nAs shown by the label on the reverse, the work formed part of the Farnese collection, where it was mentioned by Carlo Cesare Malvasia and Giovanni Pietro Bellori, with the latter stating that Carracci painted the work in Parma \\"for duke Ranuccio [Farnese] before taking it to Rome \\"in the duke's name\\" to give to cardinal Odoardo Farnese."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%A9%E3%82%A4%E3%83%B3%E3%82%B0%E3%83%95%E3%82%A3%E3%83%83%E3%82%B7%E3%83%A5_(%E6%BD%9C%E6%B0%B4%E8%89%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/USS_Flying_Fish%3B0822903.jpg","page_title":"フライングフィッシュ (潜水艦)","context_page_description":"フライングフィッシュ は、アメリカ海軍の潜水艦。ガトー級潜水艦の一隻。艦名はトビウオ科の総称に因む。その名を持つ艦としては2隻目。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%84%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%A7%DB%8C%D8%B1%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Khoda.jpg","page_title":"پل‌های ایران","context_page_description":"فهرست پل‌های ایران به ترتیب تاریخ:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%B8%D0%BE%D0%B0%D0%BD%D0%BD%D0%B8%D1%82%D0%BE%D0%B2_%D0%B2_%D0%9B%D0%B0%D0%B3%D1%83%D0%B2%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/18333_Lagow_zamek_1.JPG","page_title":"Замок иоаннитов в Лагуве","context_page_description":"Замок иоаннитов в Лагуве находится в селе Лагув, в Любуском воеводстве, на перешейке между озерами: Лаговское и Чеч.\\nВозведен иоаннитами в XIV веке в готическом стиле, достроен в XVI—XVIII веке. В 1810 году был резиденцией их командорства. В XIX веке принадлежал частному владельцу. В 1964—1970 годах был реставрирован.\\nЧетырехугольный в плане, имеет угловую высокую башню 35-и метров с квадратным основанием, с которой хорошо видно село, озера, окружающие холмы и леса. Сохранились периферийные стены, также в готическом стиле. Внутри замка сохранился зал с готическим сводом, подпертым одним столбом, и рыцарский зал, в котором можно увидеть камин в стиле барокко, построенный в 1740 году. В настоящее время в замке расположен отель."},{"page_url":"https://en.wikipedia.org/wiki/Peregrine_falcon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/PeregrineTubercle.jpg","page_title":"Peregrine falcon","context_page_description":"The peregrine falcon, also known as the peregrine, and historically as the duck hawk in North America, is a widespread bird of prey in the family Falconidae. A large, crow-sized falcon, it has a blue-grey back, barred white underparts, and a black head. The peregrine is renowned for its speed, reaching over 320 km/h during its characteristic hunting stoop, making it the fastest bird in the world, as well as the fastest member of the animal kingdom. According to a National Geographic TV program, the highest measured speed of a peregrine falcon is 389 km/h. As is typical for bird-eating raptors, peregrine falcons are sexually dimorphic, with females being considerably larger than males. According to one study, it has the fastest visual processing speed of any animal tested so far, and can register discrete changes up to 129 Hz or cycles per second. Analogically, film is a series of still images projected onto a screen. Those still images need to be changing at roughly 24 frames per second before humans see them as fluid and no longer as individual, discrete pictures."},{"page_url":"https://pl.wikipedia.org/wiki/Coudray-Rabut","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Coudray-Rabut_-_mairie.jpg","page_title":"Coudray-Rabut","context_page_description":"Coudray-Rabut – miejscowość i dawna gmina we Francji, w regionie Normandia, w departamencie Calvados. W 2013 roku populacja ówczesnej gminy wynosiła 313 mieszkańców.\\nDnia 1 stycznia 2019 roku połączono dwie wcześniejsze gminy: Pont-l’Évêque oraz Coudray-Rabut. Siedzibą gminy została miejscowość Pont-l’Évêque, a nowa gmina przyjęła jej nazwę."},{"page_url":"https://es.wikipedia.org/wiki/%C3%89vecquemont","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/%C3%89vecquemont_Mairie.JPG","page_title":"Évecquemont","context_page_description":"Évecquemont es una población y comuna francesa, en la región de Isla de Francia, departamento de Yvelines, en el distrito de Mantes-la-Jolie y cantón de Meulan."},{"page_url":"https://en.wikipedia.org/wiki/Biblioteca_Vasconcelos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Fachada_de_la_Biblioteca_Vasconcelos_Buenavista_Ciudad_de_M%C3%A9xico.jpg","page_title":"Biblioteca Vasconcelos","context_page_description":"Mexico City's Biblioteca Vasconcelos, also known as Biblioteca Vasconcelos or else la Biblioteca Vasconcelos or la Vasconcelos and labeled by the press as the Megabiblioteca, is a library in the downtown area of Mexico City. It was dedicated to José Vasconcelos, the philosopher and former presidential candidate and former president of the National Library of Mexico. The library is spread across 38,000 square metres and had an initial planned cost of 954 million pesos. The Congress of Mexico proposed plans to reduce the budget of 2006 that included cuts for all three branches of government. National Action Party presented an alternative budget that preserved funds for Enciclomedia and the Vasconcelos Library.\\nThe library is located in downtown Delegación Cuauhtémoc at the Buenavista train station where the metro, suburban train, and metrobus meet. It is adorned by several sculptures by Mexican artists, including Gabriel Orozco's Ballena, prominently located at the centre of the building."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98%C3%ADmskokatolick%C3%A1_farnost_Myslejovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Myslejovice_kostel.jpg","page_title":"Římskokatolická farnost Myslejovice","context_page_description":"Římskokatolická farnost Myslejovice je uzemní společenství římských katolíků v arcidiecézi olomoucké."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D0%B1%D0%B5%D1%80%D0%BD%D0%B0%D1%82%D0%BE%D1%80_%D0%93%D0%BE%D0%BD%D0%BA%D0%BE%D0%BD%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/SirWilliamPeelHK.jpg","page_title":"Губернатор Гонконгу","context_page_description":"Губернатор Гонконгу — офіційний представник монарха Великої Британії в Британському Гонконгу з 1843 по 1997 роки. Губернатор був головою Виконавчої ради Гонконгу і головнокомандувачем частинами британської армії в Гонконзі. Повноваження губернатора були визначені спеціальними документами, затвердженими британським монархом — Hong Kong Letters Patent і Hong Kong Royal Instructions. Після закінчення британського правління при передачі суверенітету над Гонконгом КНР в 1997 році, більшість цивільних функцій губернатора перейшли головному міністру Адміністрації Гонконгу рос., а військові — командувачу гонконгським гарнізоном Народно-визвольної армії Китаю."},{"page_url":"https://ca.wikipedia.org/wiki/Mal%C3%A1_Ma%C4%8Da","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Mala_Maca_kostol.jpg","page_title":"Malá Mača","context_page_description":"Malá Mača és un poble d'Eslovàquia que es troba a la regió de Trnava."},{"page_url":"https://de.wikipedia.org/wiki/100_of_the_World%E2%80%99s_Worst_Invasive_Alien_Species","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Starr_050610_2340_anoplolepis_gracilipes.jpg","page_title":"100 of the World’s Worst Invasive Alien Species","context_page_description":"100 of the World’s Worst Invasive Alien Species ist eine von der Invasive Species Specialist Group der IUCN herausgegebene Liste mit 100 als besonders problematisch angesehenen invasiven Arten. Die Liste ist ein Auszug aus der Global Invasive Species Database, welche Einträge über zahlreiche invasive Neobiota enthält.\\nInvasive Neobiota sind der Definition zufolge „Fremde Arten, die sich in natürlichen oder halbnatürlichen Lebensräumen etabliert haben, die deren Veränderung vorantreiben und die dortige natürliche Biodiversität bedrohen“. Fremde Arten sind in diesem Zusammenhang alle Arten, die vom Menschen in Regionen außerhalb ihres natürlichen Verbreitungsgebiets eingeschleppt oder etabliert worden sind."},{"page_url":"https://en.wikipedia.org/wiki/Operation_Cycle","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/4June-12June_Battle_of_France.PNG","page_title":"Operation Cycle","context_page_description":"Operation Cycle is the name of the evacuation of Allied troops from Le Havre, in the Pays de Caux of Upper Normandy from 10–13 June 1940, towards the end of the Battle of France, during the Second World War. The operation was preceded by the better known rescue of 338,226 British and French soldiers from Dunkirk in Operation Dynamo. On 20 May, the Germans had captured Abbeville at the mouth of the Somme and cut off the main Allied armies in the north. South of the river, the Allies improvised defences and made local counter-attacks, to dislodge the Germans from bridgeheads on the south bank and re-capture river crossings for an advance northwards to regain contact with the armies in northern France and Flanders.\\nThe 1st Armoured Division arrived in France from 15 May, without artillery and less units that had been diverted to Calais. The division joined the large number of lines-of-communication troops south of the Somme, many of whom were hurriedly organised into the Beauman Division and other improvised units, despite a lack of training and weapons."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%90%E1%83%9A%E1%83%98%E1%83%9C%E1%83%98%E1%83%9C%E1%83%92%E1%83%A0%E1%83%90%E1%83%93%E1%83%98%E1%83%A1_%E1%83%AC%E1%83%9B%E1%83%98%E1%83%9C%E1%83%93%E1%83%90_%E1%83%90%E1%83%93%E1%83%90%E1%83%9A%E1%83%91%E1%83%94%E1%83%A0%E1%83%A2%E1%83%98%E1%83%A1_%E1%83%99%E1%83%98%E1%83%A0%E1%83%AE%E1%83%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Kaliningrad_05-2017_img45_Amalienau.jpg","page_title":"კალინინგრადის წმინდა ადალბერტის კირხე","context_page_description":"კალინინგრადის წმინდა ადალბერტის კირხე — ყოფილი კათოლიკური კირხე კალინინგრადში. მშენებლობა მიმდინარეობდა 1902-1904 წლებში. აგებულია ადალბერტ პრაღელის სახელზე, არქიტექტორ ფრიდრიხ ჰაიტმანის მიერ."},{"page_url":"https://en.wikipedia.org/wiki/Idaho_Army_National_Guard","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/116th_Cavalry_Brigade_CSIB.svg","page_title":"Idaho Army National Guard","context_page_description":"The Idaho Army National Guard is a component of the United States Army and the United States National Guard. Nationwide, the Army National Guard comprises approximately one half of the US Army's available combat forces and approximately one third of its support organization. National coordination of various state National Guard units are maintained through the National Guard Bureau.\\nIdaho Army National Guard units are trained and equipped as part of the United States Army. The same ranks and insignia are used and National Guardsmen are eligible to receive all United States military awards. The Idaho Guard also bestows a number of state awards for local services rendered in or to the state of Idaho.\\nThe Militia Act of 1903 organized the various state militias into the present National Guard system.\\nFormerly attached to the Idaho National Guard NGB regulations 10-4 and United States code chapter 32 section 109 was the Idaho State Guard which was created to replace the Idaho National Guard when they were in federal service and not available for the protection of the state."},{"page_url":"https://sk.wikipedia.org/wiki/1973","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Adrien_Brody_Cannes_2008.jpg","page_title":"1973","context_page_description":"1. január – Rozšírenie Európskeho hospodárskeho spoločenstva o Dánsko, Írsko a Spojené kráľovstvo.\\n16. január – Teroristický útok na ministerstvo spravodlivosti v Bratislave na Suvorovovej ulici. 2 mŕtvi, 7 ranených\\n2. marec – vydanie albumu Dark Side of the Moon skupiny Pink Floyd\\n10. júl – Olga Hepnerová zavraždila 8 ľudí v Holešoviciach, vrazila nákladným autom do zastávky električky\\n11. september – v Čile bola vojenským prevratom zvrhnutá ľavicová vláda Salvadora Allendeho\\n24. september – Guinea-Bissau vyhlásila svoju nezávislosť od Portugalska\\n6. október až 24. október – tzv. Jomkipurská vojna\\n3. november – NASA vypustila k Marsu družicu Mariner 10; 29. marca 1974 sa stala prvou družicou, ktorá doletela k planéte"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%8B%89%E8%A5%BF%E6%8B%89%E5%A4%A9%E6%96%87%E5%8F%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Las-set-01-02.gif","page_title":"拉西拉天文台","context_page_description":"拉西拉天文台是位於智利的天文台，有3架由歐洲南天天文台製造和操作的望遠鏡，還有一些由ESO維護的其它部分。這個天文台是ESO在智利使用的第一個，也是南半球最大的一個天文台。\\n拉西拉的望遠鏡和儀器位於智利郊區的亞他加瑪沙漠，是世界上最乾燥和孤獨的地區之一。像其它天文台所在的地理區域，拉西拉遠離光汙染的來源，如同帕瑞納天文台，甚大望遠鏡的家，它也是地球上夜空最黑暗的地點之一。"},{"page_url":"https://en.wikipedia.org/wiki/Semiprime","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Arecibo_message_bw.svg","page_title":"Semiprime","context_page_description":"In mathematics, a semiprime is a natural number that is the product of two prime numbers. The two primes in the product may equal each other, so the semiprimes include the squares of prime numbers.\\nBecause there are infinitely many prime numbers, there are also infinitely many semiprimes. Semiprimes are also called biprimes."},{"page_url":"https://en.wikipedia.org/wiki/Albat%C3%A0rrec","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Castell-palau_dels_Espolters.jpg","page_title":"Albatàrrec","context_page_description":"Albatàrrec is a municipality in the comarca of the Segrià in Catalonia."},{"page_url":"https://de.wikipedia.org/wiki/Schmalfu%C3%9F-Beutelm%C3%A4use","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Sminthopsis_macroura_1.jpg","page_title":"Schmalfuß-Beutelmäuse","context_page_description":"Die Schmalfuß-Beutelmäuse, auch unter ihrem englischen Namen Dunnarts bekannt, sind eine Gattung mäuseähnlicher Beuteltiere aus der Familie der Raubbeutler. Die rund 20 Arten dieser Gattung leben in Australien und Neuguinea."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%AC%AC%E4%B8%80%E5%95%86%E6%A5%AD%E9%8A%80%E8%A1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Taiwan_First_Commercial_Bank_HQ_and_Hankou_Street_sign.png","page_title":"第一商業銀行","context_page_description":"第一商业银行，简称“第一银行”或“一银”，是总部设于台湾的一所大型的商业银行，为第一金融控股股份有限公司旗下的主要子公司。"},{"page_url":"https://pl.wikipedia.org/wiki/Dekanat_miadziolski","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/%D0%90%D0%BD%D0%B4%D1%80%D1%8D%D0%B5%D1%9E%D1%81%D0%BA%D1%96_%D0%BA%D0%B0%D1%81%D1%8C%D1%86%D1%91%D0%BB_%D1%96_%D0%B7%D0%B2%D0%B0%D0%BD%D1%96%D1%86%D0%B0..jpg","page_title":"Dekanat miadziolski","context_page_description":"Dekanat miadziolski – jeden z 11 dekanatów archidiecezji mińsko-mohylewskiej na Białorusi. Składa się z 8 parafii. Do 2013 roku? był to dekanat budsławski z siedzibą w Budsławiu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Dreitausender_in_Osttirol","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Gridenkark%C3%B6pfe_II.jpg","page_title":"Liste der Dreitausender in Osttirol","context_page_description":"Diese Liste der Dreitausender in Osttirol listet alle selbständigen Berggipfel mit einer Höhe von mindestens 3000 m ü. A. in Osttirol auf."},{"page_url":"https://ceb.wikipedia.org/wiki/Asmara_(ulohang_dakbayan)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/AsmaraMunicipality.jpg","page_title":"Asmara (ulohang dakbayan)","context_page_description":"Asmara maoy ang ulohang dakbayan sa Eritreya. Ang Asmara nahimutang sa rehiyon sa Maekel Region, sa sentro nga bahin sa nasod. 2,334 metros ibabaw sa dagat kahaboga ang nahimutangan sa Asmara, ug adunay 563,930 ka molupyo.\\nAng yuta palibot sa Asmara kay lain-lain, ug nga tinakpan sa ubos sa sidlakan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 2,371 ka metro ug 1.1 km sa kasadpan sa Asmara. Dunay mga 369 ka tawo kada kilometro kwadrado sa palibot sa Asmara nga hilabihan populasyon. Asmara ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Asmara. Sa rehiyon palibot sa Asmara, kabukiran talagsaon komon.\\nAng klima init nga ugahon. Ang kasarangang giiniton 22 °C. Ang kinainitan nga bulan Mayo, sa 26 °C, ug ang kinabugnawan Agosto, sa 16 °C. Ang kasarangang pag-ulan 424 milimetro matag tuig. Ang kinabasaan nga bulan Agosto, sa 110 milimetro nga ulan, ug ang kinaugahan Enero, sa 1 milimetro."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%BC%E3%82%A8%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/NO_0806_Skien.svg","page_title":"シーエン","context_page_description":"シェーエン は、ノルウェー・テレマルク県の都市。1838年に市となった。面積779平方キロメートル、人口50,595人。ノルウェー第7の主要都市で、都市圏はシーエン、ポルスグラン、バンブルの3つで、人口85,000人以上となる。"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Ferrari_competition_cars","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Felipe_Massa_Ferrari_Bahrain_2010_GP.jpg","page_title":"List of Ferrari competition cars","context_page_description":"The following is a complete list of racing cars manufactured by Ferrari."},{"page_url":"https://de.wikipedia.org/wiki/Welser","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Welser3_Siebmacher207_-_Augsburg.jpg","page_title":"Welser","context_page_description":"Welser ist der Name einer Augsburger sowie Nürnberger Patrizierfamilie von Großkaufleuten. In Augsburg sind die Welser seit 1246 nachweisbar. Im Mittelalter unterhielten die Welser Faktoreien unter anderem in Antwerpen, Lyon, Madrid, Nürnberg, Sevilla, Lissabon, Venedig und Rom sowie Santo Domingo und Venezuela. Durch ihre Handelsgeschäfte kamen diese oberdeutschen Kaufleute zu Reichtum und finanzierten Herrscher verschiedener europäischer Staaten."},{"page_url":"https://ca.wikipedia.org/wiki/Russula","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Russula_vesca.jpg","page_title":"Russula","context_page_description":"Russula és un gènere de bolets pertanyent a la família de les russulàcies, el qual va ser descrit per Christian Hendrik Persoon el 1796."},{"page_url":"https://ca.wikipedia.org/wiki/Marietta_Holley","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Marietta_Holley_%281836-1926%29.jpg","page_title":"Marietta Holley","context_page_description":"Marietta Holley, va ser una humorista nord-americana que va utilitzar la sàtira per criticar la societat i política estatunidenca. Holley va gaudir d'una prolífica carrera d'escriptura i va ser una autora d'èxit a finals del segle XIX, encara que va a ser gairebé oblidada després de la seva mort. Sovint, la seva narrativa era comparada a la de Mark Twain i Edgar Nye. Juntament amb Frances Miriam Whitcher i Ann S. Stephens, Holley és recordada com una de les primeres dones humoristes conegudes dels Estats Units. El seu humor es dirigia a totes les classes socials, sense distingir entre homes i dones o posició social. Els seus llibres han tingut molta repercussió en Europa."},{"page_url":"https://et.wikipedia.org/wiki/K%C3%BChvel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Aa_shoveling_00.jpg","page_title":"Kühvel","context_page_description":"Kühvel on külgedelt kõrgemate äärtega tööriist, mida kasutatakse pinnase kaevamiseks ja teisaldamiseks, puistainete tõstmiseks või koristamisel."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%AD%E5%9B%BD%E5%86%9B%E7%94%A8%E9%A3%9E%E6%9C%BA%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Kongyu_2000%2C_People%27s_Liberation_Army_Air_Force%2C_China.jpg","page_title":"中国军用飞机列表","context_page_description":"中國軍用飛機型號列表："},{"page_url":"https://es.wikipedia.org/wiki/Carla_Macelloni","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Carla_Macelloni_64.jpg","page_title":"Carla Macelloni","context_page_description":"Carla Macelloni fue una actriz italiana."},{"page_url":"https://es.wikipedia.org/wiki/Ekintza_Zuzena","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Ekintza_2011.jpg","page_title":"Ekintza Zuzena","context_page_description":"Ekintza Zuzena, que significa «acción directa» en euskera, es una publicación anarquista surgida en Bilbao en 1988. El grupo editor asume la referencia libertaria en su dimensión social, como algo no cerrado y en permanente cuestionamiento. La revista no pretende crear o ser portavoz de ninguna organización ni agrupar a nadie alrededor de su «ideología», sino que trata de ser un espacio de reflexión, debate y crítica."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B5%E0%A5%88%E0%A4%B7%E0%A5%8D%E0%A4%A3%E0%A5%8B_%E0%A4%A6%E0%A5%87%E0%A4%B5%E0%A5%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Vaishno.jpg","page_title":"वैष्णो देवी","context_page_description":"वैष्णो देवी मंदिर, हिन्दू मान्यता अनुसार, शक्ति को समर्पित पवित्रतम हिंदू मंदिरों में से एक है, जो भारत के जम्मू और कश्मीर में वैष्णो देवी की पहाड़ी पर स्थित है। इस धार्मिक स्थल की आराध्य देवी, वैष्णो देवी को सामान्यतः माता रानी और वैष्णवी के नाम से भी जाना जाता है।\\nयह मंदिर, जम्मू और कश्मीर राज्य के जम्मू जिले में कटरा नगर के समीप अवस्थित है। यह उत्तरी भारत में सबसे पूजनीय पवित्र स्थलों में से एक है। मंदिर, 5,200 फ़ीट की ऊंचाई पर, कटरा से लगभग 12 किलोमीटर की दूरी पर स्थित है। हर वर्ष, लाखों तीर्थ यात्री, इस मंदिर का दर्शन करते हैं और यह भारत में तिरूमला वेंकटेश्वर मंदिर के बाद दूसरा सर्वाधिक देखा जाने वाला तीर्थस्थल है। इस मंदिर की देख-रेख श्री माता वैष्णो देवी तीर्थ मंडल नामक न्यास द्वारा की जाती है।"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%B4%D1%80%D0%B8%D0%B0%D0%BD_%D0%93%D0%B0%D0%B4%D0%B6%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Flickr_-_proteusbcn_-_Semifinal_2_Eurovision_2008_%2867%29.jpg","page_title":"Адриан Гаджа","context_page_description":"Адриан Гаджа, известен още като Адриан, е северномакедонски поп певец от албански произход, един от представителите на Република Македония на Евровизия 2008."},{"page_url":"https://ca.wikipedia.org/wiki/Luriac","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Map_commune_FR_insee_code_42126.png","page_title":"Luriac","context_page_description":"Luriecq és un municipi francès, situat al departament del Loira i a la regió d'Alvèrnia-Roine-Alps. L'any 2007 tenia 952 habitants."},{"page_url":"https://de.wikipedia.org/wiki/Stiftsbezirk_St._Gallen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Aerial_View_of_the_Monastry_of_Sankt_Gallen_14.02.2008_14-48-17.JPG","page_title":"Stiftsbezirk St. Gallen","context_page_description":"Der Stiftsbezirk St. Gallen in St. Gallen im gleichnamigen Kanton der Schweiz gehörte zu den bedeutendsten kulturellen Zentren Europas. Die Fürstabtei ist ein ideales Beispiel für ein grosses Kloster, dessen Geschichte sich von karolingischer Zeit bis zur Säkularisierung im Jahr 1805 spannt. Die Bibliothek ist eine der reichsten und ältesten der Welt und bewahrt wertvolle Manuskripte, wie die älteste überlieferte Architekturzeichnung des Abendlandes. Grosse Teile des Stiftsbezirks wurden von 1755 bis 1768 im Stil des Barock neu gestaltet. In Baubestand, Stiftsbibliothek und Stiftsarchiv werden eine zwölf Jahrhunderte währende Kontinuität dokumentiert.\\nIm Jahr 1983 wurden der Bezirk und seine mobilen Kulturgüter von der UNESCO in das Verzeichnis des schützenswertens Weltkulturerbes aufgenommen. Die berühmte Nibelungenhandschrift B ist seit 2009 Teil des Weltdokumentenerbes der UNESCO."},{"page_url":"https://en.wikipedia.org/wiki/Tungsram","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Izz%C3%B3l%C3%A1mp%C3%A1k.jpg","page_title":"Tungsram","context_page_description":"Tungsram located in Hungary is known for their light bulbs and electronics. Established in Újpest in 1896, it initially produced telephones, wires and switchboards. The name \\"Tungsram\\" is a portmanteau of \\"tungsten\\" and \\"wolfram\\".\\nBefore the nationalization of the Communist Government in 1945, the company was the world's third largest manufacturer of light bulbs and radiotubes, after the American General Electric and RCA companies."},{"page_url":"https://en.wikipedia.org/wiki/George_Hackathorne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/The_Last_of_the_Mohicans_%281920%29_-_Ad_4.jpg","page_title":"George Hackathorne","context_page_description":"George Hackathorne was an American actor of the silent era. He appeared in 59 films between 1916 and 1939. His interment was located in Hollywood Forever Cemetery."},{"page_url":"https://it.wikipedia.org/wiki/Teatro_comunale_Riccardo_Zandonai","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Tomba_Famiglia_Carpentari.jpg","page_title":"Teatro comunale Riccardo Zandonai","context_page_description":"Il teatro comunale Riccardo Zandonai è un teatro di Rovereto ed è stato il primo teatro del Trentino."},{"page_url":"https://en.wikipedia.org/wiki/Tuindorp_Hustler_Click","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/THC2007.jpg","page_title":"Tuindorp Hustler Click","context_page_description":"The Tuindorp Hustler Click is a Dutch rap group that was created in 1995 in Tuindorp Oostzaan in the northern part of Amsterdam. The group was created by several guys with different backgrounds, but with one thing in common: they all live in Tuindorp Oostzaan. That is where the name comes from, they are all from Tuindorp Oostzaan, and they see themselves as a click."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_de_Villeneuve-Saint-Georges_%C3%A0_Montargis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Villeneuve-Saint-Georges_-_Vue_aerienne_01.jpg","page_title":"Ligne de Villeneuve-Saint-Georges à Montargis","context_page_description":"La ligne de Villeneuve-Saint-Georges à Montargis par Corbeil ou Ligne VMC est une ligne de chemin de fer située dans les départements français du Val-de-Marne, de l'Essonne, de Seine-et-Marne et du Loiret. Elle est composée de quatre sections accueillant des trafics distincts :\\nde Villeneuve-Saint-Georges à Juvisy, elle est accolée avec la ligne de Grande Ceinture, où existe un trafic mixte banlieue et fret ;\\nde Juvisy à Corbeil-Essonnes, où circulent les trains du RER D, des trains de fret et des trains de nuits reliant Paris au quart Sud-Est de la France ;\\nde Corbeil-Essonnes à Malesherbes, où circulent les trains du RER D, mais aussi quelques trains de fret ;\\nde Malesherbes à Montargis, où circulent quelques trains de fret entre Montargis et Auxy - Juranville.\\nLa section de Villeneuve-Saint-Georges à Corbeil-Essonnes constitue, avec son prolongement par la ligne de Corbeil-Essonnes à Montereau par Melun, un itinéraire de dédoublement de la ligne de Paris-Lyon à Marseille-Saint-Charles.\\nElle constitue la ligne 745 000 du réseau ferré national."},{"page_url":"https://fr.wikipedia.org/wiki/Place_Pierre_Clerdent","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Place_des_Guillemins_2015_06.JPG","page_title":"Place Pierre Clerdent","context_page_description":"La place Pierre Clerdent est une place du quartier administratif des Guillemins à Liège. La place est située au pied de la gare de Liège-Guillemins."},{"page_url":"https://fr.wikipedia.org/wiki/Geilo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Geilo_2012.jpg","page_title":"Geilo","context_page_description":"Geilo est une ville norvégienne située dans le comté de Viken à 800 mètres d'altitude et ayant pour principal attrait une station de ski."},{"page_url":"https://en.wikipedia.org/wiki/List_of_museums_in_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/ALLAIRE_VILLAGE%3B_MONMOUTH_COUNTY%2C_NEW_JERSEY.jpg","page_title":"List of museums in New Jersey","context_page_description":"This list of museums in New Jersey is a list of museums, defined for this context as institutions that collect and care for objects of cultural, artistic, scientific, or historical interest and make their collections or related exhibits available for public viewing. Museums that exist only in cyberspace are not included.\\nLists of New Jersey institutions which are not museums are noted in the \\"See also\\" section, below.\\nthis fact is all right {written by a 5 year old}"},{"page_url":"https://fr.wikipedia.org/wiki/Villeneuve-l%C3%A8s-B%C3%A9ziers","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Map_commune_FR_insee_code_34336.png","page_title":"Villeneuve-lès-Béziers","context_page_description":"Villeneuve-lès-Béziers est une commune française située dans le département de l'Hérault, en région Occitanie.\\nSes habitants sont appelés les Villeneuvois et les Villeneuvoises."},{"page_url":"https://nl.wikipedia.org/wiki/Kerk_van_Jheringsfehn","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Jheringsfehn_Orgel.jpg","page_title":"Kerk van Jheringsfehn","context_page_description":"De Kerk van Jheringsfehn is een luthers kerkgebouw in Jheringsfehn, een Ortsteil van de Oost-Friese gemeente Moormerland. De kerk werd op 21 maart 1864 plechtig ingewijd."},{"page_url":"https://pl.wikipedia.org/wiki/Cour-l%E2%80%99%C3%89v%C3%AAque","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/CP_Cour-l%27%C3%89v%C3%AAque_Rue_de_l%27Eglise.jpg","page_title":"Cour-l’Évêque","context_page_description":"Cour-l’Évêque – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Górna Marna.\\nWedług danych na rok 1990 gminę zamieszkiwało 210 osób, a gęstość zaludnienia wynosiła 11 osób/km²."},{"page_url":"https://sv.wikipedia.org/wiki/Annie_Girardot","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Annie_Girardot_C%C3%A9sars.jpg","page_title":"Annie Girardot","context_page_description":"Annie Girardot, född 25 oktober 1931 i Paris, död 28 februari 2011 i Paris, var en fransk skådespelare. Hon hade en karriär som sträckte sig över fem decennier och under 1970-talet var hon en av Frankrikes mest populära skådespelare."},{"page_url":"https://de.wikipedia.org/wiki/Souterrain_von_Tigh_Talamhain","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Tigh_Talamhain_Souterrain_-_geograph.org.uk_-_502509.jpg","page_title":"Souterrain von Tigh Talamhain","context_page_description":"Das Souterrain von Tigh Talamhain liegt etwa 400 m östlich des verlassenen Bauernhofes Lachsay, an einem leichten Anstieg über der Ebene, am rechten Ufer des Abhainn Sneosdal, ungefähr 23 m entfernt vom Fluss, auf der Insel Skye, der größten Insel der Inneren Hebriden in Schottland. Bei den Souterrains wird grundsätzlich zwischen „rock-cut“, „earth-cut“, „stone built“ und „mixed“ Souterrains unterschieden.\\nDas Souterrain – auch Earthhouse genannt – wurde vor vielen Jahren entdeckt und teilweise zerstört, als ein Teil des Zugangs entfernt und ein Loch ins Dach gemacht wurde. Es besteht aus einwärts geneigten Wänden aus Trockenmauerwerk die eine bienenstockförmige Kammer von etwa 1,75 m Durchmesser bilden. Sie wird durch einen ostwärts verlaufenden Gang betreten, der eine Restlänge von etwa 3,0 m hat. Der abgetrennte äußere Teil des Ganges ist durch eine Mulde im Boden angedeutet. Der vollständige Gang war etwas mehr als 7,5 m lang. Es misst in der Breite 0,75 bis 0,9 m. Etwa 1,5 m vom inneren Ende des Ganges ist ein Sturz 15 cm niedriger als die anderen platziert. Auf der linken Seite des Ganges befindet sich eine Nische mit einem Sturz."},{"page_url":"https://sh.wikipedia.org/wiki/Nau%C4%8Dni_univerzitet_E%C3%B6tv%C3%B6sa_Lor%C3%A1nda","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Egyetemi_K%C3%B6nyvt%C3%A1r4.JPG","page_title":"Naučni univerzitet Eötvösa Loránda","context_page_description":"Naučni univerzitet Eötvösa Loránda je javni univerzitet u Budimpešti koji je osnovan 1635. godine.\\nUniverzitet je originalno osnovan u Nagyszombatu, gradu u današnjoj Republici Slovačkoj čiji je savremeni slavenski naziv Trnava. Danas se na naslijeđe ovog isusovačkog učilišta uz Univerzitet Eötvösa Loránda u Budimpešti poziva i suvremeni Univerzitet u Trnavi iako ta institucija nije direktni nasljednik. Nakon privremenog ukidanja isusovačkog reda institucija je 1777. preseljena u Budim, a 1784. i na svoju finalnu destinaciju u Peštu. Oba ova grada danas čine Budimpeštu, glavni grad Mađarske. Sve do 1844. predavanja su se odvijala na latinskom jeziku, a nakon toga se prešlo na mađarski jezik. Od 1895. univerzitet je svoja vrata otvorio i studenticama. 1949. iz sastava univerziteta izdvojen je Teološki fakultet koji od tada funkcioniše kao neovisni Katolički univerzitet Pázmány Péter i također se poziva na tradiciju originalog isusovačkog učilišta iz Trnave. Od 1950. univerzitet nosi ime Loránda Eötvösa, austrougarskog fiziča mađarskog porijekla."},{"page_url":"https://es.wikipedia.org/wiki/Fashion_Sakala","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Fashion_Sakala_2017.jpg","page_title":"Fashion Sakala","context_page_description":"Junior Fashion Sakala es un futbolista zambiano. Juega como delantero y su equipo actual es el KV Oostende de la Jupiler Pro League de Bélgica.​"},{"page_url":"https://tg.wikipedia.org/wiki/%D0%9F%D3%AF%D1%88%D0%B0%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Disposablediaper.JPG","page_title":"Пӯшак","context_page_description":"Пӯшак — фаровардае аз лифҳои нарму ҷазбкунандаи намӣ бо як рӯкаши нигаҳдоранда барои ҷазби идрор ва мадфӯъ ки ба кӯдакон ё солмандон мебанданд то касоне, ки қодир ба контроли идрору ва мадфӯъи худ нест аз он истифода кунанд\\nИн васила аз пахта ё алёф қобили ҷазб аст то сабаби идрорсӯхтагӣ нашавад. Бархе пӯшакҳо якбормасрафанд ва бархе низ қобили шустушӯ ҳастанд ва қобилияти истифодаи дубора доранд."},{"page_url":"https://pl.wikipedia.org/wiki/Megadeth","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Megadeth_Live_at_The_O2_2018-06-16.jpg","page_title":"Megadeth","context_page_description":"Megadeth – amerykańska grupa muzyczna założona w kwietniu 1983 roku w Los Angeles w Kalifornii. Powstała z inicjatywy Dave’a Mustaine’a i Dave’a Ellefsona. Nazwa zespołu to fonetyczne brzmienie angielskiego określenia hipotetycznej jednostki miar, oznaczającej liczbę miliona osób, które zginęłyby w wyniku eksplozji nuklearnej. Formacja reprezentuje takie style muzyczne jak thrash metal, speed metal, heavy metal i metal progresywny.\\nNakład ze sprzedaży wszystkich płyt grupy wynosi ponad 38 milionów egzemplarzy na całym świecie. Zespół zdobył sześć platynowych płyt i siedem nominacji do nagród Grammy. Należy do Wielkiej Czwórki Thrash Metalu, razem z zespołami Metallica, Slayer i Anthrax. Otrzymali nagrodę Grammy w kategorii Best Metal Performance w 2017 roku.\\nMuzyka Megadeth charakteryzuje się dynamicznymi kompozycjami z bardzo szybko i agresywnie granymi riffami gitar. Łatwo rozpoznawalny jest również śpiew Dave’a Mustaine’a."},{"page_url":"https://en.wikipedia.org/wiki/Indiana_Dunes_State_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lieber-dunes-1916.jpg","page_title":"Indiana Dunes State Park","context_page_description":"Indiana Dunes State Park is an Indiana State Park located in Porter County, Indiana, United States, 47 miles east of Chicago. The park is bounded by Lake Michigan to the northwest, and is surrounded on all four sides by Indiana Dunes National Park, a unit of the National Park Service; the national park owns the water from the ordinary high water mark to 300 feet offshore. The 1,530-acre Dunes Nature Preserve makes up the bulk of eastern part of the park, and includes most of the park’s hiking trails and dune landscape. This was one of the first places Richard Lieber considered when establishing the Indiana State Park system. Like all Indiana state parks, there is a fee for entrance. Indiana Dunes State Park was established in 1925 and designated a National Natural Landmark in 1974.\\nPreserving the Indiana Dunes has resulted from the efforts of many citizens and politicians."},{"page_url":"https://es.wikipedia.org/wiki/La_Mano_Negra","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/LaManoNegra2013_MIN-DSC06779.JPG","page_title":"La Mano Negra","context_page_description":"La Mano Negra fue una presunta organización anarquista secreta y violenta que actuó en la región española de Andalucía a principios de la década de 1880, durante el reinado de Alfonso XII, y a la que se le atribuyeron asesinatos e incendios de cosechas y edificios.​ Los sucesos de la llamada Mano Negra se produjeron en el bienio 1882-1883, en el contexto de un clima de aguda lucha de clases en el campo andaluz, de difusión de un anarcocomunismo distinto del anarcocolectivismo bakuninista, y de diferencias entre legalistas y clandestinistas en el seno de la recién creada Federación de Trabajadores de la Región Española.​"},{"page_url":"https://zh.wikipedia.org/zh-tw/1978%E5%B9%B4%E5%9C%8B%E9%9A%9B%E8%B6%B3%E5%8D%94%E4%B8%96%E7%95%8C%E7%9B%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Estadio_Jos%C3%A9_Amalfitani.JPG","page_title":"1978年國際足協世界盃","context_page_description":"1978年國際足總世界盃於1978年6月1日至25日於阿根廷舉行。東道主隊在決賽中通過加時賽以3–1戰勝了荷蘭隊。這是阿根廷成為世界盃史上的第六個獲得冠軍的國家。\\n本屆比賽與1974年的規程相同：16 支球隊進行兩輪循環賽，決出參加決賽和三四名決賽的球隊。本屆也首次引入互射十二碼方式決定淘汰賽的勝負，但本屆沒有賽事需要使用這方式決定勝負。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B9%D9%88%D9%81%D9%8A%D8%B1%D8%A7_%D9%86%D8%A7%D9%81%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Flickr_-_Government_Press_Office_%28GPO%29_-_Mrs._Ophira_navon.jpg","page_title":"عوفيرا نافون","context_page_description":"عوفيرا نافون ‏ ولدت في عام 1936 – وتوفيت في عام 1993. هي نفسانية من إسرائيل ولدت في تل أبيب."},{"page_url":"https://en.wikipedia.org/wiki/Birger_Rosengren","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Birger_Rosengren.jpg","page_title":"Birger Rosengren","context_page_description":"Birger Rosengren was a former international Swedish footballer who played for IFK Norrköping as a midfielder. During his club career, he won the national Swedish league five times."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%A7%D7%A1%D7%9C%D7%99%D7%98%D7%99%D7%9D","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0b/Mao_Zedong_sitting.jpg","page_title":"נקסליטים","context_page_description":"נקסליטים או נקסל הוא שם בלתי רשמי המסמן את חברי אותם הארגונים הפוליטיים המשייכים את עצמם למורשת המפלגה הקומוניסטית של הודו שהוקמה בקולקטה בשנת 1969. הארגון הפוליטי הגדול ביותר בקרבם הוא המפלגה הקומוניסטית של הודו. הנקסליטים ראו עצמם \\"מגני השכבות החלשות בהודו\\" ו\\"מגני האיכרים נגד ניצול בעלי האחוזות\\"\\nהמונח \\"נקסל\\" נגזר משם הכפר נקסלברי במחוז דרג'ילינג במערב בנגל, שבו פרץ מרד בשנת 1967. המרד פרץ בעקבות תעמולת קומוניסטים רדיקליים מקומיים, ששאבו השראה מהאידאולוגיה הפוליטית של המנהיג הקומוניסטי הסיני, מאו דזה טונג וביקשו להדליק מהפכה.\\nסיבות המרד היו קיפוח ותסכול מול כוחם המוגזם של בעלי האחוזות והפלייתם של השבטים הילידים, לרבות טרנספר כפוי שלהם כדי לפנות שטחים לתעשיות המכרות הגדולות, במיוחד במדינות צ'האטיסגאר וג'הרקאנד\\nאחרי המרד בשנת 1967 חלה התפצלות שנייה בקרב התנועה הקומוניסטית בהודו:הפלג הרדיקלי עזב את המפלגה הקומוניסטית של הודו ויצר כעבור שנתיים את המפלגה הקומוניסטית של הודו. פילוגים דומים במפלגות הקומוניסטיות התרחשו בהשראת המאואיזם בארצות רבות בעולם אולם בהודו המפלגות הפרו-סיניות שנוצרו ב-1964 ואחר כך ב-1967 צברו כוח רב כשמוקדן היה מערב בנגל."},{"page_url":"https://hu.wikipedia.org/wiki/Ipolys%C3%A1g","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Ipolys%C3%A1g023.JPG","page_title":"Ipolyság","context_page_description":"Ipolyság város Szlovákiában, a Nyitrai kerület Lévai járásában. A mintegy nyolcezer lakosú település egykor Hont vármegye és az Ipolysági járás székhelye volt. Pereszlény és Tesmag tartozik hozzá."},{"page_url":"https://en.wikipedia.org/wiki/Lupus_band_test","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Lupus_band_test.jpg","page_title":"Lupus band test","context_page_description":"Lupus band test is done upon skin biopsy, with direct immunofluorescence staining, in which, if positive, IgG and complement depositions are found at the dermoepidermal junction. This test can be helpful in distinguishing systemic lupus erythematosus from cutaneous lupus, because in SLE the lupus band test will be positive in both involved and uninvolved skin, whereas with cutaneous lupus only the involved skin will be positive.\\nThe minimum criteria for positivity are:\\nIn sun-exposed skin: presence of a band of deposits of IgM along the epidermal basement membrane in 50% of the biopsy, intermediate intensity or more.\\nIn sun-protected skin: presence of interrupted deposits of IgM along the epidermal basement membrane, intermediate intensity or more.\\nThe presence of other immunoglobulins and/or complement proteins increases the specificity of a positive test."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historical_markers_of_the_Philippines_in_Central_Luzon","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Gen_luna_death_place.jpg","page_title":"List of historical markers of the Philippines in Central Luzon","context_page_description":"This list of historical markers installed by the National Historical Commission of the Philippines in Central Luzon is an annotated list of people, places, or events in the region that have been commemorated by cast-iron plaques issued by the said commission. The plaques themselves are permanent signs installed in publicly visible locations on buildings, monuments, or in special locations.\\nWhile many Cultural Properties have historical markers installed, not all places marked with historical markers are designated into one of the particular categories of Cultural Properties.\\nA marker on the site of the assassination of Aurora Aragon Quezon in Bongabon was rededicated on the site on April 28, 2013 after the original marker dated February 13, 1991 went missing.\\nThere has been an issue regarding the possible relocation of a historical marker dedicated to Francisco \\"Soc\\" Rodrigo in Bulakan over ownership issues of the heritage house.\\nOn June 3, 2016, it was the first time for the NHCP to unveil a marker for a nameless personality. A marker was installed in Macabebe, commemorating the leader of the Battle of Bangkusay Channel, the \\"first native to give up his life for independence.\\""},{"page_url":"https://fr.wikipedia.org/wiki/Monast%C3%A8re_de_Mala_Remeta","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Manastir_Mala_Remeta_058.jpg","page_title":"Monastère de Mala Remeta","context_page_description":"Le monastère de Mala Remeta est un monastère orthodoxe serbe situé en Serbie dans la province de Voïvodine, près du village de Mala Remeta. Il est un des 16 monastères de la Fruška gora, dans la région de Syrmie. Il dépend de l'éparchie de Syrmie et figure sur la liste des monuments culturels d'importance exceptionnelle de la République de Serbie."},{"page_url":"https://ast.wikipedia.org/wiki/Trogon_surrucura","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Trogon_surrucura_back.jpg","page_title":"Trogon surrucura","context_page_description":"Surucuá, ye una especie d'ave perteneciente a la familia Trogonidae.."},{"page_url":"https://fr.wikipedia.org/wiki/Jacques_Bihin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/M%C3%A8redeDieuduRosaire.jpg","page_title":"Jacques Bihin","context_page_description":"Jacques Bihin est un iconographe, photographe et diacre catholique belge."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%B4%E8%B6%8A%E5%9B%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Imperial_Dynasties_in_China_917_CE_%28Chinese%29.png","page_title":"吴越国","context_page_description":"吳越是五代十國時期的十國之一，由錢鏐在公元907年所建。都城為錢塘。強盛時擁有十三州疆域，約為現今浙江全省、江蘇東南部和福建東北部。吳越國共有五位君主，傳國七十一年，末主錢弘俶於公元978年獻土入宋。"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_op_9_januari","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Demersseman.jpg","page_title":"Lijst van personen geboren op 9 januari","context_page_description":"Dit is een lijst van personen die geboren zijn op 9 januari.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina.\\n727 - Tang Daizong, keizer van China en keizer uit de Tang-dynastie bewerken\\n840 - Michaël III, Byzantijns keizer uit het Byzantijnse Rijk bewerken\\n1304 - Hojo Takatoki, Japanse Shikken bewerken\\n1455 - Willem II van Gulik-Berg, Duitse hertog van Gulik, hertog van Berg en graaf van Ravensberg, aristocraat bewerken\\n1493 - Johan van Brandenburg-Ansbach-Kulmbach, politicus bewerken\\n1499 - Diane de Poitiers, Franse gravin en hertogin, hofdame bewerken\\n1554 - Paus Gregorius XV, paus, katholieke aartsbisschop en kardinaal, klerk en rooms-katholiek priester uit de Kerkelijke Staat bewerken\\n1571 - Karel Bonaventura van Longueval, Franse politicus en militair bewerken\\n1590 - Simon Vouet, Franse kunstschilder bewerken\\n1620 - Anton Günther I, Count of Schwarzburg-Sondershausen, graaf bewerken"},{"page_url":"https://it.wikipedia.org/wiki/Musei_delle_Marche","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Jesi%2C_Palazzo_Pianetti.JPG","page_title":"Musei delle Marche","context_page_description":"Questa lista di musei delle Marche elenca gallerie d'arte e musei archeologici delle Marche.\\nMappa di tutte le coordinate: OpenStreetMap · Bing - Esporta: KML · GeoRSS · microformat · RDF"},{"page_url":"https://it.wikipedia.org/wiki/Iglesiente","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Nuraghe_Seruci_2.JPG","page_title":"Iglesiente","context_page_description":"L'Iglesiente è una sub-regione storico-geografica della Sardegna sud-occidentale."},{"page_url":"https://de.wikipedia.org/wiki/Bojanovice_u_Prahy","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/35/Bojanovice_PZ_CZ.png","page_title":"Bojanovice u Prahy","context_page_description":"Bojanovice ist eine Gemeinde in Tschechien. Sie liegt 26 Kilometer südlich des Stadtzentrums von Prag und gehört zum Okres Praha-západ."},{"page_url":"https://de.wikipedia.org/wiki/Filey","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Filey_garden.jpg","page_title":"Filey","context_page_description":"Filey ist eine Kleinstadt im Borough of Scarborough der englischen Grafschaft North Yorkshire. Der ganz im Osten der Grafschaft an der Nordseeküste befindliche Ferienort hatte laut Volkszählung 2001 insgesamt 6819 Einwohner."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_City_of_Canterbury","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Roman_Museum_128.jpg","page_title":"Grade I listed buildings in City of Canterbury","context_page_description":"There are over 9,000 Grade I listed buildings in England. This page is a list of these buildings in the district of Canterbury in Kent."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BA%D0%BB%D0%B0%D0%B4_%D0%B8%D0%BA%D0%BE%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Vladimirskaya_riza.jpg","page_title":"Оклад иконы","context_page_description":"Ри́за, или окла́д — накладное украшение на иконах, покрывающее всю иконную доску поверх красочного слоя, кроме нескольких значимых элементов, для которых сделаны прорези; значимый вид русского декоративно-прикладного искусства.\\nБывали металлические: золотые и серебряные, также из латуни, меди и даже белой жести; шитые: бисером или жемчугом, украшенные эмалью, подчас с драгоценными камнями, цветными стёклами и накладными деталями. С обратной стороны порой обивались красным или малиновым бархатом.\\nОклады встречаются на православных иконах всех стран, а также на ряде католических икон. Наибольшие роскошь и размах производства были свойственны русским произведениям. В русском искусстве их создание выделилось в отдельную ветвь декоративно-прикладного искусства. С начала XX века традиция изготовления риз и обкладывания ими икон начала приходить в упадок."},{"page_url":"https://it.wikipedia.org/wiki/Timgad","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Ruelle_qui_m%C3%A8ne_vers_la_porte_de_Mskoula.JPG","page_title":"Timgad","context_page_description":"Timgad, fu una colonia romana fondata dall'imperatore Traiano nell'anno 100 con manodopera militare. Le sue notevolissime rovine sono un esempio della griglia con cui venivano costruite le città romane. Quando nell'Ottocento la città viene dissepolta dalla sabbia del deserto viene chiamata \\"la Pompei africana\\"."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%BB%D0%BE%D0%BA%D0%BE%D1%87_(%D0%BE%D0%BA%D1%80%D1%83%D0%B3_%D0%94%D0%B5%D1%82%D0%B2%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Star%C3%A1_zvoni%C4%8Dka_-_panoramio.jpg","page_title":"Клокоч (округ Детва)","context_page_description":"Клокоч — село, громада в окрузі Детва, Банськобистрицький край, Словаччина. Кадастрова площа громади — 9,84 км². Станом на 31 грудня 2015 року в селі проживало 504 людей."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BD%D0%BE%D0%B3%D0%BE%D0%BB%D0%B5%D1%82%D0%BD%D0%B8%D0%B5_%D1%81%D0%B5%D1%80%D0%B8%D0%B8_%D0%BA%D0%BE%D0%BC%D0%BC%D0%B5%D0%BC%D0%BE%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%A1%D0%A1%D0%A1%D0%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/1973_CPA_4292.jpg","page_title":"Многолетние серии коммеморативных марок СССР","context_page_description":"Как известно, почтовые марки одной серии могут иметь разные даты выпуска. Знаки почтовой оплаты с ясными серийными признаками оформления объединяют в единые серии независимо от года выпуска.\\nМноголе́тняя се́рия, или се́рия, выпуска́вшаяся в тече́ние не́скольких лет, — серия почтовых марок, выпуски которой появлялись в течение двух или более лет по датам выпусков. Другими словами, в датах выпусков формально присутствуют по крайней мере два разных года. При этом в каталоге марок имеется соответствующий текст. Многолетние серии обычно больше обычных, однолетних.\\nОсобый интерес представляют отдельные крупные серии, выпуск которых осуществляется на протяжении нескольких лет. Таких серий не так много. Еще более редки очень большие многолетние серии, которые носят специальное название перманентных.\\nМноголетние серии могут быть важной составной частью структуры каталогов почтовых марок, как это имеет место, например, у каталогов японских марок Сакура, JSCA и JSDA. В этих каталогах перманентные серии даже выделены в отдельные разделы, например, 1-я и 2-я перманентные серии национальных парков."},{"page_url":"https://en.wikipedia.org/wiki/Watermill_at_Gennep","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Gennepermolen-1.jpg","page_title":"Watermill at Gennep","context_page_description":"The Watermill at Gennep is a watermill along the river Dommel, located on the Genneperweg 143 in Gestel, Eindhoven, in the province of North Brabant, Netherlands. First mentioned in the 13th century, the watermill burned down and was rebuilt in 1587.\\nVincent van Gogh lived nearby and made several paintings while in the area, including four paintings of the mill in 1884. The watermill was listed as a national monument in 1972."},{"page_url":"https://eu.wikipedia.org/wiki/Kaxarranka","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Lekeitioko_Kilin-kala.jpg","page_title":"Kaxarranka","context_page_description":"Kaxarranka Lekeitioko dantza da, San Pedro egunean, ekainaren 29an, egiten dena. Arrantzaleen kofradiako morroiak beste arrantzale batzuek lepo gainean hartzen duten kaxa baten gainean egiten du dantza. Alkandora eta praka zuriak, gerriko gorria, lepoko gorria janzten ditu eta eskuan txistera beltz bat eta San Pedroren giltzak bordatuta dituen bandera eramaten ditu. Dantzak lau zati ditu: Herriari agurra, fandangoa, arin-arina eta azken agurra."},{"page_url":"https://sco.wikipedia.org/wiki/Max_Euwe","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Max_Euwe_1963.jpg","page_title":"Max Euwe","context_page_description":"Machgielis \\"Max\\" Euwe, PhD wis a Dutch chess Grandmaster, mathematician, an author."},{"page_url":"https://es.wikipedia.org/wiki/Cant%C3%B3n_de_Cognin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Map_canton_code_73_37.svg","page_title":"Cantón de Cognin","context_page_description":"El cantón de Cognin era una división administrativa francesa, que estaba situada en el departamento de Saboya y la región de Ródano-Alpes.​"},{"page_url":"https://de.wikipedia.org/wiki/Hackenstedt","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Holle_030.jpg","page_title":"Hackenstedt","context_page_description":"Hackenstedt ist eine Ortschaft der Gemeinde Holle im Landkreis Hildesheim im deutschen Bundesland Niedersachsen."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Mono","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Togo-karte-politisch.png","page_title":"Río Mono","context_page_description":"El río Mono es uno de los más importantes ríos de Togo, en África Occidental. Con sus 450 km es el río más grande del país; su cuenca comprende toda la parte centro-oriental y sur-oriental de Togo y parte de la zona sur-occidental de Benín. Nace de los Montes de Togo vecino al límite entre la Región de Kara y la Región Central; corre al sur atravesando la parte centro-oriental de la Región Central donde recibe las aguas de su más importante afluente, el Ogou. En la región del Plateaux el hombre ha formado un lago artificial de relevante tamaño, el Lago de Nangbéto.\\nEl Mono representa la línea de frontera meridional entre Togo y Benín durante un gran tramo. El río desemboca en el Golfo de Guinea atravesando antes un extenso sistema de lagos, lagunas y albuferas, incluyendo al Lago Togo."},{"page_url":"https://lt.wikipedia.org/wiki/Vaidas_%C4%8Cepukaitis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Vaidas_Cepukaitis_%282014-15_Juventus_season%29.jpg","page_title":"Vaidas Čepukaitis","context_page_description":"Vaidas Čepukaitis – Lietuvos krepšininkas, gimęs Alytuje, šiuo metu rungtyniaujantis LKL, Kėdainių \\"Nevėžio\\" klube, vidurio puolėjo pozicijoje.\\n2010 m. lapkričio 19 d. buvo paskolintas Utenos „Juventus“ klubui. 2011 m. gruodžio 2 d. buvo paskolintas Panevėžio „Techaso“ klubui.\\n2014 m. rugpjūčio 8 d. pasirašė vienerių metų sutartį su Utenos „Juventus“ klubu.\\n2018 m. rugpjūčio 6 d. pasirašė vienerių metų sutartį su Utenos „Juventus“ klubu."},{"page_url":"https://pt.wikipedia.org/wiki/Miss%C3%B5es_diplom%C3%A1ticas_da_Bol%C3%ADvia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Diplomatic_missions_of_Bolivia.PNG","page_title":"Missões diplomáticas da Bolívia","context_page_description":"Abaixo se encontra as embaixadas e consulados da Bolívia:"},{"page_url":"https://no.wikipedia.org/wiki/Simon_Tong","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Simon_Tong_mg_6648_%28cropped%29.jpg","page_title":"Simon Tong","context_page_description":"Simon Tong er en engelsk gitarist og keyboardist som var medlem av The Verve mellom 1996 og 1999. Han er nå medlem av Transmission. Han har også spilt i Blur, Gorillaz og den ikke navngitte supergruppen ansvarlig for The Good, the Bad & the Queen.\\nI 2002 forlot Graham Coxon bandet Blur og Tong overtok for han."},{"page_url":"https://it.wikipedia.org/wiki/Antonio_Sabato","image_url":"https://upload.wikimedia.org/wikipedia/it/3/3a/Antonio_Sabato-Inter.jpg","page_title":"Antonio Sabato","context_page_description":"Antonio Sabato è un ex calciatore italiano, di ruolo mezzala o ala ambidestra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%B8%D1%8F_%D0%A4%D1%80%D0%B8%D0%B4%D0%B5%D1%80%D0%B8%D0%BA%D0%B0_%D0%9F%D1%80%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Geschichtstaler_1842_Bayern_reverse.jpg","page_title":"Мария Фридерика Прусская","context_page_description":"Мария Фридерика Франциска Гедвига Прусская — прусская принцесса, в замужестве королева Баварии. Мать баварских королей Людвига и Отто."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B0%95%EC%9D%B8%ED%99%98_(%EB%B0%B0%EC%9A%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/190515_%EB%B0%95%EC%9D%B8%ED%99%98.jpg","page_title":"박인환 (배우)","context_page_description":"박인환은 대한민국의 배우이다. 1965년 TV 드라마 《긴 귀항 항로》로 데뷔하였다."},{"page_url":"https://pt.wikipedia.org/wiki/Po%C3%A7os_de_Caldas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Po%C3%A7os_de_Caldas_%288342713496%29.jpg","page_title":"Poços de Caldas","context_page_description":"Poços de Caldas é um município brasileiro do estado de Minas Gerais, no sudeste do país. Está localizado na mesorregião do Sul e Sudoeste de Minas. Segundo estimativa do IBGE para 1º de julho de 2017, é o 15º município mais populoso do estado com 166 085 habitantes."},{"page_url":"https://cs.wikipedia.org/wiki/Kdo_p%C5%99e%C5%BEije:_Panama","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Cirie_Fields_Qatar.jpg","page_title":"Kdo přežije: Panama","context_page_description":"Kdo přežije: Panama je název dvanácté sezóny celosvětově známe televizní reality show Kdo přežije neboli Survivor. Série se odehrává v souostroví Perlové ostrovy, které se nachází poblíž Panamy. Série měla v USA premiéru. Show se točila 39 dní jako většina a představeno nám bylo tentokrát 16 soutěžících.\\nPoprvé nám je představen Exile Island, kam bude alespoň každý týden jeden ze soutěžících poslán po tom, co jeho kmen prohraje soutěž.\\nSérie je výjimečná hned několika důvody. První je, že jsou soutěžící rozděleni do čtyř kmenů podle pohlaví a věku, což je poprvé v historii. Něco takového bylo použito v Kdo přežije: Amazonie a Kdo přežije: Vanuatu. Druhým důvodem je, že je nám poprvé představen Ostrov vyhnanství, na kterém je ukrytý skrytý symbol imunity, zaručující tomu, kdo ji najde moc. Ostrov vyhnanství se poté objeví ještě v dalších řadách, stejně jako dvě soutěžící.\\nCirie Fields se objeví ještě v dalších dvou řadách - Kdo přežije: Mikronésie, kde se umístí třetí a Kdo přežije: Hrdinové vs. Zloduši. Danielle Dilorenzo se stane členem kmene Villains ve 20. hvězdné řadě Kdo přežije: Hrdinové vs. Zloduši."},{"page_url":"https://de.wikipedia.org/wiki/Reutlinger_Stadtverkehrsgesellschaft","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/RT-EW1018-1019-2007.jpg","page_title":"Reutlinger Stadtverkehrsgesellschaft","context_page_description":"Die RSV Reutlinger Stadtverkehrsgesellschaft mbH Hogenmüller & Kull Co. KG ist für den öffentlichen Nahverkehr in Reutlingen sowie den umliegenden Städten und Gemeinden Pfullingen, Eningen, Pliezhausen und Walddorfhäslach zuständig. Das Unternehmen, das sich zu einem Drittel in kommunalem Eigentum befindet, bedient 15 Omnibuslinien und verfügt über einen Fuhrpark von 52 eigenen Omnibussen. Die Linien der RSV sind Teil des Verkehrsverbundes Neckar-Alb-Donau; sie verkehren alle in der Tarifwabe 220.\\nEin Teil der Fahrleistungen wird im Auftrag der RSV von den Subunternehmern Kurz, Lutz und Steinmaier-Aberle erbracht, die zusammen über rund 35 weitere Busse in RSV-Aufmachung verfügen."},{"page_url":"https://de.wikipedia.org/wiki/Arthur_Vichot","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Crit%C3%A9rium_du_Dauphin%C3%A9_2014_-_Etape_7_-_Arthur_Vichot.jpg","page_title":"Arthur Vichot","context_page_description":"Arthur Vichot ist ein französischer Radrennfahrer."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%8E%E0%AE%9A%E0%AF%81%E0%AE%AA%E0%AF%8D%E0%AE%AA%E0%AE%BE%E0%AE%A9%E0%AE%BF%E0%AE%AF%E0%AE%BE%E0%AE%B5%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%AA%E0%AE%A9%E0%AF%8D%E0%AE%A9%E0%AE%BF%E0%AE%B0%E0%AF%86%E0%AE%A3%E0%AF%8D%E0%AE%9F%E0%AF%81_%E0%AE%AA%E0%AF%86%E0%AE%B0%E0%AF%81%E0%AE%9E%E0%AF%8D%E0%AE%9A%E0%AF%86%E0%AE%B2%E0%AF%8D%E0%AE%B5%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Alc%C3%A1zar_de_Segovia_1-7-07.JPG","page_title":"எசுப்பானியாவின் பன்னிரெண்டு பெருஞ்செல்வங்கள்","context_page_description":"எசுப்பானியாவின் பன்னிரெண்டு பெருஞ்செல்வங்கள் எசுப்பானிய இராச்சியத்தின் பன்னிரெண்டு பெருஞ்செல்வங்களை தேர்ந்தெடுக்க நடத்தப்பட்ட திட்டமாகும். இந்தப் போட்டியை எசுப்பானிய தரைவழி தொலைக்காட்சிச் சேவை நிறுவனமான ஆன்டென்னா3 உம் எசுப்பானிய கிறித்தவத் திருச்சபைகளினால் புரக்கப்பட்ட தனியார் வானொலி நிறுவனம் கோப்பும்இணைந்து நடத்தின. இறுதி முடிவுகள் திசம்பர் 31, 2007இல் அறிவிக்கப்பட்டன. ஒன்பது கட்டிட வடிவமைப்பு நினைவுச் சின்னங்கள், இரண்டு இயற்கை நினைவிடங்கள் மற்றுமொரு குகை ஓவியங்களும் இந்த பன்னிரெண்டு பெருஞ்செல்வங்களாக தேர்ந்தெடுக்கப்பட்டன."},{"page_url":"https://be.wikipedia.org/wiki/%D0%93%D0%B5%D1%80%D0%B4_%D0%9A%D0%B0%D1%80%D0%BB_%D0%91%D1%96%D0%BD%D1%96%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Gerd_Binnig_at_the_Memorial_Symposium_for_Heinrich_Rohrer_%28cropped%29_2.jpg","page_title":"Герд Карл Бініг","context_page_description":"Герд Карл Бініг — нямецкі фізік, у 1986 годзе сумесна з Генрыхам Рорэрам атрымаў Нобелеўскую прэмію па фізіцы за вынаходства сканавальнага тунэльнага мікраскопа. Распрацоўкі Бініга пашырылі магчымасці нанатэхналогій, дазволіўшы не толькі візуалізаваць асобныя атамы, але і маніпуляваць імі."},{"page_url":"https://el.wikipedia.org/wiki/%CE%92%CE%AF%CE%BB%CE%B1_%CE%A6%CE%B1%CF%81%CE%BD%CE%B5%CE%B6%CE%AF%CE%BD%CE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Decorations_on_Lincean_Academy_%28Villa_Farnesiana%29.jpg","page_title":"Βίλα Φαρνεζίνα","context_page_description":"Η Βίλα Φαρνεζίνα, μια από τις πρώτες και ωραιότερες αναγεννησιακές επαύλεις, βρίσκεται στη Βία ντέλα Λουνγκάρα, στην περιοχή Τραστέβερε της Ρώμης, δίπλα στον ποταμό Τίβερη. Βρίσκεται στα δυτικά του ποταμού, ενώ απέναντι, στην ανατολική όχθη του Τίβερη, βρίσκεται το Παλάτσο Φαρνέζε."},{"page_url":"https://de.wikipedia.org/wiki/Lederbl%C3%A4ttriger_Wei%C3%9Fdorn","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Crataegus_lavalei_Carrierei_Frucht.jpg","page_title":"Lederblättriger Weißdorn","context_page_description":"Bei dem Lederblättrigen Weißdorn oder Apfeldorn handelt es sich um die Sorte 'Carrierei' von „Lavallées Weißdorn“, der 1870 in Frankreich gezüchtet wurde. Lavallées Weißdorn ist eine Kreuzung des Hahnensporn-Weißdorns mit Crataegus pubescens fo. stipulacea Stapf."},{"page_url":"https://en.wikipedia.org/wiki/Altstadt_(M%C3%BCnchen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Neues_Rathaus_und_Marienplatz_M%C3%BCnchen.jpg","page_title":"Altstadt (München)","context_page_description":"The Munich Old Town is part of the Bavarian capital Munich and has belonged to the city the longest, even if some places which are meanwhile districts of Munich, were mentioned long before Munich's documents spoke of the Old Town. The Old Town forms together with the district Lehel, the municipality No. 1 Altstadt-Lehel. The entire area of the Old Town is listed as both a historical ensemble as well as a historical monument listed in the Bavarian historical monument list."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_zastupitelsk%C3%BDch_%C3%BA%C5%99ad%C5%AF_v_%C4%8Cesk%C3%A9_republice","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Mongolian_embassy_Prague_3236.JPG","page_title":"Seznam zastupitelských úřadů v České republice","context_page_description":"Seznam zastupitelských úřadů v České republice je uveden v tabulce."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B5%D0%B9%D0%BB%D1%8C,_%D0%96%D0%B0%D0%BD%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/ru/d/df/%D0%92%D0%B5%D0%B9%D0%BB%D1%8C%2C_%D0%96%D0%B0%D0%BD%D0%BD%D0%B0.jpg","page_title":"Вейль, Жанна","context_page_description":"Жанна-Клеманс Вейль — мать Марселя Пруста, прототип матери и бабушки Рассказчика из его романа «В поисках утраченного времени»."},{"page_url":"https://de.wikipedia.org/wiki/Berlin-Neuk%C3%B6lln","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Berlin_neukoelln_city-hall_20050228_p1010154.jpg","page_title":"Berlin-Neukölln","context_page_description":"Neukölln ist der namensgebende Ortsteil des nördlichsten und am dichtesten bebauten Teils des Berliner Bezirks Neukölln. Bis 1920 war Neukölln eine eigenständige Stadt, die bis 1912 den Namen Rixdorf trug. Gelegentlich wird der Ortsteil zur Unterscheidung vom Bezirk auch als Nord-Neukölln bezeichnet.\\nDas Gebiet nordöstlich des Hermannplatzes gehört zum umgangssprachlichen so bezeichneten „Kreuzkölln“."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%80%D1%83%D1%82%D0%BE%D0%B2%D0%B8%D0%BA_%D0%B7%D0%B0%D0%B1%D0%BE%D1%80%D0%BD%D1%8B%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Zaun-Bl%C3%A4ttling_%28Gloeophyllum_sepiarium%2C_syn._Daedalea_sepiaria%2C_Lenzites_crocata_und_L._sepiaria%29_-_hms%281%29.jpg","page_title":"Трутовик заборный","context_page_description":"Трутови́к забо́рный, или глеофи́ллум заборный — вид грибов, входящий в род Глеофиллум семейства Глеофилловые. Один из широко распространённых грибов, вызывающих бурую гниль древесины, часто встречающийся на фундаментах домов, заборах. Нередко появляется в закрытых помещениях, где образует коралловидные недоразвитые плодовые тела."},{"page_url":"https://fr.wikipedia.org/wiki/Ernie_Banks","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/14_Ernie_Banks_Medal_of_Freedom_White_House.jpg","page_title":"Ernie Banks","context_page_description":"Ernest Banks, communément appelé Ernie Banks, est un joueur américain de baseball qui évolue chez les Cubs de Chicago en Ligue nationale de 1953 à 1971.\\nJoueur d'arrêt-court jusqu'en 1961 puis joueur de premier but à partir de 1962, Banks est élu joueur par excellence de la Ligue nationale en 1958 et 1959. Il frappe 512 coups de circuit en carrière, ce qui le place en 2015 au 22ᵉ rang de l'histoire et détient de 1958 à 2001 le record de circuit en une saison par un joueur d'arrêt-court. Surnommé Mr. Cub, il mène la franchise des Cubs de Chicago pour, entre autres, les matchs joués, les circuits et les coups sûrs de plus d'un but. Son numéro 14 est le premier retiré par les Cubs.\\nIl est intronisé au Temple de la renommée du baseball en 1977 et élu dans l'équipe du siècle en 1999."},{"page_url":"https://fr.wikipedia.org/wiki/Vocabulaire_fran%C3%A7ais_adopt%C3%A9_en_allemand","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Antoine_Watteau_Biwak.jpg","page_title":"Vocabulaire français adopté en allemand","context_page_description":"Un important vocabulaire français a été adopté en allemand. Ces « emprunts de luxe » ne résultent pas que du prestige économique, politique et culturel dont jouissait la France et le français à certaines périodes de son histoire. La révocation de l'édit de Nantes sous le règne de Louis XIV en 1685 entraîne d'abord un exode massif de Huguenots. L’Allemagne en accueille 50 000, dont 20 000 dans la région autour de Berlin, qui n'abandonneront le français qu'en 1806, en protestation à l'occupation de la Prusse par les troupes de Napoléon.\\nAux XVIIᵉ et XVIIIᵉ siècles, alors que les Allemands construisent le palais de Sanssouci en pastichant Versailles et que la France se dote d'une armée à la hauteur de ses ambitions, l'influence du français atteint son paroxysme en Europe. Le siècle des Lumières entretient une dimension culturelle et prolonge l'élan du français. Certains champs lexicaux qui évoquent la finesse de la culture française, comme les arts de la table et de la mode, sont plus représentés que d'autres. Enfin, les mots adoptés changent parfois de sens, comme l'adjectif « fidel ». Les mots qui apparaissent en gras sont d'utilisation particulièrement banale."},{"page_url":"https://fr.wikipedia.org/wiki/Esth%C3%A9tique","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Jean-Francois_Lyotard_cropped.jpg","page_title":"Esthétique","context_page_description":"L'esthétique est une discipline de la philosophie ayant pour objet les perceptions, les sens, le beau, ou exclusivement ce qui se rapporte au concept de l'art.\\nL'esthétique correspond ainsi au domaine désigné jusqu'au XVIIIᵉ siècle par « science du beau » ou « critique du goût », et devient depuis le XIXᵉ siècle la philosophie de l'art. Elle se rapporte, par exemple, aux émotions provoquées par une œuvre d'art, aux jugements de l'œuvre, à ce qui est spécifique ou singulier à une expression, à ce qui pourrait se définir comme beau par opposition à l'utile et au fonctionnel.\\nDans le langage courant, l'adjectif « esthétique » se rapproche de « beau ». Comme nom, « esthétique » est une notion désignant l'ensemble des caractéristiques qui déterminent l'apparence d'une chose, souvent synonyme de cosmétique, de design ou d'aspect physique."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Botschafter_der_Vereinigten_Staaten_in_Frankreich","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Jamie_D._McCourt.jpg","page_title":"Liste der Botschafter der Vereinigten Staaten in Frankreich","context_page_description":"Diese Liste umfasst die Botschafter der Vereinigten Staaten in Frankreich."},{"page_url":"https://de.wikipedia.org/wiki/Plies","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Plies_%28rapper%29.jpg","page_title":"Plies","context_page_description":"Plies ist ein US-amerikanischer Gangsta-Rapper."},{"page_url":"https://ga.wikipedia.org/wiki/Droichead_Westminster","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Westminster_Bridge_by_Joseph_Farington%2C_1789.jpg","page_title":"Droichead Westminster","context_page_description":"Is droichead atá suite i Londain Shasana é Droichead Westminster. Osclaíodh é sa bhliain 1750. Ceanglaíonn sé Westminster agus Lambeth."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E8%8B%B1%E5%9C%8B%E9%90%B5%E8%B7%AF378%E5%9E%8B%E9%9B%BB%E5%8A%9B%E5%8B%95%E8%BB%8A%E7%B5%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Unit_378149_at_Crystal_Palace.JPG","page_title":"英國鐵路378型電力動車組","context_page_description":"英鐵378型電力動車組首都之星是一款由龐巴迪運輸生產的電力之星系列電力動車組。這款列車實際上屬於城際列車系列，但為配合倫敦地上鐵近似捷運的營運環境而有別於同系列的其他列車，包括採用橫向座位編排以增加企位空間，以及乘客車廂使用內藏門而非內崁式門。\\n倫敦地上鐵是唯一採用這款列車的營運者。該款列車由2009年起分兩批投入服務。\\n由2014年起，378型列車逐一進行改造工程，加掛一節車廂，成為5節的列車。東倫敦線是首條獲派5節列車行走的路線，而北倫敦線及西倫敦線亦於2015年底前全線使用5節列車行走。\\n由於倫敦交通局向龐巴迪訂購的710型列車出現延誤，2019年1月起，倫敦交通局把三列378型列車臨時縮編為4節，並將它們派往行走福音橡至巴金線。"},{"page_url":"https://fr.wikipedia.org/wiki/Docta_Sanctorum_Patrum","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Solesmes.jpg","page_title":"Docta Sanctorum Patrum","context_page_description":"La Docta Sanctorum Patrum est une décrétale, déclarée par le pape Jean XXII en 1323 ou 1324. Avec ce décret, le Saint-Siège interdit l'Ars Nova, un nouveau mouvement dans le domaine du chant liturgique, afin de défendre le chant grégorien, chant ecclésiastique monodique. Si les décrétales au regard du chant ecclésiastique ne sont pas nombreuses, celle-ci est la plus importante, en raison de sa bonne connaissance concernant la nature du chant grégorien. Cependant, l'invention de nouvelle musique, enfin polyphonie, était si dynamique que cette interdiction n'était pas effectivement respectée."},{"page_url":"https://sk.wikipedia.org/wiki/Andy_Hilbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Andy_Hilbert_%281%29.jpg","page_title":"Andy Hilbert","context_page_description":"Andy Hilbert je americký hokejový útočník. Meria 180 cm a váži 88 kg."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D1%87%D1%91%D0%B2,_%D0%9C%D1%83%D1%80%D0%B0%D1%82_%D0%9F%D0%B5%D1%82%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/%D0%9C%D1%83%D1%80%D0%B0%D1%82_%D0%A5%D0%B0%D1%80%D1%87%D0%B5%D0%B2.jpg","page_title":"Храчёв, Мурат Петрович","context_page_description":"Мурат Петрович Храчев — российский боксёр-любитель, выступавший в лёгкой весовой категории, Заслуженный мастер спорта России по боксу. Двукратный чемпион России, призёр Олимпийских игр 2004 года в Афинах. Обладатель Кубка Мира 2005 года в Москве, в составе сборной команды России."},{"page_url":"https://en.wikipedia.org/wiki/Craig_Tracy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Craig_Tracy.jpg","page_title":"Craig Tracy","context_page_description":"Craig Arnold Tracy is an American mathematician, known for his contributions to mathematical physics and probability theory.\\nBorn in United Kingdom, he moved as infant to Missouri where he grew up and\\nobtained a B.Sc. in physics from University of Missouri.\\nHe studied as a Woodrow Wilson Fellow\\nat the Stony Brook University where he obtained a Ph.D. on the thesis entitled Spin-Spin Scale-Functions in the Ising and XY-Models\\nadvised by Barry M. McCoy,\\nin which he studied Painlevé functions in exactly\\nsolvable statistical mechanical models.\\nHe then was on the faculty of Dartmouth College before\\njoining University of California, Davis where he is now\\na professor. With Harold Widom he worked on the asymptotic analysis of Toeplitz determinants and their various operator theoretic generalizations. This work gave them both the George Pólya and the Norbert Wiener prizes, and the Tracy–Widom distribution is named after them."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D1%81%D1%82%D0%B0%D0%B2%D0%B0_%D0%9C%D0%B0%D1%98%D0%BE%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Flag_of_Mayotte_%28local%29.svg","page_title":"Застава Мајота","context_page_description":"Застава Мајота, француске прекоморске територије, званично је застава Француске, али се такође користи и локална застава Мајота која се састоји од грба Мајота изнад којег се налази натпис „MAYOTTE“ велики црвеним словима."},{"page_url":"https://pt.wikipedia.org/wiki/Anne_Dudek","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Anne_Dudek_%28cropped%29.jpg","page_title":"Anne Dudek","context_page_description":"Anne Louise Dudek é uma atriz americana de origem polonesa, mais conhecida por sua participação na série House, no papel da personagem Amber Volakis. Também participou de alguns episódios da série Bones como Tess, namorada do agente Booth, e do episódio-piloto de Psych.\\nParticipação em Grey's Anatomy, temporada 10, episódio 17.\\nParticipa de Friends, como Precious, a então namorada de Mike Hannigan, futuro esposo da Phoebe Buffay.\\nTambém participa em How I Met Your Mother, como Natalie, namorada do arquiteto Ted Mosby.\\nFez o papel de Tiffany Wilson no filme White Chicks.\\nAtualmente, Anne interpreta Benedicte Schaeffer na série Those Who Kill."},{"page_url":"https://zh.wikipedia.org/wiki/1926%E5%B9%B47%E6%9C%889%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/SE1926Jul09A.png","page_title":"1926年7月9日日食","context_page_description":"1926年7月9日日食是一次日環食，發生於1926年7月9日。新月當天，地球上觀測到月球和太陽的角距離極小，此時月球如果恰好在月球交點附近，穿過太陽和地球之間，與地球、太陽接近一直線，則會出現日食。月球穿過太陽和地球之間，但距地球較遠，本影未能接觸地表，而使偽本影覆蓋的區域內看到月球的角直徑小於太陽，就形成日環食，同時在偽本影兩側數千公里的半影範圍內形成日偏食。此次日環食經過了日本南洋廳的部分島嶼、威克島、中途島，日偏食則覆蓋了亞洲東部、太平洋中北部、美國西南半部、中美洲的部分地區及周邊部分地區。"},{"page_url":"https://la.wikipedia.org/wiki/Widecombe_Fair","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/S._Baring-Gould_portrait.PNG","page_title":"Widecombe Fair","context_page_description":"Widecombe Fair est cantilena Anglica quae mercatum ad Widecumbam Devoniae annuatim celebratum commemorat, ab anno 1850 inceptum. Cantilena e traditione populari descripta anno 1890 a Sabino Baring-Gould edita est, annoque 1941 a cantore Burl Ives docta. Sic incepit:\\nTom Pearse, Tom Pearse, lend me your grey mare\\nAll along, down along out along lea\\nFor I wants for to go to Widecombe Fair\\nWith Bill Brewer, Jan Stewer, Peter Gurney, Peter Davy,\\nDan'l Whiddon, Harry Hawke, Old Uncle Tom Cobley and all --\\nOld Uncle Tom Cobley and all.\\nEx hac cantilena enim extrahitur locutio Anglica \\"Uncle Tom Cobley and all\\"."},{"page_url":"https://jv.wikipedia.org/wiki/Prat%C3%A9lan_kabupat%C3%A8n_lan_kutha_ing_Indon%C3%A9sia","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Locator_kabupaten_tangerang.png","page_title":"Pratélan kabupatèn lan kutha ing Indonésia","context_page_description":"Kaca iki isi pratélan kabupatèn lan kutha ing Indonésia."},{"page_url":"https://en.wikipedia.org/wiki/Greg_Biffle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/5_Hour_Energy_Greg_Biffle_%2819866857546%29.jpg","page_title":"Greg Biffle","context_page_description":"Gregory Jack Biffle is an American professional stock car racing driver. Semi-retired, he currently competes part-time in the Stadium Super Trucks in the Continental Tire truck, part-time in the 24 Hours of LeMans, and part-time in the NASCAR Gander RV & Outdoors Truck Series in the No. 24 for GMS Racing. After racing in the NASCAR Winter Heat Series in the mid-1990s, he was recommended to Jack Roush by former announcer Benny Parsons. With Roush Racing, he was the 1998 NASCAR Craftsman Truck Series Rookie of the Year. He won the 2000 Craftsman Truck championship. He reprised this progression in the NASCAR Busch Series, winning the 2001 Rookie of the Year, immediately followed by winning the 2002 championship. Biffle drove in the NASCAR Sprint Cup Series for Roush from 2003 until 2016, winning 19 races in the No. 16 Ford. He currently is also an analyst for NBC Sports' show NASCAR America.\\nBiffle, who began his NASCAR career in 1995, is the first of only three drivers that have won a championship in both the Busch Series and the Craftsman Truck Series, and the sixth of only thirty-two drivers to win a race in each of NASCAR's three national series."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D0%B0%D1%80%D1%80%D0%B8%D1%81,_%D0%A1%D0%B0%D0%BC%D0%B0%D0%BD%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Samantha_Harris.jpg","page_title":"Харрис, Саманта","context_page_description":"Сама́нта Ха́ррис-Шапи́ро — американская телеведущая, журналистка, актриса и фотомодель."},{"page_url":"https://eo.wikipedia.org/wiki/Fosforila_fluorido","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Potassium_chlorate3D.png","page_title":"Fosforila fluorido","context_page_description":"Fosforila fluorido aŭ POF₃ estas neorganika fosfora kombinaĵo, senkolora, venena, koroda gaso, analogaĵo de la fosforila klorido kaj fosforila bromido, uzata kiel kemia reakcianto en industriaj kaj laboratoriaj sintezoj. Ĝi reakcias kun akvo formante fluoridan acidon kaj fosfatan acidon.\\nEkzistas multaj manieroj por produkti ĉi-substancon. Thomas Edward Thorpe kaj F. J. Hambly uzis la reakcion de kriolito kaj fosfora kvinoksido kaj helpis determini ĝian molekulan mason. La belga kemiisto Frédéric Swarts studis la konvertadon de kloridoj en fluoridojn, Oskar Glemser plenumis sennombrajn esplorojn pri fluoroderivaĵoj kaj malkovris la Freon-12. En 1886, Henri Moissan reakciigis 2 partojn de maldike dividitan krioliton kun tri partoj de fosfora kvinoksido. Joseph Louis Gay-Lussac interesiĝis pri la origino de la fluoro en homaj ostoj kaj priskribis plurajn fluoridojn. Louis-Jacques Thénard studis la agadon de la kloro sur fosforo, ktp.\\nKrom tio, per fosforila trifluorido oni povas sintezi sennombrajn kemiaĵojn tiaj kiaj fluorosulfata acido, dumetilamino-fosforil-fluorido, fosfata acido, trifenil-fosfito, trifluoro-pirimidino, trifluoro-benzeno, benzila fluorido, vinil-benzeno."},{"page_url":"https://sh.wikipedia.org/wiki/FIFA_Svjetsko_prvenstvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Coca_cola_world_cup_2002.jpg","page_title":"FIFA Svjetsko prvenstvo","context_page_description":"FIFA Svjetsko prvenstvo, često nazivano samo Svjetsko prvenstvo, međunarodno je nogometno natjecanje u kojemu se natječu muške nacionalne reprezentacije. Natjecanje nadgleda FIFA, vrhovno tijelo svjetskog nogometa. Od 1930. godine i Svjetskoga prvenstva u Urugvaju, natjecanje se održava svake četiri godine, uz izuzetak 1942. i 1946. godine, kada se natjecanje nije održalo zbog Drugog svjetskog rata. Aktualni svjetski prvak je Francuska. FIFA Svjetsko prvenstvo je najgledaniji sportski događaj u svijetu i globalno najpopularnije sportsko natjecanje, popularnije čak i od Olimpijskih igara; procjenjuje se da je kumulativna gledanost Svjetskog prvenstva 2006. godine bila 26,290,000,000, dok je samo finale gledalo 715,100,000 ljudi.\\nAktualni sustav natjecanja uključuje kvalifikacijski sustav, koji se trenutno održava u trogodišnjem periodu prije početka turnira, preko kojega se određuju reprezentacije koje idu na finalni turnir, a koji se često naziva završnica FIFA Svjetskog prvenstva. Domaćin je automatski kvalificiran za završnicu, dok ostale zemlje pravo nastupa moraju ostvariti kroz kontinentalne i/ili interkontinentalne kvalifikacije."},{"page_url":"https://de.wikipedia.org/wiki/Graukarkopf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Rosskarlacke_mit_Graukarkopf.jpg","page_title":"Graukarkopf","context_page_description":"Der Graukarkopf ist ein 2663 m ü. A. hoher Berg in den östlichen Zillertaler Alpen unweit der Grenze zwischen Salzburg und Tirol. Unmittelbar südwestlich des Gipfels befindet sich der Windtalkopf."},{"page_url":"https://fr.wikipedia.org/wiki/Conseil_communal_de_la_ville_de_Luxembourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Luxemb_City_Hotel_de_ville_01.jpg","page_title":"Conseil communal de la ville de Luxembourg","context_page_description":"Le Conseil communal de la ville de Luxembourg est l'assemblée délibérante de la ville de Luxembourg."},{"page_url":"https://en.wikipedia.org/wiki/Neoteny_in_humans","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Kopfproportionen.svg","page_title":"Neoteny in humans","context_page_description":"Neoteny in humans is the retention of juvenile features well into adulthood. This trend is greatly amplified in humans especially when compared to non-human primates. Adult humans more closely resemble the infants of gorillas and chimpanzees than the adults. Neotenic features of the head include the globular skull; thinness of skull bones; the reduction of the brow ridge; the large brain; the flattened and broadened face; the hairless face; hair on the head; larger eyes; ear shape; small nose; small teeth; and the small maxilla and mandible.\\nNeoteny of the human body is indicated by glabrousness. Neoteny of the genitals is marked by the absence of a baculum; the presence of a hymen; and the forward-facing vagina. Neoteny in humans is further indicated by the limbs and body posture, with the limbs proportionately short compared to torso length; longer leg than arm length; the structure of the foot; and the upright stance.\\nHumans also retain a plasticity of behavior that is generally found among animals only in the young. The emphasis on learned, rather than inherited, behavior requires the human brain to remain receptive much longer. These neotenic changes may have disparate roots."},{"page_url":"https://en.wikipedia.org/wiki/History_of_the_Special_Air_Service","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Mirbat14.jpg","page_title":"History of the Special Air Service","context_page_description":"The History of the British Army's Special Air Service or SAS regiment begins with its formation during the Western Desert Campaign of the Second World War, and continues to the present day. It includes their early operations in North Africa, the Greek Islands, and the Invasion of Italy. They then returned to the United Kingdom and were formed into a brigade with two British, two French and one Belgian regiment. The SAS Brigade then conducted operations in France, Italy again, the Low Countries and finally into Germany.\\nAfter the war the SAS were disbanded only to be reformed as a Territorial Army regiment, which then led onto the formation of the regular army 22 SAS Regiment. The new regiment has taken part in most of the United Kingdom's small wars since then. However the Ministry of Defence does not comment on special forces matters, therefore little verifiable information exists in the public domain on the regiment's recent activities.\\nAt first, service in the SAS was considered an end to an officer's career progression, however in recent years SAS officers have risen to the highest ranks in the British Army."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%B5%D9%88%D8%A7%D9%86_%D8%AD%D9%82%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Carduelis_carduelis2.jpg","page_title":"قصوان حقلي","context_page_description":"قصوان حقلي هو نوع من النباتات يتبع جنس القصوان من الفصيلة النجمية."},{"page_url":"https://de.wikipedia.org/wiki/Griechische_Staatsschuldenkrise","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Griechische_Staatsverschuldung.png","page_title":"Griechische Staatsschuldenkrise","context_page_description":"Die griechische Staatsschuldenkrise ist eine seit 2010 laufende Krise des Staatshaushalts und der Volkswirtschaft der Republik Griechenland. Nach dem Wegfall der nationalen Währungen und des damit verbundenen Wechselkursmechanismus nach der Euro-Einführung war die Entwicklung geeigneter interner Anpassungsmechanismen in den Euro-Ländern missglückt. Bereits ein Jahr vor dem 2001 erfolgten Beitritt zur Eurozone betrug die Staatsverschuldung Griechenlands 104,4 % des Bruttoinlandsprodukts. Während der weltweiten Finanzkrise ab 2007 und des Bankenrettungsprogramms der Regierung Karamanlis stieg die griechische Staatsschuldenquote weiter von 107,2 % auf 129,7 % an.\\nIm Oktober 2009 gab der neu gewählte Ministerpräsident Giorgos A. Papandreou nach oben korrigierte Daten zur Verschuldung und weitere schlechte Wirtschaftsdaten bekannt. Methodische Mängel des Statistischen Amts Griechenlands und mögliche politische Einflussnahmen auf die Statistik veranlassten diese Korrektur. Die neuen Daten führten dazu, dass die Renditen der griechischen Staatsanleihen scharf anstiegen."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BA%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9,_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/%D0%9F%D0%BE%D0%BA%D1%80%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87_%D0%B0%D0%B2%D1%82%D0%BE%D0%B3%D1%80%D0%B0%D1%84_1857.png","page_title":"Покровский, Григорий Иванович","context_page_description":"Григорий Иванович Покровский — купец ІІ гильдии, Киевский городской голова в 1853 и 1857—1860 годах."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%93%E3%82%A2_(%E6%BD%9C%E6%B0%B4%E8%89%A6)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/USSCobia2006.jpg","page_title":"コビア (潜水艦)","context_page_description":"コビア は、アメリカ海軍の潜水艦。ガトー級潜水艦の一隻。艦名は温水域に生息するスギ科スギ属の単一種スギに因む。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AF%E3%82%B5%E3%83%B4%E3%82%A7%E3%83%A9%E3%83%BB%E3%83%AC%E3%83%BC%E3%83%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Xavera_Rehme_%2830_years_old%29.jpg","page_title":"クサヴェラ・レーメ","context_page_description":"クサヴェラ・レーメは、ドイツ出身の修道女、教育者。日本で大正末期から昭和中期にかけて、北海道札幌市でドイツ語の私塾を開くことを始め、札幌市の藤高等女学校の創設に尽力し、軍国化が進み困難な社会情勢の中で、女子教育に尽力した。戦後は藤女子短期大学及び藤女子大学の設立などの実績により、女子総合教育の場の設立に貢献した。クサヴェラの名は修道名であり、出生名はカタリナ・レーメ。ドイツのニーダーザクセン州オスナブリュック郡オスターカッペルン出身。"},{"page_url":"https://af.wikipedia.org/wiki/Japan_Nasionale_Roete_41","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Kurokawa_R41_Cycle_Parking_Area_20131031.JPG","page_title":"Japan Nasionale Roete 41","context_page_description":"Nasionale Roete 41 is 'n nasionale snelweg van Japan."},{"page_url":"https://hu.wikipedia.org/wiki/Rec%C3%A9shagym%C3%A1j%C3%BA_n%C5%91szirom","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Iris_reticulata_2008-2-10.JPG","page_title":"Recéshagymájú nőszirom","context_page_description":"A recéshagymájú nőszirom a nősziromfélék családjába tartozó dísznövény."},{"page_url":"https://pl.wikipedia.org/wiki/Amalie_Arena","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/St_Pete_Times_Forum_At_Sunset.jpg","page_title":"Amalie Arena","context_page_description":"Amalie Arena znana też jako Ice Palace, St. Pete Times Forum, Tampa Bay Times Forum – hala sportowa znajdująca się w mieście Tampa w Stanach Zjednoczonych. 8 marca 2009 r. odbył się koncert Britney Spears w ramach trasy: The Circus Starring: Britney Spears. 13 marca 2006 roku zespół Nickelback wystąpił w ramach trasy \\"All the Right Reasons Tour\\".\\nObecnie swoje mecze rozgrywają tutaj:\\nTampa Bay Lightning - NHL\\nTampa Bay Storm - AFL\\nPrzed halą znajduje się pomnik hokeisty Phila Esposito."},{"page_url":"https://es.wikipedia.org/wiki/Monasterio_de_El_Escorial","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Portrait_of_Philip_II_of_Spain_by_Sofonisba_Anguissola_-_002b.jpg","page_title":"Monasterio de El Escorial","context_page_description":"El Real Monasterio de San Lorenzo de El Escorial es un complejo que incluye un palacio real, una basílica, un panteón, una biblioteca, un colegio y un monasterio. Se encuentra en la localidad española de San Lorenzo de El Escorial, en la Comunidad de Madrid, y fue construido en el siglo XVI entre 1563 y 1584.\\nEl palacio fue residencia de la familia real española, la basílica es lugar de sepultura de los reyes de España y el monasterio –fundado por monjes de la Orden de San Jerónimo– está ocupado actualmente por frailes de la Orden de San Agustín. Es una de las más singulares arquitecturas renacentistas de España y de Europa. Situado en San Lorenzo de El Escorial, ocupa una superficie de 33 327 m², sobre la ladera meridional del monte Abantos, a 1028 m de altitud, en la sierra de Guadarrama. Está gestionado por Patrimonio Nacional.\\nConocido también como Monasterio de San Lorenzo El Real, o, sencillamente, El Escorial, fue ideado en la segunda mitad del siglo XVI por el rey Felipe II y su arquitecto Juan Bautista de Toledo, aunque posteriormente intervinieron Juan de Herrera, Juan de Minjares, Giovanni Battista Castello El Bergamasco y Francisco de Mora."},{"page_url":"https://nn.wikipedia.org/wiki/Irak","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Mosul_Dam_USACE_NWD.jpg","page_title":"Irak","context_page_description":"Irak, offisielt Republikken Irak er eit land i Vest-Asia. Det grensa til Tyrkia i nord, Iran i aust, Kuwait i søraust, Saudi-Arabia i sør, Jordan i sørvest og Syria i vest. Hovudstaden og den største byen er Bagdad. Dei største folkegruppene er arabarar og kurdarar, og andre grupper er assyrarar, turkmenarar, shabakar, jesidiar, armenarar, mandearar, tsjerkessarar og Kawliya. Kring 95 % av landet, 36 millionar innbyggjarar, er muslimar, men kristendom, yarsanisme, jesidisme og mandeisme finst òg. Det offisielle språket i Irak er arabisk og kurdisk.\\nIrak har ei 58 km lang kystlinje heilt nord i Persiabukta og omfattar den mesopotamiske elvesletta, nordvestenden av Zagrosfjella og den austlege delen av Den syriske ørkenen. To store elvar, Tigris og Eufrat renn sørover gjennom Irak og ut i Shatt al-Arab nær Persiabukta. Desse elvane dannar viktig jordbruksland i Irak.\\nRegionen mellom Tigris og Eufrat, historisk kjend som Mesopotamia, vert ofte omtalt som vogga til sivilisasjonen. Det var her mennesket først byrja å lese, skrive, skape lover og bu i byar under eit organisert styre - særleg Uruk som namnet «Irak» kjem frå."},{"page_url":"https://en.wikipedia.org/wiki/Roman_Catholic_Diocese_of_Ro%C5%BE%C5%88ava","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Dieceze_roznavska.jpg","page_title":"Roman Catholic Diocese of Rožňava","context_page_description":"The Diocese of Rožňava is a Roman Catholic diocese in southern Slovakia. It covers central and eastern parts of the Banská Bystrica Region and western parts of the Košice Region. Its seat is in Rožňava, covers an area of 7,000 km² with 343,352 people of which 58% are of Catholic faith.\\nAuxiliary Bishop Stanislav Stolárik, Titular Bishop of Barica, who until then had been serving as Auxiliary Bishop of the Roman Catholic Archdiocese of Košice, in Košice, Slovakia, was appointed Bishop of the Diocese of Rožňava on Saturday, 21 March 2015, by Pope Francis, succeeding Bishop Emeritus Vladimír Filo, who himself had succeeded Bishop Emeritus Eduard Kojnok in 2008."},{"page_url":"https://pt.wikipedia.org/wiki/Vimeca_/_Lisboa_Transportes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/24F%28Vimeca%29%40Cac%C3%A9mCP.jpg","page_title":"Vimeca / Lisboa Transportes","context_page_description":"A Vimeca / Lisboa Transportes é uma empresa portuguesa de transportes públicos coletivos que opera uma rede de autocarros nos concelhos de Oeiras, Amadora, Cascais e Sintra, com ligações a Lisboa, onde opera até ao Marquês de Pombal, Colégio Militar, Belém e Praça de Espanha. Algumas carreiras estão subordinadas à rede da Vimeca e outras, nomeadamente as que passam por Lisboa, à da Lisboa Transportes, por uma questão de bilhética, embora pertençam à mesma companhia."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%B2%CE%B2%CE%B1%CE%B5%CE%AF%CE%BF_%CF%84%CE%BF%CF%85_%CE%9C%CE%BF%CE%BD-%CE%A3%CE%B1%CE%B9%CE%BD-%CE%9C%CE%B9%CF%83%CE%AD%CE%BB","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Normandie_Manche_Mont1_tango7174.jpg","page_title":"Αββαείο του Μον-Σαιν-Μισέλ","context_page_description":"Το αββαείο του Μον-Σαιν-Μισέλ βρίσκεται στην γαλλική κοινότητα του Μον-Σαιν-Μισέλ, στην Νορμανδία, στον νομό της Μάγχης.\\nΤο αββαείο αποτελεί αντικείμενο μιας κατάταξης ως ιστορικό μνημείο με την λίστα του 1862. Ο χώρος βρίσκεται από το 1979 στην λίστα των μνημείων παγκόσμιας κληρονομιάς της UNESCO εντός του Μον-Σαιν-Μισέλ και του κόλπου του και το διαχειρίζεται το Κέντρο Εθνικών Μνημείων της Γαλλίας."},{"page_url":"https://fr.wikipedia.org/wiki/Sauto","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Fetges_vue_planes.JPG","page_title":"Sauto","context_page_description":"Sauto est une commune française située dans le département des Pyrénées-Orientales en région Occitanie.\\nSes habitants sont appelés les Sautonins ou les Saltunats."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Aussichtst%C3%BCrmen_in_Bayern","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/AussichtsturmBrotjackelriegel.JPG","page_title":"Liste von Aussichtstürmen in Bayern","context_page_description":"Die Liste von Aussichtstürmen in Bayern enthält Bauwerke, welche über für den Publikumsverkehr zugängliche Aussichtsmöglichkeiten verfügen. Sie umfasst Aussichts-, Fernseh- und Wassertürme, Hochhäuser, Kirchtürme, stationäre Fahrgeschäfte und sonstige Aussichtsplattformen – auch ehemalige Türme. Die Listen enthalten keine reisenden Panoramafahrgeschäfte."},{"page_url":"https://pl.wikipedia.org/wiki/Mosedale","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Mosedale_-_geograph.org.uk_-_1520660.jpg","page_title":"Mosedale","context_page_description":"Mosedale – przysiółek w Anglii, w Kumbrii, w dystrykcie Eden, w civil parish Mungrisdale, położony ok. 15 km na zachód od miasta Penrith. W 1931 roku civil parish liczyła 49 mieszkańców"},{"page_url":"https://ca.wikipedia.org/wiki/Carrer_d%27en_Carabassa","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Carabassa_15%2C_pont_%28I%29.jpg","page_title":"Carrer d'en Carabassa","context_page_description":"El Carrer d'en Carabassa de Barcelona rep el nom o el malnom d'un terrissaire que devia tindre l'obrador per aquesta zona."},{"page_url":"https://fr.wikipedia.org/wiki/Province_de_Le%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Comarcas_agrarias_%28Le%C3%B3n%29.png","page_title":"Province de León","context_page_description":"La province de León est une des neuf provinces de la communauté autonome de Castille-et-León, dans le nord-ouest de l'Espagne. Sa capitale est la ville de León."},{"page_url":"https://nl.wikipedia.org/wiki/Potjomkin_(schip)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Panteleimon1912Sevastopol.jpg","page_title":"Potjomkin (schip)","context_page_description":"De pantserkruiser Potjomkin was een Russisch slagschip dat in de vaart werd genomen in 1904 als Kniaz Potemkin Tavricheskiy en bekendheid verwierf na de beruchte muiterij in 1905, waar de voltallige bemanning in opstand kwam tegen haar officieren."},{"page_url":"https://pl.wikipedia.org/wiki/Ustr%C3%B3j_polityczny_Polski","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Wojewodztwa.svg","page_title":"Ustrój polityczny Polski","context_page_description":"Ustrój polityczny Rzeczypospolitej Polskiej – struktura organizacyjna państwa polskiego, określona Konstytucją Rzeczypospolitej Polskiej uchwaloną przez Zgromadzenie Narodowe 2 kwietnia 1997 roku. Zgodnie z jej treścią Rzeczpospolita Polska jest republiką parlamentarną i realizuje zasady suwerenności narodu, niepodległości i suwerenności państwa, demokratycznego państwa prawnego, społeczeństwa obywatelskiego, trójpodziału władzy, pluralizmu, praworządności, społecznej gospodarki rynkowej oraz przyrodzonej godności człowieka. Rzeczpospolita określona jest także jako państwo unitarne.\\nWładzę, według trójpodziału na rodzaje, sprawują:\\nustawodawczą: Sejm i Senat,\\nwykonawczą: Rada Ministrów i Prezydent,\\nsądowniczą: sądy i trybunały."},{"page_url":"https://es.wikipedia.org/wiki/Rom%C3%A1n_P%C3%A9rez_Romeu","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b4/CasaRomanPerez.jpg","page_title":"Román Pérez Romeu","context_page_description":"Román Pérez Romeu fue alcalde de Isla Cristina entre 1918 y 1927, y miembro de la Asamblea Nacional Consultiva de 1927 a 1930. Como alcalde realizó importantes labores en favor de la cultura, creando la primera biblioteca de la localidad. Anexionó la barriada de Puente Carreras también conocida como de Román Pérez al municipio y fue nombrado alcalde Emérito de Isla Cristina."},{"page_url":"https://pl.wikipedia.org/wiki/Diaphus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Diaphus_luetkeni.jpg","page_title":"Diaphus","context_page_description":"Diaphus – rodzaj morskich ryb świetlikokształtnych z rodziny świetlikowatych."},{"page_url":"https://id.wikipedia.org/wiki/Alfons_V_dari_Aragon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/NapoliMaschioAngioinoIngresso.jpg","page_title":"Alfons V dari Aragon","context_page_description":"Alfons yang Dermawan KG merupakan Raja Aragon, Valencia, Mallorca, Sardinia dan Korsika, Sisilia dan Comte Barcelona dari tahun 1416, dan Raja Napoli dari tahun 1442 hingga kematiannya. Dia adalah salah satu tokoh paling menonjol dari Renaisans awal dan seorang ksatria Ordo Naga."},{"page_url":"https://pl.wikipedia.org/wiki/Carole_Lombard","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/No_Man_of_Her_Own_Still.jpg","page_title":"Carole Lombard","context_page_description":"Carole Lombard − amerykańska aktorka filmowa, ikona i jedna z największych gwiazd kina lat 30. XX wieku. Szczególnie ceniona za energiczne, często niecodzienne role w produkcjach z gatunku screwball comedy. W drugiej połowie lat 30. była najlepiej zarabiającą aktorką w Hollywood. W latach 1939−1942 Lombard pozostawała w związku małżeńskim z Clarkiem Gable’em, będąc jego trzecią żoną. W 1999 została sklasyfikowana przez American Film Institute na 23. miejscu w rankingu „największych aktorek wszech czasów”.\\nW wieku 12 lat, za sprawą reżysera Allana Dwana, Lombard zadebiutowała w filmie A Perfect Crime. Z chęci zostania profesjonalną aktorką, w październiku 1924 podpisała kontrakt z Fox Film Corporation, występując w rolach epizodycznych. W latach 1927−1929 współpracowała z producentem Mackiem Sennettem, grając w wielu produkcjach krótkometrażowych. Następnie zaczęła regularnie występować w filmach pełnometrażowych, takich jak High Voltage i The Racketeer. Po udanym występie w westernie The Arizona Kid, podpisała kontrakt z wytwórnią Paramount Pictures, która zaczęła obsadzać ją w rolach pierwszoplanowych."},{"page_url":"https://fr.wikipedia.org/wiki/Formation_de_Tiaojishan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Serikornis.jpg","page_title":"Formation de Tiaojishan","context_page_description":"La formation de Tiaojishan est une formation géologique du Jurassique moyen et supérieur, présente dans les provinces de Hebei, du Liaoning et de Mongolie-Intérieure, en République populaire de Chine. Cette formation est constituée de roches pyroclastiques, intercalées de roches volcaniques basiques et de roches sédimentaires détritiques. Elle est réputée pour la diversité et la qualité de ses fossiles, dont des vertébrés, découverts surtout depuis le début du XXIᵉ siècle."},{"page_url":"https://cs.wikipedia.org/wiki/Mogilev","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Mahilio%C5%AD_Montage_%282017%29.jpg","page_title":"Mogilev","context_page_description":"Mogilev, Mohylev, případně Mahiljov či Mahiljoŭ je město ve východním Bělorusku na řece Dněpr. Mogilev je třetím největším městem v zemi a střediskem Mohylevské oblasti. Žije zde přibližně 357 tisíc obyvatel."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B3%95%E5%9B%BD%E9%A9%AC%E5%88%97%E4%B8%BB%E4%B9%89%E5%85%B1%E4%BA%A7%E5%85%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Programme-du-parti-communiste-marxiste-leniniste-de-france-de-collectif-914510050_ML.jpg","page_title":"法国马列主义共产党","context_page_description":"法国马列主义共产党是一个法国的毛派政党。他是法国共产主义运动的后继者，1967年12月31日成立。面对人数的迅速下降，它在1985年放弃毛泽东思想，并改名为共产主义替代党。"},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%BE%A3%E7%82%92%E5%B9%B4%E7%B3%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Korean.food-Ddeokbokki-02.jpg","page_title":"辣炒年糕","context_page_description":"辣炒年糕，又叫韩式炒年糕，是一道很受欢迎的韩国小吃，一般能在当地的路边摊或布帐马车处买到。这道菜的雏形是炖朝鲜打糕，是用年糕片、肉、蛋和调味料做成的一道炖菜。炒年糕从前是朝鲜宫廷料理中的一道菜。这种炒年糕是由水煮条状年糕、肉、菜及调味汁制成，上桌前会在上面加银杏及核桃。最初的炒年糕是宫廷用作招待宾客的菜，因此是当时高档菜的代表作。原来的炒年糕是一道炒菜，由条状年糕与不同的材料作组合，例如牛肉、绿豆芽、葱、香菇、萝卜及洋葱，最后用酱油来调味。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%88%D9%84%D8%A9_%D8%A7%D9%84%D8%AF%D8%B1%D8%A7%D9%88%D9%8A%D8%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Taleh_Castle.jpg","page_title":"دولة الدراويش","context_page_description":"دولة الدراويش ‏. دولة إسلامية سنية أسسها السيد محمد عبد الله حسن مطلع القرن الـ20، وهو زعيم ديني محلي جمع البهانتة حوله وكوّن بهم جيشا مواليا عرف باسم الدراويش. تمكن هذا الجيش من إقامة دولة قوية من خلال السيطرة على أراضي الواقعة تحت حكم السلاطين البهانتة وإثيوبيا والقوى الأوربية. حازت دولة الدراويش على شهرة واسعة في العالمين الإسلامي بسبب مقاومته ضد الامبراطوريتين البريطانية والإيطالية. صدت قوات الدراويش بنجاح الإمبراطورية البريطانية في أربع حملات عسكرية، وأجبرها على التراجع إلى المنطقة الساحلية. ونتيجة لشهرتها في منطقة الشرق الأوسط وأوروبا، تم إدراج دولة الدراويش كحليف للإمبراطورية العثمانية والإمبراطورية الألمانية. بقيت دولة الدراويش طوال الحرب العالمية الأولى القوة الإسلامية المستقلة الوحيدة في القارة. وبعد ربع قرن من التحكم البريطاني في الساحل، هزم الدراويش أخيرا في عام 1920."},{"page_url":"https://nl.wikipedia.org/wiki/Nyepi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Ogoh-Ogoh---Ubud_Football_Field-Red_one_with_kids.jpeg","page_title":"Nyepi","context_page_description":"Nyepi of de Dag van de Stilte is een hindoefeestdag op het Indonesische eiland Bali, die jaarlijks plaatsvindt op de nieuwjaarsdag van de maankalender van het eiland. Het is gebruikelijk de dag ervoor juist veel lawaai te maken, met bijvoorbeeld bamboekanonnen en potten en pannen.\\nOp de Dag van de Stilte wordt er niet in gemotoriseerde voertuigen gereden, wordt er geen water gekookt en wordt in plaats daarvan gemediteerd en gevast. Alle winkels, scholen, banken en andere instellingen zijn gesloten en de lichten blijven uit. Verder wordt de toegang tot het eiland ontzegd en kan men het dus niet bezoeken per vliegtuig of boot.\\nVan toeristen die zich al op het eiland bevinden, wordt verwacht dat zij zich ingetogen gedragen. Er wordt verzocht binnen te blijven in het hotel. Veelal komen toeristen juist naar het eiland om de festiviteiten rondom Nyepi te kunnen aanschouwen. Reisbureaus spelen hierop in door speciale arrangementen aan te bieden voor Nyepi."},{"page_url":"https://af.wikipedia.org/wiki/Zarasai","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/LietuvaZarasai.png","page_title":"Zarasai","context_page_description":"Zarasai is 'n stad in die uiterste noordooste van Litaue naby die grens met Letland. Die stad, wat as administratiewe sentrum van die gelyknamige rajon-munisipaliteit fungeer, staan veral bekend vir sy ligging temidde van 'n boslandskap met talle mere. Die stadskern word omring deur sewe mere, waarvan die grootste met 'n oppervlakte van 372 hektaar en sewe eilande as naamgewer vir die stad gedien het.\\nVroeë verwysings na die gebied dateer uit die 14de eeu toe 'n kerk en 'n klooster van die bisdom Vilnius op een van die eilande gestig is. 'n Klein nedersetting het destyds aan die meeroewer ontstaan. Zarasai het in sy geskiedenis Duitse, Russiese en Poolse name gedra. Die laasgenoemde is, net soos die latere Litause benaming Ežerenai, afgelei van die woord \\"meer\\". Sedert 1929 is Zarasai die amptelike Litause stadsnaam."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%93%A2%E6%B9%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Lake_Hyouko.jpg","page_title":"瓢湖","context_page_description":"瓢湖是日本新潟县阿贺野市水原地区的一个人造湖，是受到湿地公约保护的湿地之一。共有31科100种鸟类在瓢湖生活，包括大天鹅、小天鹅。"},{"page_url":"https://fr.wikipedia.org/wiki/Basilique_Saint-Apollinaire-le-Neuf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Meister_von_San_Apollinare_Nuovo_in_Ravenna_001.jpg","page_title":"Basilique Saint-Apollinaire-le-Neuf","context_page_description":"La basilique Saint-Apollinaire-le-Neuf, est un des édifices religieux de la ville de Ravenne, construite au début du VIᵉ siècle sur ordre du roi ostrogoth Théodoric le Grand, à proximité de son palais. Elle est connue pour son ensemble de mosaïques du VIᵉ siècle."},{"page_url":"https://sv.wikipedia.org/wiki/Tetragonia_decumbens","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Tetragonia_decumbens03.jpg","page_title":"Tetragonia decumbens","context_page_description":"Tetragonia decumbens är en isörtsväxtart som beskrevs av Philip Miller. Tetragonia decumbens ingår i släktet tetragonior, och familjen isörtsväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://fr.wikipedia.org/wiki/Trans-Semoysienne","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d7/Haulm%C3%A9.jpg","page_title":"Trans-Semoysienne","context_page_description":"La Trans-Semoysienne est une piste cyclable et piétonne utilisant l'ancien parcours de chemins de fer le long de la Semoy, de Monthermé à Les Hautes-Rivières."},{"page_url":"https://de.wikipedia.org/wiki/Mikkelsen_Harbor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Mikkelsen_Harbour-2016-Trinity_Island-D%27Hainaut_Island%E2%80%93Refugio_Naval.jpg","page_title":"Mikkelsen Harbor","context_page_description":"Der Mikkelsen Harbor ist eine kleine Bucht an der Südküste der Trinity-Insel im Palmer-Archipel vor der Westküste des antarktischen Grahamlands. Sie liegt zwischen dem Kap Skottsberg im Westen und dem Borge Point im Osten.\\nEntdeckt wurde die Bucht bei der Schwedischen Antarktisexpedition unter der Leitung Otto Nordenskjölds. Weder der Zeitpunkt der Benennung noch der Namensgeber sind gesichert. Wahrscheinlich ist eine Namensgebung um das Jahr 1913 durch den schottischen Geologen David Ferguson, der zwischen 1913 und 1914 eine Vermessung der Bucht vornahm. Als Namensgeber kommen der dänische Polarforscher Ejnar Mikkelsen, der norwegische Walfänger Peder Mikkelsen, laut Stewart aber vor allem Otto H. Mikkelsen in Frage. Letzterer war ein norwegischer Taucher, der den beschädigten Rumpf des Forschungsschiffs Pourquoi Pas? des französischen Polarforschers Jean-Baptiste Charcot am 8. Dezember 1908 unweit der norwegischen Walfangstation auf Deception Island inspizierte."},{"page_url":"https://af.wikipedia.org/wiki/Novalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Franz_Gareis_-_Novalis.jpg","page_title":"Novalis","context_page_description":"Novalis was die pennaam van Georg Philipp Friedrich Freiherr von Hardenberg, een van die beduidendste skrywers van die vroeë Duitse Romantiek wat hom naas sy literêre loopbaan ook as filosoof, juris en mynbou-ingenieur bekwaam het.\\nEen motief uit sy romanfragment Heinrich von Ofterdingen, die Blou Blom as versinnebeelding van romantiese verlange, het later die sentrale simbool van die Romantiek geword. Vir baie is Novalis die ideaal van 'n hartstogtelike jong digter, maar biografieë soos dié van Gerhard Schulz wys daarop dat Novalis 'n veelsydige persoonlikheid was, diep gewortel in die leefwêreld en oortuigings van sy tyd. Natuurwetenskap en digkuns was in die laat 18de en vroeë 19de eeu nog nie streng van mekaar geskei nie, en die soektog na 'n verbinding tussen dié twee dissiplines het sentraal gestaan in sy werk. Met Novalis se ontydige dood in 1801 het dié soektog skielik tot 'n einde gekom."},{"page_url":"https://fr.wikipedia.org/wiki/Ligne_T%C5%8Dbu_Urban_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/TobuNodaSen2007-8.jpg","page_title":"Ligne Tōbu Urban Park","context_page_description":"La ligne Tōbu Urban Park, anciennement ligne Tōbu Noda, est une ligne ferroviaire de la compagnie privée Tōbu dans la région de Kantō au Japon. Elle relie la gare d'Ōmiya à Saitama à celle de Funabashi dans la préfecture de Chiba. C'est une ligne avec un trafic local de trains de banlieue.\\nSur les cartes, la ligne Tōbu Urban Park est de couleur bleu ciel et les stations sont identifiées par les lettres TD suivies d'un numéro."},{"page_url":"https://en.wikipedia.org/wiki/Nicolae_Fleva","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Antoniu_-_Le_Ministere_des_Domaines.jpg","page_title":"Nicolae Fleva","context_page_description":"Nicolae Fleva was a Wallachian, later Romanian politician, political journalist and lawyer. Known especially for his involvement in political incidents, and for a stated patriotism bordering on demagogy, he tested all political formulas that Romania's two-party system would allow. His activity in the public sphere brought a decades-long presence in the Assembly of Deputies and a mandate as Mayor of Bucharest between 1884 and 1886.\\nAfter beginnings with the National Liberal Party, which he helped establish and represented in court, Fleva came to oppose its monopoly on power. He experimented with creating a third party, negotiated common platforms for the various opposition forces, including the Conservatives and the Junimea society, during contiguous National Liberal administrations. Fleva was notoriously involved in the major scandals of the 1880s, when his ridicule of National Liberal power generated street battles and sparked two separate shooting incidents. At the time, \\"Flevist\\" groups were seen as the leading voice of middle class discontent, and formed one of several currents pushing for the adoption of universal male suffrage."},{"page_url":"https://en.wikipedia.org/wiki/WrestleMania_XI","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Razor_Ramon_in_1995.jpg","page_title":"WrestleMania XI","context_page_description":"WrestleMania XI was the 11th annual WrestleMania professional wrestling pay-per-view event, produced by the World Wrestling Federation at the Hartford Civic Center in Hartford, Connecticut on April 2, 1995.\\nThe main event was a match between NFL linebacker Lawrence Taylor, who faced Bam Bam Bigelow as the result of an argument that took place between the two at the 1995 Royal Rumble. Taylor won the match, which led to Bigelow being kicked out of Ted DiBiase's Million Dollar Corporation. Shawn Michaels faced WWF World Heavyweight Champion Diesel in a title match but was unable to win the championship. Jeff Jarrett retained his WWF Intercontinental Championship against Razor Ramon. Owen Hart and his mystery partner, Yokozuna, challenged The Smoking Gunns for the WWF Tag Team Championship and won the title belts.\\nThe match between Taylor and Bigelow brought the WWF mainstream press coverage. The reactions to the match were mixed; some people thought that Taylor performed surprisingly well for a non-wrestler. Others thought that the WWF pushing a football player to defeat a wrestler made professional wrestling look bad."},{"page_url":"https://fr.wikipedia.org/wiki/1809_aux_%C3%89tats-Unis","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/James_Madison_Portrait2.jpg","page_title":"1809 aux États-Unis","context_page_description":"Cette page concerne des événements d'actualité qui se sont produits durant l'année 1809 du calendrier grégorien aux États-Unis."},{"page_url":"https://bs.wikipedia.org/wiki/Stara_Ba%C5%A1ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Panorama_of_the_harbor_in_Stara_Ba%C5%A1ka.jpg","page_title":"Stara Baška","context_page_description":"Stara Baška je naseljeno mjesto u sastavu općine Punat, na ostrvu Krku, Primorsko-goranska županija, Republika Hrvatska."},{"page_url":"https://en.wikipedia.org/wiki/Examination_vessel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/HMCS_Malaspina_E-75597.jpg","page_title":"Examination vessel","context_page_description":"An examination vessel is a vessel used to inspect ships and boats entering a port during wartime.\\nAn examination vessel would typically be responsible for examining and verifying all merchant ships and small craft entering or departing a port. They would normally be equipped with one or more machine guns and in addition were often supported by one or more shore gun batteries, sometimes called examination batteries. In the case of United States Army Coast Artillery Corps defenses in World War II, a Harbor Entrance Control Post on shore would interrogate a vessel, and a nearby examination battery would be ready to respond if required. Duties might include boarding ships, examining papers to establish identity and belligerent status, and inspecting cargoes for legitimacy.\\nAs an example of how an examination service might operate, here is an account of the procedure that operated in 1917 in Sydney Harbour:\\n\\"At midnight on 7 August all traffic entering and leaving the harbour was placed under strict naval control with the inauguration of an examination service under Captain Pasco's port defense organisation, to guard against surprise attack by disguised armed merchant ship raiders."},{"page_url":"https://fr.wikipedia.org/wiki/France_Martineau","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Martineau.jpg","page_title":"France Martineau","context_page_description":"France Martineau, née en 1960, est une linguiste canadienne, professeure titulaire à l'université d'Ottawa en Ontario, en double affectation aux départements de français et de linguistique. Elle possède un doctorat de l’université d'Ottawa. Elle est une leader en sociolinguistique historique et spécialiste du français canadien et détient présentement la chaire de recherche universitaire Le français en mouvement : Frontières, réseaux et contacts en Amérique française."},{"page_url":"https://eu.wikipedia.org/wiki/Little_Comfort","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Little_Comfort_Church_-_geograph.org.uk_-_416250.jpg","page_title":"Little Comfort","context_page_description":"Little Comfort, Ingalaterrako Kornualles konderriko herrixka bat da, Lezant parrokian."},{"page_url":"https://sl.wikipedia.org/wiki/Pa%C5%A1tri%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Pa%C5%A1tri%C4%87_-_op%C5%A1tina_Mionica_-_zapadna_Srbija_-_panorama_5.jpg","page_title":"Paštrić","context_page_description":"Paštrić je naselje v Srbiji, ki upravno spada pod Občino Mionica; slednja pa je del Kolubarskega upravnega okraja."},{"page_url":"https://pl.wikipedia.org/wiki/Airon-Saint-Vaast","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Airon-Saint-Vaast_%C3%A9glise.jpg","page_title":"Airon-Saint-Vaast","context_page_description":"Airon-Saint-Vaast – miejscowość i gmina we Francji, w regionie Hauts-de-France, w departamencie Pas-de-Calais.\\nWedług danych na rok 1990 gminę zamieszkiwało 166 osób, a gęstość zaludnienia wynosiła 28 osób/km²."},{"page_url":"https://et.wikipedia.org/wiki/Bellinzona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Stemma_Bellinzona.svg","page_title":"Bellinzona","context_page_description":"Bellinzona on linn Šveitsis, mis on ühtlasi Ticino kantoni halduskeskus."},{"page_url":"https://en.wikipedia.org/wiki/Edward_Vernon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Edward_Vernon_by_Thomas_Gainsborough.jpg","page_title":"Edward Vernon","context_page_description":"Admiral Edward Vernon was an English naval officer. He had a long and distinguished career, rising to the rank of admiral after 46 years service. As a vice admiral during the War of Jenkins' Ear, in 1739 he was responsible for the capture of Porto Bello, seen as expunging the failure of Admiral Hosier there in a previous conflict. However, his amphibious operation against the Spanish port of Cartagena de Indias was a disastrous defeat. Vernon also served as a Member of Parliament on three occasions and was outspoken on naval matters in Parliament, making him a controversial figure.\\nThe origin of the name \\"grog\\" for rum diluted with water is attributed to Vernon. He was known for wearing coats made of grogram cloth, earning him the nickname of \\"Old Grog\\", which in turn came to mean the diluted rum that he first introduced into his naval squadron. He is also the namesake of George Washington's estate Mount Vernon, and thereby the many places in the United States named after it."},{"page_url":"https://fr.wikipedia.org/wiki/Dom%C3%A8vre-sous-Montfort","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Map_commune_FR_insee_code_88144.png","page_title":"Domèvre-sous-Montfort","context_page_description":"Domèvre-sous-Montfort est une commune française située dans le département des Vosges en région Grand Est."},{"page_url":"https://eo.wikipedia.org/wiki/Manipulo_(katolika_ornato)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Manipularze.jpg","page_title":"Manipulo (katolika ornato)","context_page_description":"La manipulo estas liturgia ornato. uzata eb la roma rito de la Katolika Eklezio. Dum la Eŭkaristia celebrado la presbitero, diakono kaj subdiakono ĝin surmetas sur maldekstra antaŭbrako."},{"page_url":"https://en.wikipedia.org/wiki/Scott_Gaylord","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/ScottGaylordHANS.jpg","page_title":"Scott Gaylord","context_page_description":"Scott Gaylord is an American race car driver. He has competed in four NASCAR Winston Cup Series races, all at Sears Point Raceway, most recently in 1996. He has been a long time competitor in the NASCAR Camping World West Series. Many of his starts in NASCAR's highest levels have been on the West Coast of the United States and on road courses.\\nHe has been a long term competitor in the Winston West / Camping World West Series, competing against Ron Hornaday and Kevin Harvick. He regularly competed for over a dozen years; accumulating six pole positions and over 24 top five finishes. His best career West finish were two second-place finishes.\\nGaylord runs Gaylord's Garage in Lakewood, Colorado when he's not racing."},{"page_url":"https://en.wikipedia.org/wiki/Salins,_Cantal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Chute_de_l%27Auze_a_Salins_%283%29.JPG","page_title":"Salins, Cantal","context_page_description":"Salins is a commune in the Cantal department in south-central France."},{"page_url":"https://fr.wikipedia.org/wiki/Thou_(Loiret)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Thou.Loiret-mairie-01.JPG","page_title":"Thou (Loiret)","context_page_description":"Thou est une commune française, située dans le département du Loiret en région Centre-Val de Loire."},{"page_url":"https://en.wikipedia.org/wiki/Gold_plating","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/The_Sounds_of_Earth_Record_Cover_-_GPN-2000-001978.jpg","page_title":"Gold plating","context_page_description":"Gold plating is a method of depositing a thin layer of gold onto the surface of another metal, most often copper or silver, by chemical or electrochemical plating."},{"page_url":"https://cs.wikipedia.org/wiki/Viktor_Dyk","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/M%C4%9Bln%C3%ADk_Viktor_Dyk.JPG","page_title":"Viktor Dyk","context_page_description":"Viktor Dyk byl český básník, prozaik, dramatik, publicista a nacionalistický politik, v mládí jeden z představitelů tzv. generace anarchistických buřičů, později nacionalisticky orientovaný autor. Za 1. světové války byl členem domácího odboje a byl také signatářem Manifestu českých spisovatelů. Mezi jeho nejznámější literární díla patří např. novela Krysař, drama Zmoudření Dona Quijota či básnická sbírka Devátá vlna."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%A0tuk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Jonah_house2%2C_Pardubice%2C_Czech_Republic.jpg","page_title":"Štuk","context_page_description":"Štuk je směs z jemného písku, vápna, případně sádry nebo cementu, která se užívá na svrchní vrstvu omítky. Nanáší se v kašovitém stavu a po ztuhnutí je tvrdá a poměrně křehká. U starších architektonických staveb se ze štuku tvořily i plastické ozdoby, reliéfy a římsy na vnějších fasádách i na stropech a stěnách kostelů, zámeckých i bohatších měšťanských budov."},{"page_url":"https://az.wikipedia.org/wiki/Qalan%C3%A7oj","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Galanchoj.jpg","page_title":"Qalançoj","context_page_description":"Qalançoy - Çeçenistan Respublikasının Qalançoj rayonunun mərkəzi kəndi. Hal-hazırda kənddə yaşayış yoxdur."},{"page_url":"https://es.wikipedia.org/wiki/Aloe_perfoliata","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Aloe_perfoliata-IMG_5557.jpg","page_title":"Aloe perfoliata","context_page_description":"Aloe perfoliata es una planta suculenta perteneciente al género de los aloes. Es endémica de Namibia y Sudáfrica.\\n​"},{"page_url":"https://it.wikipedia.org/wiki/Universit%C3%A0_di_Tirana","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Tirana_Mother_Teresa_Square.jpg","page_title":"Università di Tirana","context_page_description":"L'Università di Tirana è la principale istituzione universitaria della capitale albanese.\\nFondata nel 1957 come Università Statale di Tirana, è stata la prima università fondata in Albania. Dal 1985 al 1992 prese il nome di Università di Tirana \\"Enver Hoxha\\", in onore al dittatore albanese Enver Hoxha.\\nSi trova in Piazza Madre Teresa.\\nInizialmente prevedeva dieci facoltà, ma dal 1991 le facoltà di ingegneria furono scorporate dall'università confluendo nell'istituenda Università Politecnica di Tirana.\\nAttualmente comprende sette facoltà che coprono le scienze umane, economiche, naturali e mediche. Gli studenti immatricolati sono circa 14.000 e 600 professori. Dal 2008 il rettore è Mynyr Koni."},{"page_url":"https://fr.wikipedia.org/wiki/T%C5%99ebichovice","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/T%C5%99ebichovice_znak.jpg","page_title":"Třebichovice","context_page_description":"Třebichovice est une commune du district de Kladno, dans la région de Bohême-Centrale, en Tchéquie. Sa population s'élevait à 584 habitants en 2020."},{"page_url":"https://fr.wikipedia.org/wiki/San_Pedro_del_Pinatar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Spsalinas.jpg","page_title":"San Pedro del Pinatar","context_page_description":"San Pedro del Pinatar est une commune de la Région de Murcie en Espagne."},{"page_url":"https://de.wikipedia.org/wiki/Vertragsstaatenkonferenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/COP18_Doha_2012.jpg","page_title":"Vertragsstaatenkonferenz","context_page_description":"Eine Vertragsstaatenkonferenz oder Vertragsparteienkonferenz ist im Völkerrecht das höchste Gremium einer internationalen Konventionen bzw. eines Übereinkommen, also etwa solchen unter der Schirmherrschaft der UNO oder der WHO. Alle Vertragsstaaten sind jeweils zur Teilnahme eingeladen.\\nInternationale Konventionen bzw. Übereinkommen mit einer meist jährlich oder zweijährlich stattfindenden Vertragsstaatenkonferenz sind beispielsweise:\\nKlimarahmenkonvention der Vereinten Nationen\\nUN-Klimakonferenz\\nÜbereinkommen der Vereinten Nationen zur Bekämpfung der Wüstenbildung\\nÜbereinkommen der Vereinten Nationen gegen Korruption\\nÜbereinkommen zur Erhaltung wandernder wild lebender Tierarten\\nWashingtoner Artenschutzübereinkommen\\nÜbereinkommen über die biologische Vielfalt\\nRamsar-Konvention\\nBasler Übereinkommen\\nRotterdamer Übereinkommen\\nStockholmer Übereinkommen\\nVertrag über die Nichtverbreitung von Kernwaffen\\nChemiewaffenkonvention\\nKyoto-Protokoll\\nRahmenübereinkommen der WHO zur Eindämmung des Tabakgebrauchs\\nWiener Übereinkommen zum Schutz der Ozonschicht und das dieses Übereinkommen konkretisierende Montreal-Protokoll"},{"page_url":"https://es.wikipedia.org/wiki/Olcott","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Olcott_Beach_Marina.jpg","page_title":"Olcott","context_page_description":"Olcott es un lugar designado por el censo ubicado en el condado de Niágara en el estado estadounidense de Nueva York. En el año 2000 tenía una población de 1,156 habitantes y una densidad poblacional de 97.2 personas por km²."},{"page_url":"https://gl.wikipedia.org/wiki/Beniel","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Localizaci%C3%B3n_de_Beniel.svg","page_title":"Beniel","context_page_description":"Beniel é un concello español da Rexión de Murcia, situado na Huerta de Murcia. Tiña unha poboación de 11.112 habitantes en 2014 repartidas entre a capital municipal e as súas pedanías: La Basca, El Mojón e El Raiguero-La Villa.\\nEstá situado a unha altitude de 28 msnm. Limita ao norte e leste con Orihuela, na provincia de Alacant, e ao sur e oeste co concello de Murcia."},{"page_url":"https://hr.wikipedia.org/wiki/Palladijeve_vile","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Villa_Porto_%28Vivaro_di_Dueville%29_20081204-1.jpg","page_title":"Palladijeve vile","context_page_description":"Grad Vicenza i Palladijeve Vile u pokrajini Veneto upisani su na UNESCO-v popis mjesta svjetske baštine u Europi 1994. god. kako bi se zaštitila ostavština arhitekta Andrea Palladija. Isprva su na popis bili upisani samo objekti na području grada Vicenze, kao što su Teatro Olimpico, palače i nekoliko vila. Međutim, većina Palladijevih vila nalazi se izvan grada, pa se popis proširio 1996. god. kako bi i one bile uključene. Današnji naziv odražava činjenicu da zaštićena lokacija uključuje Paladijeve vile diljem pokrajine Veneto.\\nVila je izraz koji se koristi za opis ladanjske kuće, često bogatih obitelji, a u pokrajini Veneto poznate su i pod nazivom palače. U većini slučajeva vlasnici svoje palače i vile zovu obiteljskim prezimenom, pa postoje dvije palače Chiericati, jedna u Vicenzi, a druga na ladanju. Isto tako, palača Foscari je u Veneciji, a vila Foscari na ladanju. Pomalo zbunjujuće je da postoji više vila Pisani, uključujući i dvije Palladijeve."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%B4%9D%E5%B0%94%E6%A0%BC%E8%8E%B1%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Belagerung_belgrad_1717.jpg","page_title":"贝尔格莱德","context_page_description":"貝爾格勒是歐洲國家塞爾維亞的首都和最大城市，以及當年南斯拉夫聯邦時期的總首都。貝爾格勒市位於塞爾維亞北部薩瓦河和多瑙河匯合處，此處也是潘諾尼亞平原和巴爾幹半島的相遇處。貝爾格勒市內共有人口123萬，整個行政區範圍內的人口達到近170萬，是原南斯拉夫地區最大的城市。\\n貝爾格勒地區最早的人類居住出現在公元前4800年溫查文明時期。凱爾特人於公元前3世紀征服了這一地區，並將其命名為Singidunum， 後被羅馬帝國占領。\\n公元520年，斯拉夫人占領了這一地區。此後它在拜占庭帝國、法蘭克王國、保加利亞王國和奧匈帝國之間幾次易手。城市的斯拉夫語名字Beligrad第一次被提及是在878年。1284年，貝爾格勒第一次成為塞爾維亞斯雷姆王國的首都。在1521年，貝爾格勒被鄂圖曼帝國占領，並在鄂圖曼帝國和哈布斯堡王朝的統治之間幾度易手，並在1841年重新成為塞爾維亞的首都。此後，自1918年至1991年，貝爾格勒是南斯拉夫首都。南斯拉夫解體後，它又成為塞爾維亞與蒙特內哥羅的行政、立法首都，直至2006年蒙特內哥羅獨立後成為塞爾維亞首都。。\\n貝爾格勒是塞爾維亞唯一的直轄市，被分為17個自治市，每一個都擁有自己的地方委員會。貝爾格勒占塞爾維亞總面積的3.6%，24%的塞爾維亞人居住在該市。貝爾格勒是塞爾維亞的經濟、文化、教育和科技中心。"},{"page_url":"https://en.wikipedia.org/wiki/Iranian_Highflying_Tumbler","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Ghara.jpg","page_title":"Iranian Highflying Tumbler","context_page_description":"The Iranian Highflying Tumbler pigeon also known as \\"Persian Highflying Tumbler\\" in Europe and \\"Tehrani\\" in Iran is a breed of domestic pigeon bred in Iran* for performance and endurance flying competitions. They fly at very high altitude and at times out of sight. The tumbling is nothing like a Birmingham Roller, individual flips, occasionally hovering before it does the flip.\\nThe best birds tend to rise above the rest of the kit to show off their talents. The flying characteristic of the Iranian Highflyer is that of a soaring/hovering bird, with a slower wing beat than most flying breeds of pigeons. They are endurance flyers gaining altitude quickly, and have been reported to fly as long as 8 to 12 hours.\\nThe Persian Highflying Tumbler comes in various patterns and colors both in plain headed or crested.\\nThey come from three major cities: Tehran, Kashan and Qom. The high flyer type can be found in other parts of Iran."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%A7%D8%B1%D9%8A%D8%AE_%D9%85%D8%B5%D8%B1_%D8%A7%D9%84%D8%B9%D8%B3%D9%83%D8%B1%D9%8A_%D8%AE%D9%84%D8%A7%D9%84_%D8%A7%D9%84%D8%AD%D8%B1%D8%A8_%D8%A7%D9%84%D8%B9%D8%A7%D9%84%D9%85%D9%8A%D8%A9_%D8%A7%D9%84%D8%AB%D8%A7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Eg-map.png","page_title":"تاريخ مصر العسكري خلال الحرب العالمية الثانية","context_page_description":"في عام 1882 أصبحت مصر بحكم الواقع تحت الاحتلال البريطاني، واستمر هذا حتى عام 1922 عندما مُنحت مصر استقلالها، ولكن القوات البريطانية بقيت في البلاد لأن الحكم الذاتي الحقيقي لم يتم حتى الجلاء البريطاني سنة 1954م."},{"page_url":"https://no.wikipedia.org/wiki/Royal_Dublin_Society","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Dublin_Horse_Show_2008_-_main_arena.jpg","page_title":"Royal Dublin Society","context_page_description":"Royal Dublin Society, forkortet RDS, er en filantropisk forening i Irland. Foreningen ble grunnlagt 25. juni 1731 under navnet Dublin Society, og i 1820 fikk den sitt nåværende navn. RDS' hovedmål er å fremme kulturell og økonomisk utvikling i Irland. RDS har også et eget senter i bydelen Ballsbrigde i Dublin i Irland. Området omfatter RDS Arena, RDS Simmonscourt, RDS Main Hall samt flere andre bygninger som regelmessig brukes til utstillinger, konserter og idrettsarrangementer – blant annet for Leinster Rugby."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%BD%CE%B8%CF%81%CE%B1%CE%BA%CE%B9%CE%BA%CF%8C_%CE%BD%CE%AC%CF%84%CF%81%CE%B9%CE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Sodium-carbonate-xtal-3D-SF-C.png","page_title":"Ανθρακικό νάτριο","context_page_description":"Το ανθρακικό νάτριο, γνωστό και ως κρυσταλλική σόδα, σόδα πλύσης και τέφρα σόδας, με χημικό τύπο Na₂CO₃, είναι το υδατοδιαλυτό άλας του ανθρακικού οξέος με νάτριο.\\nΕμφανίζεται συνήθως ως κρυσταλλικό επταένυδρο, που αφυδατώνεται αμέσως για να σχηματίσει μια λευκή σκόνη τον, μονοένυδρο. Το καθαρό ανθρακικό νάτριο είναι μια λευκή, άοσμη σκόνη που είναι υγροσκοπική, έχει αλκαλική γεύση και σχηματίζει ένα ισχυρά αλκαλικό υδατικό διάλυμα. Το ανθρακικό νάτριο είναι αρκετά γνωστό στα σπίτια για την καθημερινή του χρήση ως αποσκληρυντικό του νερού.Μπορεί να εξαχθεί από τις τέφρες πολλών φυτών που αναπτύσσονται σε εδάφη που είναι πλούσια σε νάτριο, όπως στη βλάστηση από τη Μέση Ανατολή, στις κέλπιες της Σκωτίας και τα θαλάσσια φύκη της Ισπανίας. Επειδή οι τέφρες από αυτά τα πλούσια σε νάτριο φυτά ήταν αρκετά διαφορετικές από τις στάχτες των ξύλων"},{"page_url":"https://es.wikipedia.org/wiki/Caso_Jimmy","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Jimmy_Riazor_Blues.jpg","page_title":"Caso Jimmy","context_page_description":"Con el nombre caso Jimmy se conocen los sucesos relacionados con la muerte de Francisco Javier Romero Taboada \\"Jimmy\\" el 30 de noviembre de 2014 en Madrid, España. Jimmy, un ultra perteneciente a los Riazor Blues, se había desplazado a Madrid para asistir la fecha de los hechos al encuentro que disputaba el club del que era seguidor contra el Club Atlético de Madrid en el estadio Vicente Calderón, partido correspondiente a la 13.ª jornada de la Primera División de España 2014-15. Esa mañana, los miembros de Riazor Blues se vieron envueltos en una pelea multitudinaria contra miembros del Frente Atlético en Madrid Río.\\nEn el transcurso de la pelea, Jimmy fue arrojado al río Manzanares por miembros del Frente y falleció por un fuerte traumatismo craneoencefálico.​"},{"page_url":"https://de.wikipedia.org/wiki/Wjatka_(Fluss)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Vyatka_River.JPG","page_title":"Wjatka (Fluss)","context_page_description":"Die Wjatka ist ein 1314 km langer rechter Nebenfluss der Kama im Osten des europäischen Teils von Russland."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D8%AF%D9%88%D9%84_%D8%B2%D9%85%D9%86%D9%8A_%D9%84%D8%A3%D8%A8%D8%AD%D8%A7%D8%AB_%D8%A7%D9%84%D8%A8%D9%84%D9%8A%D8%B2%D9%88%D8%B5%D9%88%D8%B1%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Laelaps-cope.jpg","page_title":"جدول زمني لأبحاث البليزوصورات","context_page_description":"الجدول الزمني لأبحاث البليزوصورات ‏ وهو قائمة مرتبة حسب التصنيف الزمني الذي يضم الاكتشافات الاحفورية المهمة والجدالات القائمة التي أجريت حول تفسيرها، التنقيحات التصنيفية والصور المستولدة للبليزوصورات، وهي رتبة من الزواحف البحرية التي ازدهرت خلال عصر الديناصورات. اكتشفت أول أحافير البليزوصورات الموثقة علميًا أثناء أوائل القرن التاسع عشر بواسطة ماري أنينج. اكتشفت ووَصَفت البليزوصورات فعليًا قبل الدينوصورات. وكانت أيضًا من بين الحيوانات المصنفة اولياً التي برزت في عمليات إعادة التشكيل الفنية للعالم القديم، ومن ثم من بين أوائل كائنات ما قبل التأريخ لجذب اهتمام الجمهور العادي. كان هناك اعتقاد سائد أنَّ البليزوصورات في الاصل نوعًا من أشكال الانتقال البدائي بين الحياة البحرية والزواحف البرية. ومع ذلك، تعرف البليزوصورات الآن كزواحف بحرية مستمدة من الأسلاف البرية.\\nكان هناك اعتقاد سائد بين الباحثون الأوائل أن البليزوصورات وَضَعت البيض مثل الغالبية العظمى من الزواحف. وتصوروا ايضاُ إنَّ البليزوصورات تزحف إلى الشواطئ وتدفن البيض مثل السلاحف. مع ذلك، انتقل الرأي لاحقًا نحو فكرة أنَّ البليزوصورات أنجبت ولم تذهب مطلقًا إلى اليابسة. كان تحرك البليزوصورات مصدر خلاف مستمر بين علماء الحفريات."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A_%D8%A8%D9%88%D9%84_%D8%A3%D9%88%D8%B3%D8%AA%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/J._Paul_Austin_1966_press_photo.jpg","page_title":"جي بول أوستن","context_page_description":"جي بول أوستن ‏ هو سياسي من الولايات المتحدة الأمريكية ولد في لاغرانغ."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D0%B9%D0%B4%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Automaidan_Odessa_04.JPG","page_title":"Автомайдан","context_page_description":"«Автомайда́н» — мобільний підрозділ Євромайдану, який складався з групи самостійних колон автомобілістів. Виконували екстериторіальні завдання мирного спротиву владі: патрулювання вулиць, блокування адміністративних будівель і помешкань членів режиму, супроводження та евакуація активістів. Де-факто створений 30 листопада 2013 року."},{"page_url":"https://id.wikipedia.org/wiki/Jalur_kereta_api_Kertosono%E2%80%93Bangil","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Stasiun_Kertosono_2019.jpg","page_title":"Jalur kereta api Kertosono–Bangil","context_page_description":"Jalur kereta api Kertosono–Bangil—dikenal sebagai jalur kantung— adalah salah satu jalur penting dalam sejarah perkeretaapian di Jawa Timur. Jalur ini termasuk dalam Daerah Operasi VIII Surabaya dan Daerah Operasi VII Madiun melalui Kediri, Blitar, dan Malang.\\nDi jalur ini, terdapat dua terowongan buatan dalam negeri bernama Eka Bakti Karya dan Dwi Bakti Karya. Kedua terowongan tersebut dibangun bersebelahan dengan Waduk Sutami pada tahun 1969, tepatnya di petak jalur antara Stasiun Sumberpucung dan Stasiun Pogajih. Selain itu, terdapat pula Jembatan Lahor yang merupakan jembatan terpanjang di jalur tersebut."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9C%D0%B5%D0%B3%D0%BB%D0%B8%D0%BD%D0%B3%D0%B5%D0%BD_(%D0%9E%D1%81%D1%82%D0%B0%D0%BB%D0%B1%D0%BA%D1%80%D0%B0%D1%98%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/M%C3%B6gglingen_in_AA.svg","page_title":"Меглинген (Осталбкрајс)","context_page_description":"Меглинген општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 42 општинска средишта округа Осталб. Посједује регионалну шифру 8136043."},{"page_url":"https://cs.wikipedia.org/wiki/Pl%C3%A9d","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Bagpiper_RAF_Lakenheath.jpg","page_title":"Pléd","context_page_description":"Pléd může být:"},{"page_url":"https://fr.wikipedia.org/wiki/Littorinimorpha","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Tonna_galea_01.jpg","page_title":"Littorinimorpha","context_page_description":"Les Littorinimorpha constituent un ordre de mollusques prosobranches de la classe des gastéropodes, de la sous-classe des Caenogastropoda."},{"page_url":"https://pl.wikipedia.org/wiki/Rocquigny_(Ardeny)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Mainbressy_mairie_1.jpg","page_title":"Rocquigny (Ardeny)","context_page_description":"Rocquigny – miejscowość i gmina we Francji, w regionie Grand Est, w departamencie Ardeny.\\nWedług danych na rok 1990 gminę zamieszkiwało 775 osób, a gęstość zaludnienia wynosiła 21 osób/km²."},{"page_url":"https://de.wikipedia.org/wiki/Altes_Postgeb%C3%A4ude_(Ostende)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/MAES_Jo-ceramic_relief-The_Future_Of_Post_Service.jpg","page_title":"Altes Postgebäude (Ostende)","context_page_description":"Das Alte Postgebäude von Ostende diente bis 1999 als Postamt der flämischen Stadt Ostende und befindet sich in der Hendrik Serruyslaan 18. Es wurde in den Jahren 1947–1953 nach dem Entwurf des Architekten und Designers Gaston Eysselinck erbaut. Seit Dezember 2012 wird das Gebäude als Kulturzentrum De Grote Post genutzt."},{"page_url":"https://nl.wikipedia.org/wiki/ABBA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Abba_28011977_15_200.jpg","page_title":"ABBA","context_page_description":"ABBA is een Zweedse popgroep, die in 1972 in Stockholm gevormd werd door Agnetha Fältskog, Björn Ulvaeus, Benny Andersson en Anni-Frid Lyngstad. ABBA is een van de succesvolste bands ter wereld met meer dan 200 miljoen verkochte albums. Het succes begon toen ABBA in 1974 het Eurovisiesongfestival won met het nummer Waterloo.\\nDe naam ABBA is een acroniem, bestaande uit de eerste letters van de voornamen van de leden. Op de platenhoezen staat de eerste B vaak in spiegelbeeld. Dit beeldmerk werd in 1976 voor het eerst toegepast op de hoes van de single Dancing Queen, en is ontworpen door Rune Söderqvist. Door de B's naar de A's te keren wilde Söderqvist ook benadrukken dat ABBA uit twee stellen bestaat.\\nStig Anderson was in de jaren 70 en 80 de manager van de groep. In 1983 laste ABBA een pauze in, die leidde tot het uiteenvallen van de formatie. In april 2018 werd bekend dat ABBA weer twee nummers had opgenomen: I Still Have Faith in You en Don't Shut Me Down."},{"page_url":"https://pt.wikipedia.org/wiki/Zubizuri","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Bilboko_Zubizuriko_zorua.jpg","page_title":"Zubizuri","context_page_description":"O Zubizuri, também conhecido como Puente Peatonal del Campo de Volantín, embora popularmente seja chamado de \\"ponte de Calatrava\\", é uma ponte em arco sobre a ria de Bilbau, na cidade basca de Bilbau, no norte da Espanha. Liga o Campo de Volantín na margem direita com Uribitarte na margem esquerda."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%B8%E0%B4%82%E0%B4%97%E0%B5%80%E0%B4%A4%E0%B4%9C%E0%B5%80%E0%B4%B5%E0%B4%B6%E0%B4%BE%E0%B4%B8%E0%B5%8D%E0%B4%A4%E0%B5%8D%E0%B4%B0%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Louis_Gallait_-_Power_of_Music_-_Walters_37134.jpg","page_title":"സംഗീതജീവശാസ്ത്രം","context_page_description":"സംഗീതത്തെ ജീവശാസ്ത്രപരമായ കാഴ്ചപ്പാടിലൂടെ പഠിക്കുന്ന ഒരു ശാസ്ത്രശാഖയാണ് സംഗീത ജീവശാസ്ത്രം അഥവാ ബയോ മ്യൂസിക്കോളജി. 1991-ൽ നില്സ് എൽ. വാലിൻ ആണ് ഈ പദം ആദ്യമായി ഉപയോഗിച്ചത്. സംഗീത മനഃശാസ്ത്രം, സംഗീതശാസ്ത്രം എന്നിവയുടെ വിവിധ ശാഖകൾ വിശദീകരിക്കുന്ന ശാസ്ത്രശാഖയാണിത്. പരിണാമസംഗീതശാസ്ത്രം, താരതമ്യ സംഗീതശാസ്ത്രം എന്നിവ ഇതിന്റെ ഭാഗങ്ങളാണ്. പരിണാമ സംഗീതശാസ്ത്രത്തിൽ സംഗീതത്തിന്റെ തുടക്കം, ജീവികളിലെ സംഗീതാത്മക പ്രതികരണം, തുടങ്ങിയവ വിശദീകരിക്കുന്നു. നാഡീയസംഗീതശാസ്ത്രത്തിൽ സംഗീതവുമായി ബന്ധപ്പെട്ട നാഡീകേന്ദ്രങ്ങളെക്കുറിച്ചും പഠിക്കുന്നു. താരതമ്യ സംഗീതശാസ്ത്രത്തിൽ, സംഗീതത്തിൻറെ പ്രാധാന്യം, ജീവികളിൽ സംഗീതം ഉണ്ടാക്കുന്ന മാറ്റം, അവയുടെ പെരുമാറ്റത്തിലെ സവിശേഷതകൾ തുടങ്ങിയവ പഠിക്കുന്നു. പ്രായോഗിക മനഃശാസ്ത്രത്തിൽ സംഗീതത്തിന്റെ ചികിത്സാ സാധ്യതകൾ പരിഗണിക്കുന്നു. മനോരോഗ ചികിത്സയിൽ ആണ് ഇതിന്റെ സാധ്യത കൂടുതലായി ഉള്ളത്. കൂടാതെ, പഠനത്തിൽ സംഗീതത്തിന് ചെലുത്താവുന്ന സ്വാധീനത്തെക്കുറിച്ചും വിശദീകരിക്കുന്നു. ബയോ മ്യൂസിക്കോളജി പ്രധാനമായും മനുഷ്യരുമായി ബന്ധപ്പെട്ട സംഗീത മേഖലകളെ പരാമർശിക്കുമ്പോൾ സുവോമ്യൂസിക്കോളജി മറ്റു ജീവികളിൽ സംഗീതം ഉണ്ടാക്കുന്ന സ്വാധീനത്തെപ്പറ്റി പഠിക്കുന്നു."},{"page_url":"https://de.wikipedia.org/wiki/Hermann_Geiger_(Maler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Hermann_Geiger_in_seinem_Atelier.jpg","page_title":"Hermann Geiger (Maler)","context_page_description":"Hermann Geiger war ein deutscher Maler und Grafiker, der mit verschiedenen Materialien und Techniken arbeitete."},{"page_url":"https://sv.wikipedia.org/wiki/Ulvsundaskolan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Lunaskolan_vid_Ulvsundaskolan%2C_2013c.jpg","page_title":"Ulvsundaskolan","context_page_description":"Ulvsundaskolan, tidigare Ulvsunda folkskola, som byggdes 1948, ligger på Johannesfredsvägen 45 i Johannesfred i Bromma väster om Stockholm och är en kommunal lågstadieskola med drygt 90 elever. Skolbyggnaden ritades av arkitekt Björn Hedvall. Skolan är en grundskola och har årskurserna F till 3, det vill säga Förskoleklass samt klasserna 1, 2 och 3. Därefter flyttar barnen över till Alviksskolan i Alvik, som Ulvsundaskolan tillhör. Tidigare gick eleverna även årskurs 4, 5 och 6 på Ulvsundaskolan innan de fortsatte på högstadiet på Alviksskolan."},{"page_url":"https://nl.wikipedia.org/wiki/Gilly-sur-Loire","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Gare_de_Gilly-sur-Loire.jpg","page_title":"Gilly-sur-Loire","context_page_description":"Gilly-sur-Loire is een gemeente in het Franse departement Saône-et-Loire en telt 538 inwoners. De plaats maakt deel uit van het arrondissement Charolles."},{"page_url":"https://fr.wikipedia.org/wiki/Dia_(chanteuse)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/DIA_%28Lee_Ji-eun%29_from_Bella_at_the_Incheon_Festival%2C_May_2013_02.jpg","page_title":"Dia (chanteuse)","context_page_description":"Dia est une chanteuse sud-coréenne et membre du girl group maintenant séparé Kiss&Cry."},{"page_url":"https://zh.wikipedia.org/zh-cn/HK_MP5%E5%86%B2%E9%94%8B%E6%9E%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/US_special_forces_playing_pool_at_a_village_in_Afghanistan.jpg","page_title":"HK MP5冲锋枪","context_page_description":"HK MP5系列是由德国军械厂黑克勒-科赫所设计及制造的冲锋枪，是黑克勒-科赫最著名及制造量最多的枪械产品。由于该系列冲锋枪获多国的武装部队、保安部队、警队选择作为制式枪械使用，因此具有极高的知名度。"},{"page_url":"https://de.wikipedia.org/wiki/Karl_Gerstner","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Karl_Gerstner_Kompendium.jpg","page_title":"Karl Gerstner","context_page_description":"Karl Gerstner war ein Schweizer Grafikdesigner, Werber und bedeutender Vertreter der Schweizer Typografie."},{"page_url":"https://zh.wikipedia.org/zh-tw/2018%E5%B9%B4%E5%A4%A7%E9%A9%AC%E5%A3%AB%E9%9D%A9%E5%92%8C%E9%9C%8D%E5%A7%86%E6%96%AF%E8%BD%B0%E7%82%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/2018_bombing_of_Damascus_and_Homs_Syrian_protesters.png","page_title":"2018年大马士革和霍姆斯轰炸","context_page_description":"當地時間2018年4月14日凌晨4點起，美國、法國和英國利用海空飛彈襲擊敘利亞政府的多個目標，回應4月7日發生在杜馬的化學襲擊。敘利亞政府否認參與杜馬襲擊，並表示空襲違反國際法。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%87%D0%B8%D1%85%D0%B8%D0%BD%D0%BE_(%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Machihino_village_%28road_to_railway_platform%29.JPG","page_title":"Мачихино (деревня)","context_page_description":"Мачихино — деревня в Троицком административном округе Москвы. Входит в состав поселения Киевский.\\nНазвание, предположительно, произошло от некалендарного личного имени Мачеха."},{"page_url":"https://pl.wikipedia.org/wiki/Jermak_(1898)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Yermak1897-1964.jpg","page_title":"Jermak (1898)","context_page_description":"Jermak – rosyjski lodołamacz. Pierwszy na świecie specjalistyczny statek tego typu."},{"page_url":"https://io.wikipedia.org/wiki/Redfoo","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/LMFAO%2C_2011.jpg","page_title":"Redfoo","context_page_description":"Stefan Kendal Gordy, surnomizita Redfoo esas kantisto e kompozisto Usana, konocita kom membro de la dueto LMFAO de 2006 til 2012."},{"page_url":"https://eu.wikipedia.org/wiki/Tour-en-Sologne","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/SchlossVillesavinO.jpg","page_title":"Tour-en-Sologne","context_page_description":"Tour-en-Sologne Frantziako udalerri bat da, Loir-et-Cher departamenduan dagoena, Centre eskualdean. 2013an 885 biztanle zituen."},{"page_url":"https://fi.wikipedia.org/wiki/Power_Macintosh_4400","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Power_Macintosh_7220.jpg","page_title":"Power Macintosh 4400","context_page_description":"Power Macintosh 4400 on Apple Computerin 7. marraskuuta 1996 Euroopassa julkaisema tietokone. 17. helmikuuta 1997 laitteesta julkaistiin nopeammalla suorittimella varustettu versio Pohjois-Amerikassa ja Australiassa. Australian versio sai nimekseen Power Macintosh 7220. Hinnan matalana pitämiseksi Power Macintosh 4400 pyrki käyttämään mahdollisuuksien mukaan tietokoneteollisuuden standardiosia. Tietokone käytti Applen ja Motorolan yhteistyössä kehittämää Tanzania-emolevyä. Power Macintosh 4400:sta julkaistiin myös PC-yhteensopivia malleja, jotka sisälsivät ylimääräisen, prosessorikortilla sijaitsevan 166 MHz:n x86-suorittimen. Laitteiden tuotanto lakkautettiin 1. tammikuuta 1998."},{"page_url":"https://de.wikipedia.org/wiki/St._Martin_SG","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/St.MartinSG02.jpg","page_title":"St. Martin SG","context_page_description":"St. Martin im Calfeisental ist ein Weiler und eine ehemalige Walsersiedlung der Ortschaft Vättis in der politischen Gemeinde Pfäfers in der südöstlichsten Ecke des Kantons St. Gallen. Er befindet sich im Wahlkreis Sarganserland."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%91%D7%97_%D7%94%D7%A1%D7%A4%D7%95%D7%A8%D7%98%D7%90%D7%99%D7%9D_%D7%91%D7%90%D7%95%D7%9C%D7%99%D7%9E%D7%A4%D7%99%D7%90%D7%93%D7%AA_%D7%9E%D7%99%D7%A0%D7%9B%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/MunichIsraeliOlympicFront.jpg","page_title":"טבח הספורטאים באולימפיאדת מינכן","context_page_description":"טבח הספורטאים באולימפיאדת מינכן הוא אירוע טרור פלסטיני שהתרחש ב-5–6 בספטמבר 1972, במהלך האולימפיאדה העשרים שהתקיימה במינכן בגרמניה המערבית, שבו נרצחו אחד-עשר ספורטאים, מאמנים ושופטים, חברי המשלחת האולימפית הישראלית, על ידי מחבלים פלסטינים מארגון \\"ספטמבר השחור\\". שניים מהחללים נרצחו בתוך מגורי המשלחת הישראלית בכפר האולימפי תוך כדי השתלטות המחבלים על חברי המשלחת, ותשעת האחרים, שהוחזקו כבני ערובה במשך כ-19 שעות, נרצחו במהלך ניסיון חילוץ כושל של כוחות משטרת בוואריה בשדה תעופה סמוך לעיר, שבו נהרגו גם שוטר גרמני אחד וחמישה מתוך שמונת המחבלים.\\nלמרות השנים הרבות שחלפו, הטבח נחשב עד היום, לאחת מפעולות הטרור הידועות ביותר, עקב נסיבות התרחשותו במהלך אירוע הספורט החשוב ביותר, שהביאו אותו לפרסום עולמי. מחמוד דאוד ע'ודה, ראש ארגון \\"ספטמבר השחור\\" ומתכנן פעולת הטרור, טוען בספרו האוטוביוגרפי שמחמוד עבאס, לימים ראש הרשות הפלסטינית, היה בין המעטים ששותפו בסוד העניין והוא שדאג למימון הפעולה. עבאס טען שלא ידע למה עתיד לשמש הכסף."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Recorded_Texas_Historic_Landmarks_(Cameron-Duval)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Dallam_County%2C_TX%2C_Courthouse_IMG_0555.JPG","page_title":"List of Recorded Texas Historic Landmarks (Cameron-Duval)","context_page_description":"The following is a partial list of Recorded Texas Historic Landmarks arranged by county as designated by the Texas Historical Commission and local county historical commissions in Texas. This page includes RTHLs in these counties: Cameron, Camp, Carson, Cass, Castro, Chambers, Cherokee, Childress, Clay, Cochran, Coke, Coleman, Collin, Collingsworth, Colorado, Comal, Comanche, Concho, Cooke, Coryell, Cottle, Crane, Crockett, Crosby, Culberson, Dallam, Dallas, Dawson, DeWitt, Deaf Smith, Delta, Denton, Dickens, Dimmit, Donley, and Duval.\\nKEY\\nLandmarks with multiple historic designations are colored according to their highest designation within the following hierarchy."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%B3%D8%B7%D9%86%D8%A8%D9%88%D9%84_%D9%81%D9%8A_%D8%B9%D9%87%D8%AF_%D8%B3%D9%84%D9%8A%D9%85%D8%A7%D9%86_%D8%A7%D9%84%D9%82%D8%A7%D9%86%D9%88%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/%C5%9Eehzade_cami_%281%29.jpg","page_title":"إسطنبول في عهد سليمان القانوني","context_page_description":"إسطنبول، والمعروفة تاريخيًا باسم بيزنطة\\nومن الأسماء التي عُرفت بها المدينة خلال العهد العثماني: \\"دار السعادة\\"، \\"الدار العالية\\"، \\"الباب العالي\\"، \\"مقام العرش\\"، و\\"الأستانة\\" وهي كلمة فارسية من معانيها «العاصمة» أو «مركز السَّلْطَنة»."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%87%8C%E6%98%82%E8%81%96%E5%9F%83%E5%85%8B%E7%B5%AE%E4%BD%A9%E9%87%8C%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Station_d%C3%A9finitive_%22A%C3%A9roport_Lyon_Saint-%C3%89xup%C3%A9ry%22.jpg","page_title":"里昂聖埃克絮佩里站","context_page_description":"里昂聖埃克絮佩里站，又名\\"里昂機場站\\"，曾被命名為Satolas站，是一個位於法國里昂的一個高鐵站，與里昂聖埃克絮佩里機場連接。行經路線為 法國高速鐵路羅納－阿爾卑斯線和法國高速鐵路東南線。此站位於里昂市中心以東約20公里。"},{"page_url":"https://de.wikipedia.org/wiki/Schwarz-Gelb_Wei%C3%9Fenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Schwarz_Gelb_Wei%C3%9Fenfels_%281931%29.png","page_title":"Schwarz-Gelb Weißenfels","context_page_description":"Der Weißenfelser FV Schwarz-Gelb ist ein deutscher Fußballverein aus Weißenfels im Burgenlandkreis. Heimstätte ist der Sportplatz Selauer Straße. Der Club steht in der Tradition der SG Weißenfels-Ost bzw. BSG Empor Weißenfels."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D1%8C%D0%BC%D0%B0%D0%BD,_%D0%98%D0%BC%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/K%C3%A1lm%C3%A1n_Imre_cropped_%28Willinger_Vilmos%2C_1924%29.jpg","page_title":"Кальман, Имре","context_page_description":"И́мре Ка́льман — венгерский композитор, автор популярных оперетт: «Сильва», «Баядера», «Принцесса цирка», «Фиалка Монмартра» и других. Творчество Кальмана завершает период расцвета венской оперетты."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A4%A9%E4%B8%BB%E6%95%99%E5%AE%97%E5%BA%A7%E5%9C%A3%E6%AE%BF%E5%88%97%E8%A1%A8/N-Z","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Krakow_church_20070805_0912.jpg","page_title":"天主教宗座圣殿列表/N-Z","context_page_description":"天主教宗座聖殿列表\\n天主教宗座聖殿列表/A-E | 天主教宗座聖殿列表/F-M | 天主教宗座聖殿列表/N-Z"},{"page_url":"https://de.wikipedia.org/wiki/Hans_M%C3%BCller-Steinhagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Hans_M%C3%BCller-Steinhagen_2010.JPG","page_title":"Hans Müller-Steinhagen","context_page_description":"Hans Michael Gottfried Müller-Steinhagen ist ein deutscher Maschinenbauingenieur und ehemaliger Rektor der Technischen Universität Dresden."},{"page_url":"https://pl.wikipedia.org/wiki/Prezydenci_Brazylii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Figueiredo.jpg","page_title":"Prezydenci Brazylii","context_page_description":"Prezydenci Brazylii – lista Prezydentów Federacyjnej Republiki Brazylii"},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9tro_de_Lisbonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Metro_Lisboa_Dez_2007.png","page_title":"Métro de Lisbonne","context_page_description":"Le métro de Lisbonne est le principal réseau de transport en commun de la capitale du Portugal. Ouvert en 1959, il comporte 4 lignes, 56 stations et 46,5 km de voies. Le métro de Lisbonne se caractérise par la décoration soignée de ses stations les plus récentes. Il a transporté 140 millions de passagers en 2014."},{"page_url":"https://et.wikipedia.org/wiki/Browne","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Browne-Camus%C2%B4_suguv%C3%B5sa_krahvivapp.jpg","page_title":"Browne","context_page_description":"Browne, ka Browne-Camus oli Iirimaa päritolu Liivimaa ja Austria aadlisuguvõsa."},{"page_url":"https://es.wikipedia.org/wiki/Villa_Cultural_La_Estaci%C3%B3n","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Estacion_de_Posadas%2C_Misiones%2C_2012.jpg","page_title":"Villa Cultural La Estación","context_page_description":"Posadas era una estación de ferrocarril de la ciudad homónima, capital de la Provincia de Misiones, Argentina. En 2008 fue clausurada y sus instalaciones fueron transformadas en un centro cultural. Una nueva estación, apeadero Posadas, fue construida en 2014, a 700 metros de la antigua terminal."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%99%D7%9C%D7%99%D7%90%D7%9D_%D7%91%D7%98%D7%9C%D7%A8_%D7%99%D7%99%D7%98%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Yeats_Boughton.jpg","page_title":"ויליאם בטלר ייטס","context_page_description":"ויליאם בטלר ייטס היה משורר, מחזאי ומיסטיקן אירי, חתן פרס נובל לספרות לשנת 1923. ייטס הוא אחד מן האישים הבולטים של הספרות האנגלית בפרט, והספרות בכלל במאה ה-20. הוא היה שותף להקמת תיאטרון אבי, והיה הכוח המניע מאחורי התחייה הספרותית האירית, לצד אישים כגון ליידי אוגוסטה גרגורי, אדוארד מרטין ואחרים. הוא אף כיהן בסנאט האירי במשך שתי קדנציות.\\nכאדם צעיר, הושפע ייטס מהאסתטיקה ומהאחווה הפרה-רפאליטית, לצד המשוררים הסימבוליסטים הצרפתיים. כמו כן, הוא העריץ את המשורר הבריטי ויליאם בלייק. ייטס היה דמות מפתח בתחייה התרבותית האירית, ושאף באמצעות שיריו המוקדמים להחיות מחדש את ספרותה העתיקה של אירלנד. לעיתים ייטס הדגיש בשירתו נושאים פוליטיים, ומעורבותו בענייניה הציבוריים של אירלנד הובילה לבחירתו לסנאט האירי ב-1922. סגנון השירה של ייטס התפתח בכמה שלבים, ומאוחר יותר בחייו הוא נמנה עם המשוררים המודרניסטים הבולטים ביותר, לצד אמנים כמו עזרא פאונד ות. ס. אליוט. ייטס החיה מחדש את טכניקת החריזה והמשקל בתקופה שבה אמנות כתיבת השירה כמעט קפאה על שמריה. כמו המשורר האמריקאי רוברט פרוסט והמשורר הבריטי תומאס הרדי, הוא ידע לנצל בכישרון רב את תבניות השירה בהן השתמש, לכדי מימוש הפוטנציאל הגבוה ביותר הטמון בהן, ובו-זמנית מצא דרך להביע את קולו בשפה עממית מדוברת, חדישה ורעננה."},{"page_url":"https://da.wikipedia.org/wiki/Bearnsk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Flag_of_B%C3%A9arn.svg","page_title":"Bearnsk","context_page_description":"Bearnsk er en dialekt af gasconsk, der er det lokale navn for occitansk, som er det oprindelige sprog i Frankrig syd for Loire. Det er modersmål for indbyggerne i Béarn, og det taltes endnu ved slutningen af det 20. århundrede meget udbredt, men det er i tilbagegang, til trods for at man har fået oprettet de occitanske skoler, calandretas.\\nCalandretas, er tosprogede skoler med undervisning på occitansk og fransk. Det er den occitanske pendant til de bretonske Diwan, de baskiske Ikastola og de nordkatalanske Bressola. Den første calandreta blev åbnet i Pau i 1979.\\nHistorisk set blev bearnsk brugt i officielle tekster med gyldighed i Béarn side om side med fransk indtil den Franske Revolution."},{"page_url":"https://de.wikipedia.org/wiki/Evangeline_(Gedicht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Evangeline_Rice_and_Goodwin%27s_American_opera_bouffe._LCCN2014637092.jpg","page_title":"Evangeline (Gedicht)","context_page_description":"Evangeline, A Tale of Acadie ist ein Versepos des amerikanischen Dichters Henry Wadsworth Longfellow, das 1847 veröffentlicht wurde. Das Gedicht handelt von einem akadischen Mädchen namens Evangeline und ihrer Suche nach ihrer verlorenen Liebe Gabriel zur Zeit der zwangsweisen Aussiedlung der Akadier, des sog. „großen Umbruchs“.\\nDie Idee für das Gedicht stammt von Longfellows Freund Nathaniel Hawthorne. Longfellow verwendet daktylische Hexameter und ahmt damit griechische und lateinische Klassiker nach. Evangeline gehört zu Longfellows berühmtesten und meistgelesenen Werken.\\nDas Gedicht hatte eine starke Auswirkung auf die Geschichtsschreibung und Identität der Akadier im 19. und 20. Jahrhundert. Jüngere Forschungen haben historische Fehler im Gedicht und die Komplexität der Vertreibung aufgezeigt, die vom Gedicht stark vereinfacht wird."},{"page_url":"https://id.wikipedia.org/wiki/Kabupaten_Labuhanbatu_Utara","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Welcome_Gate_to_Labuhanbatu_Utara%2C_Sumatra_Utara_%28Asahan-Labura%29_01.jpg","page_title":"Kabupaten Labuhanbatu Utara","context_page_description":"Kabupaten Labuhanbatu Utara adalah kabupaten yang baru dimekarkan dari Kabupaten Labuhanbatu sesuai dengan Undang-Undang Nomor 23 Tahun 2008 pada 24 Juni 2008 tentang Pembentukan Kabupaten Labuhanbatu Utara, semasa pemerintahan Presiden Susilo Bambang Yudhoyono. Ibu kota kabupaten ini terletak di Aek Kanopan. Salah satu daerah di kabupaten ini, yaitu Tanjung Pasir, pernah menjadi pusat pemerintahan Kesultanan Kualuh pada masa lampau."},{"page_url":"https://hu.wikipedia.org/wiki/Sadrinszk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Oktyabrskaya88_Shadrinsk.JPG","page_title":"Sadrinszk","context_page_description":"Sadrinszk város Oroszországban, a Kurgani területen. Az azonos nevű járás székhelye."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bad_Ems","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Ems_Post_office_2.JPG","page_title":"Liste der Kulturdenkmäler in Bad Ems","context_page_description":"In der Liste der Kulturdenkmäler in Bad Ems sind alle Kulturdenkmäler der rheinland-pfälzischen Stadt Bad Ems aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%A0%EB%A7%88_%EB%B0%9C%EB%A0%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Emma_Bale.jpg","page_title":"엠마 발레","context_page_description":"엠마 발레는 벨기에의 가수이다. 코달라인의 곡 \\"All I Want\\"를 커버해 이름을 알렸다. 싱글 \\"Fortune Cookie\\"는 플랑드르 차트에서 1위를 했다."},{"page_url":"https://eo.wikipedia.org/wiki/Akvario_de_Zella-Mehlis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Erlebnispark_Meeresaquarium.JPG","page_title":"Akvario de Zella-Mehlis","context_page_description":"La Mara gapakvario Zella-Mehlis estas interesa eventoparko unika kaj kvazaŭ hermetika mondo en Zella-Mehlis, Germanio. Ĝi bonege atingeblas kaj trajne kaj aŭtoŝosee."},{"page_url":"https://fr.wikipedia.org/wiki/Mant%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/FOOD_Mantu.jpg","page_title":"Mantı","context_page_description":"Les mantı ou mantis sont des sortes de raviolis fabriquées en Turquie et dans plusieurs cuisines d'Asie centrale et du Caucase et chez les Ouïghours.\\nIls sont assez proches des baozi, des jiaozi, des mandu coréens, des buuz et mantuu mongols, des momo népalais et tibétains, ou des pelmeni russes.\\nUn plat de manti turc se compose de petits raviolis faits à la main, souvent fait avec de l'agneau, de l'oignon et plusieurs épices. La sauce consiste de yogourt épais turc/grec, mélangé avec une pâte d'ail, avec un coulis de beurre épicé. Le plat est décoré avec un nuage de flocons de menthe séchée et/ou de sumac séché sur le dessus.\\nDans la recette originale, la farce se compose de boulettes de viande hachée assez épicées, généralement d'agneau ou de bœuf, enveloppées dans des ravioles avec un peu d'oignon. Ils peuvent être bouillis ou cuits à la vapeur. Le mot qui les désigne n'est utilisé que dans sa forme plurielle et désigne un ensemble de boulettes dans un plat ou une marmite."},{"page_url":"https://en.wikipedia.org/wiki/List_of_diplomatic_missions_of_Pakistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Embassy_of_Pakistan%2C_Sarajevo.jpg","page_title":"List of diplomatic missions of Pakistan","context_page_description":"This is a list of diplomatic missions of Pakistan, excluding honorary consulates. As the fifth-most populous country and the second-most populous country in the Muslim world, Pakistan has an extensive and large diplomatic network across the world.\\nAs a member of the Commonwealth of Nations, Pakistani diplomatic missions in the capitals of other Commonwealth members are known as High Commissions."},{"page_url":"https://it.wikipedia.org/wiki/Ramses_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bet_el-Wali_%28Lepsius_Abth.III_Bl.177_f%29.jpg","page_title":"Ramses II","context_page_description":"Ramses II, per intero, in egizio: Usermaatra Setepenra Ramess Meriamon; in greco antico: Ὀσυμανδύας, Ozymandias, Osymandias, noto anche come Ramesse II, Ramsete II e Ramses il Grande, è stato un faraone egizio, il terzo della XIX dinastia. Regnò dal 31 maggio 1279 a.C. al luglio o agosto del 1213 a.C.\\nÈ spesso ricordato come il più grande, potente e celebrato faraone dell'impero egizio. A causa della durata eccezionale del suo regno, che l'egittologo scozzese Kenneth Kitchen ha paragonato a quello della regina Vittoria del Regno Unito, nell'egittologia è invalsa la tradizione di assegnare il suo nome all'intero periodo della sua dinastia:\\nMentre l'egittologo francese Pierre Montet ha così commentato la vita di Ramses II:\\nEbbe modo di celebrare, nel corso del suo regno, ben 14 giubilei sed, il primo dei quali coincideva con il trentesimo anniversario di regno del sovrano e da lì in poi ogni tre anni: più di ogni altro re d'Egitto."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Scharfenstein_(Kiedrich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Scharfenstein_mit_Zugv%C3%B6geln.jpg","page_title":"Burg Scharfenstein (Kiedrich)","context_page_description":"Die Burg Scharfenstein ist die Ruine einer Spornburg in der Nähe der Gemeinde Kiedrich im Rheingau-Taunus-Kreis in Hessen. Sie befindet sich an der Straße von Kiedrich nach Hausen vor der Höhe auf einem 230 m ü. NN hohen Bergsporn.\\nAuf dem Gelände um den ehemaligen Bergfried, der einen weiten Ausblick auf die Rebhänge des Rheingaues bietet, finden gelegentlich Burgfeste statt."},{"page_url":"https://sv.wikipedia.org/wiki/Esches","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Map_commune_FR_insee_code_60218.png","page_title":"Esches","context_page_description":"Esches är en kommun i departementet Oise i regionen Hauts-de-France i norra Frankrike. Kommunen ligger i kantonen Méru som tillhör arrondissementet Beauvais. År 2009 hade Esches 1 255 invånare."},{"page_url":"https://pl.wikipedia.org/wiki/Kaktusowate","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Cactaceae_-_Echinocactus_grusonii_-_Goldkugelkaktus_aus_Mexiko.jpg","page_title":"Kaktusowate","context_page_description":"Kaktusowate – rodzina sukulentów łodygowych, należąca do rzędu goździkowców. Należy do niej, w zależności od systemu klasyfikacyjnego, od 24 do 220 rodzajów, a w ich ramach od 1500 do 2000 gatunków. Występują głównie na kontynentach amerykańskich, skąd pochodzą.\\nPrzystosowane do suchych warunków, największe zróżnicowanie osiągają na terenach półpustynnych i górskich, choć są także rodzaje występujące w lasach deszczowych. Charakterystyczną cechą budowy roślin z tej rodziny jest posiadanie areoli nieobecnych u innych roślin oraz acykliczne lub spiralne ułożenie elementów kwiatu.\\nKaktusowate mają szereg zastosowań praktycznych, zwłaszcza wśród ludów tubylczych Ameryk. Na świecie zyskały popularność jako uprawne rośliny ozdobne i kolekcjonerskie. Niekontrolowany zbiór kaktusowatych spowodował zagrożenie trwałości naturalnych populacji wielu gatunków. Z tego powodu wiele z nich trafiło do Czerwonej Księgi Gatunków Zagrożonych i zostało objętych ochroną."},{"page_url":"https://de.wikipedia.org/wiki/Servian","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Servian_vue_generale.jpg","page_title":"Servian","context_page_description":"Servian ist eine französische Gemeinde mit 4937 Einwohnern im Département Hérault in der Region Okzitanien. Servian gehört zum Arrondissement Béziers und zum Kanton Béziers-3."},{"page_url":"https://en.wikipedia.org/wiki/Moydodyr","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Mojdodyrej2.jpg","page_title":"Moydodyr","context_page_description":"Moydodyr is a 1923 poem for children by Korney Chukovsky about a magical creature by the same name. The name may be literally translated as \\"Wash 'til Holes\\".\\nThe poem is about a small boy who does not want to wash. He gets so dirty that all his toys, clothes and other possessions decide to magically leave him. Suddenly, from the boy's mother's bedroom appears Moydodyr—an anthropomorphic washstand. He claims to be the chief of all washstands, soap bars, and sponges. He scolds the boy and calls his soap bars and sponges to wash him. The boy tries to run away, chased by a vicious sponge. The chase is described as happening on Petrograd streets. Finally they meet another recurring character from Chukovsky's books—the Crocodile. The Crocodile swallows the sponge and becomes angry with the boy for being so dirty. Scared by the Crocodile, the boy goes back to Moydodyr and takes a bath. The poem ends with a moralistic note to children on the virtue of hygiene.\\nMoydodyr character became a symbol of cleanliness in Russia and is often used to advertise detergents and other products.\\nThere is a statue of Moydodyr in Sokolniki Park, Moscow."},{"page_url":"https://fr.wikipedia.org/wiki/Azt%C3%A8ques","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Camas_chinampas.jpg","page_title":"Aztèques","context_page_description":"Les Aztèques, ou Mexicas, étaient un peuple amérindien du groupe nahua, c'est-à-dire de langue nahuatl.\\nIls s'étaient définitivement sédentarisés dans le plateau central du Mexique, dans la vallée de Mexico, sur une île du lac Texcoco, vers le début du XIVᵉ siècle. Au début du XVIᵉ siècle, ils avaient atteint un niveau de civilisation parmi les plus avancés d'Amérique et dominaient, avec les autres membres de leur Triple alliance, le plus vaste empire de la Mésoamérique postclassique. Leur seul vrai rival était le royaume tarasque.\\nL'arrivée, en 1519, des conquistadors menés par Hernán Cortés scella la fin de leur règne. Le 13 août 1521, les Espagnols, aidés par un grand nombre d’alliés autochtones, finirent par remporter le siège de Tenochtitlan et par capturer le dernier dirigeant aztèque, Cuauhtémoc. La civilisation aztèque s'est alors rapidement acculturée à l'époque coloniale ; il en résulte un profond syncrétisme dans le Mexique actuel entre les héritages aztèques et espagnols."},{"page_url":"https://it.wikipedia.org/wiki/Lamprotornis_hildebrandti","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Lamprotornis_hildebrandti_-Tanzania-8-2c.jpg","page_title":"Lamprotornis hildebrandti","context_page_description":"Lo storno di Hildebrandt è un passeriforme della famiglia Sturnidae, nativo del Kenya e della Tanzania.\\nCostituisce una superspecie con Lamprotornis pulcher e Lamprotornis shelleyi, altre due specie di storni diffusi nell'Africa centrale e orientale. Il suo nome scientifico è stato coniato in onore di Johannes Hildebrandt, un collezionista ed esploratore tedesco che ne raccolse i primi esemplari in Kenya."},{"page_url":"https://de.wikipedia.org/wiki/Gabriele_Krone-Schmalz","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/2018-03-21-Gabriele_Krone-Schmalz_-Maischberger-8413.jpg","page_title":"Gabriele Krone-Schmalz","context_page_description":"Gabriele Krone-Schmalz ist eine deutsche promovierte Historikerin, freie Journalistin, Publizistin und Hörbuchsprecherin. Sie war Moskau-Korrespondentin und Moderatorin der ARD. Seit Dezember 2000 ist sie Mitglied des Lenkungsausschusses im Petersburger Dialog, seit 2011 Professorin für Fernsehen und Journalistik an der University of Applied Sciences Europe in Iserlohn."},{"page_url":"https://de.wikipedia.org/wiki/Schlaf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/A_child_sleeping.jpg","page_title":"Schlaf","context_page_description":"Schlaf ist ein Zustand der äußeren Ruhe bei Menschen und Tieren. Dabei unterscheiden sich viele Lebenszeichen von denen des Wachzustands. Puls, Atemfrequenz und Blutdruck sinken bei Primaten und anderen höheren Lebewesen im sogenannten NREM-Schlaf ab und die Gehirnaktivität verändert sich. Das Schließen der Augen während des NREM-Schlafs unterstützt diese Funktion.\\nIm sogenannten REM-Schlaf, auch als „paradoxer Schlaf“ bezeichnet, finden sich hingegen Zustände, die denen des Wach-Seins ähneln, insbesondere eine erhöhte Gehirnaktivität und ein Anstieg von Herz- und Atemfrequenz sowie des Blutdrucks. Ausgenommen von diesem „aktiven Schlafzustand“ ist die Muskulatur, die im REM-Schlaf blockiert wird. Dadurch lebt der Träumende seine im Traum erlebten motorischen Handlungen nicht aus. Mit den Störungen und der Physiologie des Schlafs beschäftigt sich ein eigenes Teilgebiet der Medizin, die Somnologie.\\nDie Funktionen des Schlafs sind erst teilweise aufgeklärt. Sicher ist, dass Menschen und viele Tiere schlafen müssen, um zu überleben, der genaue Grund ist jedoch noch unbekannt. Schlafentzug ist eine verbreitete Foltermaßnahme."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%93%D0%B5%D1%80%D0%BE%D0%B5%D0%B2_%D0%A1%D0%BE%D1%86%D0%B8%D0%B0%D0%BB%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A2%D1%80%D1%83%D0%B4%D0%B0_(%D0%9C%D0%B8%D0%B3%D0%B0%D0%B5%D0%B2_%E2%80%94_%D0%9C%D0%B8%D1%89%D0%B8%D1%85%D0%B8%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/MotherHeroine.jpg","page_title":"Список Героев Социалистического Труда (Мигаев — Мищихин)","context_page_description":"Эта страница является частью списка Героев Социалистического Труда и перечисляет в алфавитном порядке лиц, удостоенных звания Героя Социалистического Труда, чьи фамилии начинаются с буквы «М», от Мигаев до Мищихин.\\nСписок не включает дважды и трижды Героев Социалистического Труда, а также лиц, лишённых этого звания.\\nСписок содержит информацию о датах жизни, роде деятельности и дате присвоения звания Героя.\\nГерои, удостоенные звания посмертно, выделены в списке серым цветом.\\nГерои, сменившие фамилию после присвоения звания, приводятся в списках дважды, при этом строка с новой фамилией выделяется бежевым цветом и не имеет номера."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Ungarns_statsministre","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Mihaly-karolyi--outlawsdiary00tormuoft.jpg","page_title":"Liste over Ungarns statsministre","context_page_description":"Under følger en liste over Ungarns statsministre fra den første statsminister, Lajos Batthyány, tiltrådte embetet under Den ungarske revolusjonen i 1848 og fram til i dag. Statsministeren er sjef for Ungarns regjering."},{"page_url":"https://sco.wikipedia.org/wiki/Weston,_Georgie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Merritt_Pecan_Co_and_General_Store%3B_Weston%2C_GA.JPG","page_title":"Weston, Georgie","context_page_description":"Weston is a toun in Webster Coonty, Georgie. The population wis 75 at the 2000 census."},{"page_url":"https://ast.wikipedia.org/wiki/Estinci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/LepidodendronOhio.jpg","page_title":"Estinción","context_page_description":"En bioloxía y ecoloxía, estinción ye la desapaición de tolos miembros d'una especie o un grupu de taxones. Considérase estinguida a una especie a partir del intre en que muerre'l postreru individuu d'esta. Por cuenta de que'l so rangu de distribución potencial pue ser bien grande, determinar esi momentu puede ser dificultosu, polo que usualmente facer en retrospectiva. Estes dificultaes pueden conducir a fenómenos como'l taxón lázaro, nel qu'una especie que se presumía estinguida remanez abruptamente tres un periodu d'aparente ausencia. Nel casu d'especies que se reproducen sexualmente, la estinción ye xeneralmente inevitable cuando namái queda un individuu de la especie, o namái individuos del mesmu sexu.\\nAl traviés de la evolución biolóxica, nueves especies surden al traviés de la especiación, según tamién otres especies escastar cuando yá nun son capaces de sobrevivir en condiciones cambiantes o frente a otros competidores. De normal, una especie escastar dientro de los primeres 10 millones d'años posteriores a la so primer apaición, anque delles especies, denominaes fósiles vivientes, sobreviven práuticamente ensin cambeos mientres cientos de millones d'años."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B5%D9%88%D8%A8%DB%81_%D8%A8%D9%88%D8%B1%DB%8C%D8%B1%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Buriram_City_Pillar.jpg","page_title":"صوبہ بوریرام","context_page_description":"صوبہ بوریرام\\nتھائی لینڈ کے شمال مشرقی صوبوں میں سے ایک ہے۔"},{"page_url":"https://eo.wikipedia.org/wiki/Ivan_Bella","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Ivan_Bella_%28Author_-_Rudolf_Csiba%29.jpg","page_title":"Ivan Bella","context_page_description":"Ivan Bella estis slovaka kosmonaŭto. Li pasis 7 tagojn, 21 horojn, kaj 56 minutojn en kosma spaco. Li estas edziĝinta, kaj la patro de du infanoj.\\nLi estis la unua slovako eniri kosman spacon nekonsidere la usona astronaŭto de slovaka origino, Eugene Cernan. Li partoprenis 9-tagan kunmisionon rusan-francan-slovakan en kosmostacio Mir en 1999."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D8%B1%D9%83%D9%89_%D8%B3%DA%A4%D9%8A%D9%86_%D8%AA%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/T%C3%BC%C3%BCr%2C_Erkki-Sven.IMG_0325.JPG","page_title":"اركى سڤين تور","context_page_description":"اركى سڤين تور ملحن مزيكا من استونيا."},{"page_url":"https://it.wikipedia.org/wiki/Mitterdorf_an_der_Raab","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/AUT_Mitterdorf_an_der_Raab_COA.jpg","page_title":"Mitterdorf an der Raab","context_page_description":"Mitterdorf an der Raab è un comune austriaco di 2 073 abitanti nel distretto di Weiz, in Stiria."},{"page_url":"https://he.wikipedia.org/wiki/Sd.Kfz._251","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Bundesarchiv_Bild_101I-769-0235-31%2C_Frankreich%2C_Sch%C3%BCtzenpanzer_mit_Funkanlage.jpg","page_title":"Sd.Kfz. 251","context_page_description":"ה-Sd.Kfz. 251 הוא זחל\\"ם שפותח על ידי הוורמאכט הגרמני במהלך מלחמת העולם השנייה. זחל\\"ם ה-Sd.Kfz. 251 יוצר בארבעה דגמים ראשיים שהיוו פלטפורמה למספר גרסאות במגוון תפקידים ייעודיים."},{"page_url":"https://de.wikipedia.org/wiki/Wald_in_Litauen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Ulos_akies_laukyme.jpg","page_title":"Wald in Litauen","context_page_description":"Der Wald in Litauen umfasst mit 2,177 Millionen Hektar 33,3 Prozent der Gesamtfläche des Landes."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%89%E8%85%B3%E6%9E%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/M60_machine_gun_DM-ST-90-01312.jpg","page_title":"三腳架","context_page_description":"三脚架是由三条杆材组成的支撑结构。利用三角形的稳定性，三脚架可以使架于其上的物品获得一个稳定的支撑，而不易翻倒。通常三脚架上也有方便设备进行俯仰、旋转的机关。通常用于架设重量不大的中小型设备。\\n常用到三脚架的设备有：\\n科学实验，如用上本生灯的实验\\n光学设备，如照相机、摄像机、经纬仪、小型望远镜，特别是小型的天文望远镜等。\\n武器，如通用机枪、重机枪、自动榴弹发射器、反坦克导弹等。\\n画板\\n较为高级的摄影三脚架并不附设云台，需要另外购买。三脚架的云台螺丝分为¹⁄₄英寸与³⁄₈英寸两种。一般的数码相机、数码单镜反光相机和摄影机机身底部的螺丝孔均为1/4英寸规格，部分专业型摄影机与中片幅以上的相机则采用3/8英寸规格的螺丝。"},{"page_url":"https://la.wikipedia.org/wiki/Gotthold_Ephraim_Lessing","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Gotthold_Ephraim_Lessing_Kunstsammlung_Uni_Leipzig.jpg","page_title":"Gotthold Ephraim Lessing","context_page_description":"Gotthold Ephraim Lessing fuit poeta, philosophus ac scriptor fabularum scaenicarum Germanicus. Philosophiam Benedicti de Spinoza secutus est ac librum \\"De Laocoonte\\" scripsit anno 1766."},{"page_url":"https://ceb.wikipedia.org/wiki/Tectona_grandis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Starr_010304-0485_Tectona_grandis.jpg","page_title":"Tectona grandis","context_page_description":"Espesye sa tanom nga bulak ang Tectona grandis. Una ning gihulagway ni Carl von Linné d.y.. Ang Tectona grandis sakop sa kahenera nga Tectona sa kabanay nga Lamiaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A2%D9%85%D9%88%D8%B3_%D8%A3%D9%88%D8%AA%D9%8A%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Amos_Otis_and_Gerald_Ford_%28cropped%29.jpg","page_title":"آموس أوتيس","context_page_description":"آموس أوتيس ‏ هو لاعب كرة قاعدة أمريكي، ولد في 26 أبريل 1947 في موبيل في الولايات المتحدة."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%BE%D0%B2%D0%B0_%D0%92%D0%B5%D1%81%D1%8C-%D0%9B%D0%B5%D0%BC%D0%B1%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Nowa_Wie%C5%9B_L%C4%99borska_-_Church_01.jpg","page_title":"Нова Весь-Лемборська","context_page_description":"Нова Весь-Лемборська — село в Польщі, у гміні Нова Весь-Лемборська Лемборського повіту Поморського воєводства.\\nНаселення — 2432 особи.\\nУ 1975-1998 роках село належало до Слупського воєводства."},{"page_url":"https://vi.wikipedia.org/wiki/Oshkosh_(th%E1%BB%8B_tr%E1%BA%A5n),_Qu%E1%BA%ADn_Winnebago,_Wisconsin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/WIMap-doton-Oshkosh.png","page_title":"Oshkosh (thị trấn), Quận Winnebago, Wisconsin","context_page_description":"Oshkosh là một thị trấn thuộc quận Winnebago, tiểu bang Wisconsin, Hoa Kỳ. Năm 2010, dân số của thị trấn này là 2.374 người."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wiener_Gemeindebauten/Mariahilf","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Leuthner-Hof_Vienna_2_stitched.jpg","page_title":"Liste der Wiener Gemeindebauten/Mariahilf","context_page_description":"Diese Liste zählt die Gemeindebauten im 6. Wiener Gemeindebezirk Mariahilf auf.\\nEs werden nur solche Objekte angeführt, die seit Beginn des sozialen Wohnbaus errichtet wurden. Ältere Häuser, die im Besitz der Stadt Wien sind und in denen ebenfalls Gemeindewohnungen vergeben werden, fehlen daher."},{"page_url":"https://vi.wikipedia.org/wiki/Arctostaphylos_mewukka","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Arctostaphylos_mewukka_ssp._truei_JEPS109967_%284498240837%29.jpg","page_title":"Arctostaphylos mewukka","context_page_description":"Arctostaphylos mewukka là một loài thực vật có hoa trong họ Thạch nam. Loài này được Merriam mô tả khoa học đầu tiên năm 1918."},{"page_url":"https://az.wikipedia.org/wiki/J%C3%BCl_%C5%9Eere","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Cheret_-_La_Danse.jpg","page_title":"Jül Şere","context_page_description":"Jül Şere — fransız rəssamı və qrafikçi. Müasir poster qurucularından biri."},{"page_url":"https://it.wikipedia.org/wiki/Ciambellano_del_Giappone","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Suzuki_Kantaro.jpg","page_title":"Ciambellano del Giappone","context_page_description":"Il Gran Ciambellano del Giappone è il capo funzionario della Corte Imperiale giapponese, aiutante dell'imperatore del Giappone. Egli è anche detentore del Sigillo Privato e del Sigillo di Stato ed è identificato come il più importante dei ruoli civili sin dal periodo Meiji. Attualmente il Gran Ciambellano, assistito da un vice-ciambellano, è responsabile dell'Agenzia della Casa Imperiale che organizza giorno per giorno la vita e gli impegni dell'imperatore."},{"page_url":"https://bs.wikipedia.org/wiki/Regije_Republike_Srpske","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Republika_Srpska_RU.PNG","page_title":"Regije Republike Srpske","context_page_description":"Geografski prostor Republike Srpske moguće je uvjetno podijeliti na različite regije, zavisno od praktičnih potreba. Budući da su urbani centri glavne poluge i medijatori ukupnog razvoja Republike Srpske, ovaj prostor najčešće se diferencira primjenom nodalno-funkcionalnog principa. Prema tome uvjetne granice regija određuju se gravitacijskim utjecajem glavnih urbanih i ujedno razvojnih centara. Jedan od najvažnijih ciljeva regionalizacije i politike regionalnog razvoja je što ravnomjerniji razvoj na nivou entiteta. Pored funkcionalnih regija, moguće je izdvojiti i fizionomske regije, odnosno prirodno-geografske oblasti Republike Srpske."},{"page_url":"https://de.wikipedia.org/wiki/Brad_Sucks","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Bradsuckspress.jpg","page_title":"Brad Sucks","context_page_description":"Brad Sucks ist eine kanadische Pop-Rock-Band. Sie wurde 2001 von Brad Turcotte gegründet und war eine der ersten Bands die Gebrauch von freier Musikdistribution, im Sinne freier Software machte.\\nTurcotte veröffentlichte die erste, völlig selbstproduzierte Single „Brad Sucks One“ im Jahr 2001 auf seiner Website. Er veröffentlichte sie als Open-Source Musik, stellte also die einzelnen Bestandteile, aus denen sich der Song zusammensetzte, frei ins Internet.\\nTurcotte verzichtet auf viele Rechte an seiner Musik, was die kostenlose Verbreitung durch Social Networks und Open-Source Musikportale ermöglichte und somit zum schnellen Erfolg seiner Musik beitrug. 2004 steuerte er ein neues Audio-Schema für den Instant-Messenger Pidgin bei.\\nDas Album „Out of It“ wurde am 8. September 2008 veröffentlicht. Am 1. Dezember 2008 veröffentlichte Turcotte in einer kurzen Botschaft auf seiner Webseite, dass Spence und McGarvy die Band verlassen haben.\\nBrad Turcotte führt das Projekt seitdem als Solomusiker fort, was auch in den neueren Songs deutlich wird, da diese sich sehr auf elektronische Sounds stützen. Am 2."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%88%B4%E9%87%8C%E5%A5%A5%C2%B7%E6%B2%99%E6%8B%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Dario_Sala.JPG","page_title":"戴里奥·沙拉","context_page_description":"戴里奧·阿爾拔圖·沙拉一般稱作沙拉，生於科爾多瓦，阿根廷職業足球運動員，現效力於美國職業足球大聯盟球會FC達拉斯。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%B8%D1%87%D0%B0%D1%80%D0%B4_%D0%A1%D0%B8%D0%BC%D0%BE%D0%BD%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/RichardSimmonsSept2011.jpg","page_title":"Ричард Симонс","context_page_description":"Милтон Тигл Симонс, познатији као Ричард Симонс, бивши је амерички фитнес инструктор, глумац и видео продуцент. Познат је по својој ексцентричној, блиставој и енергичној личности. Крајем 1960-их је започео емитовање својих програма за мршављење и од тада је објавио више десетина књига, звучних снимака и видео материјала."},{"page_url":"https://tr.wikipedia.org/wiki/Nemrut_Da%C4%9F%C4%B1_(Bitlis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Nemrut_Il%C4%B1ca_G%C3%B6l.JPG","page_title":"Nemrut Dağı (Bitlis)","context_page_description":"Nemrut Dağı ya da Nemrut Stratovolkanı, Bitlis İlinin Tatvan ilçesinde, Doğu Anadolu Bölgesi'nde yer alan yüksek dağlardan biridir. Van Gölü'nün batısına düşer. Nemrut, uyuyan aktif bir yanardağdır ve 1441 yılında son kez lav çıkışı olmuştur. Tepesindeki kraterde Nemrut Gölü yer alır. Krater etrafında, en yüksek tepe olan Sivritepe 2935 m, Doğu Nemrut Tepesi 2625 m, güneydeki Tursuktepe 2828 m ve batıda Nemrut Dağı Tepesi 2801 m yüksekliktedir."},{"page_url":"https://an.wikipedia.org/wiki/Lista_de_consorts_de_monarcas_d%27Arag%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/La_emperatriz_Isabel_de_Portugal%2C_por_Tiziano.jpg","page_title":"Lista de consorts de monarcas d'Aragón","context_page_description":"Ista ye a lista de consorts de monarcas d'Aragón. Se pueden trobar consorts d'o condato y d'o Reino y Corona d'Aragón. Nomás ha habito un rei consort en Aragón, Remón Berenguer IV de Barcelona.\\nBlanca II de Navarra y Felipe o Fermoso morioron antis de que os suyos respectives conchuches heredasen a corona. Muitos reis d'Aragón tenioron mas d'una muller; habendo-se divorciato u habendo muerto a muller antis que ell."},{"page_url":"https://simple.wikipedia.org/wiki/Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Washington_Montage_2016.png","page_title":"Washington, D.C.","context_page_description":"Washington, D.C. is the capital of the United States. It is a federal district. The President of the USA and many major national government offices are in the territory. This makes it the political center of the United States of America.\\nWashington was named after the first U.S. President George Washington. \\"D.C.\\" stands for \\"District of Columbia\\". At first, it was made up of a piece from Virginia south of the Potomac River and a piece from Maryland north of the Potomac River. In 1847, Virginia's piece was returned to it, and is now Arlington County and part of the city of Alexandria. Since 1847, all of the District of Columbia is on the north side of the Potomac River. The District of Columbia used to have other small towns which used \\"D.C.\\".\\nSince 1800, The District of Columbia has been the home of all three branches of the U.S. government: Congress, the President, and the Supreme Court. All of the major political parties are based here. It is also the headquarters of the World Bank, the International Monetary Fund, and the Organization of American States."},{"page_url":"https://fr.wikipedia.org/wiki/Maynard_M._Metcalf","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Maynard_Mayo_Metcalf_%281868-1940%29_%285857269601%29.jpg","page_title":"Maynard M. Metcalf","context_page_description":"Maynard M. Metcalf est un zoologiste américain, né le 12 mars 1868 à Elyria et mort le 22 avril 1940 à Winter Park."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%88%E3%82%B0%E3%83%AB%E6%A9%9F%E6%A7%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/SceneryWagonBrake.jpg","page_title":"トグル機構","context_page_description":"トグル機構は二つのリンクと一つのスライダーから構成されるリンク機構の一種であり、機械要素のひとつである。一般的なリンク機構の目的は多くの場合、機械の運動を一定のパターンに束縛するためのものであり、伝達要素として力を伝えるが、てこのように機構それ自体で力を変換するために使われるわけではない。トグル機構は倍力機構である点が特徴である。"},{"page_url":"https://it.wikipedia.org/wiki/Diocesi_di_Ca%C3%A7ador","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Catedral_de_Ca%C3%A7ador.jpg","page_title":"Diocesi di Caçador","context_page_description":"La diocesi di Caçador è una sede della Chiesa cattolica in Brasile suffraganea dell'arcidiocesi di Florianópolis appartenente alla regione ecclesiastica Sul 4. Nel 2016 contava 352.000 battezzati su 417.000 abitanti. La sede è vacante."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%DB%8C%D8%A7%D8%AA_%D8%A7%DB%8C.%DB%B5%DB%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Fiat_A.50_%281%29.jpg","page_title":"فیات ای.۵۰","context_page_description":"فیات ای. ۵۰ یک موتور هواگرد ساختِ کارخانهٔ فیات اتومبیلز در کشور ایتالیا است."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mammals_of_Ivory_Coast","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Zwergflusspferd_-_Pygmy_Hippopotamus_-_Hexaprotodon_liberiensis.jpg","page_title":"List of mammals of Ivory Coast","context_page_description":"This is a list of the mammal species recorded in Ivory Coast. Of the mammal species in Ivory Coast, one is critically endangered, ten are endangered, fourteen are vulnerable, and seventeen are near threatened.\\nThe following tags are used to highlight each species' conservation status as assessed by the International Union for Conservation of Nature:\\nSome species were assessed using an earlier set of criteria. Species assessed using this system have the following instead of near threatened and least concern categories:"},{"page_url":"https://de.wikipedia.org/wiki/Frankfurt_am_Main","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Frankfurt%2C_Beethovenstra%C3%9Fe_71.jpg","page_title":"Frankfurt am Main","context_page_description":"Frankfurt am Main ist mit 763.380 Einwohnern die größte Stadt Hessens und die fünftgrößte Deutschlands. Sie ist kreisfrei und bildet das Zentrum des Ballungsraums Frankfurt mit mehr als 2,3 Millionen Einwohnern. In der gesamten Metropolregion Frankfurt/Rhein-Main leben etwa 5,8 Millionen Menschen.\\nSeit dem Mittelalter gehört Frankfurt am Main zu den bedeutenden städtischen Zentren Deutschlands. Im Jahr 794 erstmals urkundlich erwähnt, war es seit 1372 Reichsstadt. Bis zum Ende des Heiligen Römischen Reiches 1806 wurden die meisten römisch-deutschen Könige in Frankfurt am Main gewählt und seit 1562 auch zum Kaiser gekrönt. Von 1815 an war die Freie Stadt Frankfurt ein souveräner Mitgliedsstaat des Deutschen Bundes. Hier tagten die Bundesversammlung und 1848/49 in der Paulskirche mit der Nationalversammlung das erste deutsche Parlament. Nach dem Deutschen Krieg 1866 annektierte Preußen die Freie Stadt Frankfurt. Durch die rasche Industrialisierung setzte ein Bevölkerungsschub ein. Seit 1875 zählte die Stadt über 100.000 Einwohner, seit 1928 mehr als 500.000, seit 2013 mehr als 700.000."},{"page_url":"https://en.wikipedia.org/wiki/Symphony_No._1_(Mahler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Schwind_Begraebnis.jpg","page_title":"Symphony No. 1 (Mahler)","context_page_description":"Symphony No. 1 in D major by Gustav Mahler was mainly composed between late 1887 and March 1888, though it incorporates music Mahler had composed for previous works. It was composed while Mahler was second conductor at the Leipzig Opera, Germany. Although in his letters Mahler almost always referred to the work as a symphony, the first two performances described it as a symphonic poem and as a tone poem in symphonic form respectively. The work was premièred at the Vigadó Concert Hall, Budapest, in 1889, but was not well received. Mahler made some major revisions for the second performance, given at Hamburg in October 1893; further alterations were made in the years prior to the first publication, in late 1898. Some modern performances and recordings give the work the title Titan, despite the fact that Mahler only used this label for the second and third performances, and never after the work had reached its definitive four-movement form in 1896.\\nMahler conducted more performances of this symphony than of any of his later works."},{"page_url":"https://sv.wikipedia.org/wiki/Jedvard_Filipsson_(Rumby%C3%A4tten)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/COA_family_sv_Rumbyatten.png","page_title":"Jedvard Filipsson (Rumbyätten)","context_page_description":"Jedvard Filipsson, död 1328, var en storman, riddare och godsägare, son till Filip Finvidsson av Rumby, och en dotter till Karl Tjälfvesson av Fånö vid Ekolsund och hans hustru Ingegärd Filipsdotter. Han ägde gods i gods i Danderyd, Vallentuna och Seminghundra härad i Uppland. Hans sätesgård var Stora Benhamra, och han förde i vapnet en schackrutad balk, varför han ibland kallas Jedvard Filipsson [Snedbjälke].\\nJedvard Filipsson var ättling till Erikska ätten och den sista manliga medlemmen av Rumbyätten, som vid hans död utslocknade.\\nVapen: Rutig snedbjälke från sköldens övre högra hörn."},{"page_url":"https://fr.wikipedia.org/wiki/Dubienka_(Che%C5%82m)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Cerkiew_prawos%C5%82awna_%C5%9Awi%C4%99tej_Tr%C3%B3jcy.jpg","page_title":"Dubienka (Chełm)","context_page_description":"Dubienka - est un village polonais de la gmina de Dubienka dans le powiat de Chełm de la voïvodie de Lublin dans l'est de la Pologne, à la frontière avec l'Ukraine.\\nLe village est le siège administratif de la gmina appelée gmina de Dubienka.\\nIl se situe à environ 32 kilomètres à l'est de Chełm et 95 kilomètres à l'est de Lublin.\\nLe village comptait approximativement une population de 1 042 habitants en 2008."},{"page_url":"https://en.wikipedia.org/wiki/The_Skeptics_Society","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Skeptic_Magazine.png","page_title":"The Skeptics Society","context_page_description":"The Skeptics Society is a nonprofit, member-supported organization devoted to promoting scientific skepticism and resisting the spread of pseudoscience, superstition, and irrational beliefs. The Skeptics Society was founded by Michael Shermer as a Los Angeles-area skeptical group to replace the defunct Southern California Skeptics. After the success of its magazine, Skeptic, introduced in early 1992, it became a national and then international organization. The stated mission of Skeptics Society and Skeptic magazine \\"is the investigation of science and pseudoscience controversies, and the promotion of critical thinking.\\""},{"page_url":"https://da.wikipedia.org/wiki/Bratislava","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Bratislava-34.jpg","page_title":"Bratislava","context_page_description":"Bratislava er hovedstad og største by i Slovakiet med 429.564 indbyggere. Byen ligger i den sydvestlige del af Slovakiet på begge bredder af Donau. Byen grænser op til både Østrig og Ungarn og er dermed den eneste hovedstad, der grænser op til to andre lande.\\nBratislava er det politiske, kulturelle og økonomiske centrum i Slovakiet. Den er sæde for den slovakiske præsident, parlamentet og regeringen. Byen er ligeledes hjemsted for flere universiteter, museer, teatre, gallerier og andre vigtige økonomiske, kulturelle og uddannelsesmæssige institutioner. Hovedkvartererne for mange af Slovakiets store virksomheder og finansielle institutioner ligger ligeledes i Bratislava.\\nByens historie, i lang tid kendt under det tyske navn Pressburg, er blevet kraftigt påvirket af forskellige folkeslag, inklusiv østrigere, tjekker, tyskere, ungarere, jøder og slovakker. Byen var hovedstad i Kongeriget Ungarn under det Habsburgske monarki fra 1536 til 1783. Bratislava var hjemsted for den slovakiske nationale bevægelse i det 19. århundrede og mange vigtige historiske personer af slovakisk, ungarsk og tysk afstamning."},{"page_url":"https://it.wikipedia.org/wiki/Discografia_di_Avicii","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Avicii.jpg","page_title":"Discografia di Avicii","context_page_description":"Questa pagina contiene la discografia di Avicii."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%B5%D0%B4%D1%80%D0%BE_%D0%A4%D0%BE%D0%BD%D1%81%D0%B5%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Pedro_Lu%C3%ADs_da_Fonseca.png","page_title":"Педро Фонсека","context_page_description":"Педро Луис да Фонсека е анголски икономист и политик. Той е настоящият министър на икономиката и планирането на Ангола."},{"page_url":"https://de.wikipedia.org/wiki/Rolls-Royce_Corniche","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Rolls-Royce_Corniche_1977.jpg","page_title":"Rolls-Royce Corniche","context_page_description":"Rolls-Royce Corniche, benannt nach der Küstenstraße Corniche bei Monaco, ist eine Modellbezeichnung des britischen Herstellers Rolls-Royce.\\nUnter diesem Namen wurden von 1971 bis 1995 die Coupé- und Drophead Coupé- Varianten des Rolls-Royce Silver Shadow und von 2000 bis 2002 die Rolls-Royce-Version des Bentley Continental R vermarktet.\\nZeitweilig gab es von der Schwestermarke Bentley ein Parallelmodell Bentley Corniche, das 1984 in Bentley Continental umbenannt wurde. Den Namen Corniche hatte schon 1939 ein Prototyp auf Basis des Bentley Mark V getragen, der aber wegen des Kriegsausbruches nicht mehr in Serie gegangen war."},{"page_url":"https://pl.wikipedia.org/wiki/Autoportrety_Vincenta_van_Gogha","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Vincent_van_Gogh%2C_Portrait_of_Theo_van_Gogh_%281887%29.jpg","page_title":"Autoportrety Vincenta van Gogha","context_page_description":"Vincent van Gogh namalował w ciągu swego życia 38 autoportretów. Zbiór jego autoportretów stawia go wśród najbardziej płodnych autoportrecistów wszech czasów. Dla van Gogha malowanie portretów było metodą introspekcji, sposobem zarabiania pieniędzy i rozwoju swoich umiejętności artystycznych. Kiedy zaczął malować pierwsze portrety, jako modele posłużyli mu chłopi. Później przestawił się na malowanie pejzaży i kwiatów, przede wszystkim dlatego, że nie był w stanie zapłacić modelom. Wyjaśniał to w liście do siostry Willeminy z 1887 roku. Dlatego zaczął malować siebie samego. Ustawiczny brak pieniędzy był też powodem malowania autoportretów również i w latach następnych."},{"page_url":"https://de.wikipedia.org/wiki/Nutzhanf","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Coat_of_Arms_of_Kimovsk_rayon_%28Tula_oblast%29.png","page_title":"Nutzhanf","context_page_description":"Nutzhanf oder Industriehanf umfasst alle Sorten des Hanfs, die zur kommerziellen Nutzung angebaut werden – abseits von seiner Verwendung als Rauschmittel oder Arzneimittel. Dabei handelt es sich vor allem um Sorten der Hanfart Cannabis sativa und dessen Kulturform Cannabis sativa var. sativa. Der Indische Hanf spielt hingegen nur als Drogen- und Medizinpflanze eine Rolle.\\nNutzhanf wird vor allem zur Gewinnung von Hanffasern angebaut. Weitere genutzte Produkte sind Hanfschäben, Hanfsamen und Hanfblüten und -blätter. Neue Kaltpressverfahren ermöglichen es inzwischen, den Hanfsaft aus dem oberen Teil der Pflanze ebenfalls als Nahrungsmittel zu gewinnen. So kann dieser hochwertige Pflanzenbestandteil zur Ernährung verwendet werden, anstatt wie bisher auf dem Feld zu verrotten.\\nInsgesamt stehen 52 von der EU zertifizierte Hanfsorten für den Nutzanbau zur Verfügung. Diese für die Faser- und Samennutzung angebauten Sorten besitzen im Gegensatz zu jenen, die als Rauschmittel und medizinisch genutzt werden, einen sehr hohen Faseranteil von 30 bis 40 %."},{"page_url":"https://en.wikipedia.org/wiki/138th_Attack_Squadron","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/138th_Attack_Squadron_-_General_Atomics_MQ-9B_Reaper_09-4072.jpg","page_title":"138th Attack Squadron","context_page_description":"The 138th Attack Squadron is a unit of the New York Air National Guard's 174th Attack Wing located at Hancock Field Air National Guard Base in Syracuse, New York. The 138th is equipped with the MQ-9 Reaper Remotely Piloted Aircraft."},{"page_url":"https://en.wikipedia.org/wiki/Puccinia_sessilis","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6d/Puccinia_aecidia_0482.jpg","page_title":"Puccinia sessilis","context_page_description":"Puccinia sessilis is a fungal plant pathogen, also known as arum rust or ramsons rust. It commonly infects Arum maculatum and Allium ursinum causing yellow to orange circular patches on leaves. On the underside it produces raised orange aecia commonly covered in spores. It is common in Eurasia in the spring.\\nOther species affected by this rust include Convallaria majalis, Dactylorhiza fuchsii, Dactylorhiza incarnata, Dactylorhiza majalis, Gymnadenia conopsea, Neottia ovata, Paris quadrifolia and Phalaris arundinacea\\nA specialised form, Puccinia sessilis f.sp. narcissi-orchidacearum Boerema & Kesteren is a cause of rust in daffodils and various wild Orchidaceae."},{"page_url":"https://de.wikipedia.org/wiki/FP%C3%96-Parlamentsklub","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/G%C3%BCnther_Steinkellner_.png","page_title":"FPÖ-Parlamentsklub","context_page_description":"Der FPÖ-Parlamentsklub ist der Klub der Freiheitlichen Partei Österreichs im österreichischen Nationalrat."},{"page_url":"https://pl.wikipedia.org/wiki/Kopalnia_W%C4%99gla_Kamiennego_%E2%80%9EWieczorek%E2%80%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Jan%C3%B3w-Nikiszowiec_I_032.jpg","page_title":"Kopalnia Węgla Kamiennego „Wieczorek”","context_page_description":"Kopalnia Węgla Kamiennego Wieczorek – kopalnia węgla kamiennego w likwidacji znajdująca się w Katowicach, w dzielnicy Nikiszowiec.\\n1 kwietnia 2017 roku została przejęta od Katowickiego Holdingu Węglowego przez Polską Grupę Górniczą i zatrudnia około 3000 pracowników. 31 marca 2018 roku kopalnia została przekazana Spółce Restrukturyzacji Kopalń w celu likwidacji. Pozostałe złoża będzie eksploatowała sąsiednia kopalnia Murcki-Staszic."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_arter_i_vivesl%C3%A4ktet","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Buberel_unknown_flower_4.jpg","page_title":"Lista över arter i vivesläktet","context_page_description":"Detta är en lista över arter och hybrider i vivesläktet inom familjen Viveväxter."},{"page_url":"https://hr.wikipedia.org/wiki/Muzej_Hunana","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Mawangdui_silk_banner_from_tomb_no1.jpg","page_title":"Muzej Hunana","context_page_description":"Muzej Hunana je muzej kineske pokrajine Hunan koji izgrađen od 1951. do lipnja 1956. god. kada je otvoren za javnost. Smješten je u glavnom gradu pokrajine, Changsha, na adresi Dongfeng Lu br. 50, odmah uz Park mučenika revolucije. Muzej Hunana posjeduje preko 180.000 povijesno značajnih predmeta od dinastije Zhou do posljednje dinastije Qing, smješteno na 51.000 hektara prostora u muzeju.\\nPokrajinski muzej Hunana je jedan od najposjećenijih muzeja u Kini, te je 2018. god. zabilježio 3.600.000 posjetitelja, prema čemu je bio 5. u Kini."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%86%D8%AF%D8%A8_%D8%B1%D8%BA%D9%88%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Koppie_foam_grasshopper_%28Dictyophorus_spumans_spumans%29_2.jpg","page_title":"جندب رغوي","context_page_description":"جندب رغوي، نوع من الجنادب التي تنتمي إلى فصيلة Pyrgomorphidae، مهده أفريقيا. ويستمد اسمه \\"الجندب الرغوي\\" من قدرته على إفراز رغوة سامة من الغدد الصدرية. يصل طول الحشرة البالغة منها إلى 80 مم."},{"page_url":"https://da.wikipedia.org/wiki/Starbucks","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Starbuckscenter.jpg","page_title":"Starbucks","context_page_description":"Starbucks er verdens største kæde af kaffebarer. Den første Starbucks åbnede i Seattle i USA 31. marts 1971, af tre partnere, der mødtes, da de studerede ved San Franciscos universitet. Virksomheden fik navn efter en person i romanen Moby Dick, en kvæker fra Nantucket.\\nStarbucks har hovedkvarter i Seattle, 140.000 ansatte og en årlig omsætning på 7,8 milliarder dollar. Kæden er repræsenteret i lande over hele verden, og den 15. juni 2007 åbnede den sin første skandinaviske butik i Københavns Lufthavn.\\nStarbucks har ofte været brugt af antiglobaliseringsbevægelsen som eksempel på amerikansk økonomisk og kulturel dominans, og i Kina har det vakt kritik, at en Starbucks åbnede i Den Forbudte By. Omvendt er Starbucks blevet rost for at tilføje en produktlinje af bæredygtige kaffedrikke, ligesom kæden tilstræber et godt arbejdsmiljø for sine ansatte. Starbucks' Red-kampagne anbefaler kunderne at købe og drikke den specielle østafrikanske Red-kaffeblanding og forbinder købet af kaffen med Starbucks' forpligtelse til at give en dollar for hver pose solgt kaffe til AIDS-bekæmpelse i Afrika."},{"page_url":"https://ro.wikipedia.org/wiki/Sanmenxia","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ad/Smxgongcheng.jpg","page_title":"Sanmenxia","context_page_description":"Sanmenxia este un oraș district din provincia Henan situat într-o poziție centrală în China. Suprafața regiunii de adminstrație a orașului se întinde pe o suprafață de 10.475 km² având o populație de 2,2 milioane de locuitori din care o cincime sunt creștini. Lângă oraș se află Lacul de acumulare Sanmenxia care este așezat pe cursul Fluviului Galben."},{"page_url":"https://tr.wikipedia.org/wiki/Vertebral_arter","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Suboccipital_triangle_dissection.jpg","page_title":"Vertebral arter","context_page_description":"Vertebral arter boyunda bulunan önemli arterlerden biridir. Tipik olarak Vertebral arterin orijini Subklaviyan arterdir. Her iki damar boynun her iki yanında kafa tabanına doğru yükselirler. Kafa tabanında kafatası içerisine girerler ve beyin sapı önünde birleşerek baziler arter'i oluştururlar. Vertebrobaziler sistem olarak tarif edilen omurilik, beyin sapı, beyincik ve beyinin arka bölgesini besleyen temel yapılardan biridir."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_L%C3%BCdenscheid","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/BD_1.JPG","page_title":"Liste der Baudenkmäler in Lüdenscheid","context_page_description":"Die Liste der Baudenkmäler in Lüdenscheid enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Lüdenscheid im Märkischen Kreis in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Lüdenscheid eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://ro.wikipedia.org/wiki/Chaff_(m%C4%83sur%C4%83_antiradar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/RAF_%22Window%22_radar_countermeasures.jpg","page_title":"Chaff (măsură antiradar)","context_page_description":"Chaff denumit inițial Window de către britanici și Düppel de către germani în epoca celui de-al Doilea Război Mondial, este o măsură anti-radar prin care aeronavele sau alte ținte răspândesc un nor de mici și subțiri fâșii din aluminiu sau de fâșii metalizate din fibră de sticlă sau din plastic, care apar ca un grup de ținte primare, inundând ecranele radarelor cu multe puncte luminoase.\\nForțele armate moderne folosesc chaff-urile pentru a distrage rachetele ghidate de radar de la țintele lor. Majoritatea aeronavelor militare și a navelor de război au astfel de sisteme de autoapărare. O rachetă balistică intercontinentală poate elibera, în faza sa medie, mai multe focoase independente, precum și auxiliare de penetrare, cum ar fi baloanele-momeală și chaff-urile.\\nSistemele moderne de radar pot distinge chaff-urile de țintele reale prin măsurarea efectului Doppler; chaff-urile pierd rapid viteză comparativ cu o aeronavă și arată astfel o schimbare caracteristică a frecvenței care permite filtrarea acesteia. Acest lucru a dus la noi tehnici în care chaff-urile sunt iluminate în continuare de un semnal suplimentar din vehiculul țintă cu frecvența Doppler corespunzătoare."},{"page_url":"https://pl.wikipedia.org/wiki/Gromada_Skalmierzyce_Nowe","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Nowe_Skalmierzyce-dworzec_PKP.jpg","page_title":"Gromada Skalmierzyce Nowe","context_page_description":"Gromada Skalmierzyce Nowe – dawna gromada, czyli najmniejsza jednostka podziału terytorialnego Polskiej Rzeczypospolitej Ludowej w latach 1954–1972.\\nGromady, z gromadzkimi radami narodowymi jako organami władzy najniższego stopnia na wsi, funkcjonowały od reformy reorganizującej administrację wiejską przeprowadzonej jesienią 1954 do momentu ich zniesienia z dniem 1 stycznia 1973, tym samym wypierając organizację gminną w latach 1954–1972.\\nGromadę Skalmierzyce Nowe z siedzibą GRN w Skalmierzycach Nowych utworzono – jako jedną z 8759 gromad na obszarze Polski – w powiecie ostrowskim w woj. poznańskim, na mocy uchwały nr 32/54 WRN w Poznaniu z dnia 5 października 1954. W skład jednostki wszedł obszar dotychczasowej gromady Skalmierzyce Nowe ze zniesionej gminy Skalmierzyce Nowe w tymże powiecie. Dla gromady ustalono 27 członków gromadzkiej rady narodowej.\\nGromadę Skalmierzyce Nowe zniesiono 1 stycznia 1956 w związku z nadaniem jej statusu osiedla. 18 lipca 1962 osiedle Skalmierzyce Nowe otrzymało prawa miejskie, a nazwę miasta ustalono na Nowe Skalmierzyce.\\n1 stycznia 1973 w powiecie ostrowskim reaktywowano gminę Nowe Skalmierzyce, początkowo z siedzibą w Nowych Skalmierzycach."},{"page_url":"https://de.wikipedia.org/wiki/Lulo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Lulo.jpg","page_title":"Lulo","context_page_description":"Die Lulo oder Quitorange, auf Spanisch auch Naranjilla genannt, ist eine südamerikanische Kulturpflanze aus der Gattung Nachtschatten in der Familie der Nachtschattengewächse. Lulo ist die aus dem Quechua abgeleitete, vor allem in Kolumbien verbreitete Bezeichnung, während in Ecuador die aus dem Spanischen stammende Bezeichnung Naranjilla verwendet wird. Das wissenschaftliche Art-Epitheton quitoense ist von Quito, der Hauptstadt Ecuadors, gebildet."},{"page_url":"https://no.wikipedia.org/wiki/Claudius","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/A_Roman_Emperor_AD41_detail.jpg","page_title":"Claudius","context_page_description":"Tiberius Claudius Nero Drusus Germanicus var romersk keiser fra 24. januar 41 til sin død 13. oktober 54. Han var av det Julio-Claudiske dynasti, og var sønn av Drusus og Antonia den yngre. Han var født i Lugdunum i Gallia, og var første romerske keiser født utenfor Italia. Som ung var han sykelig, haltet og hadde dårlig hørsel. Derfor var han ekskludert fra familien og fra offisielle verv, fram til han delte stillingen som konsul med sin nevø Caligula fra år 37. Claudius' skrøpelighet berget ham trolig gjennom utrenskningene som foregikk både under Tiberius og Caligula, da hans potensielle fiender ikke anså ham som noen trussel. At han overlevde disse, muliggjorde at han ble utropt til keiser av Pretorianergarden etter at Caligula var blitt henrettet, på et tidspunkt hvor han var siste gjenlevende av voksne mannlige medlemmer av familien.\\nTil tross for manglende erfaring, viste Claudius seg å være en dyktig og effektiv administrator. Han var også en ambisiøs byggherre som fikk bygget mange nye veier, akvedukter og kanaler over hele imperiet. I sin regjeringstid erobret Claudius Thrakia, Noricum, Pamfylia, Lykia og Judea, og påbegynte den romerske ekspansjonen i Britannia."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B1%D1%8D%D0%BB%D1%8F%D0%BA%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Kobeliaky_Cathedral.JPG","page_title":"Кабэлякы","context_page_description":"Кабэлякы — горад у Палтаўскай вобласці Украіны на рацэ Ворскла за 13 км ад аднайменнай чыгуначнай станцыі на лініі Палтава - Крэменчуг. Раённы цэнтр.\\nПрацуюць завод харчовых тавараў «Мара», швейная фабрыка, хлебакамбінат, камбікормавы завод і інш. Горад газіфікаваны з 1966 г. Ёсць крыты рынак, аўтавакзал. Тры школы, музычная школа, школа-інтэрнат, прафтэхвучылішча, 2 дзіцячых садка. Ёсць дом культуры на 550 месцаў, бібліятэка, гістарычны музей, музей літаратуры і мастацтва, 3 паркі адпачынку."},{"page_url":"https://de.wikipedia.org/wiki/St._Johann_Baptist_(Breitnau)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/St._Johannes_%28Breitnau%29_jm30024.jpg","page_title":"St. Johann Baptist (Breitnau)","context_page_description":"St. Johann Baptist ist die römisch-katholische Pfarrkirche der Gemeinde Breitnau im Landkreis Breisgau-Hochschwarzwald von Baden-Württemberg. Die Pfarrgemeinde bildet mit den Pfarreien Mariä Himmelfahrt in Hinterzarten, St. Jakobus in Neustadt, Christkönig in Titisee und St. Nikolaus in Waldau die Seelsorgeeinheit Beim Titisee des Erzbistums Freiburg. Besonders der Pfarrer und Kunsthistoriker Manfred Hermann hat die Geschichte und Gestalt der Kirche erforscht."},{"page_url":"https://hr.wikipedia.org/wiki/Artimus_Pyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Artimus_Pyle_-_Lynyrd_Skynyrd_drummer.jpg","page_title":"Artimus Pyle","context_page_description":"Artimus Pyle je američki glazbenik, bubnjar."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B2%D0%B5%D0%BD%D0%B5-%D0%92%D0%B0%D0%BB%D1%8C-%D0%B4%27%D0%9E%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Avenay-51.JPG","page_title":"Авене-Валь-д'Ор","context_page_description":"Авене́-Валь-д'Ор — муніципалітет у Франції, у регіоні Шампань-Арденни, департамент Марна. Населення — 901 осіб.\\nМуніципалітет розташований на відстані близько 130 км на схід від Парижа, 27 км на північний захід від Шалон-ан-Шампань."},{"page_url":"https://pt.wikipedia.org/wiki/Tupolev_TB-3","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/T-27_tb-3.jpg","page_title":"Tupolev TB-3","context_page_description":"O Tupolev TB-3 foi um bombardeiro pesado, que foi implantado pela Força Aérea Soviética em 1932 e usado na Segunda Guerra Mundial. Foi o primeiro bombardeiro pesado quadrimotor do mundo. Apesar de ser obsoleto e sendo oficialmente retirado de serviço em 1939, o TB-3 exerceu funções de bombardeio e transporte durante quase toda a Segunda Guerra Mundial. O TB-3 também foi usado como nave-mãe no Projeto Zveno, que era basicamente um avião maior carregando aviões de caça menores."},{"page_url":"https://hu.wikipedia.org/wiki/Scheer","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/00/Karte_Scheer.png","page_title":"Scheer","context_page_description":"Scheer település Németországban, azon belül Baden-Württembergben. Lakosainak száma 2490 fő. +/-"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A7%E3%83%9F%E3%83%8A%E8%B3%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Zeruya_Shalev_%287044917941%29_%28cropped%29.jpg","page_title":"フェミナ賞","context_page_description":"フェミナ賞は、ゴンクール賞、ルノードー賞、メディシス賞、アンテラリエ賞と並んで、フランスでの最も権威ある文学賞の一つである。1904年に女性詩人アンナ・ド・ノアイユの提唱により、女性向け雑誌『ラ・ヴィー・ウールーズ』の女性寄稿者22人により創設された。1904年のゴンクール賞で、女性作家ミリアム・アリーが候補に挙がっていたにもかかわらず、男性作家レオン・フラピエが受賞したために、ミソジニー的なゴンクール賞に対抗して制定された賞である。実際、女性初のゴンクール賞受賞者はエルザ・トリオレであり、40年後のことである。\\n毎年、最も優れたフランス語の散文もしくは詩作品に贈られる。11月の第1水曜日に、パリのクリヨン・ホテルで女性審査員10人によって選出される。"},{"page_url":"https://pt.wikipedia.org/wiki/Diagrama_de_fluxo_de_sinal","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Associa%C3%A7%C3%A3o_em_paralelo.png","page_title":"Diagrama de fluxo de sinal","context_page_description":"Um grafo de fluxo de sinal ou diagrama de fluxo de sinal ou Grafo de Mason, inventado por Claude Shannon, é um grafo de fluxo peculiar cuja estrutura configura um grafo orientado no qual os nós representam as variáveis do sistema ao passo que as setas representam conexões funcionais entre os pares de nós. Os GFSs são mais comumente usados para representar o fluxo de sinal em um sistema físico e em seu controlador, formando um sistema ciber-físico. Entre seus outros usos, estão a representação do fluxo de sinal em várias redes e amplificadores eletrônicos, filtros digitais, filtros de estado variável e alguns outros tipos de filtros analógicos. Em quase toda a literatura, um grafo de fluxo de sinal está associado a um conjunto de equações lineares."},{"page_url":"https://vi.wikipedia.org/wiki/Hoceni","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Hoceni_judetul_Vaslui.jpg","page_title":"Hoceni","context_page_description":"Hoceni là một xã thuộc hạt Vaslui, România. Dân số thời điểm năm 2002 là 3208 người."},{"page_url":"https://es.wikipedia.org/wiki/Rachell_Ferrell","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Rachelle_Ferrelle_2011.jpg","page_title":"Rachell Ferrell","context_page_description":"Rachelle Ferrell es una cantante y compositora estadounidense. Aunque iniciada y partícipe en géneros como el Gospel, R&B y Pop, su corriente más conocida y talentosa es el Jazz contemporáneo."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B8%D1%87%D0%B8%D0%B3%D0%B0%D0%BD%D1%81%D0%BA%D0%B8_%D1%83%D0%BD%D0%B8%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/UniversityofMichiganLurieTower.jpg","page_title":"Мичигански университет","context_page_description":"Мичиганският университет е американски държавен университет.\\nОткрит е през 1817 г. в Детройт и е преместен през 1941 г. в гр. Ан Арбър, щата Мичиган. Университетът е най-важният в Системата на университети в Мичиган. Има два допълнителни кампуса, разположени в Диърборн и във Флинт.\\nСчита се, че е сред най-добрите държавни университети в САЩ. Член е на Асоциацията на американските университети, която представлява от 1900 г. съюз на водещи северноамерикански университети с интензивно изследване."},{"page_url":"https://af.wikipedia.org/wiki/Georgi%C3%AB","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Keselo%2C_Tusheti.jpg","page_title":"Georgië","context_page_description":"Georgië is 'n Eurasiese land in die Kaukasus en is geleë aan die ooskus van die Swartsee. Sy buurstate sluit in Rusland, Turkye en Armenië en Azerbeidjan. Die hoofstad en grootste stad is Tbilisi; Koetaisi het vanaf Oktober 2012 tot Desember 2018 as regeringsetel gedien. Die land het ’n oppervlakte van 69 700 km² en ’n bevolking van omtrent 3,7 miljoen.\\nGeorgië het ’n demokraties verkose staatshoof. Sedert 2018 is dit Salome Zurabisjwili. Danksy onder meer die vorige president, Micheil Saakasjwili, se goeie betrekkinge met die Verenigde State vorder Georgië goed in sy poging om 'n Navo-lidland te word. Dit is onder groot protes van Rusland, wat Georgië en ander oud-Sowjetstate steeds as deel van sy invloedsfeer beskou.\\nKoninkryke wat in die gebied geleë was, Iberië en Kolchis, het in die 4de eeu n.C. reeds die Christelike geloof aanvaar. Vandag is 80% van die inwoners Georgies-Ortodokse Christene, terwyl 2% Russies-Ortodoks en 4% van die Armeens-Apostoliese Kerk is.\\nGeorgië het die hoogtepunt van sy politieke en ekonomiese mag in die 11de tot 12de eeu bereik toe Iberië en Kolchis in die Koninkryk Georgië verenig is."},{"page_url":"https://en.wikipedia.org/wiki/Structure_of_the_Danish_Armed_Forces_in_1989","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/HDMS_Olfert_Fischer_%28F355%29.jpg","page_title":"Structure of the Danish Armed Forces in 1989","context_page_description":"The following article depicts the structure of the Danish Armed Forces in 1989 by service branch. In wartime all Danish military units would have come under the joint West German/Danish NATO command Allied Forces Baltic Approaches. BALTAP was a principal subordinate command under the Allied Forces Northern Europe Command. The commander-in-chief of was always a Danish Lieutenant General or Vice Admiral, who had the designation Commander Allied Forces Baltic Approaches. In peacetime BALTAP had only a few communication units allocated and all other units remained under national command of West Germany's Bundeswehr and Denmark's Forsvaret."},{"page_url":"https://en.wikipedia.org/wiki/Eilidh_Doyle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Eilidh_Child.jpg","page_title":"Eilidh Doyle","context_page_description":"Eilidh Doyle is a British track and field athlete who specialises in the 400 metres hurdles and the 4 x 400 metres relay. She represented Great Britain at the 2012 Olympic Games in London, and won an Olympic bronze medal in the 4 x 400 metres relay at the 2016 Games in Rio de Janeiro.\\nDoyle is the Scottish record holder for the 400 metres hurdles with 54.09 sec and the indoor 400 metres with 51.45 sec. She is the 2014 European Champion and a three-time Commonwealth silver medalist in the 400 metres hurdles. Her other relay honours include World Championship silver medals in 2013 and 2017, and the bronze medal in 2015. She was also a world and European indoor medalist in the 400 metres."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Autobahnkirchen_und_-kapellen_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Exter_Autobahnkirche_IMGP8781_wp.jpg","page_title":"Liste der Autobahnkirchen und -kapellen in Deutschland","context_page_description":"Diese Liste enthält Autobahnkirchen und -kapellen in Deutschland, christliche Sakralbauten in unmittelbarer Nähe einer Autobahn, die ausdrücklich zur Autobahnkirche beziehungsweise -kapelle erklärt wurden."},{"page_url":"https://ca.wikipedia.org/wiki/Jean_de_La_Barri%C3%A8re","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Jean-Baptiste_de_la_Barri%C3%A8re%2C_Fondateur_des_Feuillants.jpg","page_title":"Jean de La Barrière","context_page_description":"Jean de la Barrière va ésser un monjo cistercenc, abat i reformador de l'abadia de Notre-Dame de Feuillant prop de Tolosa de Llenguadoc i fundador de la Congregació Cistercenca de Feuillant o Orde dels Fuliencs. Ha estat proclamat venerable per l'Església catòlica."},{"page_url":"https://ca.wikipedia.org/wiki/La_Bastida_de_les_Alcusses","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Guerrer_Moixent_Bastida.jpg","page_title":"La Bastida de les Alcusses","context_page_description":"El poblat iber de la Bastida de les Alcusses és un assentament que data de finals del segle v aC al segle iv aC, situat en l'extrem sud-oest de la Serra Grossa. Està situat al terme de Moixent, al cim d'un turó allargat i aïllat, a 741 m sobre el nivell del mar. S'accedeix per la carretera CV-652 Moixent-Fontanars dels Alforins, amb accés senyalitzat al km 10,5. Es pot pujar amb vehicle fins a l'aparcament del poblat.\\nEl jaciment, situat sobre un turó, ocupa una extensió de 650 m de longitud i uns 150 m d'amplada. Està a més de 720 m sobre el nivell del mar, i a uns 200 m per sobre de les terres circumdants del Pla de les Alcusses, que és un petit altiplà elevat pel qual s'accedeix i del qual rep el nom. És considerat com un dels principals poblats ibèrics del País Valencià.\\nL'entorn actual del jaciment és un espai forestal, amb bosc de pi i matoll mediterrani baix. I encara que el cultiu actual de fruiters i cereals a la plana ha transformat moltes parcel·les, encara es pot apreciar un paisatge marcat, fonamentalment, pel ritme tradicional de les tasques agrícoles, en no existir-hi un fort impacte de construccions modernes."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AA%D9%88%D8%AC%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Thujene3D.png","page_title":"توجن","context_page_description":"توجن یا ثوجین با فرمول شیمیایی C۱۰H۱۶ یک ترکیب شیمیایی با شناسه پاب‌کم ۵۲۰۳۸۴ است. که جرم مولی آن ۱۳۶٫۲۳۴۰۴ می‌باشد."},{"page_url":"https://oc.wikipedia.org/wiki/Avocat_(mesti%C3%A8r)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Cicero_-_Musei_Capitolini.JPG","page_title":"Avocat (mestièr)","context_page_description":"En drech, l'avocat es un jurista que sa foncion tradicionala es de defendre los seus clients, personas fisicas o moralas, en justícia, en pledejant per far valer los lors interèsses e, mai generalament, per los representar. L'avocat fa foncion de conselh e de redactor d'actes. Lo ministèri d'avocat es de vegadas obligatòri pel drech nacional, subretot per d'assegurar los drechs de la defensa devant unas jurisdiccions."},{"page_url":"https://en.wikipedia.org/wiki/The_Satyr_and_the_Traveller","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Jan_van_der_Venne_-_Satyr_and_Peasant_in_a_Tavern.jpg","page_title":"The Satyr and the Traveller","context_page_description":"The Satyr and the Traveller is one of Aesop's Fables and is numbered 35 in the Perry Index. The popular idiom 'to blow hot and cold' is associated with it and the fable is read as a warning against duplicity."},{"page_url":"https://en.wikipedia.org/wiki/Great_Western_Railway_(train_operating_company)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Barnstaple_-_GWR_143619_leaving_for_Exmouth.JPG","page_title":"Great Western Railway (train operating company)","context_page_description":"Great Western Railway is a British train operating company owned by FirstGroup that operates the Greater Western railway franchise. It manages 197 stations and its trains call at over 270. GWR operates long-distance inter-city services along the Great Western Main Line to and from the West of England and South Wales, inter-city services from London to the West Country via the Reading–Taunton line and the Night Riviera sleeper service between London and Penzance. It also provides commuter and outer-suburban services from its London terminus at Paddington to West London, the Thames Valley region including parts of Berkshire, parts of Buckinghamshire and Oxfordshire; and regional services throughout the West of England and South Wales to the South coast of England. GWR will also be providing and maintaining the new fleet for Heathrow Express from May 2020.\\nThe company began operating in February 1996 as Great Western Trains, as part of the privatisation of British Rail. In December 1998 it became First Great Western after FirstGroup bought out its partners' shares in Great Western Holdings."},{"page_url":"https://de.wikipedia.org/wiki/Strichcode","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Deutsche_Post_AG_Zielcode_Adresscode_Anschriftencode_Barcode_Strichcode_Brief_Postkarte_Code.jpg","page_title":"Strichcode","context_page_description":"Als Strichcode, Balkencode, Streifencode oder Barcode wird eine optoelektronisch lesbare Schrift bezeichnet, die aus verschieden breiten, parallelen Strichen und Lücken besteht. Der Begriff Code steht hierbei für Abbildung von Daten in binären Symbolen. Die Daten in einem Strichcode werden mit optischen Lesegeräten, wie z. B. Barcodelesegeräten oder Kameras, maschinell eingelesen und elektronisch weiterverarbeitet."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%AB%D5%B4%D5%A1_%D5%91%D5%B5%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Shiji.jpg","page_title":"Սիմա Ցյան","context_page_description":"Սիմա Ցյան ՝ չին պատմագիր, Հին Չինաստանի թերևս ամենակարևոր պատմագիրը:"},{"page_url":"https://vi.wikipedia.org/wiki/Le_khoang_c%E1%BB%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Whiskered_Tern_with_Cotton_Pygmy_Geese_I_IMG_9385.jpg","page_title":"Le khoang cổ","context_page_description":"Le khoang cổ là một loài vịt đậu cây nhỏ sinh sống trong khu vực Ấn Độ, Pakistan, Đông Nam Á và kéo dài về phía nam tới miền bắc Úc. Trong một số ngôn ngữ bản địa nó được gọi là girri, girria, girja; gurgura; bali hans; bhullia hans; dandana; ade, atla; naher, keeke, chuwa; baher, kararhi."},{"page_url":"https://de.wikipedia.org/wiki/Backform","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Backschale1.jpg","page_title":"Backform","context_page_description":"Die Backform dient zum Backen von Kuchen, Torten, Brot, Kleingebäck und Pasteten. Ursprünglich aus Steinzeug oder feuerverzinntem Kupfer, besteht eine Backform heute in der Regel aus emailliertem oder verzinntem Eisenblech, häufig mit einer Antihaftbeschichtung. Daneben gibt es auch durchsichtige Backformen aus hitzebeständigem Borosilikatglas.\\nRelativ neu im Handel sind Backformen aus Silikon. Sie sind im Gegensatz zu Backformen aus Metall flexibel und lassen sich dadurch besser vom Backwerk lösen.\\nHauptzweck von Backformen ist es, die durch hohen Flüssigkeits- oder Fettgehalt weichen Teige und Massen wie Rühr- und Biskuitteig oder fettreiche Füllungen am Auseinanderfließen zu hindern, bis sich die Masse verfestigt, meist indem das in ihr enthaltene Eiweiß in der Ofenhitze gerinnt. Brot, Kleingebäck und viele Hefefeingebäcke sind ungebacken oft ausreichend formstabil, um „frei geschoben“ auf dem Blech gebacken zu werden, doch backt man auch Brot, Stuten, Stollen usw. vielfach in Backformen."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%85rstaberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/%C3%85rsta_gamla_skola_mars_2018a.jpg","page_title":"Årstaberg","context_page_description":"Årstaberg är ett informellt område i stadsdelarna Liljeholmen och Årsta i Söderort inom Stockholms kommun. Eftersom området är informellt har det inte exakt fastställda gränser. Området begränsas ungefär av Årstabergsvägen i söder, av Svärdlångsvägen i öster, av Årstadal i norr och grönområdet med Berga gamla tomt i väster."},{"page_url":"https://fr.wikipedia.org/wiki/Evgueni_Fiodorov","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Fedorov_Eugeny_20_july_2017.jpg","page_title":"Evgueni Fiodorov","context_page_description":"Evgueni Alekseïevitch Fiodorov à Leningrad en RSFSR, en Union soviétique est un homme politique russe."},{"page_url":"https://pt.wikipedia.org/wiki/Deserto_de_Gibson","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/MVC-684F.JPG","page_title":"Deserto de Gibson","context_page_description":"O Deserto de Gibson é um deserto localizado no centro-oeste da Austrália."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Greene_County_(Missouri)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Old_calaboose_Springfield%2C_Missouri.JPG","page_title":"Liste der Einträge im National Register of Historic Places im Greene County (Missouri)","context_page_description":"Die Liste der Einträge im National Register of Historic Places im Greene County in Missouri führt die Bauwerke und historischen Stätten im Greene County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://en.wikipedia.org/wiki/Syed_Zainul_Abedin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Dargah_of_Sufi_saint_Moinuddin_Chishti_Ajmer_India_%285%29.JPG","page_title":"Syed Zainul Abedin","context_page_description":"Syed Zainul Abedin is the Dewan of the Ajmer Sharif Dargah founded by Khawaja Moinuddin Chishti, according to the APEX Court of India. He is the successor of Khwaja Gareeb Nawaz, and is also known as Dargah Dewan, successor, Sajjadanashin of the Chishti order of Sufism, Gaddinashin, Pir and Sheikhul Mashaeikh Dewan Syed Zainul Abedin Ali Khan Sahib of the Ajmer Sharif Dargah."},{"page_url":"https://ca.wikipedia.org/wiki/Cat%C3%A0nia_(dol%C3%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/CataloniaCatanies.JPG","page_title":"Catània (dolç)","context_page_description":"Les Catànies són un dolç sec típic de Vilafranca del Penedès, elaborat amb ametlles marcones senceres, torrades i caramel·litzades, recobertes de pasta d’ametlla, avellana i llet i després recobert d’una fina capa de xocolata negra o cacau i sucre refinat. Les catànies foren inventades pel xocolater vilafranquí Joan Trens i Ribas."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%83%91%E5%B7%9E%E6%96%B0%E9%83%91%E5%9B%BD%E9%99%85%E6%9C%BA%E5%9C%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Terminal_1_of_CGO_20141201.jpg","page_title":"郑州新郑国际机场","context_page_description":"郑州新郑国际机场，是中华人民共和国河南省郑州市的一座大型民用机场、中国民航局确定的中国八大航空枢纽港之一。机场按照国际化标准设计，飞行区等级为4F级，于1997年建成通航，是中国国内干线运输机场和国家一类航空口岸。郑州新郑国际机场是河南省最主要的民用机场，作为河南省的空中门户和国内重要的航空港之一，承担着河南省的大部分航空运输任务，运输规模占全省民航运输的96%以上。根据2019年的统计数据，新郑机场旅客吞吐量2912.93万人次，位列中国大陆第十二，货邮吞吐量52.2万吨，位列中国大陆第七，为中部六省旅客吞吐量和货邮吞吐量最大的机场。\\n新郑机场坐落在郑州市东南新郑市薛店镇和孟庄镇交界，距离郑州市区25公里，由河南省机场集团有限公司管理运营，目前为卢森堡货运航空、中国南方航空、西部航空、东海航空、祥鹏航空、深圳航空等航空公司的基地机场。根据远景规划，新郑机场将建设为国际航空货运枢纽和国内航空综合枢纽。"},{"page_url":"https://cs.wikipedia.org/wiki/Muhu_(obec)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d0/Eesti_muhu_vald.png","page_title":"Muhu (obec)","context_page_description":"Obec Muhu je samosprávná obec, náležející do estonského kraje Saaremaa. Její území tvoří ostrov Muhu a jej obklopující menší ostrovy a ostrůvky."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%A8%D8%A7%D9%84%D9%83%D8%A7%D8%A6%D9%86%D8%A7%D8%AA_%D8%A7%D9%84%D8%AD%D9%8A%D8%A9_%D8%AD%D8%B3%D8%A8_%D8%B9%D8%AF%D8%AF_%D8%A7%D9%84%D9%83%D8%B1%D9%88%D9%85%D9%88%D8%B3%D9%88%D9%85%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Ailurus_fulgens_RoterPanda_LesserPanda.jpg","page_title":"قائمة بالكائنات الحية حسب عدد الكروموسومات","context_page_description":"تصف قائمة الكائنات الحية حسب عدد الكروموسوم الصيغة الصبغية أو أعداد الكروموسومات في خلايا النباتات والحيوانات والطلائعيات والكائنات الحية الأخرى المختلفة. يُعرف هذا العدد، بالإضافة إلى المظهر البصري للكروموسوم، بالنمط النووي، ويمكن العثور عليه بالنظر إلى الكروموسومات من خلال المجهر. يتم الانتباه إلى طولها، وموضع السنترومير، ونمط النطاق، وأي فروق بين الكروموسومات الجنسية وأي خصائص فيزيائية أخرى. يعد إعداد ودراسة الأنماط النووية جزءاً من علم الوراثة الخلوية."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/L%C3%ADsek","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/L%C3%ADsek_flag.jpg","page_title":"Lísek","context_page_description":"Lísek sī Czech Vysočina chiu Žďár nad Sázavou koān ê chi̍t ê hiuⁿ-siā."},{"page_url":"https://ro.wikipedia.org/wiki/Nikola_Ivanov","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/BASA-1599K-1-1882-48-Nikola_Ivanov.JPG","page_title":"Nikola Ivanov","context_page_description":"Nikola Ivanov a fost un general bulgar. Este cunoscut pentru capturarea Adrianopolului în Primul Război Balcanic."},{"page_url":"https://de.wikipedia.org/wiki/H%C3%B6here_Graphische_Bundes-Lehr-_und_Versuchsanstalt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Wien_14_H%C3%B6here_Graphische_Lehranstalt_a.jpg","page_title":"Höhere Graphische Bundes-Lehr- und Versuchsanstalt","context_page_description":"Die Höhere Graphische Bundes-Lehr- und Versuchsanstalt in Wien ist eine berufsbildende höhere Schule für Berufe der visuellen Kommunikation und Medientechnik in Österreich. Sie wird im allgemeinen Sprachgebrauch meist „die Graphische“ genannt.\\nDie HGBLuVA wurde im Jahr 1888 gegründet und ist die einzige ihrer Art in Österreich. Hier werden Schüler und Studenten der vier Abteilungen in einander ergänzenden Fachrichtungen in visueller Kommunikation ausgebildet: In der Abteilung Grafik- und Kommunikationsdesign werden für Auftraggeber aus Wirtschaft und Kultur visuelle Konzepte entwickelt und gestaltet; in der Abteilung Fotografie und audiovisuelle Medien und Multimedia die dafür benötigten bildhaften Umsetzungen realisiert oder selbständige bildhafte Werke erstellt; und in der Abteilung Druck- und Medientechnik Druckprodukte zusammengeführt und reproduktionstechnisch geplant und umgesetzt."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8F%E3%82%B4%E3%82%A4%E9%A3%9B%E8%A1%8C%E5%A0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Badly_battered_Japanese_plane.jpg","page_title":"ハゴイ飛行場","context_page_description":"ハゴイ飛行場は北マリアナ諸島テニアン島の北部にあり、アメリカ海兵隊が管理する飛行場である。ハゴイ飛行場という呼称は完成時の名称で、この他にも日本統治時代には北飛行場、ウシ飛行場とも呼称された。なお、現在の米軍内での名称はノースフィールド飛行場である。2,500メートル級の滑走路を4本持ち、太平洋戦争末期には広島、長崎に向けて原爆搭載機が発進した飛行場である。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BE%8E%E5%9B%BD%E6%BC%94%E5%91%98%E5%B7%A5%E4%BC%9A%E7%BB%88%E8%BA%AB%E6%88%90%E5%B0%B1%E5%A5%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Rita_Moreno_face.jpg","page_title":"美国演员工会终身成就奖","context_page_description":"美國演員工會終身成就獎是由美國演員工會的國家榮譽和表彰委員會頒發的，以表彰「在培養演藝界最崇高理想方面的傑出成就」。它比第一屆美國演員工會獎早誕生30多年。1962年，該獎項的第一位獲獎者是演員和喜劇演員埃迪·康托爾。從那以後，除了1963年和1981年，每年都會頒發。還有兩年，有兩個人分享了該獎：1985年，該獎頒給了演員保羅·紐曼和演員瓊安·伍華德；2000年，該獎頒給了民權活動家奧西·戴維斯和露比·迪。"},{"page_url":"https://de.wikipedia.org/wiki/Kundratstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Cricetus_cricetus%2C_Kaiser-Franz-Josef-Spital%2C_Vienna.jpg","page_title":"Kundratstraße","context_page_description":"Die Kundratstraße ist eine Straße in den Wiener Gemeindebezirken 10, Favoriten, und 12, Meidling. Sie stellt zwischen Gürtel und Wienerbergstraße die einzige Verbindung von der Triester Straße nach Westen dar. Seit 1897 ist die Kundratstraße nach dem Pathologen Johann Kundrat benannt."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%AA%E6%81%A9%C2%B7%E6%B8%A9%E8%BE%BE%E6%96%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Dean_Windass_Hull_City_v._Aberdeen_2.png","page_title":"迪恩·温达斯","context_page_description":"迪恩·溫達斯生於英格蘭約克郡-亨伯的侯城，是一名退役職業足球運動員，司職前鋒。\\n溫達斯在任職建築工人一段時期後才在赫爾城展開職業足球事業，曾分別效力鴨巴甸、牛津聯、巴拉福特、米德斯堡、錫周三及雪菲爾聯等球隊。溫達斯是一名充滿爭議性的球員，在效力鴨巴甸時於同一場比賽中被罰三面紅牌；而在巴拉福特時更曾手抓對方球員的睪丸。但溫達斯亦是一名多產前鋒，為巴拉福特至今入球第三高的球員。"},{"page_url":"https://es.wikipedia.org/wiki/Taudactylus_liemi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Taudactylus_liemi.jpg","page_title":"Taudactylus liemi","context_page_description":"Taudactylus liemi es una especie de anfibios de la familia Myobatrachidae."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%83%8C%E7%82%99%E5%B1%B1%E5%85%AC%E5%9C%92%E9%87%8E%E8%8D%89%E3%82%BE%E3%83%BC%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/ja/7/70/%E3%82%A8%E3%82%BE%E3%82%BF%E3%83%B3%E3%83%9D%E3%83%9D_Taraxacum_hondoense.JPG","page_title":"背炙山公園野草ゾーン","context_page_description":"背炙山公園野草ゾーンは、福島県会津若松市の背炙山公園内にあるミニ野草園である。春は、背炙山公園でヤマツツジ、レンゲツツジの花が映える。初夏には野草ゾーン内にガガイモ科カモメヅル属のフナバラソウ、スズサイコ等、草刈草原に特有、希少な草本が多く観察される。"},{"page_url":"https://sv.wikipedia.org/wiki/Phytomyza_angelicastri","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Phytomyza.angelicastri8.-.lindsey.jpg","page_title":"Phytomyza angelicastri","context_page_description":"Phytomyza angelicastri är en tvåvingeart som beskrevs av Erich Martin Hering 1932. Phytomyza angelicastri ingår i släktet Phytomyza och familjen minerarflugor.\\nArtens utbredningsområde är Polen. Arten är reproducerande i Sverige. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://es.wikipedia.org/wiki/Seogwipo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Squid_Boats_in_the_Harbor.jpg","page_title":"Seogwipo","context_page_description":"Seogwipo, es una ciudad de la provincia de Jeju, Corea del Sur, en la isla volcánica de dicho nombre.\\nCuenta con una población estimada de 155.691 habitantes. En 2002 fue una de las ciudades-sede de la Copa del Mundo de Fútbol."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%A9lix_Roulin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Nivelles_JPG00_%2815%29.jpg","page_title":"Félix Roulin","context_page_description":"Félix Roulin est un sculpteur belge, né le 21 août 1931 à Dinant."},{"page_url":"https://en.wikipedia.org/wiki/Awamori","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Taragawa_Cellar.jpg","page_title":"Awamori","context_page_description":"Awamori is an alcoholic beverage indigenous and unique to Okinawa, Japan. It is made from long grain indica rice, and is not a direct product of brewing but of distillation. All awamori made today is from indica rice imported from Thailand, the local production being insufficient to meet domestic demand.\\nAwamori is typically 60–86 proof, although \\"export\\" brands are increasingly 50 proof. Some styles are 120 proof and are flammable. Awamori is aged in traditional clay pots to improve its flavor and mellowness.\\nThe most popular way to drink awamori is with water and ice. When served in a restaurant in Okinawa, it will nearly always be accompanied by a container of ice and carafe of water. Awamori can also be drunk straight, on the rocks, and in cocktails. Traditionally, awamori was served in a kara-kara, a small earthen vessel with a small clay marble inside. The marble would make a distinctive \\"kara-kara\\" sound to let people know the vessel was empty. These vessels are still found in Okinawa, but the clay marbles are often absent.\\nAnother name for awamori used in Okinawa is \\"island sake\\", or shima for short.\\nIn general the price of awamori increases with the beverage's age."},{"page_url":"https://en.wikipedia.org/wiki/Awamori","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Taragawa_Cellar.jpg","page_title":"Awamori","context_page_description":"Awamori is an alcoholic beverage indigenous and unique to Okinawa, Japan. It is made from long grain indica rice, and is not a direct product of brewing but of distillation. All awamori made today is from indica rice imported from Thailand, the local production being insufficient to meet domestic demand.\\nAwamori is typically 60–86 proof, although \\"export\\" brands are increasingly 50 proof. Some styles are 120 proof and are flammable. Awamori is aged in traditional clay pots to improve its flavor and mellowness.\\nThe most popular way to drink awamori is with water and ice. When served in a restaurant in Okinawa, it will nearly always be accompanied by a container of ice and carafe of water. Awamori can also be drunk straight, on the rocks, and in cocktails. Traditionally, awamori was served in a kara-kara, a small earthen vessel with a small clay marble inside. The marble would make a distinctive \\"kara-kara\\" sound to let people know the vessel was empty. These vessels are still found in Okinawa, but the clay marbles are often absent.\\nAnother name for awamori used in Okinawa is \\"island sake\\", or shima for short.\\nIn general the price of awamori increases with the beverage's age."},{"page_url":"https://nl.wikipedia.org/wiki/Nederlands_kenteken","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Caribbean_Netherlands_license_plate_%28Saba%29.png","page_title":"Nederlands kenteken","context_page_description":"In 1898 introduceerde Nederland als derde land ter wereld een nationale kentekenplaat, na Frankrijk in 1893 en Duitsland in 1896. Het eerste kenteken bestond uit het cijfer 1, en werd op 26 april 1898 afgegeven op naam van W.A. van Dam uit Groningen. Het tweede, met het cijfer 2, werd uitgegeven aan zijn broer J. van Dam op dezelfde datum. Het volgende kenteken had nummer 3 etc, zij het dat het 'gekkengetal' 11 werd overgeslagen. Op 8 augustus 1899 waren er reeds 168 platen uitgegeven. Dit systeem werd op 15 januari 1906 afgeschaft. Het laatst uitgegeven nummer was het nummer 2065."},{"page_url":"https://pl.wikipedia.org/wiki/Maksymilian_Milan-Kamski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Maksymilian_Milan-Kamski.jpg","page_title":"Maksymilian Milan-Kamski","context_page_description":"Maksymilian Jan Milan-Kamski – generał brygady Wojska Polskiego."},{"page_url":"https://en.wikipedia.org/wiki/Electric_power_system","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Big_Bend_Power_Station.jpg","page_title":"Electric power system","context_page_description":"An electric power system is a network of electrical components deployed to supply, transfer, and use electric power. An example of a power system is the electrical grid that provides power to homes and industry within an extended area. The electrical grid can be broadly divided into the generators that supply the power, the transmission system that carries the power from the generating centres to the load centres, and the distribution system that feeds the power to nearby homes and industries. Smaller power systems are also found in industry, hospitals, commercial buildings and homes. The majority of these systems rely upon three-phase AC power—the standard for large-scale power transmission and distribution across the modern world. Specialised power systems that do not always rely upon three-phase AC power are found in aircraft, electric rail systems, ocean liners, submarines and automobiles."},{"page_url":"https://en.wikipedia.org/wiki/Eastern_newt","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Red-spotted_newt_%28N._v._viridescens%29.jpg","page_title":"Eastern newt","context_page_description":"The eastern newt is a common newt of eastern North America. It frequents small lakes, ponds, and streams or nearby wet forests. The eastern newt produces tetrodotoxin, which makes the species unpalatable to predatory fish and crayfish. It has a lifespan of 12 to 15 years in the wild, and it may grow to 5 in in length. These animals are common aquarium pets, being either collected from the wild or sold commercially. The striking bright orange juvenile stage, which is land-dwelling, is known as a red eft. Some sources blend the general name of the species and that of the red-spotted newt subspecies into the eastern red-spotted newt."},{"page_url":"https://eo.wikipedia.org/wiki/Hortob%C3%A1gy_(vila%C4%9Do)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Hortobagy-ziehbrunnen.jpg","page_title":"Hortobágy (vilaĝo)","context_page_description":"Hortobágy [hortobAdj] estas vilaĝo en Hungario, en regiono Norda Ebenaĵo, en departemento Hajdú-Bihar, en subregiono Balmazújváros. La nomo ne havas sencon en la hungara."},{"page_url":"https://en.wikipedia.org/wiki/HMTSS_Te_Mataili_II_(802)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/RSIPV_Gizo_at_Austal_shipyards_in_Henderson%2C_Western_Australia%2C_September_2019_01.jpg","page_title":"HMTSS Te Mataili II (802)","context_page_description":"HMTSS Te Mataili II (802) is the second Guardian-class patrol boat completed, and the first to be given to the small Pacific Ocean nation Tuvalu. She was commissioned on 5 April 2019, replacing Te Mataili, a Pacific Forum patrol vessel, that had reached the end of her designed lifetime."},{"page_url":"https://nl.wikipedia.org/wiki/Parkhof_(Alkmaar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Alkmaar_-_IJkgebouw_in_Victoriepark_4.jpg","page_title":"Parkhof (Alkmaar)","context_page_description":"Parkhof was van 1980 tot 2009 een Nederlands poppodium in het IJkgebouw gelegen aan Victoriepark te Alkmaar."},{"page_url":"https://ro.wikipedia.org/wiki/Tricholoma_imbricatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Tricholoma_pessundatum_176487.jpg","page_title":"Tricholoma imbricatum","context_page_description":"Tricholoma imbricatum din încrengătura Basidiomycota, în familia Tricholomataceae și de genul Tricholoma, este o specie de ciuperci comestibile care coabitează, fiind un simbiont micoriza, formând prin urmare micorize pe rădăcinile arborilor. O denumire populară nu este cunoscută. Acest burete destul de comun trăiește în România, Basarabia și Bucovina de Nord de obicei în grupuri, adesea în mănunchiuri, în păduri de conifere și mixte precum la marginea lor aproape exclusiv sub pini, foarte rar și pe lângă molizi. Marcel Bon pretinde că soiul s-ar dezvolta din când în când și sub plopi sau stejari. Apare pe sol nisipos și sărac în calcar, de la câmpie la munte, din septembrie până în noiembrie."},{"page_url":"https://en.wikipedia.org/wiki/Wesleyan_Church,_Aldershot","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Aldershot_Wesleyan_Soldiers_Home_c1897.jpg","page_title":"Wesleyan Church, Aldershot","context_page_description":"The Wesleyan Church is a former Methodist church for the town of Aldershot in Hampshire. Closed in 1988 the building has been a Grade II* listed building since 30 April 1981. In use today as offices, a dental studio and a gymnasium, the former Wesleyan Church is situated on the corner of Grosvenor Road and Queens Road in Aldershot."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BF%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D1%8F_%C2%AB%D0%A7%D0%B0%D1%80%D0%BD%D0%B2%D1%83%D0%B4%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Dug-in_panzer_IV.jpg","page_title":"Операция «Чарнвуд»","context_page_description":"Операция «Чарнвуд» — наступательная операция британских и канадских войск, проведённая 8—9 июля 1944 года в рамках Нормандской операции Второй мировой войны. В ходе операции союзники намеревались захватить хотя бы часть занятого немцами города Кан, являвшегося важной целью начальных этапов Нормандской операции. Также возлагались надежды на то, что наступление предотвратит переброску немецких танковых соединений в американский сектор, в котором планировалось совершить прорыв немецкой обороны. Британцы и канадцы начали наступление на широком фронте и к вечеру второго дня операции захватили Кан вплоть до рек Орн и Одон.\\nОперация «Чарнвуд» началась на рассвете 8 июля после массированного налёта бомбардировщиков, уничтожившего большую часть Старого города. Батальоны трёх пехотных дивизий под прикрытием мощного артиллерийского огня атаковали немецкие позиции в северной части Кана. Войска 1-го британского корпуса, поддерживаемые тремя бронетанковыми бригадами, постепенно продвигались, преодолевая сопротивление 12-й танковой дивизии СС «Гитлерюгенд» и 16-й авиаполевой дивизии люфтваффе."},{"page_url":"https://nn.wikipedia.org/wiki/Russland_i_Junior_Eurovision_Song_Contest","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Mikhail_Smirnov_at_stage_of_JESC_2015_%282%29.jpg","page_title":"Russland i Junior Eurovision Song Contest","context_page_description":"Russland debuterte i Junior Eurovision Song Contest i 2005 i Hasselt, Belgia, med songen «Doroga K Solntsu», framført på russisk av Vladislav Krutskikh. Bidraga vert valt gjennom ei nasjonal finale, arrangert av den russiske kringkastaren Russia-1. I 2014, vart bidraget valt internt.\\nEkaterina Ryabova vart den fyrste songaren til å tevle to gongar i Junior Eurovision Song Contest, då ho deltok i 2009 og 2011. Lerika vart den fyrste til å tevle to år rad, men for to ulike land. I 2011 tevla ho for Moldova, og i 2012 for Russland.\\nRussland har vunne Junior Eurovision Song Contest to gongar. I 2006 vann dei for fyrste gong med songen «Vesenniy Jazz», syngja av Tolmachevy Twins. Det var også fyrste gongen Russland vann ei Eurovision-konkurranse. I 2017 vann dei igjen, med songen «Wings», syngja av Polina Bogusevitsj."},{"page_url":"https://pl.wikipedia.org/wiki/Dinamo_Ryga_(hokej_na_lodzie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Dinamo_Riga_-_Barys_Astana_2008-12-28.jpg","page_title":"Dinamo Ryga (hokej na lodzie)","context_page_description":"Dinamo Ryga – łotewski klub hokejowy z siedzibą w Rydze, występujący w rozgrywkach KHL. Klub został reaktywowany 7 kwietnia 2008 roku."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_l%27Aveyron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Le_pont_gothique_%C3%A0_Estaing.jpg","page_title":"Liste des monuments historiques de l'Aveyron","context_page_description":"Cet article recense les monuments historiques de l'Aveyron, en France.\\nPour les monuments historiques de la commune de Rodez, voir la liste des monuments historiques de Rodez\\nPour les monuments historiques de la commune de Villefranche-de-Rouergue, voir la liste des monuments historiques de Villefranche-de-Rouergue"},{"page_url":"https://es.wikipedia.org/wiki/Demograf%C3%ADa_de_Uruguay","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Uruguay-demography.png","page_title":"Demografía de Uruguay","context_page_description":"La población de Uruguay se constituye esencialmente a partir del aporte de grupos de distintas oleadas migratorias.\\nLos pueblos indígenas originales eran demográficamente pequeños y fueron desapareciendo debido a la aculturación, discriminación y exterminio ocurridos hasta el siglo XIX.​ En la actualidad, la inmensa mayoría de los uruguayos son descendientes de europeos​ con minorías indígenas​, mestizas, negras y una muy pequeña de asiáticos."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC%D1%8E%D1%8D%D0%BB%D1%8C_%D0%AD%D1%82%D0%BE%E2%80%99%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Etoo_Joan_Gamper_Trophy_2008.jpg","page_title":"Самюэль Это’о","context_page_description":"Самюэль Это’о — былы камерунскі футбаліст, нападнік. Ігрок нацыянальнай зборнай Камеруна, адзін з найлепшых футбалістаў афрыканскага футбола. Найлепшы бамбардзір у гісторыі Кубка афрыканскіх нацый."},{"page_url":"https://it.wikipedia.org/wiki/Raterio_di_Verona","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Li%C3%A8ge%2C_Palais_Provincial05%2C_statues_des_%C3%A9v%C3%AAques_Francon%2C_Rath%C3%A8re_et_Wazon.JPG","page_title":"Raterio di Verona","context_page_description":"Raterio è stato un vescovo, predicatore e scrittore belga autore di opere in lingua mediolatina."},{"page_url":"https://vi.wikipedia.org/wiki/Lissemys_punctata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Lissemys_punctata1.jpg","page_title":"Lissemys punctata","context_page_description":"Lissemys punctata là một loài rùa trong họ Trionychidae sống ở Nam Á. Loài này được Bonnaterre mô tả khoa học đầu tiên năm 1789."},{"page_url":"https://es.wikipedia.org/wiki/Jard%C3%ADn_de_Esculturas","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Jard%C3%AD_de_les_Escultures_de_Barcelona_-_Riera_i_Arag%C3%B3-_Gran_avi%C3%B3_d%E2%80%99h%C3%A8lix_blava_1990.JPG","page_title":"Jardín de Esculturas","context_page_description":"El jardín de Esculturas se encuentra en la montaña de Montjuïc, en el distrito de Sants-Montjuic de Barcelona, anexo a la Fundación Miró. Se construyó en 1990 con un proyecto arquitectónico de Jaume Freixa y Jordi Farrando, y en 2002 fue reconstruido por Marina Salvador. Contiene obras de escultores como Tom Carr, Pep Duran, Perejaume, Enric Pladevall, Jaume Plensa, Josep Maria Riera i Aragó, Cado Manrique, Ernest Altès, Gabriel Sáenz Romero y Sergi Aguilar."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%85%D8%A8%D8%B1%D9%8A%D9%86%D8%B3_(%D8%A8%D8%A7%D8%AF_%D9%83%D8%A7%D9%84%D9%8A%D9%87)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2b/Map_commune_FR_insee_code_62027.png","page_title":"أمبرينس (باد كاليه)","context_page_description":"أمبرينس، باد كاليه ‏ هي بلدية تقع في إقليم باد كاليه من منطقة نور با دو كاليه في شمال فرنسا. تبلغ مساحة هذه المدينة 4.68، وترتفع عن سطح البحر 127 م، يبلغ عدد سكانها 216 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Georges Lasselin البلدية خلال فترة."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9E%E3%83%A9%E3%82%A4%E3%82%AB%E3%83%BB%E3%82%A2%E3%83%AD%E3%83%BC%E3%83%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Malaika_A_Khan_LFW-2017.jpg","page_title":"マライカ・アローラ","context_page_description":"マライカ・アローラはインドの芸能人。マハーラーシュトラ州ターネーで生まれた。俳優、映画製作者、ビデオジョッキー、ダンサー、ファッションモデル、テレビ司会者とさまざまな側面からインド映画界を支えている。\\n2013年に日本でも公開されたインド映画「恋する輪廻 オーム・シャンティ・オーム」に出演している。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%AD%A3%E5%AE%9A%E5%8E%BF%E6%96%87%E5%BA%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Zhengdingxianwenmiaodachengdian.JPG","page_title":"正定县文庙","context_page_description":"正定县文庙坐落在河北省石家庄市正定县老城内育才街西侧，坐北朝南，县志记载建于明洪武七年，但由建筑风格判断建于唐末五代初。现存建筑还有照壁，泮池，戟门，东西庑和大成殿，其中大成殿是中国现存最早的文庙大成殿建筑。文庙内还有《重修真定县学碑记》，《重修文庙碑记》等石碑。\\n大成殿是文庙的正殿，可能是五代或宋朝初时的遗物，面宽五间，进深三间，面积650平米，单檐歇山顶，柱头铺作双杪偷心，斗拱雄伟，无补间铺作。\\n正定县文庙大成殿于1956年被列为河北省文物保护单位，1996年被列为第四批全国重点文物保护单位。"},{"page_url":"https://hu.wikipedia.org/wiki/Fontaines_(Sa%C3%B4ne-et-Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Fontaines_%28Francio%29.jpg","page_title":"Fontaines (Saône-et-Loire)","context_page_description":"Fontaines település Franciaországban, Saône-et-Loire megyében. Fontaines Rully, Mellecey, Chagny, Farges-lès-Chalon, Lessard-le-National, La Loyère és Mercurey községekkel határos."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_di_s%E1%BA%A3n_v%C4%83n_h%C3%B3a_T%C3%A2y_Ban_Nha_%C4%91%C6%B0%E1%BB%A3c_quan_t%C3%A2m_%E1%BB%9F_t%E1%BB%89nh_A_Coru%C3%B1a","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Balben_11179TM.jpg","page_title":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở tỉnh A Coruña","context_page_description":"Danh sách di sản văn hóa Tây Ban Nha được quan tâm ở A Coruña."},{"page_url":"https://vi.wikipedia.org/wiki/Gaultheria_myrsinoides","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/65/Gaultheria_myrsinoides_2.jpg","page_title":"Gaultheria myrsinoides","context_page_description":"Gaultheria myrsinoides là một loài thực vật có hoa trong họ Thạch nam. Loài này được Kunth mô tả khoa học đầu tiên năm 1819."},{"page_url":"https://sv.wikipedia.org/wiki/Tricyrtis_stolonifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Tricyrtis_stolonifera_140-8560.jpg","page_title":"Tricyrtis stolonifera","context_page_description":"Tricyrtis stolonifera är en liljeväxtart som beskrevs av Jinzô Matsumura. Tricyrtis stolonifera ingår i släktet skuggliljor, och familjen liljeväxter. Inga underarter finns listade."},{"page_url":"https://tr.wikipedia.org/wiki/Mikronezya_bayra%C4%9F%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Kosrae.png","page_title":"Mikronezya bayrağı","context_page_description":"Mikronezya Federal Devletler bayrağı ülke bayrağının belirlenmesi için yapılan yarışmada seçilmiş, bu seçim sonrası 30 Ekim 1978 tarihinde kullanılmaya başlanmıştır. Ülkenin bağımsızlığını kazanması sonrası bayrak resmi olarak 10 Kasım 1979 tarihinde göndere çekilmiştir.\\nBayrak açık mavi zemin üzerinde dört adet beyaz renkli beş köşeli yıldızdan oluşmaktadır.\\nAçık mavi renk adayı çevreleyen Pasifik Okyanusu'nun yanı sıra özgürlüğü ve ülkeye bağlılığı sembolize ederken, yer alan dört adet yıldız ise federal yapıyı oluşturan dört ada eyaletini ifade etmektedir. Yıldıza renk veren beyaz ise adada yaşayan farklı halk topluluklarını temsil etmektedir."},{"page_url":"https://af.wikipedia.org/wiki/Kaliforni%C3%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/The_Beach_Boys_TV.jpg","page_title":"Kalifornië","context_page_description":"Kalifornië is 'n deelstaat aan die suidelike weskus van die Verenigde State van Amerika. Dit is die grootste deelstaat ten opsigte van sy bevolking van sowat 39,3 miljoen en die derde grootste ten opsigte van sy oppervlak, na Alaska en Texas. Die staat grens in die ooste aan Nevada, in die noorde aan Oregon, en in die suidooste aan Arizona. Die Kaliforniese Kanaaleilande maak ook deel uit van die deelstaat.\\nDie gebied is deur stamme van die Eerste Nasies bewoon toe Europese ontdekkers die gebied in die 16de eeu geleidelik begin verken het. Die Spaanse navigeerder Juan Rodríguez Cabrillo was die eerste seevaarder wat in 1542 langs die Kaliforniese kus geseil het. Die eerste Spaanse sendingstasie in die gebied van die huidige San Diego is egter eers in 1769 gevestig. Dekades later het Kalifornië met die Meksikaanse Onafhanklikheidsoorlog in 1821 die juk van kolonialisme afgeskud en deel van die Eerste Meksikaanse Keiserryk geword.\\nIn die Meksikaans-Amerikaanse Oorlog tussen 1846 en 1848 het die Meksikane 'n verpletterende neerlaag teen Amerikaanse magte gely. Volgens die Verdrag van Guadalupe Hidalgo is uitgestrekte gebiede in Noord-Meksiko aan die Verenigde State afgestaan."},{"page_url":"https://fr.wikipedia.org/wiki/Mullen_(Nebraska)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/NEMap-doton-Mullen.png","page_title":"Mullen (Nebraska)","context_page_description":"La ville de Mullen est le siège du comté de Hooker, dans l’État de Nebraska, aux États-Unis. Elle comptait 509 habitants lors du recensement de 2010."},{"page_url":"https://eu.wikipedia.org/wiki/Thaining","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Segelflug_Geratshofen_-_Thaining%2C_LL_OZ.jpg","page_title":"Thaining","context_page_description":"Thaining Alemaniako udalerria da. Bavariako estatuan kokatuta dago, Landsberg am Lech barrutian. 2014an 932 biztanle zituen 8,71 kilometro koadrotan banatuta."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%BA%A2%E7%A7%BB%E7%A9%BA%E9%97%B4%E7%95%B8%E5%8F%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Fingerofgod.svg","page_title":"红移空间畸变","context_page_description":"上帝的手指是觀測宇宙學中使星系團在紅移空間中被拉長，而被拉長的方向軸指向了在地球的觀測者的效應。這效應是由星系團內星系的本動速度相關的都卜勒效應引起。造成這效應的高速度與星系團的重力相關，並可使用維里定理解釋；也就是觀測者所見星系團內星系的紅移和實際紅移不同。這效應會造成距離與紅移之間的關係哈伯定律的值被改變，造成距離量測失準。\\n與上帝的手指密切相關的效應是凱澤效應。這同樣是因為星系本動速度產生的紅移使宇宙紅移的值改變，並且使天體在觀測者方向上變形了。然而，凱澤效應並不是由本動速度推測的星系團內星系隨機運動產生；而是星系團中多個星系間向星系團中心的同調運動產生。根據特定的運動狀況，凱澤效應在大部分狀況下不會造成拉長的效應，而是在外觀上結構變得扁平，即「上帝的煎餅」。凱澤效應的影響遠小於上帝的手指效應，並且在大尺度環境下可透過兩者造成的不同效果區分。"},{"page_url":"https://sv.wikipedia.org/wiki/Thomas_Lundin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Thomas_lundin_3.jpg","page_title":"Thomas Lundin","context_page_description":"Thomas Lundin, född 7 april 1974 i Hangö, är en finlandssvensk TV-programledare, sångare och scenartist.\\nLundin jobbade åren 1994-2000 som radioredaktör på Svenska Yle, och åren 2000-2008 på Yle:s svenskspråkiga TV-kanal FST5. Han är bland annat känd som schlagerexpert och ESC-kommentator. Mellan 2004 och 2012 medverkade Lundin i jurypanelen i det årliga SVT-programmet Inför Eurovision Song Contest. 2004–2007 samsändes programmet med DR, Yle, NRK och RÚV och då bestod panelen av en helnordisk jury, där Lundin representerade Finland.\\nLundin ledde schlagerfrågesporten \\"Schlager på lager\\" i FST5 mellan 2002 och 2005. Programmet belönades med en Venla för Bästa Gameshow år 2004. Under 2008 ledde Lundin pratshowen \\"Allt ljus på...\\" på FST5 där han träffade olika musikartister, bland andra Christer Björkman, Eiríkur Hauksson och Cyndee Peters. Från och med år 2009 är han frilansjournalist och jobbar bland annat för SR P4 och Yle Vega. 2014 och 2015 leder han ett nytt program som heter På resande not.\\nVid sidan av jobbet som programledare är Lundin vissångare och musikalartist. Våren 2009 gav han ut sin debutsingel \\"Vara dom vi är\\"."},{"page_url":"https://ru.wikipedia.org/wiki/Megascops","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Megascops_petersoni.jpg","page_title":"Megascops","context_page_description":"Megascops — род птиц семейства совиных. Ранее включался в род совки.\\nОбитают в Северной, Центральной и Южной Америке."},{"page_url":"https://sk.wikipedia.org/wiki/Melek","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Mellek_templom_2.JPG","page_title":"Melek","context_page_description":"Melek je obec na Slovensku v okrese Nitra.\\nNázov obce Melek pochádza z Turecka a znamená anjel. Prvá písomná zmienka pochádza z roku 1332 - 1337, kde sa píše, že to bola obec s farou a kostolom, jej názov bol Merlek. Obec leží v žitavskej doline, 26 km juhovýchodne od Nitry. Na východ od obce sa nachádza vodná nádrž vybudovaná v roku 1961. Na začiatku obce v roku 1991 založil obyvateľ obce súkromnú firmu UNICOM, ktorá je tam ešte do dnes. Za obcou sa nachádzajú vinice. V obci je materská škôlka spojená s kultúrnym domom. Prvá zmienka o najstaršom kostole v obci hovorí, že bol v 1647 zasvätený Svätému Mikulášovi. Ďalší kostol, ktorý tiež už nejestvuje, bol postavený v rokoch 1750 -1757 v barokovom slohu. Zasvätený bol Svätému Martinovi. V terajšej dobe dominuje obci rímskokatolícky kostol Krista Kráľa v nadmorskej výške 170 m, postavený v rokoch 1949 -1950."},{"page_url":"https://es.wikipedia.org/wiki/Jouaville","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Eglise_Jouaville.jpg","page_title":"Jouaville","context_page_description":"Jouaville es una población y comuna francesa, en la región de Lorena, departamento de Meurthe y Mosela, en el distrito de Briey y cantón de Homécourt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A8%D0%B5%D1%81%D1%82%D0%B8_%D1%81%D0%B5%D0%BF%D1%82%D0%B5%D0%BC%D0%B2%D1%80%D0%B8_(%D0%B1%D1%83%D0%BB%D0%B5%D0%B2%D0%B0%D1%80%D0%B4_%D0%B2_%D0%9F%D0%BB%D0%BE%D0%B2%D0%B4%D0%B8%D0%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Nebet_tepe_view.jpg","page_title":"Шести септември (булевард в Пловдив)","context_page_description":"„Шести септември“ е основен и най-дългият булевард в Пловдив.\\nЗапочва от кръстовището на булевард „Пещерско шосе“ с разклонението за кв. Прослав, където булевардът е формиран от едно двупосочно платно. Минава през формиращия се квартал Ривиера. След това пресича парк „Отдих и култура“ като върви успоредно на гребната база.\\nСлед кръстовището с булевард „Копривщица“ булевардът минава в район „Централен“, където е с две ленти за движение във всяка посока и разделителна ивица между тях. В много участъци лентите са три като третата е предназначена за градския транспорт или за завиващите на дясно. Булевардът последователно минава през площадите „Никола Мушанов“, „Кочо Честименски“ и „Цар Калоян“ и пресича булевардите „Васил Априлов“ и „Руски“ в квартал Мараша. След това в централната част булевардът е с едно платно с две ленти за движение във всяка посока.\\nСлед площад „Съединение“ е подлезът на „Главната“ и булевардът пресича основния пловдивски булевард „Цар Борис III – Обединител“. След това булевардът е отново с две ленти за движение във всяка посока и разделителна ивица между тях."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Saint-Michel_de_Zetting","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/S%C3%A9pulcre_et_vitraux_de_l%27%C3%A9glise_Saint-Marcel_de_Zetting_Moselle_France_IMG_7309.JPG","page_title":"Église Saint-Michel de Zetting","context_page_description":"L''église Saint-Marcel est une église catholique située à Zetting, en France."},{"page_url":"https://en.wikipedia.org/wiki/Coplay,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Coplay_Cement_Company_Kilns_in_Saylor_Park.jpg","page_title":"Coplay, Pennsylvania","context_page_description":"Coplay is a borough in Lehigh County, Pennsylvania, six miles northwest of Allentown. It is part of the Lehigh Valley region of the state. In 1900, 1,581 people lived in Coplay; in 1910, 2,670 people lived there. The population was 3,192 at the 2010 census. Coplay is included in the Allentown-Bethlehem-Easton, PA-NJ Metropolitan Statistical Area, which is also included in the New York City-Newark, New Jersey, NY-NJ-CT-PA Combined Statistical Area."},{"page_url":"https://da.wikipedia.org/wiki/Stenbjerg_(Sydslesvig)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Luftbild_Steinberg_%28Ostsee%29_Amt_Geltinger_Bucht_Region_Angeln_Kreis_Schleswig-Flensburg_Foto_Wolfgang_Pehlemann_IMG_6695.jpg","page_title":"Stenbjerg (Sydslesvig)","context_page_description":"Stenbjerg eller Steinberg er en landsby og kommune beliggende ved Flensborg yderfjord i det nordøstlige Angel i Sydslesvig. Administrativt hører Stenbjerg under Slesvig-Flensborg kreds i den tyske delstat Slesvig-Holsten. Kommunen omfatter bebyggelser Havernæs, Nørregårdskov, Stenbjerghav, Stenbjerggaard, Stenbjergskov og godset Østergård, og samarbejder med nabokommunerne i Gelting Bugt kommunefællesskab. Ud mod Gelting Bugt ligger Østergårdskov. I kirkelig henseende hører Stenbjerg under Stenbjerg Sogn undtagen Havernæs, som hører under Kværn Sogn. Begge sogn lå i den danske tid indtil 1864 i Ny Herred."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%AF%D1%88%D1%83%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Ja%C5%A1uny._%D0%AF%D1%88%D1%83%D0%BD%D1%8B_%281928-30%29.jpg","page_title":"Яшуны","context_page_description":"Яшуны — вёска ў Летуве, на рацэ Мерачанцы. Цэнтар староства Салечніцкага раёну Віленскага павету. Насельніцтва на 2001 год — 1879 чалавек. Знаходзяцца за 17 на паўночны захад ад Салечнікаў, за 18 км ад Вільні; чыгуначная станцыя на лініі Вільня — Ліда.\\nЯшуны — даўняе мястэчка на мяжы гістарычных Віленшчыны і Троччыны, на этнічнай тэрыторыі беларусаў. Да нашага часу тут захаваўся палацава-паркавы комплекс Балінскіх, помнік архітэктуры і садова-паркавага мастацтва XIX ст."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%90%89%E5%B0%94%E5%90%89%E7%89%B9-%E5%B7%B4%E5%B0%94%E8%92%82%E6%96%AF%E5%9D%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Bzo.JPG","page_title":"吉尔吉特-巴尔蒂斯坦","context_page_description":"吉尔吉特-巴尔蒂斯坦，过去称北部地区，当地民族主义分子称为巴拉瓦里斯坦，位于巴基斯坦控制的克什米尔的北部，是巴基斯坦最北的地区。面积72,971平方公里，2006年人口1,126,542人。首府吉尔吉特。向西它与巴基斯坦的开伯尔-普赫图赫瓦省相邻，向北它与阿富汗的瓦罕走廊接壤，向东和东北是中华人民共和国，向西南是自由克什米尔，向东南则是印度管理的查谟－克什米尔邦。吉尔吉特-巴尔蒂斯坦大多数面积是山地。1970年这个地区成为一个名为“北部地区”的行政区域。它是由吉尔吉特、巴尔蒂斯坦以及坎巨提邦等组成的。吉尔吉特－巴尔蒂斯坦和它相邻的自由克什米尔都是有争议的地区，联合国和其它国际组织称它们为“巴控克什米尔”，印度称它们为“巴占克什米尔”。"},{"page_url":"https://lt.wikipedia.org/wiki/%C5%BDygimantas_Augustas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Death_of_Sigismund_Augustus_at_Knyszyn.JPG","page_title":"Žygimantas Augustas","context_page_description":"Žygimantas Augustas – Žygimanto Senojo sūnus, Lenkijos karalius ir Lietuvos didysis kunigaikštis, kurio valdymo metu Lenkija ir LDK susijungė, sudarydamos konfederaciją – Abiejų Tautų Respubliką. Žygimantas Augustas mirė nesusilaukęs įpėdinio ir buvo paskutinysis Jogailaičių dinastijos valdovas."},{"page_url":"https://tr.wikipedia.org/wiki/Subnotebook","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/MacBookEeePCNintendoDS.JPG","page_title":"Subnotebook","context_page_description":"Bir subnotebook, tipik bir dizüstü bilgisayardan daha küçük ve daha hafif olan bir laptop sınıfıdır.\\nBu bilgisayarlar bazen küçük form faktörlü tablet PC'lerin bir platformunun adı olan Ultra Taşınabilir Bilgisayar kategorisi ile karıştırılmaktadır. UMPC'ler subnotebooklardan daha küçüktür, ancak her ikisi de genellikle Windows CE, Palm OS veya Internet Tablet OS gibi özel yazılımlar yerine Windows veya Linux gibi tam masaüstü işletim sistemlerini çalıştırır. Alt not defterleri bazen mini dizüstü bilgisayarlardan genel olarak ayrılan farklı bir cihaz kategorisi olan netbook'larla da karıştırılır. Netbook'lar, çoğu kez, taşınabilir İnternet özellikli cihazlar olarak kullanılmak üzere optimize edildiğinden ve genellikle bir iş istasyonunun işlem gücünden yoksun olduğundan, subnotebooklardan daha ucuzdur. Netbook'lar genellikle 9W TDP CPU'larına sahiptir, güç verimliliği için performanstan ödün verirken, subnotebooklar genellikle 18W TDF işlemcileri kullanır.\\nSubnotebooklar, tam boyutlu dizüstü bilgisayarlardan daha küçük, ancak Palmtop PC, Mobil Internet cihazı, smartbook, el bilgisayarılarından daha büyüktür."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A2%D0%BE%D1%82%D1%82%D0%BE%D1%80%D0%B8_(%D0%B3%D3%80%D0%B0%D0%BB%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Tottori_montage.jpg","page_title":"Тоттори (гӀала)","context_page_description":"Тоттори — Японин гӀала, лаьтташ ю Тоттори перфектурехь."},{"page_url":"https://vi.wikipedia.org/wiki/Millotia_tenuifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Millotia_tenuifolia_%288730694150%29.jpg","page_title":"Millotia tenuifolia","context_page_description":"Millotia tenuifolia là một loài thực vật có hoa trong họ Cúc. Loài này được Cass. mô tả khoa học đầu tiên năm 1829."},{"page_url":"https://fr.wikipedia.org/wiki/Orchestres_symphoniques_(Slovaquie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Ko%C5%A1ice_-_Dom_umenia-7.jpg","page_title":"Orchestres symphoniques (Slovaquie)","context_page_description":"La Slovaquie compte environ une dizaine d'orchestres symphoniques et lyriques permanents, principalement autour des plus grandes villes du pays, telles que Bratislava, Košice, Žilina."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A1%D1%98%D0%BD%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Sini_-_Panorama_%2801%29.jpg","page_title":"Сјни","context_page_description":"Сјни је насеље у Италији у округу Ористано, региону Сардинија.\\nПрема процени из 2011. у насељу је живело 510 становника. Насеље се налази на надморској висини од 243 м."},{"page_url":"https://en.wikipedia.org/wiki/Lists_of_exoplanets","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Kepler186f-ArtistConcept-20140417.jpg","page_title":"Lists of exoplanets","context_page_description":"This is a list of exoplanets. As of 13 August 2020, there are 4,201 confirmed exoplanets, the majority of which were discovered by the Kepler space telescope. There are an additional 2,418 potential exoplanets from Kepler's first mission yet to be confirmed, as well as 889 from its \\"Second Light\\" mission and 1,326 from the Transiting Exoplanet Survey Satellite mission."},{"page_url":"https://hu.wikipedia.org/wiki/Touch_Your_Heart","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/%EC%9D%B4%EB%8F%99%EC%9A%B1_2019.jpg","page_title":"Touch Your Heart","context_page_description":"A Touch Your Heart egy 2019-ben bemutatott dél-koreai televíziós sorozat, melyet a tvN csatorna vetített I Donguk és Ju Inna főszereplésével."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%83%90%EB%A6%AC_%ED%95%84%EB%93%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Sally_Field_%2811205%29_%28cropped%29.jpg","page_title":"샐리 필드","context_page_description":"샐리 마거릿 필드는 미국의 배우이다."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%80%D1%88%D0%B8%D1%86%D1%8F_(%D1%85%D1%80%D0%B5%D0%B1%D0%B5%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Arshicya_06.JPG","page_title":"Аршиця (хребет)","context_page_description":"А́ршиця — хребет у Ґорґанах, в межах Рожнятівського та Долинського районів Івано-Франківській області."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%82%D0%BA%D0%BB%D0%BE%D0%BD%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BE%D1%82_%D0%BA%D1%80%D1%83%D0%B3%D0%BB%D0%BE%D1%81%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/RON-Pilot.jpg","page_title":"Отклонение от круглости","context_page_description":"Отклонение от круглости — геометрическая величина, численно равная наибольшему расстоянию от точек реального профиля до прилегающей окружности. Ранее использовался термин некруглость. Частными видами отклонений от круглости являются овальность и огранка.\\nОвальность — отклонение от круглости, при котором реальный профиль представляет собой овалообразную фигуру, наибольший и наименьший диаметры которой находятся во взаимно перпендикулярных направлениях. Ранее использовался термин эллипсность. Огранка — отклонение от круглости, при котором реальный профиль представляет собой многогранную фигуру. Огранка подразделяется по числу граней. В частности, огранка с нечетным числом граней характеризуется тем, что диаметры профиля поперечного сечения во всех направлениях одинаковы.\\nБазами для отклонения от круглости являются:\\nприлегающая окружность — окружность минимального диаметра, описанная вокруг реального профиля наружной поверхности вращения, или окружность максимального диаметра, вписанная в реальный профиль внутренней поверхности вращения."},{"page_url":"https://sv.wikipedia.org/wiki/Stora_%C3%84ngby","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Stora_%C3%84ngby_1927a.jpg","page_title":"Stora Ängby","context_page_description":"Stora Ängby är en herrgård och ett tidigare säteri vid Stora Ängby allé 30−36 i Norra Ängby i Bromma socken i Stockholms kommun. Stora Ängbys huvudbyggnad uppfördes under 1600-talets sista år, och ägs sedan 2005 av kommunala AB Stadsholmen. Huvudbyggnad, flygeln och visthusboden är blåmärkta av Stadsmuseet i Stockholm, vilket innebär \\"att bebyggelsen bedöms ha synnerligen höga kulturhistoriska värden\\"."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/La_Charm%C3%A9e","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Map_commune_FR_insee_code_71102.png","page_title":"La Charmée","context_page_description":"La Charmée sī ūi-tī Hoat-kok Bourgogne toā-khu Saône-et-Loire koān ê chi̍t ê commune."},{"page_url":"https://es.wikipedia.org/wiki/Logron","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Logron-FR-28-panneau-01.jpg","page_title":"Logron","context_page_description":"Logron es una localidad y comuna de Francia situada en la región de Centro, departamento de Eure y Loir, en el distrito y cantón de Châteaudun\\nSu población en el censo de 1999 era de 502 habitantes.\\nEstá integrada en la Communauté de communes des Plaines et Vallées Dunoises."},{"page_url":"https://en.wikipedia.org/wiki/Operation_Pershing","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Cavalrymen_with_burning_VC_hut%2C_July_1967.jpg","page_title":"Operation Pershing","context_page_description":"Operation Pershing was an operation conducted by the 1st Cavalry Division, the 3rd Brigade, 25th Infantry Division, the Army of the Republic of Vietnam 22nd Division and the South Korean Capital Division in Bình Định Province, lasting from 12 February 1967 to 19 January 1968.\\nThe operation concluded on 19 January 1968 with the 1st Cavalry Division being ordered to move 350km north from Landing Zone English in Bình Định Province to Camp Evans in Thừa Thiên Province as part of Operation Checkers, to increase the number of manoeveure battalions in I Corps in order to support the besieged Marines at Khe Sanh Combat Base and defeat any other People's Army of Vietnam attack across the DMZ."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%95%E0%B4%BE%E0%B4%B2%E0%B4%BF%E0%B4%AC%E0%B5%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/45_ACP_-_FMJ_-_SB_-_2.jpg","page_title":"കാലിബർ","context_page_description":"ഒരു തോക്കിന്റെ ബാരലിന്റെ ഉൾവ്യാസത്തെ പറയുന്ന പേരാണ് കാലിബർ. ആ തോക്കിൽ ഉപയോഗിക്കുന്ന വെടിയുണ്ടയുടെ ബാഹ്യവ്യാസം എന്നു പറഞ്ഞാലും ശരിയാകും.\\nഎന്നാൽ വലിയ തോക്കുകളിലോ യുദ്ധടാങ്കുകളിലെ പീരങ്കികളുടെയോ കാര്യമെടുക്കുമ്പോൾ കാര്യം മാറുന്നു. അവിടെ ബാരലിന്റെ ഉൾവ്യാസത്തെയല്ല മറിച്ച് ബാരലിന്റെ നീളത്തെ വ്യാസം കൊണ്ട് ഹരിച്ച് കിട്ടുന്ന മൂല്യത്തെയാണ് കാലിബർ എന്നു പറയുന്നത്. ഉദാഹരണത്തിന് ഒരു തോക്കിന്റെ കാലിബർ 140mmx50 എന്നു പറഞ്ഞാൽ ആ തോക്കിന്റെ ബാരലിന്റെ വ്യാസം 140മില്ലി മീറ്ററും നീളം 7000മില്ലി മീറ്ററും ആണെന്നാണ്."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D6%80%D5%AB%D5%AF%D5%AB_%D5%BD%D5%B8%D6%81%D5%AB%D5%A1%D5%AC%D5%A1%D5%AF%D5%A1%D5%B6_%D5%BF%D5%A1%D5%B2%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/2014_Erywa%C5%84%2C_Matenadaran_%2809%29.jpg","page_title":"Ֆրիկի սոցիալական տաղեր","context_page_description":"Ֆրիկի սոցիալական տաղեր, հայ միջնադարյան քնարերգության խոշոր ներկայացուցիչ Ֆրիկի չափածո և արձակ տաղեր, որոնք գրված են սոցիալական թեմայով։ Տաղերում անդրադարձ է կատարվում սոցիալական անհավասարության և անարդարության գաղափարներին, ի տարբերություն Ֆրիկի հոգևոր թեմայով գրված տաղերի, որոնք հիմնականում Աստծուն են գովերգում։"},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A4sterg%C3%B6tlands_runinskrifter_100","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/VG100.jpg","page_title":"Västergötlands runinskrifter 100","context_page_description":"Vg 100 är en vikingatida runsten i Flo kyrkogård, Flo socken och Grästorps kommun, i Åse härad."},{"page_url":"https://en.wikipedia.org/wiki/Ferhan_%C5%9Eensoy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Ferhan_%C5%9Eensoy.jpg","page_title":"Ferhan Şensoy","context_page_description":"Ferhan Şensoy is a prominent Turkish playwright, actor and stage director."},{"page_url":"https://en.wikipedia.org/wiki/Rhopalosiphum_rufiabdominale","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/5481918-PPT.jpg","page_title":"Rhopalosiphum rufiabdominale","context_page_description":"Rhopalosiphum rufiabdominale, the rice root aphid or red rice root aphid, is a sap-sucking insect pest with a wide host range and a global distribution. As a member of the superfamily Aphidoidea, it is one of 16 species of the genus Rhopalosiphum. Adults and nymphs are soft-bodied and usually dark green with brown, red, or yellow tones. Like all aphids, reproduction is sexual and asexual, depending on the environmental conditions and host plant. Rice root aphids cause injury to external plant parts, namely the roots or stem, by feeding on plant sap and vector several important plant viruses. The hosts of this pest extend across multiple plant families with most belonging to Rosaceae, Poaceae, and Solanaceae. R. rufiabdominale is universally associated with Prunus species but also infests various field crops, greenhouse vegetables, cannabis, and other ornamental plants. While this aphid originates from east Asia, it spans nearly every continent. Dispersal is particularly widespread across the United States, India, and Australia, with crop damage documented in multiple instances, although economic losses are primarily associated with Japanese rice crops."},{"page_url":"https://de.wikipedia.org/wiki/Stadttheater_Memmingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Memmingen_Landestheater_2018_1.jpg","page_title":"Stadttheater Memmingen","context_page_description":"Das Stadttheater Memmingen, auch Theaterstadel genannt, ist ein städtisches Theatergebäude in der oberschwäbischen Stadt Memmingen. Das ehemals zum Augustinerinnenkloster gehörende Gebäude wird seit 1802 als Theater genutzt. Heute ist es Hauptsitz des Landestheaters Schwaben."},{"page_url":"https://en.wikipedia.org/wiki/List_of_lieutenant_governors_of_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/William_Holden_%28California_Lieutenant_Governor%29.jpg","page_title":"List of lieutenant governors of California","context_page_description":"Below is a list of lieutenant governors of the U.S. state of California, 1849 to present. In California, the Lieutenant Governor and the Governor do not run together on the same ticket. The Lieutenant Governor can therefore be affiliated with a different political party than that of the Governor. Per the 1879 California Constitution, the Lieutenant Governor is the President of the State Senate."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_%27s-Graveland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/%27s-Graveland_-_Noordereinde_283_RM520836.JPG","page_title":"Lijst van rijksmonumenten in 's-Graveland","context_page_description":"De Noord-Hollandse plaats 's-Graveland telt 121 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://mg.wikipedia.org/wiki/Pentek%C3%B4sta","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Pierre_Reymond_-_Pentecost.jpg","page_title":"Pentekôsta","context_page_description":"Ny Pentekôsta na Pentekôty dia fety kristiana ahatsiarovana sy ankalazana ny nidinanan’ny Fanahy Masina tamin’ireo Apostoly tamin’ny faha-50 andro taorian’ny nitsanganan’i Jesosy tamin’ny maty. Amin’ny Alahady fahafito aorian’ny Paska no anatanterahana azy. Io fety io no mamarana ny fetin’ny Paska."},{"page_url":"https://de.wikipedia.org/wiki/Peter_von_Koblenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Bad_Urach_Amanduskirche_2.jpg","page_title":"Peter von Koblenz","context_page_description":"Peter von Koblenz, auch Peter Steinmetz von Koblenz genannt, war ein spätmittelalterlicher Baumeister und Steinmetz, der der Uracher Bauhütte angehörte und an zahlreichen Sakralbauten in Württemberg arbeitete."},{"page_url":"https://da.wikipedia.org/wiki/%C3%93scar_Sevilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/13_Etapa-Vuelta_a_Colombia_2018-Oscar_Sevilla-Tercero_Vuelta_a_Colombia_2018.jpg","page_title":"Óscar Sevilla","context_page_description":"Óscar Miguel Sevilla Rivera er en spansk landevejscykelrytter. Han er en udpræget bjergrytter, med mange gode resultater i etapeløb, som i Tour de France og Vuelta a España hvor han flere gange har været blandt de ti bedste sammenlagt."},{"page_url":"https://ceb.wikipedia.org/wiki/Saint_Petersburg_(kapital_sa_lalawigan)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Saint_Petersburg_in_Russia_%28detail%2C_special_marker%29.png","page_title":"Saint Petersburg (kapital sa lalawigan)","context_page_description":"Kapital sa lalawigan ang Saint Petersburg sa Rusya. Nahimutang ni sa lalawigan sa Sankt-Peterburg, sa kasadpang bahin sa nasod, 600 km sa amihanan-kasadpan sa Moscow ang ulohan sa nasod. 11 metros ibabaw sa dagat kahaboga ang nahimutangan sa Saint Petersburg, ug adunay 5,028,000 ka molupyo.\\nAng yuta palibot sa Saint Petersburg kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 88 ka metro ug 19.1 km sa amihanan sa Saint Petersburg. Dunay mga 1,463 ka tawo kada kilometro kwadrado sa palibot sa Saint Petersburg may kaayo hilabihan populasyon. Saint Petersburg ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kabalayan ang palibot sa Saint Petersburg. Sa rehiyon palibot sa Saint Petersburg, kapuloan, mga kanal, nabigasyon, ug salog sa dagat talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 4 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -12 °C."},{"page_url":"https://hu.wikipedia.org/wiki/Sz%C3%B3jabab","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Soybean.USDA.jpg","page_title":"Szójabab","context_page_description":"A szójabab vagy egyszerűen szója, Kelet-Ázsiában honos, a hüvelyesek családjába tartozó lágyszárú, egynyári haszonnövény. Neve a japán sóju - szójaszósz jelentésű szóból ered. Az Élelmezésügyi és Mezőgazdasági Világszervezet azonban nem a hüvelyesek, hanem az olajos magvak közé sorolja, mert ez a legfontosabb olajnövény. A világ mezőgazdasági termelőterületének 6%-át vetik be vele, amelyen 2010-ben 265 millió tonna termett.\\nA szójabab körülbelül 18% olajat és 35% fehérjét tartalmaz. A kipréselt olaj 95%-át étolajnak dolgozzák fel. Az olajtalanított szárazanyag 98%-át az állattenyésztés használja fel takarmányozási célra. Lábasjószágok élelmezése mellett a iparszerű haltenyésztés alaptakarmánya is. Csupán a szójabab 2%-a kerül emberi fogyasztásra.\\nA szója szalmáját is hasznosítják: takarmány, takarmányadalék, alom, tüzelőanyag vagy ipari rostanyag lesz belőle."},{"page_url":"https://fr.wikipedia.org/wiki/Troisi%C3%A8me_circonscription_de_la_Marne","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Circ-Marne-2010-3.png","page_title":"Troisième circonscription de la Marne","context_page_description":"La troisième circonscription de la Marne est l'une des 5 circonscriptions législatives françaises que compte le département de la Marne situé en région Champagne-Ardenne puis Grand Est."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Prince_George%27s_County,_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Calvert_Hills_1_Dec_08.JPG","page_title":"National Register of Historic Places listings in Prince George's County, Maryland","context_page_description":"This is a list of the National Register of Historic Places listings in Prince George's County, Maryland.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Prince George's County, Maryland, United States. Latitude and longitude coordinates are provided for many National Register properties and districts; these locations may be seen together in a map.\\nThere are 105 properties and districts listed on the National Register in the county, including 6 National Historic Landmarks.\\nThis National Park Service list is complete through NPS recent listings posted July 17, 2020."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D1%8A%D0%BA_%D0%BD%D0%B0_%D0%B8%D0%BD%D0%B4%D0%BE-%D0%B3%D1%80%D1%8A%D1%86%D0%BA%D0%B8%D1%82%D0%B5_%D0%B8_%D0%B3%D1%80%D1%8A%D0%BA%D0%BE-%D0%B1%D0%B0%D0%BA%D1%82%D1%80%D0%B8%D0%B9%D1%81%D0%BA%D0%B8%D1%82%D0%B5_%D1%86%D0%B0%D1%80%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Coin_of_the_Bactrian_King_Antimachos_I.jpg","page_title":"Списък на индо-гръцките и гръко-бактрийските царе","context_page_description":"Списък на индо-гръцките и гръко-бактрийските царе от Гръко-бактрийско царство, Индо-гръцко царство и Бактрия."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Backsteinbauwerke_der_Gotik_in_Italien","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Sant%27Agostino_in_Prato_Facade_1.jpg","page_title":"Liste der Backsteinbauwerke der Gotik in Italien","context_page_description":"Die Liste der gotischen Backsteinbauwerke in Italien ist Teil des Listenwerkes Backsteinbauwerke der Gotik, in dem die gotischen Backsteinbauwerke aller entsprechenden Länder Europas möglichst vollständig erfasst sind. Aufgenommen sind nur Bauten, an denen der Backstein irgendwo zutage tritt oder, bei geschlämmten Oberflächen, wenigstens die Backsteinstruktur von Mauerwerk erkennbar ist.\\nUmfang:\\nDiese Liste umfasst 396 Einträge von Bauwerken und Gruppen von Bauwerken.\\nHintergrundinformationen:\\nBei einigen Gebäuden ist unter „“ die zugehörige Bildersammlung in Wikimedia Commons verlinkt.\\nDatenbank-Links sind, sofern verfügbar, bei den einzelnen Provinzen erklärt."},{"page_url":"https://en.wikipedia.org/wiki/Tara_Spencer-Nairn","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Tara_Spencer-Nairn_in_2017_%2831844893994%29.jpg","page_title":"Tara Spencer-Nairn","context_page_description":"Tara Spencer-Nairn is a Canadian actress best known for her work on the television series Corner Gas."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%AD%D9%85%D8%AF_%D8%AF%D8%A7%D9%88%D9%88%D8%AF%D8%A7%D8%BA%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Ahmet_Davuto%C4%9Flu_signature.png","page_title":"احمد داووداغلو","context_page_description":"احمد داووداُغلو از سیاستمداران و دیپلمات‌های ترک، و نخست وزیر سابق ترکیه است."},{"page_url":"https://hu.wikipedia.org/wiki/2013_a_sportban","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Andras_Redli_Challenge_RFF_team_t163114.jpg","page_title":"2013 a sportban","context_page_description":"2013 a sportban a 2013-as év fontosabb sporteseményeit tartalmazza az alábbiak szerint:"},{"page_url":"https://fr.wikipedia.org/wiki/Prieur%C3%A9_Saint-Arnoul_de_Cr%C3%A9py-en-Valois","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Cr%C3%A9py-en-Valois_%2860%29%2C_abbaye_Saint-Arnoul%2C_salle_capitulaire%2C_chapiteaux_engag%C3%A9s_1.JPG","page_title":"Prieuré Saint-Arnoul de Crépy-en-Valois","context_page_description":"L'ancien prieuré Saint-Arnoul est situé dans la commune de Crépy-en-Valois, dans l'Oise. Il est issu de la réforme d'une abbaye bénédictine fondée par le comte Gautier II le Blanc en 1008, qui se substitua elle-même à un chapitre de chanoines installé vers 935 / 943 par le comte Raoul II de Valois. En 1076, le comte Simon de Valois effectue un pèlerinage à Rome, et le pape Grégoire VII lui présente Hugues de Cluny. Raoul et Hugues se lient d'amitié pendant leur voyage de retour vers la France, et Hugues décide de donner l'abbaye à l'ordre de Cluny. Hugues reste à Crépy le temps de mettre en place la réforme, et doit lutter contre la résistance des moines, mais le prieuré finit par connaître un développement très favorable grâce à de nombreuses donations jusqu'au début du XIIIᵉ siècle. Il bénéficie de l'exemption, relève directement de l'abbaye-mère de Cluny, et occupe l'un des premiers rangs dans la hiérarchie de l'ordre. Le nombre de vingt-huit moines prévu par la charte de fondation est même dépassé au premier tiers du XIVᵉ siècle. La prospérité du monastère est mise à mal par la guerre de Cent Ans, et le chœur de l'église est incendié par les Anglais vers 1431."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%9B%D0%B0%D1%80%D1%81%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Clocher_et_manoir_%C3%A0_Lar%C3%A7ay.jpg","page_title":"Ларсе","context_page_description":"Ларсе — Францин гӀала-коммуна, лаьтта Центр — Луаран атагӀа регионехь. Коммунан департамент — Эндр а, Луара а. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://fr.wikipedia.org/wiki/Alfred_Pellan","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Monument_Alfred-Pellan_-_11.jpg","page_title":"Alfred Pellan","context_page_description":"Alfred Pellan est un peintre, un muraliste, un illustrateur et un costumier québécois, domicilié à Auteuil pendant près de quarante ans. Il est le premier peintre québécois à s'être illustré sur la scène française. Vingt ans plus tard, à la suite d'une exposition à Paris, son œuvre est reconnue au Québec et au Canada."},{"page_url":"https://fr.wikipedia.org/wiki/Arnold_Jackson","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Arnold_Jackson.jpg","page_title":"Arnold Jackson","context_page_description":"Arnold Nugent Strode Strode-Jackson, né le 5 avril 1891 - mort le 13 novembre 1972, est un athlète britannique, spécialiste du demi-fond, officier général de la British Army. Il est devenu citoyen américain en 1945.\\nIl remporte la médaille d'or lors des Jeux de 1912 sur 1 500 m dans ce qui a été considéré, à l'époque, comme la « plus grande course jamais courue ». Il a été le plus jeune général de l'armée de terre britannique.\\nNé sous le nom d’Arnold Nugent Strode Jackson à Addlestone, Surrey, il a changé son nom en Strode-Jackson le 31 mars 1919."},{"page_url":"https://ms.wikipedia.org/wiki/Spullersee","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/2015_Spullersee_im_Lechquellengebirge.jpg","page_title":"Spullersee","context_page_description":"Spullersee merupakan sebuah tasik buatan yang terletak di kawasan tanah tinggi Vorarlberg, Austria. Ia dibina di antara tahun 1919 hingga 1925 oleh Kereta Api Persekutuan Austria dengan tujuan untuk menjana tenaga elektrik bagi projek kereta api Arlberg."},{"page_url":"https://en.wikipedia.org/wiki/Dean_Forest_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Forest_of_Dean_Railway_%289726079568%29.jpg","page_title":"Dean Forest Railway","context_page_description":"The Dean Forest Railway is a 4 ¹⁄₄-mile long heritage railway that runs between Lydney and Parkend in the Forest of Dean, Gloucestershire.\\nThe route was part of the former Severn and Wye Railway which ran from Lydney to Cinderford. The society that operates the line started steam locomotive operations in 1971, and bought the trackbed and line from British Rail in 1986, reaching both Lydney Junction and Parkend railway stations by 1995 and 2005 respectively. Trains are operated by both steam and heritage diesel locomotives, and heritage diesel multiple units.\\nThe Dean Forest Railway has been given the former GWR signal box that stood slightly to the east of Codsall station in Staffordshire. Its removal was completed in July 2007, and was placed at the newly restored Whitecroft railway station.\\nThe Dean Forest Railway has also been given the former Griffithstown Station building. Its removal was completed in June 2016, and is expected to be placed at the new upcoming Speech House Road.\\nCrossCountry are now providing a combined fare for travel to Lydney mainline station and then onto the Dean Forest Railway."},{"page_url":"https://sk.wikipedia.org/wiki/Atmosf%C3%A9rick%C3%BD_tlak","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Dosen-barometer.jpg","page_title":"Atmosférický tlak","context_page_description":"Atmosférický tlak je tlak, spôsobený atmosférou planéty Zem. Tento tlak je vyvolaný tiažou vzduchového stĺpca siahajúceho od nadmorskej výšky, v ktorej tlak meriame, až po hornú hranicu atmosféry.\\nAtmosférický tlak je tlak masy vzduchu v atmosfére podmienený gravitačným pôsobením Zeme. Normálna hodnota atmosférického tlaku pri hladine mora je 101 325 Pa. Vrstva atmosféry Zeme pôsobí tlakovou silou na zemský povrch. Hodnota tohoto tlaku je najväčšia na zemskom povrchu a s rastúcou výškou klesá. Barometrický tlak nie je stály, neustále kolíše v danom bode zemského povrchu okolo určitej hodnoty. Na tlak vzduchu má okrem nadmorskej výšky vplyv aj teplota vzduchu a prúdenie vzduchu.\\nTlak menší ako barometrický tlak sa nazýva podtlak, tlak väčší ako barometrický tlak sa nazýva pretlak.\\nAtmosférický tlak má veľký význam v meteorológii."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%9E%E0%B8%B8%E0%B8%97%E0%B8%98%E0%B9%84%E0%B8%AA%E0%B8%A2%E0%B8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B9%84%E0%B8%AA%E0%B8%A2%E0%B8%B2_Reclining_Buddha_of_Wat_Bowonniwet.jpg","page_title":"พระพุทธไสยา","context_page_description":"พระพุทธไสยา เป็นพระพุทธรูปปางปรินิพพาน ศิลปะสุโขทัย ประดิษฐาน ณ มุขหลัง วิหารพระศรีศาสดา วัดบวรนิเวศวิหารราชวรวิหาร เขตพระนคร กรุงเทพมหานคร เป็นพระพุทธรูปที่ พระบาทสมเด็จพระจอมเกล้าเจ้าอยู่หัว รัชกาลที่ 4 ได้อัญเชิญมาจาก วัดพระพายหลวง อำเภอเมืองสุโขทัย จังหวัดสุโขทัย ที่ด้านหลังพระพุทธไสยามีจิตรกรรมฝาผนังเรื่อง พุทธประวัติ ตอน เสด็จดับขันธปรินิพพาน โดยมีพระสงฆ์จำนวนมากมานมัสการพระพุทธเจ้า และ มีต้นสาละโน้มกิ่งมาหาพระองค์ ปัจจุบัน จะเปิดวิหารให้เข้าชมเฉพาะวันคล้ายวันประสูติของสมเด็จพระญาณสังวร สมเด็จพระสังฆราช สกลมหาสังฆปริณายก และ วันสำคัญๆเท่านั้น"},{"page_url":"https://fi.wikipedia.org/wiki/Arkangelin_kuvernementti","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Map_Arkhangelsk_Governorate.jpg","page_title":"Arkangelin kuvernementti","context_page_description":"Arkangelin kuvernementti eli Arkangelin lääni tai Vienan lääni oli Venäjän keisarikunnan ja sittemmin Venäjän SFNT:n hallinnollinen alue valtakunnan luoteisosassa vuosina 1784-1929.\\nSe oli Euroopan-puoleisen Venäjän kuvernementeista laajin ja ulottui Suomen rajalta Uralille asti. Kuvernementti rajoittui Pohjoiseen jäämereen ja käsitti muun muassa Kuolan niemimaan, Vienan Karjalan ja nykyisen Arkangelin alueen Vienanmeren ympäristössä sekä Nenetsian ja Komin tasavallan alueet.\\nVenäjän keisarikunnan ensimmäisessä koko maan kattaneessa väestönlaskennassa 1897 Arkangelin kuvernementin asukasluku oli 346 536 henkeä ja pinta-ala 742 759,2 neliövirstaa.\\nKuvernementinkaupunki oli Arkangeli. Kuvernementti jakautui kihlakuntiin. Vuonna 1796 kuvernementtiin kuuluivat Kuolan, Kemin, Onegan, Šenkurskin, Holmogoryn, Pinegan ja Mezenin kihlakunnat. Kuolan kihlakunta yhdistettiin Kemin kihlakuntaan 1859, perustettiin uudelleen 1883 ja muutettiin Aleksandrovskin kihlakunnaksi 1899. Mezenin kihlakunnasta pilkottiin erilleen suuri Petšoran kihlakunta 1891.\\nVuoden 1897 väestönlaskennan aikaan kuvernementissa oli seuraava kihlakuntajako:"},{"page_url":"https://ca.wikipedia.org/wiki/Pere_Ramon_Sacosta","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Rhodos445.JPG","page_title":"Pere Ramon Sacosta","context_page_description":"Pere Ramon Sacosta fou un cavaller català de l'orde de Sant Joan de Jerusalem. Va accedir a la castellania d'Amposta el 1446 després de la mort de l'antic castellà Joan de Vilagut. El 1461 fou ascendit a gran mestre de l'orde i intentà conservar en les seves mans la castellania, en contra de l'opinió del rei Joan II d'Aragó, que volia col·locar en aquest càrrec el seu fidel Bernat Hug de Rocabertí. Durant la Guerra Civil Catalana va entregar les seves comandes de l'Ebre al seu germà, el també hospitaler Ponç Sacosta i al seu nebot Galceran Sarriera, que les van tenir fins al 1466. Davant de les pressions de Joan II, Sacosta va convocar capítol general de l'orde a Roma el 1466 per tal que el papa li donés suport, però en el transcurs d'aquesta reunió va morir i fou enterrat a Roma.\\nEl 1462 va dividir la llengua d'Espanya en dues noves llengües, la llengua d'Aragó i la llengua de Castella."},{"page_url":"https://en.wikipedia.org/wiki/2009%E2%80%9310_UEFA_Champions_League_group_stage","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Thierry_Henry_Rubin_Kazan.jpg","page_title":"2009–10 UEFA Champions League group stage","context_page_description":"The 2009–10 UEFA Champions League group stage matches took place between 15 September and 9 December 2009. The draw for the eight groups took place on 27 August 2009, at the Grimaldi Forum in Monaco.\\nThe group stage features the 22 automatic qualifiers and the 10 winners of the play-off round.\\nAt the completion of the group stage, the top two teams in each group will advance to play in the first knockout round, while the third-placed teams will drop down to the UEFA Europa League round of 32."},{"page_url":"https://en.wikipedia.org/wiki/Jack_Straw%27s_Lane","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/NewMarston_StMichael%26AllAngels_southeast.JPG","page_title":"Jack Straw's Lane","context_page_description":"Jack Straw's Lane is a residential road in Oxford, England.\\nIt runs between the north end of Pullens Lane on Headington Hill and Marston Road."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%9F%E0%B4%BE%E0%B5%BB%E0%B4%B8%E0%B4%BE%E0%B4%A8%E0%B4%BF%E0%B4%AF%E0%B4%AF%E0%B4%BF%E0%B4%B2%E0%B5%86_%E0%B4%B5%E0%B4%BF%E0%B4%A6%E0%B5%8D%E0%B4%AF%E0%B4%BE%E0%B4%AD%E0%B5%8D%E0%B4%AF%E0%B4%BE%E0%B4%B8%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Tanzanian_students_tending_school_crops.jpg","page_title":"ടാൻസാനിയയിലെ വിദ്യാഭ്യാസം","context_page_description":"ടാൻസാനിയായിലെ വിദ്യാഭ്യാസം പൊതുസ്വകാര്യ ഉടമസ്ഥതയിലുള്ളതാണ്. താഴെപ്പറയുന്നതാണ് പൊതുവായ ഘടന:\\n2 years of pre-primary education for ages 5–6\\n7 years of primary education for ages 7–13\\n4 years of secondary ordinary level education for ages 14–17\\n2 years of secondary advanced level education for ages 18–19\\n3 or more years of university education"},{"page_url":"https://ca.wikipedia.org/wiki/Origen_de_la_Senyera_Reial","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Sello-real-con-bloca-alfonso-II-aragon-millau-1187.jpg","page_title":"Origen de la Senyera Reial","context_page_description":"L'Origen de la Senyera Reial és el senyal heràldic dels Quatre Pals del qual la senyera n'és la translació sobre una bandera. El primer testimoni històric del senyal dels Quatre Pals apareix en un segell de cera que valida un document datat el 2 de setembre del 1150, i en el que s'hi representa a Ramon Berenguer IV portant sobre el seu escut el senyal dels Quatre Pals.\\nActualment hi ha consens entre els màxims especialistes heràldics -l'aragonès Faustino Menéndez Pidal de Navascués, l'aragonès Alberto Montaner Frutos, i el català Armand de Fluvià- a l'hora de determinar que el senyal heràldic nasqué i aparegué com a emblema personal de Ramon Berenguer IV. El fet que de resultes del desgast només en una de les impromptes dels segells de cera hi aparegui clarament el senyal heràldic, ja és suficient per indicar que a les matrius base hi havia gravades els quatre pals. Aquest fet ve reforçat per l'arcaisme del senyal en un moment on l'heràldica tot just acabava de nàixer a Europa, fet que s'evidencia en aquest cas en la presència arcaica de l'escarboncle - o bloca-, unes proteccions metàl·liques en forma d'aspa que protegien l'escut."},{"page_url":"https://ast.wikipedia.org/wiki/Martorell","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Baix_Llobregat_nord.jpg","page_title":"Martorell","context_page_description":"Martorell ye un conceyu de la comarca del Baix Llobregat, na provincia de Barcelona, comunidá autónoma de Cataluña."},{"page_url":"https://es.wikipedia.org/wiki/Bogot%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Ajiaco.jpg","page_title":"Bogotá","context_page_description":"Bogotá oficialmente Bogotá Distrito Capital​​, ​ es la capital de la República de Colombia y del departamento de Cundinamarca. Está administrada como Distrito capital, y goza de autonomía para la gestión de sus intereses dentro de los límites de la Constitución y la ley.​​ A diferencia de los demás distritos de Colombia, Bogotá es una entidad territorial de primer orden, con las atribuciones administrativas que la ley confiere a los departamentos.​ Está constituida por 20 localidades y es el epicentro político, económico, administrativo, industrial, artístico, cultural, deportivo y turístico del país.​​​​\\nBogotá fue fundada como capital del Nuevo Reino de Granada el 6 de agosto de 1538 por el conquistador español Gonzalo Jiménez de Quesada después de una dura expedición a los Andes.\\nEs la tercera capital más alta de Suramérica, ya que se encuentra a un promedio de 2.625 metros sobre el nivel del mar. Está ubicada en el centro de Colombia, en la región natural conocida como la sabana de Bogotá, que hace parte del altiplano cundiboyacense, formación ubicada en la cordillera Oriental de los Andes.\\nTiene una longitud de 33 km de sur a norte, y 16 km de oriente a occidente.​"},{"page_url":"https://en.wikipedia.org/wiki/Charaxes_cowani","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Novitates_Zoologicae1899PlateXI.jpg","page_title":"Charaxes cowani","context_page_description":"Charaxes cowani is a butterfly in the family Nymphalidae. It is found in eastern Madagascar. The habitat consists of montane forests at altitudes above 1,000 meters."},{"page_url":"https://pl.wikipedia.org/wiki/Flaga_Polski","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Warsaw_Uprising_-_Captured_SdKfz_251_%281944%29.jpg","page_title":"Flaga Polski","context_page_description":"Flaga Polski – jeden z symboli państwowych Rzeczypospolitej Polskiej.\\nWedług ustawy z dnia 31 stycznia 1980 r. o godle, barwach i hymnie Rzeczypospolitej Polskiej oraz o pieczęciach państwowych jest nią prostokątny płat tkaniny o barwach Rzeczypospolitej Polskiej i proporcji 5:8, umieszczony na maszcie. Zgodnie z art. 6 ust. 2 ustawy, za flagę Polski uważany jest także wariant z godłem Polski, umieszczonym pośrodku białego pasa.\\nBarwy Rzeczypospolitej Polskiej stanowią składniki flagi państwowej Rzeczypospolitej Polskiej. Ustawa stanowi, że barwami Rzeczypospolitej Polskiej są kolory biały i czerwony, ułożone w dwóch poziomych, równoległych pasach tej samej szerokości, z których górny jest koloru białego, a dolny koloru czerwonego.\\nOd 2004 roku 2 maja jest w Polsce oficjalnie obchodzony jako Dzień Flagi Rzeczypospolitej Polskiej."},{"page_url":"https://fr.wikipedia.org/wiki/Les_Survivants_de_la_fin_du_monde","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/2014-3-28-Landmaster-01.JPG","page_title":"Les Survivants de la fin du monde","context_page_description":"Les Survivants de la fin du monde est un film américain réalisé par Jack Smight et sorti en 1977."},{"page_url":"https://de.wikipedia.org/wiki/Jingshan-Park","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/JingShan_Park.jpg","page_title":"Jingshan-Park","context_page_description":"Der Jingshan-Park ist ein öffentlicher Park unmittelbar nördlich von Pekings Verbotener Stadt in der Volksrepublik China. Der Park war lange Zeit Teil der 1420 errichteten Verbotenen Stadt. Erst 1928 wurde der zuvor private kaiserliche Garten der Öffentlichkeit zugänglich gemacht. Zentrum des etwa 230.000 Quadratmeter großen Parks bildet ein künstlich aufgeschütteter Aussichtshügel. Der Aussichtshügel wird auch als „Kohlehügel“ bezeichnet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8B%8F%E5%B7%9E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Wangshiyuan.jpg","page_title":"苏州市","context_page_description":"蘇州，古稱吳，現簡稱蘇，是中華人民共和國江蘇省東南部的一個地級市，位於長江三角洲和太湖平原的中心地帶，著名的魚米之鄉、狀元之鄉、院士之鄉、經濟重鎮、歷史文化名城，自古享有「人間天堂」的美譽。\\n蘇州有文字記載的歷史已有4000餘年，而官方認定的建城史逾2500年，是中國現存最古老的城市之一，江南吳文化的發祥地，歷史上長期為江南地區一級行政區的首府和經濟文化中心。早在東漢中期，就成為僅次於中國首都洛陽的全國第二大城市和世界十大城市之一，明清時期，更成為全國的經濟文化中心。當時，蘇州是全國最大的工商業城市，世界十大城市之一。但19世紀時受到西方列強的衝擊，上海開埠與之後太平天國的庚申之劫後，工商業衰敗，人口銳減外移，蘇州經歷了長達一百多年的衰落時期。直到20世紀80年代左右，隨著蘇南模式的發展和眾多開發區的建立，蘇州經濟開始快速發展，1978-2013年年均經濟增長超過14%。據聯合國的報告，蘇州人口在2000年至2014年年均增長6.5%，在全球超過五百萬人口的城市高居增長首位，也因此被認為是全球最具潛力的新興城市。\\n蘇州是國內經國務院批准的享有地方立法權的較大的市之一，長江三角洲經濟圈北翼最重要的經濟中心，是江蘇省經濟最發達、現代化程度最高的城市之一，經濟總量長期居全省之冠，是全省的經濟中心、工商業中心、對外貿易中心和物流中心，也是全省重要的金融、文化、科教城市及交通樞紐。根據2015年官方發布的各項統計數據，蘇州的人類發展指數已達到0.894，相當於世界第18位的以色列。\\n蘇州文化底蘊深厚，是中華人民共和國首批24個國家歷史文化名城之一，10個全國重點風景旅遊城市之一，首批中國優秀旅遊城市。蘇州古典園林作為中國古典園林的代表，已列入《世界文化遺產名錄》。蘇州還承辦過第28屆世界遺產大會。在2018年舉辦的世界遺產城市組織第三屆亞太區大會上，蘇州市被授予全球首個「世界遺產典範城市」稱號。蘇州是中國重要的旅遊城鎮之一，被《米其林旅遊指南》評為「三星級旅遊推薦」。"},{"page_url":"https://nl.wikipedia.org/wiki/Fremantle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Fremantle_Harbour_Classic.jpg","page_title":"Fremantle","context_page_description":"Fremantle is een havenstad in Australië, aan de monding van de Swan River. De plaats grenst aan Perth."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D1%83%D0%B7%D1%94%D1%94%D0%B2%D0%B0_%D0%9B%D0%B0%D1%80%D0%B8%D1%81%D0%B0_%D0%90%D0%BD%D0%B4%D1%80%D1%96%D1%97%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Guzeeva-kremlin-2.jpeg","page_title":"Гузєєва Лариса Андріївна","context_page_description":"Лариса Андріївна Гузєєва — радянська і російська актриса. Заслужена артистка Росії З 2008 року веде програму «Давай одружимося!».\\nНародилася 23 травня 1959 р. в радгоспі Буртинський Оренбурзької обл. в родині робітника. Закінчила Ленінградський інститут театру, музики і кінематографії."},{"page_url":"https://en.wikipedia.org/wiki/Anna_Russell","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Anna_Russell_1965.JPG","page_title":"Anna Russell","context_page_description":"Anna Russell was an English–Canadian singer and comedian. She gave many concerts in which she sang and played comic musical sketches on the piano. Among her best-known works are her concert performances and famous recordings of The Ring of the Nibelungs – a humorous 22-minute synopsis of Richard Wagner's Der Ring des Nibelungen – and her parody How to Write Your Own Gilbert and Sullivan Opera."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%BCdiger_Lautmann","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Lautmann_2012.jpg","page_title":"Rüdiger Lautmann","context_page_description":"Rüdiger Lautmann es un sociólogo alemán. Fue el primer catedrático de una escuela superior alemana que en 1971 se dedicó al estudio de la discriminación de los homosexuales en la historia y en la actualidad."},{"page_url":"https://ro.wikipedia.org/wiki/Gheorghe_P%C3%A2rnu%C8%9B%C4%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Gheorghe_Parnuta.jpg","page_title":"Gheorghe Pârnuță","context_page_description":"Gheorghe Pârnuță a fost un profesor universitar doctor, istoric al învățământului din România, scriitor, membru de onoare al Academiei Oamenilor de Știință din România 10 septembrie 1991. Al treilea copil al familiei Ion Mihai Pârnuță și Maria Pârnuță, ambii, urmașii unor moșeni rucăreni. Primii doi copii ai familiei erau o fata, Muța, căsătorită cu Neculae Idoraș, și un băiat Moise, ajuns brigadier silvic."},{"page_url":"https://lt.wikipedia.org/wiki/Marija_Magdalena_Radvilien%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Kuchci%C4%8Dy%2C_Zavi%C5%A1a._%D0%9A%D1%83%D1%85%D1%86%D1%96%D1%87%D1%8B%2C_%D0%97%D0%B0%D0%B2%D1%96%D1%88%D0%B0_%28N._Orda%2C_13.08.1864-76%29_%282%29.jpg","page_title":"Marija Magdalena Radvilienė","context_page_description":"Marija Magdalena Radvilienė – „Gulbės“ herbo kunigaikštienė, filantropė."},{"page_url":"https://eu.wikipedia.org/wiki/R%C3%A9chicourt-la-Petite","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/RechicourtPetite3.jpg","page_title":"Réchicourt-la-Petite","context_page_description":"Réchicourt-la-Petite Frantziako udalerri bat da, Meurthe-et-Moselle departamenduan dagoena, Ekialde Handia eskualdean. 2013an 72 biztanle zituen."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_lieux_patrimoniaux_des_Laurentides","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Maison-B%C3%A9lair_1.JPG","page_title":"Liste des lieux patrimoniaux des Laurentides","context_page_description":"Cet article recense les lieux patrimoniaux des Laurentides inscrit au répertoire des lieux patrimoniaux du Canada, qu'ils soient de niveau provincial, fédéral ou municipal."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89quipe_de_C%C3%B4te_d%27Ivoire_de_football","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/AbidjanStade.JPG","page_title":"Équipe de Côte d'Ivoire de football","context_page_description":"L'équipe de Côte d'Ivoire de football est la sélection de joueurs ivoiriens représentant le pays lors des compétitions internationales de football masculin, sous l'égide de la Fédération ivoirienne de football.\\nLa Côte d'Ivoire a remporté à deux reprises la Coupe d'Afrique des nations, en 1992 et 2015, en battant à chaque fois le Ghana aux tirs au but. Elle compte en 2015 vingt-et-une qualifications pour la phase finale de la compétition continentale et huit podiums. Les « Éléphants » ont participé par ailleurs à trois phases finales de la Coupe du monde, en 2006, 2010 et 2014, sans jamais franchir le premier tour.\\nParmi les joueurs de football ayant marqué l'histoire de la sélection, deux ont remporté le trophée du Joueur africain de l'année : Didier Drogba et Yaya Touré, respectivement deux et quatre fois.\\nLes joueurs de la sélection s'entraînent au Centre technique national de Bingerville et jouent au stade Félix-Houphouët-Boigny situé à Abidjan.\\nL'équipe de Côte d’Ivoire est la 5ᵉ meilleure sélection africaine de tous les temps avec 8 médailles, 2 en or, 2 en argent et 4 médailles de bronze."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B3%D9%85%D8%B1%D9%82%D9%86%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Imammaturidi.jpg","page_title":"سمرقند","context_page_description":"سمرقند هي مدينة في أوزبكستان يبلغ عدد سكانها 400,000 نسمة وهي ثاني أكبر مدن أوزباكستان."},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Miko%C5%82aja_Kopernika_w_Wieliczce","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/UlicaMiko%C5%82ajaKopernika-WidokNaP%C3%B3%C5%82noc-POL%2C_Wieliczka.JPG","page_title":"Ulica Mikołaja Kopernika w Wieliczce","context_page_description":"Ulica Mikołaja Kopernika – ulica łącząca wielicki Rynek z drogą powiatową wiodącą z Rożnowej do Sierczy.\\nUważana za jedną z najbardziej stromych ulic w Polsce: różnica wzniesień na całej jej długości wynosi ponad 100 metrów. W znacznej części jest wyłożona nieforemnym brukiem.\\nPo tej ulicy przebiegała trasa wielu szosowych wyścigów kolarskich, na szczycie usytuowana była bądź to meta wyścigów, bądź to premia górska. Z powodu ogromnego nachylenia i trudnej nawierzchni nazywana jest \\"ścianą płaczu\\" – wielu znanych kolarzy zmuszonych było prowadzić rowery.\\nZ niektórych miejsc ulicy rozciąga się widok na Wieliczkę i Kraków. Ulica leży na samym skraju Pogórza Wielickiego.\\nPrzy ulicy Kopernika znajduje się Zespół Szkół Zawodowych."},{"page_url":"https://en.wikipedia.org/wiki/Fothergilla_gardenii","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/FothergillaGardenii.jpg","page_title":"Fothergilla gardenii","context_page_description":"Fothergilla gardenii, also known by the common names witch alder, dwarf fothergilla, American wych hazel, and dwarf witchalder is a deciduous shrub in the Hamamelidaceae family. It is one of two species in the genus Fothergilla."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_deutschen_Kolonialbahnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Wirtschafts-Atlas_der_deutschen_Kolonien_-_13.jpg","page_title":"Liste der deutschen Kolonialbahnen","context_page_description":"Die deutschen Kolonialbahnen in den Kolonien des Deutschen Kaiserreiches entstanden vom Ende des 19. Jahrhunderts bis in das Jahr 1916. In den deutschen Kolonien entstanden zur Friedenszeit Bahnstrecken mit einer Gesamtlänge von etwa 5500 Kilometern. Dies entsprach etwa 7,5 Prozent des Schienennetzes innerhalb des damaligen Deutschen Reiches. Der Bau dieser Eisenbahnen diente vorwiegend der Beherrschung wie auch der wirtschaftlichen Erschließung und Ausbeutung der Kolonien. Einige Bahnprojekte gelangten aufgrund des Ersten Weltkriegs nicht zur Ausführung oder ihr Bau wurde wegen des Krieges eingestellt. Aber auch im Ersten Weltkrieg wurden in Deutsch-Ostafrika noch viele dutzend Kilometer Bahnen gebaut. Die schnelle Annahme einiger dieser Bahnen auch für die Personenbeförderung durch die farbige Bevölkerung überraschte selbst die Betreiber der Bahnen.\\nKurze Feld- und Werkbahnen sind unvollständig aufgelistet. Feldbahnen kamen etwa beim Bau der Funkstationen Kamina und Apia zum Einsatz. Ein Beispiel für eine Werkbahn war der Betrieb der Landungsbrücke von Lomé in Togo. Auf den Pazifik-Inseln Angaur und Nauru wurden derartige Bahnen beim Phosphat-Abbau eingesetzt."},{"page_url":"https://lmo.wikipedia.org/wiki/Lech_(AT-8)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Lech_Dorfkirche.jpg","page_title":"Lech (AT-8)","context_page_description":"Lech l'è on comun austriegh, del land del Vorarlberg. El fa part del distrett de Bludenz e el se troeuva a ona altituden de 1 444 meter sora del nivel del mar e l'è vun de pu renomaa sit sportiv invernaj internassiunaj di Alp. El se troeuva ai pee de l'Arlberg.\\nEl gh'ha 1,532 abitant e ona superfis de 89,97 km² per ona densità de popolazion de 0 ab./km².\\nEl sò codes statistegh l'è 80113."},{"page_url":"https://ast.wikipedia.org/wiki/Arquiteutura_armenia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Building_on_Abovyan_street.jpg","page_title":"Arquiteutura armenia","context_page_description":"L'arquiteutura armenia tien unes carauterístiques especiales que la acomuñar col pueblu armeniu. Ye difícil asitiar esti estilu arquiteutónicu dientro de llendes xeográfiques o cronolóxicos precisos, pero munchos de los sos monumentos crear na Armenia histórica, l'altiplanu Armeniu."},{"page_url":"https://nl.wikipedia.org/wiki/Burst_(plaats)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Kapel_einde_Dorent_Burst_1.jpg","page_title":"Burst (plaats)","context_page_description":"Burst is een dorp in de Belgische provincie Oost-Vlaanderen en een deelgemeente van Erpe-Mere. Burst heeft 2968 inwoners en de oppervlakte van de deelgemeente is 3,83 km². Burst ligt in de Denderstreek aan de Molenbeek en wordt omringd door Bambrugge, Aaigem, Ressegem, Borsbeke, Vlierzele en Zonnegem. Aan Burstenaren gaf men de bijnaam \\"De Stro-zekers\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Ordres,_d%C3%A9corations_et_m%C3%A9dailles_du_Royaume-Uni","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Lint_van_de_Orde_Compaions_of_Honour.jpg","page_title":"Ordres, décorations et médailles du Royaume-Uni","context_page_description":"Les ordres, décorations et médailles du Royaume-Uni comprennent un système complexe par lequel les britanniques sont récompensés pour leur courage, leur réussite ou leur service envers le royaume. Il comprend trois types de récompenses :\\nLes ordres honorifiques sont utilisés pour reconnaître le mérite en termes de réussite ou de service.\\nLes décorations militaires et civiles sont utilisées pour reconnaître des actions spécifiques.\\nLes médailles sont utilisées pour reconnaître le courage, un long et/ou important service et/ou bonne conduite.\\nDe plus, le système de noblesse britannique, encore largement utilisé, constitue un autre type d'honneur."},{"page_url":"https://en.wikipedia.org/wiki/MV_Agusta","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Rivale_800cc_%2819624301310%29.jpg","page_title":"MV Agusta","context_page_description":"MV Agusta is a motorcycle manufacturer founded by Count Domenico Agusta on 19 January 1945 as one of the branches of the Agusta aircraft company near Milan in Cascina Costa, Italy. The abbreviation MV stands for Meccanica Verghera, the hamlet where the first MVs were made. The modern headquarters and main production facilities are located in Varese, Italy on the shore of Lake Varese."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D0%BC_%D0%A8%D1%82%D1%83%D0%B1%D1%80%D0%B8%D0%BD%D0%B0_(%D0%9C%D0%B8%D0%BD%D1%81%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/%D0%94%D0%BE%D0%BC_%D0%A8%D1%82%D1%83%D0%B1%D1%80%D0%B8%D0%BD%D0%B0_%28%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%292.jpg","page_title":"Дом Штубрина (Минск)","context_page_description":"Дом Штубрина — бывший доходный дом в Раковском предместье Минска, расположен на улице Освобождения 11, историко-культурная ценность регионального значения."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B0%B8%E5%BE%B3%E7%9C%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Location_of_Yongde_within_Yunnan_%28China%29.png","page_title":"永徳県","context_page_description":"永徳県は中華人民共和国雲南省臨滄市に位置する県。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D1%83%D1%81%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%BA%D1%83%D0%BB%D1%8C%D0%BF%D1%82%D1%83%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Monomakhov_tron_%28copy%29_-_detail_01._Side_A._Upper_row%2C_left_-_by_shakko.JPG","page_title":"Русская скульптура","context_page_description":"Русская скульптура — один из жанров русского изобразительного искусства.\\nБудучи, в отличие от живописи, искусством дорогостоящим и затратным по материалам и времени, искусство скульптуры тесно связано в своих подъёмах и спадах с развитием и благосостоянием государства, его идеологии и уровня жизни населения. Это наглядно наблюдается в истории развития русской скульптуры. Хотя она ведёт свою историю со времён язычества, но после христианизации Руси оказывается слабо развитой в связи с запретом на идолопоклонство, влиявшим на развитие скульптуры в православном искусстве. Однако провинциальные скульптурные школы демонстрируют чрезвычайно любопытное развитие народной религиозной скульптуры до самой революции.\\nПосле реформ Петра I русская скульптура начинает догонять европейскую, заимствуя из неё жанры и иконографии. В Золотой век Екатерины II, с началом классицизма, скульптура достигает чрезвычайно высокого уровня, который продолжается в образцах стиля ампир, знаменующих победу над Наполеоном. Ко 2-й пол."},{"page_url":"https://tr.wikipedia.org/wiki/Vilasantar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Situacion_Vilasantar.PNG","page_title":"Vilasantar","context_page_description":"Vilasantar İspanya'nın otonom bölgelerinden biri olan Galiçya'nın kuzeybatısında bulunan A Coruña eyaletine bağlı belediyesi."},{"page_url":"https://pl.wikipedia.org/wiki/Eigg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Lochaber_UK_relief_location_map.jpg","page_title":"Eigg","context_page_description":"Eigg – wyspa położona na zachód od wybrzeża Wielkiej Brytanii, należąca do Szkocji. Jest częścią archipelagu Hebrydy Wewnętrzne. Leży na południe od wyspy Skye i na północ od półwyspu Ardnamurchan."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B3%D9%8A%D9%85%D9%86_%D8%A7%D8%AC%D8%AF%D8%B3%D8%AA%D8%A7%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Simen_Agdestein.jpg","page_title":"سيمن اجدستاين","context_page_description":"سيمن اجدستاين لاعب كورة قدم من النرويج."},{"page_url":"https://sv.wikipedia.org/wiki/Stilbit","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/StilbiteInde2.jpg","page_title":"Stilbit","context_page_description":"Stilbit är en silikatmineral som är vit till vitgrå.\\nDen är 5-5,6 på Mohs hårdhetsskala. Den tillhör det monoklina kristallsystemet."},{"page_url":"https://en.wikipedia.org/wiki/Ne-Yo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Ne-Yo_Promotion.jpg","page_title":"Ne-Yo","context_page_description":"Shaffer Chimere Smith, better known by his stage name Ne-Yo, is an American singer-songwriter, record producer, actor, dancer and television judge. He gained fame for his songwriting abilities when he penned his 2004 hit \\"Let Me Love You\\" for singer Mario. The single's successful release in the United States prompted an informal meeting between Ne-Yo and Def Jam's label head and the signing of a recording contract.\\nNe-Yo's debut solo single, \\"Stay\\", was released in 2005 to moderate success. His debut studio album, In My Own Words, was critically and commercially successful, reaching number one on the Billboard 200 chart in the United States. It is certified platinum in the United States, United Kingdom, Japan and Australia and saw the success of the single \\"So Sick\\", which topped the Billboard Hot 100 chart in the United States.\\nBecause of You, Ne-Yo's second studio album, was the second number one platinum-selling album debuted on the Billboard 200 and Top R&B/Hip-Hop Albums charts, and received the Grammy Award for Best Contemporary R&B Album at the 50th Grammy Awards."},{"page_url":"https://fr.wikipedia.org/wiki/Wolff-Metternich","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Gracht_Wappen.jpg","page_title":"Wolff-Metternich","context_page_description":"La famille von Wolff-Metternich est une famille de la noblesse ancienne de Rhénanie, qui descend des seigneurs Wolff von Gudenberg, originaires de la Hesse du Nord.\\nCette famille ne doit pas être confondue avec les comtes et princes de Metternich-Winneburg."},{"page_url":"https://en.wikipedia.org/wiki/Rickinghall_Inferior","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Rickinghall_Inferior_1881_Occupation_Census_Data.jpg","page_title":"Rickinghall Inferior","context_page_description":"Rickinghall Inferior is a civil parish in the Mid Suffolk district of Suffolk, England. According to the 2011 census there were 233 males and 216 females in this civil parish, for a total population of 449. It includes the western part of the village of Rickinghall and is adjacent to the village and parish of Wattisfield. The road from the market town of Bury. St Edmunds to the city of Norwich passes through the village."},{"page_url":"https://es.wikipedia.org/wiki/Hybe","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Hybe_evang-kostel_%282014%29.JPG","page_title":"Hybe","context_page_description":"Hybe es un municipio del distrito de Liptovský Mikuláš en la región de Žilina, Eslovaquia, con una población estimada a final del año 2017 de 1471 habitantes.\\nSe encuentra ubicado al sureste de la región, cerca del curso alto del río Váh, de los montes Tatras y de la frontera con Polonia y las regiones de Prešov y Banská Bystrica.​"},{"page_url":"https://da.wikipedia.org/wiki/Bisped%C3%B8mmet_Ratzeburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Ratzeburg_Cathedral_Interior.jpg","page_title":"Bispedømmet Ratzeburg","context_page_description":"Bispedømmet Ratzeburg blev stiftet i 1154 af Henrik Løve og opnåede i 1236 rigsumiddelbarhed. I 1648 blev bispedømmet ophævet og overdraget som arveligt fyrstendømme til hertug Adolf Frederik 1. af Mecklenburg-Schwerin som erstatning for afståelsen af Wismar."},{"page_url":"https://sl.wikipedia.org/wiki/Bosra","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bosra-TheatreStage.jpg","page_title":"Bosra","context_page_description":"Bosra je južno sirsko mesto. Leži okoli 150 km južno od Damaska, nedaleč od meje z Jordanijo. Administrativno pripada okrožju Daraa v guverniji Daraa, ki je geografsko del regije Hauran.\\nPo podatkih Sirskega statističnega urada je po popisu leta 2004 v mestu živelo 19.683 prebivalcev. Prebivalci so pretežno sunitski muslimani, v mestu pa je tudi majhna muslimanska skupnost Shia.\\nBosra ima staro zgodovino in je bila v rimski dobi uspešna deželna prestolnica in metropolitanska nadškofija pod nadzorom vzhodnega pravoslavnega patriarhata Antiohije in celotnega vzhoda. Administrativno pomembna je bila tudi v islamski dobi, vendar je v času osmanske dobe postajala manj pomembna. Bila je tudi latinsko katoliška naslovna nadškofija in sedež škofije Melkite katoliške arheparhije. Danes je to glavno arheološko najdišče, ki ga je UNESCO razglasil za območje svetovne dediščine."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AE%E0%AF%81%E0%AE%A4%E0%AE%B2%E0%AE%BE%E0%AE%AE%E0%AF%8D_%E0%AE%85%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AF%8B%E0%AE%9A%E0%AF%82%E0%AE%B8%E0%AF%8D_%E0%AE%9A%E0%AF%8B%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AE%B0%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Antiochos_I_Tetradrachm_620447.jpg","page_title":"முதலாம் அந்தியோசூஸ் சோத்தர்","context_page_description":"முதலாம் அந்தியோசூஸ் சோத்தர் ஹலெனியக் காலத்தில் மேற்காசியா மற்றும் நடு ஆசியாவின் பகுதிகளை கிமு 281 முதல் 261 முடிய 20 ஆண்டுகள் செலூக்கியப் பேரரசை ஆண்ட இரண்டாவது பேரரசரும், செலூக்கஸ் நிக்காத்தர் மகனும் ஆவார்.இவரை மெசொப்பொத்தேமியாவில் அகிலத்தின் மன்னர் என அழைக்கப்பட்ட ஆட்சியாளர் ஆவார்."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D0%BC%D0%BE%D0%BA_%D0%95%D1%88%D1%84%D0%BE%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Ashford_Castle_Memorabilia.jpg","page_title":"Замок Ешфорд","context_page_description":"Замок Ешфорд — один із замків Ірландії. Розташований в графстві Ґолвей на кордоні з графством Мейо. Це середньовічний замок, що розбудовувася протягом століть і нині перетворений в п'ятизірковий готель класу люкс. Розташований біля селища Кон, на березі озера Лох-Корріб. Нині цей замок як готель є членом провідних готелів Всесвітньої організації. Належав клану Гіннесс."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%AD%E0%B8%A2%E0%B8%B2%E0%B8%9F%E0%B8%A2%E0%B8%B2%E0%B8%95%E0%B8%A5%E0%B8%B2%E0%B9%80%E0%B8%A2%E0%B8%AD%E0%B8%84%E0%B8%B8%E0%B8%95%E0%B8%A5%E0%B9%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Iceland_relief_map.jpg","page_title":"เอยาฟยาตลาเยอคุตล์","context_page_description":"เอยาฟยาตลาเยอคุตล์ เป็นชื่อเรียกของครอบน้ำแข็งขนาดเล็กแห่งหนึ่งทางตอนใต้ของประเทศไอซ์แลนด์ ครอบน้ำแข็งแห่งนี้ตั้งอยู่ทิศเหนือของหมู่บ้านสโกอาร์และทางทิศตะวันตกของครอบน้ำแข็งมีร์ตัลส์เยอคุตล์ซึ่งมีขนาดใหญ่กว่า\\nชั้นน้ำแข็งของครอบน้ำแข็งดังกล่าวได้ปกคลุมภูเขาไฟ ซึ่งได้ปะทุค่อนข้างบ่อยนับตั้งแต่ยุคน้ำแข็ง เมื่อเวลาที่มันนำหินไรโอไลต์ขึ้นมาสู่พื้นผิวโลก ในปี พ.ศ. 2553 ได้มีการปะทุขึ้นสองครั้งเมื่อวันที่ 20 มีนาคม และวันที่ 15 เมษายน ผลจากการปะทุในเดือนเมษายน ส่งผลรบกวนการจราจรทางอากาศตลอดยุโรปเหนือและยุโรปตะวันตก ซึ่งนักวิทยาศาสตร์กล่าวว่ามันมีความรุนแรงกว่าการปะทุเมื่อเดือนก่อนถึง 10-20 เท่า การปะทุครั้งล่าสุดในอดีตคือจาก ค.ศ. 1821-1823 การระเบิดออกของทะเลสาบธารน้ำแข็งก่อให้เกิดอุทกภัยตามมา. แม้ว่าการประทุของเอยาฟยาลาเยอคุตล์ทำให้เกิดการชะงักครั้งยิ่งใหญ่ แต่หากเทียบกับการประทุครั้งใหญ่ที่สุดในประเทศไอซ์แลนด์เมื่อในอดีตนั้น การประทุครั้งนี้ถือเป็นเพียงแค่หยดน้ำเท่านั้น"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%9B%B2%E8%9D%BD%E7%A7%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Heter-hemielytron.gif","page_title":"盲蝽科","context_page_description":"盲蝽科，或作盲椿象科，是一個數量龐大而且高度多樣性的半翅目異翅亞目昆蟲的科，皆為小型到中型的物種，體形多樣。\\n本科現時包括有超過1300個屬、合共超過一萬個已知物種；而新的物種每年均有發現。本科最廣為人知的物種均為農業上的害蟲，會刺穿植物的組織，以吸取其汁液進食。這種進食的行為更不時將植物性病毒在農作物間傳染，造成經濟損失。有小量物種卻是捕食性昆蟲。"},{"page_url":"https://en.wikipedia.org/wiki/Coral","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Coral_polyp.jpg","page_title":"Coral","context_page_description":"Corals are marine invertebrates within the class Anthozoa of the phylum Cnidaria. They typically live in compact colonies of many identical individual polyps. Corals species include the important reef builders that inhabit tropical oceans and secrete calcium carbonate to form a hard skeleton.\\nA coral \\"group\\" is a colony of myriad genetically identical polyps. Each polyp is a sac-like animal typically only a few millimeters in diameter and a few centimeters in height. A set of tentacles surround a central mouth opening. Each polyp excretes an exoskeleton near the base. Over many generations, the colony thus creates a skeleton characteristic of the species which can measure up to several meters in size. Individual colonies grow by asexual reproduction of polyps. Corals also breed sexually by spawning: polyps of the same species release gametes simultaneously overnight, often around a full moon. Fertilized eggs form planulae, a mobile early form of the coral polyp which when mature settles to form a new colony."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BB%99%E5%8F%B0_-_%E7%A6%8F%E5%B3%B6%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Miyagi-kotsu-s787.jpg","page_title":"仙台 - 福島線","context_page_description":"仙台 - 福島線は、宮城県仙台市と福島県福島市を結ぶ高速バスである。\\n共同運行する既存の乗合バス事業者3社と、道路運送法改正によるバス事業の規制緩和により新規参入してきた元貸切バス事業者が値下げ競争を繰り返し、新規参入事業者が経営破綻から廃業に至るという、いわゆる「ツアーバス問題」の典型的な展開を示した。同じ事業者が同時期に参入した仙台 - 郡山線、仙台 - 山形線でも同様に激しい競争が繰り広げられた。"},{"page_url":"https://pl.wikipedia.org/wiki/Gmina_Manly","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/FairyBower.JPG","page_title":"Gmina Manly","context_page_description":"Manly – jeden z 38 samorządów lokalnych wchodzących w skład aglomeracji Sydney, największego zespołu miejskiego Australii. Dzielnica ta położona jest w części miasta określanej potocznie jako tzw. północne plaże. Zajmuje powierzchnię 15 km² i liczy 37 110 mieszkańców.\\nManly ma podpisane umowy o współpracy z sześcioma miastami lub dzielnicami. W czterech przypadkach są to umowy przewidujące status tzw. miast siostrzanych. Więzy takie łączą dzielnicę z Taitō, Jing’an, Bath oraz Haeundae-gu. Z kolei umowy zawarte z japońskim miastem Odawara oraz miastem Gunnedah mówią o statusie „miast zaprzyjaźnionych”."},{"page_url":"https://en.wikipedia.org/wiki/Moulting","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Ranapipiensmoulting.jpg","page_title":"Moulting","context_page_description":"In biology, moulting, or molting, also known as sloughing, shedding, or in many invertebrates, ecdysis, is the manner in which an animal routinely casts off a part of its body, either at specific times of the year, or at specific points in its life cycle.\\nMoulting can involve shedding the epidermis, pelage, or other external layer. In some groups, other body parts may be shed, for example, wings in some insects or the entire exoskeleton in arthropods."},{"page_url":"https://pt.wikipedia.org/wiki/Irlandeses","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Sir_Arthur_Wellesley%2C_1st_Duke_of_Wellington.png","page_title":"Irlandeses","context_page_description":"Os irlandeses constituem o grupo étnico autóctone da Irlanda."},{"page_url":"https://uk.wikipedia.org/wiki/Calumma_crypticum","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Blue-legged_Chameleon_%28Calumma_crypticum%29%2C_Ranomafana_National_Park%2C_Madagascar_%2811389223796%29.jpg","page_title":"Calumma crypticum","context_page_description":"Calumma crypticum — вид ящірок родини Хамелеонові."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B5%A4%E5%B9%B3%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Akabira_in_Sorachi_Subprefecture.png","page_title":"赤平市","context_page_description":"赤平市是位於日本北海道中部的城市，屬空知綜合振興局，主要市區主要位於空知川流域，除空知川沿岸區域外接為山區。\\n過去在煤礦產業最盛的1960年，人口數曾經達到59,430人，但是之後隨著煤礦產業的衰退使得人口開使減少，目前人口僅有一萬人左右，是全日本人口第四少的市級行政區劃；目前正致力發展以煤礦產業遺跡為主的觀光旅遊業。\\n城市名稱源自阿伊努語的「aka-pira」，意思是山稜的崖。或是「hure-pira」「wakka-pira」等。"},{"page_url":"https://pt.wikipedia.org/wiki/Ilha_de_Navassa","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Navassa-location.png","page_title":"Ilha de Navassa","context_page_description":"Navassa é uma pequena ilha desabitada do mar do Caribe. Constitui em um território não incorporado dos Estados Unidos, administrado pelo Serviço de Pesca e Vida Silvestre dos Estados Unidos. No entanto, a ilha é reclamada por instituições privadas e pelo Haiti, país que alega possuir sua soberania desde 1801. Pescadores, em sua maioria provenientes do Haiti, pescam nas águas ao redor de Navassa."},{"page_url":"https://it.wikipedia.org/wiki/Mus%C3%A9e_Marmottan_Monet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Claude_Monet%2C_Impression%2C_soleil_levant.jpg","page_title":"Musée Marmottan Monet","context_page_description":"Il Musée Marmottan Monet è un museo di impressionismo ed arte francese dell'Ottocento, si trova in rue Louis Boilly 2, vicino al Jardin du Ranelagh, nella zona NO di Parigi in Francia."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D0%A4%D0%9A_%D0%A6%D0%A1%D0%9A%D0%90_(%D0%A1%D0%BE%D1%84%D0%B8%D1%8F)_%D0%BF%D1%80%D0%B5%D0%B7_%D1%81%D0%B5%D0%B7%D0%BE%D0%BD_2010/11","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/CSKA_10-11_kits.png","page_title":"ПФК ЦСКА (София) през сезон 2010/11","context_page_description":"Сезон 2010/2011 е 64-тият сезон в историята на ПФК ЦСКА (София). Армейците участват в „А“ група на първенството на България по футбол, в Купата на България по футбол и в Лига Европа. От ръководството на ЦСКА заявяват стадион „Васил Левски“ за домашен, тъй като клубният Българска армия не покрива критериите за лицензиране на УЕФА."},{"page_url":"https://fi.wikipedia.org/wiki/Chalk%C3%ADdan_arkeologinen_museo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/%CE%91%CE%BD%CE%AC%CE%B3%CE%BB%CF%85%CF%86%CE%BF_%CE%B8%CF%85%CF%83%CE%AF%CE%B1%CF%82_%CE%BA%CF%81%CE%B9%CE%BF%CF%8D_9883.jpg","page_title":"Chalkídan arkeologinen museo","context_page_description":"Chalkídan arkeologinen museo on arkeologinen museo Chalkídan kaupungissa Euboian saarella Kreikassa. Se esittelee eri puolilta saarta löydettyä pääosin antiikin aikaista esineistöä.\\nMuseo on perustettu ja rakennettu vuosina 1901–1902. Se toimii Chalkídan keskustassa sijaitsevassa uusklassisessa rakennuksessa. Museossa on kolme näyttelysalia. Esineitä on näytteillä myös museon pihalla. Rakennus kunnostettiin vuosina 1990–1991."},{"page_url":"https://ceb.wikipedia.org/wiki/Togiak_National_Wildlife_Refuge","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Boundary_Map_Togiak_National_Wildlife_Refuge.png","page_title":"Togiak National Wildlife Refuge","context_page_description":"Parke ang Togiak National Wildlife Refuge sa Tinipong Bansa. Ang Togiak National Wildlife Refuge nahimutang sa kondado sa Dillingham Census Area ug estado sa Alaska, sa kasadpang bahin sa nasod, 6,000 km sa kasadpan sa ulohang dakbayan Washington, D.C. 48 metros ibabaw sa dagat kahaboga ang nahimutangan sa Togiak National Wildlife Refuge. Naglangkob kin og 16.6 ka kilometro kwadrado.\\nAng yuta palibot sa Togiak National Wildlife Refuge kay kabungtoran sa amihang-kasadpan, apan sa habagatang-sidlakan nga kini mao ang patag. Kinahabogang dapit sa palibot ang Lone Mountain, 724 ka metros ni kahaboga ibabaw sa dagat, 5.8 km sa amihanan sa Togiak National Wildlife Refuge. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Togiak National Wildlife Refuge. Hapit nalukop sa [[kalibonan ang palibot sa Togiak National Wildlife Refuge.\\nAng klima boreal. Ang kasarangang giiniton -3 °C. Ang kinainitan nga bulan Hulyo, sa 14 °C, ug ang kinabugnawan Enero, sa -15 °C."},{"page_url":"https://hu.wikipedia.org/wiki/Wroc%C5%82aw","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Terminal_T2_lotniska_we_Wroc%C5%82awiu.jpg","page_title":"Wrocław","context_page_description":"Wrocław város Lengyelországban, Szilézia történelmi fővárosa. Lakosságát tekintve a negyedik legnagyobb és az egyik legrégibb lengyelországi város. Az Alsó-sziléziai vajdaság fővárosa.\\nA történelem során Lengyelországhoz, Csehországhoz, a Habsburg Birodalomhoz, a Porosz Királysághoz és a Német Birodalomhoz is tartozott.\\nWrocław adott otthont az 1963-as férfi kosárlabda-Európa-bajnokság összes mérkőzésének, valamint a 2009-es férfi kosárlabda-Európa-bajnokság, a 2009-es női röplabda-Európa-bajnokság és a 2012-es labdarúgó-Európa-bajnokság egyes összecsapásainak.\\n2016-ban Európa kulturális fővárosa volt."},{"page_url":"https://it.wikipedia.org/wiki/Orto-metallazione","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Directedorthometalation.png","page_title":"Orto-metallazione","context_page_description":"Una reazione di orto-metallazione è un adattamento della sostituzione elettrofila aromatica in cui l'elettrofilo si attacca esclusivamente in posizione orto riguardo ad un anello aromatico, solitamente benzenico, generando un composto di aril-metallo come intermedio. Affinché si possa parlare di orto-metallazione è necessario che l'attacco del metallo sia coordinato da un gruppo contenente un eteroatomo in grado di donare elettroni. Il sostituente coordinatore prende il nome di gruppo di metallazione diretta ed esempi sono ammidi, ammine e alcossidi come il gruppo metossi.\\nQuesto tipo di reazione fu riportato per la prima volta, indipendentemente, dai chimici Henry Gilman e Georg Wittig negli anni Quaranta e si può inquadrare nella famiglia delle ciclometallazioni.\\nDi seguito è riportato lo schema generale di funzionamento, impiegando composti di organo-litio.\\nUn sistema benzenico aromatico porta un DMG, il quale interagisce con un alchil-litio per formare l'intermedio 2. Dal momento che l'eteroatomo del DMG si comporta, donando elettroni, da base di Lewis, abbiamo che il metallo fa da acido di Lewis."},{"page_url":"https://en.wikipedia.org/wiki/Chevrolet_Silverado","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/MP_MilCOTS.jpg","page_title":"Chevrolet Silverado","context_page_description":"The Chevrolet Silverado is a range of trucks manufactured by General Motors under the Chevrolet brand. Introduced for the 1999 model year, the Silverado is the successor to the long-running Chevrolet C/K model line. Taking its name from the top trim level from the Chevrolet C/K series, the Silverado is offered as a series of full-size pickup trucks, chassis cab trucks, and medium-duty trucks. The fourth generation of the model line was introduced for the 2019 model year.\\nThe Chevrolet Silverado shares mechanical commonality with the GMC Sierra; GMC ended the use of the C/K nomenclature a model generation prior to Chevrolet. In Mexico, heavy-duty versions of the Silverado use the Chevrolet Cheyenne name. Competing against the Ford F-Series, Ram Pickup, Nissan Titan, and Toyota Tundra, the Silverado is among the best-selling vehicles in the United States, selling almost 12 million examples since its introduction."},{"page_url":"https://eo.wikipedia.org/wiki/Fuensanta_de_Martos","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Fuensanta_de_Martos_-_Location.png","page_title":"Fuensanta de Martos","context_page_description":"Fuensanta de Martos estas vilaĝo kaj municipo de la Aŭtonoma Komunumo Andaluzio, en la provinco Ĥaeno, sude de Hispanio."},{"page_url":"https://it.wikipedia.org/wiki/Arcidiocesi_di_Gniezno","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Glemp_J%C3%B3zef.JPG","page_title":"Arcidiocesi di Gniezno","context_page_description":"L'arcidiocesi di Gniezno è una sede metropolitana della Chiesa cattolica in Polonia. Nel 2016 contava 654.000 battezzati su 672.000 abitanti. È retta dall'arcivescovo Wojciech Polak."},{"page_url":"https://cs.wikipedia.org/wiki/Z%C3%A1liv_Fundy","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Bay_of_Fundy_Low_Tide.jpg","page_title":"Záliv Fundy","context_page_description":"Záliv Fundy leží na pobřeží Severní Ameriky s Atlantským oceánem v severovýchodní části Mainského zálivu na pomezí kanadských provincií New Brunswick a Nové Skotsko dotýkající se malou částí i amerického státu Maine. Záliv je známý zejména pro vysoký rozdíl výšek hladiny mezi přílivem a odlivem a je spolu se zálivem Ungava Bay v severním Quebecu a ústím řeky Severn považován za místo vůbec největšího přílivu. Jméno \\"Fundy\\" pochází z 16. století, když Portugalci nazvali záliv jako \\"Rio Fundo\\" nebo \\"Deep river\\"."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%88%9A%E6%9E%9C%E6%B0%91%E4%B8%BB%E5%85%B1%E5%92%8C%E5%9B%BD%E5%9F%8E%E5%B8%82%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Residentie_van_de_gouverneur-generaal.jpg","page_title":"刚果民主共和国城市列表","context_page_description":"下表为刚果民主共和国的城市列表："},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%91%E5%8D%97%E7%9C%81%E9%93%81%E8%B7%AF%E8%BF%90%E8%BE%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Namitibridge.jpg","page_title":"云南省铁路运输","context_page_description":"云南铁路包括在中国云南省境内建设、运营、规划以及已停用的铁路线。云南省第一条铁路昆河铁路于1910年通车，是中国的第一条国际铁路，后又相继通车几条铁路与全国铁路网相连接。至2009年底，云南省铁路营业里程为2308.4公里，排名全国第18位。按照规划，云南将在2020年形成”八入滇，四出境“的铁路格局。"},{"page_url":"https://br.wikipedia.org/wiki/Koed-Keneg","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Bois-de-C%C3%A9n%C3%A9_%C3%A9glise.jpg","page_title":"Koed-Keneg","context_page_description":"Koed-Keneg a zo ur gumun etre Naoned ha Nermouster, gwechall e oa e Marzioù dispartiañ Breizh ha Poatev, ha bremañ e Vande, e kanton Challans."},{"page_url":"https://oc.wikipedia.org/wiki/Amersfoort","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Amersfoort2.JPG","page_title":"Amersfoort","context_page_description":"Amersfoort es una vila neerlandesa de la Província d'Utrecht. Sa populacion èra estimada a 134 904 abitants, en 2005. Sa superfícia totala es 63,85 km²."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Pulsnitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Ziegenbalgstra%C3%9Fe_17_Pulsnitz.JPG","page_title":"Liste der Kulturdenkmale in Pulsnitz","context_page_description":"In der Liste der Kulturdenkmale in Pulsnitz sind die Kulturdenkmale der sächsischen Stadt Pulsnitz verzeichnet, die bis Juli 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen."},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CF%81%CE%BF%CF%8D%CF%84%CE%BF_%CF%84%CE%BF%CF%85_%CE%B4%CF%81%CE%AC%CE%BA%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Pitaya_cross_section_ed2.jpg","page_title":"Φρούτο του δράκου","context_page_description":"Φρούτο του δράκου ή δρακόγια είναι η ονομασία των καρπών αρκετών κάκτων, κυρίως του γένους Υλοκέρεος. Είναι δημοφιλές στην Νοτιοανατολική Ασία. Λέγεται επίσης φρούτο δράκος ή Πιτάγια, λόγω της εξωτερικής του επιφάνειας που θυμίζει τις φολίδες του δράκου. Εξωτερικά ο καρπός έχει ροζ χρώμα, ενώ το εσωτερικό του είναι άσπρο με μαύρους κόκκους που θυμίζουν ακτινίδιο.\\nΟι κάκτοι του γένους Υλοκέρεος κατάγονται από την Νότια και Κεντρική Αμερική και το Μεξικό. Οι κάκτοι καλλιεργούνται επίσης στην Νοτιοανατολική Ασία. Επίσης, βρίσκονται στην ανατολική Μεσόγειο, κυρίως στο Ισραήλ, στην Τουρκία και στην Παλαιστίνη, τη βόρεια Αυστραλία, τη Χαβάη και τη νότια Κίνα. Οι κάκτοι μεταφέρθηκαν μαζί με τους Ευρωπαίους. Οι κάκτοι αυτού του είδους ανοίγουν τα άνθη τους κατά τη διάρκεια της νύχτας.\\nΗ γεύση του είναι υπόγλυκη και έχει ελάχιστες θερμίδες, ενώ βοηθάει και στο αδυνάτισμα. Καταναλώνεται ως φρούτο, τσάι, ή χυμός ο οποίος είναι πολύ δροσιστικός. Είναι αρκετά διαδεδομένο στις περιοχές της Ινδοκίνας. Το φρούτο δρακόγια είναι πλούσιο σε φυτικές ίνες, σίδηρο, ασβέστιο, φώσφορο, βιταμίνη E και βιταμίνη C."},{"page_url":"https://en.wikipedia.org/wiki/Venado,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/DanielsSchoolPhotos1e.jpg","page_title":"Venado, California","context_page_description":"Venado is an unincorporated community in Sonoma County, California, United States, and is located about 12 miles west of Healdsburg, along Mill Creek Road, below the north slope of Knoll Ridge, on the south bank of Gray Creek, at an elevation of 1,102 feet. The name is Spanish for deer or venison, and the community had a post office from 1921 to 1941. Venado was devastated by the Walbridge Fire in 2020, part of the larger LNU Lighting Complex fire. The Walbridge Fire destroyed many homes and structures in the area, including the Venado Post Office and Daniels School."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D0%BC%D0%BF%D0%B8%D0%BD,_%D0%9F%D0%B0%D0%B2%D0%B5%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Pawel_Stempin_1990.jpg","page_title":"Стемпин, Павел","context_page_description":"Павел Стемпин — польский шахматист, международный мастер, тренер.\\nВ составе сборной Польши участник 2-х Олимпиад и 9-го командного первенства Европы в Хайфе."},{"page_url":"https://simple.wikipedia.org/wiki/Public_speaking","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Churchill-in-quebec-1944-23-0201a.gif","page_title":"Public speaking","context_page_description":"Public speaking is speaking to a group of people in an organized way: to give information, influence or persuade, or to entertain the listeners.\\nIn public speaking there are five important questions, which are often expressed as \\"who is saying what to whom, using which medium, with what effects?\\"\\nThe Ancient Greeks called public speaking rhetoric; the Romans called it oratory. Until the late 20th century it was also called forensic speaking, or forensics. Propaganda is an another name for speech for or against some point of view. In George Orwell's words propaganda is a reflection of prejudices and beliefs that colors people's [or societies] aesthetic judgements. Often they are simply fallacies or conjectures."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%87%D8%B1%D8%AC%D8%A7%D9%86_%D8%A7%D9%84%D9%88%D8%B1%D8%AF_%D8%A7%D9%84%D8%B7%D8%A7%D8%A6%D9%81%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/%D9%88%D8%B1%D9%88%D8%AF_%D8%A7%D9%84%D8%B7%D8%A7%D8%A6%D9%81.jpg","page_title":"مهرجان الورد الطائفي","context_page_description":"مهرجان الورد الطائفي هو مهرجان للورود يقام في كل عام بالسعودية، وبدأ من عام 1426هـ، حيث تشتمل الطائف على نحو 860 مزرعة غالبيتها في منطقتي الهدا والشفا. ويجذب المهرجان الزائرين كل عام بهدف مشاهدة الورد الطائفي والتعرف على طريقة صناعة منتجات الورد الطائفي المختلفة وشراء بعض منتجاته. وبلغ الإنتاج السنوي 500 مليون وردة، وعدد معامل الورد 36 معملا. ويذكر أن أمانة الطائف قامت بإنشاء سجادة زهور بمساحة 900 متر مربع تضم 100 ألف شتلة من 10 أنواع من الزهور المتنوعة في حديقة الملك فيصل بالقديرة، ضمن مشاركتها في مهرجان الورد الطائفي، بالإضافة إلى جهود المشتل الرئيسي والذي يدعم التوسع المستمر في المسطحات الخضراء في الطائف وضواحيها وإنشاء الحدائق والمتنزهات بالإضافة إلى جهود التحسين والتجميل الجارية بمواقع مختلفة من المحافظة مع توعية الزوار بأساليب العناية بالحدائق المنزلية.\\nفي عام 1440 هـ نظمت أمانة الطائف مهرجان الورد بمساعدة رابطة العمل التطوعي الذين اشتركو بالتنظيم بأكثر من 120 شاب وشابة متطوعين وبأكثر من 8 مواقع اشتملت فعاليات صحية وثقافية وتوعوية وترفيهيه وركن للرسم الحر والخط أمام الجمهور ومعرض لوحات فنانيين ومعرض لوحات للمصورين."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%96%B0%E6%A4%8D%E6%B0%91%E5%9C%B0%E4%B8%BB%E7%BE%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Worldbank_protest_jakarta.jpg","page_title":"新植民地主義","context_page_description":"新植民地主義とは、ポストコロニアル批評において発展途上国の様態を形容する際用いられる用語。かつての宗主国が築き上げた現存するあるいは過去の国際的な経済協定が、第二次世界大戦後に発生した脱植民地化を経てもなお、独立国に対しその支配を維持すべく利用されているとする。\\n「新植民地主義」の語は今日における「現実の」植民地主義及び旧植民地で展開されている資本主義的事業の双方を批判の射程に入れることが多い。とりわけ多国籍企業が発展途上国の資源を搾取する構図を強調し、この経済支配が16世紀から20世紀にかけてのヨーロッパの植民地主義を髣髴とさせるとの批判がある。広義では大国による小国への内政干渉を指し、帝国主義時代の列強諸国にも似た大国の行動そのものが一種の「経済的帝国主義」と重なることを示唆する。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_in_Berlin/A","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Br%C3%BCcke_A113_Teltowkanal_Berlin_2.JPG","page_title":"Liste der Brücken in Berlin/A","context_page_description":"= in Klammern gesetzt: namenlose Brücken.\\nMusterbrücke = kursiv gesetzt: ehemalige Brücken."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%B9%D0%B3%D0%BB%D1%8C%D1%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Saint-antoine_Eygliers.jpg","page_title":"Ейгльє","context_page_description":"Ейгльє́, Ейґльє — муніципалітет у Франції, у регіоні Прованс-Альпи-Лазурний берег, департамент Верхні Альпи. Населення — 739 осіб.\\nМуніципалітет розташований на відстані близько 570 км на південний схід від Парижа, 185 км на північний схід від Марселя, 50 км на схід від Гапа."},{"page_url":"https://sq.wikipedia.org/wiki/Pallati_Drottningholm","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Kina_Slott_2007_Juni.jpg","page_title":"Pallati Drottningholm","context_page_description":"Pallati Drottningholm është një rezidencë banimi private e familjes mbretërore suedeze. Ajo është e vendosur në Drottningholm. E ndërtuar në ishull Lovön, kjo është një nga Pallatet Mbretërore të Suedisë. Ajo është ndërtuar fillimisht në fund të shekullit të XVI-të. Ajo shërbeu si një vendbanim i rregullt veror i oborrit mbretëror suedez për shumicën e shekullit të XVIII-të. Përveç qëndrimit privat të familjes mbretërore suedeze, pallati është një tërheqje turistike popullore."},{"page_url":"https://fr.wikipedia.org/wiki/Gallotia_stehlini","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Dune_di_maspalomas%2C_lagartos_14.JPG","page_title":"Gallotia stehlini","context_page_description":"Gallotia stehlini est une espèce de sauriens de la famille des Lacertidae."},{"page_url":"https://pl.wikipedia.org/wiki/Gossersweiler-Stein","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Gossersweiler-Stein.JPG","page_title":"Gossersweiler-Stein","context_page_description":"Gossersweiler-Stein – miejscowość i gmina w Niemczech, w kraju związkowym Nadrenia-Palatynat, w powiecie Südliche Weinstraße, wchodzi w skład gminy związkowej Annweiler am Trifels."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Plossen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Kapellenweg_9_Meissen.JPG","page_title":"Liste der Kulturdenkmale in Plossen","context_page_description":"Die Liste der Kulturdenkmale in Plossen enthält die Kulturdenkmale des am Plossenberg gelegenen Stadtteils Plossen der Gemarkung Meißen. Er liegt südlich der Altstadt der Kreisstadt Meißen am linken Ufer der Elbe im Landkreis Meißen. Die denkmalgeschützten Objekte wurden in der Denkmalliste vom Landesamt für Denkmalpflege Sachsen mit Stand von 2017 erfasst. Sie ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://ceb.wikipedia.org/wiki/Iruma_Ab","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Hangar_Iruma_Airbase_2006-8.jpg","page_title":"Iruma Ab","context_page_description":"Tugpahanan ang Iruma Ab sa Hapon. Nahimutang ni sa prepektura sa Saitama-ken, sa habagatan-sidlakang bahin sa nasod, 30 km sa amihanan-kasadpan sa Tokyo ang ulohan sa nasod. 89 metros ibabaw sa dagat kahaboga ang nahimutangan sa Iruma Ab.\\nAng yuta palibot sa Iruma Ab kay patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 727 ka metro ug 19.9 km sa kasadpan sa Iruma Ab. Dunay mga 7,482 ka tawo kada kilometro kwadrado sa palibot sa Iruma Ab may kaayo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Sayama, 1.2 km sa amihanan sa Iruma Ab. Hapit nalukop sa kabalayan ang palibot sa Iruma Ab.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Agosto, sa 29 °C, ug ang kinabugnawan Enero, sa 5 °C. Ang kasarangang pag-ulan 1,773 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 283 milimetro nga ulan, ug ang kinaugahan Enero, sa 59 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/Silas_Pereira","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Paulo_Silas.jpg","page_title":"Silas Pereira","context_page_description":"Paulo Silas do Prado Pereira, simply known as Paulo Silas, is a Brazilian retired footballer, who played as a central midfielder, and is a manager."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_pinardier","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Saint-Jean_d%27Aureilhan.JPG","page_title":"Château pinardier","context_page_description":"Un château pinardier est un château construit ou transformé à la fin du XIXᵉ siècle autour d'un domaine viticole de la plaine biterroise dans un rayon d'environ 25 km autour de Béziers."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%87%D1%91%D1%82%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Schoty_abacus.jpg","page_title":"Счёты","context_page_description":"Счёты — простое механическое устройство для выполнения арифметических расчётов, согласно одной версии происходят от китайского счётного приспособления суаньпань, согласно другой имеют собственно русское происхождение.\\nПредставляют собой раму, имеющую некоторое количество спиц; на них нанизаны костяшки, которых обычно по 10 штук. Счёты являются одним из ранних вычислительных устройств и вплоть до конца XX века массово использовались в торговле и бухгалтерском деле, пока их не заменили калькуляторы."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AA%E0%A4%B0%E0%A4%B8%E0%A5%82%E0%A4%95%E0%A5%8D%E0%A4%B7%E0%A5%8D%E0%A4%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/%E0%A4%B9%E0%A4%BF%E0%A4%A8%E0%A5%8D%E0%A4%A6%E0%A5%82_%E0%A4%B9%E0%A4%B8%E0%A5%8D%E0%A4%A4_%E0%A4%AA%E0%A4%B0%E0%A4%BF%E0%A4%AE%E0%A4%BE%E0%A4%A3.svg","page_title":"परसूक्ष्म","context_page_description":"परसूक्षम यह वैदिक काल की हिन्दू लम्बाई मापन की इकाई है।\\nएक परसूक्षम बराबर होता है दस परमाणुओं के।"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%A5%BF%E4%B9%9D%E9%BE%8D%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Dragon_Centre_Food_Court_20110709.jpg","page_title":"西九龍中心","context_page_description":"西九龙中心是香港的一座大型商场，位于九龙深水埗区深水埗钦州街37K，于1994年11月7日开幕。商场为全港第二座纯商场建筑，设有9层，商场总面积840,000平方英尺，及设有香港第二座室内过山车天龙过山车，其中过山车轨道架设于商场顶部，但基于安全问题，过山车已停用多年；另外更设有5层地库停车场。\\n西九龙中心自开幕以后商场内外装修风格和商店都没太大的转变。它更是全港首设“车仔档”商店的商场，为目前香港难得一见的平民化商场。商场内的扶手电梯机件部分只被透明深绿色玻璃包围，游人可窥见内里的机械运作；升降机亦采用开放式设计，教育电视《小六常识》节目甚至以本商场为示例向学生介绍齿轮和滑轮的机械原理。\\n根据发展商与持有者裕景兴业网页显示，西九龙中心是其辖下旗舰物业，其他项目有铜锣湾天后苹果商场、赤柱苹果商场、铜锣湾裕景商业中心、铜锣湾利景酒店、铜锣湾电业城、尖沙咀佐敦嘉文花园、大连裕景中心、沈阳裕景中心\\n商场多年来不时举办大型宣传活动，邀请本地和亚洲巨星参与，也举办过财政司司长曾俊华特首竞选活动、亚洲电视停播倒数等，中庭又不时设置节日布置。"},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Matval","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Atelier_mon%C3%A9taire.jpg","page_title":"Château de Matval","context_page_description":"Le château de Matval est un édifice des XIIIᵉ et XVᵉ siècles, situé à Bonneveau dans le Loir-et-Cher.\\nInscrit à l'inventaire des Monuments historiques, ses façades et toitures sont protégées par arrêté du 18 octobre 1971 et le château en totalité par arrêté du 8 avril 2009"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BD%E9%80%A3%E9%81%8B%E8%BC%B8%E7%9C%812TE116%E5%BD%A2%E3%83%87%E3%82%A3%E3%83%BC%E3%82%BC%E3%83%AB%E6%A9%9F%E9%96%A2%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/2%D0%A2%D0%AD116-1552%2C_Russia%2C_Yaroslavl_region%2C_Vaulovo_-_Chebakovo_stretch_%28Trainpix_163118%29.jpg","page_title":"ソ連運輸省2TE116形ディーゼル機関車","context_page_description":"2TE116形ディーゼル機関車は、ソ連運輸通信省が1971年から導入した電気式ディーゼル機関車である。この項目では関連する他の形式についても記す。"},{"page_url":"https://en.wikipedia.org/wiki/Buxton,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Buxton_NSW_Australia.jpg","page_title":"Buxton, New South Wales","context_page_description":"Buxton is a small village in Macarthur Region of New South Wales, Australia, in Wollondilly Shire. At the 2016 census, Buxton had a population of 2,028 people. Its name comes from the town of Buxton, Derbyshire."},{"page_url":"https://fr.wikipedia.org/wiki/Lucy-sur-Cure","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Essert-eglise1.JPG","page_title":"Lucy-sur-Cure","context_page_description":"Lucy-sur-Cure est une commune française située dans le département de l'Yonne et la région Bourgogne-Franche-Comté faisant partie de la Communauté de communes Chablis Villages et Terroirs depuis le 1er janvier 2017. Ses habitants sont appelés les Lucyats."},{"page_url":"https://sv.wikipedia.org/wiki/Psococerastis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Psococerastis_gibbosa_01.JPG","page_title":"Psococerastis","context_page_description":"Psococerastis är ett släkte av insekter som beskrevs av John Victor Pearman 1932. Psococerastis ingår i familjen storstövsländor.\\nSläktet innehåller bara arten Psococerastis gibbosa."},{"page_url":"https://sl.wikipedia.org/wiki/Severna_Makedonija","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Coat_of_arms_of_Veles_Municipality.png","page_title":"Severna Makedonija","context_page_description":"Severna Makedonija, uradno Republika Severna Makedonija, je celinska demokratična država na Balkanskem polotoku v jugovzhodni Evropi, s površino 25.333 km² in le malo več kot dvema milijonoma prebivalcev. Severna Makedonija na zahodu meji na Albanijo, na jugu na Grčijo, na vzhodu na Bolgarijo, na severozahodu na Kosovo ter na severovzhodu na Srbijo. Glavno mesto države je Skopje.\\nPo ureditvi je unitarna parlamentarna ustavna republika. Država je članica OZN, Nata, Sveta Evrope, Svetovne banke in OVSE, od leta 2005 pa tudi kandidatka za članstvo v Evropski uniji."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D0%B0%D1%81%D1%8F_%D0%9D%D0%B0%D0%BF%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Stacia_Napierkowska_1.jpg","page_title":"Стася Наперковська","context_page_description":"Ста́ся Наперко́вська — французька танцівниця та акторка епохи німого кіно. У період з 1908 до 1926 року вона знялася у 86 фільмах."},{"page_url":"https://mg.wikipedia.org/wiki/Wos","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Wos_freestyle.png","page_title":"Wos","context_page_description":"Valentín Oliva, fantatra amin'ny anarana hoe Wos, dia mpihaza sy freestyler Arzantina."},{"page_url":"https://en.wikipedia.org/wiki/Lever_rule","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Lever_rule.svg","page_title":"Lever rule","context_page_description":"The lever rule is a rule used to determine the mole fraction or the mass fraction of each phase of a binary equilibrium phase diagram. It can be used to determine the fraction of liquid and solid phases for a given binary composition and temperature that is between the liquidus and solidus line.\\nIn an alloy or a mixture with two phases, α and β, which themselves contain two elements, A and B, the lever rule states that the mass fraction of the α phase is\\nwhere\\nis the mass fraction of element B in the α phase\\nis the mass fraction of element B in the β phase\\nis the mass fraction of element B in the entire alloy or mixture\\nall at some fixed temperature or pressure."},{"page_url":"https://cs.wikipedia.org/wiki/Janovice_(Poln%C3%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Poln%C3%A1%2C_Janovice%2C_old_farm.jpg","page_title":"Janovice (Polná)","context_page_description":"Janovice jsou nejvzdálenější částí města Polná. Nachází se na české straně historické zemské hranice Čech a Moravy asi se 5 km východně od Polné v okrese Jihlava v Kraji Vysočina."},{"page_url":"https://fr.wikipedia.org/wiki/Bandon_(Oregon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Bandon_Rocks_and_Sky_%285841997453%29.jpg","page_title":"Bandon (Oregon)","context_page_description":"Bandon est une municipalité américaine du comté de Coos en Oregon. Lors du recensement de 2010, sa population est de 3 066 habitants."},{"page_url":"https://hu.wikipedia.org/wiki/Pruniers-en-Sologne","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Population_-_Municipality_code_41185.svg","page_title":"Pruniers-en-Sologne","context_page_description":"Pruniers-en-Sologne település Franciaországban, Loir-et-Cher megyében. Pruniers-en-Sologne Billy, Gièvres, Gy-en-Sologne, Lassay-sur-Croisne, Mur-de-Sologne, Romorantin-Lanthenay, Selles-sur-Cher, Veilleins és Villefranche-sur-Cher községekkel határos."},{"page_url":"https://en.wikipedia.org/wiki/Brass_band","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Brassband.jpg","page_title":"Brass band","context_page_description":"A brass band is a musical ensemble generally consisting entirely of brass instruments, most often with a percussion section. Ensembles that include brass and woodwind instruments can in certain traditions also be termed brass bands, but may more correctly termed military bands, concert bands, or \\"brass and reed\\" bands."},{"page_url":"https://en.wikipedia.org/wiki/Jo%C3%A3o_Gomes_J%C3%BAnior","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Jo%C3%A3o_Gomes_J%C3%BAnior_Rio_2016b.jpg","page_title":"João Gomes Júnior","context_page_description":"João Luiz Gomes Júnior is a Brazilian breaststroke swimmer."},{"page_url":"https://pt.wikipedia.org/wiki/Toyota_Corolla","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/1991_Toyota_Corolla_GL_1.3.jpg","page_title":"Toyota Corolla","context_page_description":"O Toyota Corolla é um modelo compacto da Toyota oferecido em versões sedan, hatchback e perua. Também é o modelo mais vendido da história, com produção nos cinco continentes e vendas totais superiores a 39 milhões de automóveis desde seu lançamento em 1966.\\nSeu nome provém do Latim e o significado é “Coroa de Flores”, que por sua vez significam felicidade e triunfo. No Brasil o nome do veículo tem sido remetido por muitos como “Carro de Coroa”, em alusão sobretudo ao perfil dos seus compradores: pessoas mais velhas. Ao adotar este nome a Toyota manteve uma tradição da época em que muitos dos nomes dos seus carros começavam por “C” – Crown, Corona, Carina, Century, Celica, Camry etc. – Apesar da Toyota já não utilizar esta estratégia para dar nomes aos carros, nomes como o Yaris, Auris, Avalon, Etios e Avensis, todos eles derivam ainda do Latim."},{"page_url":"https://sv.wikipedia.org/wiki/Sannazzaro_de%27_Burgondi","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Sannazzaro_parrocchiale.jpg","page_title":"Sannazzaro de' Burgondi","context_page_description":"Sannazzaro de' Burgondi är en ort och kommun i provinsen Pavia i regionen Lombardiet i Italien. Kommunen hade 5 414 invånare."},{"page_url":"https://eu.wikipedia.org/wiki/Tragikomedia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Tragic_comic_masks_-_roman_mosaic.jpg","page_title":"Tragikomedia","context_page_description":"Tragikomedia osagai tragikoak eta komikoak dituen antzezlana da.\\nPlauto antzerkigile erromatarrak erabili zuen hitza lehenengo aldiz, K.a. II. mendean. Haren lanetan jainkoei eta gizonei, nagusiei eta zerbitzariei ohikoak ez zituzten zereginak eta ezaugarriak egozten zitzaizkien. Jainkoak eta heroiak irrigarriak ziren eta zerbitzariak duintasun handikoak. Errenazimentuan, tragikomediak osagai tragikoak erantsi zizkion batez ere komikoa zen dramari. B. Guarini idazle italiarrak tragikomediak tragediaren osagai gehienak dituela esan zuen: hizketa serioa, gertaera garrantzitsuen aurkezpena, eta erruki sentipena, baina tragedietako amaierara iritsi gabe, eta osagai komikoak, pertsonaia irrigarriak, barreak eta keinuak erabiltzen dituela. Arriskua, atsekabeak eta amaiera zoriontsua dira ezaugarri nagusiak. Neoklasizismoak genero nahasketak onartzen ez zituen arren, garai horretan Ingalaterran arrakasta handia izan zuten tragikomediek. XIX. mendeko idazle erromantikoek Shakespeareren tragikomediak hartu zituzten eredutzat. Mende horren bukaeran errealismo garaian idatzitako lanetan, H. Ibsen-en, Gengangere, tragikomediaren bi osagaiak are gehiago nahasi ziren."},{"page_url":"https://pl.wikipedia.org/wiki/Crouay","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/FranceNormandieCrouayEglise.jpg","page_title":"Crouay","context_page_description":"Crouay – miejscowość i gmina we Francji, w regionie Normandia, w departamencie Calvados.\\nWedług danych na rok 1990 gminę zamieszkiwały 444 osoby, a gęstość zaludnienia wynosiła 57 osób/km²."},{"page_url":"https://ca.wikipedia.org/wiki/Coulomb_(cr%C3%A0ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Normal_coulomb-large.jpg","page_title":"Coulomb (cràter)","context_page_description":"Coulomb és un cràter d'impacte que es troba darrere de l'extremitat nord-oest, en la cara oculta de la Lluna, a l'oest-sud-oest del gran cràter Poczobutt, i al nord-est de Sarton.\\nLa vora d'aquest cràter apareix lleugerament erosionada, però manté encara una contorn ben definit i mostra alguns terraplenats antics en les seves amples parets interiors. L'exterior del cràter també conserva algunes rampes exteriors, que s'estenen al voltant d'un terç del diàmetre del cràter. El cràter satèl·lit Coulomb V se situa just més enllà de l'extremitat oest-nord-oest, mentre que en el costat oposat Coulomb J es troba a poca distància de la vora exterior, formant un patró gairebé simètric. Les parets internes del cràter mostren només uns petits impactes, cadascun d'ells propers als dos cràters satèl·lit abans esmentats.\\nDins de les parets internes inclinades, el sòl del cràter està notablement a nivell i gairebé sense trets distintius, almenys en comparació del terreny més consistent que envolta al cràter. Només uns pocs cràters minúsculs marquen aquesta plana interior, amb un petit cràter prop de la paret interior sud-sud-est."},{"page_url":"https://cs.wikipedia.org/wiki/Trolejbusov%C3%A1_doprava_v_%C3%9Ast%C3%AD_nad_Labem","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/13-07-28-%C3%9Ast%C3%AD-38.jpg","page_title":"Trolejbusová doprava v Ústí nad Labem","context_page_description":"V krajském městě Ústí nad Labem funguje trolejbusová síť, kterou provozuje Dopravní podnik města Ústí nad Labem."},{"page_url":"https://en.wikipedia.org/wiki/Roberto_Fonseca","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Roberto_Fonseca.JPG","page_title":"Roberto Fonseca","context_page_description":"Roberto Fonseca is a Cuban jazz pianist. From an early age, Fonseca was surrounded by music: his father was drum player Roberto Fonseca, Sr, his mother, Mercedes Cortes Alfaro, a professional singer, and his two older half-brothers from his mother's previous marriage to the pianist and musician Jesús \\"Chucho\\" Valdés are Emilio Valdés and Jesús \\"Chuchito\\" Valdés Jr."},{"page_url":"https://sh.wikipedia.org/wiki/Clearwater,_South_Carolina","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/SCMap-doton-Clearwater.PNG","page_title":"Clearwater, South Carolina","context_page_description":"Klirvoter je naseljeno mesto bez administrativnog statusa u američkoj saveznoj državi Južna Karolina."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D1%81%D0%BA%D0%B8_%D0%B0%D1%80%D1%85%D0%B5%D0%BE%D0%BB%D0%BE%D0%B3%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B8_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Macedonian_Museums-22-Arx_Serrvn-107.jpg","page_title":"Серски археологически музей","context_page_description":"Серският археологически музей е музей в южномакедонския град Сяр, Гърция. Музеят е разположен в сградата на Серския безистен и излага находки от всички исторически периоди от Сяр и Серско.\\nМузеят е създаден в 1968 година. Праисторическите експонати са от разкопки край Драготин и Крионери. Изложени са и архаични, класически, елинистически и римски експонати, предимно керамика и надписи от Аргилос, главния град на Висалтия, Копач, Черпища, Кешишлък, Порна, античния Трагилос и Сяр. Особено ценни са раннохристиянските и византийските експонати от Сяр, особено мраморната икона на Христос и мозайката от XII век с Апостол Андрей и двете от Старата катедрала."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A7%E0%A5%8C%E0%A4%B2%E0%A5%80%E0%A4%A8%E0%A4%BE%E0%A4%97_%E0%A4%AE%E0%A4%82%E0%A4%A6%E0%A4%BF%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Dhaulinag_01.jpg","page_title":"धौलीनाग मंदिर","context_page_description":"धौलीनाग मंदिर उत्तराखण्ड राज्य के बागेश्वर जनपद में धौलीनाग देवता को समर्पित एक पुराना मंदिर है। धौलीनाग मंदिर विजयपुर के पास एक पहाड़ी के शीर्ष पर स्थित है। धौलीनाग मंदिर मे रोजाना पूजा होती है और कुछ खास दिनों मे बहुत भीड़-भाड़ होती है, मुख्य रूप से नवरात्रि के दौरान तो यह भक्तों से भरा रहता है। प्रत्येक नाग पंचमी को मंदिर में मेला लगता है। नवंबर २०१६ में उत्तराखण्ड के तत्कालीन मुख्यमंत्री, हरीश रावत ने इस मंदिर को गंगोलीहाट के महाकाली मंदिर और पाताल भुवनेश्वर से पर्यटन सर्किट द्वारा जोड़ने की घोषणा की थी।"},{"page_url":"https://en.wikipedia.org/wiki/George_Lawley_%26_Son","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/1917_USS_Cigarette_Boston_H99913.jpg","page_title":"George Lawley & Son","context_page_description":"George Lawley & Son was a shipbuilding firm operating in Massachusetts from 1866 to 1945. It began in Scituate, then moved to Boston. After founder George Lawley retired in 1890, his son, grandson and great-grandson upheld the business, which continued until 1945. Of the hundreds of ships built by the Lawleys, highlights include the yachts Puritan and Mayflower, respective winners of the 1885 and 1886 America's Cup."},{"page_url":"https://en.wikipedia.org/wiki/Manuel_Earnshaw","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/ManuelEarnshaw.jpg","page_title":"Manuel Earnshaw","context_page_description":"Manuel Earnshaw was a Resident Commissioner of the Philippines."},{"page_url":"https://fr.wikipedia.org/wiki/Wikip%C3%A9dia_en_esp%C3%A9ranto","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/2008-07-02_co_informilo.JPG","page_title":"Wikipédia en espéranto","context_page_description":"La Wikipédia en espéranto a été créée le 6 novembre 2001, par Chuck Smith, un espérantophone américain. Elle a franchi le cap des 50 000 articles le 7 juillet 2006, celui des 100 000 articles le 15 juin 2008, celui des 150 000 articles le 7 aout 2011, celui des 200 000 articles le 13 aout 2014 et celui des 250 000 articles le 18 septembre 2018. Il s'agit de la plus importante Wikipédia écrite dans une langue construite, devant la Wikipédia en volapük et la Wikipédia en ido. C'est l'un des principaux sites internet en espéranto."},{"page_url":"https://de.wikipedia.org/wiki/Soyaux","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/58/Soy_eg6.JPG","page_title":"Soyaux","context_page_description":"Soyaux ist eine Gemeinde mit 9356 Einwohnern im westfranzösischen Département Charente in der Region Nouvelle-Aquitaine."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%88%D9%8A%D8%AA_%D9%83%D9%84%D9%8A%D9%86%D8%AA%D9%88%D9%86_%D8%B1%D8%A7%D9%85%D8%B2%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Adm_ramsey.jpg","page_title":"ديويت كلينتون رامزي","context_page_description":"ديويت كلينتون رامزي ‏ هو ضابط أمريكي، ولد في 2 أكتوبر 1888 في Fort Whipple في الولايات المتحدة، وتوفي في 7 سبتمبر 1961 في فيلادلفيا في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/House_of_Zhu","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/%E6%98%8E%E4%BB%81%E5%AE%97.jpg","page_title":"House of Zhu","context_page_description":"The House of Zhu, also known as the House of Chu, was the imperial family of the Ming dynasty of China. Zhu was the family name of the emperors of the Ming dynasty. The House of Zhu ruled China from 1368 until the fall of the Ming dynasty in 1644, followed by the rule as the Southern Ming dynasty until 1662, and the last Ming princes, the Prince of Ningjing Zhu Shugui and Prince Zhu Honghuan held out until the annexation of the Kingdom of Tungning in 1683."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%90%D7%A8%D7%95%D7%9F_%D7%A4%D7%95%D7%A7%D7%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/20160330_MCDAAG_De%27Aaron_Fox_at_the_top_of_the_key.jpg","page_title":"דיארון פוקס","context_page_description":"דיארון פוקס הוא כדורסלן אמריקאי, המשחק בעמדת הרכז בסקרמנטו קינגס מליגת ה-NBA."},{"page_url":"https://es.wikipedia.org/wiki/Hermanos_Coen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Veronica_Lake_and_Joel_McCrea_in_Sullivan%27s_Travels_trailer.jpg","page_title":"Hermanos Coen","context_page_description":"Joel David Coen e Ethan Jesse Coen, ​ conocidos profesionalmente como los hermanos Coen, son dos cineastas estadounidenses ganadores de cuatro Premios Óscar, dos BAFTA y un Globo de Oro, entre otros reconocimientos. Entre su filmografía se destacan títulos como Miller's Crossing, Barton Fink, Fargo, El gran Lebowski, O Brother, Where Art Thou?, The Man Who Wasn't There, No Country for Old Men y True Grit.\\nSus inicios en la industria del cine se remontan a principios de los años 1980, cuando Joel trabajaba como asistente de montaje en películas de terror de bajo presupuesto​ e Ethan colaboraba como guionista en la serie policiaca Cagney & Lacey.​ Mientras tanto empezaron a escribir el guion del que fue su debut como directores, el thriller neo-noir Blood Simple, cuyo modesto éxito en la taquilla y a nivel crítico logró abrirles el camino y los dio a conocer como parte de una nueva generación de directores independientes.​ Desde entonces han trabajado en conjunto para escribir, producir, dirigir y montar sus propios filmes. Debido a su tendencia a colaborar juntos y su similar visión artística, se ha hecho referencia a ellos como el «director bicéfalo» —two-headed director—.​"},{"page_url":"https://en.wikipedia.org/wiki/Mary_J._L._Black","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Mary_J.L._Black_c.1921.jpg","page_title":"Mary J. L. Black","context_page_description":"Mary Johanna Louisa Black, or Mary J. L. Black as she is often known, was a Canadian librarian and suffragist. Black was the president of the Ontario Library Association from 1917 to 1918 and was a member of the American Library Association."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%BE%B7%E5%9C%8B%E5%9C%8B%E5%AE%B6%E5%85%83%E9%A6%96%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Frank-Walter_Steinmeier_Feb_2014_%28cropped%29.jpg","page_title":"德國國家元首列表","context_page_description":"下表顯示各年代德國國家元首："},{"page_url":"https://en.wikipedia.org/wiki/Aphanius","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Aphanius_fasciatus_male.jpg","page_title":"Aphanius","context_page_description":"Aphanius is a genus of pupfishes. Unlike other members of the family which are from the Americas, Aphanius species are native to northern Africa, southwestern Asia and southern Europe. Several species in the genus have very small distributions and are seriously threatened."},{"page_url":"https://fr.wikipedia.org/wiki/Jack_Warner_(homme_politique)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Jack_warner_football_executive.jpg","page_title":"Jack Warner (homme politique)","context_page_description":"Jack Warner, né Austin Warner le 26 janvier 1943 à Rio Claro, est un homme politique, un homme d'affaires et un administrateur sportif trinidadien."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%B7%D0%B0%D0%B7%D0%B0%D0%B2%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/GlobidensDB2.jpg","page_title":"Мозазавры","context_page_description":"Мозазавры — семейство вымерших морских ящериц из надсемейства мозазавроидей. Довольно близкие родственники современных варанов.\\nПервые ископаемые остатки мозазавров были найдены в известняковом карьере в Маастрихте на Маасе в 1764 году. В настоящее время ископаемые остатки представителей этого семейства уже были обнаружены на всех континентах, включая Антарктиду.\\nМозазавры представляли собой большую группу верхнемеловых морских рептилий, главным образом хищников крупных или средних размеров. Большинство известных видов населяло тёплые, мелководные моря, широко распространённые в позднем меловом периоде. В силу своей специализации, мозазавры очень сильно отличались от современных ящериц: строение их внутренних органов больше напоминало таковое у китообразных, они были живородящими, имели высокие темпы обмена веществ и были теплокровными.\\nМозазавры, вероятно, произошли от вымершего семейства водных ящериц айгиалозаврид. В течение последних 20 млн лет мелового периода мозазавры вытеснили всех своих конкурентов в лице крупных ламнообразных акул и последних плиозавров, и стали доминирующими морскими хищниками своего времени."},{"page_url":"https://nl.wikipedia.org/wiki/Mastophora_phrynosoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Bolas_Spider%2C_Mastophora_phrynosoma_-_Julie_Metz_Wetlands%2C_Woodbridge%2C_Virginia.jpg","page_title":"Mastophora phrynosoma","context_page_description":"Mastophora phrynosoma is een spinnensoort in de taxonomische indeling van de wielwebspinnen.\\nHet dier behoort tot het geslacht Mastophora. De wetenschappelijke naam van de soort werd voor het eerst geldig gepubliceerd in 1955 door Willis J. Gertsch."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9F%8E%E5%B8%82%E7%BE%8E%E5%8C%96%E8%BF%90%E5%8A%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/FieldMuseum.jpg","page_title":"城市美化运动","context_page_description":"城市美化运动是1890年代和1900年代在北美洲达到繁荣的建筑和城市规划领域的进步主义改革运动，意图在城市进行美化，兴建宏伟的纪念碑式建筑。这一运动最初主要涉及芝加哥、底特律和华盛顿哥伦比亚特区，旨在在城市居民中建立公民道德的共同利益，运动的支持者认为这样的美化可以促进和谐的社会秩序，提高生活质量，有助于消除社会弊病。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B7%E3%83%80%E3%83%9E%E7%9C%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Map_of_Sidama_Zone.png","page_title":"シダマ県","context_page_description":"シダマ県は、エチオピア・南部諸民族州の県のひとつ。県庁所在地はアワッサであるが、行政上は独立した特別市とされている。人口約30万人、約35万人。南部諸民族州では最大の民族であるシダマ人が多く住む。\\n2019年11月20日に実施された住民投票によって、州へ昇格することが決定。2020年6月18日に南部諸民族州議会はシダマ州への権限移譲を決定した。"},{"page_url":"https://no.wikipedia.org/wiki/Christie","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Nils_Christie_at_Third_Annual_Death_Penalty_Symposium_2007_%28cropped%29.jpg","page_title":"Christie","context_page_description":"Christie er en skotsk slekt med en norsk gren med mange fremtredende medlemmer. Navnet kom til Norge på 1600-tallet med brødrene Andrew Davidson Christie og David Christie fra kystbyen Montrose i Skottland.\\nSlektsvåpenet med andreaskors og stjerner i skjoldet, har vært ført i slekten helt fra innvandreren. Våpenet finnes blant annet i eidsvollsmannens segl på Grunnloven 17. mai 1814.\\nNavnet er opprinnelig et patronymikon, som betyr «Christians sønn» eller «Christoffers sønn»."},{"page_url":"https://nl.wikipedia.org/wiki/Scutosaurus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Scutosaurus_BW.jpg","page_title":"Scutosaurus","context_page_description":"Scutosaurus is een geslacht van reptielen uit de familie Pareiasauridae met als enige soort Scutosaurus karpinski. Deze leefde tijdens het Laat-Perm. Vondsten van dit primitieve reptiel zijn bekend uit Rusland.\\nScutosaurus karpinski was ongeveer 2.5 meter lang met een grote kop, een zwaargebouwd lichaam en een dik huidpantser. Het was een herbivoor en Scutosaurus karpinski leefde in een groep, wat blijkt uit de vondst van meerdere exemplaren op dezelfde locatie. Scutosaurus karpinski en verwante pareiasauriërs werden bejaagd door gorgonopisiërs, grote vleesetende reptielen met Inostrancevia als bekendste voorbeeld uit Rusland."},{"page_url":"https://en.wikipedia.org/wiki/Chinese_armour","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/Han_pottery_figurines_02.jpg","page_title":"Chinese armour","context_page_description":"Chinese armour was predominantly lamellar from the Warring States period onward, prior to which animal parts such as rhinoceros hide, rawhide, and turtle shells were used for protection. Lamellar armour was supplemented by scale armour since the Warring States period or earlier. Partial plate armour was popular from the Northern and Southern dynasties, and mail and mountain pattern armour from the Tang dynasty. Chain mail had been known since the Han Dynasty, but did not see widespread production or battlefield use, and may have seen as \\"exotic foreign armor\\" used as a display of wealth for wealthier officers and soldiers. During the Ming dynasty, brigandine began to supplant lamellar armour and was used to a great degree into the Qing dynasty. By the 19th century most Qing armour, which was of the brigandine type, were purely ceremonial, having kept the outer studs for aesthetic purposes, and omitted the protective metal plates."},{"page_url":"https://en.wikipedia.org/wiki/Novel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Dan_Brown_bookjacket_cropped.jpg","page_title":"Novel","context_page_description":"A novel is a relatively long work of narrative fiction, normally written in prose form, and which is typically published as a book. The present English word for a long work of prose fiction derives from the Italian: novella for \\"new\\", \\"news\\", or \\"short story of something new\\", itself from the Latin: novella, a singular noun use of the neuter plural of novellus, diminutive of novus, meaning \\"new\\".\\nSome novelists, including Nathaniel Hawthorne, Herman Melville, Ann Radcliffe, John Cowper Powys, preferred the term \\"romance\\" to describe their novels.\\nAccording to Margaret Doody, the novel constitutes \\"a continuous and comprehensive history of about two thousand years\\", with its origins in the Ancient Greek and Roman novel, in Chivalric romance, and in the tradition of the Italian renaissance novella. The ancient romance form was revived by Romanticism, especially the historical romances of Walter Scott and the Gothic novel. Some, including M. H. Abrams and Walter Scott, have argued that a novel is a fiction narrative that displays a realistic depiction of the state of a society, while the romance encompasses any fictitious narrative that emphasizes marvellous or uncommon incidents."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/%D0%9A%D1%80%D0%B5%D0%BC%D0%BB%D1%8C_-_panoramio_%2821%29.jpg","page_title":"Кремль","context_page_description":"Кремль — укреплённое ядро исторического русского города, центральная и наиболее древняя его часть. Слово «кремль» с XIV века получило распространение в Северо-Восточной Руси, постепенно заменив первоначальное название детинец. В топографии древнерусских городов к обнесённому крепостной стеной кремлю-детинцу в большинстве случаев примыкали один или два более крупных по площади окольных города, которые также были укреплены. Неукреплённые части города назывались посадами.\\nВ кремле, как правило, находился княжеский дворец, главные каменные храмы, усадьбы феодальной знати и ремесленные мастерские, обслуживавшие княжеский двор. Для повышения обороноспособности кремли пытались строить с учётом естественных топографических преимуществ — на мысах у слияния двух рек, на возвышенностях и т. д.\\nКремлями иногда неправильно называют некоторые крепостные сооружения, которые в Древней Руси изначально создавались не в качестве городских укреплений, а как пограничные военные форпосты; кремлями именовались отдельные монастыри, например, Соловецкий."},{"page_url":"https://pl.wikipedia.org/wiki/Esporlatu","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Esporlatu%2C_panorama_%2802%29.jpg","page_title":"Esporlatu","context_page_description":"Esporlatu – miejscowość i gmina we Włoszech, w regionie Sardynia, w prowincji Sassari. Graniczy z Bottidda, Burgos i Illorai.\\nWedług danych na rok 2004 gminę zamieszkiwało 475 osób, 26,4 os./km²."},{"page_url":"https://pt.wikipedia.org/wiki/Obelisco_de_Parna%C3%ADba","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Obelisco_Jo%C3%A3o_Arag%C3%A3o.jpg","page_title":"Obelisco de Parnaíba","context_page_description":"O Obelisco de Parnaíba é um monumento erigido pelo município de Parnaíba, no estado brasileiro do Piauí, em 1944, em comemoração pela passagem do primeiro centenário do município."},{"page_url":"https://en.wikipedia.org/wiki/AGH_University_of_Science_and_Technology","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Agh_cracow_ceramics_faculty.JPG","page_title":"AGH University of Science and Technology","context_page_description":"AGH University of Science and Technology is a technical university in Poland, located in Kraków. The university was established in 1919, and was formerly known as the University of Mining and Metallurgy. It has 15 faculties and one school, which will become a faculty in the near future."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%84%9B%E7%AB%8B%E4%BF%A1%E7%90%83%E5%BD%A2%E9%AB%94%E8%82%B2%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Globen_okt_2014a.jpg","page_title":"愛立信球形體育館","context_page_description":"爱立信球形体育馆是位于瑞典斯德哥尔摩的体育馆，属于斯德哥尔摩球形都市的成员。"},{"page_url":"https://tr.wikipedia.org/wiki/Benito_Ju%C3%A1rez,_Meksiko","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Logobenitojuarezdf.jpg","page_title":"Benito Juárez, Meksiko","context_page_description":"Benito Juárez, Meksika'nın başkenti Meksiko'nun 16 beldesinden biri. Şehrin tarihi merkezinin güneyinde yer almakta olup, hemen hemen tamamı yerleşim bölgesidir. Kuzeyde Miguel Hidalgo ve Cuauhtémoc, doğuda Iztacalco ve Iztapalapa, güneyde Coyoacán, batıda ve güneybatıda ise Álvaro Obregón beldeleriyle sınırı bulunmaktadır. 26,63 km²lik yüzölçümüyle alan bakımından şehrin en küçük ikinci beldesi olan Benito Juárez'in nüfusu, 2010 sayımına göre 355.017 kişidir ve nüfus bakımından Meksiko'nun beldeleri arasında 14. sırada yer almaktadır."},{"page_url":"https://en.wikipedia.org/wiki/Bar%C4%B1%C5%9F_Atik","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Baris-atik.jpg","page_title":"Barış Atik","context_page_description":"Barış-Fahri Atik is a Turkish footballer who plays as a midfielder for Dynamo Dresden."},{"page_url":"https://fr.wikipedia.org/wiki/Course_d%27orientation","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/36/World_Orienteering_Championships_2010_-_relay_11.jpg","page_title":"Course d'orientation","context_page_description":"La course d’orientation est un sport de pleine nature qui se pratique avec une carte et une boussole, et un système de gestion chronométrique électronique pour les courses officielles et qui se déroule en forêt ou en ville de jour ou de nuit. La forme traditionnelle est une course à pied de type tout terrain mais d’autres formes de course d’orientation sont nées au fil des années, notamment à VTT et à ski. Une personne pratiquant cette activité est appelée un orienteur ou une orienteuse. Ce sport est géré par l'International Orienteering Federation."},{"page_url":"https://it.wikipedia.org/wiki/James_Archer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/The_Death_of_King_Arthur.jpg","page_title":"James Archer","context_page_description":"James Archer è stato un pittore britannico.\\nI suoi lavori più conosciuti sono i ritratti in costume, le scene medioevali e dipinti di ambientazione arturiana."},{"page_url":"https://it.wikipedia.org/wiki/Capo_Spear","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Cape_Spear%2C_NL%2C_Canada.JPG","page_title":"Capo Spear","context_page_description":"Il capo Spear è il punto più orientale del Canada e dell'America del Nord. Si trova nella provincia di Terranova e Labrador, sulla penisola di Avalon, a 11 chilometri dal capoluogo Saint John's. È più vicino a Parigi che a Vancouver."},{"page_url":"https://hu.wikipedia.org/wiki/I._Areusz_sp%C3%A1rtai_kir%C3%A1ly","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Areus_I_King_of_Sparta.jpg","page_title":"I. Areusz spártai király","context_page_description":"I. Areusz spártai király, Akrotatosz Agiada herceg fia, II. Kleomenész spártai király unokája. Nagyapja halálát követően, Kr. e. 309-ben lépett Spárta Agiada trónjára.\\nUralkodása alatt, Kertész István történész szerint megfigyelhető a dinasztikus eszme erősödése Spártában, amely arra utal, hogy a városállam kezdett hellenisztikus királysággá alakulni.\\nKr. e. 281-ben a II. Antigonosz makedón király elleni görögországi felkelést vezette, később pedig már Antigonosszal szövetségben Épeirosz ellen harcolt. Kr. e. 272-ben felmentette a Pürrhosz ostromolta Spártát. Kr. e. 267-ben összefogott Athénnal a makedón uralkodó ellen, ám az úgynevezett khemónidészi háborúban vezérlete alatt Spárta vereséget szenvedett, Areusz király pedig Korinthosznál esett el."},{"page_url":"https://en.wikipedia.org/wiki/Alabama_High_School_Athletic_Association","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/AHSAA_logo.PNG","page_title":"Alabama High School Athletic Association","context_page_description":"The Alabama High School Athletic Association, based in Montgomery, is the governing body for interscholastic athletics and activities programs for public schools in Alabama.\\nThe AHSAA is a member National Federation of State High School Associations since 1924.\\nThe AHSAA merged with the Alabama Interscholastic Athletic Association in 1968, forming one high school athletic association for the State of Alabama in accordance with a court order relating to athletics. The AIAA had previously governed athletics at segregated African-American schools.\\nThe AHSAA sponsors state championships programs in 13 boys and 13 girls sports: Baseball, Softball, Basketball, Football, Cross Country, Soccer, Swimming and Diving, Track and Field, Tennis, Volleyball, Wrestling, Cheerleading and Indoor Track.\\nWhile the AHSAA is the primary sanctioning organization for high school sports in Alabama, it is not the only such organization. The Alabama Independent School Association sanctions athletics for approximately 40 private schools throughout the state."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D0%B9%D0%B7%D0%B5%D0%BD%D1%88%D1%82%D0%B5%D0%B9%D0%BD,_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB_%D0%9E%D1%81%D0%B8%D0%BF%D0%BE%D0%B2%D0%B8%D1%87","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Alberta_iela_6_04.JPG","page_title":"Эйзенштейн, Михаил Осипович","context_page_description":"Михаи́л О́сипович Эйзенште́йн — русский архитектор и гражданский инженер, один из корифеев рижского модерна, директор департамента путей сообщения Лифляндской губернской управы, отец реформатора советского киноискусства Сергея Михайловича Эйзенштейна."},{"page_url":"https://en.wikipedia.org/wiki/Argentine_conger","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Conger_orbignianus.jpg","page_title":"Argentine conger","context_page_description":"The Argentine conger is a conger of the family Congridae. It is widespread in the Western Atlantic ocean from Rio de Janeiro in Brasil to the Bonaelensis area in north Argentina. In the Eastern Atlantic it is known only as larvae from the southern Gulf of Guinea from Annobon to Mossamedes. Marine demersal fish, up to 1.12 m length."},{"page_url":"https://fr.wikipedia.org/wiki/Trolleybus_de_Limoges","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Irisbus_Cristalis_ETB_12_n%C2%B0110_TCL_Place_Carnot.jpg","page_title":"Trolleybus de Limoges","context_page_description":"Le trolleybus de Limoges est un système de transports en commun de l'agglomération de Limoges.\\nLe réseau de trolleybus a été créé à Limoges à partir de 1943, en supprimant progressivement, jusqu'en 1951, les lignes de l'ancien tramway de Limoges. La ville a depuis toujours été fidèle à la traction électrique et les lignes ont été allongées au cours du temps. Limoges est une des trois dernières villes françaises à conserver un réseau de trolleybus, avec Lyon et Saint-Étienne.\\nEn 2012, on compte 32,5 km de lignes électrifiées soit 130 km de câbles. La tension du réseau est de 750 V courant continu. Les 5 lignes de trolleybus représentent environ 53 % des personnes transportées et le tiers des kilomètres parcourus sur le réseau."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A3%D1%80%D0%B0%D1%9E%D0%BD%D0%B5%D0%BD%D0%BD%D1%96_%D0%9C%D0%B0%D0%BA%D1%81%D0%B2%D0%B5%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Induction1.jpg","page_title":"Ураўненні Максвела","context_page_description":"Ураўне́нні Ма́ксвела — сістэма ўраўненняў у дыферэнцыяльнай або інтэгральнай форме, якія апісваюць электрамагнітнае поле і яго сувязь з электрычнымі зарадамі і токамі ў вакууме і суцэльных асяроддзях. Разам з выразам для сілы Лорэнца, што задае меру ўздзеяння электрамагнітнага поля на зараджаныя часціцы, ураўненні Максвела ўтвараюць поўную сістэму ўраўненняў класічнай электрадынамікі, якую часам называюць ураўненнямі Максвела — Лорэнца. Ураўненні, сфармуляваныя Джэймсам Клеркам Максвелам на аснове назапашаных к сярэдзіне XIX стагоддзя эксперыментальных вынікаў, адыгралі ключавую ролю ў развіцці ўяўленняў тэарэтычнай фізікі і аказалі моцны, у некаторых выпадках вырашальны, уплыў не толькі на ўсе вобласці фізікі, непасрэдна звязаныя з электрамагнетызмам, але і на многія пазнейшыя фундаментальныя тэорыі, прадмет якіх не зводзіўся да электрамагнетызму."},{"page_url":"https://nn.wikipedia.org/wiki/Tidvatn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Tide_overview.svg","page_title":"Tidvatn","context_page_description":"Tidvatn er ei nemning på at nivået på havet stig og senker seg i høve til land. Det er mest månen, men og sola, si tiltrekkingskraft som skaper fenomenet.\\nFjøre sjø eller lågvatn er når vatnet er på sitt lågaste. Flod, og kalla høgvatn, er når tidvatnet er på sitt høgste. Ei vasslinje ved gjennomsnittleg flod vert kalla eit flomål. Når ein går frå flod til fjøre vert det kalla ebbe. Tidsrommet mellom to høgvatn eller to lågvatn i norske kystområder er kring 12 timer og 25 min, dvs. eit halvt månedøgn. Dei største vekslingane i vasstanden skjer omtrent ved ny- og fullmåne og ca. 71/4 dagar før og etter springflod har ein den minste vekslinga i vasstanden. Dei største vekslingane vert kalla spring, som springflod og springfjøre. Overgangen frå flo eller frå fjøre vert kalla straumkantring eller straumkentring.\\nI innhav og innsjøar er tidvatnet som regel heilt ubetydeleg.\\nKombinasjonen av flod og kraftig vind, gjerne saman med eit kraftig lågtrykk, kan gje stormflod. Då når floda enda høgare enn normal springflod og kan skapa flaum. I ekstreme tilfelle har slik flaum gjort stor skade."},{"page_url":"https://it.wikipedia.org/wiki/Coit_Tower","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/05/Looking_up_at_Coit_Tower.jpg","page_title":"Coit Tower","context_page_description":"La Coit Tower è una torre che si trova a San Francisco, California, Stati Uniti. Fu costruita tra 1933 e 1938 a Pioneer Park sulla cima Telegraph Hill con un lascito di Lillie Hitchcock Coit.\\nContrariamente all'opinione comune la torre non fu progettata con l'intento di ricordare una lancia antincendio. Questa convinzione resiste in parte per l'affinità di Lillie Hitchcock Coit ai pompieri di San Francisco dell'epoca, in particolare con la Knickerbocker Engine Company Number 5. Benché gli architetti abbiano dichiarato di non avere in mente alcun progetto precedente, all'epoca in Europa nacquero centrali elettriche dagli intenti estetici che potrebbero essere viste come prototipi.\\nLa torre in stile Art déco, alta 64 metri in cemento armato non dipinto, fu progettata dagli architetti Arthur Brown, Jr. e Henry Howard con le pitture murali di 26 diversi artisti e numerosi assistenti."},{"page_url":"https://is.wikipedia.org/wiki/Mannakorn","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Mannakorn_-_Gegnum_t_ina_-framogbak-1000x445x24_-72DPI-Kristj_n_Kristj_nsson.jpg","page_title":"Mannakorn","context_page_description":"Mannakorn er íslensk popphljómsveit, sem gaf út sína fyrstu plötu 1975. Orðið Mannakorn kemur úr biblíunni og þýðir brauð af himnum eða orð guðs.\\nKjölfesta hljómsveitarinnar þá voru þeir:\\nMagnús Eiríksson, aðal laga- og textahöfundur, sem lék á ýmsar gerðir gítara og söng.\\nPálmi Gunnarsson, bassleikari og aðalsöngvari.\\nBaldur Már Arngrímsson, gítar, slagverk og söngur.\\nBjörn Björnsson, trommur og söngur.\\nAuk þeirra var Vilhjálmur Vilhjálmsson gestasöngvari á plötunni ásamt Úlfari Sigmarssyni á píanó.\\nÁ fyrstu plötunni voru 12 lög og textar, flest/ir eftir Magnús nema Lilla Jóns sem er eftir Ray Sharp og Jón Sigurðsson og svo texti við Hudson Bay eftir Stein Steinarr."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%9F,_%D7%9E%D7%9C%D7%9B%D7%AA_%D7%91%D7%A8%D7%99%D7%98%D7%A0%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Wissing%2C_Willem_-_Queen_Anne%2C_1687.jpg","page_title":"אן, מלכת בריטניה","context_page_description":"אן, מלכת בריטניה הייתה מלכת אנגליה, סקוטלנד ואירלנד בתחילת המאה ה-18, והמלכה הראשונה של ממלכת בריטניה הגדולה. אן הייתה המלכה האחרונה לבית סטיוארט, לפני העברת המלוכה לבית הנובר."},{"page_url":"https://en.wikipedia.org/wiki/Black_pepper","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/TVM_Pepper.JPG","page_title":"Black pepper","context_page_description":"Black pepper is a flowering vine in the family Piperaceae, cultivated for its fruit, known as a peppercorn, which is usually dried and used as a spice and seasoning. When fresh and fully mature, the fruit is about 5 mm in diameter and dark red, and contains a single seed, like all drupes. Peppercorns and the ground pepper derived from them may be described simply as pepper, or more precisely as black pepper, green pepper, or white pepper.\\nBlack pepper is native to present-day Kerala in South India, and is extensively cultivated there and elsewhere in tropical regions. Vietnam is the world's largest producer and exporter of pepper, producing 34% of the world's crop, as of 2013.\\nGround, dried and cooked peppercorns have been used since antiquity, both for flavour and as a traditional medicine. Black pepper is the world's most traded spice, and is one of the most common spices added to cuisines around the world. Its spiciness is due to the chemical compound piperine, which is a different kind of spicy from the capsaicin characteristic of chili peppers. It is ubiquitous in the modern world as a seasoning, and is often paired with salt and available on dining tables in shakers or mills."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%98%BF%E6%B3%A2%E5%B7%9D%E5%8F%A3%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/JRS_awa-kawaguchi_sta_enclosure.jpg","page_title":"阿波川口駅","context_page_description":"阿波川口駅は、徳島県三好市山城町大川持にある、四国旅客鉄道土讃線の駅である。駅番号はD25。\\n徳島県では最西端の駅であるとともに、三好市山城町の中心部への最寄駅である。観光列車・四国まんなか千年ものがたりが運転停車する際、やましろ狸の会等による歓待やホームでの地元特産品の販売等が行われている。駅舎には周辺地域に伝わる妖怪タヌキ伝説をもとにした「汽車タヌキ」が設置されている。"},{"page_url":"https://pt.wikipedia.org/wiki/Louches","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Louches_%28Pas-de-Calais%29_mairie.JPG","page_title":"Louches","context_page_description":"Louches é uma comuna francesa na região administrativa de Altos da França, no departamento de Pas-de-Calais. Estende-se por uma área de 12,83 km². Em 2010 a comuna tinha 930 habitantes."},{"page_url":"https://de.wikipedia.org/wiki/Pouce_Coup%C3%A9_River","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Pouce_Coupe_-Landry_bridge.JPG","page_title":"Pouce Coupé River","context_page_description":"Der Pouce Coupé River ist ein rechter Nebenfluss des Peace River in den kanadischen Provinzen Alberta und British Columbia.\\nDer Pouce Coupé River entspringt im Saddle Hills County in Alberta. Er fließt anfangs in westlicher Richtung, überquert die Provinzgrenze nach British Columbia und wendet sich dort nach Norden. Er passiert den Ort Pouce Coupe, nimmt 5 km östlich von Dawson Creek den gleichnamigen Fluss von links auf, wird vom British Columbia Highway 49 überquert und fließt in nordnordöstlicher Richtung wieder nach Alberta. Etwa 5 km östlich der Provinzgrenze mündet der Pouce Coupé River in den Peace River. Der Pouce Coupé River hat eine Länge von etwa 150 km."},{"page_url":"https://en.wikipedia.org/wiki/Laura_Sogar","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Laura_Sogar_signs_autographs_after_200m_fly-2_%2818426690064%29.jpg","page_title":"Laura Sogar","context_page_description":"Laura Sogar is an American swimmer. She is a two times medal winner representing United States at the FINA World Swimming Championships in 2012 and swims for University of Texas at the United States Short Course Swimming Championships, a domestic and national level swimming championship in USA."},{"page_url":"https://en.wikipedia.org/wiki/Skinflint_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Skinflint_Band_Photo.jpg","page_title":"Skinflint (band)","context_page_description":"Skinflint is a heavy metal band from Gaborone, Botswana. They have incorporated elements from African culture into heavy metal music, attracting the attention of international media. Their releases, Iklwa, Gauna and Dipoko, pay homage to ancestral beliefs and African spirituality, while the band still plays in the vein of traditional heavy metal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%8F_%D0%BF%D0%BE%D1%87%D1%82%D1%8B_%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D1%8B%D1%85_%D0%BC%D0%B0%D1%80%D0%BE%D0%BA_%D0%90%D1%80%D1%83%D0%B1%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Aruba_stamp_type_PO2.jpg","page_title":"История почты и почтовых марок Арубы","context_page_description":"История почты и почтовых марок Арубы охватывает развитие почтовой связи на Арубе, самоуправляемом государственном образовании, расположенном на юге Карибского моря вблизи берегов Венесуэлы, со столицей в Ораньестаде. Собственные почтовые марки эмитируются здесь с 1986 года. Находясь в составе Королевства Нидерландов, Аруба участвует во Всемирном почтовом союзе. За почтовое обслуживание в стране отвечает компания Post Aruba N. V."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D9%84%D9%8A%D9%86%D8%AF%D9%8A%D9%84_(%D8%AF%D9%8A%D9%84%D8%A7%D9%88%D9%8A%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Ellendale_Fire_Company.JPG","page_title":"إلينديل (ديلاوير)","context_page_description":"إلينديل ‏ هي بلدة تقع في مقاطعة سوسكس (ديلاوير) بولاية ديلاوير في الولايات المتحدة. تبلغ مساحتها 0.7، وترتفع عن سطح البحر 15 م، بلغ عدد سكانها 381 نسمة في عام 2010 حسب إحصاء مكتب تعداد الولايات المتحدة وتصل الكثافة السكانية فيها 544.3 نسمة/كم²."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_der_Stadt_Bayreuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Bayreuth_Brunnenstra%C3%9Fe.JPG","page_title":"Liste der Straßen und Plätze der Stadt Bayreuth","context_page_description":"Die Liste der Straßen und Plätze der Stadt Bayreuth beschreibt das Straßensystem mit den entsprechenden historischen Bezügen. Sie erhebt keinen Anspruch auf Vollständigkeit."},{"page_url":"https://de.wikipedia.org/wiki/Neuroglobin","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Neuroglobin.png","page_title":"Neuroglobin","context_page_description":"Neuroglobin ist ein sauerstofftransportierendes Protein, ähnlich dem Hämoglobin, in Wirbeltieren. Beim Menschen ist es im Sauerstofftransport im Gehirn involviert. Es wird hauptsächlich im Stirnlappen, Nucleus subthalamicus und Thalamus exprimiert. Es gehört zu den Globinen.\\nDas mausspezifische und das menschliche Neuroglobin-Gen wurden 2000 charakterisiert. Beim Menschen liegt das Neuroglobin-Gen auf dem Chromosom 14q21. Neuroglobin ist mit den menschlichen Globinen verwandt, hat aber eine eigentümliche Genstruktur. Aus Sequenzanalysen ergab sich, dass es eine eigene Proteinfamilie bildet und sich früh in der Evolution der vielzelligen Tiere - vor der Trennung der Urmünder von den Neumündern - gebildet hat."},{"page_url":"https://de.wikipedia.org/wiki/Pegasos_(Mythologie)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Pegasos_Staatliche_Antikensammlungen_2504.jpg","page_title":"Pegasos (Mythologie)","context_page_description":"Pegasos ist in der griechischen Mythologie ein geflügeltes Pferd."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%9C%88%E7%90%83%E9%8C%AF%E8%A6%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/GoldenMedows.jpg","page_title":"月球錯覺","context_page_description":"月球错觉是对出现在低空的月球感觉比在高空时要大的一种光学错觉，这种光学错觉也会出现在太阳和星座上。这种现象在古代就已经知道，并且在许多不同的文化中都有纪录。如《列子·汤问》中所载的寓言故事“两小儿辩日”。\\n月亮错觉最早被提出来的解释是：接近地表的月亮，周围有很多的建筑物可以作为对比，让我们具体觉得月亮很大，相反的，高挂天空的月亮，周围没有什么具体让我们觉得很大的东西当对比，因此我们无法具体感受到月亮的大小。这是月亮错觉的一种解释。\\n关于这种错觉的解释仍在争论中。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%84%D8%B1%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Retinne_Verwaltungsgeb%C3%A4ude.jpg","page_title":"فلرون","context_page_description":"شهر فلرون در شهرستان لیئژ در استان لیئژ در منطقه فدرال والوون در کشور بلژیک واقع شده‌است."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%A0ansi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Pingyao-muralla-c01-f.jpg","page_title":"Šansi","context_page_description":"Šansi – provincija šiaurės Kinijoje. Plotas – 156,8 tūkst. km²; 37,6 mln. gyventojų. Sostinė – Tajuanas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BB%D1%8E%D1%81%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Amphitretus_pelagicus.jpg","page_title":"Молюски","context_page_description":"Молю́ски, або м'якуни́ — тип первинноротих двобічно-симетричних целомічних тварин зі спіральним дробленням зиготи.\\nМ'якуни — другий за чисельністю видів тип тварин після Членистоногих. Наразі відомо приблизно 130 тисяч сучасних видів молюсків, проте науковці припускають існування до 200 тисяч видів. Крім того, відомо від 35 до 70 тисяч викопних видів м'якунів. Приблизно 80 % видів належать до класу Черевоногих. В Україні налічують орієнтовно 500–650 видів молюсків.\\nЗдебільшого молюски є водяними тваринами, що мешкають у морських та прісних водоймах, меншість м'якунів наземні. Здебільшого молюски є вільноживучими організмами, проте деякі з них пристосувалися до паразитичного способу життя.\\nМолюски дуже різноманітні за розмірами, анатомічною будовою та поведінкою. Дорослі особини найменших видів сягають завдовжки лише 0,5 мм, тоді як найбільші — велетенські кальмари з класу Головоногих, зокрема Mesonychoteuthis hamiltoni, які можуть досягати 10 м у довжину та 495 кг ваги, є найбільшими безхребетними тваринами. Однак переважна більшість м'якунів має розміри в кілька сантиметрів."},{"page_url":"https://la.wikipedia.org/wiki/Ciceralis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Cicerale_pos_SA.png","page_title":"Ciceralis","context_page_description":"Ciceralis est oppidum Italiae et municipium, in Regione Campania et in Provincia Salernitana situm. Incolae Ciceralenses appellantur."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Velsen-Zuid","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Flora_Waterland_Velsen_%28508292%29.jpg","page_title":"Lijst van rijksmonumenten in Velsen-Zuid","context_page_description":"De plaats Velsen-Zuid telt 63 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://en.wikipedia.org/wiki/Galen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Statue_of_Galen_of_Pergamon.jpg","page_title":"Galen","context_page_description":"Aelius Galenus or Claudius Galenus, often Anglicized as Galen and better known as Galen of Pergamon, was a physician, surgeon and philosopher in the Roman Empire. He is considered one of the most accomplished of all medical researchers of antiquity, Galen influenced the development of various scientific disciplines, including anatomy, physiology, pathology, pharmacology, and neurology, as well as philosophy and logic.\\nThe son of Aelius Nicon, a wealthy Greek architect with scholarly interests, Galen received a comprehensive education that prepared him for a successful career as a physician and philosopher. Born in the ancient city of Pergamon, Galen travelled extensively, exposing himself to a wide variety of medical theories and discoveries before settling in Rome, where he served prominent members of Roman society and eventually was given the position of personal physician to several emperors.\\nGalen's understanding of anatomy and medicine was principally influenced by the then-current theory of humorism, as advanced by ancient Greek physicians such as Hippocrates. Galen's views dominated and influenced Western medical science for more than 1,300 years."},{"page_url":"https://en.wikipedia.org/wiki/Louis_Finson","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Louis_Finson_-_The_Four_Elements_-_BF.2018.1_-_Museum_of_Fine_Arts%2C_Houston.jpg","page_title":"Louis Finson","context_page_description":"Louis Finson, Lodewijk Finson or Ludovicus Finsonius was a Flemish painter, draughtsman, copyist and art dealer. He painted portraits, religious compositions, allegorical paintings and genre scenes. Moving to Italy early in his career, he became one of the first Flemish followers of Caravaggio whom he knew personally in Naples. He produced a number of copies after works by Caravaggio. He worked for a number of years in various cities in France where he created altarpieces and portraits. He is known for being the co-owner together with his fellow Flemish painter and business partner Abraham Vinck of two paintings by Caravaggio. Louis Finson played a major role in the Northern Caravaggesque movement through his own works as well as his role as an art dealer."},{"page_url":"https://hu.wikipedia.org/wiki/F%C3%B6ldtan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Ceratarges_sp_Alnif.jpg","page_title":"Földtan","context_page_description":"A földtan a Föld anyagi összetételét és annak kialakulását vizsgáló természettudomány. Rokon tudománya a planetológia, amely a földtan módszereit egyéb, szilárd égitestekre alkalmazza.\\nA földtan három fő ága:\\ngeológia,\\ngeokémia,\\ngeofizika."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A5%A7%E0%A5%A6_%E0%A4%AC%E0%A5%88%E0%A4%B6%E0%A4%BE%E0%A4%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Pasang.jpg","page_title":"१० बैशाख","context_page_description":"बैशाख १० गते बैशाख महिनाको दशौ दिन हो। यस दिन नेपालको तर्फबाट पहिलोपटक सर्वोच्च शीखर सगरमाथा आरोहण गर्ने पासाङ ल्हामु शेर्पाको सगरमाथाको शीखरमा पाइला टेकेर फर्कने क्रममा निधन भएको थियो।"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%AC%D8%B3%D9%88%D8%B1_%D8%A7%D9%84%D8%B3%D8%B9%D9%88%D8%AF%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Wadi_Laban_Bridge_2.jpg","page_title":"قائمة جسور السعودية","context_page_description":"الجسر أو القنطرة هو مُنشأ يُستخدم للعبور من مكان إلى آخر بينهما عائق."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9A%E1%83%A3%E1%83%A5%E1%83%A1%E1%83%94%E1%83%9B%E1%83%91%E1%83%A3%E1%83%A0%E1%83%92%E1%83%98%E1%83%A1_%E1%83%AA%E1%83%98%E1%83%AE%E1%83%94%E1%83%A1%E1%83%98%E1%83%9B%E1%83%90%E1%83%92%E1%83%A0%E1%83%94%E1%83%94%E1%83%91%E1%83%98%E1%83%A1_%E1%83%A1%E1%83%98%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Colmar_Berg_05_grand_duke_castle_Luxembourg.jpg","page_title":"ლუქსემბურგის ციხესიმაგრეების სია","context_page_description":"ზოგიერთი ოპტიმისტური შეფასებით ლუქემბურგში 130-ზე მეტი ციხესიმაგრეა, მაგრამ უფრო რეალურად 100-ზე მეტი, მიუხედავად ამისა უმეტესობა ამ ციხესიმაგრეებიდან შეიძლება ჩაითვალოს დიდ რეზიდენციებად ან ფეოდალური მამულების სახლებად ვიდრე ციხესიმაგრებად.\\nამჟამინდელი ლუქსემბურგის ციხესიმაგრეების სია შეიცავს დაახლოებით 50 ციხესიმაგრეს და ყველასთვის კარგად ცნობილ სარეზიდენციო ციხე-დარბაზებს. ქვემოთ მოცემულ სიაში არის ქვე-სიაც, რომელშიც ნახსენებია სხვა ციხესიმგრეები, რომლებიც შეიძლება მთავარ სიას დაემატოს მოგვიანებით."},{"page_url":"https://de.wikipedia.org/wiki/Jauerling-Aussichtswarte","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Jauerling-Aussichtswarte2.jpg","page_title":"Jauerling-Aussichtswarte","context_page_description":"Die Aussichtswarte Jauerling ist ein von 1984 bis 1991 errichteter 38 m hoher Aussichtsturm auf dem Jauerling bei Maria Laach am Jauerling, KG Wiesmannsreith."},{"page_url":"https://la.wikipedia.org/wiki/Pyralidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Moth_on_Sunflower.jpg","page_title":"Pyralidae","context_page_description":"Pyralidae sunt familia papilionum superfamiliae Pyraloideorum. In multis classificationibus, Crambidae in Pyralidis ut subfamilia ponuntur; quo facto, grex est unus ex maximis in Lepidopteris. Recentissima autem tractatio, a Munroe et Solis in Kristensen edita, Crambidas ut distinctam Pyraloideorum familiam retinuit."},{"page_url":"https://eo.wikipedia.org/wiki/Champ%C3%A9ry","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/Champery-02.jpg","page_title":"Champéry","context_page_description":"Champéry estas komunumo en la distrikto Monthey en Kantono Valezo, Svislando. Ĝi havis 1272 loĝantojn je la 31-a de decembro 2012."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D1%80%D0%BB%D0%B0%D0%BD%D0%B8,_%D0%90%D1%80%D0%BD%D0%B0%D0%BB%D1%8C%D0%B4%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Forlani.jpg","page_title":"Форлани, Арнальдо","context_page_description":"Арнальдо Форлани — итальянский политик и государственный деятель, 64-й премьер-министр Италии с 18 октября 1980 года по 28 июня 1981 года. Член Христианско-демократическая партии Италии."},{"page_url":"https://de.wikipedia.org/wiki/Essigbaum","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Rhus_fg03.jpg","page_title":"Essigbaum","context_page_description":"Der Essigbaum oder Hirschkolbensumach ist eine Pflanzenart innerhalb der Familie Sumachgewächse. Sie stammt aus dem östlichen Nordamerika. Der Essigbaum wurde um 1620 in Europa eingeführt und ist wegen seiner ausgeprägten Herbstfärbung ein weit verbreitetes Ziergehölz. Die Blätter werden dabei gelb, später orange und im Oktober leuchtend karmesinrot. Sein deutscher Trivialname Hirschkolbensumach wie auch der englische Name staghorn sumac beruhen auf dem kennzeichnenden Merkmal der Art: den kräftigen, braunen und filzig behaarten jungen Zweigen, die an ein mit Bast bewachsenes Hirschgeweih erinnern."},{"page_url":"https://it.wikipedia.org/wiki/Naomi_Watts","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Naomi_Watts_at_Golden_Globes_Red_Carpet_2020.png","page_title":"Naomi Watts","context_page_description":"Naomi Ellen Watts è un'attrice britannica.\\nDopo una serie di film, ha ottenuto la fama internazionale per la sua performance nel cult Mulholland Drive, l'horror The Ring e il dramma 21 grammi, per il quale riceve la nomination ai BAFTA, agli Screen Actors Guild Award e al Premio Oscar alla miglior attrice. Nel 2013 ottiene la sua prima nomination ai Golden Globe e la seconda agli Oscar per la miglior attrice per The Impossible.\\nNel 2002 è stata inserita dalla rivista People nella lista delle \\"50 persone più belle\\". Nel 2006 è diventata ambasciatrice di buona volontà per l'UNAIDS, il Programma congiunto delle Nazioni Unite sull'HIV / AIDS, che aiuta ad aumentare la consapevolezza dei problemi correlati all'AIDS."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B4%91%EC%96%91%EC%97%AC%EC%9E%90%EA%B3%A0%EB%93%B1%ED%95%99%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Gwangyang_Girl%27s_High_school.JPG","page_title":"광양여자고등학교","context_page_description":"광양여자고등학교는 전라남도 광양시 광양읍 칠성리에 위치한 공립 고등학교이다."},{"page_url":"https://pt.wikipedia.org/wiki/S%C3%A3o_Jos%C3%A9_dos_Campos","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Sao-jose-dos-campos-SP.jpg","page_title":"São José dos Campos","context_page_description":"São José dos Campos é um município brasileiro no interior do estado de São Paulo. Está situado no Vale do Paraíba Paulista, a leste da capital do estado, distando desta cerca de 81 km. É sede da Região Metropolitana do Vale do Paraíba e Litoral Norte e ocupa uma área de 1 099,41 km², da qual 353,9 km² estão em perímetro urbano. Em 2020, sua população foi estimada pelo IBGE em 729 737 habitantes, sendo naquele ano o quinto mais populoso de São Paulo e o 23.º de todo o país, além de ser o segundo município mais populoso do interior do Brasil, ficando atrás somente de Campinas. O município está integrado — junto com as regiões metropolitanas de São Paulo, Campinas, Sorocaba e Baixada Santista — ao Complexo Metropolitano Expandido, uma megalópole que ultrapassa os trinta milhões de habitantes e que é a primeira aglomeração urbana do tipo no hemisfério sul.\\nSão José dos Campos foi elevado à categoria de vila em 1767. No decorrer do século XIX a agricultura desenvolveu-se no município, com destaque para o café, principalmente a partir da década de 1880."},{"page_url":"https://ru.wikipedia.org/wiki/(471)_%D0%9F%D0%B0%D0%BF%D0%B0%D0%B3%D0%B5%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/471Papagena_%28Lightcurve_Inversion%29.png","page_title":"(471) Папагена","context_page_description":"(471) Папагена — крупный астероид главного пояса, который был открыт 7 июня 1901 года немецким астрономом Максом Вольфом в обсерватории Хайдельберг в Германии и назван в честь персонажа оперы «Волшебная флейта» великого немецкого композитора Амедея Моцарта."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_guvern%C3%B6rer_i_Mississippi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Tate_Reeves_2019.jpg","page_title":"Lista över guvernörer i Mississippi","context_page_description":"Mississippis guvernör är den främste utövaren av verkställande makt och det högsta offentliga ämbetet i den amerikanska delstaten Mississippi.\\nMississippi blev upptagen som delstat i USA den 10 december 1817. Mississippi utträdde ur unionen den 9 januari 1861 och var med om att bilda Amerikas konfedererade stater i februari 1861. Efter amerikanska inbördeskriget ockuperades Mississippi av nordstaterna. Mississippi blev åter en fullvärdig delstat i USA den 23 februari 1870."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%90%E3%83%AB%E3%83%9E%E3%82%BB%E3%83%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/51/Zubia_ots.jpg","page_title":"バルマセダ","context_page_description":"バルマセダは、スペイン・バスク州ビスカヤ県のムニシピオ。公式名はバスク語のBalmaseda。ビスカヤ県の西部にあり、コマルカとしてはエンカルテリに属している。ビスカヤ県の県都ビルバオ、カンタブリア州やカスティーリャ・イ・レオン州からの距離が近く、ビスカヤ県で重要な役割を果たしている。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%B0%D1%82%D1%80%D0%B8%D0%B0%D1%80%D1%85_%D0%9C%D0%BE%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%B8_%D0%B2%D1%81%D0%B5%D1%8F_%D0%A0%D1%83%D1%81%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Joasaphus_II_from_Tsarsky_titulyarnik.jpg","page_title":"Патриарх Московский и всея Руси","context_page_description":"Святе́йший Патриа́рх Моско́вский и всея́ Руси́ — титул предстоятеля Русской православной церкви. В разные годы использовались разные вариации титула: «Патриарх Московский и всея Русии», «Патриарх Московский и всея России», «Патриарх Московский и всея великия и малыя и белыя России» и другие. Современная форма, «Патриарх Московский и всея Руси», использовалась в древности и используется современными историками для обозначения всех патриархов, при избрании на патриарший престол митрополита Сергия в 1943 году стала официальным титулом.\\nЯвляясь правящим архиереем Московской епархии, состоящей из города Москвы, патриарх Московский и всея Руси, кроме того, в соответствии с уставом РПЦ, обладает рядом общецерковных полномочий в рамках поместной Русской православной церкви.\\nПатриаршество учреждено в Москве в 1589 году: первым патриархом стал Иов. Упразднено в 1721 году; восстановлено 28 октября 1917 года решением Всероссийского поместного собора."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%95%D0%B2%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D1%83%D0%BF%D0%B5%D1%80%D0%B8%D0%BD%D1%82%D0%B5%D0%BD%D0%B4%D0%B5%D0%BD%D1%82%D1%81%D1%82%D0%B2%D0%BE_%D0%90%D1%83%D0%B3%D1%81%D0%B1%D1%83%D1%80%D0%B3%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%B8%D1%81%D0%BF%D0%BE%D0%B2%D0%B5%D0%B4%D0%B0%D0%BD%D0%B8%D1%8F_%D0%9A%D0%B0%D1%80%D0%B8%D0%BD%D1%82%D0%B8%D0%B8_%D0%B8_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D1%87%D0%BD%D0%BE%D0%B3%D0%BE_%D0%A2%D0%B8%D1%80%D0%BE%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Evangelische_Kirche_in_Sankt_Ruptrecht_bei_Villach.JPG","page_title":"Евангелическое суперинтендентство Аугсбургского исповедания Каринтии и Восточного Тироля","context_page_description":"Евангелическое суперинтендентство Аугсбургского исповедания Каринтии и Восточного Тироля, сокращённо Евангелическое суперинтендентство А. И. Каринтии и Восточного Тироля или просто Суперинтендентство — епархия в Евангелической церкви Аугсбургского исповедания в Австрии.\\nСуперинтендентство возглавляет суперинтендент."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/26_-_New_York_-_Octobre_2008.jpg","page_title":"Нью-Йорк","context_page_description":"Нью-Йо́рк — крупнейший город США, входящий в одну из крупнейших агломераций мира. Население города составляет 8 405 837 человек, агломерации — 20,63 млн. Нью-Йорк расположен на берегу Атлантического океана в юго-восточной части штата Нью-Йорк. Город был основан в начале XVII века голландскими колонистами и до 1664 года назывался Новый Амстердам.\\nНью-Йорк включает пять административных округов: Бронкс, Бруклин, Куинс, Манхэттен и Статен-Айленд.\\nОсновные достопримечательности расположены в боро Манхэттен. Среди них: исторические небоскрёбы, Рокфеллеровский центр, Вулворт-билдинг, художественный Метрополитен-музей, Метрополитен-опера, Карнеги-холл, Музей Соломона Гуггенхейма, Американский музей естественной истории, отель «Плаза», отель «Уолдорф-Астория», отель «Челси», штаб-квартира ООН, Гарлем.\\nНью-Йорк — важный мировой финансовый, политический, экономический и культурный центр."},{"page_url":"https://en.wikipedia.org/wiki/Hemrik","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Map_NL_Opsterl%C3%A2n_De_Himrik.png","page_title":"Hemrik","context_page_description":"Hemrik is a village in the municipality of Opsterland in the east of Friesland, the Netherlands. It had a population of around 770 in January 2017."},{"page_url":"https://af.wikipedia.org/wiki/Twerskajastraat","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Moscow_English_Club_building_asv2019-06_img16.jpg","page_title":"Twerskajastraat","context_page_description":"Twerskajastraat, tussen 1935 en 1990 bekend as Gorkistraat, is die hoofstraalpad van Moskou. Dit loop in noordwestelike rigting vanuit die sentrale Manezjnaja-plein oor 'n afstand van sowat twee kilometer tot die Tuinring waar dit oorgaan in die Eerste Twerskaja-Jamskaja-straat, die Leningradski-Laan en die Leningradskoje-snelweg - die beginpunt van die M10 na Sint Petersburg.\\nVroeër is na Twerskaja dikwels verwys as die \\"Tsarestraat\\" - Russiese heersers wat amptelike besoeke aan Moskou gebring of om ander redes vanuit die nuwe hoofstad Sint Petersburg na die Moskwametropool gereis het, het Moskou op Twerskaja binnegekom - so ook Pieter die Grote. Vir die gerieflikheid van tsare was Twerskaja een van die eerste steen-geplaveide strate in Moskou.\\nDie meeste Moskowiete sal na Twerskaja as dié of tenminste een van Moskou se hoofstrate verwys, al is van die beste restaurante en winkels in die systrate geleë."},{"page_url":"https://es.wikipedia.org/wiki/Oberth_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Far_side_18.jpg","page_title":"Oberth (cráter)","context_page_description":"Oberth es un cráter perteneciente a la cara oculta de la Luna. Se encuentra en las altas latitudes del norte, al sureste del cráter Gamow. Al este de Oberth se halla Avogadro.\\nSe trata de un cráter ligeramente erosionado, con un borde exterior aproximadamente circular pero desigual. Un par de pequeñas depresiones en forma de cráter están unidas al borde norte, y la pared interna es más estrecha en esa sección. Presenta ligeras protuberancias hacia el exterior en el borde noroeste y a lo largo del sur. El suelo interior es relativamente plano, con una pequeña colina al norte del punto medio. Varios pequeños cráteres se sitúan a través del suelo del cráter.\\nSe nombra en memoria del físico alemán Hermann Julius Oberth."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%92%A6%E5%A4%A9%E7%9B%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Schall.jpg","page_title":"钦天监","context_page_description":"欽天監，中國古代官名。掌管觀察天文、推算曆法、授時等工作。民國建立後裁撤。"},{"page_url":"https://vi.wikipedia.org/wiki/Thi%E1%BA%BFt_b%E1%BB%8B_d%C6%B0%E1%BB%9Bi_n%C6%B0%E1%BB%9Bc_kh%C3%B4ng_ng%C6%B0%E1%BB%9Di_l%C3%A1i","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/REMUS_100_ja_Seafox-I_Merivoimien_vuosip%C3%A4iv%C3%A4_2014_01.JPG","page_title":"Thiết bị dưới nước không người lái","context_page_description":"Thiết bị dưới nước không người lái hay thiết bị lặn không người lái là những phương tiện có thể hoạt động dưới nước mà không có người điều khiển trực tiếp.\\nNhững thiết bị này có thể được chia thành hai loại, là phương tiện dưới nước hoạt động điều khiển từ xa, được điều khiển bởi một nhà điều hành con người từ xa, và các phương tiện tự động dưới nước hoạt động độc lập với đầu vào trực tiếp của con người. Đôi khi chỉ AUV được coi như một loại robot vì hoạt động độc lập với sự chỉ huy trực tiếp của con người, tuy nhiên ROV hoạt động với cơ chế tương tự như robot phẫu thuật dưới sự điều khiển cũng được coi như một loại robot."},{"page_url":"https://de.wikipedia.org/wiki/Squalomorphii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Cuban_dogfish_nmfs.jpg","page_title":"Squalomorphii","context_page_description":"Die Squalomorphii sind eine Überordnung der Haie. Das Taxon wurde im Jahre 1977 durch den US-amerikanischen Ichthyologen Leonard Compagno aufgestellt um eine Gruppe urtümlicher, teilweise rochenähnlicher Haie von den weiter entwickelten Galeomorphi, den sogenannten Echten Haien abzugrenzen. Die Squalomorphii vereinigen die Dornhaiartigen, die Nagelhaie, die Hexanchiformes, die Sägehaie und die Engelhaie.\\nAlternativ zu den Squalomorphii wurde 1992 durch den japanischen Ichthyologen Shigeru Shirai das Taxon Squalea aufgestellt, eine systematische Gruppe, die neben den squalomorphen Haien auch die Rochen umfasste, die nach verschiedenen morphologischen Analysen nur eine Untergruppe der squalomorphen Haie sind. Die Squalea fanden zunächst eine rasche Anerkennung und ersetzten in der wissenschaftlichen Debatte und in systematischen Lehrbüchern weitgehend die Squalomorphii.\\nMit der zunehmenden Verbreitung der DNA-Sequenzierung zur Analyse von Verwandtschaftsverhältnissen zwischen taxonomischen Gruppen mehren sich allerdings die Zweifel an der Monophylie der Squalea."},{"page_url":"https://pnb.wikipedia.org/wiki/%D8%A8%D8%B1%D8%A7%D8%A4%D9%86_%DB%8C%D9%88%D9%86%DB%8C%D9%88%D8%B1%D8%B3%D9%B9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Brown_university_robinson_hall_2009a.JPG","page_title":"براؤن یونیورسٹی","context_page_description":"دنیا دیاں ودیا یونیورسٹیاں"},{"page_url":"https://la.wikipedia.org/wiki/Schortens","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Stephans-Kirche_Schortens.jpg","page_title":"Schortens","context_page_description":"Schortens est oppidum Saxoniae Inferioris et pars Circuli Frisici. Ad Schortens et vici Heidmühle, Grafschaft, Accum, Sillenstede, Schoost, Roffhausen, Middelsfähr, Addernhausen, Oestringfelde, Ostiem atque Upjever pertinent."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%97%E0%B0%B8%E0%B1%8D%E0%B0%9F%E0%B0%BE%E0%B0%B5%E0%B1%8D_%E0%B0%A1%E0%B1%8B%E0%B0%B0%E0%B1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Par_18.jpg","page_title":"గస్టావ్ డోరె","context_page_description":"గస్టావ్ డోరే పూర్తి పేరు పాల్ గస్టావ్ లూయిస్ క్రిస్టోఫర్ డోరె Paul Gustave Louis Christophe Doré ఫ్రాన్స్ కి చెందిన ప్రముఖ చిత్రకారుడు, శిల్పి, నగిషీలు చెక్కే శిల్పి. ముఖ్యంగా నగీషీలు చెక్కడంలో ప్రసిద్దుడు. ప్రముఖ నవలలైన \\"ది పారడైజ్ లాస్ట్\\" \\"డాన్ క్విక్సట్\\" ఇంకా అనేకమైన నవలలకు చిత్రాలతో పాటూ నగీషీలు చెక్కాడు."},{"page_url":"https://hu.wikipedia.org/wiki/G%C3%A1bor_D%C3%A9nes_F%C5%91iskola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Budapest_Gabor_Denes_foiskola_Szamalk_0380-1000.jpg","page_title":"Gábor Dénes Főiskola","context_page_description":"A Gábor Dénes Főiskola egy magyar felsőoktatási intézmény Budapesten. Alapítványi intézményként hozta létre az LSI Oktatóközpont és a SZÁMALK Rendszerház Rt., a Magyar Köztársaság 1027/1992.-es Kormányhatározata alapján. A főiskola az elektronikus távoktatás e-learning magyarországi úttörője. A főiskolán lehetőség van munka mellett megszerezni az informatikai profilú főiskolai oklevelet, a 2006/2007-es tanévtől pedig BSc képzésben alapdiplomát. A főiskola nappali és távoktatási formában indítja képzéseit. Az alapképzések mellett felsőoktatási szakképzéseket és szakirányú továbbképzések kínál."},{"page_url":"https://nl.wikipedia.org/wiki/Kasteel_Puth","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Interieur_Hal_-_Puth_-_20183649_-_RCE.jpg","page_title":"Kasteel Puth","context_page_description":"Kasteel Puth is een kasteel en buitenplaats bij Voerendaal in Zuid-Limburg. Het kasteel is een rijksmonument. Kasteel Puth is een van de vier kastelen van Voerendaal en vormt samen met Kasteel Rivieren, kasteel Cortenbach en kasteel Haeren een landgoederenzone. Van oudsher behoorde ook Kasteel Terworm bij Voerendaal, maar dit ligt thans in de gemeente Heerlen."},{"page_url":"https://fr.wikipedia.org/wiki/Fouesnant","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/John_Recknagel_Jeune_fouesnantaise.jpg","page_title":"Fouesnant","context_page_description":"Fouesnant est une commune du département du Finistère, dans la région Bretagne, en France. La commune est le chef-lieu du canton de Fouesnant ainsi que de la communauté de communes du Pays Fouesnantais.\\nEn 2016, la commune comptait 9 520 habitants, ce qui la plaçait en douzième place des villes du Finistère.\\nSituée au cœur de la côte Cornouaillaise, à 15 km environ de Pont-l'Abbé, Quimper et Concarneau, et bénéficiant d'un littoral parmi les plus étendus du Finistère, la ville attire chaque année de nombreux touristes et vacanciers. Avec Bénodet et La Forêt-Fouesnant, Fouesnant forme désormais la « Riviera bretonne », nouvelle appellation touristique."},{"page_url":"https://es.wikipedia.org/wiki/Path%C3%A9_Baby","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Path%C3%A9-Baby_hand_movie_camera_%28right%29.jpg","page_title":"Pathé Baby","context_page_description":"El Pathé Baby es un sistema de cine amateur inventado por Victor Continsouza y fabricado y comercializado por la empresa francesa Pathé Frères entre 1922 y 1946 que destacó por ser uno de los primeros sistemas cinematográficos pensados y diseñados para llevar el cine en casa. Constaba de una pequeña cámara y un proyector de sobremesa que funcionaban con película perforada de 9,5 mm, formato que también había introducido aquel sistema. Su tamaño excepcionalmente pequeña para la época en que salió al mercado junto con el innovador y económicamente más asequible formato de película que usaba hicieron que el sistema se volviera muy popular durante las décadas de los años 1920 y 1930.​"},{"page_url":"https://lb.wikipedia.org/wiki/Panzerkampfwagen_VI_Tiger_II","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Tiger_II_La_Gleize2008.jpg","page_title":"Panzerkampfwagen VI Tiger II","context_page_description":"De Panzerkampfwagen VI Königstiger, oder Tiger II, bekannt als Kinnekstiger, ass, ouni Zweiwel, de gréissten a stäerksten däitschen Tanks vum Zweete Weltkrich, deen a Serie produzéiert gouf. Et gëtt souguer behaapt, et wier de beschten an deem Krich gewiescht. No him koumen d'Panzere vun der Sowjetunioun IS-2 an IS-3 an den amerikaneschen M26 Pershing, och wann hien eng Kanoun vu méi klengem Kaliber hat."},{"page_url":"https://de.wikipedia.org/wiki/Pecunia_non_olet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Pecunia_non_olet_%28Geyger%29.jpg","page_title":"Pecunia non olet","context_page_description":"Pecunia non olet ist eine lateinische Redewendung.\\nDie Redewendung geht zurück auf den römischen Kaiser Vespasian. Im alten Rom wurde Urin, insbesondere „gefaulter“, aus dem sich alkalisches Ammoniak bildet, als Mittel für die Ledergerbung und die Wäschereinigung eingesetzt. So wurden in Rom an belebten Straßen amphorenartige Latrinen aufgestellt, um den Urin einzusammeln, der von den Gerbern und Wäschern benötigt wurde.\\nUm die leeren Staatskassen zu füllen, erhob Kaiser Vespasian auf diese öffentlichen Toiletten eine spezielle Latrinensteuer. Sueton überliefert, dass Vespasian die Steuer vor seinem Sohn Titus rechtfertigte, indem er ihm Geld aus den ersten Einnahmen unter die Nase gehalten und gefragt habe, ob der Geruch ihn störe. Als dieser verneinte, habe Vespasian gesagt: Atqui e lotio est. Im Laufe der Zeit wurde daraus die Redewendung Pecunia non olet, „Geld stinkt nicht“.\\nDie Redewendung hat sich bis heute gehalten, um den Besitz oder Erwerb von Geld aus unsauberen Einnahmequellen zu rechtfertigen. Die öffentlichen Toiletten in Paris heißen noch heute Vespasienne. Auch in Italien werden die öffentlichen Toiletten Vespasiani genannt."},{"page_url":"https://simple.wikipedia.org/wiki/Reef_triggerfish","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Rhinecanthus_rectangulus_X-ray.jpg","page_title":"Reef triggerfish","context_page_description":"The reef triggerfish is one of several species of triggerfish. It is also known as the rectangular triggerfish, wedgetail triggerfish, or by its Hawaiian name humuhumunukunukuāpuaʻa. The reef triggerfish is found at reefs in the Indo-Pacific and is the state fish of Hawaii."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%AB%D5%A5%D5%A3%D5%B8_%D5%8E%D5%A5%D5%AC%D5%A1%D5%BD%D5%AF%D5%A5%D5%BD%D5%AB_%D5%AF%D5%BF%D5%A1%D5%BE%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Velazquez-Rioja.jpg","page_title":"Դիեգո Վելասկեսի կտավների ցանկ","context_page_description":"Իսպանացի գեղանկարիչ Դիեգո Վելասկեսի ժառանգությունը ներառում է բազմաթիվ դիմանկարներ, կտավներ ընտանեկան, պատմական, կրոնական և միֆական սյուժետներով: Ներքևի ցուցակում ներկայացված կտավները, որոնք ստեղծվել են Վելասկեսի կողմից 1617-1660-ական թվականներին, բաժանված են շրջանների՝ կապված նրա գտնվելու վայրի և գործունեության հետ. նա Սևիլյայում ուսում է ստացել, ապա Մադրիդում ծառայել է Ֆիլիպ IV-ին՝ որպես թագավորական գեղանկարիչ:\\nԱշխարհի 11 երկրների թանգարաններ պահպանում են Վելասկեսի բոլոր աշխատանքները: Նրա կտավների ամենամեծ քանակությունը գտնվում է Պրադո թանգարանում. այն հիմնականում ընդգրկում է արքայական ընտանիքի պատմությունը: Վիեննայի Արվեստի պատմության թանգարանում պահվում են իսպանացի արքաների նվերները իրենց ավստրիացի բարեկամնրին: Վելասկեսի աշխատանքներից պահվում են նաև Վելլիգնտոնի թանգարանում, Լոնդոնի ազգային պատկերասրահում, Դրեզդենի պատկերասրահում, Նյու Յորքի Մետրոպոլիտեն թանգարանում և Բոստոնի կերպարվեստի թանգարանում: Էրմիտաժում գտնվում են նկարչի երեք գեղանկար, որոնցից մեկը ունի վիճելի ատրիբուցիա:"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%97%A5%E6%9C%AC%E8%BF%91%E4%BB%A3%E7%A7%91%E6%8A%80%E5%8F%91%E6%98%8E%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Sony_MZ-1_and_a_disc_20040221.jpg","page_title":"日本近代科技发明列表","context_page_description":"日本近代科技發明列表列出了日本自明治維新以來的發明，但列表並不完整。"},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Baptiste-Marie_Champion_de_Cic%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Le_Vachez_Collection_-_Jean-Baptiste-Marie_Champion_de_Cic%C3%A9_%281725-1805%29.jpg","page_title":"Jean-Baptiste-Marie Champion de Cicé","context_page_description":"Jean-Baptiste-Marie Champion de Cicé est un ecclésiastique français du XVIIIᵉ siècle, évêque de Troyes puis d'Auxerre."},{"page_url":"https://en.wikipedia.org/wiki/Mahatma_Gandhi_Road,_Vijayawada","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Bandar_Road_in_Vijayawada.JPG","page_title":"Mahatma Gandhi Road, Vijayawada","context_page_description":"Mahatma Gandhi Road, popularly known as Bandar Road, is a boulevard and major road in the Indian city of Vijayawada.The road starts at Benz Circle, busiest traffic circle in the city and continues to Avatar Park, where it connects to Eluru Road which is also a major road. It runs almost parallel to the Bandar Canal. The National Highway 9 runs parallel to this road on the other side of the Bandar Canal, merging into Bandar Road at Benz Circle. The name \\"Bandar\\" was originally the name of Machilipatan Road, which the current Bandar Road intersects.\\nIts official name comes from Mahatma Gandhi, the inspirational leader of the Indian Independence Movement in the early twentieth century."},{"page_url":"https://lv.wikipedia.org/wiki/Horodenka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/COA_of_Horodenka.png","page_title":"Horodenka","context_page_description":"Horodenka ir pilsēta Ukrainas rietumos, Ivanofrankivskas apgabala Horodenkas rajona centrs."},{"page_url":"https://nl.wikipedia.org/wiki/Oranje_(Drenthe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Oranje_kombord.png","page_title":"Oranje (Drenthe)","context_page_description":"Oranje is een streekdorp in de gemeente Midden-Drenthe, in de Nederlandse provincie Drenthe. Het is gelegen aan het Oranjekanaal tussen Hijken en Smilde.\\nOranje is gesitueerd rond een voormalige aardappelzetmeelfabriek van Avebe die in het midden van de jaren tachtig sloot."},{"page_url":"https://de.wikipedia.org/wiki/Bill_Cosby","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/2011_Bill_Cosby.jpg","page_title":"Bill Cosby","context_page_description":"William Henry „Bill“ Cosby Jr. ist ein US-amerikanischer Komiker, Schauspieler, Sänger, Buchautor und verurteilter Sexualstraftäter. Zu seinen größten Erfolgen zählen die Hauptrollen in den Fernsehserien Die Bill Cosby Show und Tennisschläger und Kanonen.\\nNach einer Karriere von mehr als 50 Jahren in der Unterhaltungsbranche wurde Cosby 2018 als Sexualstraftäter zu einer Haftstrafe von drei bis zehn Jahren verurteilt, die er im selben Jahr antrat."},{"page_url":"https://de.wikipedia.org/wiki/Chang%C3%A9_(Mayenne)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Chang%C3%A9_%28Mayenne%29_-_Town_hall_-_4.jpg","page_title":"Changé (Mayenne)","context_page_description":"Changé ist eine französische Gemeinde mit 5950 Einwohnern im Département Mayenne in der Region Pays de la Loire. Sie gehört zum Arrondissement Laval und zum Kanton Saint-Berthevin."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%81%D9%8A%D9%84%D9%8A%D8%AC%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Villegas20121006145356P1160700.jpg","page_title":"فيليجاس","context_page_description":"بلدية فيليجاس, هي إحدى بلديات مقاطعة برغش, التي تقع في منطقة قشتالة وليون, والتي تقع في شمال غرب إسبانيا.\\nيبلغ عدد سكانها 122 نسمة وفقاً لإحصائية سنة."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BB%D1%8C_(%D0%9C%D0%B8%D0%BD%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/%D0%A2%D0%B0%D0%BB%D1%8C._%D0%9D%D0%BE%D0%B2%D0%B0%D1%8F_%D1%86%D0%B0%D1%80%D0%BA%D0%B2%D0%B0.jpg","page_title":"Таль (Минская область)","context_page_description":"Таль — агрогородок в Любанском районе Минской области Белоруссии, центр Тальского сельсовета. Население 1065 человек."},{"page_url":"https://mn.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BD%D0%B3%D0%BE%D0%BB_%D1%83%D0%BB%D1%81%D1%83%D1%83%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Mongol_Empire_c.1207.png","page_title":"Монгол улсууд","context_page_description":"Энэхүү жагсаалт нь Монгол улсуудын жагсаалт болно."},{"page_url":"https://cs.wikipedia.org/wiki/Pachypodium","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Pachypodium_baroni.JPG","page_title":"Pachypodium","context_page_description":"Pachypodium je rod rostlin z čeledi toješťovité."},{"page_url":"https://en.wikipedia.org/wiki/Vihula_Parish","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Eesti_vihula_vald.png","page_title":"Vihula Parish","context_page_description":"Vihula Parish was a rural municipality of Estonia, in Lääne-Viru County. It had a population of 1,939 and an area of 364.28 km²."},{"page_url":"https://en.wikipedia.org/wiki/List_of_bread_dishes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Italian_Panzanella.jpg","page_title":"List of bread dishes","context_page_description":"This is a list of bread dishes and foods, which use bread as a primary ingredient. Bread is a staple food prepared from a dough of flour and water, usually by baking. Throughout recorded history it has been popular around the world and is one of the oldest artificial foods, having been of importance since the dawn of agriculture."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Essen","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Rosegertrud_Elsberg_03.JPG","page_title":"Liste der Stolpersteine in Essen","context_page_description":"Die Liste der Stolpersteine in Essen enthält alle Stolpersteine, die im Rahmen des gleichnamigen Projekts von Gunter Demnig in Essen verlegt wurden. Mit ihnen soll an Opfer des Nationalsozialismus erinnert werden, die in Essen lebten und wirkten."},{"page_url":"https://en.wikipedia.org/wiki/Tyre,_Lebanon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Tyre_OldTownEntrance-HaratElIslem_RomanDeckert27102019.jpg","page_title":"Tyre, Lebanon","context_page_description":"Tyre is one of the oldest continually inhabited cities in the world, though in medieval times for some centuries by just a tiny population. It was one of the earliest Phoenician metropolises and the legendary birthplace of Europa, her brothers Cadmus and Phoenix, as well as Carthage's founder Dido. The city has many ancient sites, including the Tyre Hippodrome, and was added as a whole to UNESCO's list of World Heritage Sites in 1984.\\nThe historian Ernest Renan noted:\\nOne can call Tyre a city of ruins, built out of ruins.\\nToday Tyre is the fifth largest city in Lebanon after Beirut, Tripoli, Aley and Sidon, It is the capital of the Tyre District in the South Governorate. There were approximately 200,000 inhabitants in the Tyre urban area in 2016, including many refugees."},{"page_url":"https://pl.wikipedia.org/wiki/London_Calling","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/Bad-don-letts-2-np.jpg","page_title":"London Calling","context_page_description":"London Calling – trzeci album studyjny brytyjskiego zespołu punkowego The Clash wydany 14 grudnia 1979 za pośrednictwem CBS Records w Wielkiej Brytanii oraz przez Epic Records w USA w styczniu 1980. Album zmienił styl prezentowany przez The Clash na poprzednich albumach i zawiera elementy takich stylów w muzyce jak ska, pop, soul, rockabilly i reggae. Album porusza problemy bezrobocia, rasizmu i konfliktów rasowych, zażywania narkotyków, a także odpowiedzialności za dorosłe życie.\\nAlbum został doceniony przez krytyków oraz zebrał dobre oceny od magazynów muzycznych. Umieszczony został na 8. miejscu listy 500 albumów wszech czasów magazynu „Rolling Stone” w 2003. Album uplasował się w pierwszej dziesiątce list przebojów w Wielkiej Brytanii, zaś pierwszy utwór promujący album o tym samym tytule znalazł się w pierwszej dwudziestce notowań. London Calling sprzedał się na całym świecie w nakładzie 2 milionów kopii oraz zdobył status platynowej płyty w Stanach Zjednoczonych."},{"page_url":"https://pt.wikipedia.org/wiki/Demografia_do_Rio_Grande_do_Norte","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/RioGrandedoNorte_RM_Natal.svg","page_title":"Demografia do Rio Grande do Norte","context_page_description":"No censo demográfico de 2010, a população do Rio Grande do Norte, estado localizado a nordeste da região Nordeste do Brasil, era de 3 168 027 habitantes, sendo a décima sexta unidade da federação mais populosa do país, concentrando cerca de 1,7% da população brasileira. De acordo o mesmo censo, 2 464 991 habitantes viviam na zona urbana e 703 036 na zona rural. Ao mesmo tempo, 1 548 887 pessoas eram do sexo masculino e 1 619 140 do sexo feminino, tendo uma razão de sexo de 95,66. Entre 2000 e 2010, o Rio Grande do Norte registrou um crescimento populacional de 14,30%, superior às médias da região Nordeste e do Brasil.\\nA densidade demográfica, uma razão entre população e área, era de 59,99 habitantes por quilômetro quadrado, a décima maior do Brasil e mais de 2,5 vezes maior que a média nacional. Dentre os municípios, a maior densidade era verificada em Natal e a menor em Galinhos, no litoral norte.\\nLevando-se em conta a nacionalidade da população, 3 166 001 eram brasileiros, sendo 165 204 brasileiros natos e 797 naturalizados brasileiros, além de 2 026 estrangeiros."},{"page_url":"https://fr.wikipedia.org/wiki/Chambourg-sur-Indre","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Map_commune_FR_insee_code_37049.png","page_title":"Chambourg-sur-Indre","context_page_description":"Chambourg-sur-Indre est une commune française du département d'Indre-et-Loire en région Centre-Val de Loire.\\nPeut-être déjà occupé dès le Néolithique, le site ne conserve cependant que les vestiges d'un établissement datant de l’époque romaine : un aqueduc, une villa, une voie. Viguerie puis fief médiéval, Chambourg devient commune en 1789, au terme d'un échange de hameaux jusqu'alors indivis avec sa voisine Chédigny. Les crues de l'Indre, toujours à craindre en 2014, n'ont jamais dissuadé les hommes de s'implanter définitivement à Chambourg jusque sur les bords de la rivière.\\nDevenue Chambourg-sur-Indre en 1920, la commune est l'un des rares territoires ruraux du Lochois à ne pas connaître de récession démographique au XXᵉ siècle. En 2017, sa population est de 1 291 habitants. L'agriculture communale se recentre depuis une trentaine d'années autour de grosses exploitations spécialisées dans la culture des céréales, des oléagineux et protéagineux. Dans le secteur industriel, Chambourg-sur-Indre accueille depuis 1961 l'une des grandes entreprises françaises du domaine de la signalisation routière."},{"page_url":"https://sl.wikipedia.org/wiki/Aleksander_Terplan","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Terplanov_groub%2C_Puconci.JPG","page_title":"Aleksander Terplan","context_page_description":"Aleksander Terplan, madžarski slovenski evangeličanski pastor in pisatelj, * 1. maj 1816, Ivanovci, † 18. marec 1858, Puconci."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%86%DB%8C_%DA%A9%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Lenny_Kaye_and_guitar_1978.jpg","page_title":"لنی کی","context_page_description":"لنی کی یک موسیقی‌دان اهل ایالات متحده آمریکا است. وی از سال ۱۹۶۴ میلادی تاکنون مشغول فعالیت بوده‌است."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B5%E3%83%8A%E3%82%A4%E3%83%B3%E4%BF%AE%E9%81%93%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Armenia_with_NKR_relief_map.png","page_title":"サナイン修道院","context_page_description":"サナイン修道院とは、10世紀から建築が始まったアルメニア教会の修道院である。2000年に、拡張登録という形で同時代に建設されたハフパット修道院とあわせて、UNESCOの世界遺産に登録された。"},{"page_url":"https://ja.wikipedia.org/wiki/%E7%B5%B6%E4%BD%93%E5%BB%B6%E5%91%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Osaka-jo_Hall_in_201408.JPG","page_title":"絶体延命","context_page_description":"『絶体延命』は、2012年1月11日にEMIミュージック・ジャパンからDVD及びBlu-ray Discで発売された、日本のロックバンドRADWIMPSのライブビデオである。"},{"page_url":"https://en.wikipedia.org/wiki/Oparara_Basin_Arches","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/Inside_Oparara_Arch.jpg","page_title":"Oparara Basin Arches","context_page_description":"The Oparara Basin Arches are a number of natural limestone tunnels formed by the Oparara River, in the Oparara Basin, New Zealand. The two most famous ones are the 'Oparara Arch', large enough for a multi-storey house, and the 'Moria Gate Arch', which is smaller in height.\\nThe arches can be reached by a forestry road from the main road approximately 9 km north of Karamea. The 12 km road is rough but can be accessed by normal cars most of the year. A carpark with a modern open shelter and toilet facilities just before the bridge over the Oparara River is the starting point for walks of around an hour return to each of the arches. There are also mountain bike tracks and a mountain lake in the area."},{"page_url":"https://de.wikipedia.org/wiki/Reichsgrafschaft_Ortenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Map_Bavaria-Straubing_-_Karte_Straubing-Holland.png","page_title":"Reichsgrafschaft Ortenburg","context_page_description":"Die Reichsgrafschaft Ortenburg war eine reichsunmittelbare Grafschaft der Grafen von Ortenburg im Heiligen Römischen Reich. Hauptsitz war die Feste Ortenburg über dem Markt Ortenburg in Niederbayern. Die Reichsgrafschaft bestand von etwa 1120 bis 1805 mitten im Herrschaftsraum des Herzogtums Bayern.\\nIm Hochmittelalter umfasste die Grafschaft verstreute Gebiete in Altbayern, der Oberpfalz, Oberösterreich, Niederösterreich und Tirol. Mitte des 13. Jahrhunderts verfiel jedoch ihre Macht und ihr Herrschaftsraum verringerte sich auf nur vier Quadratkilometer um Ortenburg herum. Dennoch konnte die Reichsgrafschaft ihren Einfluss im Reich wahren und ihre Unabhängigkeit bis zum Tausch mit dem bayerischen Kurfürsten im Jahre 1805 stets beibehalten.\\nNach dem Niedergang der Grafen von Ortenburg übernahmen die Wittelsbacher den sogenannten Ortenburger Panther in ihr Erbwappen, um ihre Ansprüche auf die Gebiete Altbayerns zu verdeutlichen. Dieser steht heute im Bayerischen Staatswappen für Ober- und Niederbayern."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BB%E3%83%AB%E3%82%B2%E3%82%A4%E3%83%BB%E3%83%80%E3%83%B4%E3%82%A3%E3%83%89%E3%83%95_(%E3%83%95%E3%82%A3%E3%82%AE%E3%83%A5%E3%82%A2%E3%82%B9%E3%82%B1%E3%83%BC%E3%83%88%E9%81%B8%E6%89%8B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Sergei_Davydov.JPG","page_title":"セルゲイ・ダヴィドフ (フィギュアスケート選手)","context_page_description":"セルゲイ・ドミトリエヴィチ・ダヴィドフは、ロシアロストフ州ロストフ・ナ・ドヌ出身のロシア、ベラルーシの元フィギュアスケート選手、フィギュアスケートコーチ。\\n2002年ソルトレイクシティオリンピック、2006年トリノオリンピックベラルーシ代表。"},{"page_url":"https://en.wikipedia.org/wiki/Lat_Krabang_District","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9e/%E0%B8%AA%E0%B8%96%E0%B8%B2%E0%B8%9A%E0%B8%B1%E0%B8%99%E0%B9%80%E0%B8%97%E0%B8%84%E0%B9%82%E0%B8%99%E0%B9%82%E0%B8%A5%E0%B8%A2%E0%B8%B5%E0%B8%9E%E0%B8%A3%E0%B8%B0%E0%B8%88%E0%B8%AD%E0%B8%A1%E0%B9%80%E0%B8%81%E0%B8%A5%E0%B9%89%E0%B8%B2%E0%B9%80%E0%B8%88%E0%B9%89%E0%B8%B2%E0%B8%84%E0%B8%B8%E0%B8%93%E0%B8%97%E0%B8%AB%E0%B8%B2%E0%B8%A3%E0%B8%A5%E0%B8%B2%E0%B8%94%E0%B8%81%E0%B8%A3%E0%B8%B0%E0%B8%9A%E0%B8%B1%E0%B8%87001.jpg","page_title":"Lat Krabang District","context_page_description":"Lat Krabang is one of the eastern districts of Bangkok.\\nNeighboring districts are: Bang Bo, Bang Sao Thong and Bang Phli; Prawet, Saphan Sung, Min Buri and Nong Chok and Mueang Chachoengsao.\\nIn October 2005, the plan to create the special administrative area Nakhon Suvarnabhumi around Suvarnabhumi Airport became public. Lat Krabang was among the five districts that were to be included in this new administrative area."},{"page_url":"https://en.wikipedia.org/wiki/Bedkot","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Kanchanpur.png","page_title":"Bedkot","context_page_description":"Bedkot Municipality is in Kanchanpur District of Kanchanpur. Bedkot Municipality was formed on 18 September 2015 by merging Daiji and Suda VDCs. Bedkot Municipality Office is in Sisaiya Bazar.\\nIt Has 11 numbers of ward at the first time but later on ward no.11 is renamed as ward no.10."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9B%CE%B9%CE%BC%CE%AD%CE%BD%CE%B5%CF%82_%CE%9C%CE%AC%CE%BB%CE%BC%CF%80%CE%B5%CF%81%CE%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/MulberryB_-_Piers.jpg","page_title":"Λιμένες Μάλμπερι","context_page_description":"Οι λιμένες Μάλμπερι ήταν δύο προκατασκευασμένοι προσωρινοί λιμένες που κατασκευάστηκαν από τους Βρετανούς σε δύο από τις παραλίες της απόβασης της Νορμανδίας το 1944. Κύριος σκοπός των λιμένων αυτών ήταν η από θαλάσσης υποστήριξη των αποβιβασμένων δυνάμεων με πολεμικό υλικό, καύσιμα και τρόφιμα."},{"page_url":"https://es.wikipedia.org/wiki/Scenopoeetes_dentirostris","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Tooth_billed_bowerbird_-_bower.jpg","page_title":"Scenopoeetes dentirostris","context_page_description":"El pergolero dentado ​ es una especie de ave paseriforme de la familia Ptilonorhynchidae propia de Australia. Es el único miembro del género Scenopoeetes."},{"page_url":"https://gl.wikipedia.org/wiki/Clase_Arleigh_Burke","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/USS_Mason_DDG-87_Crest.png","page_title":"Clase Arleigh Burke","context_page_description":"Clase Arleigh Burke é un tipo de destrutor norteamericano da Armada dos Estados Unidos de América é o deseño no que se basean as F-100 da Armada Española. Foi a primeira serie de buques construídos para o sistema de combate AEGIS.\\nNa Base Naval de Rota en España están destinados catro destes destrutores, Escuadra 60 de Destrutores:\\nUSS Carney\\nUSS Ross\\nUSS Donald Cook\\nUSS Porter"},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_spoorwegstations_in_Nederland","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Den_Haag_station_Laan_NOI.jpg","page_title":"Lijst van spoorwegstations in Nederland","context_page_description":"Hieronder volgt een lijst van alle huidige 400 spoorwegstations in Nederland en op korte termijn te openen nieuwe stations met verwacht jaartal van ingebruikname. Van deze stations worden er vier alleen bij evenementen in de naastliggende stadions gebruikt, Eemshaven alleen als de veerdienst naar Borkum gaat, en Utrecht Maliebaan alleen als het Spoorwegmuseum open is."},{"page_url":"https://pt.wikipedia.org/wiki/Anita_Sarkeesian","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Anita_Sarkeesian_headshot.jpg","page_title":"Anita Sarkeesian","context_page_description":"Anita Sarkeesian é uma feminista de origem canadense, crítica de mídia e blogueira. Ela é a autora do videoblog \\"Feminist Frequency\\" e da série de vídeos Tropes vs. Women e Tropes vs. Women in Video Games, que examinam clichês na representação de mulheres na cultura popular.\\nEm 2012, Sarkeesian foi alvo de uma campanha de assédio virtual após ter lançado um projeto no Kickstarter para financiar a série Tropes vs. Women in Video Games. Ao mesmo tempo, apoiadores doaram mais de US$ 150 mil ao projeto, muito além do objetivo inicial de US$ 6 mil. A situação foi extensivamente divulgada na mídia, colocando Sarkeesian no centro de discussões sobre misoginia na cultura dos video games e assédio virtual. Subsequentemente, ela tem continuado a estudar percepções de gênero em video games e falar publicamente sobre problemas que ela percebe na indústria e na cultura. Em 2014, ela se tornou o tópico de ameaças terroristas contra sua conferência na Universidade do Estado de Utah, como divulgado em manchetes internacionais."},{"page_url":"https://pl.wikipedia.org/wiki/Berta_Holenderska","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Bertha_of_holland.jpg","page_title":"Berta Holenderska","context_page_description":"Berta Holenderska – francuska królowa, żona króla Francji Filipa I w latach 1072–1092, matka Ludwika VI Grubego.\\nByła córką Florisa I – grafa Holandii z dynastii Gerolfingów. W 1072 została wydana za mąż za Filipa I przez matkę Gertrudę Saską oraz ojczyma Roberta I Fryzyjskiego. Stało się to już po śmierci jej ojca, który zginął w 1061. Celem małżeństwa było umocnienie politycznych związków Francji z ziemiami niderlandzkimi przeciwko Wilhelmowi Zdobywcy.\\nZ Filipem I Berta Holenderska miała pięcioro dzieci:\\nKonstancję, żonę Hugona I, hrabiego Szampanii, Boemunda I, księcia Antiochii,\\nLudwika VI Grubego, króla Francji, hrabiego Vexin i Vermandois,\\nHenryka,\\nKarola,\\nEudesa.\\nW 1092 Berta Holenderska pod pretekstem bycia zbyt grubą została oddalona przez Filipa I, który związał się z Bertradą de Montfort, żoną swego wasala Fulka, hrabiego Andegawenii. Umieszczono ją w Montreuil, gdzie krótko potem zmarła, mając ok. 38 lat."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BF%D1%96%D1%81_%D1%81%D1%8B%D1%81%D1%83%D0%BD%D0%BE%D1%9E_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Water.vole.arp.jpg","page_title":"Спіс сысуноў Азербайджана","context_page_description":"Спіс сысуноў Азербайджана ўключае каля 109 відаў класа сысуны, якія насяляюць на тэрыторыі Азербайджана.\\nЗ 109 указаных у табліцы відаў, 0 верагодна знік, 0 знаходзіцца пад крытычнай пагрозай, 2 знаходзіцца пад пагрозай знікнення, 5 схільныя да знікнення, 13 знаходзяцца ў блізкім да пагрозлівага стане.\\nНаступныя тэгі выкарыстоўваюцца для вылучэння ахоўнага статусу кожнага віду па адзнаках МСАП:"},{"page_url":"https://ru.wikipedia.org/wiki/Cardiocondyla_pirata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Cardiocondyla_pirata_paratype_-_ZooKeys-301-013-g003.jpg","page_title":"Cardiocondyla pirata","context_page_description":"Cardiocondyla pirata — вид мелких муравьёв рода Cardiocondyla из подсемейства мирмицин с необычной окраской тела. Эндемик Юго-Восточной Азии: Филиппины."},{"page_url":"https://no.wikipedia.org/wiki/Oban_(New_Zealand)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Oban_Stewart_Island.jpg","page_title":"Oban (New Zealand)","context_page_description":"Oban er det største tettstedet på Stewart Island som er den sørligste av New Zealands tre hovedøyer. Oban ligger i Halfmoon Bay. Det finnes flyforbindelse til Invercargill og fergeforbindelse til Bluff.\\nTettstedet er oppkalt etter Oban i Skottland. Oban har rundt 400 innbyggere og turisme til Rakiura nasjonalpark og fiske er hovednæring."},{"page_url":"https://id.wikipedia.org/wiki/Kecambah_kedelai","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Korean_soup-Kongnamul_guk-01.jpg","page_title":"Kecambah kedelai","context_page_description":"Kecambah kedelai atau kecambah kacang kedelai, disebut kongnamul dalam bahasa Korea, adalah tumbuhan muda yang baru saja berkembang dari tahap embrionik di dalam kedelai."},{"page_url":"https://nl.wikipedia.org/wiki/Kalv%C3%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/2012-06-02_22_Kalv%C3%B8_Havn.JPG","page_title":"Kalvø","context_page_description":"Kalvø is een Deens eiland in de Genner Bugt, aan de oostkust van Jutland, bij de Kleine Belt. Het eiland maakt deel uit van de parochie Øster Løgum, behorende tot de gemeente Aabenraa."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EB%B8%8C%EB%A1%9C%EB%B3%B4_%EB%A1%9C%EC%8A%A4%ED%88%AC%EC%83%A4_%EC%8B%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Map_of_Mavrovo_i_Rostu%C5%A1a_Municipality.svg","page_title":"마브로보 로스투샤 시","context_page_description":"마브로보 로스투샤 시는 마케도니아 공화국 서부에 위치한 지방 자치체로 행정 중심지는 로스투샤이며 면적은 663.19km², 인구는 8,618명이다. 북쪽으로는 고스티바르 시, 동쪽으로는 키체보 시, 남쪽으로는 데바르 시와 접하며 서쪽으로는 알바니아와 국경을 접한다."},{"page_url":"https://en.wikipedia.org/wiki/List_of_consorts_of_Brittany","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Hrobka.jpg","page_title":"List of consorts of Brittany","context_page_description":"A royal consort is the spouse of a ruling monarch. Consorts of monarchs in the Duchy of Brittany and its predecessor states had no constitutional status or power, but many had significant influence over their spouse. Listed are the wives of the Dukes of Brittany who were styled Duchesses of Brittany. Although there were six suo jure Duchesses of Brittany, the husbands of those duchesses were jure uxoris dukes and not consorts. Brittany is no longer a duchy and the title is currently not being used by the defunct Royal Family of France, so the position of Duchess of Brittany is vacant. Little is known about the duchesses whose husbands reigned prior to the year 900 besides their names.\\nNot all wives of the monarchs became consorts, as they may have died, been divorced, or had their marriage declared invalid prior to their husband's accession to the throne, or married him after his abdication. Such cases include\\nBeatrice of England, the second daughter of Henry III, King of England; only wife of John II, married 22 January 1260, died 24 March 1275.\\nMarie, Viscountess of Limoges, the second daughter of Guy VI, Viscount of Limoges; first wife of Arthur II, married 1275, died 1291."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%85%E5%A4%96%E7%B7%9A%E6%BA%AB%E5%BA%A6%E8%A8%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Infrarot-Thermometer_2011-by-RaBoe-04.jpg","page_title":"紅外線溫度計","context_page_description":"紅外線溫度計，分為固定式測溫儀與手持式測溫槍，是一種利用偵測物體表面的紅外線量進而達成溫度測量的溫度計。因為紅外線量越大說明溫度越高，所以可以使用紅外線測量溫度，測量範圍一般在400 ℃以內，最高可達3000℃，測量誤差在 1～3% 之間。\\n紅外線溫度計通常備有雷射，幫助用戶確定測量區域。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%BC%8A%E6%8B%89%E5%85%8B%E5%AE%97%E6%95%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Baghdad_Latin_Church.jpg","page_title":"伊拉克宗教","context_page_description":"伊斯兰教是伊拉克共和国的官方宗教，但伊拉克宪法保障宗教自由。伊拉克是一个多民族，多宗教的国家，伊斯兰教、琐罗亚斯德教、基督宗教、亚兹迪、犹太教、曼达安教、巴哈伊教和许多其他宗教都在该国有存在。什叶派穆斯林在伊拉克有50-55％的人数，而逊尼派穆斯林则有32-37％的人口。伊拉克许多城市都是在历史上对什叶派和逊尼派穆斯林都是重要的地区，包括纳杰夫、卡尔巴拉、巴格达和萨马拉。"},{"page_url":"https://sl.wikipedia.org/wiki/Piran","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Piran_panorama1.JPG","page_title":"Piran","context_page_description":"Piran je obmorsko istrsko mestno naselje na slovenski strani Piranskega zaliva, sedež istoimenske občine, župnije in upravne enote.\\nNaselje se nahaja na samem rtu Piranskega polotoka, v neposredni bližini Portoroža.\\nPiran se nahaja na območju, kjer avtohtono živijo pripadniki italijanske narodne skupnosti in kjer je poleg slovenščine uradni jezik tudi italijanščina."},{"page_url":"https://en.wikipedia.org/wiki/List_of_tallest_buildings_in_Salt_Lake_City","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/257_towers_building.jpg","page_title":"List of tallest buildings in Salt Lake City","context_page_description":"This list of tallest buildings in Salt Lake City ranks skyscrapers in the U.S. city of Salt Lake City, Utah by height. The tallest building in the city is the Wells Fargo Center, which rises 422 feet and was completed in 1998."},{"page_url":"https://pl.wikipedia.org/wiki/O%C5%82tarz_Jerozolimski","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Gda%C5%84sk_Entry_into_Jerusalem.jpg","page_title":"Ołtarz Jerozolimski","context_page_description":"Ołtarz Jerozolimski – gotyckie retabulum ołtarzowe, wykonane około 1495–1500 przez anonimowego malarza, przypuszczalnie dolnoreńskiego, zaznajomionego z malarstwem gdańskim, nadreńskim i niderlandzkim.\\nZleceniodawcą dzieła było prawdopodobnie Bractwo Kapłańskie kościoła Mariackiego w Gdańsku. Malowidła ukazują wybrane epizody z życia Jezusa Chrystusa ukazane w konwencji narracyjno-symultanicznej, których dopełnienie tworzy bogata sceneria krajobrazowo-architektoniczna. Dominantę krajobrazu tworzy panorama Jerozolimy. Ołtarz był pierwotnie umieszczony w kaplicy Jerozolimskiej w obrębie kościoła Mariackiego w Gdańsku, a po roku 1945 trafił do zbiorów warszawskiego Muzeum Narodowego, gdzie znajduje się do dnia dzisiejszego. Dzieło charakteryzuje się wysoką klasą artystyczną. Posiada unikatowy program ideowy o charakterze chrystologicznym, sakramentalnym i eklezjologicznym. Obrazuje słuszność nauki Chrystusa i eucharystyczny wymiar chleba-Ciała i wina-Krwi Chrystusowej, oraz istotę Kościoła, jego działalność apostolską, udzielanie sakramentów i głoszenie prawdy, której źródłem jest Chrystus."},{"page_url":"https://nl.wikipedia.org/wiki/Nasidius_truncatifrons","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Nasidius_truncatifrons.JPG","page_title":"Nasidius truncatifrons","context_page_description":"Nasidius truncatifrons is een rechtvleugelig insect uit de familie Anostostomatidae. De wetenschappelijke naam van deze soort is voor het eerst geldig gepubliceerd in 1878 door Stål."},{"page_url":"https://lb.wikipedia.org/wiki/Kierch_Beetebuerg","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/DuUerBeet.JPG","page_title":"Kierch Beetebuerg","context_page_description":"D'Kierch vu Beetebuerg ass eng kathoulesch Kierch déi zur Par Beetebuerg–Fréiseng Saint-André, zum Dekanat Süden-Ost an zu der Gemeng Beetebuerg gehéiert.\\nSi steet zentral an der Uertschaft un der Escher Strooss, der N13."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D8%B3%D8%A8%D9%88%D8%B9_%D8%A7%D9%84%D9%85%D9%88%D8%B6%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Andre_Leon_Talley_by_David_Shankbone.jpg","page_title":"أسبوع الموضة","context_page_description":"أسبوع الموضة هو حدث في صناعة الأزياء. ويستمر لأسبوع واحد تقريبا. وفيه يسمح لمصممي الأزياء والعلامات التجارية أو \\"بيوت الأزياء\\" عرض أحدث مجموعاتهم في عروض الأزياء ويسمح للمشترين ووسائل الإعلام بإلقاء نظرة على أحدث الصيحات. والأهم من ذلك، أن هذه الأحداث تعلم الصناعة ماهو دارج أو غير دارج لهذا الموسم.\\nتقام أسابيع الموضة الأبرز في عواصم الموضة الأربعة في العالم: مدينة نيويورك ولندن وميلانو وباريس. وتعقد بعض أهم أسابيع الموضة في العالم في أستراليا وبنغالور وجاكرتا وبرلين وبانكوك وبرشلونة وسيول وطوكيو وساو باولو ولوس انجليس ولودز وروما ودبي وهونغ كونغ وبوينس آيرس وسنغافورة ووتورونتو ودالاس ومدريد."},{"page_url":"https://af.wikipedia.org/wiki/Israel-museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Jerusalem_Schrein_des_Buches_BW_1.JPG","page_title":"Israel-museum","context_page_description":"Die Israel-museum in Jerusalem is in 1965 as Israel se nasionale museum gestig. Dit is op 'n heuwel in die weste van Jerusalem, naby die parlementsgebou en die Nasionale Kampus vir die Argeologie van Israel, geleë.\\nDie museum het 'n oppervlakte van sowat 50 000 m², insluitende 'n tuin van 24 000 m², en word jaarliks deur byna een miljoen belangstellendes besoek.\\nDie museum behels vier afdelings:\\ndie Kunsafdeling met die Billy-Rose-kunstuin,\\ndie Afdeling vir Judaica en Joodse etnografie,\\ndie Argeologiese Afdeling met die Heiligdom van die Boek waar enkele van die Dooie See-rolle bewaar word, en\\ndie Jeugafdeling."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%BA%AB%E7%89%B9%E6%96%AF_(%E5%BE%B7%E5%85%8B%E8%96%A9%E6%96%AF%E5%B7%9E)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/TXMap-doton-Winters.PNG","page_title":"溫特斯 (德克薩斯州)","context_page_description":"温特斯是一个在美国德克萨斯州兰纳尔斯郡中的一个城市。根据2010年美国人口普查，人口数量为2,562"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%82%BE%E8%A7%92%E9%BE%8D%E5%B1%AC","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/da/Prenoceratops_BW.jpg","page_title":"傾角龍屬","context_page_description":"傾角龍屬是生存於白堊紀晚期的角龍類，屬於纖角龍科，化石於美國蒙大拿州的雙麥迪遜組被發現。傾角龍生存於坎潘階，約7430萬年前。"},{"page_url":"https://en.wikipedia.org/wiki/Chebei_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Chebei_Station_Concourse.JPG","page_title":"Chebei station","context_page_description":"Chebei Station is a station of Guangzhou Metro Line 4. It is located at the underground of the junction of Chebei Road and Zhongshan Avenue in Tianhe District. It started operation on 25 September 2010."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%A7%DA%A9%D8%B3_%D8%A7%D9%88%DB%8C%D9%88%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Max_Euwe.jpg","page_title":"ماکس اویوه","context_page_description":"ماکس اویوه ‏ استادبزرگ شطرنج، ریاضی‌دان و نویسندهٔ هلندی بود. او پنجمین قهرمان رسمی شطرنج جهان از ۱۹۳۵ تا ۱۹۳۷ و چهارمین رئیس فیده از ۱۹۷۰ تا ۱۹۷۸ بود. او در سال ۱۹۳۵ به دیدار الکساندر آلخین رفت و او را با نتیجه ۹ برد و ۸ شکست و ۱۳ تساوی شکست داد و به عنوان قهرمانی شطرنج جهان دست یافت ولی دو سال بعد در ۱۹۳۷ با نتیجه ۴ برد و ۱۰ شکست و ۱۱ تساوی عنوان خود را به الکساندر آلخین واگذار کرد. اویوه از سال ۱۹۲۱ تا ۱۹۵۲ در تمام دوره‌های قهرمانی شطرنج هلند که در آن شرکت کرد به پیروزی رسید و علاوه بر آن در سال ۱۹۵۵ هم این عنوان را به دست آورد و در مجموع با ۱۲ قهرمانی رکورددار قهرمانی در هلند است.\\nاو همچنین مفسر و نویسنده بسیاری از کتابهای آموزشی شطرنج از جمله تئوری وسط بازی شطرنج که به زبان هنلدی نوشته شده بود، می باشد. کتاب ایشان نخست به زبان انگلیسی ترجمه شد سپس از این طریق به زبان فارسی ترجمه یافت."},{"page_url":"https://fr.wikipedia.org/wiki/Bons_baisers_de_Russie_(jeu_vid%C3%A9o)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Sean_Connery_as_James_Bond_%281971%29.jpg","page_title":"Bons baisers de Russie (jeu vidéo)","context_page_description":"Bons baisers de Russie est un jeu vidéo de tir en vue à la troisième personne comprenant des séquences de jeu de course, sorti en 2005 et édité et développé par Electronic Arts en collaboration avec Rebellion Developments pour la version PSP. Il met en vedette l'agent secret d'Ian Fleming, James Bond. Le jeu est basé sur le roman de 1957 et sur le film de 1963 du même nom.\\nLe jeu suit le scénario du livre et du film avec toutefois l'ajout de nouvelles scènes pour ajouter de l'action. Dans le jeu, James Bond est par ailleurs équipé de gadgets issus de films suivants comme le jet pack d'Opération tonnerre ou l'Aston Martin DB5 qui apparaît la première fois dans Goldfinger. Il est l'unique jeu vidéo James Bond à représenter 007 sous les traits de Sean Connery. Bons baisers de Russie est le dernier jeu vidéo James Bond commercialisée par EA Games. En effet, Activision récupère les droits en 2006."},{"page_url":"https://qu.wikipedia.org/wiki/Jos%C3%A9_Camacho","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Jose_Antonio_Camacho.jpg","page_title":"José Camacho","context_page_description":"José Álvaro Antonio Pastor Camacho Alfaro sutiyuq runaqa, Ispaña mama llaqtayuq piluta hayt'aqmi wan pukllaykamachiq qarqan.\\nTayta:\\nYachay wasikuna."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%95%D7%9C%D7%98%D7%99%D7%9E%D7%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Ultimo_Sydney_Institute_2.JPG","page_title":"אולטימו","context_page_description":"אולטימו הוא פרוור בסידני. אולטימו מנוהל על ידי עיריית סידני."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_du_Gers","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Condom_-_H%C3%B4tel_du_Bouzet_de_Roquepine_-1.JPG","page_title":"Liste des monuments historiques du Gers","context_page_description":"Cet article recense les monuments historiques du Gers, en France.\\nPour les monuments historiques de la commune d'Auch, voir la liste des monuments historiques d'Auch"},{"page_url":"https://en.wikipedia.org/wiki/340th_Weapons_Squadron","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/340th_Bombardment_Squadron_-_SAC_-_Emblem.png","page_title":"340th Weapons Squadron","context_page_description":"The 340th Weapons Squadron is a United States Air Force unit assigned to the USAF Weapons School. It is stationed at Barksdale Air Force Base, Louisiana. The 340th is assigned to the 57th Wing, at Nellis Air Force Base, Nevada. The mission of the squadron is to provide Boeing B-52 Stratofortress instructional flying.\\nOn 3 February 1942, Captain Paul Tibbets was given command of a new squadron that would later become the 340th Bombardment Squadron. The 340th Bomb Squadron was involved in combat missions in both the European and Mediterranean theaters from 1942 through 1945. The most notable of these were the Operation Tidal Wave raids on Hitler’s largest oil refinery in Ploiești, Romania. During the Vietnam War, B-52 crews from the 340th BS participated in the Linebacker offensives over the skies of North Vietnam. In August 1990 the 340th deployed aircrews for Operation Desert Storm."},{"page_url":"https://fi.wikipedia.org/wiki/Kanta-H%C3%A4meen_vaakuna","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Landskaps_vapen_gustav_vasas_grav_Tavast.jpg","page_title":"Kanta-Hämeen vaakuna","context_page_description":"Kanta-Hämeen vaakuna on Kanta-Hämeen maakunnan heraldinen tunnus. Sisäministeriön vuonna 1963 vahvistama vaakunaselitys kuuluu: \\"Punaisessa kentässä kävelevä kultainen ilves, jonka korvatöyhdöt mustat; saatteena ilveksen yläpuolella kolme kuusisakaraista tähteä ja alapuolella neljä ruusua sijoitettuina 1:3; kaikki hopeaa. Kilven päällä herttuakunnan kruunu.\\" Erotukseksi Hämeen historiallisen maakunnan vaakunasta nykymaakunta ei käytä vaakunan päällä herttuakunnan kruunua."},{"page_url":"https://en.wikipedia.org/wiki/Sing_Sing","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Sing_Sing_012.jpg","page_title":"Sing Sing","context_page_description":"Sing Sing Correctional Facility is a maximum-security prison operated by the New York State Department of Corrections and Community Supervision in the village of Ossining, New York. It is about 30 miles north of New York City on the east bank of the Hudson River. Sing Sing holds about 1,700 prisoners.\\nThe name \\"Sing Sing\\" was derived from the Sintsink native American tribe from whom the land was purchased in 1685. In 1970, the name was changed to the \\"Ossining Correctional Facility,\\" but it reverted to its original name in 1985. There are plans to convert the original 1825 cell block into a period museum.\\nThe prison property is bisected by the Metro-North Railroad's four-track Hudson Line."},{"page_url":"https://pl.wikipedia.org/wiki/Marimba","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Marimba-Antonko-AMC12.jpg","page_title":"Marimba","context_page_description":"Marimba – instrument muzyczny z grupy idiofonów. W wersji etniczej - prymitywna odmiana ksylofonu z rezonatorami, używana w południowej i środkowej Afryce oraz Ameryce Środkowej; w wersji używanej przez klasycznych perkusistów – instrument o bardzo dużych możliwościach barwowych i dynamicznych, używany do gry solo, w zespołach oraz do występów z orkiestrami symfonicznymi.\\nW 2010 roku muzyka na marimbę i tradycyjne śpiewy z regionu Południowego Pacyfiku w Kolumbii zostały wpisane na listę niematerialnego dziedzictwa UNESCO.\\nWiele utworów na marimbę napisano dopiero po II wojnie światowej, choć wykonuje się na niej z powodzeniem np. utwory J.S. Bacha. Soliści grający na marimbie zazwyczaj posługują się dwiema parami specjalnych pałek.\\nMarimba pozwala na wirtuozerskie popisy solistyczne, dlatego interesujące wykonania utworów na marimbę są zazwyczaj przyjmowane z dużym aplauzem przez publiczność sal koncertowych.\\nJednym z bardziej znanych kompozytorów i wirtuozów marimby jest Japonka Keiko Abe. Marimbafoniści często wykonują również utwory Neya Rosauro ze względu na ich melodyjność i możliwości popisu solowego."},{"page_url":"https://pl.wikipedia.org/wiki/Zamek_w_Pilicy","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Pa%C5%82ac_w_Pilicy4.jpg","page_title":"Zamek w Pilicy","context_page_description":"Zamek w Pilicy – zamek leżący na Jurze Krakowsko-Częstochowskiej, w mieście Pilica, w województwie śląskim. Otoczony fortyfikacjami bastionowymi zamek składa się z 4 skrzydeł otaczających wewnętrzny dziedziniec."},{"page_url":"https://en.wikipedia.org/wiki/New_York_City_Police_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/NYPD_museum_Gov_Is_jeh.jpg","page_title":"New York City Police Museum","context_page_description":"The New York City Police Museum is a museum that features the history and contributions of the New York City Police Department since its establishment in 1845. The museum is located in Lower Manhattan in New York City, near Wall Street and the South Street Seaport. While one of the museum's primary focuses is a memorial to the September 11 attacks, the museum contains a wide range of information on the history of the NYPD.\\nThe museum, which grew from a gallery housed at the New York City Police Academy, opened at 26 Broadway at Bowling Green in January 2000 and re-opened in a new location at 100 Old Slip, former home of the First Precinct, in January 2002. In October 2012, Hurricane Sandy caused substantial damage at 100 Old Slip, and the museum reopened on October 24, 2013 at 45 Wall Street. That location closed in 2014 and the museum's future plans are unclear. While there were attempts to move the museum to Pershing Hall, a historic building on Governors Island, to date the museum has only sponsored a few exhibits on the island that is open to the public from May to September."},{"page_url":"https://es.wikipedia.org/wiki/Potencias_del_Eje_en_la_Segunda_Guerra_Mundial","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Flag_of_Bulgaria.svg","page_title":"Potencias del Eje en la Segunda Guerra Mundial","context_page_description":"Las potencias del Eje —en alemán, Achsenmächte; en italiano, Potenze dell'Asse; en japonés 樞軸國 Sūjikukoku—, también conocido como «Eje Roma–Berlín–Tokio» y por su acrónimo «Roberto», ​ formaban el bando beligerante que se enfrentó a los Aliados en la Segunda Guerra Mundial. Estaba formado por Alemania, el Imperio de Japón y el Reino de Italia, y contó con la adhesión de otros países.\\nEstas naciones firmaron el Pacto Tripartito. Este nuevo bloque logró su establecimiento debido a las coincidencias que existían entre los sistemas de gobierno, económico e ideológico de los tres países. De igual forma, compartían tres coincidencias de connotación negativa: fueron los países más perjudicados por el Tratado de Versalles."},{"page_url":"https://fr.wikipedia.org/wiki/Snecma_M53","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/M53-P2%28Modules_8-9-10%29.jpg","page_title":"Snecma M53","context_page_description":"Le Snecma M53 est un turboréacteur double flux simple corps à postcombustion. Conçu par le motoriste français Snecma, il équipe l'avion de combat français Mirage 2000."},{"page_url":"https://en.wikipedia.org/wiki/St_Briavels_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/St_Briavels_Castle_Forest_Horn_Chimney.JPG","page_title":"St Briavels Castle","context_page_description":"St Briavels Castle is a moated Norman castle at St Briavels in the English county of Gloucestershire. The castle is noted for its huge Edwardian gatehouse that guards the entrance.\\nSt Briavels Castle was originally built between 1075 and 1129 as a royal administrative centre for the Forest of Dean. During the 13th century the castle became first a favourite hunting lodge of King John, and then the primary centre in England for the manufacture of quarrels, large numbers of which were required for crossbows in medieval warfare. The castle was transferred many times between royal favourites in the 14th and 15th centuries and slowly declined in appearance and importance. St Briavels Castle became used primarily as a court and as a notorious debtors' prison, conditions being documented by the prison reformer John Howard in 1775. Following local riots and a parliamentary investigation in the 1830s, reforms in the 19th century brought an end to the castle's use as a prison.\\nExtensive renovation at the turn of the 20th century allowed St Briavels Castle to be taken over as a Youth Hostel in 1948. It remains in this role today, owned by English Heritage and open to the public."},{"page_url":"https://fr.wikipedia.org/wiki/Ng%C3%B4_%C4%90%C3%ACnh_Di%E1%BB%87m","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Ngo_Dinh_Diem_at_Washington_-_ARC_542189.jpg","page_title":"Ngô Đình Diệm","context_page_description":"Jean-Baptiste Ngô Đình Diệm, né à Hué le 3 janvier 1901, assassiné à Saïgon le 2 novembre 1963, est un homme d'État vietnamien, Premier ministre de l'État du Viêt Nam de 1954 à 1955, puis président de la république du Viêt Nam de 1955 à 1963.\\nLuttant contre l'extension et l'influence communiste dans le pays, Ngô Đình Diệm est un personnage clé de l'escalade de la guerre du Viêt Nam à cause notamment de son refus, avec l'appui de ses alliés américains, d'organiser le référendum d'autodétermination prévu dans la déclaration finale des accords de Genève. On lui prête la formule : « plutôt la guerre que les camps de rééducation ».\\nDévot et célibataire, il fait remplir, pendant ses années comme président de la République du Viêt Nam, la fonction de « Première dame » à l’épouse de son frère Ngô Đình Nhu. Il a lui-même contribué à mettre en place cette république, à la suite des accords de Genève qui avaient mis fin à la Première Guerre d'Indochine.\\nNgô Đình Diệm a souvent été décrit comme anti-bouddhiste dans un pays à forte majorité bouddhiste, et anti-communiste alors que le mouvement nationaliste comprend en son sein une composante communiste soutenue par l'URSS et la Chine."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%95%D7%A0%D7%9E%D7%99%D7%9C%D7%90%D7%99%D7%95_%D7%A8%D7%A0%D7%A1%D7%95%D7%9D-%D7%A7%D7%95%D7%98%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/70_year_old_Funmilayo_Ransome-Kuti_on_her_birthday.png","page_title":"פונמילאיו רנסום-קוטי","context_page_description":"פונמילאיו רנסום קוטי, הייתה מורה, פעילה פוליטית, פעילה למען זכויות נשים ובת לאצולה המסורתית של ניגריה. היא הייתה במהלך חייה אחת ממנהיגי הדור הבולטים. היא גם הייתה האישה הראשונה במדינתה לנהוג במכונית. פעילותה הפוליטית זיכתה אותה בכינוי \\"אם אפריקה\\" והיא נחשבה גם לאם תנועת הנשים בניגריה. היא הייתה דמות משפיעה במאבק למען הכרה בזכות הצבעה לנשים, וכונתה פעם בעיתון \\"הלביאה מליסאבי\\" בשל הנהגתה את הקמפיין של נשות עם האגבה נגד מיסוי לא הוגן. מאבק זה הוביל לוויתורו של המלך אובה אדמולה השני על כס מלכותו ב-1949.\\nקוטי היא אמם של הפעילים למען זכויות האדם פלה קוטי, המוזיקאי; בקו רנסום-קוטי, רופא; ופרופסור אוליקוייה רנסום-קוטי, גם הוא רופא ושר הבריאות לשעבר של ניגרה. היא גם סבתם של המוזיקאים סאון קוטין ופמי קוטי."},{"page_url":"https://en.wikipedia.org/wiki/Upper_Volga_railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/%D0%9F%D0%BB%D0%B0%D0%BD_%D1%81%D1%82%D1%80%D0%BE%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%B0_%D0%92%D0%B5%D1%80%D1%85%D0%BD%D0%B5-%D0%92%D0%BE%D0%BB%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%B6%D0%B5%D0%BB%D0%B5%D0%B7%D0%BD%D0%BE%D0%B9_%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%B8_Upper_Volga_Railroad_Project.png","page_title":"Upper Volga railway","context_page_description":"The Upper Volga railway was a private railway in the upper Volga region of Russia, built in 1914–1918 and in the second half of the 1930s. It was planned as part of a backup route from St. Petersburg to Moscow. Today the lines are part of the Moscow region of the October Railway."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Lango%C3%ABlan","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Map_commune_FR_insee_code_56099.png","page_title":"Langoëlan","context_page_description":"Langoëlan sī ūi-tī Hoat-kok Bretagne toā-khu Morbihan koān ê chi̍t ê commune."},{"page_url":"https://fr.wikipedia.org/wiki/F%C3%A9lix_Tshisekedi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Secretary_Pompeo_Meets_With_DRC_President_Tshisekedi_%2846615782065%29.jpg","page_title":"Félix Tshisekedi","context_page_description":"Félix Antoine Tshisekedi Tshilombo, né le 13 juin 1963 à Léopoldville, est un homme d'État congolais, président de la République depuis janvier 2019. Il est élu le 9 février 2020, premier vice-président de l’Union africaine pour 2020 et président pour 2021.\\nFils de l'homme politique Étienne Tshisekedi, il est élu président de la République démocratique du Congo lors de l'élection présidentielle de décembre 2018. Bien que controversée du fait d'allégations de fraude électorale, il s'agit de la première alternance politique pacifique depuis l'indépendance du pays. Cependant, des suspicions apparaissent par la suite concernant l'étendue réelle des pouvoirs du nouveau président, celui-ci devant composer avec le camp de son prédécesseur Joseph Kabila, soupçonné de vouloir continuer à diriger le pays dans l'ombre."},{"page_url":"https://sv.wikipedia.org/wiki/Riley_Sheahan","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Riley_Sheahan_2018-03-03_19621.jpg","page_title":"Riley Sheahan","context_page_description":"Riley Michael Sheahan, född 7 december 1991 i St. Catharines, är en kanadensisk professionell ishockeyspelare som spelar för Florida Panthers i NHL.\\nHan har tidigare spelat på NHL-nivå för Pittsburgh Penguins och Detroit Red Wings och på lägre nivåer för Grand Rapids Griffins i AHL, Notre Dame Fighting Irish i CCHA och St. Catharines Falcons i GOJHL."},{"page_url":"https://sv.wikipedia.org/wiki/Sk%C3%A4rtorsdagen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Washing_of_the_Feet.jpg","page_title":"Skärtorsdagen","context_page_description":"Skärtorsdagen är en kristen högtidsdag som infaller torsdagen före påsk, dagen efter dymmelonsdagen, före långfredagen, i stilla veckan.\\nI Romersk-katolska kyrkan är skärtorsdagen en reningsdag, varav ordet skärtorsdag är bildat. \\"Skär\\" kommer från ett fornnordiskt ord för 'ren', 'vacker', 'blank' eller 'klar', som också finns i förleden till ordet skärseld. Dagens namn är det samma på norska och danska. I äldre tid sade man omväxlande \\"skärdag\\" och \\"skärhelgd\\" om denna torsdag."},{"page_url":"https://eu.wikipedia.org/wiki/Lurra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Earth_heat_flow.jpg","page_title":"Lurra","context_page_description":"Lurra Eguzki-sistemako hirugarren planeta da, dentsoena eta bizia duen planeta ezagun bakarra. Datazio erradiometrikoa erabilita eta beste ebidentzia iturri batzuk hartuta, Lurra orain dela 4.500 milioi urte baino gehiago sortu zen. Lurraren grabitateak espazioko beste objektu batzuekin elkarrekintza du, bereziki Eguzkia eta Ilargiarekin, Lurraren satelite natural bakarra. Lurrak Eguzkiaren inguruan bira bat ematen du 365,26 egunean behin, urte gisa ezagutzen den denbora. Denbora honetan zehar Lurrak bere buruari 366,26 bira ematen dizkio.\\nLurraren biraketa-ardatza bere plano orbitalarekiko okertua dago, urtaroak sortuz. Ilargiaren eta Lurraren arteko grabitazio elkarrekintzak itsasaldiak sortzen ditu, Lurra bere ardatzean egonkortzen du eta biraketa abiadura geldotzen du. Lurra da Eguzki-sistemako planetarik dentsoena eta lau planeta telurikoen artean handiena.\\nLurraren litosfera milioika urtetan gainazalean zehar higitzen diren plaka tektoniko izeneko hainbat atal zurrunetan banatuta dago. Lurraren gainazalaren % 71 urez estalita dago. Beste guztia kontinente eta uharteak dira, bertako aintzira eta ur-ibilguak kontuan hartuta."},{"page_url":"https://ca.wikipedia.org/wiki/Art_asturi%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Cruz_de_los_%C3%81ngeles_de_Oviedo.JPG","page_title":"Art asturià","context_page_description":"L'art asturià o preromànic asturià és un estil artístic englobat dins el preromànic, localitzat a la península Ibèrica a la zona adjacent a la mar Cantàbrica que va quedar lliure de l'ocupació musulmana a finals del segle viii. Va ser vigent fins al començament del segle x, quan es va adoptar l'art romànic provinent de França.\\nEncara que és successor de l'estil visigòtic, no es pot dir que l'art asturià sigui hereu legítim seu, perquè no conserva sinó accidentalment algun dels seus elements principals com és l'arc de ferradura. Encara que al començament va ser una imitació molt pobre de l'esmentat art, molt aviat es va manifestar amb nous i originals elements –potser importats de l'Orient o de Llombardia– que el realcen de manera singular, esdevenint un precursor del romànic. L'arquitectura es caracteritza per l'ús de murs de carreus, arcs de mig punt, volta de canó amb arcs faixons i contraforts exteriors. La tipologia principal és la de la planta basilical de tres naus amb creuer i tres capelles rectangulars a la capçalera."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bamberg/Innere_Inselstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Bamberg%2C_Kapuzinerstra%C3%9Fe_22%2C_20150911%2C_002.jpg","page_title":"Liste der Baudenkmäler in Bamberg/Innere Inselstadt","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen kreisfreien Stadt Bamberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Teilliste enthält die Denkmäler des historischen Bereichs der Inneren Inselstadt innerhalb der ehemaligen Stadtbefestigung der Inselstadt."},{"page_url":"https://pt.wikipedia.org/wiki/Museu_Militar_dos_A%C3%A7ores","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Forte_de_S%C3%A3o_Br%C3%A1s%2C_Museu_militar%2C_Ponta_Delgada%2C_ilha_de_S%C3%A3o_Miguel%2C_A%C3%A7ores.JPG","page_title":"Museu Militar dos Açores","context_page_description":"O Museu Militar dos Açores localiza-se no Forte de São Brás, na cidade de Ponta Delgada, na ilha de São Miguel, Região Autónoma dos Açores, em Portugal."},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_punaisten_muistomerkeist%C3%A4_Suomessa","image_url":"https://upload.wikimedia.org/wikipedia/fi/7/75/M%C3%A4nts%C3%A4l%C3%A4n_1918_muistomerkki_1.jpg","page_title":"Luettelo punaisten muistomerkeistä Suomessa","context_page_description":"Luettelo punaisten muistomerkeistä Suomessa sisältää vuonna 1918 Suomen sisällissodassa kaatuneiden punaisten muistoksi pystytetyt muistomerkit: patsaat, veistokset, muistopaikat ja muistolaatat. Luettelossa voi olla myös hautausmailla tai niiden lähellä olevia yleisiä mutta ei yksittäisillä haudoilla olevia muistomerkkejä."},{"page_url":"https://pt.wikipedia.org/wiki/Hist%C3%B3ria_do_Uruguai","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Paysand%C3%BA_-_Puente_General_Artigas.jpg","page_title":"História do Uruguai","context_page_description":"Antes da chegada dos espanhois ao Uruguai, em 1516, os habitantes daquela terra eram os índigenas charruas, chanaés e guaranis, entre outros. Dos milhares de índigenas que lá habitavam, a maioria era da tribo charrua.\\nA primeira colônia se estabeleceu em 1624, em Soriano. Os colonizadores eram espanhóis. Em 1680, um grupo de portugueses fundou a colônia de Sacramento. Logo os espanhóis expulsaram os portugueses. A época da colonização do Uruguai foi marcada pela constante disputa entre espanhóis e portugueses.\\nO registro da história do Uruguai se inicia com a chegada dos primeiros europeus à área no início do século XVI. Tanto a Espanha como Portugal procuraram colonizar o futuro Uruguai. Portugal tinha por base a Colônia do Sacramento, enquanto a Espanha ocupava Montevidéu, fundada no século XVIII e que veio a se tornar a capital do futuro país."},{"page_url":"https://es.wikipedia.org/wiki/Prats_del_Rey","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Santa_Maria_dels_Prats_de_Rei_P1060529.jpg","page_title":"Prats del Rey","context_page_description":"Prats del Rey​​ es un municipio y localidad situado en la parte norte de la comarca de Anoia, en la provincia de Barcelona, comunidad autónoma de Cataluña, España."},{"page_url":"https://pt.wikipedia.org/wiki/Os_Lus%C3%ADadas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Ines_de_castro.jpg","page_title":"Os Lusíadas","context_page_description":"Os Lusíadas é uma obra de poesia épica do escritor português Luís Vaz de Camões, da epopeia portuguesa. Provavelmente concluída em 1556, foi publicada pela primeira vez em 1572 no período literário do Renascimento, três anos após o regresso do autor do Oriente.\\nA obra é composta de dez cantos, 1 102 estrofes e 8 816 versos que são oitavas decassílabas, sujeitas ao esquema rímico fixo AB AB AB CC – oitava rima camoniana. A ação central é a descoberta do caminho marítimo para a Índia por Vasco da Gama, à volta da qual se vão descrevendo outros episódios da história de Portugal, glorificando o povo português."},{"page_url":"https://la.wikipedia.org/wiki/Saint-Martin-d%27Auxy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Map_commune_FR_insee_code_71441.png","page_title":"Saint-Martin-d'Auxy","context_page_description":"Saint-Martin-d'Auxy est commune Francicum 89 incolarum praefecturae Araris et Ligeris in regione Burgundia."},{"page_url":"https://no.wikipedia.org/wiki/Euryglottis","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Euryglottis_dognini_MHNT_CUT_2010_0_112_Limbo_Chapare_Cochabamba_Bolivia_male.jpg","page_title":"Euryglottis","context_page_description":"Euryglottis er en slekt av sommerfugler som tilhører familien svermere."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Berge_oder_Erhebungen_in_Marokko","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Mountain_In_Zagora_%2CMorocco.jpg","page_title":"Liste der Berge oder Erhebungen in Marokko","context_page_description":"Dies ist eine Liste der Berge oder Erhebungen in Marokko, Minimum Schartenhöhe 100 m. Die Höhenangaben weichen je nach Quelle oft geringfügig voneinander ab."},{"page_url":"https://hu.wikipedia.org/wiki/Langenlois","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Langenlois.jpg","page_title":"Langenlois","context_page_description":"Langenlois település Ausztriában, Alsó-Ausztria tartományban, a Kremsvidéki járásban, területe 67,12 km²."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%B0%E0%A7%8D%E0%A6%A8%E0%A6%BF_%E0%A6%B9%E0%A7%87%E0%A6%87%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Ernie_Hayes_1912.jpg","page_title":"আর্নি হেইস","context_page_description":"আর্নেস্ট জর্জ হেইস, এমবিই লন্ডনের পেকহাম এলাকায় জন্মগ্রহণকারী বিখ্যাত ইংরেজ আন্তর্জাতিক ক্রিকেট তারকা ছিলেন। ইংল্যান্ড ক্রিকেট দলের অন্যতম সদস্য ছিলেন তিনি। ঘরোয়া প্রথম-শ্রেণীর ইংরেজ কাউন্টি ক্রিকেটে সারে ও লিচেস্টারশায়ারের প্রতিনিধিত্ব করেছেন আর্নি হেইস। দলে তিনি মূলতঃ ডানহাতি ব্যাটসম্যান হিসেবে খেলতেন।"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%DB%8C%D8%AA%D8%B1_%D8%A7%DB%8C%D8%A8%D8%B1%DB%8C%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Peter_the_Iberian.jpg","page_title":"پیتر ایبریایی","context_page_description":"پیتر ایبریایی شاهزاده، روحانی و فیلسوف گرجی بود."},{"page_url":"https://hu.wikipedia.org/wiki/2018-as_Eurov%C3%ADzi%C3%B3s_Dalfesztiv%C3%A1l","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/ESC2018_-_San_Marino_05.jpg","page_title":"2018-as Eurovíziós Dalfesztivál","context_page_description":"A 2018-as Eurovíziós Dalfesztivál volt a hatvanharmadik Eurovíziós Dalfesztivál. Portugáliában rendezték meg, mivel a 2017-es Eurovíziós Dalfesztivált a portugál Salvador Sobral nyerte meg. Ez volt az első alkalom, hogy a dalfesztivált Portugáliában, azon belül Lisszabonban rendezték meg, valamint 1969 után a második alkalom, hogy a verseny az Ibériai-félszigeten került megrendezésre.\\n43 ország erősítette meg részvételét a dalfesztiválra, beleértve Oroszországot, mely egy kihagyott év után vett részt újból. 2011 óta ez volt az első alkalom, hogy egy ország sem lépett vissza a versenytől. A magyar induló az AWS metal zenekar volt, akik a Viszlát nyár című számukkal nyerték meg A Dalt, a hazai válogató műsort."},{"page_url":"https://de.wikipedia.org/wiki/Giouvetsi","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Giouvetsi.JPG","page_title":"Giouvetsi","context_page_description":"Giouvetsi ist ein Gericht der Griechischen Küche, bei dem Fleisch, Meeresfrüchte oder Gemüse gemeinsam mit den Nudeln in der Sauce im Backofen gegart wird. Es handelt sich um eine Variante des in der Küche Südosteuropas verbreiteten Đuveč oder Güveç.\\nAls Fleisch wird meist Lammfleisch von der Keule verwendet, aber auch Rind- und Kalbfleisch ist üblich. Das Fleisch wird beim Braten im Ganzen gelassen, als Beilage sind die reisförmigen Nudeln, Kritharaki, typisch. Diese werden oft einfach um das Fleisch herum arrangiert und die letzten 20–30 Minuten mitgegart."},{"page_url":"https://zh.wikipedia.org/wiki/2011%E5%B9%B412%E6%9C%8810%E6%97%A5%E6%9C%88%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Lunar_eclipse_from_moon-2012Jun04.png","page_title":"2011年12月10日月食","context_page_description":"2011年12月的月食發生在2011年12月10日，是一次月全食，也是2011年第二次的月食，第一次是發生在同年6月15日的月全食。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%82%BF%E3%83%BC%E3%82%AF_(%E3%83%95%E3%83%AA%E3%82%B2%E3%83%BC%E3%83%88)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/USS_Stark_%28FFG-31%29.jpg","page_title":"スターク (フリゲート)","context_page_description":"スタークは、アメリカ海軍のミサイルフリゲート。オリバー・ハザード・ペリー級ミサイルフリゲートの23番艦。艦名は第8代海軍作戦部長を務めたハロルド・スターク提督に因む。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%A4%E1%83%A0%E1%83%98%E1%83%A2%E1%83%98%E1%83%9D%E1%83%A4_%E1%83%9C%E1%83%90%E1%83%9C%E1%83%A1%E1%83%94%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Nansen_Fram_Map.svg","page_title":"ფრიტიოფ ნანსენი","context_page_description":"ფრიტიოფ ნანსენი — ნორვეგიელი პოლარული მკვლევარი, სწავლული-ზოოლოგი, ახალი მეცნიერების – ფიზიკური ოკეანოგრაფიის დამაარსებელი, პოლიტიკური მოღვაწე, ჰუმანისტი, ფილანთროპი, 1922 წლის ნობელის მშვიდობის პრემიის ლაურეატი. მრავალი ქვეყნის ჯილდოს მფლობელი. ნანსენის სახელი უწოდეს გეოგრაფიულ და ასტორნომიულ ობიექტებს, მათ შორის აღსანიშნავია მთვარეზე არსებული ნანსენის კრატერი. ახალგაზრდობაში ცნობილი იყო, როგორც მოთხილამურე. 27 წლის ასაკში ისტორიაში პირველად გადალახა გრენლანდიის ყინულის საფარი, რომელიც ფართო საზოგადოებამ აღიქვა, როგორც გრანდიოზული სპორტული მიღწევა. გემ „ფრამით“ ჰქონდა მცდელობა მიეღწია ჩრდილოეთ პოლუსზე, მაგრამ მივიდა ჩრდილოეთ განედის 86° 13′-ზე. ამის შემდეგ ნანსენი რეგულარულად უწევდა კონსულტაციებს პოლარულ მკვლევრებს სხვადასხვა ქვეყნიდან.\\nცხოვრების ბოლო ათწლეულში ნანსენი დაკავშირებული იყო ერთა ლიგის საქმიანობასთან. 1921 წელს იგი იყო უზენაესი კომისარი ლტოლვილთა საკითხებში. ნანსენის გარდაცვალების შემდეგ მისი საქმიანობა გააგრძელა ნანსენის საერთაშორისო ორგანიზაციამ ლტოლვილთა საქმეებში, რომელმაც 1938 წელს მიიღო ნობელის პრემია.\\nფრიტიოფ ნანსენი 1861 წლის 10 ოქტომბერს დაიბადა ქრისტიანიასთან ახლოს სტურე-ფრიონის მამულში, რომელიც მამამისს — სახელგანთქმულ ადვოკატ ვალდურ ნანსენს ეკუთვნოდა."},{"page_url":"https://en.wikipedia.org/wiki/Skew_polygon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Skew_polygon_in_square_antiprism.png","page_title":"Skew polygon","context_page_description":"In geometry, a skew polygon is a polygon whose vertices are not all coplanar. Skew polygons must have at least 4 vertices. The interior surface of such a polygon is not uniquely defined.\\nSkew infinite polygons have vertices which are not all collinear.\\nA zig-zag skew polygon or antiprismatic polygon has vertices which alternate on two parallel planes, and thus must be even-sided.\\nRegular skew polygons in 3 dimensions are always zig-zag."},{"page_url":"https://en.wikipedia.org/wiki/La_Mabili%C3%A8re","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Amabiliere_cassini.jpg","page_title":"La Mabilière","context_page_description":"La Mabilière is the property of an old farm in Courcoué, near Richelieu, in Indre-et-Loire department in the Centre-Val de Loire region of France, which was formerly a castle, manor and noble house. The estate is first mentioned in 14th-century documents and was formerly a fief of Poitou. It was fortified by Jehan Poret in the 15th century with a bailey and a drawbridge; by the early 19th century these had been removed, but until about 1945 one half-demolished defensive turret remained, serving as a dovecote. This collapsed when an adjacent building was demolished. One of the three towers still stood in 1956, in use as a dovecote and with a hipped roof added."},{"page_url":"https://sv.wikipedia.org/wiki/AK-230","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Forward_AK-230%2C_Keih%C3%A4ssalmi.jpg","page_title":"AK-230","context_page_description":"AK-230 är en sovjetisk luftvärnspjäs för marint bruk. Pjäsen är helautomatisk och fjärrstyrs från ett centralsikte. Pjäsen blev snabbt populär och installerades på allt från patrullbåtar till kryssare. Den har också licenstillverkats i Kina under namnet ”Typ 69”. I mitten på 1970-talet ersattes den av den modernare pjäsen AK-630, men den är fortfarande i tjänst i många länder."},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Lab-Lam)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Coa_fam_ITA_lambardi_catignano2.jpg","page_title":"Armoriale delle famiglie italiane (Lab-Lam)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Lab a Lam."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_c%C3%A1c_lo%C3%A0i_c%C3%A1_c%E1%BA%A3nh_n%C6%B0%E1%BB%9Bc_ng%E1%BB%8Dt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Botia_dario.jpg","page_title":"Danh sách các loài cá cảnh nước ngọt","context_page_description":"Một số lượng lớn các loài cá cảnh đã được nuôi thành công trong các hồ cá nước ngọt. Danh sách này đưa ra một số các loài cá này thường được nuôi."},{"page_url":"https://ca.wikipedia.org/wiki/JPEG_2000","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/JPEG_process_diagram_goodcolors.jpg","page_title":"JPEG 2000","context_page_description":"JPEG 2000 és un estàndard de compressió d'imatges que pretén millorar el popular JPEG. JPEG 2000 neix promogut pel grup \\"Joint Photographic Experts Group\\" l'any 2000 usant l'extensió .jp2.\\nEls principals canvis tècnics del JPEG 2000 respecte al JPEG són l'ús d'una Transformada Wavelet Discreta en lloc de la Transformada Discreta del Cosinus, i la reorganització de les paraules de bit per permetre una millor escalabilitat."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8F%D5%A1%D6%80%D5%AF%D5%BE%D5%AB%D5%B6%D5%AB%D5%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Tarquinia_Museo_Nazionale_Tarquinese.jpg","page_title":"Տարկվինիա","context_page_description":"Տարկվինիա, կոմունա Իտալիայում, տեղակայված է Լացիո մարզի Վիտերբո գավառում։\\nԲնակչությունը կազմում է 16401 մարդ, խտությունը կազմում է 59 մարդ/քառ. կմ։ Զբաղեցնում է 280 քառ. կմ տարածք։ Փոստային ինդեքս - 1016, հեռախոսային կոդ - 0766։\\nԲնակավայրի հովանավոր է համարվում Սուրբ Մադոննա դի Վալվերդեն։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%96-43","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/%D0%98%D0%96-43%D0%95_%281%29.jpg","page_title":"ИЖ-43","context_page_description":"ИЖ-43 — советское и российское двуствольное охотничье ружьё."},{"page_url":"https://en.wikipedia.org/wiki/James_Lenox","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/James_Lenox.jpg","page_title":"James Lenox","context_page_description":"James Lenox was an American bibliophile and philanthropist. His collection of paintings and books eventually became known as the Lenox Library and in 1895 became part of the New York Public Library."},{"page_url":"https://en.wikipedia.org/wiki/January_28_incident","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/ff/Shanghai_1932_aftermath.jpg","page_title":"January 28 incident","context_page_description":"The January 28 incident or Shanghai incident was a conflict between the Republic of China and the Empire of Japan. It took place in the Shanghai International Settlement which was under international control. Japanese army officers, defying higher authorities, had provoked anti-Japanese demonstrations in the international District of Shanghai. A Chinese mob attacked Japanese Buddhist priests, killing one. Heavy fighting broke out, and China appealed with no success to the League of Nations. A truce was finally reached on May 5, calling for Japanese military withdrawal, and an end to Chinese boycotts of Japanese products. Internationally, the episode intensified opposition to Japan's aggression in Asia. The episode helped undermine civilian rule in Tokyo; Prime Minister Inukai Tsuyoshi was assassinated on May 15, 1932."},{"page_url":"https://sk.wikipedia.org/wiki/Raissac-d%E2%80%99Aude","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dd/Map_commune_FR_insee_code_11307.png","page_title":"Raissac-d’Aude","context_page_description":"Raissac-d’Aude je francúzska obec, ktorá sa nachádza v departemente Aude, v regióne Languedoc-Roussillon."},{"page_url":"https://cy.wikipedia.org/wiki/Rhestr_o_seintiau_Cymru","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Saint_Pol_Aurelien.jpg","page_title":"Rhestr o seintiau Cymru","context_page_description":"Dyma restr o seintiau Cymru. Mae gan bob sant neu santes a restrir yma gysylltiad cryf â Chymru gydag un eglwys o leiaf yno wedi'i chysegru iddo/iddi.\\nYn ôl un ffynhonnell cynnar: Nyd oes wlad yn holl Gred o gymaint o dir a chymaint o saint ynddei ag oedd gynt ymhlith Cymbry.\\nCafodd dros 90 o fenywod eu cydnabod yn seintiau, ac yn eu plith y mae Elen, 24 o ferched Brychan Brycheiniog, gan gynnwys: Arianwen, Rhiangar, Gwladys, Gwrgon, Nefydd, Lleian, Marchell, Meleri, Nefyn, Tutglid, Belyau, Ceinwen, Cynheiddon, Ceindrych, Clydai, Dwynwen, Eiluned, Goleudydd, Gwawr, Gwen, Ilud, Tybïe, Tudful, a Tangwystl.\\nNi restrir seintiau sy'n gyffredin i draddodiad Cristnogol Ewrop, sydd gan amlaf yn gymeriadau Beiblaidd, er bod gan rai ohonyn nhw sawl eglwys wedi'i chysegru yn ei enw yng Nghymru, e.e. Sant Mihangel a'r Santes Fair. Dylanwad y Sistersiaid oedd yn bennaf cyfrifol am newid enw eglwys o'r enw'r santes leol i'r enw Mair a dylanwad y Normaniaid sy'n cyfrifol am newid enw i Fihangel.\\nMae'r Cognatio de Brychan 11g yn rhestru ei 24 o ferched a 11 o feibion."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D5%B8%D6%82%D5%A1%D5%AF%D5%A1%D5%B4%D5%B8%D5%AC%D5%A5","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Guacamole.jpg","page_title":"Գուակամոլե","context_page_description":"Գուակամոլե ավոկադոյի խյուսային միջուկից՝ լոլիկի, գինձի, լայմի հյութի և այլ բանջարեղենի ու համեմունքների ավելացմամբ։ Ունի թանձր սոուսի խտություն։ Մեքսիկական խոհանոցի ճաշատեսակ, ենթադրաբար ունի ացտեկական արմատներ։"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%89%D1%83%D0%B1%D0%B8%D1%87%D0%B0%D1%81%D1%82%D0%B0_%D0%B3%D1%99%D0%B8%D0%B2%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Ljubi%C4%8Dasta_gljivica_2.jpg","page_title":"Љубичаста гљивица","context_page_description":"Љубичаста гљивица врста је јарко обојене гљиве која припада фамилији Hydnangiaceae, реду Agaricales. Распрострањена је у Европи, Азији и већем делу Северне Америке. Микоризна је гљива. Насељава листопадне шуме, а може се пронаћи и у четинарским, као и мешовитим шумама. Одговара јој влажно земљиште. Често расте на маховини или на иглицама четинара. Расте у групи, на веома малом простору их може бити и по неколико десетина. Плодоноси од лета до краја јесени. Јестива и честа врста. Име рода коме припада Laccaria на персијском значи обојен и све гљиве овог рода су јарке боје. Име врсте amethystina је добила по драгом камену аметисту, услед сличне обојености."},{"page_url":"https://en.wikipedia.org/wiki/HM_LST-404","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/HM_LST-404_Salerno_12_September_1943.jpg","page_title":"HM LST-404","context_page_description":"HMS LST-404 was a United States Navy LST-1-class tank landing ship that was transferred to the Royal Navy during World War II. As with many of her class, the ship was never named. Instead, she was referred to by her hull designation."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%DB%8C%D9%88%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Stevia_plant.jpg","page_title":"استیویا","context_page_description":"استیویا یا اِستِـویا یک شیرین‌کننده و جایگزین شکر است که از عصارهٔ گیاه شیرین‌برگ به‌دست می‌آید.\\nمادهٔ فعال و مؤثر استیویا، «گلیکوزیدهای استه‌ویول» است که تا حدود ۱۵۰ برابر شیرین‌تر از قند معمولی، مقاوم‌به‌حرارت، مقاوم به تغییرات پی‌اچ و غیرقابل تخمیر است. طعم استیویا شروعی آهسته اما دوامی درازمدت‌تر از قند دارد و برخی از مواد استحصال‌شده از آن کمی تلخ و در غلظت‌های بالا، پس‌مزه‌ای شبیه به شیرین‌بیان دارند.\\nدر کشورهای مختلف، وضعیت قانونی این مادهٔ شیمیایی، جهت استفاده به‌عنوان یک مادهٔ افزودنی غذایی یا مکمل غذایی متفاوت است. در ایالات متحده آمریکا، عصارهٔ گلیکوزید استیویا در رده‌بندیِ افزودنی‌های مجاز قرار دارد و اجازه استفاده در محصولات خوراکی را دارد؛ اما برگِ استیویا و عصارهٔ فراوری‌نشدهٔ آن، افزودنی مجاز نیست و توسط سازمان غذا و داروی آمریکا برای مصارف خوراکی تأیید نشده‌است. اتحادیه اروپا، استیویا را در سال ۲۰۱۱ میلادی پذیرفت و در ژاپن، این ماده سال‌هاست که به‌عنوان شیرین‌کننده مورد استفاده بوده‌است."},{"page_url":"https://fr.wikipedia.org/wiki/6e_r%C3%A9giment_d%27artillerie_(France)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Artillerie-b%C3%A9ret.jpg","page_title":"6e régiment d'artillerie (France)","context_page_description":"Le 6ᵉ régiment d’artillerie est une unité de l’armée française. Il était basé au Quartier Guyon-Gellin de Hettange-Grande dans les années 1970. Puis à Chaumont au Quartier Foch, et a Phalsbourg jusqu'à sa dissolution en 1993."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%83%D9%8A%D9%87%D8%A7%D9%86_%D9%83%D9%84%D9%87%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Kayhan_Kalhor.jpg","page_title":"كيهان كلهر","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nكيهان كلهر ملحن مزيكا من ايران."},{"page_url":"https://bs.wikipedia.org/wiki/Ermita%C5%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Hermitage_Museum_-_Exterior_view_1.jpg","page_title":"Ermitaž","context_page_description":"Muzej Ermitaž nalazi se u Sankt Peterburgu u Rusiji. Predstavlja jednu od najvećih, najljepših i najstarijih umjetničkih galerija u ljudskoj historiji i kulturi. Njegova ogromna zbirka izložena je u 6 zgrada, s tim što je glavna zgrada Zimski dvorac koji je nekada bio zvanična rezidencija ruskih careva.\\nNajznačajnija zbirka ovog muzeja je zbirka zapadne umjetnosti sa djelima Michelangela Buonarotija, Leonarda da Vinčija, Rubensa, Rembrandta, Caravaggia, Canaletta, Vincenta van Gogha, Pabla Picassa, Henrija Matissa.\\nZbirku je započela Katarina Velika 1764."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%B0%D0%B7%D0%BE%D1%81_(%D1%80%D0%B5%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Brazos_River_railroad_bridge_Waco_TX.jpg","page_title":"Бразос (река)","context_page_description":"Бразос је река која протиче кроз САД. Дуга је 1.390 km. Протиче кроз америчку савезну државу Тексас. Улива се у Мексички залив."},{"page_url":"https://no.wikipedia.org/wiki/Integrated_Drive_Electronics","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/ATA_on_mainboard.jpg","page_title":"Integrated Drive Electronics","context_page_description":"Integrated Drive Electronics, også kjent som AT Attachment er en grensesnitt-standard for å koble lagringsenheter som harddisker og CD-ROM-enheter til personlige datamaskiner. Mange synonymer og relaterte begreper eksisterer, inkludert forkortelser som ATAPI og UDMA.\\nDa Serial ATA kom på markedet i 2003, ble den opprinnelige ATA-standarden omdøpt til Parallel ATA. Denne artikkelen dekker kun Parallel ATA.\\nPATA-standarden tillater bare kabler opp til 46 cm lengde. Det er likevel enkelt å finne kabler på opp til 91 cm på markedet. På grunn av den begrensede lengden, brukes denne teknologien vanligvis internt i kabinettet.\\nKablene hadde 40 ledere fram til UDMA4-standarden kom med 80 ledere i kabelen. Denne standarden brukte de samme 40-pinners soklene, men kabelen hadde 40 nye jordledere for å redusere elektromagnetisk støy."},{"page_url":"https://es.wikipedia.org/wiki/Gobierno_Aut%C3%B3nomo_Municipal_de_La_Paz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/MACRODISTRITO_6.png","page_title":"Gobierno Autónomo Municipal de La Paz","context_page_description":"Gobierno Autónomo Municipal de La Paz es el nombre oficial de la instancia de gobierno del Municipio de La Paz, o Alcaldía de La Paz, oficialmente Nuestra Señora de La Paz, que alberga entre otras poblaciones a la ciudad de La Paz, sede del Gobierno de Bolivia.\\nDe acuerdo a la ley de Autonomías de Bolivia, y la organización territorial de Bolivia los municipios bolivianos tiene la potestad de elegir sus alcaldes en elecciones locales.\\nEl Gobierno Autónomo Municipal de La Paz, también conocido por sus siglas: GAMLP, se compone del poder ejecutivo, representado por el alcalde y su equipo, y el concejo municipal constituido por representantes elegidos igualmente por voto popular a través de elecciones municipales cada 5 años, la gestión 2015-2020 fue elegida durante las elecciones de 2015 resultando ganador Luis Revilla Herrero."},{"page_url":"https://fr.wikipedia.org/wiki/Seiganto-ji","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Seigantoji06.JPG","page_title":"Seiganto-ji","context_page_description":"Seiganto-ji est un temple bouddhique Tendai situé à Nachikatsuura, au Japon."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B5%8B%E0%B4%A8%E0%B4%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Noni.svg","page_title":"നോനി","context_page_description":"വനപ്രദേശങ്ങളിലും മണൽ-പാറ തീരപ്രദേശങ്ങളിലും ഒരുപോലെ കാണപ്പെടുന്ന ഒരു ചെടിയാണ് നോനി.ഇന്ത്യൻ മൾബറി, ബീച്ച് മൾബറി, ചീസ്ഫ്രൂട്ട്, ഗ്രേറ്റ് മൊറിൻഡ എന്നിങ്ങനെ പേരുകളിൽ ലോകത്തിന്റെ വിവിധഭാഗങ്ങളിൽ ഇത് അറിയപ്പെടുന്നു. ഇതൊരു ഔഷധസസ്യവുമാണ്. ശാസ്ത്രീയനാമം മൊറിൻഡ സിട്രിഫോളിയ എന്നാണ്.റുബിയേസീ എന്ന സസ്യകുടുംബത്തിലെ അംഗമാണിത്. തെക്കുകിഴക്കൻ ഏഷ്യ മുതൽ ആസ്ട്രേലിയ വരെയുള്ള ഭാഗങ്ങളാണ് ഇതിന്റെ ജന്മദേശം. പതിനെട്ടു മാസംകൊണ്ട് വളർച്ചപ്രാപിക്കുന്ന നോനി വർഷത്തിൽ എല്ലാമാസത്തിലും 4 മുതൽ 8 കിലോഗ്രാം വരെ ഫലം പ്രദാനം ചെയ്യുന്നു. ലവണാംശമുള്ള മണ്ണിലും വരൾച്ച പ്രദേശങ്ങളിലും ഇതിനു അതിജീവിക്കാനാവും. ഒമ്പത് മീറ്റർ നീളത്തിൽ വളരാൻ കഴിയുന്ന ഈ ചെടി നീണ്ടുവലിപ്പമുള്ളതും കടും പച്ചനിറത്തിലുള്ള തിളങ്ങുന്നതുമായ ഇലകളോടുകൂടിയവയാണ്.\\nവിശപ്പിന്റെ ഫലം എന്ന് പലപ്പോഴും ഇതിനെ വിളിക്കുന്നു. സമോബ, ഫിജി എന്നിവിടങ്ങളിൽ പ്രധാന ഭക്ഷ്യവിഭവമായി ഉപയോഗിക്കുന്നു. ചവർപ്പു രുചിയും കടുത്ത മണവും ഉള്ള ഇതിന്റെ ഫലം ക്ഷാമകാലത്തെ ഭക്ഷണമായി ഉപയോഗിക്കുന്നു. പസഫികിലെ ചില ദ്വീപുകളിൽ പാകം ചെയ്തും അല്ലാതെയുമുള്ള പ്രധാന ധാന്യമായും ഇതു ഉപയോഗത്തിലുണ്ട്. തെക്കുകിഴക്കൻ ഏഷ്യക്കാരും ആസ്ട്രേലിയൻ ആദിമനിവാസികളും പാകം ചെയ്യാതെ ഉപ്പ് ചേർത്തും കറികളിൽ വേവിച്ചും കഴിക്കാറുണ്ട്. ഫലവിത്തുകൾ വറുത്ത് ഭക്ഷിക്കാവുന്നതാണ്."},{"page_url":"https://ro.wikipedia.org/wiki/Podul_Dom_Lu%C3%ADs_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Porto_-_Ponte_Dom_Lu%C3%ADs_I_%288239679580%29.jpg","page_title":"Podul Dom Luís I","context_page_description":"Podul D. Luís I sau Podul Dom Luís I este un pod cu structură metalică în arc și două tabliere, realizat între anii 1881 și 1888, care traversează fluviul Douro și conectează orașele Porto și Vila Nova de Gaia din Portugalia.\\nPodul Dom Luís I a fost construit pentru a înlocui vechiul pod suspendat Maria a II-a, care exista pe același amplasament. Lucrarea a fost realizată după proiectul și sub supravegherea inginerului francez Théophile Seyrig, discipol al lui Gustave Eiffel și colaborator al acestuia la o investiție similară, podul feroviar Podul Dona Maria Pia.\\nTablierul superior al podului a fost inaugurat în 1886, iar cel inferior și intrarea completă în funcțiune în 1888."},{"page_url":"https://de.wikipedia.org/wiki/Kolonnenweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/0637_1989_Grenz%C3%BCbergang_Elend_%2828_dec%29_%2814122186397%29.jpg","page_title":"Kolonnenweg","context_page_description":"Der Kolonnenweg ist ein Teil der innerdeutschen Grenzanlagen auf Seiten der ehemaligen DDR. Er wurde aus einheitlichen, sehr verwitterungsbeständigen Lochplatten hergestellt, die größtenteils von Pflanzen durchwachsen sind und so ziemlich fest mit dem Boden verbunden sind. Im Todesstreifen der Berliner Mauer war der Kolonnenweg asphaltiert.\\nIm Gegensatz zum Rest der Grenzanlage ist der Kolonnenweg auch Jahrzehnte nach dem Ende der DDR noch weitgehend erhalten und dient heute als Wander- und Radweg entlang der ehemaligen Grenze, obwohl die Fortbewegung auf der durch Ausspülungen der Betonhohlräume recht unebenen Oberfläche mitunter sehr beschwerlich ist. Zu DDR-Zeiten diente er den DDR-Grenztruppen dazu, jeden Punkt der Grenze möglichst schnell mit Fahrzeugen zu erreichen. Zwischen dem Kolonnenweg und der eigentlichen Grenze befanden sich dann noch der Kontrollstreifen und der Grenzzaun bzw. die Grenzmauer."},{"page_url":"https://ro.wikipedia.org/wiki/Expedi%C8%9Bia_Terra_Nova","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/EmperorPenguin_2005_2592.JPG","page_title":"Expediția Terra Nova","context_page_description":"Expediția Terra Nova, oficial numită Expediția Britanică Antarctică 1910, a fost o misiune condusă de Robert Falcon Scott cu obiectivul de a fi primul care ajunge la Polul Sud geografic. Expediția a ajuns la Polul Sud pe 17 ianuarie 1912, însă doar pentru a descoperi că norvegienii conduși de Roald Amundsen atinseseră acest punct cu 33 de zile în urmă. Întreaga echipă a lui Scott a murit pe drumul de întoarcere, unele cadavre, jurnale și fotografii fiind găsite de o echipă de căutare opt luni mai târziu.\\nScott era un comandant cu experiență în expediții polare, conducând mai înainte Expediția Discovery din Antarctica între anii 1901-1904. Expediția Terra Nova, numită astfel după nava de aprovizionare, a fost una privată, finanțată prin donații publice dar și de un grant oferit de guvern. A fost susținută și de Amiralitate, care a contribuit cu marinari experimentați, dar și de către Royal Geographical Society. Pe lângă încercarea polară, expediția a avut și un important rol științific, explorând Zona Victoria și Munții de Vest. S-a încercat fără succes debarcarea și explorarea Țării Eduard al VII-lea."},{"page_url":"https://en.wikipedia.org/wiki/HiWish_program","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/2509mantlelayers.jpg","page_title":"HiWish program","context_page_description":"HiWish is a program created by NASA so that anyone can suggest a place for the HiRISE camera on the Mars Reconnaissance Orbiter to photograph. It was started in January 2010. In the first few months of the program 3000 people signed up to use HiRISE. The first images were released in April 2010. Over 12,000 suggestions were made by the public; suggestions were made for targets in each of the 30 quadrangles of Mars. Selected images released were used for three talks at the 16th Annual International Mars Society Convention. Below are some of the over 4,224 images that have been released from the HiWish program as of March 2016."},{"page_url":"https://es.wikipedia.org/wiki/Monasterio_de_San_Miguel_de_Escalada","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/SMdE_vp_01.jpg","page_title":"Monasterio de San Miguel de Escalada","context_page_description":"San Miguel de Escalada era un monasterio ubicado cerca del pueblo del mismo nombre, en el municipio de Gradefes, provincia de León. Está ubicado en el Camino de Santiago, a 27 km de la ciudad de León. Del monasterio se conserva actualmente solamente el templo. El monasterio fue consagrado en el año 913 por el abad Alfonso, que había llegado a León junto a otros monjes desde Córdoba.\\nObra mozárabe para algunos autores, estaría incluida dentro del denominado arte de repoblación. El templo mozárabe fue construido reaprovechando materiales de épocas anteriores, visigótica y romana. Tiene la categoría de Monumento nacional desde 1886."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BA%D0%B0%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Viialan_rautatieasema.JPG","page_title":"Акаа","context_page_description":"А́каа — город на юго-западе центральной части Финляндии, в провинции Пирканмаа. Акаа был образован 1 января 2007 года, когда муниципалитеты Тойяла и Вийала были объединены в один муниципалитет. 1 января 2011 года к Акаа присоединился также муниципалитет Кюльмякоски. Площадь Акаа составляет 314,38 км².\\nГород расположен в 42 км от Тампере, 130 км от Турку, 115 км от Лахти и 142 км от Хельсинки."},{"page_url":"https://it.wikipedia.org/wiki/Tiramis%C3%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Tvarohov%C3%A9_tiramisu_5.jpg","page_title":"Tiramisù","context_page_description":"Il tiramisù è un dolce e prodotto agroalimentare tradizionale diffuso in tutto il territorio italiano, le cui origini sono dibattute e attribuite soprattutto al Veneto e al Friuli-Venezia Giulia. È un dessert al cucchiaio a base di savoiardi inzuppati nel caffè e ricoperti di una crema, composta di mascarpone, uova e zucchero, che in alcune varianti è aromatizzata con il liquore."},{"page_url":"https://cs.wikipedia.org/wiki/Administrativn%C3%AD_d%C4%9Blen%C3%AD_Ma%C4%8Farska","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/HU_NUTS_3.png","page_title":"Administrativní dělení Maďarska","context_page_description":"Současné administrativní dělení Maďarska bylo zavedeno od roku 2013. Země je rozdělena na 19 žup a území hlavního města Budapešti, které má zvláštní statut. Župy se dále dělí na okresy maďarsky járas, kterých bylo 175, později byl zrušen okres Polgárdi, takže současný počet je 174."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_der_Emilia-Romagna","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Stolperstein_f%C3%BCr_Fermino_Toniato_%28Guastalla%29.jpg","page_title":"Liste der Stolpersteine in der Emilia-Romagna","context_page_description":"Die Liste der Stolpersteine in der Provinz Reggio nell’Emilia enthält die Stolpersteine in der italienischen Provinz Reggio Emilia, die an das Schicksal der Menschen aus dieser Region erinnern, die von Nationalsozialisten ermordet, deportiert, vertrieben oder in den Suizid getrieben worden sind. Die Stolpersteine wurden von Gunter Demnig verlegt. Sie werden im Regelfall vor dem letzten selbstgewählten Wohnort des Opfers verlegt. Ihre Bezeichnung lautet auf Italienisch: Pietre d'inciampo.\\nDie Tabellen sind teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://cy.wikipedia.org/wiki/Durham,_Connecticut","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Elizur_Goodrich_The_Connecticut_Quarterly%2C_July%2C_August%2C_September_1898_p._307.jpg","page_title":"Durham, Connecticut","context_page_description":"Ardal a ddynodwyd gan y cyfrifiad yn Connecticut, yn nhalaith Connecticut, Unol Daleithiau America yw Durham, Connecticut. ac fe'i sefydlwyd ym 1699."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B7%D0%B0%D0%B1%D0%B5%D0%BB%D0%BB%D0%B0_%D0%9B%D0%BE%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%B3%D1%81%D0%BA%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Ambito_francese_-_Isabella_di_Lorena%2C_regina_di_Napoli.jpg","page_title":"Изабелла Лотарингская","context_page_description":"Изабелла — герцогиня Лотарингии с 1431 года. Первая жена неаполитанского короля Рене Анжуйского из династии Анжу-Валуа. Во время отсутствия мужа управляла его владениями."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AB%B9%E8%8A%9D%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Takeshiba_eki_1.jpg","page_title":"竹芝駅","context_page_description":"竹芝駅は、東京都港区海岸一丁目にある東京臨海新交通臨海線の駅である。駅番号はU 03。"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B0%E0%A7%87%E0%A6%87%E0%A6%A8%E0%A6%BE%E0%A6%B0_%E0%A6%93%E0%A6%AF%E0%A6%BC%E0%A6%BE%E0%A6%87%E0%A6%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Rainer_Weiss_EM1B8841_%2824027015857%29.jpg","page_title":"রেইনার ওয়াইস","context_page_description":"রেইনার ওয়াইস একজন মার্কিন পদার্থবিজ্ঞানী যিনি মহাকর্ষীয় পদার্থবিজ্ঞান এবং জ্যোতির্বিজ্ঞানে অবদানের জন্য পরিচিত। তিনি মার্কিন যুক্তরাষ্ট্রের খ্যাতনামা প্রযুক্তি শিক্ষা ও গবেষণা প্রতিষ্ঠান ম্যাসাচুসেটস ইন্সটিটিউট অফ টেকনোলজি-র পদার্থবিজ্ঞান বিষয়ে সংখ্যাতিরিক্ত অধ্যাপক এবং এলএসইউ-এর উপ-অধ্যাপক। তিনি লেজারের ইন্টারফেরোমেটিক কৌশ্ল আবিষ্কারের জন্য সুপরিচিত যা কিনা LEGO এর মৌলিক অপারেশন । তিনি COBE বিজ্ঞান কর্মী গ্রুপের চেয়ারম্যান ছিলেন।\\nতিনি ফরমিলাব হোলোমিটার পরীক্ষণের সদস্য, যা কোয়ান্টাম স্কেলে স্থান ও সময়ের বৈশিষ্ট্যগুলি পরিমাপ করতে এবং কোয়ান্টাম হোলফিকাল অস্থিরতার প্ল্যাংক-স্পষ্টতা পরীক্ষা প্রদানের জন্য একটি 40m লেজারের ইন্টারফেরোমিটার ব্যবহার করে।\\nLIGO আবিষ্কারে নিরবচ্ছিন্ন অবদান এবং মহাকর্ষীয় তরঙ্গ পর্যবেক্ষণের জন্য ২০১৭ সালে কিপ থর্ন এবং ব্যারি ব্যারিশের সাথে তাকে পদার্থবিজ্ঞানে নোবেল পুরস্কার প্রদান করা হয়"},{"page_url":"https://ca.wikipedia.org/wiki/Tambor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/DK-Bongos.JPG","page_title":"Tambor","context_page_description":"Tambor és un terme genèric que designa un instrument de percussió membranòfon que consta d'una caixa de ressonància, generalment de forma cilíndrica, i una membrana que cobreix l'obertura de la caixa. Un tambor, doncs, no és tant un instrument com conjunt de tipologies diverses d'instruments membranòfons, en principi percudits.\\nGeneralment, perquè soni, el tambor és colpejat amb la mà o amb algun objecte, comunament baquetes; també se sol percudir la caixa de ressonància. És un dels primers instruments a aparèixer històricament i, a part, del seu ús estrictament musical podia fer-se servir com a mitjà de comunicació per transmetre avisos a persones allunyades.\\nTot i que a voltes es considera que timbal i tabal són sinònims de tambor, el cert és que en molts contextos aquestes dues denominacions corresponen a una tipologia determinada i concreta de tambor que continua cobrint un camp semàntic més gran."},{"page_url":"https://en.wikipedia.org/wiki/Natalia_Poklonskaya","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Natalia_Poklonskaya_August_2015_%28cropped%29.jpg","page_title":"Natalia Poklonskaya","context_page_description":"Natalia Vladimirovna Poklonskaya is a Russian politician, serving as Deputy of the State Duma of Russia, deputy chairman of the State Duma Committee on Foreign Affairs from 18 September 2016.\\nShe was the Prosecutor of the Autonomous Republic of Crimea from 11 to 17 March 2014. From 2 May 2014 to 6 October 2016, she served as Prosecutor of the Republic of Crimea and in 2015 as State Counselor of Justice 3rd Class.\\nPoklonskaya was a Ukrainian prosecutor from 2002 to February 2014, working in various Prosecutor's Offices or as an assistant district attorney. During the 2014 Crimean crisis, she resigned from Ukrainian service and was appointed Prosecutor General of Crimea on 11 March 2014; a press conference given by Poklonskaya on that day resulted in her becoming an Internet phenomenon. After Crimea was annexed by Russia during the 2014 Crimean crisis, Poklonskaya's appointment was confirmed by Russian authorities on 25 March, around the same time Ukrainian judicial authorities declared her a wanted criminal.\\nPoklonskaya resigned as Prosecutor General on 6 October 2016 due to her election to the State Duma during the 2016 Russian legislative election."},{"page_url":"https://sl.wikipedia.org/wiki/Somerset_(grofija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Watchetmarinab%26w.jpg","page_title":"Somerset (grofija)","context_page_description":"Somerset je grofija na jugozahodu Anglije. Glavno mesto grofije je Taunton, ki leži v južnem delu. Somerset meji na grofije Bristol in Gloucestershire na sevetu, Wiltshire na vzhodu, Dorset na jugovzhodu in Devon na jugozahodu. Na severu in zahodu delno meji na Bristolski zaliv in izliv reke Severn. Tradicionalna severna meja grofije poteka po reki Avon. Upravna meja pa leži bolj proti jugu zaradi nastanka in razvoja mesta Bristol ter kasneje nastanka grofije Avon in njenih naslednikov Unitary Authorities na severu.\\nSomerset je podeželska grofija številnih gričev kot so Mendip Hills, Quantock Hills. Velika močvirnata ravna področja pa spadajo v Narodni park Exmoor, v katerem leži tudi ravnica Somerset Levels. V grofiji sledi človeškega obstoja segajo v čas neolitika, našli so tudi ostanek naselij iz časa Rimljanov in Sasov. Kasneje je grofija igrala pomembno vlogo v političnem vzponu kralja Alfreda Velikega, v času angleške državljanske vojne ter Monmouthovega upora.\\nNajpomembnejšo vlogo v grofiji ima kmetijstvo. Reja ovc in živine za volno in sloveči siri iz te grofije je v grofiji prisotna že dlje časa. Razvito je tudi gojenje vrb za izdelavo košar."},{"page_url":"https://de.wikipedia.org/wiki/Nachrodt-Wiblingwerde","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Nahmertal.jpg","page_title":"Nachrodt-Wiblingwerde","context_page_description":"Nachrodt-Wiblingwerde ist eine Gemeinde in Nordrhein-Westfalen, Deutschland. Sie liegt im Sauerland und gehört zum Märkischen Kreis. Weite Flächen auf den Höhen des Lennegebirges und das enge Tal der Lenne prägen das Gemeindegebiet. Im frühen 19. Jahrhundert begannen sich im derzeitigen Gemeindegebiet metallverarbeitende Betriebe anzusiedeln. Mittelständische Unternehmen im Bereich der Metallverarbeitung sind auch heute noch ansässig. Die Gemeinde entstand 1907 aus dem Zusammenschluss der Gemeinden Kelleramt und Wiblingwerde. Der Ortsteil Wiblingwerde ist staatlich anerkannter Erholungsort."},{"page_url":"https://en.wikipedia.org/wiki/International_Criminal_Tribunal_for_Rwanda","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Impressions_of_Rwanda_by_Jenny_Paul_%E2%80%93_%2820%29.jpg","page_title":"International Criminal Tribunal for Rwanda","context_page_description":"The International Criminal Tribunal for Rwanda was an international court established in November 1994 by the United Nations Security Council in Resolution 955 in order to judge people responsible for the Rwandan genocide and other serious violations of international law in Rwanda, or by Rwandan citizens in nearby states, between 1 January and 31 December 1994.\\nIn 1995, it became located in Arusha, Tanzania, under Resolution 977. From 2006, Arusha also became the location of the African Court on Human and Peoples' Rights. In 1998 the operation of the tribunal was expanded in Resolution 1165. Through several resolutions, the Security Council called on the tribunal to complete its investigations by end of 2004, complete all trial activities by end of 2008, and complete all work in 2012.\\nThe tribunal had jurisdiction over genocide, crimes against humanity, and violations of Common Article Three and Additional Protocol II of the Geneva Conventions."},{"page_url":"https://en.wikipedia.org/wiki/Archie_Stout","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Irene_Rich%2C_Gail_Russell_%26_John_Wayne_in_Angel_and_the_Badman_-_1947.jpg","page_title":"Archie Stout","context_page_description":"Archie Stout, A.S.C. was an American cinematographer whose career spanned from 1914 to 1954. He enjoyed a long and fruitful association with John Ford, working as second unit cinematographer on Fort Apache, She Wore a Yellow Ribbon and The Quiet Man, becoming the only 2nd unit cinematographer to receive an Oscar. In a wide-ranging career, he also worked on such films as the original version of The Ten Commandments and several Hopalong Cassidy and Tarzan films. His last film was the airborne disaster movie The High and the Mighty in 1954."},{"page_url":"https://eu.wikipedia.org/wiki/Saint-Hippolyte_(Aveyron)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Truy%C3%A8re_Valley_at_St._Hippolyte%2C_Aveyron%2C_France%2C_Sept._2008.jpg","page_title":"Saint-Hippolyte (Aveyron)","context_page_description":"Saint-Hippolyte Okzitaniako udalerri bat da. Administratiboki Frantziako Aveyron departamenduan dago, Okzitania eskualdean. 2013an 456 biztanle zituen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Isny_im_Allg%C3%A4u","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Isny_im_Allg%C3%A4u_by-RaBoe_104.jpg","page_title":"Liste der Kulturdenkmale in Isny im Allgäu","context_page_description":"In der Liste der Kulturdenkmale in Isny im Allgäu sind Bau- und Kunstdenkmale der Stadt Isny im Allgäu verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg verzeichnet sind. Dieses Verzeichnis ist nicht öffentlich und kann nur bei „berechtigtem Interesse“ eingesehen werden. Die folgende Liste ist daher nicht vollständig. Sie beruht im Wesentlichen auf dem veröffentlichten Denkmalpflegerischen Werteplan, in dem auch erhaltenswerte Gebäude und Grünanlagen verzeichnet sind. Diese sind in dieser Liste ebenfalls aufgeführt."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B7%D0%B3%D1%80%D0%B0%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/File-Abritus_Razgrad_Kaladan_2.jpg","page_title":"Разград","context_page_description":"Ра̀зград е град, разположен в Североизточна България. Той е административен център на община Разград, област Разград. Разположен е в южната част на историко-географска област Лудогорие. Според последното преоброяване на НСИ към 31.12.2019 година населението на град Разград е 30 173 жители."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A%D9%83_%D8%B3%D8%A7%D9%86%D8%B4%D9%8A%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Rick_Sanchez.jpg","page_title":"ريك سانشيز","context_page_description":"ريك سانشيز ‏، الاسم الكامل ريكاردو ليون ريك سانشيز دي رينالدو ‏، مذيع ومراسل سابق في شبكة سي إن إن، حاليا مؤلف ومساهم في فوكس نيوز القناة الإخبارية الأمريكية. أمريكي من أصل كوبي، في كوبا، في بلدة قريبة من العاصمة.\\nقال إنه يفضل أن يسمى ريك سانشيز بدلا من استخدام اسم ولادته، لأنه كما قال في نشرة الأخبار في عام 2009:\\" أريد أن احترم البلد الرائع الذي سمح لي وللاتينيين للمجيء إلى هنا\\"."},{"page_url":"https://az.wikipedia.org/wiki/G%C3%BCrc%C3%BC_kalliqrafiyas%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/1597._%E1%83%99%E1%83%90%E1%83%AE%E1%83%94%E1%83%97%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%94%E1%83%A4%E1%83%94_%E1%83%90%E1%83%9A%E1%83%94%E1%83%A5%E1%83%A1%E1%83%90%E1%83%9C%E1%83%93%E1%83%A0%E1%83%94_II-%E1%83%98%E1%83%A1_%E1%83%92%E1%83%A3%E1%83%AF%E1%83%90%E1%83%A0%E1%83%98_%E1%83%92%E1%83%90%E1%83%A0%E1%83%94%E1%83%AF%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%94%E1%83%A2%E1%83%9D%E1%83%A5%E1%83%98_%E1%83%90%E1%83%99%E1%83%A3%E1%83%A0%E1%83%98%E1%83%A1_%E1%83%9B%E1%83%9D%E1%83%9C%E1%83%90%E1%83%A1%E1%83%A2%E1%83%A0%E1%83%98%E1%83%A1%E1%83%90%E1%83%93%E1%83%9B%E1%83%98.jpg","page_title":"Gürcü kalliqrafiyası","context_page_description":"Gürcü kalliqrafiyası — üç Gürcü yazısını istifadə edən, Gürcü dilinin kalliqrafik və ya bədii yazı şəkli."},{"page_url":"https://el.wikipedia.org/wiki/%CE%95%CE%B4%CE%BF%CF%85%CE%AC%CF%81%CE%B4%CE%BF%CF%82_%CE%92%CE%84_%CF%84%CE%B7%CF%82_%CE%91%CE%B3%CE%B3%CE%BB%CE%AF%CE%B1%CF%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Seal_of_Edward_II.jpg","page_title":"Εδουάρδος Β΄ της Αγγλίας","context_page_description":"Ο Εδουάρδος Β΄ της Αγγλίας βασιλιάς της Αγγλίας και δούκας της Ακουιτανίας ήταν τέταρτος γιος και διάδοχος του Εδουάρδου Α΄ της Αγγλίας και της Ελεονώρας της Καστίλης. Ο Εδουάρδος Β΄ ήταν ο πρώτος Άγγλος μονάρχης που ίδρυσε κολέγια, και ίδρυσε το Πανεπιστήμιο της Οξφόρδης και το Πανεπιστήμιο του Κέμπριτζ.\\nΈγινε διάδοχος του αγγλικού θρόνου μετά το θάνατο του μεγαλύτερου αδελφού του Αλφόνσου του Τσέστερ, και μεγάλωσε στην αυλή ενός δεσποτικού και αυταρχικού πατέρα, που προσέλαβε για φίλο του γιου του τον ευγενή από τη Γασκώνη Πηρς Γκάβεστον. Σύντομα συνδέθηκαν τόσο στενά που διαδόθηκε η φήμη ότι υπήρχε μεταξύ τους ομοφυλοφιλική σχέση, και ότι ο νεαρός Εδουάρδος ήταν έτοιμος να του παραχωρήσει βασιλικούς τίτλους. Εξοργισμένος ο ηλικιωμένος βασιλιάς έδιωξε τον Γκάβεστον από την Αυλή, παρά τις αντιρρήσεις του γιου του, που όταν έγινε βασιλιάς τον επανέφερε."},{"page_url":"https://de.wikipedia.org/wiki/Kap_Tscheljuskin","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Kap_Tscheljuskin_3_2012-08-05.jpg","page_title":"Kap Tscheljuskin","context_page_description":"Das Kap Tscheljuskin ist der nördlichste Punkt der Taimyr-Halbinsel und somit die nördlichste Festlandstelle der Erde. Es ist nach dem russischen Polarforscher Semjon Iwanowitsch Tscheljuskin benannt."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%A4%A7%E8%B1%90%E7%94%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/JR-Shikoku-ToyonagaStation.JPG","page_title":"大豐町","context_page_description":"大丰町是位于高知县长冈郡的一町。位于四国山地中部，吉野川中流。\\n是四国地方唯一65歳以上人口比率超过50％的行政区划，在2012年4月时，老年人口占约52%。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%91%D7%99_%D7%9E%D7%95%D7%9E%D7%91%D7%90%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Nmmtabc.jpg","page_title":"נבי מומבאי","context_page_description":"נבי מומבאי היא עיר במדינת מהאראשטרה שבהודו. נבי מומבאי פותחה בשנת 1972 כעיר התאומה של מומבאי. היא אחת מהערים המתוכננות מראש הגדולות בעולם, עם שטח של 344 קמ\\"ר, מתוכם 163 בתחום השיפוט של NMMC, התאגיד המוניציפלי לנבי מומבאי. העיר שוכנת בחוף המזרחי של מפרצון טהנה וגובלת באירולי בצפון וביוראן בדרום. אורך העיר קרוב לזה של מומבאי, ובין שתי הערים מקשרים הגשרים ואשי ואירולי. האזורים המפותחים ביותר והיקרים ביותר בעיר הם ואשי ונרול, המכונים בהתאמה \\"המלך של נבי מומבאי\\" ו\\"המלכה של נבי מומבאי\\". אוכלוסיית העיר מונה 2,100,000 איש, שמתוכם כ-600,000 מנרול וכ-400,000 מואשי.\\nנבי מומבאי שייכת לאיגוד הערים של מומבאי. NMMC מופיע ברשימת התאגידים העשירים ביותר באסיה. נבי מומבאי היא העיר ההודית היחידה שהופיעה בתוכנית \\"Super Cities of the World\\" של ערוץ נשיונל ג'יאוגרפיק."},{"page_url":"https://ckb.wikipedia.org/wiki/%D9%85%DB%86%D9%85%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Mummy_at_British_Museum.jpg","page_title":"مۆمیا","context_page_description":"مۆمیا بە تەرمێک دەوترێ کە پێست و ئەندامەکانی تری بە ھۆی پۆشران بە مۆم یان ماکێکی کیمیاویی تر یان بە ھۆی سەرمای زۆرەوە پارێزرابێت.\\nمیسرییە کۆنەکان مردووەکانی خۆیان مۆمیا دەکرد و باوەڕیان وابوو کە رۆژێک لە رۆژان زیندوو دەبنەوە، بۆیە جلوبەرگ و زێڕ و زیو و سەرجەم کەلوپەلە پێویستەکانیان لەگەڵدا حەشاردەدا. وشەی مۆمیا لە ەوە ھاتووە، چونکە وەک گوتمان میسرییە کۆنەکان مردووەکانی خۆیان مۆمیا دەکرد. واتا بە مۆم دایاندەپۆشی. وشەی مۆمیاش واتا. شایانی باسە جگە لە مۆم میسرییە کۆنەکان قیریشیان بۆ داپۆشینی مردووەکان بەکارھێناوە. واتا مۆمیاکردن ھەر بە مۆم نەبووە، بەڵکو ھەندێک جار قیریش بەکارھێنراوە."},{"page_url":"https://en.wikipedia.org/wiki/Keta_Lagoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Keta_Lagoon-1.jpg","page_title":"Keta Lagoon","context_page_description":"Keta Lagoon, also called Anlo-Keta lagoon, is the largest of the over 90 lagoons that cover the 550 km stretch of the coastline of Ghana. This lagoon is 126.13 km in length. It is located in the eastern coast of Ghana and separated from the Gulf of Guinea by a narrow strip of sandbar. This open salty water is surrounded by flood plains and mangrove swamps. Together they form the Keta Lagoon Ramsar site which covers 1200 km²\\nThere are seasonal inflow of sea water during high tide from the Gulf of Guinea and regular inflow of rivers. The rivers which drain into the lagoon include the Aka, the Tordzi River and Belikpa stream which enter the lagoon from the north. The lagoon is surrounded by many settlements. The towns include Anloga, Woe, Keta and Kedzi to the south, Anyako and Anlo Afiadenyigba to the north, Kodzi, Alakple and Tregui to the west and Denu and Adina to the east.\\nOver the years population growth, extensive human activities and climate change all contributed to reduce the volume of water in the lagoon which appears to be drying up. The lagoon became part of the daily existence of the people of Anlo land."},{"page_url":"https://pt.wikipedia.org/wiki/Plotly","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Plotly-logo-01-square.png","page_title":"Plotly","context_page_description":"A Plotly é uma empresa de computação com sede em Montreal, Quebec, Canadá. A empresa desenvolve ferramentas de análise e visualização de dados. A Plotly fornece ferramentas on-line de gráficos, análises e estatísticas e colaboração, bem como bibliotecas científicas de gráficos para Python, R, MATLAB, Perl, Julia, Arduino e REST."},{"page_url":"https://es.wikipedia.org/wiki/Santa_Teresa_en_Corso_d%27Italia_(t%C3%ADtulo_cardenalicio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Coat_of_arms_of_Maurice_Piat.svg","page_title":"Santa Teresa en Corso d'Italia (título cardenalicio)","context_page_description":"Santa Teresa en Corso d'Italia es un título cardenalicio de la Iglesia Católica. Fue instituido por el papa Juan XXIII en 1962 con la constitución apostólica Inter frequentissima.​"},{"page_url":"https://pt.wikipedia.org/wiki/Hamelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Hameln_vor_Anker.jpg","page_title":"Hamelin","context_page_description":"Hamelin é uma cidade da Alemanha no estado de Baixa Saxônia, capital do distrito de Hamelin-Pyrmont. Hamelin é cortada pelo rio Weser e localiza-se na região de colinas muito procurada por turistas andarilhos e ciclistas."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%94%9D%E6%9C%AB%E7%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Aguchi-jinja_setsumassha2.jpg","page_title":"攝末社","context_page_description":"攝末社是日本神道教的一種宗教場所，指在神社的本社之外而受到該神社管理之小型神社——攝社與末社的合稱。也可以被稱為枝宮或枝社。"},{"page_url":"https://da.wikipedia.org/wiki/Alvin_Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Alvin_Martin%2C_he%27s_got_no_hair.jpg","page_title":"Alvin Martin","context_page_description":"Alvin Edward Martin er en tidligere engelsk fodboldspiller og træner, der spillede som forsvarsspiller. Han var på klubplan tilknyttet West Ham United, som han spillede for i hele 20 år, og opnåede 469 ligakampe for. Han sluttede karrieren med en enkelt sæson hos Leyton Orient. Med West Ham var han med til at vinde FA Cuppen i 1980.\\nMartin blev desuden noteret for 17 kampe for Englands landshold. Han repræsenterede sit land ved VM i 1986 i Mexico, hvor englænderne nåede kvartfinalerne.\\nEfter sit karrierestop var Martin i to sæsoner manager for Southend United."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Polk_County,_Georgia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Big_Spring_Park%2C_Cedartown%2C_Georgia.jpg","page_title":"National Register of Historic Places listings in Polk County, Georgia","context_page_description":"This is a list of properties and districts in Polk County, Georgia that are listed on the National Register of Historic Places.\\nThis National Park Service list is complete through NPS recent listings posted November 22, 2019."},{"page_url":"https://pl.wikipedia.org/wiki/P%C4%85kle","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Corrosion.jpg","page_title":"Pąkle","context_page_description":"Pąkle – rodzaj morskich skorupiaków prowadzących osiadły tryb życia, zaliczanych do wąsonogów."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%96%D1%81%D0%BB%D0%B0%D0%BF%D0%BB%D0%BE%D0%B4%D0%BD%D1%96%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Anethum_graveolens_seeds.JPG","page_title":"Віслаплоднік","context_page_description":"Віслаплоднік, або двухсямянка — плод сасудзістых раслін, відазмененая каробачка. Характэрны для раслін сямейства сельдэрэевых і некаторых араліевых. Складаецца з двух аднанасенных сухіх паўплодзікаў, якія не раскрываюцца. Развіваецца з двухгнездавой завязі, спелы распадаецца падоўжна на 2 палавінкі, якія вісяць на расшчэпленым напалам стрыжаньку, што прадаўжаецца ў пладаножку."},{"page_url":"https://sh.wikipedia.org/wiki/Igor_Radoji%C4%8Di%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Igor_Radojicic_Crop.jpg","page_title":"Igor Radojičić","context_page_description":"Igor Radojičić je aktualni gradonačelnik Banje Luke.\\nDiplomirao je elektrotehnika u rodnom gradu, a postdiplomski nastavio u Beogradu.\\nŠto se tiče politike, njegov se razvoj kreće od člana Predsjedništva Saveza socijalističke omladine Bosne i Hercegovine do glavnog tajnika SNSD-a.\\nOsim maternjeg, govori engleski i francuski jezik."},{"page_url":"https://de.wikipedia.org/wiki/Benedetto_Aloisi_Masella","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Coat_of_arms_of_Benedetto_Aloisi_Masella.svg","page_title":"Benedetto Aloisi Masella","context_page_description":"Benedetto Kardinal Aloisi Masella war ein vatikanischer Diplomat und später ein Kurienkardinal der römisch-katholischen Kirche."},{"page_url":"https://simple.wikipedia.org/wiki/Ani","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/AniCathedral.JPG","page_title":"Ani","context_page_description":"Ani is a ruined and uninhabited medieval city-site in Turkey. It is in the province of Kars, beside the border with Armenia. It was once the capital of a medieval Armenian kingdom that covered much of present-day Armenia and eastern Turkey.\\nAt the height of its great times, Ani had a population of 100,000 - 200,000 people and was the rival of Constantinople, Baghdad and Cairo. Long ago renowned for its splendor and magnificence, Ani has been abandoned and largely forgotten for centuries."},{"page_url":"https://pt.wikipedia.org/wiki/Anaj%C3%A1s","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Brasao_anajas.JPG","page_title":"Anajás","context_page_description":"Anajás é um município brasileiro do estado do Pará, pertencente à Mesorregião do Marajó. Localiza-se no norte brasileiro, a uma latitude 00º 59' 12\\" sul e longitude 49º 56' 24\\" oeste."},{"page_url":"https://it.wikipedia.org/wiki/Grattacieli_pi%C3%B9_alti_della_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Paris_La_D%C3%A9fense_-_panoramio_%2815%29.jpg","page_title":"Grattacieli più alti della Francia","context_page_description":"Questa è una lista dei grattacieli più alti di Francia con altezza minima di 100 metri.\\nGli edifici qui elencati sono 23, la maggior parte situati nel quartiere de La Défense, di cui il più alto è la Tour First che con i suoi 231 metri è il grattacielo più alto di Francia."},{"page_url":"https://en.wikipedia.org/wiki/Alfoz_de_Lloredo","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/San_Martin_de_Ciguenza_001.jpg","page_title":"Alfoz de Lloredo","context_page_description":"Alfoz de Lloredo is a municipality located in the autonomous community of Cantabria, Spain. According to the 2007 census, the city has a population of 2.538 inhabitants. Its capital is Novales."},{"page_url":"https://de.wikipedia.org/wiki/Departamento_San_Mart%C3%ADn_(Corrientes)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/San_Martin_Corrientes.PNG","page_title":"Departamento San Martín (Corrientes)","context_page_description":"Das Departamento San Martín liegt im Osten der Provinz Corrientes im Nordosten Argentiniens und ist eine von 25 Verwaltungseinheiten der Provinz.\\nIm Norden grenzt es an das Departamento Santo Tomé, im Osten, getrennt durch den Río Uruguay, an Brasilien und das Departamento General Alvear, im Süden an das Departamento Paso de los Libres und im Westen an das Departamento Mercedes.\\nDie Hauptstadt des Departamento San Martín ist La Cruz."},{"page_url":"https://en.wikipedia.org/wiki/G%C3%BCnther_Hell","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/G%C3%BCnther_Hell_%26_Stefano_Giliati.png","page_title":"Günther Hell","context_page_description":"Günther Hell is an Italian ice hockey player. He competed in the men's tournament at the 2006 Winter Olympics."},{"page_url":"https://ru.wikipedia.org/wiki/Mercury_(%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%BC%D0%B0%D1%80%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/MercuryCommuter.jpg","page_title":"Mercury (автомобильная марка)","context_page_description":"Mercury — марка легковых и лёгких грузовых автомобилей, созданная в 1938 году в качестве самостоятельного подразделения Ford Motor Company для продажи автомобилей средней ценовой категории, располагающихся между относительно доступными моделями Ford и роскошными Lincoln.\\nПроизводство автомобилей этой марки было прекращено в 2010 году. Было заявлено, что для компенсации под брендом Lincoln в ближайшие 4 года будет создано 7 новых, сравнительно бюджетных, моделей. Mercury, входивший в состав подразделения Lincoln-Mercury, не имел собственных отдельных дилерских представительств, продаваясь через совместную с маркой Lincoln сеть; теперь занимавшиеся продажей автомобилей этой марки фирмы станут дилерами либо Lincoln, либо Ford.\\nИзначально это подразделение выпускало автомобили полностью независимой разработки, но в недавней перспективе все модели Mercury были построены на общих платформах с моделями Ford."},{"page_url":"https://hu.wikipedia.org/wiki/Frans_Sammut","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Premju_Letterarju_1991.jpg","page_title":"Frans Sammut","context_page_description":"Frans Sammut máltai regény- és prózaíró."},{"page_url":"https://sl.wikipedia.org/wiki/Gr%C5%A1ka_temna_doba","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/AGM_Ancient_Greek_Pair_of_Terracotta_Boots.jpg","page_title":"Grška temna doba","context_page_description":"Grška temna doba, ki se imenuje tudi grški srednji vek ali Homerjeva doba ali geometrično obdobje, je obdobje grške zgodovine od konca mikenske palačne civilizacije okoli 1100 pr. n. št. do prvih znakov grških polisov v 9. stoletju pr. n. št.\\nArheološki dokazi kažejo zelo razširjen propad bronastodobne civilizacije v vzhodnem sredozemskem svetu na začetku obdobja, saj so bile velike mikenske palače in mesta uničeni ali zapuščeni. Približno takrat je bila hetitska civilizacija resno motena in mesta od Troje do Gaze so bila uničena. Po razpadu je revna in manjša naselja pestila lakota in prebivalci so se začeli odseljevati. V Grčiji se je prenehala uporabljati linearna pisava B za grški jezik, ki so jo uporabljali mikenski birokrati. Dekoracija na grški lončenini po okoli 1100 pred našim štetjem ni bila več figurativna mikenska keramika, omejena je bila na enostavnejše, geometrijske vzorce."},{"page_url":"https://en.wikipedia.org/wiki/2015_Putrajaya_ePrix","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Litar_jalan_daripada_Putrajaya.svg","page_title":"2015 Putrajaya ePrix","context_page_description":"The 2015 Putrajaya ePrix, was a Formula E motor race held on 7 November 2015 at the Putrajaya Street Circuit in Putrajaya, Malaysia. It was the second edition of the Putrajaya ePrix and the second championship race of the 2015–16 Formula E season. The race was won by Lucas di Grassi."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%A9%BA%E4%B8%AD%E6%8E%A5%E8%BF%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/JAL2001incident.png","page_title":"空中接近","context_page_description":"空中接近是指飞航中的两机于空中过于接近，后果可能导致两机相撞。\\n为了空中交通的安全与顺畅，航空交通管制员会以无线电和飞行员通话，告知航路上的交通状况，将航机彼此隔离在安全的空域，飞行员必须遵守航管员的引导，调整航机飞行的航路、高度和速度，以避免发生空中接近的危险。"},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Louis_Costes_(restaurateur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/La_Strasbourgeoise%2C_5_Rue_du_8_Mai_1945%2C_75010_Paris%2C_5_June_2011_-_panoramio.jpg","page_title":"Jean-Louis Costes (restaurateur)","context_page_description":"Jean-Louis Costes est un restaurateur et homme d'affaires né en 1950 à Saint-Amans-des-Cots dans l'Aveyron. Arrivé à Paris avec son frère, Gilbert quand ils sont tous les deux adolescents, il fonde grâce au réseau d'entraide aveyronnais, à une solidarité familiale et à un carnet d'adresses fourni un groupe de restauration, de brasserie et d'hôtellerie de luxe qui a changé les codes de la brasserie et de la restauration parisienne traditionnelle depuis 1974."},{"page_url":"https://en.wikipedia.org/wiki/Accropode","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/AccropodeMonitoring.jpg","page_title":"Accropode","context_page_description":"Accropode blocks are man-made unreinforced concrete objects designed to resist the action of waves on breakwaters and coastal structures."},{"page_url":"https://de.wikipedia.org/wiki/Westfeld_(Ibbenb%C3%BCren)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Ibbenbueren-Bergehalde.jpg","page_title":"Westfeld (Ibbenbüren)","context_page_description":"Das Westfeld liegt im Ibbenbürener Steinkohlenrevier im Tecklenburger Land. Es umfasst den westlichen Teil der Ibbenbürener Karbonscholle. Es reicht vom Bockradener Graben im Osten bis nach Uffeln im Westen, sowie von Püsselbüren im Süden nach Recke im Norden. Der Steinkohleabbau endete hier 1979."},{"page_url":"https://cs.wikipedia.org/wiki/Johnny_Jebsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Johnny_Jebsen.png","page_title":"Johnny Jebsen","context_page_description":"Johann-Nielsen Jebsen alias „Johnny“ byl německý protinacistický dvojitý agent, který během druhé světové války spolupracoval s německým Abwehrem a britskou MI6. Do služeb německé tajné služby přivedl srbského špióna Dušana Popova, který rovněž pracoval pro MI6. Roku 1944 byl Němci zatčen, internován v koncentračním táboře a na konci války zabit."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_Santa_Maria_la_Mayor_(Inca)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sirena3.jpg","page_title":"Iglesia de Santa Maria la Mayor (Inca)","context_page_description":"La Iglesia de Santa María la Major es un templo católico situado en la localidad de Inca. El edificio es de estilo barroco."},{"page_url":"https://ceb.wikipedia.org/wiki/Persoonia_fastigiata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/PersooniafastigiataDistMap28.png","page_title":"Persoonia fastigiata","context_page_description":"Espesye sa tanom nga bulak ang Persoonia fastigiata. Una ning gihulagway ni Robert Brown. Ang Persoonia fastigiata sakop sa kahenera nga Persoonia sa kabanay nga Proteaceae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://de.wikipedia.org/wiki/Bistum_S%C3%A3o_Gabriel_da_Cachoeira","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3e/Catedral-S%C3%A3o-Gabr-da-Cachoeira.jpg","page_title":"Bistum São Gabriel da Cachoeira","context_page_description":"Das Bistum São Gabriel da Cachoeira ist eine in Brasilien gelegene römisch-katholische Diözese mit Sitz in São Gabriel da Cachoeira im Bundesstaat Amazonas."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BA%D0%B8_%D0%9A%D0%B5%D1%80%D1%87%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Eni_Kale.jpg","page_title":"Пам'ятки Керчі","context_page_description":"На території Керченської міськради знаходиться 11 архітектурно-археологічних комплексів, 5 пам'яток архітектури національного значення і 15 пам'яток — місцевого значення, 3 пам'ятки історії національного значення і 59 — місцевого."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B8%BD%E6%B1%9F%E5%9C%9F%E5%8F%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/A_portrait_of_Mu_Sen.jpg","page_title":"丽江土司","context_page_description":"丽江木氏土司，是元朝、明朝、清朝时期丽江世袭的土司，属纳西族。\\n丽江一带的纳西族政权早在隋末唐初便出现在中国史料当中。在藏文史料中，与南诏地区统称为姜域。在吐蕃崛起的时候，纳西族政权和南诏曾多次抗击吐蕃的入侵。忽必烈进攻大理国的时候，摩娑诏君主阿琮阿良归降蒙古，受封云南等处行中书省丽江路宣抚使之职，其后代世袭此职。1381年明军攻入云南，阿甲阿得归降明军，被明太祖任命为云南承宣布政使司丽江府知府，赐予木姓。\\n丽江木氏土司历代都接受中原朝廷的册封，并不断对外扩张。在木增在位期间，丽江土司的势力达到鼎盛。清军攻入云南之际，土司木懿归降清廷，被允许继续世袭土司之职。三藩之乱爆发的时候，丽江土司拒绝响应吴三桂发动的叛乱。\\n雍正元年改土归流，末代土司木钟被罢免丽江知府的职位，以流官代替。丽江木氏共传十九位知府，此后被降为没有实权的土通判，直到清朝灭亡为止。\\n丽江人及其邻近的嘉绒人都称丽江土司为“木天王”。丽江木氏土司受到中原文化的深远影响，史载“云南诸土司，知诗书，好礼守义，以丽江木氏为首”。其中木泰、木公、木高、木青、木增、木靖六位土司的诗文造诣颇深，被后世并称为“木氏六公”。此外，受嘉绒人的影响，丽江土司也笃信藏传佛教。"},{"page_url":"https://es.wikipedia.org/wiki/Orden_de_Agustinos_Recoletos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Religiosas_de_la_Congregaci%C3%B3n_de_Misioneras_Agustinas_Recoletas.JPG","page_title":"Orden de Agustinos Recoletos","context_page_description":"La Orden de Agustinos Recoletos es una orden religiosa perteneciente a la Iglesia católica surgida en el siglo XVI con presencia en 22 países alrededor del mundo. Se encuentra conformada por cerca de 1000 sacerdotes y religiosos, además de los monasterios de monjas de clausura, las comunidades de religiosas de vida apostólica, la Fraternidad Seglar —laicos que viven según la regla de la Orden— y las comunidades de Jóvenes Agustinos Recoletos."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%81%8B%E8%B3%83%E7%AE%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/ALPICO_Kotsu_16043_Issui_NHAV2_Fare_box.jpg","page_title":"運賃箱","context_page_description":"運賃箱とは、ワンマン運転を実施している路線バス・旅客列車内での運賃収受を簡便かつ厳正に行うために設置されている機械装置。また、車掌が乗務している旅客列車においても、車内精算を行う事業者局では運賃箱を設置している場合がある。事業者局によっては料金箱・料金機・乗車料金収納機などと呼んでいるところもある。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9C%B0%E6%A8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Tower_bridge_London_Twilight_-_November_2006.jpg","page_title":"地標","context_page_description":"地標是指某地方具有獨特地理特色的建築物或者自然景觀地形，遊客或其他一般人可以看圖而認出自己所在之處，例如摩天大樓、購物中心、會議中心、飯店、娛樂場所、體育館、劇院、學校、博物館、紀念碑、廣場、鐘樓、市政廳、教堂、寺廟、清真寺、雕像、車站、機場、發電廠、天線、煙囪、水壩、水塔、燈塔、橋樑等公共建設。"},{"page_url":"https://hu.wikipedia.org/wiki/V%C3%A9rtesalja","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/54/HU_subregion_5.2.1._V%C3%A9rtesalji-dombs%C3%A1g.png","page_title":"Vértesalja","context_page_description":"A Vértesalja - vagy másképpen a Bársonyos - dombság a Kisalföld keleti részén, a Vértes és a Duna között."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%84%D9%81_%D8%B3%D8%AA%D9%88%D9%84%D8%AA%D9%8A%D8%B1%D9%81%D9%88%D9%87%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/UlfStolterfoht.JPG","page_title":"الف ستولتيرفوهت","context_page_description":"الف ستولتيرفوهت كاتب و مترجم و مؤلف من المانيا."},{"page_url":"https://en.wikipedia.org/wiki/Chief_of_Staff_of_the_Presidential_Executive_Office_(Russia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Sergey_Sobyanin_small_photo.jpg","page_title":"Chief of Staff of the Presidential Executive Office (Russia)","context_page_description":"The Chief of Staff of the Presidential Executive Office of the Russian Federation is the head of the Presidential Executive Office. The position was created by Boris Yeltsin's decree in 1991. The Chief of Staff is responsible for general management of presidential activity.\\nThe incumbent Chief of Staff is Anton Vaino, who assumed the position in August 2016."},{"page_url":"https://sw.wikipedia.org/wiki/Berkeley,_California","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Berkeley-downtown-Bay-bridge-SF-in-back-from-Lab.jpg","page_title":"Berkeley, California","context_page_description":"Berkeley ni mji wa Marekani katika jimbo la California. Kwa mujibu wa sensa iliyofanyika mnamo mwaka wa 2000, mji una wakazi wapatao 100,000 wanaoishi katika mji huu. Mji upo m 0-400 kutoka juu ya usawa wa bahari."},{"page_url":"https://en.wikipedia.org/wiki/Herrengasse_23_(Bern)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Von-Wattenwyl-Haus%2C_Herrengasse_23%2C_Westseite.jpg","page_title":"Herrengasse 23 (Bern)","context_page_description":"The von Wattenwyl house on Herrengasse 23 is a historic building in Bern, Switzerland, named after the von Wattenwyl family who owned it for over 200 years.\\nThe building was constructed during the Middle Ages, incorporating some older neighbouring properties; these can still seen in the eastern range of the house.\\nOver time, the house changed owners several times, and various design changes were effected. The first major reconstruction was in 1690, with further changes executed between 1730 and 1740. The most notable of these was made in 1760 by the eminent Bernese architect, Erasmus Ritter, for the building's then owner, David Salomon von Wattenwyl. A fountain by Ritter, in the form of a carved pillar surmounted by a vase, remains in front of the house."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_Todos_los_Santos_(Wing)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/AllSaintsChurchWing-2.jpg","page_title":"Iglesia de Todos los Santos (Wing)","context_page_description":"La iglesia de Todos los Santos es una iglesia parroquial de la Iglesia de Inglaterra, situada en Wing –condado de Buckinghamshire– en Inglaterra. Clasificada como Monumento de Grado I.\\nSu mampostería se construyó en gran medida en los siglos VIII al XI durante el período anglosajón, lo que la convierte en una de las iglesias más antiguas de Inglaterra.\\nWing se encuentra a 5 km al suroeste de Leighton Buzzard y 12 km al noreste de Aylesbury. La iglesia de All Saints' se encuentra en las afueras al oeste del centro de la ciudad.\\nLa iglesia alberga una serie de vidrieras del siglo XIX y un órgano Walker que data de 1864, colocado en 2002 en una nueva galería en la base de la torre. En su interior destaca su techo de madera o la tumba de Sir William Dorner y Dorathe Dormer.\\nEl interior de la iglesia fue utilizado para grabar un videoclip de Libera​ para el programa Songs of Praise."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89lections_l%C3%A9gislatives_mac%C3%A9doniennes_de_2008","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Radmila_%C5%A0ekerinska_-_2018_%2840930351855%29_%28cropped%29.jpg","page_title":"Élections législatives macédoniennes de 2008","context_page_description":"Les élections législatives macédoniennes de 2008 se tiennent le dimanche 1ᵉʳ juin 2008, afin d'élire les 120 députés de la 6ᵉ législature de l'Assemblée de Macédoine, pour un mandat de quatre ans.\\nLe scrutin est convoqué avec deux ans d'avance, après que l'OTAN a repoussé la candidature de la Macédoine en raison du débat autour de son nom. Il est remporté par la coalition conservatrice et libérale du président du gouvernement Nikola Gruevski, qui obtient la majorité absolue des sièges. Il se maintient donc au pouvoir, après avoir forgé un gouvernement de coalition avec l'Union démocratique pour l'intégration."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D0%B0%D0%BD%D0%B4%D0%B0%D1%80%D0%BC_2-%D0%B3%D0%B0_%D1%80%D0%B0%D0%BD%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Alksnis_Yakov.jpg","page_title":"Камандарм 2-га рангу","context_page_description":"Камандарм 2-га рангу — персанальнае воінскае званне вышэйшага каманднага і начальніцкага складу ў РСЧА.\\nНазва воінскага звання утворана ад скарачэння назвы воінскай пасады «камандуючы арміяй» з даданнем рангу. В/З было вышэй звання камкор, ніжэй звання камандарма 1-га рангу."},{"page_url":"https://sh.wikipedia.org/wiki/Botulinski_toksin","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Botulinum_toxin_3BTA.png","page_title":"Botulinski toksin","context_page_description":"Botulinski toksin, egzogeni neurotoksin, botoks, je enzim koji prozvodi bakterija klostridijum botulinum, i spada u grupu biološki najjačih otrova koji ostvaruje svoj paralitički efekat brzom i ireverzibilnom blokadom neuromišićne transmisije. Unet u organizam inhibira oslobađanje acetilholina u neuromišićnim sinapsama uzrokujući u organizmu bolest pozantu pod nazivom botulizam. Srednja smrtna doza botulinskog toksina, kao jednog od najačih prirodnih otrova, je 30 pg/kg nakon intravenske ili supkutane aplikacije, ili 3 ng/kg nakon udisanja. NJegova izutena toksičnost dokazana je u eksperimentalnim uslovima, kada posle intravenskog ubrizgavanja, u krv primata, srednja smrtna doza botulinskog toksina iznosi, - 40-56 ng, ili kod tipa-C1 oko 32 ng, kod tipa-D oko 3.200 ng, i tipa-E oko 88 ng.\\nBotulinski toksin poznat po jednom od svojih najupotrebljavinijih imena, Botoks ili Disport, oko dve decenije se, zahvaljujući istraživanjima Alana Skota koristi u medicini u veoma malim dozama kao lek za opuštanje mišića, kod pacijenata sa bolnim grčevima i fascikulacijama mišića, ali neuporedivo veću popularnost je stekao u kozmetologiji kao sredstvo za ulepšavanje, tačnije za „zatezanje bora“."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Paul_Klee","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Klee_Botanisches_Theater_1290079.jpg","page_title":"List of works by Paul Klee","context_page_description":"This is an incomplete list of works by Paul Klee, a Swiss-born German artist and draftsman. His highly individual style was influenced by movements in art that included Expressionism, Cubism, and Surrealism."},{"page_url":"https://da.wikipedia.org/wiki/San_Martino_(1863)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Regina_maria_pia_%281863%29.jpg","page_title":"San Martino (1863)","context_page_description":"Panserskibet San Martino var et skib i den fjerde og hidtil største klasse af panserskibe i den nye italienske marine, der blev skabt, da Italien blev samlet i 1861. Værftskapaciteten i Italien var begrænset, så marinen måtte gøre brug af udenlandske værfter. De fire skibe i Regina Maria Pia-klassen blev derfor bygget i Frankrig, der var et foregangsland for panserskibsbygning, og marinen fik moderne konstruktioner med jernskrog, der alle holdt i 40 år eller mere. Navnet San Martino kan henvise til adskillige helgener og lokaliteter opkaldt efter dem. I dette tilfælde må det være San Martino i provinsen Brescia. Her vandt en hær fra Frankrig og kongeriget Sardinien i 1859 et slag over østrigerne. I resten af verden kendes det som slaget ved Solferino, men i Italien er det kendt som slaget ved Solferino og San Martino, fordi de italienske tropper kæmpede på venstre fløj ved byen San Martino."},{"page_url":"https://en.wikipedia.org/wiki/Heat-pipe_tectonics","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Volcanic_Resurfacing.png","page_title":"Heat-pipe tectonics","context_page_description":"Heat-pipe tectonics is a cooling mode of terrestrial planets in which the main heat transport mechanism in the planet is volcanism through the outer hard shell, also called the lithosphere. Heat-pipe tectonics initiates when volcanism becomes the dominant surface heat transfer process. Melted rocks and other more volatile planetary materials are transferred from the mantle to surface via localised vents. Melts cool down and solidify forming layers of cool volcanic materials. Newly erupted materials deposit on top of and bury older layers. The accumulation of volcanic layers on the shell and the corresponding evacuation of materials at depth cause the downward transfer of superficial materials such that the shell materials continuously descend toward the planet's interior.\\nHeat-pipe tectonics was first introduced based on the observations on Io, one of the moons of Jupiter. Io is a rocky body that is internally extremely hot; its heat is produced by tidal flexing associated with its eccentric orbit. It releases internal heat via frequent and extensive volcanic eruptions that transfer melts to the surface."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D0%BA%D0%B8%D0%BD%D0%B0,_%D0%A1%D0%B2%D0%B5%D1%82%D0%BB%D0%B0%D0%BD%D0%B0_%D0%A1%D0%B5%D1%80%D0%B3%D0%B5%D0%B5%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/1939-Markin-Bolshevo-35x35.jpg","page_title":"Маркина, Светлана Сергеевна","context_page_description":"Светлана Сергеевна Маркина — советский и российский врач и учёный-эпидемиолог, ведущий научный сотрудник лаборатории эпидемиологического надзора за дифтерией Московского научно-исследовательского института эпидемиологии и микробиологии имени Г. Н. Габричевского Роспотребнадзора России, автор научных публикаций и изобретения, депутат Московского городского совета."},{"page_url":"https://de.wikipedia.org/wiki/Werner_Grill","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Werner_Grill.jpg","page_title":"Werner Grill","context_page_description":"Werner Grill war ein deutscher Chirurg. Er war Professor und Spezialist auf dem Gebiet der Bauchchirurgie. Ab 1965 leitete er das Kreiskrankenhaus in Starnberg. Nach seiner aktiven Zeit als Mediziner wurde er Leiter der Schlichtungsstelle der Bayerischen Landesärztekammer."},{"page_url":"https://sv.wikipedia.org/wiki/Myopa_dorsalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Conopidae_-_Myopa_dorsalis-1.JPG","page_title":"Myopa dorsalis","context_page_description":"Myopa dorsalis är en tvåvingeart som beskrevs av Fabricius 1794. Myopa dorsalis ingår i släktet Myopa och familjen stekelflugor. Arten har ej påträffats i Sverige. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://hu.wikipedia.org/wiki/Eu%C3%9Ferthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Eusserthal-02-mit_Zisterzienserkirche-2019-gje.jpg","page_title":"Eußerthal","context_page_description":"Eußerthal település Németországban, Rajna-vidék-Pfalz tartományban. Lakosainak száma 886 fő. +/-"},{"page_url":"https://de.wikipedia.org/wiki/Lago_di_Vagli","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/VagliSottoPonteMorandi2.jpg","page_title":"Lago di Vagli","context_page_description":"Der Lago di Vagli ist der größte Stausee in der Toskana."},{"page_url":"https://it.wikipedia.org/wiki/Piano_sub-montano","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/75/Tilia_platyphyllos_003.jpg","page_title":"Piano sub-montano","context_page_description":"Il piano sub-montano è il piano altitudinale che si trova al di sopra del piano basale e al di sotto del piano montano, e dunque tra i 400-600 e gli 800–1200 m s.l.m.\\nCorrisponde alla fascia dei primi rilievi che ancora non presentano una chiara morfologia montana o alpina, sebbene la lascino intuire. Si tratta di rilievi collinari pedemontani, quasi mai innevati, almeno sino ai 1000 m circa, o comunque, nelle parti più alte, coperti da poca neve in modo discontinuo e mai stabile. I loro versanti e i loro altopiani mostrano una vegetazione arborea ricca di numerosissime specie, folta e assai variegata, là dove la progressiva diffusione del Sistema insediativo umano ha conservato i manti boschivi su superfici sufficientemente vaste, o anche in più modesti ma rappresentativi aggruppamenti, alternandoli alle terre coltivate o antropizzate in senso lato. Più si scende di quota, infatti, e meno acclivi si fanno i pendii sino alle pianure di fondovalle, tanto più l'espansione antropica ha occupato i terreni, sacrificando ciò che, in un tempo ormai lontano, era una ininterrotta distesa di foreste."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AF%D9%87%D8%A7%D8%AA%DB%8C_(%D9%BE%D8%B1%D9%88%D8%A7%D9%86%D9%87)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Rustic_puddling.jpg","page_title":"دهاتی (پروانه)","context_page_description":"دهاتی (پروانه) نام یک گونه از تیره فرچه‌پایان است."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B5%E0%AF%86%E0%AE%B2%E0%AF%8D%E0%AE%B2%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Jiggery%2C_shaped.JPG","page_title":"வெல்லம்","context_page_description":"வெல்லம் எனப்படுவது பதனிடப்படாத சர்க்கரை ஆகும். ஆங்கிலத்தில் ஜக்கரி என அழைக்கப்படுகிறது.\\nவெல்லம் இந்திய துணைக்கண்டத்தில் சுமார் 2500 ஆண்டுகளுக்கும் மேலாக தொன்றுதொட்டு உட்கொள்ளப்படும் ஒரு பண்டமாகும். தலைமையாக இந்திய ஆயுர்வேத மருத்துவ நூல் ஒன்றில் வெல்லத்திற்கு வாதம் மற்றும் செரிமான நோய்களைக் குணப்படுத்தும் தன்மை உள்ளதாக எழுதப்பட்டுள்ளது. மேம்பட்ட மருத்துவத்தில் வெல்லத்திற்குத் தொண்டையில்/நுரையீரலில், புழுதி மற்றும் புகையினால் ஏற்படும் சிதைவைத் தடுக்கும் குணம் உள்ளதாகவும் கண்டறியப்பட்டுள்ளது.\\nவெல்லம், கரும்பு அல்லது பனையிலிருந்து தயாரிக்கப்படுகிறது. கரும்புச் சாறோ பனம்பாலோ ஒரு பெரிய அகண்ட வாணலியில், திறந்த வண்ணம், சுமார் 200 °C சூட்டில் வெகு நேரம் கொதிக்க வைக்கப்படுகிறது. இதனால் கரும்புச்சாற்றில் அல்லது பனம்பாலில் உள்ள நீர் ஆவியாகி பாகு போன்ற பதம் பெறப்படுகிறது. கொதி நிலையில் உள்ள பாகை அச்சில் ஊற்றி, உலர வைத்த பின், வெவ்வேறு வடிவங்களில் விற்பனை செய்யப்படுகிறது. கைகளால் பிடித்து உருட்டப்பட்ட வெல்லம், மண்டை வெல்லம் எனவும் அச்சுக்களில் ஊற்றி வடிவமைக்கப்பட்ட வெல்லம், அச்சு வெல்லம் எனவும் அழைக்கப்படுகிறது."},{"page_url":"https://eo.wikipedia.org/wiki/N%C3%A9bian","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Nebian.jpg","page_title":"Nébian","context_page_description":"Nébian estas komunumo de Francio. Ĝi situas en la departemento Hérault, en la regiono Okcitanio. Fine de 2017 en la komunumo vivis 1 388 loĝantoj."},{"page_url":"https://nn.wikipedia.org/wiki/Sichuan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Larix_potaninii_trees_Huluhai.jpg","page_title":"Sichuan","context_page_description":"Sichuan er ein provins i Kina.\\nProvinsen dekker 485 000 km², og er den største provinsen i det sørvestlege Kina. Sichuan har 87 millionar innbyggarar. Av desse er 98 % hankinesarar, mens resten høyrer til 14 av dei offisielle etniske minoritetane i Kina. Provinsen er fjellrik med mange elvar, den største og viktigaste er Chang Jiang. Sichuan er rikt på naturressursar: kol, olje, naturgass, titan, kopar, vanadium, gull og salt. Provinshovudstad er Chengdu.\\nSichuan kan delast i to topografiske halvdelar: Sichuanhøgsletta i vest, og Sichuanbassenget i aust. Sichuanhøgsletta er del av den tibetanske høgsletta med fleire nord-sør-gåande fjellryggar. Området har mange høgtliggande beitemarker og skogkledde tindar. Høgsletta er delt i to autonome prefektur med tibetanarar, qiangfolket og/eller yifolket. Det raude bekken har subtropisk klima og rikeleg sommarregn. Heile landskapet er oppdyrka, terrassert og kunstig vatna. Det er svært tettfolka, men ettersom det er omgitt av fjell har det i tidlegare tider vore mykje isolert frå omverda. Frå 1950-åra har omfattande veg- og jarnbanebygging opna området."},{"page_url":"https://pl.wikipedia.org/wiki/Ugyrczin_(gmina)","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Ugarchini_Municipality_Within_Bulgarial.png","page_title":"Ugyrczin (gmina)","context_page_description":"Ugyrczin − gmina w północnej Bułgarii. Populacja wynosi 7500 mieszkańców."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%AC%E3%82%A4%E3%82%B9%E3%83%A9%E3%83%B3%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Koizumi_in_Graceland_2006.jpg","page_title":"グレイスランド","context_page_description":"グレイスランド は、アメリカのロックミュージシャン、エルヴィス・プレスリーの邸宅だった建物を含む、その敷地である。"},{"page_url":"https://en.wikipedia.org/wiki/Joshua_Sears_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Joshua_Sears_Building_01.jpg","page_title":"Joshua Sears Building","context_page_description":"The Joshua Sears Building is a historic building in Kirkland, Washington located at the northwest corner of Market Street and Seventh Avenue, Kirkland's historic commercial core. It is listed on the National Register of Historic Places. It was built in 1891 by Boston philanthropist and capitalist, Joshua Sears, who was heavily invested in Peter Kirk's Great Western Iron and Steel Company and who planned to open a bank in town. As a result of the Panic of 1893, the steel mill and the bank never opened but the Sears building survives today as a reminder of what might have been in Kirkland. It is an early example of Beaux-Arts architecture in the Northwest, where Victorian and Romanesque Revival styles were still predominant in commercial buildings. On August 3, 1982, it was added the National Register of Historic Places. In December 2015 the building was purchased by local attorney Simeon Osborn and his wife Monica Hart, who stated they plan to keep the current business and residential tenants."},{"page_url":"https://fr.wikipedia.org/wiki/Chahid_(Alg%C3%A9rie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Alger_Memorial-du-Martyr_IMG_1135.JPG","page_title":"Chahid (Algérie)","context_page_description":"Un chahid est, en Algérie, le titre officiel de toute personne qui a combattu durant la guerre d'Algérie dans les rangs indépendantistes et qui est tombé au champ d'honneur ou qui est mort à la suite de son engagement. Les chahids sont désignés en Algérie comme « le symbole et la fierté de la Nation »."},{"page_url":"https://ca.wikipedia.org/wiki/Tessel%C2%B7laci%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Semi-regular-floor-3464.JPG","page_title":"Tessel·lació","context_page_description":"Els termes tessel·lació i tessel·lat fan referència a una regularitat o patró de figures que recobreixen o pavimenten completament una superfície plana de manera que es no queden espais buits ni se superposen les figures. En matemàtiques, les tessel·lacions es poden generalitzar a dimensions superiors i a una diversitat de geometries.\\nUna tessel·lació periòdica té un patró que es repeteix. Alguns tipus especials inclouen les tessel·lacions regulars amb tessel·les totes de la mateixa forma de polígons regulars, i tessel·lacions semiregulars amb més d'una forma i amb cada cantonada arranjada idènticament. Els patrons formats per tessel·lacions periòdiques es poden categoritzar en 17 grups de paper pintat. Una tessel·lació sense patró repetitiu s'anomena «no periòdica». Una tessel·lació aperiòdica utilitza un petit conjunt de formes que no poden formar un patró de repetició. En la geometria de dimensions superiors, un enrajolat també s'anomena «tessel·lació de l'espai».\\nUna tessel·lació real és aquella feta de peces quadrades o hexagonals de ceràmica cimentada."},{"page_url":"https://it.wikipedia.org/wiki/Lindesberg_(comune)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Lindesberg_Municipality_in_%C3%96rebro_County.png","page_title":"Lindesberg (comune)","context_page_description":"Lindesberg è un comune svedese di 23.037 abitanti, situato nella contea di Örebro. Il suo capoluogo è la città omonima."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%8B%E3%82%B3%E3%83%A9%E3%82%A8%E3%83%95%E3%82%B9%E3%82%AF%E3%83%BB%E3%83%8A%E3%83%BB%E3%82%A2%E3%83%A0%E3%83%BC%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Nikolayevsk_Incident-3.jpg","page_title":"ニコラエフスク・ナ・アムーレ","context_page_description":"ニコラエフスク・ナ・アムーレはロシア極東部、ハバロフスク地方のニコラエフスキー地区の行政中心都市・港湾都市。漢字では、尼港と表記される。この町はアムール川が河口部に流入する地点から80km上流に位置しており、川の左岸にある。ハバロフスクからは977km、コムソモリスク・ナ・アムーレの鉄道駅からは582kmの距離にある。人口は、2002年調査で28,492人。"},{"page_url":"https://ja.wikipedia.org/wiki/%E6%B5%85%E9%96%93%E7%A5%9E%E7%A4%BE_(%E7%B7%B4%E9%A6%AC%E5%8C%BA%E5%B0%8F%E7%AB%B9%E7%94%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Ekoda_no_Fujizuka_in_Ekoda-sengen-jinjya%2C_2015-07-01-a.JPG","page_title":"浅間神社 (練馬区小竹町)","context_page_description":"浅間神社は、東京都練馬区小竹町にある神社。「江古田浅間神社」、「茅原浅間神社」とも呼称される。"},{"page_url":"https://en.wikipedia.org/wiki/History_of_Bolivia_(1809%E2%80%931920)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Independence_treaty_of_Bolivia.jpg","page_title":"History of Bolivia (1809–1920)","context_page_description":"The invasion of the Iberian Peninsula in 1807-08 by Napoleon Bonaparte's forces proved to be critical for the independence struggle in South America, during which the local elites of Upper Peru remained mostly loyal to Spain, supporting Junta Central, a government which ruled in the name of the overthrown king Ferdinand VII of Spain. A number of radical criollos in 1808-10 began a local power struggle. Pedro Domingo Murillo proclaimed an independent state in Upper Peru in the name of king Ferdinand VII. During the following seven years Upper Peru became the battleground between the armed forces of independent United Provinces of the Rio de la Plata and royalist troops from Viceroyalty of Peru.\\nAfter 1820 the criollos who had formed the Conservative Party supported General Pedro Antonio de Olañeta. During the 1820–1823 liberal revolution in Spain, Olañeta, convinced that revolution threatens the traditional royal authority, refused to join the royalist forces or the rebel armies under the command of Simón Bolívar and Antonio José de Sucre y Alcalá."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A7%D9%87%D9%8A_%D9%85%D8%A7%D9%87%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Coryphaena_hippurus.png","page_title":"ماهي ماهي","context_page_description":"ماهي ماهي أو اللمبوكة المعروف أيضاً باسم سمكة الدلفين الشائعة هو نوع من أنواع الأسماك الشعاعية الزعانف التي تعيش في طبقات المياه السطحية، في البحار الاستوائية والشبه استوائية. يكون الماهي ماهي مع سمكة دلفين بومبانو فصيلة سمكة الدلفين الأسماك الدلفينية. \\"ماهي ماهي\\" تعني \\"قوي قوي\\" بلغة الهاواي، وشاع استخدام هذه التسمية، وخاصة في المطاعم تجنباً للخلط بينها والدلافين التي تنتمي لرتبة الثدييات.\\nتسمى ببعض المصادر باسم سمكة الحصان، بينما تُعرف باسم العنفلوص في عُمان والإمارات، ويشيع اسم اللمبوكة في سوريا ولبنان ومصر وليبيا وتونس والجزائر"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%B8%D0%B4%D1%96%D0%B2_%D1%80%D0%BE%D0%B4%D1%83_%D1%81%D0%BE%D1%81%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Maximartinezii.JPG","page_title":"Список видів роду сосна","context_page_description":"Список видів, що входять до роду Сосна\\nВ алфавітному порядку латинською мовою.\\nЦей список є списком видів сосен, записаних на території Північної Африки, Північна Америка, Європи, Азії, згідно з МСОП. У список не включені регіонально зниклі види.\\nНаступні теги використовуються для виділення охоронного статусу кожного виду за оцінками МСОП:"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B0%D0%BD%D0%B5%D1%81%D0%BA%D0%B8_%D0%BA%D0%BE%D0%B4%D0%B5%D0%BA%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Codex_Manesse_Friedrich_von_Hausen.jpg","page_title":"Манески кодекс","context_page_description":"Манеският кодекс, срещан също като Манески песенник, Манески ръкопис, Голям Хайделбергски песенник, Хайделбергски ръкопис, Парижки ръкопис, е най-големият и най-известен средновековен светски поетичен песенник на немски език.\\nСъстои се от 426 пергаментови листа с размери 35,5 х 25 см. От 1657 до 1888 г. ръкописът е притежание на Кралската библиотека в Париж. Днес се съхранява в библиотеката на Хайделбергския университет."},{"page_url":"https://it.wikipedia.org/wiki/Monodactylidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Fishes_Mada.JPG","page_title":"Monodactylidae","context_page_description":"I Monodactylidae sono una famiglia di pesci ossei d'acqua marina e salmastra appartenenti all'ordine Perciformes."},{"page_url":"https://af.wikipedia.org/wiki/Marion-eiland","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c3/MarionIsland_Map.png","page_title":"Marion-eiland","context_page_description":"Marion-eiland is 'n onbewoonde en onherbergsame sub-antarktiese vulkaaneiland in die suidelike Indiese Oseaan en behoort sedert 1947 aan Suid-Afrika, sedert 1994 tot die provinsie Wes-Kaap en maak administratief deel uit van die Stad Kaapstad Metropolitaanse Munisipaliteit.\\nDie eiland is die grootste en suidwestelike van die twee Prins Eduard-eilande en huisves in teenstelling met die noordoostelike Prins Eduard-eiland 'n gletser. Die eiland is op 13 Januarie 1773 deur die Franse ontdekkingsreisiger Marc-Joseph Marion du Fresne ontdek en na hom genoem."},{"page_url":"https://sk.wikipedia.org/wiki/Wittring","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Map_commune_FR_insee_code_57748.png","page_title":"Wittring","context_page_description":"Wittring je francúzska obec, ktorá sa nachádza v departemente Moselle, v regióne Lotrinsko."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%96%B0%E6%B4%A5%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Nitsu_Niigata_chapter.png","page_title":"新津市","context_page_description":"新津市是位於新潟縣的一個已不存在的市。1951年1月1日，新津市成立。在2005年3月21日，被編入新潟市。現在是新潟市秋葉區的一部分。"},{"page_url":"https://hsb.wikipedia.org/wiki/%C5%A0%C4%87edrjenc","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Cytisus_nigricans_2006.07.01_10.41.34-p7010259.jpg","page_title":"Šćedrjenc","context_page_description":"Šćedrjenc je rostlina ze swójby łušćinowcow.\\nWobsahuje sćěhowace družiny:\\nAlpski šćedrjenc\\nHłójčkaty šćedrjenc\\nMnohokwětkaty šćedrjenc\\nWočornjacy šćedrjenc\\nDwójniči šćedrjenc\\nChošćowc\\nČerwjenožołty šćedrjenc\\nItalski šćedrjenc\\nSmužkaty šćedrjenc"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_bourgmestres_d%27Amsterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Job_Cohen_2010.jpg","page_title":"Liste des bourgmestres d'Amsterdam","context_page_description":"Le bourgmestre d'Amsterdam dirige le pouvoir exécutif dans la commune d'Amsterdam, assisté par un collège d'échevins. Présidant le conseil municipal, il est une figure importante de la vie politique néerlandaise, dirigeant la capitale et commune la plus peuplée du pays. Bien que souvent issu d'un parti politique, le bourgmestre se doit relativement impartial quant à la gestion des affaires municipales, se réservant notamment de faire ouvertement campagne. Il est également en charge de l'ordre public au côté du chef de la police municipale.\\nDepuis le 12 juillet 2018, Femke Halsema exerce la fonction de bourgmestre d'Amsterdam. Elle succède à Jozias van Aartsen."},{"page_url":"https://sl.wikipedia.org/wiki/Sebastijan_Pregelj","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Sebastijan_Pregelj.jpg","page_title":"Sebastijan Pregelj","context_page_description":"Sebastijan Pregelj, slovenski pisatelj, * 29. julij 1970, Ljubljana, Slovenija."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9F%8F%E6%9E%97%E8%A3%85%E9%A5%B0%E8%89%BA%E6%9C%AF%E5%8D%9A%E7%89%A9%E9%A6%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/P1010025_Vortragskreuz.JPG","page_title":"柏林装饰艺术博物馆","context_page_description":"柏林装饰艺术博物馆是一个德国装饰艺术博物馆，也是柏林国立博物馆的一部分。藏品因为历史原因被分割在柏林文化广场 和克佩尼克宫.。"},{"page_url":"https://sv.wikipedia.org/wiki/Arkitektur_i_Norge","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Dalen_Hotel-2011.jpg","page_title":"Arkitektur i Norge","context_page_description":"Utvecklingen inom Norges arkitektur har historiskt drivits på av förändrade ekonomiska förutsättningar, teknisk utveckling, demografiska svängningar och kulturella förändringar. Arkitektoniska influenser från andra delar av världen är uppenbara i stora delar av arkitekturen i Norge, men dessa har ofta anpassats för att möta norska klimatförhållanden med hårda vintrar och starka vindar.\\nArkitektoniska trender i Norge har också förändrats parallellt med politiska och samhälleliga förändringarna genom århundradena. Redan under vikingatiden hade snickeriet utvecklats till ett sofistikerat hantverk, vilket syns i de elegant konstruerade långskeppen.\\nEfter att kristendomen införts i landet kom den romanska arkitekturen att dominera i byggandet av katedraler och kyrkor, till stor del som ett resultat av religiöst inflytande från England, vilket resulterade i karakteristiskt rundbågade valv, tunnvalv, korsformade stödjande pelare och kryssvalv.\\nPå grund av geografin var under medeltiden ekonomin och befolkningen spridd över landet."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BB%D1%96%D0%BD_%D0%A4%D1%80%D0%B5%D0%B4%D0%B5%D1%80%D1%96%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Paulinefredericks.jpg","page_title":"Полін Фредерік","context_page_description":"Полін Фредерік — американська актриса."},{"page_url":"https://en.wikipedia.org/wiki/Pigment_Yellow_81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/PigmentYellow81.png","page_title":"Pigment Yellow 81","context_page_description":"Pigment Yellow 81 is an organic compound that is classified as a diarylide pigment. It is used as a yellow colorant.\\nThe compound is synthesized from three components. Treatment of 2,4-dimethylaniline with diketene gives an acetoacetylated aniline. This compound is then coupled to the bisdiazonium salt obtained from 3,3'-dichlorobenzidine."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A6%AC%E6%B6%85%E7%B6%AD%E5%A5%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Maniewicze_Kosciol.jpg","page_title":"馬涅維奇","context_page_description":"馬涅維奇，是烏克蘭的市級鎮，位於該國西北部沃倫州，始建於1892年，面積4.41平方公里，海拔高度193米，2004年人口10,119，人口密度為每平方公里2,295人。"},{"page_url":"https://eo.wikipedia.org/wiki/Castano_Primo","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Castano_Primo_-_San_Zenone.jpg","page_title":"Castano Primo","context_page_description":"Castano Primo - prononco [kasTAno PRImo] - estas komunumo de Italio. Ĝi apartenas al la metropola urbo Milano de la regiono Lombardio. Fine de 2017 en la komunumo vivis 11 249 loĝantoj.\\nNajbaras la komunumoj Lonate Pozzolo, Vanzaghello, Magnago, Nosate, Buscate, Cameri, Turbigo, Robecchetto con Induno kaj Cuggiono."},{"page_url":"https://de.wikipedia.org/wiki/Haakon_Graf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Haakon_Graf_Trio_Kongsberg_Jazzfestival_2017_%28223817%29.jpg","page_title":"Haakon Graf","context_page_description":"Haakon Graf ist ein norwegischer Jazz-Pianist und -organist.\\nGraf, der als Kind eine klassische Klavierausbildung erhielt und sich später auch für Malerei interessierte, arbeitete nach dem Abbruch der Schule in einem Musikladen. Er wurde Mitglied der Jazzrock-Gruppe Ruphus, an deren Debütalbum New Born Day er als Pianist und Komponist mitwirkte.\\nEr trat dann als Sessionmusiker im Osloer Club 7 auf, bevor er 1976 mit Matz Nilsson, Ulf Wakenius und Niels Nordin die Band Hawk On Flight gründete. Mit dem Schlagzeuger Jon Christensen arbeitete er im Quintett Blow Out und der Duoformation Hideaway zusammen. 1978 tourte er mit Terje Rypdal, 1979 unternahm er mit Jan Garbarek eine Tournee durch die Sowjetunion. Er trat regelmäßig bei den Jazzfestivals von Molde und Kongsberg auf und arbeitete als Sideman mit Miroslav Vitouš, Jack DeJohnette, Michał Urbaniak und Urszula Dudziak.\\nNach einer Brasilientournee wurde Graf für drei Jahre Leiter des Club 7, wo er drei- bis fünfmal wöchentlich auftrat. Mit Joeri Hommerson gründete er die Gruppe Graffiti. Von 1988 bis 1989 lebte er in Brasilien."},{"page_url":"https://en.wikipedia.org/wiki/Anna_Smole%C5%84ska","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Tablica_Anna_Smole%C5%84ska_Tadeusz_Zawadzki_ul._Koszykowa_75_Warszawa.JPG","page_title":"Anna Smoleńska","context_page_description":"Anna Smoleńska, pseudonym \\"Hania\\", Polish student of art history at the University of Warsaw, author of the symbol of Fighting Poland during World War II, girl scout Gray Ranks."},{"page_url":"https://lv.wikipedia.org/wiki/Valsts_aizsarg%C4%81jamie_kult%C5%ABras_pieminek%C4%BCi_Gulbenes_novad%C4%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Gulbene%2C_L%C4%ABk%C4%81_iela_21.jpg","page_title":"Valsts aizsargājamie kultūras pieminekļi Gulbenes novadā","context_page_description":"Šajā lapā apkopoti valsts aizsargājamie kultūras pieminekļi Gulbenes novadā.\\nKultūras pieminekļu karte\\nŠis saraksts tiek veidots no Vikidatiem, to periodiski atjaunina bots."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%86%D0%BD%D0%B4%D0%BE%D0%BD%D0%B5%D0%B7%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B0_%D0%BA%D1%83%D1%85%D0%BD%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Bebek_tutu.jpg","page_title":"Індонезійська кухня","context_page_description":"Індонезійська кухня — національні страви, поширені в державі Індонезія. Фактично являє собою поєднання регіональних і етнічних кухонь з власними особливості, які водночас мають низки загальних характеристик. В кожній з цих кухонь присутні місцеві особливості, своєрідні «підкухні». Притаманне більше поширення курятина, риби та морепродуктів у порівняні з м'ясом.\\nНа розвиток індонезійської кухні в значній мірі вплинули кулінарні традиції азійських та європейських держав, насамперед китайської, індійської, арабської, нідерландської, португальської кухонь, англійської. Також певного впливу зазнало з боку тайської, малайської кухонь."},{"page_url":"https://nl.wikipedia.org/wiki/OLA_VT_560","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/NWB_treinstel_VT_561.jpg","page_title":"OLA VT 560","context_page_description":"De VT 560 en VT 610 ook wel Desiro genoemd is een tweedelig dieseltreinstel met lagevloerdeel voor het regionaal personenvervoer van de Ostseeland Verkehr GmbH."},{"page_url":"https://en.wikipedia.org/wiki/Culture_of_Japan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Kamidana_with_kagamimochi_offering_by_shig2006_in_Hitachinaka.jpg","page_title":"Culture of Japan","context_page_description":"The culture of Japan has changed greatly over the millennia, from the country's prehistoric Jōmon Period, to its contemporary modern culture, which absorbs influences from Asia, Europe, and North America.\\nJapan's indigenous culture originates primarily from the Yayoi people who settled in Japan between 1000 BCE to 300 CE. Yayoi culture quickly spread to the main island of Honshū, mixing with the native Jōmon culture. Modern Japanese have an estimated 80% Yayoi and 20% Jōmon ancestry.\\nJapanese culture was influenced from ancient times to the Middle Ages primarily by multiple Chinese dynasties and to a lesser extent by other Asian countries. For example the Japanese language uses Chinese characters for writing, but Japanese has no genetic relationship with Chinese. Since the Meiji period Japan has been primarily influenced by western countries.\\nThe inhabitants of Japan experienced a long period of relative isolation from the outside world for over 220 years during the Tokugawa shogunate until the arrival of the \\"Black Ships\\" and the Meiji period."},{"page_url":"https://hu.wikipedia.org/wiki/Railjet","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/%C3%96BB_1116_200-5_bei_Landeck.jpg","page_title":"Railjet","context_page_description":"A Railjet az Osztrák Szövetségi Vasutak 2008/2009-es menetrendjében megjelent új vonatnem, mely legelőször Budapest-Keleti pályaudvar–Wien Westbahnhof–München Hauptbahnhof között közlekedett. A szolgáltatást kiszolgáló nagysebességű ingavonatoknak a neve \\"Siemens Viaggio Comfort\\". Magyarországon 2008. december 14. óta közlekedik EuroCity vonatként.\\nGyorsabb, modernebb és kényelmesebb, mint az eddigi nagy távolságú vonatok, melyek előtte Ausztriában közlekedtek. A Railjet minőségileg magas színvonalú utazási környezetet nyújt az utasainak.\\n„Elsősorban a közép-európai térséget szeretnénk hozzáférhetőbbé tenni és Bécset ennek a minőségi távolsági forgalom fordítókorongjává alakítani”, mondja Stefan Wehinger, az ÖBB Személyszállítási Rt. Igazgatója."},{"page_url":"https://es.wikipedia.org/wiki/Aa_en_Hunze","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Hunebed_D9_in_Annen.jpg","page_title":"Aa en Hunze","context_page_description":"Aa en Hunze es un municipio de los Países Bajos, en la provincia de Drente. Debe su nombre a los ríos Drentsche Aa y Hunze que lo atraviesan. El municipio tiene una superficie de 278,88 km², de los que 2,53 km² corresponden a la superficie ocupada por el agua, con una población el 1 de enero de 2014 de 25.333 habitantes y una densidad de población de 92 h/km². El municipio se creó en 1998 por la fusión de cuatro anteriores municipios: Rolde, Gasselte, Gieten y Anloo. El gobierno municipal tiene su sede en Gieten.\\nSe encuentra en una de las zonas de más antigua población de los Países Bajos, localizándose doce megalitos en su término municipal."},{"page_url":"https://fr.wikipedia.org/wiki/Deuterocohnia_recurvipetala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Deuterocohnia_recurvipetala.JPG","page_title":"Deuterocohnia recurvipetala","context_page_description":"Deuterocohnia recurvipetala est une espèce de plantes de la famille des Bromeliaceae, endémique d'Argentine et décrite en 1991."},{"page_url":"https://cs.wikipedia.org/wiki/Huelva","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Panor%C3%A1mica_puerto_de_Huelva.JPG","page_title":"Huelva","context_page_description":"Huelva je město v jihozápadním cípu Španělska. Leží v západní Andalusii, 8 km od pobřeží Cádizského zálivu Atlantiku na soutoku řek Tinto a Odiel. Je centrem provincie Huelva, jedné z osmi provincií Andalusie. Huelva má přibližně 144 tisíc obyvatel.\\nMísto bylo osídleno již ve 3. tisíciletí př. n. l., později zde sídlili Féničané, Římané, Vizigóti a Arabové, na nichž město dobyl Alfons X. roku 1257. Z huelvského přístavu Palos de la Frontera vyplouval Kryštof Kolumbus na svou první výpravu do Indie."},{"page_url":"https://en.wikipedia.org/wiki/North_Carolina_A%26T_State_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/McNair_Hall_View_2012f.jpg","page_title":"North Carolina A&T State University","context_page_description":"North Carolina Agricultural and Technical State University is a public, historically black, research university in Greensboro, North Carolina. It is a constituent institution of the University of North Carolina System. Founded by the North Carolina General Assembly on March 9, 1891, as the Agricultural and Mechanical College for the Colored Race, it is the second college established under the provisions of the Morrill Act of 1890, and the first for people of color in the state of North Carolina. Initially, the college offered instruction in agriculture, English, horticulture, and mathematics. In 1967, the college was designated a Regional University by the North Carolina General Assembly and renamed North Carolina Agricultural and Technical State University.\\nWith an enrollment of over 12,556 students, North Carolina A&T is the largest historically black university in the U.S., a position it has held since 2014. According to U.S. News & World Report, the university is ranked sixth nationally among historically black colleges and universities and first among public HBCUs. The university is also well recognized for its degree program in engineering."},{"page_url":"https://ca.wikipedia.org/wiki/Concert_europeu","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Map_congress_of_vienna.jpg","page_title":"Concert europeu","context_page_description":"El Concert Europeu és un terme emprat en història per designar un tipus de relacions interestatals a Europa amb l'objectiu de mantenir un equilibri de poder i garantir la pau entre els Estats, particularment al segle xix posterior a les Guerres Napoleòniques, després del Congrés de Viena. Aquesta Restauració Europea o també anomenat Pentarquia pel nombre dels seus estats va ser protagonitzat per Metternich, raó per què s'anomena també Sistema Metternich. Al món de parla alemanya es parla de Vormärz. Va ser una època de política reaccionària i antiliberal. Les bases socials que recolzarien el projecte restauracionista serien fonamentalment l'aristocràcia, el clergat i determinats sectors de l'alta burgesia.\\nAllò que dóna caràcter de continuïtat al període és l'absència de normes escrites o institucions permanents, sinó que en temps de crisi es proclamava una conferència. Alguns dels llegats del període són el sorgiment del nacionalisme als estats petits que van sortir clarament perjudicats a favor de les grans potències."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B9%D0%B4%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%B2%D0%BE%D1%80%D0%BE%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/%D0%91%D0%B0%D0%B9%D0%B4%D0%B0%D1%80%D1%81%D0%BA%D0%B8%D0%B5_%D0%92%D0%BE%D1%80%D0%BE%D1%82%D0%B0.JPG","page_title":"Байдарские ворота","context_page_description":"Байда́рские воро́та — горный перевал через главную гряду Крымских гор, ведущий из Байдарской долины на Южный берег Крыма. Перевал Байдарские ворота или просто Байдарский перевал находится между горой Челеби на западе и Чху-Баир на востоке. Высота перевала — 503 м над уровнем моря."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B5%D0%BC%D0%B5%D1%80,_%D0%A4%D1%80%D0%B8%D1%86_(%D1%81%D0%BA%D1%83%D0%BB%D1%8C%D0%BF%D1%82%D0%BE%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Fotothek_df_ld_0003122_001_Denkm%C3%A4ler_-_Denkmale_-_Ehrenm%C3%A4ler_-_Ehrenmale_%5E_Mahnm.jpg","page_title":"Кремер, Фриц (скульптор)","context_page_description":"Фриц Кремер — немецкий скульптор, график и иллюстратор, вице-президент Академии искусств ГДР; антифашист, член движения Сопротивления в годы Второй мировой войны, член организации «Красная капелла»."},{"page_url":"https://id.wikipedia.org/wiki/Georgi_Dzhikiya","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/14_Georgi_Dzhikiya.jpg","page_title":"Georgi Dzhikiya","context_page_description":"Georgi Tamazovich Dzhikiya adalah pemain sepak bola asal Rusia. Pada saat ini ia bermain untuk tim FC Lokomotiv-2 Moscow.\\nIa memulai debut kariernya di Dvisi Kedua Rusia untuk tim FC Lokomotiv-2 Moscow pada tanggal 24 Mei 2011 dalam pertandingan melawan FC Volochanin-Ratmir Vyshny Volochyok."},{"page_url":"https://en.wikipedia.org/wiki/Planar_separator_theorem","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d9/Grid_separator.svg","page_title":"Planar separator theorem","context_page_description":"In graph theory, the planar separator theorem is a form of isoperimetric inequality for planar graphs, that states that any planar graph can be split into smaller pieces by removing a small number of vertices. Specifically, the removal of O(√n) vertices from an n-vertex graph can partition the graph into disjoint subgraphs each of which has at most 2n/3 vertices.\\nA weaker form of the separator theorem with O(√n log n) vertices in the separator instead of O(√n) was originally proven by Ungar, and the form with the tight asymptotic bound on the separator size was first proven by Lipton & Tarjan. Since their work, the separator theorem has been reproven in several different ways, the constant in the O(√n) term of the theorem has been improved, and it has been extended to certain classes of nonplanar graphs.\\nRepeated application of the separator theorem produces a separator hierarchy which may take the form of either a tree decomposition or a branch-decomposition of the graph."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BA%A1i_h%E1%BB%8Dc_Nagoya","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Nagoya_University_dk4591.jpg","page_title":"Đại học Nagoya","context_page_description":"Đại học Nagoya, hay còn được gọi là Meidai, là một Đại học Quốc gia Nhật Bản tọa lạc tại Chikusa-ku, Nagoya. Đây là trường đại học Hoàng gia cuối cùng ở Nhật Bản và nằm trong số Bảy trường đại học quốc gia Nhật Bản. Trường là tổ chức giáo dục đại học được xếp hạng cao thứ 3 tại Nhật Bản.\\nTính đến năm 2014, sáu người đoạt giải Nobel đã học tại Đại học Nagoya, đứng thứ ba tại Nhật Bản sau Đại học Kyoto và Đại học Tokyo.\\nTrường có nhiều cựu sinh viên thành công, Cựu chủ tịch tập đoàn ôtô Toyota Toyoda Shoichiro cũng đã học tại Đại học Quốc gia Nagoya."},{"page_url":"https://cy.wikipedia.org/wiki/Olivia_Newton-John","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Olivia_Newton_John_2012.jpg","page_title":"Olivia Newton-John","context_page_description":"Cantores bop, cyfansoddwraig ac yn actores Awstralaidd yw Olivia Newton-John, OBE, sydd a llinach Almaenig a Chymreig. Fe'i ganwyd yn Lloegr ond cafodd ei magu yn Awstralia. Mae wedi ennill Gwobr Grammy a Golden Globe. Ymgyrcha'n frwd ymwybyddiaeth cancr y fron a materion amgylcheddol. Mae hi hefyd wedi lawnsio nifer o gynhyrchion ar gyfer cwmni Koala Blue.\\nRoedd ei thad Bryn Newton-John yn academydd, yn swyddog cudd-wybodaeth yn Bletchley Park yn ystod yr Ail Ryfel Byd ac yn ddarlledwr ar deledu Awstralia. Cafodd ei eni yng Nghaerdydd."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%DA%98%DA%AF%D9%88%DA%98%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Grzegorzew%2C_ko%C5%9Bci%C3%B3%C5%82%2C_Andrzej_W%C3%B3jtowicz.jpg","page_title":"گژگوژو","context_page_description":"گژگوژو یک روستا در لهستان است که در گمینا گژگوژو واقع شده‌است.\\nگژگوژو ۱٬۶۵۰ نفر جمعیت دارد."},{"page_url":"https://ceb.wikipedia.org/wiki/Bordertown","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Bordertown_street.jpg","page_title":"Bordertown","context_page_description":"Lungsod ang Bordertown sa Ostralya. Nahimutang ni sa rehiyon sa Tatiara ug estado sa State of South Australia, sa habagatang bahin sa nasod, 800 km sa kasadpan sa Canberra ang ulohan sa nasod. 87 metros ibabaw sa dagat kahaboga ang nahimutangan sa Bordertown, ug adunay 2,583 ka molupyo.\\nAng yuta palibot sa Bordertown kay patag, ug nga tinakpan sa ubos sa kasadpan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 106 ka metro ug 1.9 km sa habagatan-sidlakan sa Bordertown. Kunhod pa sa 2 ka tawo kada kilometro kwadrado sa palibot sa Bordertown. Bordertown ang kinadak-ang lungsod sa maong dapit.\\nHapit nalukop sa kaumahan ang palibot sa Bordertown. Ang klima mediteranyo. Ang kasarangang giiniton 15 °C. Ang kinainitan nga bulan Enero, sa 26 °C, ug ang kinabugnawan Hunyo, sa 6 °C. Ang kasarangang pag-ulan 518 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 90 milimetro nga ulan, ug ang kinaugahan Disyembre, sa 9 milimetro."},{"page_url":"https://he.wikipedia.org/wiki/%D7%97%D7%9C%D7%95%D7%A7%D7%94_%D7%9E%D7%A0%D7%94%D7%9C%D7%99%D7%AA_%D7%A9%D7%9C_%D7%A9%D7%95%D7%95%D7%93%D7%99%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Essunga_Municipality_in_V%C3%A4stra_G%C3%B6taland_County.png","page_title":"חלוקה מנהלית של שוודיה","context_page_description":"ממלכת שוודיה, בדומה למדינות אחרות ביבשת אירופה, מחולקת לארבע יחידות שלטוניות: ארץ, חבל, מחוז ונפה. אך בעוד שלמחוזות ישנם מושלים נבחרים שממלאים תפקיד רשמי, כיום נהוג להתייחס לארצות ולחבלים בעיקר בענפי הספורט והתיירות, ולעיתים גם בנושאים הנוגעים להיסטוריה ולתרבות.\\nלעיתים ישנם הבדלים בלתי ניכרים לעין בחלוקה שבין החבל למחוז, לעיתים הם אף חופפים לגמרי, ולעיתים חבל חולש על מספר מחוזות, או מחוז כפוף למספר חבלים. זאת מאחר שהחלוקה ביניהם בוצעה במשך כ-1,000 שנים, ונבעה בין היתר מריבים פוליטיים בין שליטים שונים לאורך ההיסטוריה ולאו דווקא מחלוקה שבטית או תרבותית."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D8%A7%DA%A9%D9%86%D8%A7%D9%86%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Weihnachtsmarkt_Backnang_2010.jpg","page_title":"باکنانق","context_page_description":"باکنانق آلمانین بادن-وورتمبرق ایالتینده یئر آلان بیر شهردیر و ۲۷۱ متر دنیز سوییه‌سیندن اۇجالیقی وار. ۲۰۱۵-جی ایلين نۆفوس ساییمی اساسیندا ۳۵۶۶۱ نفر دیر. بۇ شهرین ۳۹٫۳۷ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://nl.wikipedia.org/wiki/Anniviers","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Karte_Gemeinde_Anniviers_2009.png","page_title":"Anniviers","context_page_description":"Anniviers is een gemeente en plaats in het Zwitserse kanton Wallis, en maakt deel uit van het district Sierre.\\nAnniviers telt 2.644 inwoners."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D9%88%D9%81%D9%84%D8%A7%D9%86%D8%AF%D8%8C_%D9%86%D8%A8%D8%B1%D8%A7%D8%B3%DA%A9%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Hoffland%2C_NE.jpg","page_title":"هوفلاند، نبراسکا","context_page_description":"هوفلاند آمریکانین نبراسکا ایالتینده یئرلشن بیر یاشاییش منطقه‌سی."},{"page_url":"https://ga.wikipedia.org/wiki/Folkestone_agus_Hythe_(Toghcheantar_na_R%C3%ADochta_Aontaithe)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9f/FolkestoneHythe2007Constituency.svg","page_title":"Folkestone agus Hythe (Toghcheantar na Ríochta Aontaithe)","context_page_description":"Is toghcheantar i dTeach Theachtaí na Ríochta Aontaithe é Folkestone agus Hythe. Cruthaíodh sa bhliain 1950 é. Is é Damian Collins an sealbhóir reatha den suíochán."},{"page_url":"https://en.wikipedia.org/wiki/Prunus_mume","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Pickledmai.jpg","page_title":"Prunus mume","context_page_description":"Prunus mume is an East Asian tree species classified in the Armeniaca section of the genus Prunus subgenus Prunus. Its common names include Chinese plum, Japanese plum, and Japanese apricot. The flower, long a beloved subject in the traditional painting and poetry of East Asia, is usually called plum blossom. This distinct tree species is related to both the plum and apricot trees. Although generally referred to as a plum in English, it is more closely related to the apricot.\\nIn Chinese, Japanese, Korean and Vietnamese cooking, the fruit of the tree is used in juices, as a flavouring for alcohol, as a pickle and in sauces. It is also used in traditional medicine.\\nThe tree's flowering in late winter and early spring is highly regarded as a seasonal symbol."},{"page_url":"https://en.wikipedia.org/wiki/Arizona_State_Fair","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Phoenix-Arizona_State_Fair_Gem_and_Mineral_Building-1918-5.JPG","page_title":"Arizona State Fair","context_page_description":"The Arizona State Fair is an annual state fair, held at Arizona State Fairgrounds.\\nIt was first held in 1884, but has had various interruptions due to cotton crop failure, the Great Depression era, World War I & World War II years & the COVID-19 pandemic. From 1946 to 2019 and resuming in 2021, the fair has been held annually. It was a territory fair before Arizona was a state.\\nThe Arizona Exposition and State Fair is a self-supporting state agency, and receives no money from the state's General Fund. The fairgrounds serve as a host facility for a number of different tradeshows, events, and entertainment. The fairgrounds is the location for the Maricopa County Fair, the Arizona National Livestock Show, the Maricopa Home and Garden Show, and more.\\nThe Fair typically has around 75 amusement rides, 110 food booths, and 300 commercial sales booths. The Arizona State Fair is one of the top 5 state fairs by yearly attendance in the country, drawing over a million visitors annually."},{"page_url":"https://da.wikipedia.org/wiki/Fjern%C3%B8sten","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Far_east1.png","page_title":"Fjernøsten","context_page_description":"Fjernøsten er en sammenfattende benævnelse af landene længst mod øst, det vil sige Østasien, Kina, Japan, det østlige Rusland, Koreahalvøen og flere. Betegnelsen er skabt ud fra et historisk europæisk perspektiv, og benyttes fortsat i enkelte sammenhænge, men i internationalt samarbejde benyttes begrebet Østasien."},{"page_url":"https://ceb.wikipedia.org/wiki/Abades_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1d/Aytoabades.jpg","page_title":"Abades (munisipyo)","context_page_description":"Munisipyo ang Abades sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Segovia ug rehiyon sa Castilla y León, sa sentro nga bahin sa nasod, 70 km sa amihanan-kasadpan sa Madrid ang ulohan sa nasod. Adunay 882 ka molupyo. Naglangkob kin og 31 ka kilometro kwadrado.\\nAng yuta sa Abades kay patag.\\nAng klima kasarangan. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Disyembre, sa 2 °C. Ang kasarangang pag-ulan 767 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 104 milimetro nga ulan, ug ang kinaugahan Agosto, sa 8 milimetro."},{"page_url":"https://sh.wikipedia.org/wiki/Javni_gradski_promet_u_Zagrebu","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Tip_2100.jpg","page_title":"Javni gradski promet u Zagrebu","context_page_description":"Javni gradski promet u Zagrebu čini mreža tramvajskih i autobusnih linija, prigradski vlakovi te taksi vozila. Glavninu javnog gradskog prometa u Zagrebu obavlja Zagrebački električni tramvaj, koje je operator tramvajskog i autobusnog prometa, a brine se i o uspinjači i žičari, koja je trenutno izvan funkcije. ZET je podružnica gradskog trgovačkog društva Zagrebački holding d.o.o."},{"page_url":"https://en.wikipedia.org/wiki/Cladius_Detlev_Fritzsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Claus_Detlev_Fritzsch_%28Christian_Albrecht_Jensen%29.jpg","page_title":"Cladius Detlev Fritzsch","context_page_description":"Cladius Detlev Fritzsch, normally referred to as C. D. Fritzsch, was a Danish flower painter."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D8%A8%D8%A7%D9%83_%D8%A7%D9%84%D8%AA%D8%B0%D8%A7%D9%83%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Ticket_%28unseparated%29_Kurkino-Berchtesgaden.JPG","page_title":"شباك التذاكر","context_page_description":"شباك التذاكر أو البوكس أوفيس هو المكان الذي تُباع فيه التذاكر للعوام من أجل حضور فعالية ما، حيث يمكن لرواد هذه الفعاليات شراء التذاكر من طاولة بيع أو عبر كوة في جدار أو نافذة أو كشك صغير. ودرج استخدام هذا المصطلح، لا سيما ضمن سياق قطاع الأفلام، مرادفًا يدل على حجم مبيعات مشروع أو منتج معين، مثل الفيلم السينمائي أو العرض المسرحي.\\nويمكن قياس حجم تجارة البوكس أوفيس بالاستناد إلى عدد التذاكر المباعة أو المبلغ المالي المجني من مبيعات التذاكر. ولتخطيط هذه الأرباح وتحليلها أهمية كبيرة بالنسبة للقطاعات الإبداعية، وكثيرًا ما يشكل محطًا لاهتمام المعجبين، وهذا أمر بارز في صناعة الأفلام الهوليوودية."},{"page_url":"https://fr.wikipedia.org/wiki/Place_du_Molard","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Place_du_Molard_%28Geneva%29-Fontaine_et_WC.jpg","page_title":"Place du Molard","context_page_description":"La place du Molard est une place de la ville de Genève en Suisse. C’était historiquement le principal port et le centre économique au XVIᵉ siècle.\\nLa fontaine du Molard est depuis 1921 un bien culturel d'importance régionale. La Tour du Molard avec le bâtiment des Halles sont depuis 2005 des biens culturels d'importance régionale."},{"page_url":"https://pl.wikipedia.org/wiki/(2112)_Ulyanov","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/2112Ulyanov_%28Lightcurve_Inversion%29.png","page_title":"(2112) Ulyanov","context_page_description":"(2112) Ulyanov – planetoida z pasa głównego asteroid okrążająca Słońce w ciągu 3 lat i 141 dni w średniej odległości 2,25 j.a. Została odkryta 13 lipca 1972 roku Krymskim Obserwatorium Astrofizycznym w Naucznym na Krymie przez Tamarę Smirnową. Nazwa planetoidy pochodzi od Aleksandra Uljanowa, starszego brata Włodzimierza Lenina. Przed nadaniem nazwy planetoida nosiła oznaczenie tymczasowe (2112) 1972 NP."},{"page_url":"https://fr.wikipedia.org/wiki/Stade_de_la_Vall%C3%A9e_du_Cher","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Stade_de_la_vall%C3%A9e_du_Cher.jpg","page_title":"Stade de la Vallée du Cher","context_page_description":"Le stade de la Vallée du Cher est le stade principal de la ville de Tours dans le département d'Indre-et-Loire. Avec une capacité de 10 128 places, ce stade est l'enceinte utilisée par le Tours Football Club depuis 1978."},{"page_url":"https://de.wikipedia.org/wiki/St._Lutwinus_(Mettlach)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Mettlach_Kirche_Lutwinusmosaik_Klosterbau.jpg","page_title":"St. Lutwinus (Mettlach)","context_page_description":"Die Kirche St. Lutwinus ist eine römisch-katholische Pfarr- und Wallfahrtskirche in Mettlach, Landkreis Merzig-Wadern, Saarland. Die Kirche trägt das Patrozinium des heiligen Liutwin und ist seine Grabkirche. Der neoromanische Sakralbau ist in der Denkmalliste des Saarlandes als Einzeldenkmal aufgeführt. Das Gotteshaus ist Ziel der Lutwinuswallfahrt, die über Jahrhunderte stattfand und seit Anfang der 2000er Jahre wieder neu belebt wurde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86_%D0%9A%D0%BE%D0%B2%D0%BD%D0%B5%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/uk/3/30/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86_%D0%9A%D0%BE%D0%B2%D0%BD%D0%B5%D1%80%D0%B0_1906.png","page_title":"Палац Ковнера","context_page_description":"Палац Ковнера — палац кінця XIX століття в Мукачеві, збудований угорським бароном єврейського походження Адольфом Ковнером. У різні роки тут містився жупанат, угорська контррозвідка, в'язниця для політичних в'язнів."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A4%D7%90%D7%A8%D7%A7_%D7%94%D7%97%D7%95%D7%A4%D7%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Freedom_Park-333.jpg","page_title":"פארק החופש","context_page_description":"פארק החופש הוא מתחם לאומי הכולל אנדרטאות זיכרון, מוזיאון וגן ציבורי בפרטוריה, אחת משלוש ערי הבירה של דרום אפריקה. פארק החופש מנציח את \\"אלו שהקריבו את חייהם כדי לזכות בחופש\\" בדרום אפריקה, את גיבוריה הלאומיים של האומה, ואת הנופלים במלחמותיה לרבות אלו אשר מצאו את מותם במלחמת הזולו והקוסה, מלחמת הבורים הראשונה והשנייה, מלחמת העולם הראשונה והשנייה ואף מלחמות הגבול והמאבק באפרטהייד. כל זאת, תוך תשומת לב ל\\"סיפורה המורכב של דרום אפריקה\\". בנוסף, פארק החופש שם עבורו למטרה לעסוק בתחומי חינוך, לשאוף להוות \\"סמל לאומי ובינלאומי מוביל של אנושיות וחופש\\" וכן להוות כר פורה להרהור ביקורתי בעברה של דרום אפריקה."},{"page_url":"https://vi.wikipedia.org/wiki/Circus_pygargus","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Sylwetka_blotniak_lakowy.jpg","page_title":"Circus pygargus","context_page_description":"Circus pygargus là một loài chim trong họ Accipitridae.\\nLoài này vẫn có thể được tìm thấy trên hầu hết các vùng Tây Cổ Bắc giới. Ở hầu hết các nước châu Âu có ít nhất một quần thể nhỏ, ngoại trừ ở Na Uy nơi chúng không có mặt. Phạm vi sinh sản kéo dài đến tận phía đông đến tận Ural, trong khi số lượng đông nhất là ở Bồ Đào Nha. Sinh sản cũng diễn ra ở miền bắc châu Phi, chủ yếu ở Morocco. Ở Anh, loài này chỉ giới hạn ở miền nam nước Anh. Ở Ireland, loài này hiếm khi được nhìn thấy, và chủ yếu ở miền Nam, mặc dù có một số hồ sơ sinh sản, gần đây nhất là từ năm 1971. Mặc dù có sự phân bố rộng, loài chim này không phổ biến ở nhiều khu vực và chỉ có quần thể mạnh ở Pháp, Tây Ban Nha, Nga, Belarus và Ba Lan, nơi có thể tìm thấy phần lớn quần thể chim ở châu Âu. Các địa điểm sinh sản thường xuyên thay đổi, với một số tổ lẻ ​​tẻ xuất hiện bên ngoài các khu vực sinh sản đã được biết, tuy nhiên các dấu hiệu rõ ràng về phạm vi giảm là rõ ràng và có liên quan đến sự suy giảm dân số.\\nChế độ ăn chủ yếu bao gồm các loài gặm nhấm nhỏ, chim nhỏ, trứng chim, bò sát và côn trùng lớn."},{"page_url":"https://es.wikipedia.org/wiki/Aspillera","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Schie%C3%9Fscharte.jpg","page_title":"Aspillera","context_page_description":"Una aspillera, palabra proveniente del Latín sagitta, ​ es una abertura vertical, estrecha y profunda, practicada en algunos muros o murallas defensivas, así como en las torres de los castillos o incluso en algunas almenas, para permitir disparar flechas con arcos o bien con ballestas.​\\nuna cruz."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Berlin-Tiergarten","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Bison_-Rudolf_Siemering_%281835-1905%29_-_1902_-_IMG_8393.JPG","page_title":"Liste der Kulturdenkmale in Berlin-Tiergarten","context_page_description":"In der Liste der Kulturdenkmale von Tiergarten sind die Kulturdenkmale des Berliner Ortsteils Tiergarten im Bezirk Mitte aufgeführt."},{"page_url":"https://de.wikipedia.org/wiki/MALDI-TOF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/TOF_mass_spectrometer_June2007.JPG","page_title":"MALDI-TOF","context_page_description":"MALDI-TOF ist eine Methode der Massenanalyse von chemischen Verbindungen. Das Verfahren kombiniert die Matrix–Assistierte Laser–Desorption–Ionisierung mit der Flugzeitanalyse freigesetzter Ionen zur Massenspektrometrie."},{"page_url":"https://it.wikipedia.org/wiki/Simplified_Aid_for_EVA_Rescue","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/STS-131_EVA3_Rick_Mastracchio_2.jpg","page_title":"Simplified Aid for EVA Rescue","context_page_description":"Il Simplified Aid For EVA Rescue è un piccolo jet pack autosufficiente da portare sulla schiena che viene indossato dagli astronauti durante le attività extraveicolari. Il SAFER è, di fatto, una versione semplificata della Manned Maneuvering Unit, usata per tre missioni dello Space Shuttle Challenger nel 1984, ma, al contrario di questa, viene utilizzato solamente in caso di emergenza.\\nIl SAFER è stato indossato durante attività esterne sia alla Stazione Spaziale Internazionale che allo Space Shuttle e, qualora l'astronauta perdesse il contatto fisico con il velivolo, esso gli permetterebbe di raggiungerlo nuovamente in una condizione di volo libero. Al 2020, però, una tale evenienza non si è ancora verificata e il SAFER è stato azionato solo in occasioni di test."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%83%D5%B8%D5%BA%D5%A1%D5%B6%D5%AB_%D5%B8%D6%82%D5%B2%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Roosevelt_Island_Tramway_tower.jpg","page_title":"Ճոպանի ուղի","context_page_description":"Ճոպանի ուղի, ճոպանուղի, տրանսպորտի ձև մարդկանց և իրեր տեղափոխելու համար, որտեղ վագոնների, խցիկների և նստարանների տեղափոխումն իրականացվում է ձգվող պարանի միջոցով, որոնք ամրակների վրա ձգված են այնպես, որ խցիկները, վագոնիկները գետնի հետ չեն շփվում։\\nՆեղ իմաստով «ճոպանուղի», հասկանում են որպես երթուղիներ, սակայն ոչ քաղաքային՝ ձգված օդում, իսկ լայն իմաստով ճոպանուղի ասելով հասկանում են բոլոր տրանսպորտային միջոցները, որոնք կապված են պարանի քաշող ուժի հետ։ Վերջինս կարող է նաև լինել միջքաղաքային, ինչպես նաև ոչ փողոցային տես՝, այնպես էլ փողոցային ։ Հիմնականում սրանք նեղ իմաստով վերաբերվում են ճանապարհներին, ինչպես նայև ստորգետնյա տրանսպորտին։\\nՈւղևորների տեղափոխությունը ճոպանուղով կարող է հասնել մեկ ժամում մինչև 2000 ուղևոր, իսկ բեռների ծանրությունը մեկ ժամում 10000 տոննա։"},{"page_url":"https://en.wikipedia.org/wiki/List_of_the_oldest_buildings_in_Maryland","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Meredith_House%2C_Cambridge%2C_Maryland_-_Stierch.jpg","page_title":"List of the oldest buildings in Maryland","context_page_description":"Some dates are approximate and based upon dendrochronology, architectural studies, and historical records. Sites on the list are generally from the First Period of American architecture or earlier.\\nTo be listed here a site must:\\ndate from prior to 1776; or\\nbe the oldest building in a county, large city, or oldest of its type."},{"page_url":"https://en.wikipedia.org/wiki/Iain_Macleod","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Iain_Macleod_and_Julius_Nyerere%2C_1961.png","page_title":"Iain Macleod","context_page_description":"Iain Norman Macleod was a British Conservative Party politician and government minister.\\nA playboy and professional bridge player in his twenties, after war service Macleod worked for the Conservative Research Department before entering Parliament in 1950. He was an outstanding orator and debater, and was soon appointed Minister of Health, later serving as Minister of Labour. He served an important term as Secretary of State for the Colonies under Harold Macmillan in the early 1960s, overseeing the independence of many African countries from British rule but earning the enmity of Conservative right-wingers, and the soubriquet that he was \\"too clever by half\\".\\nMacleod was unhappy with the \\"emergence\\" of Sir Alec Douglas-Home as party leader and Prime Minister in succession to Macmillan in 1963. He refused to serve in Home's government, and whilst serving as editor of The Spectator, alleged that the succession had been stitched up by Macmillan and a \\"magic circle\\" of Old Etonians.\\nMacleod did not contest the first ever Conservative Party leadership election in 1965, but endorsed the eventual winner Edward Heath."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%89%99%E5%88%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/TePe_Interdental_Brushes_original.jpg","page_title":"牙刷","context_page_description":"牙刷是用于刷牙的一种刷子。它的结构，是将嵌满一束束高密度刷毛的刷头安装在握把上，促进清洁口腔中难以触及的区域。一般刷牙时都会在牙刷上加上牙膏以提高刷牙的功效。市面上的牙刷有各式各样的尺寸、形式、和刷毛材质可供选择。大部分的牙医师都推荐软刷毛的牙刷，因为过硬的刷毛可能会破坏牙釉质并且刺激牙龈。电动牙刷可减少用户刷牙时手部的反复运动，最新型的牙刷是超声波牙刷，但目前没有可靠证据证明电动牙刷的清洁效果优于传统牙刷。"},{"page_url":"https://de.wikipedia.org/wiki/Andreas_von_Barby","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/StatiusVonD%C3%BCrenInStAnnen04.JPG","page_title":"Andreas von Barby","context_page_description":"Andreas von Barby war ein dänischer Politiker und Bischof von Lübeck."},{"page_url":"https://en.wikipedia.org/wiki/Acoustic_guitar","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Acoustic_Guitar_Anatomy.jpg","page_title":"Acoustic guitar","context_page_description":"An acoustic guitar is a musical instrument in the guitar family. Its strings vibrate a sound board on a resonant body to project a sound wave through the air. The original, general term for this stringed instrument is guitar, and the retronym 'acoustic guitar' distinguishes it from an electric guitar, which relies on electronic amplification. Typically, a guitar's body is a sound box, of which the top side serves as a sound board that enhances the vibration sounds of the strings. In standard tuning the guitar's six strings are tuned E₂ A₂ D₃ G₃ B₃ E₄.\\nGuitar strings may be plucked individually with a pick or fingertip, or strummed to play chords. Plucking a string causes it to vibrate at a fundamental pitch determined by the string's length, mass, and tension. The string causes the soundboard and the air enclosed by the sound box to vibrate. As these have their own resonances, they amplify some overtones more strongly than others, affecting the timbre of the resulting sound."},{"page_url":"https://pl.wikipedia.org/wiki/Kirchberg_ob_der_Donau","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/AUT_Kirchberg_ob_der_Donau_COA.jpg","page_title":"Kirchberg ob der Donau","context_page_description":"Kirchberg ob der Donau – gmina w Austrii, w kraju związkowym Górna Austria, w powiecie Rohrbach. Liczy 1046 mieszkańców."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A7%E9%98%AA%E7%AC%AC%E4%BA%8C%E9%81%8B%E8%BC%B8%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Tokaido_Shinkansen_Osaka_fast_%26_second_transport_office_%28plate%29.jpg","page_title":"大阪第二運輸所","context_page_description":"大阪第二運輸所は、大阪市東淀川区にある東海旅客鉄道関西支社の運転士・車掌が所属する乗務員区所である。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%A6%D5%B8%D5%B2_%D5%A1%D5%AC%D5%AB%D6%84%D5%AB_%D5%AC%D5%A1%D5%B4%D5%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%D5%8E%D5%A1%D5%A6%D5%B8%D5%B2_%D5%A1%D5%AC%D5%AB%D6%84%D5%AB_%D5%AC%D5%A1%D5%B4%D5%BA%D5%AB_%D5%BD%D5%AD%D5%A5%D5%B4%D5%A1%D5%B6.png","page_title":"Վազող ալիքի լամպ","context_page_description":"Վազող ալիքի լամպ, վազող ալիքով լամպ, էլեկտրավակուումային սարք, որում գերբարձր հաճախականության էլեկտրամագնիսական ալիքը, տարածվելով էլեկտրոնների հոսքի ուղղությամբ և փոխազդելով նրա հետ, ուժեղանում է։\\nՎազող ալիքի լամպի հիմնական Վազող ալիքի լամպի սխեման մասերն են․ էլեկտրոնային թնդանոթը"},{"page_url":"https://uz.wikipedia.org/wiki/Les_Ch%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Map_commune_FR_insee_code_69055.png","page_title":"Les Chères","context_page_description":"Les Chères Fransiyaning Rhône-Alpes mintaqasida joylashgan kommunadir. Rhône departamenti Lyon tumani tarkibiga kiradi."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%8B%A5%E5%BC%80%E6%B0%91%E6%97%8F%E5%86%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Arakan_State_Army_Flag.png","page_title":"若开民族军","context_page_description":"若開民族軍是緬甸克倫邦的一支若開人地方武裝部隊，由若開民族代表大會領導。 該組織除了孟加拉國邊防部隊外還襲擊緬甸與孟加拉國邊界的緬甸軍事哨所。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%94%9F%E7%89%A9%E5%90%88%E6%88%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Nucleotides_syn1.svg","page_title":"生物合成","context_page_description":"生物合成是簡單的物質在生物體內經過酶催化後轉變為更複雜的物質的多步驟的過程。在生物合成過程中，簡單的化合物通過化學反應，轉換成其他化合物，或聚合形成大分子。這個過程通常在代謝途徑中完成。生物合成有時候在單個細胞的細胞器內進行，而一些需要多種酶催化的合成會在多個細胞的細胞器中進行。生物合成的例子包括脂膜和核苷酸的合成。\\n生物合成的必要元素包括：先導化合物、化學能和包括輔酶在內的催化酶。通過上述元素可以合成生物大分子的基本元素。 一些重要的生物大分子包括由胺基酸通過肽鍵連接而成的蛋白質和由核苷酸通過磷酸二酯鍵連接而成的DNA分子。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B8%8A%E6%B5%B7%E5%B8%82%E4%BC%98%E7%A7%80%E5%8E%86%E5%8F%B2%E5%BB%BA%E7%AD%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Butterfield_%26_Swire.jpg","page_title":"上海市优秀历史建筑","context_page_description":"上海市優秀歷史建築是指上海市建成三十年以上，並有下列情形之一的建築：\\n建築樣式、施工工藝和工程技術具有建築藝術特色和科學研究價值；\\n反映上海地域建築歷史文化特點；\\n著名建築師的代表作品；\\n在中國產業發展史上具有代表性的作坊、商鋪、廠房和倉庫；\\n其他具有歷史文化意義的優秀歷史建築。\\n優秀歷史建築的初步名單，由上海市規劃管理部門和上海市房屋土地管理部門研究提出，並徵求上海市文物管理部門、建築所有人和所在區人民政府的意見，經專家委員會評審後報上海市人民政府批准確定。在上海市人民政府批准確定前，應當將優秀歷史建築的初步名單公示，徵求社會意見。經批准確定的優秀歷史建築，由上海市人民政府公布，並由市房屋土地管理部門設立標誌。\\n上海是中國首個將近現代建築單獨作為保護類別的城市。目前上海市人民政府已公布了五批優秀歷史建築共1058處，覆蓋全市17個區。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BF%D0%BE%D0%B5%D0%B2%D0%B0%D1%8F_%D0%BA%D0%B8%D1%81%D0%BB%D0%BE%D1%82%D0%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/Lipoic-acid-3D-vdW.png","page_title":"Липоевая кислота","context_page_description":"Липоевая кислота — сероорганическое соединение, один из энантиомеров которого является важным коферментом для многих ферментативных комплексов.\\nМолекула является карбоновой кислотой с присоединенным циклическим дисульфидом. Биологическое значение имеет только R—энантиомер. Липоат необходим для кислородной жизни и является распространенной пищевой добавкой.\\nЛипоат играет роль кофермента в кислородном метаболизме, особенно в пируватдегидрогеназном комплексе.\\nВ 1948 году Ирвин Гансалес назвал липоат фактором окисления пирувата.\\nБиодоступность липоевой кислоты при пероральном применении составляет около 30 %.\\nПрименяется в медицине как витаминоподобное вещество — тиоктовая кислота."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Landshut-Nikola","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Schwimmschulstr._1_Landshut-2.jpg","page_title":"Liste der Baudenkmäler in Landshut-Nikola","context_page_description":"In der Liste der Baudenkmäler in Landshut–Nikola sind die Baudenkmäler im Landshuter Stadtbezirk 01 Nikola aufgelistet.\\nDiese Liste ist eine Teilliste der Liste der Baudenkmäler in Landshut. Grundlage der Liste ist die Bayerische Denkmalliste, die auf Basis des bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt und aktualisiert wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://de.wikipedia.org/wiki/Liste_Schwarzer_Madonnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Loretto_Gnadenkapelle.JPG","page_title":"Liste Schwarzer Madonnen","context_page_description":"Im Folgenden findet sich eine nicht vollständige Auflistung von Vorkommen und Verehrungsstätten Schwarzer Madonnen."},{"page_url":"https://ast.wikipedia.org/wiki/Fernando_Lamas","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f1/Fernando_Lamas_circa_mid_1960s.JPG","page_title":"Fernando Lamas","context_page_description":"Fernando Álvaro Lamas foi un actor y direutor arxentín que desenvolvió la so carrera n'Estaos Xuníos. Padre del actor arxentín-estauxunidense Lorenzo Lamas."},{"page_url":"https://sv.wikipedia.org/wiki/Mammillaria_grahamii","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Mammilaria_grahamii.jpg","page_title":"Mammillaria grahamii","context_page_description":"Mammillaria grahamii är en kaktusväxtart som beskrevs av Georg George Engelmann. Mammillaria grahamii ingår i släktet Mammillaria och familjen kaktusväxter."},{"page_url":"https://ceb.wikipedia.org/wiki/Gerum_socken","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Gerum_kyrka_Gotland.jpg","page_title":"Gerum socken","context_page_description":"Baranggay ang Gerum socken sa Sweden. Nahimutang ni sa munisipyo sa Gotland ug lalawigan sa Gotlands län, sa habagatang bahin sa nasod, 230 km sa habagatan sa Estokolmo ang ulohan sa nasod.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -6 °C."},{"page_url":"https://it.wikipedia.org/wiki/Cloruro_di_zinco","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/ZnCl2_fluorescein.png","page_title":"Cloruro di zinco","context_page_description":"Il cloruro di zinco è il composto inorganico di formula ZnCl₂. Il composto anidro è un solido biancastro, traslucido, igroscopico e deliquescente; va tenuto al riparo dall'umidità. Può cristallizzare in quattro forme cristalline, bianche o incolori, tutte molto solubili in acqua. ZnCl₂ forma anche varie forme idrate. Il cloruro di zinco è uno dei più importanti composti commerciali dello zinco: tra le sue numerose applicazioni è impiegato nella lavorazione dei tessuti, come flussante per saldature, e per sintesi chimiche."},{"page_url":"https://fr.wikipedia.org/wiki/Kaliningrad","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Kaliningrad.jpg","page_title":"Kaliningrad","context_page_description":"Kaliningrad, anciennement Königsberg en Prusse-Orientale, est une ville de Russie située dans une exclave territoriale, l'oblast de Kaliningrad, totalement isolée du reste du territoire russe, entre la Pologne et la Lituanie. Sa population s'élève à 475 100 habitants en 2018.\\nEn 2018, la ville a accueilli quatre matchs de la Coupe du monde de football."},{"page_url":"https://de.wikipedia.org/wiki/Rudbeckien","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Rudbeckia_triloba_-_001x.jpg","page_title":"Rudbeckien","context_page_description":"Die Rudbeckien sind eine Pflanzengattung in der Familie der Korbblütler. Die 20 bis 23 Arten sind in Nordamerika verbreitet. Es gibt einige Sorten, die als Zierpflanzen in Parks und Gärten verwendet werden."},{"page_url":"https://es.wikipedia.org/wiki/Universidad_de_Zaragoza","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Edificio_Ada_Byron_Zaragoza_4.jpg","page_title":"Universidad de Zaragoza","context_page_description":"La Universidad de Zaragoza es un centro de educación superior público repartido geográficamente entre los campus de Zaragoza, Huesca, Jaca, Teruel y La Almunia de Doña Godina, todos ellos en la comunidad autónoma de Aragón.\\nFundada en 1542, reúne en 2014 a más de 30 000 estudiantes y 3000 miembros docentes​ entre sus 22 centros y 74 titulaciones y estudios propios. Su actual rector es José Antonio Mayoral Murillo.​"},{"page_url":"https://cy.wikipedia.org/wiki/Llydanbig_tywyll","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Corydon_sumatranus_-_Khao_Yai.jpg","page_title":"Llydanbig tywyll","context_page_description":"Aderyn a rhywogaeth o adar yw Llydanbig tywyll a adnabyddir hefyd gyda'i enw gwyddonol Corydon sumatranus; yr enw Saesneg arno yw Dusky broadbill. Mae'n perthyn i deulu'r Llydanbigau sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn C. sumatranus, sef enw'r rhywogaeth."},{"page_url":"https://ca.wikipedia.org/wiki/Travnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Travnik_Municipality_Location.png","page_title":"Travnik","context_page_description":"Travnik és una ciutat i municipalitat del centre de Bòsnia a Bòsnia i Hercegovina, a la vall del Lašva, 90 km a l'oest de Sarajevo, entre les muntanyes de Vlašić al nord i de Vilenica al sud. La ciutat és la capital del canto de Bòsnia Central, i amb la comarca forma una municipalitat. La ciutat té uns 27.000 habitants i la municipalitat uns 70.000. Fou capital de Bòsnia sota els otomans de 1699 a 1850."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D1%82%D0%BC%D0%B0%D1%80%D1%88%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Wietmarschen%2C_Stiftskirche_1.jpg","page_title":"Витмаршен","context_page_description":"Витмаршен — коммуна в Германии, в земле Нижняя Саксония.\\nВходит в состав района Графство Бентхайм. Население составляет 11 474 человека. Занимает площадь 119,84 км². Официальный код — 03 4 56 025.\\nКоммуна подразделяется на 6 сельских округов.\\nВо время второй мировой войны здесь находился трудовой лагерь для военнопленных."},{"page_url":"https://de.wikipedia.org/wiki/Reh","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Circaea_lutetiana02.jpg","page_title":"Reh","context_page_description":"Das Reh, zur Unterscheidung vom Sibirischen Reh auch Europäisches Reh genannt, ist die in Europa häufigste und kleinste Art der Hirsche. Als Trughirsch ist es näher mit Ren, Elch und dem amerikanischen Weißwedelhirsch verwandt als mit dem in Mitteleuropa ebenfalls heimischen Rothirsch.\\nDas Reh besiedelte ursprünglich Waldrandzonen und -lichtungen. Es hat sich aber erfolgreich eine Reihe sehr unterschiedlicher Habitate erschlossen und kommt mittlerweile auch in offener, fast deckungsloser Agrarsteppe vor. Aufgeschreckte Rehe suchen gewöhnlich mit wenigen, schnellen Sprüngen Schutz in Dickichten, es wird deswegen und aufgrund einiger morphologischer Merkmale dem sogenannten „Schlüpfertypus“ zugerechnet. Rehe sind Wiederkäuer und werden als Selektierer bezeichnet, da sie bevorzugt eiweißreiches Futter äsen. Während des Sommerhalbjahrs lebt das Reh überwiegend einzeln oder in kleinen Gruppen, bestehend aus einer Ricke und ihren Kitzen, im Winter bilden sich Sprünge, die meist mehr als drei oder vier Tiere umfassen. Rehe, die in der offenen Agrarlandschaft leben, bilden Sprünge von mehr als zwanzig Individuen."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Truppenteile_der_Pioniertruppe_des_Heeres_der_Bundeswehr","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/PzPiKp_100..png","page_title":"Liste der Truppenteile der Pioniertruppe des Heeres der Bundeswehr","context_page_description":"Die Liste der Truppenteile der Pioniertruppe des Heeres der Bundeswehr enthält nahezu alle aufgelösten, aktiven und nicht aktiven Verbände und Großverbände der Pioniertruppe der Bundeswehr sowie eine kurze Übersicht über ihren Aufstellungszeitpunkt, Stationierungsorte, Unterstellung und über ihre Auflösung oder Umbenennung.\\nAusdrücklich ausgenommen sind Pioniere und vergleichbare Kräfte der Luftwaffe und der Marine."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_del_Tempio","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/TempleChurch-Exterior.jpg","page_title":"Chiesa del Tempio","context_page_description":"La chiesa del Tempio è una chiesa medievale di Londra. Si trova all'interno dell'area chiamata Temple, ubicata tra Fleet Street e il Tamigi, nella City. Vicine alla chiesa sorgono la Inner Temple e la Middle Temple, antiche e prestigiose scuole universitarie di formazione professionale per avvocati e magistrati."},{"page_url":"https://pt.wikipedia.org/wiki/Chord_Overstreet","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Chord_Overstreet.jpg","page_title":"Chord Overstreet","context_page_description":"Chord Overstreet é um cantor, compositor e ator norte-americano, mais conhecido por seu papel como Sam Evans na série de televisão Glee e como \\"Nick\\" no filme de televisão \\"4th man out'"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%96%E3%83%A9%E3%82%A4%E3%82%A2%E3%83%B3%E3%83%BB%E3%83%8F%E3%83%BC%E3%82%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/BryanHerta_2001.jpg","page_title":"ブライアン・ハータ","context_page_description":"ブライアン・ジョン・ハータ は、アメリカ合衆国のレーシングドライバー。ミシガン州ウォーレン出身。自身のチーム、ブライアン・ハータ・オートスポーツを率いてインディ・ライツに参戦している。"},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_Castellan","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Ch%C3%A2teau_de_Castellan.jpg","page_title":"Château de Castellan","context_page_description":"Le château de Castellan est un château de Saint-Martin-sur-Oust, dans le Morbihan."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B8%D0%BD%D1%8F%D0%BA_(%D0%B3%D0%BE%D1%80%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/%D0%93%D0%BE%D1%80%D0%B0_%D0%A1%D0%B8%D0%BD%D1%8F%D0%BA.jpg","page_title":"Синяк (гора)","context_page_description":"Синяк — высокая, с отвесными склонами гора в Горганах. Высота — 1665 м. Расположена в пределах Карпатского национального природного парка, в Надворнянском районе Ивано-Франковской области, неподалеку от сел Поляница и Татаров. Массив горы простирается с юго-востока на северо-запад, где завершается второй вершиной, по названию Малый Горган. До высоты примерно 1300 м гора Синяк покрыта лесом. Выше начинаются альпийские луга, а еще через 100 м — сплошные каменистые россыпи.\\nГора Синяк является популярным пунктом для пешеходных маршрутов в выходной день. С вершины Синяка видны соседние хребты: Довбушанка и Яворник. Отсюда же открывается великолепная панорама на горнолыжный курорт Буковель, а также вид на самый высокий хребет Украинских Карпат — Черногора, с вершинами Говерлы и Петрос."},{"page_url":"https://ast.wikipedia.org/wiki/Casas_de_Juan_N%C3%BA%C3%B1ez","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Casas_de_Juan_Nu%C3%B1ez%2C_Plaza_de_Castilla_la_Mancha%2C_Iglesia_y_Ayuntamiento.jpg","page_title":"Casas de Juan Núñez","context_page_description":"Casas de Juan Núñez ye un conceyu español asitiáu al sureste de la península ibérica, na provincia d'Albacete, dientro de la comunidá autónoma de Castiella-La Mancha. Cuntaba con una población de 1.291 habitantes a 1 de xineru de 2017, según datos del INE. Ta asitiáu a 27 km de la capital provincial, a un altor mediu de 705 msnm. La estensión del términu municipal ye de 88.98 km²."},{"page_url":"https://en.wikipedia.org/wiki/Austria_at_the_2014_Winter_Olympics","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Austria_Short_Track_Speed_Skating_Team_Winter_Olympics_2014_Heinz_Fischer.jpg","page_title":"Austria at the 2014 Winter Olympics","context_page_description":"Austria competed at the 2014 Winter Olympics in Sochi, Russia, from 7 to 23 February 2014. The team was composed of 132 athletes in 14 sports, consisting of 90 men and 42 women. The 132 athletes is 27 more than the country's previous largest Winter Olympics team.\\nOriginally Benjamin Raich was scheduled to carry the flag at the opening ceremony, however he withdrew after he decided to skip the combined competition, thus delaying his arrival in Sochi. Nordic combined athlete Mario Stecher was named his replacement.\\nThe Austrian Olympic Committee received a Russian letter containing a kidnap threat against Alpine skier Bernadette Schild and skeleton pilot Janine Flock during the Sochi Games.\\nOn 23 February, skier Johannes Dürr was suspended from the Winter Olympics after testing positive for EPO."},{"page_url":"https://es.wikipedia.org/wiki/Canal_de_la_Mancha","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/English_Channel_Satellite.jpg","page_title":"Canal de la Mancha","context_page_description":"El canal de la Mancha es el brazo de mar del océano Atlántico que lo comunica con el mar del Norte, al oeste de Europa, y separa el noroeste de Francia de la isla de Gran Bretaña.\\nEl canal tiene una longitud de 560 km aproximadamente y su anchura varía entre 240 km y 33,3 km.​ Es el más pequeño de los mares superficiales de la plataforma continental de Europa y ocupa una superficie de 75 000 km aproximadamente².​\\nEn el estrecho, cerca de las costas francesas, existen unas islas llamadas Islas del Canal, pertenecientes a la Corona Británica. La isla de Ouessant marca el extremo occidental del canal. La península de Cotentin destaca dentro del canal."},{"page_url":"https://ceb.wikipedia.org/wiki/Stein_(munisipyo_sa_Nasod_nga_Swiss,_Kanton_Aargau,_Bezirk_Rheinfelden,_lat_47,55,_long_7,95)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/Karte_Gemeinde_Stein_AG_2010.png","page_title":"Stein (munisipyo sa Nasod nga Swiss, Kanton Aargau, Bezirk Rheinfelden, lat 47,55, long 7,95)","context_page_description":"Munisipyo ang Stein sa Nasod nga Swiss. Nahimutang ni sa distrito sa Bezirk Rheinfelden ug kanton sa Kanton Aargau, sa sentro nga bahin sa nasod, 80 km sa amihanan-sidlakan sa Bern ang ulohan sa nasod. Adunay 2,978 ka molupyo. Naglangkob kin og 2.8 ka kilometro kwadrado.\\nAng yuta sa Stein kay patag sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang kabungtoran.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 1,854 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 202 milimetro nga ulan, ug ang kinaugahan Marso, sa 76 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Pirch","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Pirch_Wappen.jpg","page_title":"Pirch","context_page_description":"Pirch ist der Name eines pommerschen Uradelsgeschlechts aus Hinterpommern."},{"page_url":"https://vi.wikipedia.org/wiki/Huntleya","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Huntleya_lucida_Orchi_01.jpg","page_title":"Huntleya","context_page_description":"Huntleya là một chi phong lan gồm 14 loài. Các loài phân bố trong các khu rừng mây ẩm ướt ở độ cao trung bình Guatemala, [[Costa Rica, Nam Mỹ xuống Bolivia. Loài điển hình \\"Huntleya meleagris\\" mọc ở Trinidad."},{"page_url":"https://en.wikipedia.org/wiki/List_of_historic_properties_in_Glendale,_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Glendale-W._Weigold_House-1910.jpg","page_title":"List of historic properties in Glendale, Arizona","context_page_description":"This is a list of historic properties in Glendale, Arizona, which includes a photographic gallery, of some of the city's remaining historic structures and monuments."},{"page_url":"https://de.wikipedia.org/wiki/Audi_R8_4S","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Audi_R8_2017_Convertible_3.jpg","page_title":"Audi R8 4S","context_page_description":"Der Audi R8 ist die seit 2015 erhältliche zweite Generation des Mittelmotor-Sportwagens R8 von Audi."},{"page_url":"https://zh.wikipedia.org/zh-tw/3,3-%E4%BA%8C%E7%94%B2%E5%9F%BA-1-%E4%B8%81%E9%86%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Choline-skeletal.svg","page_title":"3,3-二甲基-1-丁醇","context_page_description":"3,3-二甲基-1-丁醇是一種醇類的有機化合物，是膽鹼的結構類似物。"},{"page_url":"https://it.wikipedia.org/wiki/Cantone_di_Carrillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Playa_Hermosa.jpg","page_title":"Cantone di Carrillo","context_page_description":"Il cantone di Carrillo è un cantone della Costa Rica, ubicato nella Penisola di Nicoya, nella provincia di Guanacaste, con capoluogo Filadelfia. Il capoluogo cantonale è ubicato a pochi chilometri da Santa Cruz, sulla strada panamericana che collega quest'ultima a Liberia.\\nConfina ad Est con il cantone di Bagaces, a Sud con il cantone di Santa Cruz, ad Ovest con l'Oceano Pacifico, a Nord con il cantone di Liberia.\\nIl cantone fu istituito con decreto nel 1877; il nome Carrillo fu attribuito in onore all'ex presidente Braulio Carrillo Colinas.\\nL'economia si basa sull'agricoltura, sull'allevamento del bestiame e sul turismo. Alcune spiagge sono assai frequentate dagli amanti del surf, dello snorkeling, delle immersioni: Golfo de Papagayo, Guacamaya, Playas del Coco, Bahia Culebra, Playa Hermosa.\\nIl capoluogo Filadelfia è ubicato su un tratto di terreno pianeggiante, tra i fiumi Tempisque e Palmas.\\nFiladelfia è anche conosciuta, come recita un arco eretto all'uscita del nucleo urbano, città archeologica della Costa Rica."},{"page_url":"https://fi.wikipedia.org/wiki/Eurooppatie_E22","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/M62_J22_from_Pennine_Way.JPG","page_title":"Eurooppatie E22","context_page_description":"E22 tai Eurooppatie 22 on Iso-Britannian Holyheadistä Venäjän Ishimiin kulkeva tie. Sen pituus on 5 320 kilometriä ja on tämän myötä yksi pisimmistä Eurooppateistä. E22 päättyi ennen Latviaan, mutta 24. kesäkuuta 2002 tietä pidennettiin Venäjälle."},{"page_url":"https://pl.wikipedia.org/wiki/Rosarium_w_Parku_%C5%9Al%C4%85skim","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a8/Silesian_Central_Park_-_June_2012_14.jpg","page_title":"Rosarium w Parku Śląskim","context_page_description":"Rosarium w Parku Śląskim – największy w Polsce różany ogród o powierzchni około 7 ha znajdujący się w Parku Śląskim na terenie Chorzowa."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D8%B3%D8%AA%D8%B1%D9%88%D8%AF%D8%8C_%DA%A9%D9%86%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/High_Street%2C_Strood_%283%29_-_geograph.org.uk_-_714438.jpg","page_title":"استرود، کنت","context_page_description":"استرود، کنت بریتانیادا بیر یاشاییش منطقه‌سی‌دیر سوْن نۆفوس تخمین‌لرینه گؤره 33182 نفر دیر. بۇ شهر اینگیلیس اؤلکه‌سینده یئرلشیب."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%DB%8C%D9%86%D8%A7%D8%8C_%D8%A2%D9%84%D8%A7%D8%A8%D8%A7%D9%85%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Vina-CR23-al.jpg","page_title":"وینا، آلاباما","context_page_description":"وینا آمریکانین آلاباما ایالتینده یئرلشن بیر شهر. ۲۰۱۸-جی ایلده وئریلن معلوماتا گؤره اهالیسینین سایی ۳۵۶ نفر ایدی."},{"page_url":"https://en.wikipedia.org/wiki/Iodocyanopindolol","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Iodocyanopindolol-3D-spacefill.png","page_title":"Iodocyanopindolol","context_page_description":"Iodocyanopindolol is a drug related to pindolol which acts as both a β₁ adrenoreceptor antagonist and a 5-HT1A receptor antagonist. Its ¹²⁵I radiolabelled derivative has been widely used in mapping the distribution of beta adrenoreceptors in the body."},{"page_url":"https://pt.wikipedia.org/wiki/Estrada_nacional_50_(Su%C3%A9cia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Riksv%C3%A4g_50_vid_Falu_gruva.jpg","page_title":"Estrada nacional 50 (Suécia)","context_page_description":"A Rv 50 ou Estrada nacional 50 é uma estrada nacional sueca com uma extensão de 486 km. É também conhecida como a Diagonal da Bergslag. Liga Ionecopinga a Söderhamn, passando por Ödeshög, Vadstena, Motala, Askersund, Hallsberg, Kumla, Örebro, Nora, Lindesberga, Ljusnarsberg, Ludvika, Borlänge, Falun, Ovanåker, Bollnäs, e Hudiksvall."},{"page_url":"https://nl.wikipedia.org/wiki/Cerentino","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Karte_Gemeinde_Cerentino_2008.png","page_title":"Cerentino","context_page_description":"Cerentino is een gemeente en plaats in het Zwitserse kanton Ticino, en maakt deel uit van het district Vallemaggia. Cerentino telt 66 inwoners."},{"page_url":"https://hu.wikipedia.org/wiki/Hvannadalshn%C3%BAkur","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Hvannadalshn%C3%BAkur.JPG","page_title":"Hvannadalshnúkur","context_page_description":"A Hvannadalshnúkur vagy Hvannadalshnjúkur egy hegycsúcs az izlandi Öræfajökull vulkán északnyugati peremén, Izland legmagasabb pontja. Egy 2005. augusztusában végzett mérés alapján magassága a korábban elfogadott 2119 méter helyett 2109,6 méter. A hegycsúcs a Skaftafell Nemzeti Park része.\\nA Wikimédia Commons tartalmaz Hvannadalshnúkur témájú kategóriát."},{"page_url":"https://en.wikipedia.org/wiki/Tuarii","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Raiatea_-_La_reine_Tuarii_et_son_Conseil%2C_%C3%A0_Avera.jpg","page_title":"Tuarii","context_page_description":"Tuarii or Tūari'i was the queen regnant of Raiatea and Tahaa in the Leeward Islands of the Society Islands, part of present-day French Polynesia. She was the last monarch of the kingdom of Raiatea-Tahaa from 1887/1888 to 1897 before the conquest and annexation of the islands to France.\\nTuarii was born into the ruling family of Raiatea. Her father was King Tahitoe and her sister Queen Tehauroa. A succession dispute gave the throne to a female-line cousin Tamatoa VI who submitted to French rule in 1888. In response, she and the minor chief Teraupo'o led a resistance government during the Raiatean rebellion against the French. She unsuccessfully attempted to enlist the diplomatic support of the British by offering the islands to Queen Victoria and traveling to the British-controlled Cook Islands. The British refused to intervene. The rebellion ended with the surrender of Tuarii and her followers and the defeat and capture of Teraupo'o in 1897. She was pensioned off by the French colonial government and died in 1911."},{"page_url":"https://cs.wikipedia.org/wiki/Mumie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Tuts_Tomb_Opened.JPG","page_title":"Mumie","context_page_description":"Mumie je mrtvé tělo člověka nebo zvířete, které bylo zachováno buď přirozeně nebo uměle. K náhodné mumifikaci dochází, pokud se mrtvé tělo nachází ve vhodných přírodních podmínkách. Řada lidských kultur vyvinula chemický proces balzamování, při kterém se dosahovalo stejného výsledku. Obvykle se tak dělo z náboženských důvodů. Hmotnost dospělého člověka se při úplné mumifikaci změní na 5 až 7 kilogramů."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%B1%82%E7%B1%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/%E7%AB%B9%E7%B1%A4%E5%8F%8A%E7%B1%A4%E6%96%87.JPG","page_title":"求籤","context_page_description":"求签，是一种占卜的行为，签，或称神签、灵签，是东亚民间用来求问吉凶祸的占卜工具，以签来占卜的行为称为求签。现今的道观、佛寺和庙宇，大多摆上签筒供人求签问卜。古时在签上印有签诗，由信众抄录回家，但现今寺庙大多会将签文，另外印至于他处薄纸片上，让信徒于抽取签条且核对签条上的番号后，再抽取相对应的签诗纸片获得相关诗文解答。华人地区重视此项活动，台湾各大庙宇会在农历新春时期抽出“国运签”，香港政府也有农历新年求签活动。"},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%BF%D5%A1%D5%B5%D6%81%D5%A5%D5%AC%D5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Staicele%2C_Staiceles_pils%C4%93ta%2C_LV-4043%2C_Latvia_-_panoramio.jpg","page_title":"Ստայցելե","context_page_description":"Ստայցելե, քաղաք Լատվիայի Ալոյայի շրջանում։\\nԳտնվում է Ռիգա մայրաքաղաքից 130 կմ հեռավորության վրա, Վալմիերա քաղաքից՝ 62 կմ, Լիմբաժի քաղաքից՝ 45 կմ, իսկ Այնաժի քաղաքից՝ 30 կմ։ Քաղաքի մակերեսը կազմում է 5.16 կմ²։\\nՍտայցելե, արագիլների քաղաքն է, որտեղ արագիլը համարվում է քաղաքի գլխավոր խորհրդանիշերից մեկը։"},{"page_url":"https://uk.wikipedia.org/wiki/Phlox_stolonifera","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Creeping_Phlox_with_dogwood_tree.jpg","page_title":"Phlox stolonifera","context_page_description":"Флокс повзучий, флокс столононосний — квіткова рослина роду Флокс."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%B8%8C%E8%87%98%E8%8B%B1%E9%9B%84%E5%B4%87%E6%8B%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Hero_offering.jpg","page_title":"希臘英雄崇拜","context_page_description":"英雄崇拜是古希腊宗教众多鲜明特色之一。在荷马时代希腊语中，指的是于特洛伊战争期间中希腊与特洛伊任何一方参战之男子。英语中的“hero”源自于古希腊语“ἥρως”，而古希腊语转写成拉丁文为“hērōs”，透过了关于特洛伊这段历史时期的典故，无论如何，这单字成为了明确表示一位“已逝”的男子之意思，人们对祂们的崇敬与请求息灾是位于祂们的陵墓或是在一座特定的神龛，因为在祂还活着的期间之名望或是非凡的辞世态度赐给了祂力量可以去协助与保佑在世的人们。一位英雄的地位是超越于人类但是却尚未及于一尊神明，还有各类超自然的人物后来都被同化成为英雄的位阶；一名英雄与一尊神明之间的区别是前者等级小于后者，尤其是在赫拉克勒斯的情况，这是最突出的，但却不是典型的英雄。\\n从青铜时代所留下来宏伟的遗址以及古墓赐予公元前十世纪到公元前九世纪前文字时期之希腊人一个伟大还有消失年代的观感，由伟大遗址与古墓反映出了口头史诗传统，而《伊利亚特》便是史诗传统的结晶。丰富更新的奉献物开始被成为一种象征，在经过了一个年代的间断之后，像是位在勒夫坎狄的地点，即使被隆重埋葬礼的死者之名字已难以被忆记，“故事开始被讲述，令被葬于这些古老庄严的人物，得到独特的个性，”罗宾·莱恩·福克斯陈述著。"},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%AF%D8%B1%D9%88_%D9%86%D8%A7%D9%86%DA%A9_%DA%AF%D8%B1%D9%BE%D9%88%D8%B1%D8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Akal_Takht_illuminated%2C_in_Harmandir_Sahib_complex%2C_Amritsar.jpg","page_title":"گرو نانک گرپورب","context_page_description":"گرو نانک گرپورب، گرو نانک جیندی یا گُرو نانک پرکاش اُتسو اک سکھی تہوار جو اکثر سکھ منا‏ندے نيں۔ ایہ دن سکھ ہر سال پہلے گُرو، بابا گُرو نانک د‏‏ی ولادت د‏‏ی مناسبت تو‏ں منا‏ندے نيں۔ ایہ سکھ دھرم دا مقدس ترین تہوار ا‏‏ے۔\\nسکھ دھرم د‏‏ی تقریبات و تہوار انہاں دے دس گُروواں د‏‏ی سالگرہاں یا برسیاں دے گرد گھمدے نيں۔ دس گُرو سکھ دھرم د‏‏ی اوہ مذہبی اولین قیادت سی جس نے سکھ دھرم دے عقائد تے اصول و ضوابط د‏‏ی تشکیل ورگی۔ انہاں د‏‏ی سالگرہاں نو‏‏ں گُرپورب کہیا جاندا ا‏‏ے۔ ایہ تہواری دن تے مواقع سکھ دھرم وچ مراسم و قبولیت دعا تے تقریبات جشن بپا کرنے دے ہُندے نيں۔\\nسکھ دھرم دے بانی بابا گُرو نانک، بیساکھی دے دن 5 اپریل 1469 عیسوی بمطابق یکم بیساکھ 1526 بکرمی نو‏‏ں رائے بھوئے دی تلونڈی موجودہ ضلع شیخوپورہ، پنجاب، پاکستان جسنو‏ں ہن ننکانہ صاحب کہیا جاندا اے، وچ پیدا ہوئے۔ اس دن بھارت وچ عام تعطیل ہُندی ا‏‏ے۔\\nبھائی بالا د‏‏ی متنازع جنم ساکھی دے مطابق بابا گُرو نانک ہندی قمری مہینے کاتک وچ پُورن ماشی نو‏‏ں پیدا ہوئے سن۔ ايس‏ے وجہ تو‏ں سکھ بابا گُرو نانک دا گُرپورب نومبر وچ منا‏ندے نيں تے ایہ ہن سکھ رسومات و روایات دا جزو ا‏‏ے۔"},{"page_url":"https://sv.wikipedia.org/wiki/Aulacomya_atra","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Choromytilus_chorus-_Coro_zapato_02_Mercado_Pto_Montt.jpg","page_title":"Aulacomya atra","context_page_description":"Aulacomya atra är en musselart. Aulacomya atra ingår i släktet Aulacomya och familjen blåmusslor. Utöver nominatformen finns också underarten A. a. maoriana."},{"page_url":"https://uk.wikipedia.org/wiki/Calamoceratidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Anisocentropus_bicoloratus.jpg","page_title":"Calamoceratidae","context_page_description":"Calamoceratidae — родина волохокрилих комах. Містить близько 120 видів у 9 родах."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%95%B0%E5%AD%A6%E5%8E%9F%E7%90%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Russell%2C_Whitehead_-_Principia_Mathematica_to_56.jpg","page_title":"数学原理","context_page_description":"《数学原理》是由伯特兰·罗素与他的老师阿尔弗雷德·诺思·怀特黑德合著的一本数学书籍，书籍共分三卷，分别出版于1910年，1912年，1913年。\\n它通常缩写为PM，为表述所有数学真理在一组数理逻辑内的公理和推理规则下，原则上都是可以证明的。因此这一雄心勃勃的项目对于数学史和哲学史都是非常重要的，然而在1931年，哥德尔不完备性定理证明对于数学原理或其他任何类似的尝试，这个崇高的目标皆永远无法达到；也就是说，任何尝试以一组公理和推理规则来建立的数学系统，不是不一致，就是不完备。\\n数学原理的一个主要的灵感和动机来自于逻辑学家戈特洛布·弗雷格的工作，但伯特兰·罗素发现其允许建设有矛盾的集合。数学原理排除无限制创建任意的集合来试图避免这个问题，它以不同“类型”的集合来取代一般的集合，一组特定类型的集合只能包含套较低的类型。然而在当代数学，会使用如Zermelo-Fraenkel的集合理论体系，来避免如罗素的笨拙方式。\\n现代图书馆它排在二十世纪英文非虚构书籍中的第23名。"},{"page_url":"https://fr.wikipedia.org/wiki/Crevoladossola","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Crevoladossola_veduta.jpg","page_title":"Crevoladossola","context_page_description":"Crevoladossola est une commune italienne d'environ 4 700 habitants, située dans la province du Verbano-Cusio-Ossola, dans la région Piémont, en Italie nord-occidentale."},{"page_url":"https://en.wikipedia.org/wiki/El_Tabl%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Colombia_-_Nari%C3%B1o_-_El_Tabl%C3%B3n.svg","page_title":"El Tablón","context_page_description":"El Tablón is a town and municipality in the Nariño Department, Colombia.\\nTravelers visit the town for its \\"mystical stone statues\\" from the pre-Columbian era and other archaeological sites, go rock climbing, and do horseback riding. Climbers in the region get a good view of the Magdelena river valley."},{"page_url":"https://de.wikipedia.org/wiki/Claudia_Dalbert","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/2018-05-24_Abgeordnete%28r%29_des_Landtags_von_Sachsen-Anhalt_IMG_5934_LR10_by_Stepro.jpg","page_title":"Claudia Dalbert","context_page_description":"Claudia Dalbert ist eine deutsche Psychologin, Hochschullehrerin an der Martin-Luther-Universität Halle-Wittenberg sowie Politikerin. Seit 25. April 2016 ist sie im Kabinett Haseloff II Ministerin für Umwelt, Landwirtschaft und Energie sowie 2. Stellvertreterin des Ministerpräsidenten von Sachsen-Anhalt."},{"page_url":"https://pl.wikipedia.org/wiki/Boutenac","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Boutenac.JPG","page_title":"Boutenac","context_page_description":"Boutenac – miejscowość i gmina we Francji, w regionie Oksytania, w departamencie Aude. Gmina znajduje się na terenie Parku Regionalnego Narbonnaise en Méditerranée.\\nWedług danych na rok 1990 gminę zamieszkiwało 519 osób, a gęstość zaludnienia wynosiła 23 osoby/km²."},{"page_url":"https://de.wikipedia.org/wiki/Kettenschifffahrt_auf_Elbe_und_Saale","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Dresden_Alt%C3%BCbigau_Informationstafeln_Kettenst%C3%BCck.JPG","page_title":"Kettenschifffahrt auf Elbe und Saale","context_page_description":"Die Kettenschifffahrt auf Elbe und Saale war eine spezielle Art des Schiffstransports, die in der zweiten Hälfte des 19. Jahrhunderts die motorisierte Binnenschifffahrt auf Elbe und Saale dominierte. Dabei zog ein Kettenschleppschiff mehrere Schleppkähne entlang einer im Fluss verlegten Kette. Bis die Kettenschifffahrt ab 1866 die Binnenschifffahrt in Deutschland zunächst an der Elbe revolutionierte, war das Treideln die vorherrschende Antriebsart stromaufwärts fahrender Schiffe. Nach dem Ausbau der Kette fuhren auf einer Gesamtlänge von 668 Kilometern bis zu 28 Kettenschlepper die Elbe stromaufwärts. Ab 1890 ging die Bedeutung der Kettenschifffahrt im Bereich der unteren Elbe zugunsten von Raddampfschleppern immer weiter zurück und wurde hier bis 1898 vollständig eingestellt. Auf der Oberelbe konnte sie sich noch bis 1926/27 halten und wurde danach in Deutschland bis 1943 nur noch lokal in drei kurzen, besonders schwierigen Abschnitten der Elbe eingesetzt. Von 1943 bis 1945 war als letzter Streckenabschnitt in Deutschland nur noch jener kurze Abschnitt in Magdeburg vorhanden, an dem die Kettenschifffahrt auf der Elbe ihren Anfang genommen hatte."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%90%D7%9C%D7%A4%D7%99%D7%9D_%D7%94%D7%91%D7%A8%D7%A0%D7%99%D7%99%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Carl_Heyn_Blick_auf_das_Doldenhorn_mit_Oeschinensee.jpg","page_title":"האלפים הברניים","context_page_description":"האלפים הברניים הם רכס הרים בהרי האלפים בדרום מערב שווייץ.\\nאף על פי שמשמם ניתן להבין כאילו הם שייכים לקנטון ברן, רכס האלפים הברניים עובר גם בקנטונים הסמוכים פריבורג, וו, וואלה. ואכן יש המכנים את הרכס ה'אלפים הפריבורגים' או 'האלפים של קנטון וו' בהתאמה.\\nהנקודה הגבוהה ביותר ברכס היא הר פינסטרארהורן, שהוא גם הנקודה הגבוהה ביותר בקנטון ברן.\\nגבולות הרכס הם עמק הרון מאגם ז'נבה במערב עד העיר מרטיני שם פונה העמק מזרחה והופך לגבולם הדרומי עד לחיבורו עם נהר ארה על ידי נהר טוטנסיבאך היורד מאגם טוטנסי, נהר ארה ממזרח עד לאגם ברינץ, והאגמים ברינץ ותון מצפון. הגבול הצפון-מערבי שלהם אינו מוגדר בבירור, והוא עובר בערך בקו שבין אגם ז'נבה ואגם תון, שם מתמזגים ההרים בהדרגה אל תוך השפלה השווייצרית ונעלמים באזור העיר פריבורג.\\nעמק הרון מפריד בין האלפים הברניים לבין האלפים השבליים ממערב, ובין האלפים הפניניים מדרום. חלקו העליון של עמק הרון מפריד בינם לבין האלפים הלפונטיניים בדרום מזרח.\\nמעבר גרימזל ונהר ארה מפרידים בינם לבין האלפים האוריים ממזרח, ובין האלפים האמנטליים מצפון.\\nהשלגים המפשירים ברכס האלפים הברניים מתנקזים על ידי נהר ארה ויובלו נהר זאנה מצפון, ועל ידי נהר הרון מדרום ונהר רויס ממזרח."},{"page_url":"https://cy.wikipedia.org/wiki/Ocsitania","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Bernard_Barillot_P.jpg","page_title":"Ocsitania","context_page_description":"Gwlad hanesyddol ac endid ieithyddol-ddiwylliannol ydy Ocsitania, sydd heddiw yn y rhan honno o Ffrainc a elwir yn Profens, rhannau o'r Eidal, rhannau o Sbaen a rhan o Fonaco. Yn answyddogol, gelwir yr ardaloedd hyn yn Ocsitania. Yn aml, yn yr Ocsitaneg, gelwir yr ardal yn lo país, h.y. 'y wlad', neu lo País d'Òc h.y. 'gwlad yr Oc'.\\nYstyriwyd hi'n endid ieithyddol-diwylliannol ers yr Oesoedd Canol, ond nid yw wedi bod yn endid statudol, gyfreithiol. Mae'r Ocsitaneg, fodd bynnag, yn iaith swyddogol yng Nghatalwnia. Yn oes y Rhufeiniaid, roedd yn wlad unedig, a gelwid hi gan y Rhufeinwyr yn Septem Provinciæ ac felly hefyd yn yr Oesoedd Canol pan galwyd hi'n Aquitanica gan y Fisigothiaid cyn i'r Ffrancwyr gychwyn ei choncro yn niwedd y 13g."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_los_Diezmos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Desjatynna_westerfeld.jpg","page_title":"Iglesia de los Diezmos","context_page_description":"La Iglesia de los Diezmos, destruida por completo en el siglo XIII, es considerada como el más antiguo templo cristiano de piedra construido en Kiev, en el territorio Rus de Kiev y en el mundo eslavo oriental, hecho que le hace ser considerada como un símbolo en la historia de Ucrania.​​\\nFue construida por orden gran príncipe Vladímir el Grande en el mismo lugar donde se produjo la muerte del protomártir Teodoro el Varego y su hijo Juan​ entre 989 y 996 en conmemoración del bautismo de la Rus de Kiev. El primer nombre que tuvo fue Iglesia de Nuestra Señora por la Dormición de Theotokos. El nombre de Iglesia de los Diezmos se debe a que para su construcción y mantenimiento el príncipe Vladímir destinó una décima parte de los ingresos estatales.​"},{"page_url":"https://en.wikipedia.org/wiki/Hypostatic_model_of_personality","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/Intrapersonal_Relations.PNG","page_title":"Hypostatic model of personality","context_page_description":"The hypostatic model of personality is a view asserting that humans present themselves in many different aspects or hypostases, depending on the internal and external realities they relate to, including different approaches to the study of personality. It is both a dimensional model and an aspect theory, in the sense of the concept of multiplicity. The model falls into the category of complex, biopsychosocial approaches to personality.\\nThe term hypostasis can cover a wide range of personality-related entities usually known as type, stage, trait, system, approach. The history of the concept can be traced back to Peirce's hypostatic abstraction, or personification of traits. Different authors have described various dimensions of the self, personality dimensions and subpersonalities. Contemporary studies link different aspects of personality to specific biological, social, and environmental factors.\\nThe work on subpersonalities was integrated into a hypostatic model. The model describes personality aspects and dimensions, as well as intra- and interpersonal relations."},{"page_url":"https://xmf.wikipedia.org/wiki/%E1%83%90%E1%83%93%E1%83%A0%E1%83%98%E1%83%90%E1%83%9C%E1%83%9D_%E1%83%AF%E1%83%98%E1%83%90%E1%83%9C%E1%83%98%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Adriano_Giannini_-_Cannes_%282%29.jpg","page_title":"ადრიანო ჯიანინი","context_page_description":"ადრიანო გიანინი — იტალიარი არტისტი. თინა რე ჯანკარლო ჯანინიშ ბოში. 2004 წანას ლაჸაფენდჷ ფილმის ოუშენიშ ვითოჟირი მაჸალე. თინა ახნარენდჷ ჰით ლეჯერიშ ხონარს წკურუმია აიარიშ იტალიურ თანგუას"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_Ehrenfeld/I%E2%80%93L","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Hochbunker_K%C3%B6rnerstra%C3%9Fe%2C_K%C3%B6ln-Ehrenfeld-8738.jpg","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Ehrenfeld/I–L","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Ehrenfeld, Stadtbezirk Köln-Ehrenfeld, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Doma%C5%BElice","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/DomazliceNamestiMiru58.JPG","page_title":"Liste der denkmalgeschützten Objekte in Domažlice","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Domažlice ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt.\\nDie folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalbehörde."},{"page_url":"https://da.wikipedia.org/wiki/Thomas_Keneally","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Thomas_Keneally_Festival_Cine_Sidney.jpg","page_title":"Thomas Keneally","context_page_description":"Thomas Keneally er en australsk forfatter. Han er særlig kendt for sin roman Schindlers liste, der lagde navn til filmen af samme navn og som han vandt Bookerprisen for."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D1%80%D0%BA%D0%B0_%D1%87%D1%8B%D1%80%D0%B2%D0%BE%D0%BD%D0%B0%D0%B2%D0%B0%D0%BB%D0%BB%D1%91%D0%B2%D0%B0%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Branta_ruficollis.jpg","page_title":"Казарка чырвонаваллёвая","context_page_description":"Казарка чырвонаваллёвая — вадаплаўная птушка з сямейства качыных."},{"page_url":"https://la.wikipedia.org/wiki/Ch%C3%A2teau_(Arar_et_Liger)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Map_commune_FR_insee_code_71112.png","page_title":"Château (Arar et Liger)","context_page_description":"Château est commune Francicum 249 incolarum praefecturae Araris et Ligeris in regione Burgundia."},{"page_url":"https://sv.wikipedia.org/wiki/Santa_Cruz_de_Moncayo_(kommunhuvudort)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Santa_Cruz_de_Moncayo%2C_Zaragoza%2C_Espa%C3%B1a%2C_2015-12-31%2C_DD_08.JPG","page_title":"Santa Cruz de Moncayo (kommunhuvudort)","context_page_description":"Santa Cruz de Moncayo är en kommunhuvudort i Spanien. Den ligger i provinsen Provincia de Zaragoza och regionen Aragonien, i den nordöstra delen av landet, 230 km nordost om huvudstaden Madrid. Santa Cruz de Moncayo ligger 621 meter över havet och antalet invånare är 112.\\nTerrängen runt Santa Cruz de Moncayo är kuperad västerut, men österut är den platt. Den högsta punkten i närheten är 780 meter över havet, 1,1 km söder om Santa Cruz de Moncayo. Runt Santa Cruz de Moncayo är det mycket glesbefolkat, med 5 invånare per kvadratkilometer. Närmaste större samhälle är Tarazona, 3,5 km nordost om Santa Cruz de Moncayo. Omgivningarna runt Santa Cruz de Moncayo är i huvudsak ett öppet busklandskap.\\nKustklimat råder i trakten. Årsmedeltemperaturen i trakten är 14 °C. Den varmaste månaden är juli, då medeltemperaturen är 25 °C, och den kallaste är december, med 3 °C. Genomsnittlig årsnederbörd är 583 millimeter. Den regnigaste månaden är november, med i genomsnitt 77 mm nederbörd, och den torraste är augusti, med 19 mm nederbörd."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%86%D5%A5%D6%86%D5%BF%D5%A5%D5%AF%D5%A1%D5%B4%D5%BD%D5%AF%D5%AB_%D5%A1%D5%BE%D5%BF%D5%B8%D5%A3%D5%B8%D6%80%D5%AE%D5%A1%D6%80%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Innoprom_2013_007.jpg","page_title":"Նեֆտեկամսկի ավտոգործարան","context_page_description":"Նեֆտեկամսկի ավտոգործարան ԲԲԸ, «ԿԱՄԱԶ» ՓԲԸ-ի ձեռնարկությունների խմբի մեջ մտնող ավտոմոբիլային ձեռնարկություն, որը հանդիսանում է «ԿԱՄԱԶ» մակնիշի ավտոմեքենայի շասսիի հատուկ վերահսկողության ռուսական խոշոր արտադրողը: 2000 թվականի դեկտեմբերին գործարանը ներկայացրեց NefAZ-5299 առաջին քաղաքային տիպի ավտոբուսը: Գործարանը գտնվում է Նեֆտեկամսկ քաղաքում:"},{"page_url":"https://nl.wikipedia.org/wiki/Rafa%C3%ABl_(kunstenaar)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Raffaello_Ritratto_di_donna.jpg","page_title":"Rafaël (kunstenaar)","context_page_description":"Rafaël was een Italiaanse kunstschilder en architect uit de hoogrenaissance. Naast fresco's, altaarstukken en portretten heeft hij ontwerpen gemaakt voor kerken, palazzo's en wandtapijten.\\nRafaël is de naam waaronder hij nu wereldwijd bekend is. Zijn echte naam naam was Raffaello Sanzio. Sanzio is een variant van Santi, de naam van zijn vader. Als hij zijn werk signeerde, deed hij dit vaak met raphael urbinas, de pseudo-Latijnse vorm van zijn bijnaam Raffaello da Urbino.\\nHij speelt een prominente rol in Le Vite, de beroemde verzameling kunstenaarsbiografieën geschreven door de 16e-eeuwse schilder en schrijver Giorgio Vasari."},{"page_url":"https://en.wikipedia.org/wiki/Olive_Higgins_Prouty","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Beatrice_Moreland.jpg","page_title":"Olive Higgins Prouty","context_page_description":"Olive Higgins Prouty was an American novelist and poet, best known for her 1922 novel Stella Dallas and her pioneering consideration of psychotherapy in her 1941 novel Now, Voyager."},{"page_url":"https://ru.wikipedia.org/wiki/Maxima_grup%C4%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Maxima_inside.jpg","page_title":"Maxima grupė","context_page_description":"Maxima grupė — литовская группа компаний, управляющая сетью магазинов розничной торговли через дочерние компании на территории Литвы, Латвии, Эстонии, Польши и Болгарии. Принадлежит компании «Vilniaus prekyba». Штаб-квартира находится в Вильнюсе.\\nПо состоянию на середину 2020 года управляет более чем 1200 магазинами с общим количеством работников свыше 40 тысяч человек."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E5%8C%88%E5%8D%A1%E6%A2%85%E6%96%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/PlutoMapFeatures-Updated-20150727a.jpg","page_title":"匈卡梅斑","context_page_description":"匈卡梅斑是冥王星暗黑色指節套環系列中的一節。它的名稱源自Jun Kameh，是瑪雅基切語的議會之書提到的七位死神之一。"},{"page_url":"https://pl.wikipedia.org/wiki/W%C5%82odzimierz_Bernhardt","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/ISBS_-_Bernhardt.JPG","page_title":"Włodzimierz Bernhardt","context_page_description":"Włodzimierz Bernhardt – podpułkownik Wojska Polskiego."},{"page_url":"https://de.wikipedia.org/wiki/Oslip","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Cselleym%C3%BChle2_Oslip.JPG","page_title":"Oslip","context_page_description":"Oslip ist eine Gemeinde mit 1262 Einwohnern im Bezirk Eisenstadt-Umgebung im Burgenland in Österreich. Die Mehrheit der Bevölkerung zählt zur burgenlandkroatischen Volksgruppe und spricht neben der Hauptsprache Deutsch auch Burgenland-Kroatisch."},{"page_url":"https://bs.wikipedia.org/wiki/Smederevska_Palanka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Tr%C5%BEni_centar_Oblik.jpg","page_title":"Smederevska Palanka","context_page_description":"Smederevska Palanka je grad i sjedište istoimene općine u Srbiji. Nalazi se u dolini Jasenice, pritoke rijeke Morave. Geografske koordinate su mu 44.37° sjeverne geografske širine i 20.96° istočne geografske dužine."},{"page_url":"https://ro.wikipedia.org/wiki/Pitbull","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Staffordshire_Bull_Terrier_600.jpg","page_title":"Pitbull","context_page_description":"Pitbull este o rasă de câini de talie medie creată\\nprin anii 1800, prin încrucișări între Bull Terrieri aduși în America din Irlanda și Anglia, datorită popularității de care se bucurau în acea perioadă luptele între câini. În ciuda zvonurilor, ei nu sunt agresivi cu stăpânul, dar pot fi agresivi cu străinii. Blana este scurtă, aspră, lucioasă, de diferite culori. Ei sunt dispuși să își apere stăpânul în orice mod, ceea ce poate crea un exces de agresivitate. Clubul Americii consideră American Staffordshire Terrierul o rasă diferită față de American Pit Bull Terrierul, dar Anglia înscrie ambele rase sub denumirea de APBT. Rasa APBT a fost omologată de UKC în 1898.\\nLa fel ca și în cazul altor rase de câini, cuparea urechilor este interzisă sau restricționată în multe țări europene. De altfel, Asociația Medical Veterinară Americană se opune unei asemenea practici, dacă este folosită doar în scopuri cosmetice. În România, legea interzice tăierea cozii și cuparea urechilor, pe motiv ca sunt crude și sunt catalogate ca maltratare a animalelor.\\nDeși au loc adesea lupte ad-hoc, care nu țin cont de nici un fel de regulă, teoretic, acestea există."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%84%D8%B9%D8%A9_%D8%A7%D9%84%D8%AA%D9%86%D9%88%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Shepherd_Neolithic_flint_tools.jpg","page_title":"قلعة التنور","context_page_description":"قلعة تنور هو موقع أثري من العصر الحجري الحديث يقع في منتصف الطريق بين بريتال وحور تعلا، على بعد 12 كيلومتر جنوب غرب بعلبك في قضاء بعلبك في محافظة البقاع في لبنان. يرتفع فوق مستوى سطح البحر 1182 متراً.\\nاكتشف السيد بيسانسون الموقع السطحي في عام 1966 على تل من الصخور الجيرية المكشوفة، حيث كان أبعد موقع من جميع مواقع الراعي العصر الحجري الحديث المفهرسة في ذلك الوقت، وكانت أدوات الصوان الموجودة في الموقع بشكل عام ذو لون بني أو رمادي، وبعضها يظهر في الزنجار الأبيض، وكانت أنواع الشفرة قصيرة عادة ولكنها تضمنت أيضًا أنواعًا أخرى رقيقة ومدعومة، وكاشطات شديدة الانحدار، وتم تخزين المواد المستكشفة في متحف ما قبل التاريخ اللبناني الموجود بمبنى جامعة القديس يوسف في العاصمة اللبنانية بيروت."},{"page_url":"https://fr.wikipedia.org/wiki/Carnaval_Festival","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Eft_Carnaval_05.jpg","page_title":"Carnaval Festival","context_page_description":"Carnaval Festival est un parcours scénique du parc d'attractions néerlandais Efteling. Conçue par l’auteur de films d’animation Joop Geesink - aussi connu en tant que créateur de Loeki le lion - l’attraction ouvre en 1984 peu après le décès de son père spirituel."},{"page_url":"https://vi.wikipedia.org/wiki/M%E1%BA%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Dr._J.C._Ayers_and_Co._%283093726046%29.jpg","page_title":"Mẹ","context_page_description":"Mẹ thông thường được dùng để chỉ người phụ nữ mang thai, sinh ra và nuôi lớn đứa trẻ. Tuy nhiên, vì sự phức tạp và các khác biệt trong các định nghĩa và vai trò của người mẹ về mặt văn hóa, xã hội và tôn giáo nên rất khó có thể có một định nghĩa chung về mẹ được chấp nhận rộng khắp. Tương đương về phía nam giới là người cha."},{"page_url":"https://sv.wikipedia.org/wiki/Caldwellkatalogen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/NGC_2516_in_Carina.jpg","page_title":"Caldwellkatalogen","context_page_description":"Caldwellkatalogen är en astronomisk katalog på 109 stjärnhopar, nebulosor och galaxer för amatörastronomer. Listan skapades av Patrick Moore som ett komplement till Messiers katalog.\\nMoore märkte att Messiers katalog, som används av många amatörastronomer till som en lista på deep-sky-objekt att observera saknar flera av himlens ljusaste objekt, såsom Hyaderna, Dubbelhopen och Bildhuggargalaxen. Moore märkte också att eftersom Messier gjorde sin lista utgående från observationer gjorda i Paris, innehöll listan inte flera ljusa objekt längre söderut, som Omega Centauri, Centaurus A, the NGC 4755 och 47 Tucanae. Moore skapade en lista på 109 objekt – för att ha samma antal objekt som Messiers katalog Listan publicerades i Sky & Telescope i december 1995.\\nMoore använde sitt andra efternamn som listans namn, eftersom den första bokstaven av \\"Moore\\" redan används för Messiers katalog. Objekt i katalogen är listade med ett \\"C\\" och numret av objektet.\\nTvärtemot objekten i Messiers katalog, som är listade ungefär i upptäcktsordningen, är Caldwellobjekten listade enligt deklination, C1 längst norrut och C109 längst söderut."},{"page_url":"https://es.wikipedia.org/wiki/Bandera_mundial","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Esquema_bandera_mundial_2011.png","page_title":"Bandera mundial","context_page_description":"La bandera mundial es una bandera internacional creada en 1988 por el estadounidense Paul Carroll para aumentar la conciencia de los desafíos comunes para la humanidad con respecto a la globalización en el mundo actual. En centro de la bandera, hay un mapa del mundo rodeado por las banderas de 216 países y territorios, así como la bandera de la ONU."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_vua_Nga","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Svatoslav_titularnik.png","page_title":"Danh sách vua Nga","context_page_description":"Đây là danh sách tất cả các vị vua trị vì trong lịch sử nước Nga. Nó bao gồm các danh hiệu Đại thân vương Novgorod, Đại thân vương Kiev, Đại thân vương Vladimir, Đại thân vương Moscow, Sa hoàng của tất cả nước Rus' và Hoàng đế của toàn nước Nga. Danh sách bắt đầu với Rurik, Hoàng tử Novgorod, vào khoảng thời gian nào đó giữa thế kỷ thứ IX và kết thúc với Hoàng đế của toàn nước Nga Nicholas II, người đã thoái vị vào năm 1917 và bị xử tử cùng gia đình vào năm 1918.\\nLãnh thổ rộng lớn được biết đến ngày nay là Nga bao gồm một khu vực đã được biết đến trong lịch sử bởi nhiều tên khác nhau, bao gồm Rus', Rus' Kiev, Đại công quốc Moscow, Sa quốc Nga và Đế quốc Nga, và chủ quyền của nhiều quốc gia này và trong suốt lịch sử của họ đã được sử dụng tương tự như một loạt các chức danh trong vị trí của họ như là quan tòa chính của một quốc gia."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%9A%87%E6%81%A9%E6%A1%A5%E7%8E%84%E5%A4%A9%E8%A7%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/%E7%9A%87%E6%81%A9%E6%A1%A5%E7%8E%84%E5%A4%A9%E8%A7%82.jpg","page_title":"皇恩桥玄天观","context_page_description":"皇恩橋玄天觀是北京市東城區東華門大街北側的一座道觀。"},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_nis%C3%A4kk%C3%A4ist%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/ChinchillaMaria.jpg","page_title":"Luettelo nisäkkäistä","context_page_description":"Tämä on luettelo nisäkäslajeista. Nisäkkäitä on maailmassa yhteensä noin 5 400 lajia 1200 suvussa, 153 heimossa ja 29 lahkossa, tosin nämä luvut vaihtelevat luokituksen mukaan.\\nKatso myös:\\nLuettelo pussieläimistä\\nLuettelo lepakoista\\nLuettelo jyrsijöistä\\nLuettelo jäniseläimistä\\nLuettelo sorkkaeläimistä\\nLuettelo kavioeläimistä\\nLuettelo kädellisistä\\nLuettelo ihmislajeista\\nLuettelo petoeläimistä\\nLuettelo valaista\\nLuettelo Afrosoricida-lahkon nisäkkäistä\\nLuettelo Soricomorpha-lahkon nisäkkäistä\\nLuettelo Suomen nisäkkäistä\\nLuettelo äärimmäisen uhanalaisista selkärankaisista#Nisäkkäät"},{"page_url":"https://fr.wikipedia.org/wiki/Alain_L%C3%A9vy","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Alain-levy-2019.jpg","page_title":"Alain Lévy","context_page_description":"Alain Lévy, né le 14 juillet 1949 à Casablanca, lauréat de médecine à Strasbourg, est un bridgeur français licencié au Bridge Club Saint Honoré et vivant à Paris."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Seattle_landmarks","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Seattle_-_Columbia_City_-_street_clock_01.jpg","page_title":"List of Seattle landmarks","context_page_description":"The City of Seattle Landmarks Preservation Board, part of the Department of Neighborhoods of the city of Seattle, Washington, United States, designates city landmarks. According to the department's official website, the following are designated landmarks; the list should be complete as of March 2010.\\nAll designated landmarks are added to chapter 25.32 of the Seattle municipal code and are approved via legislative action from the Seattle City Council."},{"page_url":"https://de.wikipedia.org/wiki/Planetarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Moderner_Carl_Zeiss_Projektor.JPG","page_title":"Planetarium","context_page_description":"Planetarium bezeichnete ursprünglich ein Gerät zur Veranschaulichung des Planetenlaufs. Bis zum 19. Jahrhundert verstand man darunter einen kleinen mechanischen Apparat, den man inzwischen als „Orrery“ bezeichnet. Unter dem modernen Planetarium versteht man heute ein Gebäude mit einer halbkugelförmigen Kuppel, auf deren Innenfläche Bilder des Sternenhimmels von einem speziellen Projektor erzeugt werden. Diese Art Planetarium bezeichnet man als Projektionsplanetarium. Zu den wesentlichen Merkmalen gehört, dass der Projektor die Tages- und Jahresbewegungen zu einer beliebigen Zeit und für einen beliebigen geographischen Ort darstellen kann. Als Erfinder des modernen Projektionsplanetariums gilt der Physiker Walther Bauersfeld, der es 1919 im Auftrag von Carl Zeiss Jena entwickelte und baute. Das Projektionsplanetarium ist nicht mit einer Sternwarte zu verwechseln. Ersteres erzeugt einen simulierten Sternenhimmel, während man in einer Sternwarte die realen Himmelsobjekte beobachten kann."},{"page_url":"https://es.wikipedia.org/wiki/Jos%C3%A9_Selva_Mergelina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Firma_del_Marqu%C3%A9s_de_Villores.png","page_title":"José Selva Mergelina","context_page_description":"José Selva Mergelina, quinto marqués de Villores fue un político carlista español, último secretario político del pretendiente Jaime de Borbón y Borbón-Parma y jefe delegado de la Comunión Tradicionalista desde 1921 hasta su muerte en 1932."},{"page_url":"https://vi.wikipedia.org/wiki/Burj_Khalifa","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Burjdubaiaug92007.jpg","page_title":"Burj Khalifa","context_page_description":"Burj Khalifa, trước kia tên là Burj Dubai trước khi khánh thành, là một nhà chọc trời siêu cao ở \\"Trung tâm Mới\\" của Dubai, Các Tiểu Vương quốc Ả Rập Thống nhất. Với tổng chiều cao 829,8 m trong đó chiều cao đến mái là 828 m, nó đã là công trình nhân tạo cao nhất thế giới từng được xây dựng từ cuối năm 2008.\\nĐây là một phần của một khu phức hợp mang tên Downtown Dubai ở Giao lộ Thứ nhất dọc theo Đường Sheikh Zayed, vốn là khu trung tâm tài chính của Dubai. Quyết định xây dựng tòa nhà được đưa ra dựa trên quyết định của chính phủ để thúc đẩy nền kinh tế luôn dựa vào dầu mỏ và để Dubai được thế giới biết đến nhiều hơn. Tòa nhà ban đầu có tên là Burj Dubai nhưng được đổi tên thành tiểu vương của Abu Dhabi và Tổng thống của Các Tiểu vương quốc Ả Rập thống nhất, Khalifa bin Zayed Al Nahyan; Abu Dhabi và chính phủ cho Dubai vay tiền để trả nợ. Tòa nhà đã phá vỡ nhiều kỷ lục chiều cao, bao gồm là tòa nhà cao nhất thế giới.\\nBurj Khalifa được thiết kế và thi công bởi công ty Skidmore, Owings & Merrill LLP từ Chicago, công ty đã thiết kế Willis Tower và Trung tâm Thương mại Thế giới Một. Adrian Smith là kiến trúc sư trưởng và Bill Baker là trưởng công trình sư của tháp Khalifa."},{"page_url":"https://de.wikipedia.org/wiki/Liste_gefl%C3%BCgelter_Worte/N","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e6/Nearer%2C_My_God%2C_to_Thee_-_Project_Gutenberg_eText_21566.png","page_title":"Liste geflügelter Worte/N","context_page_description":"Die Redewendung „Nach Adam Riese“ wird gebraucht, um auszudrücken, dass etwas „richtig gerechnet“ sei. Sie geht auf den bekannten Rechenmeister Adam Ries zurück, der 1528 in Annaberg als Buchführer in den Bergwerksdienst eintrat. Sein erstes Rechenbuch erschien unter dem Titel Rechnung auff der linihen, gemacht durch Adam Risen von Staffelsteyn anno 1518.\\nEs folgten noch drei weitere Lehrbücher, die, im Gegensatz zu den bis ins 16. Jahrhundert üblicherweise in Latein abgefassten Rechenbüchern, in deutscher Sprache abgefasst sind. Durch diesen Verdienst erreichte Adam Ries einen großen Leserkreis und gilt seither allgemein als der „Vater des modernen Rechnens“ und hat entscheidend dazu beigetragen, dass die damals noch gebräuchliche römische Zahlschrift als in der Praxis unhandlich erkannt und durch die indische Zahlschrift ersetzt wurde.\\nRiese war eine schon zu Lebzeiten des Mathematikers vorkommende Variante des Namens Ries und blieb in der Redewendung bis heute erhalten. Die Ursprünge der Verwendung des Namens in Bezug auf korrekte Rechenergebnisse sind ungewiss. Bereits 1829 erschien folgende Deutung:"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%9A%D0%B0%D0%BD%D1%82%D0%B5%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Flag_of_Kantemirovka_%28Voronezh_oblast%29.png","page_title":"Флаг Кантемировки","context_page_description":"Флаг муниципального образования Кантеми́ровское городское поселение Кантемировского муниципального района Воронежской области Российской Федерации — опознавательно-правовой знак, служащий официальным символом муниципального образования.\\nФлаг утверждён 12 марта 2010 года и внесён в Государственный геральдический регистр Российской Федерации с присвоением регистрационного номера 6038.\\nФлаг Кантемировского городского поселения отражает исторические, культурные, социально-экономические, национальные и иные местные традиции."},{"page_url":"https://en.wikipedia.org/wiki/Carter_House_(Elkader,_Iowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/The_Carter_House.jpg","page_title":"Carter House (Elkader, Iowa)","context_page_description":"Carter House in Elkader, Iowa, also known as W. C. Reimer House, is a Greek Revival building built in 1850 as a duplex by brothers Ernest and Henry Carter.\\nIt was listed on the National Register of Historic Places in 1976. Its 1975 NRHP nomination document calls it a \\"lovely Greek Revival home\\" which \\"contributes substantially to the historic ambience of Elkader\\", having greater effect due to its location across from the historic Clayton County Courthouse. As of 1975, it was relatively unaltered, besides having plumbing and electric service added.\\nIn 2016, it is operated as a 19th-century period historic house museum by the Elkader Historical Society."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%98%D0%BD-%D1%8F%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Yin_yang_laozi.jpg","page_title":"Ин-ян","context_page_description":"Ин и Ян в китайската философия и метафизика e концепция, която описва как двете привидно противоположни сили, енергии и принципи се допълват взаимно и преливат една в друга. Ин е черно, а Ян е бяло."},{"page_url":"https://hu.wikipedia.org/wiki/Bandai_Namco_Entertainment","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/NBGI_Headquarters.JPG","page_title":"Bandai Namco Entertainment","context_page_description":"A Bandai Namco Games egy japán, videójátékok készítésével és forgalmazásával foglalkozó cég. A Bandai Namco Games két, a videójátékokkal foglalkozó cég 2005-ös összeolvadásából jött létre. Ezek a Bandai és a Namco. Hivatalosan a Bandai Namco Games 2006 március 31.én jött létre, a két cég történelme ekkor összekapcsolódik, ezt megelőző történelmük egyenként vissza nyúlik az 1950-es évekre. A mostani vezérigazgató Jaszuo Mijakava. A cég összértéke körülbelül 10 milliárd Yen, ami körülbelül 25 milliárd forintra tehető. Sok nevezetes játékuk van, ilyen például a Dark Souls 3, vagy a mindenki számára ismert Tekken verekedős játéksorozat. A cég székhelye Tokióban található."},{"page_url":"https://nl.wikipedia.org/wiki/Musiom","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Musiom-2.jpg","page_title":"Musiom","context_page_description":"Musiom: huis voor hedendaagse kunst, is een Nederlands museum voor moderne en hedendaagse kunst in Amersfoort. Het museum toont kunst van Nederlandse kunstenaars die geboren zijn rond de jaren vijftig van de vorige eeuw.\\nDe naam van het museum is een oud-Latijnse vertaling van het Griekse mythologische verschijnsel van de negen muzen."},{"page_url":"https://simple.wikipedia.org/wiki/Bullfrog","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Lithobates_catesbeianus_distribution.png","page_title":"Bullfrog","context_page_description":"The American bullfrog is a semi-aquatic frog. It belongs to the family Ranidae, or 'true frogs'. Bullfrogs are native to most of North America, Canada and Mexico. The ones that live in northern America hibernate during winter. However, bullfrogs in southern US states are active all the time. Bullfrogs have been seen in South America, Asia, Western Europe and the Caribbean. These bullfrogs were brought on ships. Many people, including pet owners, have placed bullfrogs outside of their native area. They have done this: on purpose because they no longer want them, to control the pest population, or by accident by catching them in fishing nets.\\nBullfrogs can adapt and live almost anywhere if there is water nearby. They can eat rodents, insects, small fish, arachnids, small birds, crustaceas, small mammals, worms, and other frogs. Because of this, they have been blamed for many animal extinctions. Bullfrogs live in large bodies of water such as swamps, lakes, and ponds. They like to stay near the edge of the water. During a rainstorm, they may travel on land. They travel in search of a new habitat."},{"page_url":"https://fi.wikipedia.org/wiki/Hawkins-luokka_(risteilij%C3%A4)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Hawkins_class_cruiser_diagrams_Brasseys_1923.jpg","page_title":"Hawkins-luokka (risteilijä)","context_page_description":"Hawkins-luokka oli Britannian kuninkaallisen laivaston viiden raskaan risteilijän muodostama sotalaivaluokka."},{"page_url":"https://nl.wikipedia.org/wiki/Medaille_met_het_Allerhoogste_Regeringsmotto","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Vier_Gnadenmedaillen_%C3%96sterreich_18es_Jahrhundert.gif","page_title":"Medaille met het Allerhoogste Regeringsmotto","context_page_description":"De Medailles met het Allerhoogste Regeringsmotto, waren onderscheidingen van de Habsburgse heersers over Oostenrijk en de vele andere bezittingen van het Oostenrijkse Huis.\\nDe 17e-eeuwse Habsburgers namen evenmin als de andere Europese vorsten niet-adellijke onderdanen op in een ridderorde. De Orde van het Gulden Vlies was gereserveerd voor edellieden van het katholieke geloof en in de praktijk waren zij altijd van oude adel.\\nOm anderen waaronder de protestantse onderdanen te kunnen belonen met een zichtbaar teken van de keizerlijke dankbaarheid of achting werden medailles geslagen. De hoge waarde van de gouden en zilveren medailles betekende dat de materiële waarde de medaille ook het karakter van een gratificatie of bonus gaf.\\nIedere heerser koos aan het begin van zijn regering een motto, de \\"Allerhöchste Wahlspruch\\" genoemd. Dit motto had het karakter van een politiek programma. Kunstenaars ontwierpen een daarbijpassend vignet. Het was indertijd gebruikelijk om met de uitdrukking \\"Allerhoogste\\" naar de keizer en koning en de aartshertogen en aartshertoginnen te verwijzen. Men sprak van \\"allerhoogste Bevelen\\" en \\"Allerhoogste Personen\\"."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%A4%E0%A5%8B%E0%A4%B0%E0%A4%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Luffa_aegyptiaca_KKMishra.jpg","page_title":"तोरई","context_page_description":"तोरई, तोरी या तुराई एक लता है जिसके फल सब्जी बनाने के काम आते हैं, इसे भारत के कुछ राज्यों में \\"झिंग्गी\\" या \\"झींगा\\" भी कहा जाता है। यह वर्षा ऋतु में पैदा होती है।"},{"page_url":"https://it.wikipedia.org/wiki/Hernando_Bernal_Duran","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Primer_curso_de_colombia.jpg","page_title":"Hernando Bernal Duran","context_page_description":"Hernando Bernal Duran è stato un militare colombiano, fondatore e primo comandante della prestigiosa scuola militare colombiana del gruppo di combattimento \\"Lanceros\\"."},{"page_url":"https://de.wikipedia.org/wiki/Kfz-Kennzeichen_(Jordanien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Jordan_-_License_Plate_-_Diplomatic.png","page_title":"Kfz-Kennzeichen (Jordanien)","context_page_description":"Die aktuellen jordanischen Kfz-Kennzeichen wurden 2007 eingeführt und orientieren sich am europäischen Standard. Sie zeigen in der Regel schwarze Lettern auf weißem Grund. Am linken Rand befindet sich ein farbiges Feld, in dem der Landesname auf Arabisch und Englisch erscheint. Die Farbe des Feldes gibt die nähere Verwendung des Fahrzeugs an. Schilder für Privatfahrzeuge besitzen ein weißes, Fahrzeuge des öffentlichen Transports ein grünes Feld. Rot kennzeichnet Staatsfahrzeuge, Diplomatenkennzeichen weisen ein gelbes Feld und zusätzlich die Buchstaben CD auf. Anhängern wird in Kombination mit den Buchstaben TRL für englisch trailer ebenfalls gelb zugeordnet. Die eigentliche Kombination besteht ausschließlich aus Ziffern, die getrennt von einem Punkt in zwei Gruppen gegliedert sind. Die erste Zifferngruppe korrespondiert mit der Verwendung des Fahrzeugs.\\nÄltere Kennzeichen zeigen sowohl den Landesnamen als auch die Ziffernkombination in lateinischer und arabischer Schrift."},{"page_url":"https://it.wikipedia.org/wiki/John_Ingleby","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Halton%2C_1794.jpg","page_title":"John Ingleby","context_page_description":"John Ingleby è stato un pittore e miniaturista britannico, di origini gallesi."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DB%8C%D8%B1%DB%8C%D8%B3%D8%AA%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Myricetin.png","page_title":"میریستین","context_page_description":"میریستین با فرمول شیمیایی C۱۵H۱۰O۸ یک ترکیب شیمیایی با شناسه پاب‌کم ۵۲۸۱۶۷۲ است؛ که جرم مولی آن ۳۱۸٫۲۳۵۱ g/mol می‌باشد. میریستین جزو فلاونوئیدها می‌باشد. میریستین پلی فنولی با خاصیت آنتی اکسیدانی می‌باشد که تحت شرایط ویژه‌ای خاصیت پرواکسیدانی هم می‌تواند داشته باشد. هرچند میریستین علاوه بر اثرات مفید در بیماری‌های قلبی عروقی و دیابت ملیتوس، به عنوان یک مادهٔ ضد سرطان قوی شناخته شده است، در آزمایش‌هایی که بر پایهٔ تست ایمز انجام گردیده اثرات جهش‌زایی از خود نشان داده است."},{"page_url":"https://hu.wikipedia.org/wiki/Hollandia_kult%C3%BAr%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/PanoramaZuidasAmsterdamtheNetherlands.jpg","page_title":"Hollandia kultúrája","context_page_description":"Hollandia kultúrája sokszínű, tükrözve a regionális különbségeket, de ma már transznacionális holland kultúráról beszélhetünk.\\nA 17. században az ország politikai és gazdasági sikerei nyomán virágzó kultúra bontakozott ki, amelyet holland aranykor néven is ismernek.\\nA hollandok büszkék kulturális örökségükre, gazdag művészettörténetükre és a nemzetközi ügyekben való részvételükre."},{"page_url":"https://es.wikipedia.org/wiki/K%C3%B6hler%27s_Medizinal-Pflanzen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Tamarindus_indica_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-134.jpg","page_title":"Köhler's Medizinal-Pflanzen","context_page_description":"Köhler's Medizinal-Pflanzen es una rara guía medicinal alemana publicada originalmente en 3 volúmenes. Fue obra de Hermann Adolph Koehler, editada después de su muerte por Gustav Pabst, y contiene 283 láminas en cromolitograbado de los ilustradores Walther Müller, C.F.Schmidt, y K.Gunther. La imprimió la editorial de Franz Eugen Köhler, lo que ha dado lugar a cierta confusión sobre la autoría de la obra, por la homoninía entre autor e impresor, y es corriente ver atribuida erróneamente, incluso en publicaciones respetables, dicha autoría al impresor. Para complicar, existió más o menos en la misma época otro Franz Eugen Köhler, este sí botánico, pero que no tuvo nada que ver con esta obra, aunque, ocasionalmente, también se la atribuyó.\\n16 años después, unos complementos"},{"page_url":"https://en.wikipedia.org/wiki/Pino_Rucher","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Pino_Rucher_with_the_Vitale_Orchestra.jpg","page_title":"Pino Rucher","context_page_description":"Pino Rucher was an Italian guitarist active in orchestral settings and in film soundtracks."},{"page_url":"https://de.wikipedia.org/wiki/Brilon-Wald","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Brilon_wald.jpg","page_title":"Brilon-Wald","context_page_description":"Brilon-Wald ist der südlichste Stadtteil von Brilon im Hochsauerlandkreis im östlichen Nordrhein-Westfalen. Er entstand zum Ende des 19. Jahrhunderts unter dem Einfluss des Baus der Oberen Ruhrtalbahn von Hagen nach Warburg. Am 31. Dezember 2013 lebten im Ort 539 Einwohner."},{"page_url":"https://pt.wikipedia.org/wiki/Aleksandr_Gorshkov","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Aleksandr_Gorshkov_%28figure_skater%29.jpg","page_title":"Aleksandr Gorshkov","context_page_description":"Aleksandr Georgievich Gorshkov é um ex-patinador artístico russo, que competiu em provas na dança no gelo. Ele foi campeão olímpico na patinação artística em 1976 ao lado de Lyudmila Pakhomova."},{"page_url":"https://pt.wikipedia.org/wiki/Museu_do_Amanh%C3%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Museu_do_Amanh%C3%A3_em_sua_inaugura%C3%A7%C3%A3o_09.jpg","page_title":"Museu do Amanhã","context_page_description":"O Museu do Amanhã é um museu construído no município do Rio de Janeiro, no Brasil. O prédio, projeto do arquiteto espanhol Santiago Calatrava, foi erguido ao lado da Praça Mauá, na zona portuária. Sua construção teve o apoio da Fundação Roberto Marinho e teve o custo total de cerca de 230 milhões de reais. O edifício foi inaugurado em 17 de dezembro de 2015 com a presença da então presidente do Brasil Dilma Rousseff e recebeu cerca de 25 mil visitantes em seu primeiro final de semana de funcionamento.\\nO antigo píer desativado passou a abrigar uma construção pós-moderna, orgânica e sustentável que, atualmente, é um ícone da identidade local e cultural da cidade do Rio de Janeiro. A proposta da instituição é ser um museu de artes e ciências, além de contar com mostras que alertam sobre os perigos das mudanças climáticas, da degradação ambiental e do colapso social. O edifício conta com espinhas solares que se movem ao longo da claraboia, projetadas para adaptar-se às mudanças das condições ambientais. A exposição principal é majoritariamente digital e foca em ideias ao invés de objetos."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Johannes-Nepomuk-Darstellungen_im_Bezirk_Melk","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/St_Martin_am_Ybbsfelde_Kirche06.jpg","page_title":"Liste der Johannes-Nepomuk-Darstellungen im Bezirk Melk","context_page_description":"Der 1729 heiliggesprochene Johannes Nepomuk gilt nach Maria und Josef als der am dritthäufigsten dargestellte Heilige in Österreich. An zahlreichen Standorten gibt es Johannes-Nepomuk-Darstellungen im niederösterreichischen Bezirk Melk.\\nErst nach Böhmen, aber noch vor dessen Selig- oder Heiligsprechung, setzte in Niederösterreich jene Verehrung Johannes Nepomuks ein, die sich in Form von Statuen und Bildern dokumentiert. Gemessen an der großen Zahl plastischer und bildhafter Darstellungen ist die Zahl der Johannes Nepomuk geweihten Kirchen im Bezirk Melk allerdings verschwindend gering."},{"page_url":"https://sv.wikipedia.org/wiki/Garpenberg","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/S%C3%B6dra_gruvan%2C_Garpenberg.jpg","page_title":"Garpenberg","context_page_description":"Garpenberg är en tätort i Hedemora kommun i Dalarnas län. Den är även kyrkbyn i Garpenbergs socken. Garpenbergs gruva är tillsamman med Lovisagruvan i Örebro län de enda som fortfarande är i bruk i Bergslagen. År 2010 fanns 518 invånare i tätorten."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BB-%D0%AE%D1%80%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Gora_Gebek-kala.jpg","page_title":"Сал-Юрт","context_page_description":"Сал-Юрт — территория которая принадлежала село Дылым Казбековском районе Дагестана. Ныне микрорайон Калининаула.\\nВ 1930-х годах была на полунезаконных соглашениях по желанию одного человека, тогдашнего командированного откуда-то главой Салатавского округа продана эта земля селу Калининаул, никого не спросив, народ не продавал эту землю. Сейчас это микрорайон где уже проживают люди."},{"page_url":"https://fr.wikipedia.org/wiki/1560_en_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Braun_Lyon_UBHD.jpg","page_title":"1560 en France","context_page_description":"4 janvier : rencontre diplomatique à Roncevaux, près de la frontière franco-espagnole, pour la livraison d'Élisabeth de France, fille de France, sœur du roi François II et nouvelle épouse du roi Philippe II d’Espagne.\\n8 mars : signature par le roi de l’édit d’Amboise amnistiant les protestants.\\n15 mars - 19 mars : conjuration d’Amboise.\\n15 mars : destruction par les Portugais de fort Coligny, au Brésil mettant fin à la France antarctique.\\n28 mars : décès du chancelier François Olivier. Il est remplacé quelques semaines plus tard par Michel de L’Hospital.\\n5 juillet : enregistrement par le parlement de Paris de l’édit de Romorantin.\\n6 juillet : signature du traité d’Édimbourg qui met un terme à la tutelle de la France sur l’Écosse. François II refuse de le ratifier.\\n21 août - 26 août : assemblée des notables à Fontainebleau.\\n29 août : arrestation de Jacques de La Sague, agent du prince de Condé, en possession de documents compromettants pour son maître.\\n30 août : arrestation et embastillement du vidame de Chartres.\\nnuit du 4-5 septembre : tentative ratée d’un coup de force protestant sur la ville de Lyon.\\n31 octobre : arrestation du prince de Condé à Orléans."},{"page_url":"https://id.wikipedia.org/wiki/Cemil_%C3%87i%C3%A7ek","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Cemil_Cicek.jpg","page_title":"Cemil Çiçek","context_page_description":"Cemil Çiçek adalah politisi Turki yang kini memangku amanah sebagai Ketua Parlemen Turki sejak 4 Juli 2011. Ia pernah menduduki posisi Deputi Perdana Menteri dan legislator dari Partai Keadilan dan Pembangunan mewakili Ankara. Ia juga mantan Menteri Kehakiman dan pernah menjadi juru bicara pemerintah."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AF%D9%8A%D9%81%D9%8A%D8%AF_%D8%B3%D9%88%D9%84%D9%8A%D9%81%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/David_Sullivan_co-owner_West_Ham_United_F.C..jpg","page_title":"ديفيد سوليفان","context_page_description":"ديفيد سوليفان ‏، من مواليد 1 فبراير 1949، ترأس نادي برمنغهام سيتي في فترة من الفترات."},{"page_url":"https://it.wikipedia.org/wiki/Religioni_della_Mesopotamia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Ab_%28cuneiforme%29.JPG","page_title":"Religioni della Mesopotamia","context_page_description":"Le religioni della Mesopotamia, quell'insieme di differenti credenze, miti, rituali, culti misterici, teologie e pratiche divinatorie professate nell'antica Mesopotamia ovvero in quella regione del mondo che corrisponde approssimativamente all'attuale Iraq, dal IV al I millennio a.C.\\nLe origini di tali religioni vanno individuate nella preistoria delle prime genti abitanti quella regione, nelle credenze e nelle tradizioni di differenti popoli che, a partire dal XXX secolo a.C., lì migrarono, nelle civiltà sumerica e accadica e in quelle civiltà emerse successivamente, quali, ad esempio, quella babilonese e quella assira.\\nLe religioni della Mesopotamia, ma solo intese come culto principale di una realtà statale, cessarono di essere nel 539 a.C. quando la città di Babilonia accolse, sottomettendosi, il re persiano achemenide di probabile fede zoroastriana Ciro II. I Persiani non perseguitarono, né discriminarono tali religioni che continuarono quindi a essere professate dalle popolazioni locali dando luogo anche a differenti sincretismi."},{"page_url":"https://ia.wikipedia.org/wiki/Amazonas_(Brasil)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Lago_Jefferson_Peres_em_Manaus.jpg","page_title":"Amazonas (Brasil)","context_page_description":"Amazonas es un stato del Nord de Brasil, con un area 1 570 745,680 km². Illo ha frontieras al nord con Venezuela e Roraima, Pará al est, Mato Grosso al sud-est, Rondônia al sud, Acre al sud-west), Peru al west e Colombia al nord-west, con 3 393 369 habitantes que se distribue in 62 municipios. Le capital del stato es Manaus.\\nPecietta de geographia\\nIste articulo es ancora in stato embryonic: illo es un pecietta. Nos te invita cordialmente a completar lo pro meliorar Wikipedia in interlingua."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%89%9B%E8%A7%92%E9%9D%A2%E5%8C%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Croissant_And_The_People.jpg","page_title":"牛角面包","context_page_description":"牛角麵包，又稱羊角麵包或新月麵包，是用奶油烘烤出來的西式麵點。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%80%D1%96%D1%8F_%D2%90%D0%B0%D0%B5%D1%82%D0%B0%D0%BD%D0%B0_%D0%90%D0%BD%D1%8C%D1%94%D0%B7%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Maria_Gaetana_Agnesi.jpg","page_title":"Марія Ґаетана Аньєзі","context_page_description":"Марія Ґаетана Аньєзі — італійський математик та філософ.\\nЇй приписують авторство першої книги, в якій обговорюється як диференціальне числення, так і інтегральне числення. Була почесним членом факультету в Болонському університеті.\\nОстанні чотири десятиліття свого життя присвятила вивченню богослов'я, благодійній діяльності та служінню бідним. Власний будинок використовувала для допомоги хворим, влаштувавши в ньому лікарню."},{"page_url":"https://es.wikipedia.org/wiki/Textos_de_execraci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Aechtungstext2.jpg","page_title":"Textos de execración","context_page_description":"Los textos de execración, también conocidos a veces como listas de proscripción​ son antiguos textos hieráticos egipcios, donde se listaban los enemigos del faraón, los enemigos del estado egipcio o vecinos extranjeros problemáticos.​\\nLos textos con los nombres de los enemigos se solían escribir en estatuillas que representaban a extranjeros, cuencos de cerámica o bloques de arcilla o piedra, que eran destruidas posteriormente. El proceso ceremonial de romper los nombres y enterrarlos estaba destinado a ser una especie de magia empática que debía afectar a las personas o lugares mencionadas en los textos, su poder sería quebrantado y el enemigo podría sufrir hasta dolor. Los fragmentos se colocaban generalmente cerca de lugares de enterramiento o de sitios rituales. Esta práctica fue más común en tiempos de conflicto con los vecinos asiáticos de Egipto, sobre todo durante el reinado de Sesostris III y años posteriores.​"},{"page_url":"https://ru.wikipedia.org/wiki/Damnatio_ad_bestias","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Tsezarskaya_zabava.JPG","page_title":"Damnatio ad bestias","context_page_description":"Damnatio ad bestias — вид смертной казни в Древнем Риме посредством бросания осуждённого на растерзание зверям на цирковой арене. Этот вид казни был позаимствован Римом во II веке до н. э. с Древнего Востока, где аналогичное наказание существовало по меньшей мере с VI века до н. э..\\nВ I—III веках н. э. казнь применялась преимущественно для расправы с ранними христианами, благодаря чему наряду со смертью на кресте стала одной из самых известных причин мученической кончины христианских святых. С принятием империей христианства практика сохранилась против других преступников и была окончательно отменена лишь в 681 году.\\nВ переносном смысле «бросить на растерзание львам» означает «оставить кого-либо абсолютно неподготовленным в одиночестве среди агрессивных противников, практически без надежды избежать физического или морального ущерба»."},{"page_url":"https://it.wikipedia.org/wiki/Reggimenti_dell%27Esercito_Italiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/CoA_mil_ITA_rgt_logistico_garibaldi.png","page_title":"Reggimenti dell'Esercito Italiano","context_page_description":"I reggimenti dell'Esercito Italiano, attualmente in attività o dissolti, sono i seguenti.\\nLa voce presenta i reggimenti elencati per arma e specialità, non per organizzazione. Può accadere che la denominazione di una brigata cui un reggimento appartiene faccia riferimento ad una specialità diversa da quella del reggimento stesso: ad esempio, la Brigata paracadutisti folgore include il 185º Reggimento artiglieria paracadutisti \\"Folgore\\" e il Reggimento \\"Savoia Cavalleria\\", cioè reggimenti che non appartengono alla specialità \\"paracadutisti\\". Viceversa, il 185º Reggimento paracadutisti ricognizione acquisizione obiettivi \\"Folgore\\" non è inquadrato nella Brigata paracadutisti ma nel Comando forze speciali.\\nPuò accadere che una certa unità sia stata riconfigurata nel corso del tempo e che sia passata da un'arma o specialità ad un'altra."},{"page_url":"https://sv.wikipedia.org/wiki/Bristol_City_FC","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Ashtongateatyeo.JPG","page_title":"Bristol City FC","context_page_description":"Bristol City FC är en engelsk professionell fotbollsklubb i Bristol, grundad 1894. Hemmamatcherna spelas på Ashton Gate Stadium. Smeknamnet är The Robins. Klubben spelar sedan säsongen 2019/2020 i Championship."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B8%D1%81_%D0%92%D0%B0%D1%81%D0%B8%D1%9B%D0%B0_%D0%BE%D1%80%D0%B0%D1%85_(%D0%A8%D0%B0%D0%BB%D1%83%D0%B4%D0%BE%D0%B2%D0%B0%D1%86)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Zapis-0404-Saludovac-Vasica-orah_20150823_9947.jpg","page_title":"Запис Васића орах (Шалудовац)","context_page_description":"Запис Васића орах (Шалудовац) се налази на парцели чији је власник Васић Миодраг."},{"page_url":"https://simple.wikipedia.org/wiki/Guadalcanal_Campaign","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/USS_Washington_%28BB-56%29_firing_during_the_Second_Naval_Battle_of_Guadalcanal%2C_14_November_1942.jpg","page_title":"Guadalcanal Campaign","context_page_description":"The Guadalcanal Campaign was fought between August 7, 1942, and February 9, 1943, in the Pacific theatre of World War II. This campaign, which was a decisive and strategically important campaign of World War II, was fought on the ground, at sea, and in the air between Allied forces against Imperial Japanese forces. The fighting took place on and around the island of Guadalcanal in the southern Solomon Islands, and was the first major offensive launched by Allied forces against the Empire of Japan.\\nOn August 7, 1942, Allied forces, mainly from the United States, started landings on the islands of Guadalcanal, Tulagi, and Florida in the southern Solomons with the aim to make supply routes between the U.S., Australia, and New Zealand safer.\\nThe Battle of Guadalcanal was one of the first long campaigns in the Pacific."},{"page_url":"https://fr.wikipedia.org/wiki/Roumengoux","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Voie_verte_en_Pyr%C3%A9n%C3%A9es_Cathares%2C_panneau.jpg","page_title":"Roumengoux","context_page_description":"Roumengoux est une commune française, située dans le département de l'Ariège en région Occitanie.\\nSes habitants sont appelés les Roumengosiens."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0-%D0%A0%D0%BE%D0%BA-%D0%A1%D0%B5%D0%BD%D1%82-%D0%9C%D0%B0%D1%80%D0%B3%D0%B5%D1%80%D0%B8%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/ChaosMontpellierLeVieux.jpg","page_title":"Ла-Рок-Сент-Маргерит","context_page_description":"Ла-Рок-Сент-Маргери́т — коммуна во Франции, находится в регионе Юг — Пиренеи. Департамент — Аверон. Входит в состав кантона Пейрело. Округ коммуны — Мийо.\\nКод INSEE коммуны — 12204.\\nКоммуна расположена приблизительно в 530 км к югу от Парижа, в 155 км восточнее Тулузы, в 60 км к юго-востоку от Родеза."},{"page_url":"https://en.wikipedia.org/wiki/Chief_of_the_General_Staff_(United_Kingdom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Chief_of_the_General_Staff.svg","page_title":"Chief of the General Staff (United Kingdom)","context_page_description":"Chief of the General Staff has been the title of the professional head of the British Army since 1964. The CGS is a member of both the Chiefs of Staff Committee and the Army Board. Prior to 1964 the title was Chief of the Imperial General Staff. Since 1959, the post has been immediately subordinate to the Chief of the Defence Staff, the post held by the professional head of the British Armed Forces.\\nThe current Chief of the General Staff is General Sir Mark Carleton-Smith – having succeeded his predecessor, General Sir Nick Carter in June 2018."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%88%D8%A7%D8%B1%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Kabakum.JPG","page_title":"وارنا","context_page_description":"وارنا بلغاریائی بحیرہ اسود کے ساحل پر بلغاریہ کا سب سے بڑا اور بلغاریہ کا تیسرا سب سے بڑا شہر ہے۔"},{"page_url":"https://pl.wikipedia.org/wiki/Johnny_Whitworth","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Johnny_Whitworth_at_the_Chiller_Theatre_Expo_2017.jpg","page_title":"Johnny Whitworth","context_page_description":"Johnny Whitworth, właściwie Jonathan Lance Whitworth Jr. – amerykański aktor filmowy i telewizyjny."},{"page_url":"https://nds.wikipedia.org/wiki/Rendsborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Rendsburg_in_RD.png","page_title":"Rendsborg","context_page_description":"Rendsborg is een Stadt in Sleswig-Holsteen. Se liggt in de Midden van dat Bundsland un verbind de beid Landsdeelen Sleswig un Holsteen. Se liggt an de Noord-Oostsee-Kanal an de historisch Ossenweg un an de Düütsche Fährstraat.\\nDe Stadt hett 28.470 Inwahners up een Flach van 23,72 km² un is Sitt van de Verwalten van de Kreis Rendsborg-Eckernföör.\\nDe Stadt Rendsborg is üm 1150 grünnt wurrn un 1199 as „Reinoldesburch“ eerstmals schriftlich in de „Chronica Slavorum“ vun Arnold vun Lübeck erwähnt wurrn. Wiels de Oldstadt up een Eiland in de Grenzstroom Eider anleggt weer, hebbt se sück faaken streeden, of de Stadt nu to Sleswig oder doch to Holsteen hören de. In dat Johr 1253 har se dat Stadtrecht.\\nBekannt is ok de Rendsborger Hoochbrüch, de tüschen 1911 un 1913 ut Stahl makt wurrn is, un de Sweevfähr.\\nUt Rendsborg stammen de Singersche Hanne Haller un de Moderator Gerhard Delling."},{"page_url":"https://ht.wikipedia.org/wiki/Kyan_Khojandi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Kyan_Khojandi_au_Festival_Onze_Bouge.jpg","page_title":"Kyan Khojandi","context_page_description":"Kyan Khojandi, ki fèt 29 out 1982 nan Reims, se yon imoris, aktè, senaris ak reyalizatè franse."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%91%D0%BE%D1%86%D0%B2%D0%B0%D0%BD%D1%81%D0%BA%D0%B0_%D0%BA%D1%83%D0%BB%D1%82%D1%83%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Botswana_sunrise.jpg","page_title":"Боцванска култура","context_page_description":"Културата во Боцвана е типична јужноафриканска, но со одредено влијание од европските колонијални сили. Доминантен културен елемент во државата е цванскиот, и истиот се рефлектира во спортот, уметноста, музиката и останатите општествени сегменти."},{"page_url":"https://de.wikipedia.org/wiki/Die_Beshin-Wiese","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Pavel_Morozov.jpg","page_title":"Die Beshin-Wiese","context_page_description":"Die Beshin-Wiese ist ein halbstündiges, sowjetisches Filmfragment, das der Regisseur Sergei Eisenstein in den Jahren 1935 bis 1937 inszenierte. Der Filmtitel ist einer literarischen Vorlage von Iwan Turgenjew entlehnt, orientiert sich aber inhaltlich an dem Fall des nach offizieller sowjetischer Lesart von reaktionären Verwandten erschlagenen Pawel Morosow, dessen historische Authentizität aber zweifelhaft ist."},{"page_url":"https://en.wikipedia.org/wiki/List_of_high_schools_in_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Jewell_School.jpg","page_title":"List of high schools in Oregon","context_page_description":"This is a list of high schools in the U.S. state of Oregon. Schools are listed in alphabetical order by city, then in alphabetical order by school name. Schools that have closed are listed separately."},{"page_url":"https://pl.wikipedia.org/wiki/Frank_Biela","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Audi_R10_1.JPG","page_title":"Frank Biela","context_page_description":"Frank Biela – niemiecki kierowca wyścigowy, pięciokrotny zwycięzca 24-godzinnego wyścigu w Le Mans."},{"page_url":"https://en.wikipedia.org/wiki/Bordj_T%27har","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Bodj_Thar.jpg","page_title":"Bordj T'har","context_page_description":"Bordj T'har is a town and commune in Jijel Province, Algeria. According to the 1998 census it has a population of 4893."},{"page_url":"https://en.wikipedia.org/wiki/Ashitha_(writer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Maharajas_Entrance.jpg","page_title":"Ashitha (writer)","context_page_description":"Ashitha was an Indian writer of Malayalam literature, best known for her short stories, poems and translations. She contributed in popularising haiku poems in Malayalam through her translations and her stories were known for the sensitive portrayal of life. She was a recipient of the Kerala Sahitya Akademi Award for Story as well as other honours including Padmarajan Award, Lalithambika Anterjanam Smaraka Sahitya Award and Edasseri Award."},{"page_url":"https://pt.wikipedia.org/wiki/Bakili_Muluzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Muluzi.png","page_title":"Bakili Muluzi","context_page_description":"Elson Bakili Muluzi é um político malaviano. Foi presidente do Malawi de 1994 a 2004 e foi presidente do partido da Frente Democrática Unida até 2009."},{"page_url":"https://hu.wikipedia.org/wiki/J%C3%A9zus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Gustave_Dor%C3%A9_-_Crucifixion_of_Jesus.jpg","page_title":"Jézus","context_page_description":"Názáreti Jézus vagy Jézus Krisztus, gyakran csak Jézus vagy Krisztus, héberül: יהשוה a kereszténység központi alakja, a világtörténelem egyik legismertebb és legnagyobb hatású személye.\\nA többségi keresztény nézet szerint Jézus a Fiúisten, a Szentháromság tagja. Más keresztény felekezetek és a többi ábrahámi vallás Jézus-képe ettől eltér; mindegyik elveti Jézus isten-mivoltát. Az iszlám szerint Jézus csak az egyik a legfőbb próféták közül, a judaizmus szerint pedig hamis messiás volt; ahol a Talmud szól Jézusról, a lehető legsötétebb színben festi le.Születését a keresztény világ december 25-én, karácsonykor ünnepli, kereszthalálára nagypénteken emlékezik, föltámadását pedig húsvétkor ünnepli. Egykor feltételezett születési évétől számítják a mai világ időszámítását."},{"page_url":"https://tr.wikipedia.org/wiki/Ukrayna_ekonomisi","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/97/Ukr_world_GNI_percapita.PNG","page_title":"Ukrayna ekonomisi","context_page_description":"Ukrayna ekonomisi gelişmekte olan bir pazardır. Diğer Sovyet sonrası devletleri gibi, gayri safi yurt içi hasılanın 1991 yılında çökmesiyle Sovyetler Birliği'ni izleyen 10 yıl boyunca GSYİH hızla düşmüştür. 2008 yılında Büyük Durgunluk dünya çapında başlamış ve 2008-2009 Ukrayna ekonomik krizi olarak Ukrayna'ya ulaşmıştır; ancak, 2000'den 2008 yılına kadar hızla büyümüştür. Ekonomisi 2010 yılında iyileşmiş, ancak 2013 yılından bu yana Ukrayna ekonomisi ciddi bir darboğaza uğramıştır.\\n1990'larda bunalım hiperenflasyona neden olmuş ve önceki Ukrayna SSC gibi GSYİH'sının yarısından daha az ekonomik üretimi azalmıştır. GSYİH büyümesi 2000 yılında ilk kez kaydedilmiş ve bu sekiz yıl boyunca devam etmiştir. Bu büyüme, 2008 yılının küresel mali krizini durdurmuştur, ancak Ukrayna ekonomisi iyileşmiş ve 2010 yılının ilk çeyreğinde pozitif GSYİH büyümesi sağlanmıştır. Ekim 2013'te Ukrayna ekonomisi başka durgunluk içinde olmuştur. Rusya'ya önceki yaz Ukrayna ihracatı büyük ölçüde Rusya tarafından sıkı sınırlama ve gümrük kontrolü nedeniyle kötüleşmiştir."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B9_%D0%B3%D0%BB%D0%BE%D0%B1%D1%83%D1%81_(%D0%BF%D1%80%D0%B5%D0%BC%D0%B8%D1%8F,_1989)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Michael_Caine_%28Nobel_Peace_Prize_Concert_2008%29_cropped.jpg","page_title":"Золотой глобус (премия, 1989)","context_page_description":"46-я церемония вручения наград премии «Золотой глобус» за заслуги в области кинематографа и телевидения за 1988 год состоялась 28 января 1989 года в Beverly Hilton Hotel. Номинанты были объявлены 4 января 1989.\\nОбладательницами премии за лучшую женскую роль в драматическом фильме стали сразу три актрисы: Джоди Фостер, Ширли Маклейн и Сигурни Уивер, воплотившая образ этолога Дайан Фосси в биографической драме «Гориллы в тумане», причём Сигурни Уивер досталась ещё награда за женскую роль второго плана в фильме «Деловая девушка»."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_ente%C3%B3genos","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Atropa_bella-donna0.jpg","page_title":"Lista de enteógenos","context_page_description":"Essa lista contém as substâncias consideradas enteógenos.\\nExibe o princípio ativo e todas plantas, fungos ou animais que contém determinada substância.\\nA palavra enteógeno, que significa literalmente \\"manifestação interior do divino\\", deriva de uma palavra grega que refere à comunhão religiosa sob efeito de substâncias visionárias."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A2%E3%83%B3%E3%83%BB%E3%83%87%E3%83%BB%E3%82%B0%E3%83%AA%E3%83%8F%E3%83%AB%E3%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/JuanGrijalvaCuellar.jpg","page_title":"フアン・デ・グリハルバ","context_page_description":"フアン・デ・グリハルバは、スペインのコンキスタドール。幾人かの作家は彼がディエゴ・ベラスケスの一族の出身であるとする。\\n彼は1508年にイスパニョーラ島を、1511年にキューバを訪れた。\\n彼はメキシコを探検した最も初期の探検家の内の一人であった。1518年4月に4隻の船を従えキューバを去った。エルナン・コルテスによれば、170名がグリハルバと共に行ったとするが、ペドロ・マルティアによれば300名だとされる。\\nグリハルバは、メキシコ南部のグアニグアニコ岬に5月1日に到着した。メキシコのグリハルバ川は彼にちなんで命名された。ベルナル・ディアス・デル・カスティリョはその著書でグリハルバの航海について著述した。\\n彼は1527年にニカラグアで死去した。"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%8C%8D%EC%9A%A9_%EC%BD%94%EB%9E%80%EB%8F%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/20111023_ssangyong_korando_1.jpg","page_title":"쌍용 코란도","context_page_description":"쌍용 코란도는 쌍용자동차의 준중형 스포츠 유틸리티 자동차로 현존하는 대한민국의 승용차 중에서 최장수를 자랑한다. 코란도의 어원은 '한국인은 할 수 있다'를 의미하는 것으로 알려졌으나, '한국인의 의지와 힘으로 개발한 차', '한국 땅을 뒤덮는 차', '한국을 지배하는 차' 등의 이니셜을 가지고 있기도 하다."},{"page_url":"https://mg.wikipedia.org/wiki/Willi_Schulz","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Willi_Schulz_%281968%29.jpg","page_title":"Willi Schulz","context_page_description":"Willi Schulz dia mpilalao baolina kitra mizaka ny zom-pirenen'i Alemaina teraka ny 4 Oktobra 1938 tao Bochum"},{"page_url":"https://en.wikipedia.org/wiki/List_of_Korean_traditional_festivals","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Korean_pancake-Jindallae_hwajeon-03.jpg","page_title":"List of Korean traditional festivals","context_page_description":"Korean Traditional Festivals are the Korean national and local festivals that have been continued among Korean people throughout its long history. Korean traditional festivals are largely based on its agricultural rituals and myths. \\"Seollal, New Year's Day\\" and \\"Chuseok, Harvest Festival\\" are regarded as the biggest festivals."},{"page_url":"https://fr.wikipedia.org/wiki/Nissan_Violet_160J","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Datsport_Rally_Team_1980_-_Barry_Burns_%28Driver%29_and_David_Milne_%28Co-Driver%29_1981_South_Australian_Rally_Champions.jpg","page_title":"Nissan Violet 160J","context_page_description":"La Nissan Violet 160J est le modèle du constructeur nippon Nissan ayant obtenu le plus de succès en championnat du monde des rallyes."},{"page_url":"https://id.wikipedia.org/wiki/Tergu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Tergu%2C_panorama_%2802%29.jpg","page_title":"Tergu","context_page_description":"Tergu adalah sebuah komune yang terletak di Provinsi Sassari, Sardinia, Italia. Kota ini berada di ketinggian 284 meter dengan jumlah penduduk sebesar 595 jiwa dan luas wilayah 36,88 km²."},{"page_url":"https://en.wikipedia.org/wiki/Smoke_Hole_Canyon","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Smoke_Hole_-_Tibicen_cicada_1.jpg","page_title":"Smoke Hole Canyon","context_page_description":"Smoke Hole Canyon — traditionally called The Smoke Holes and later simply Smoke Hole — is a rugged 20 miles long gorge carved by the South Branch Potomac River in the Allegheny Mountains of eastern West Virginia, United States. The area is rather isolated and remote with parts accessible only by boat or on foot.\\nDefined to the east by Cave Mountain and to the west by North Fork Mountain, Smoke Hole has been part of the Monongahela National Forest's Spruce Knob-Seneca Rocks National Recreation Area since 1965, although some of it is still private land. Formerly, the area was home to a scattered community of family homesteads, storied for their isolation, traditional lifestyles, and skilled production of the illicit liquor known as \\"moonshine\\". Today, The Nature Conservancy considers Smoke Hole and the surrounding mountains to be \\"one of the most biologically rich places in the East\\", especially as regards its rare plant communities. It included the Canyon as part of the greater Smoke Hole-North Mountain Bioreserve during its \\"Last Great Places\\" campaign."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Karstquellen_in_Bayern","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Aubachquelle_%28Menchau%29.JPG","page_title":"Liste von Karstquellen in Bayern","context_page_description":"Dies ist eine Liste von Karstquellen in Bayern. Sie enthält eine Auswahl von Karstquellen in Bayern."},{"page_url":"https://es.wikipedia.org/wiki/Luis_Miguel_Domingu%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Corrida_de_toros_en_la_plaza_de_%27El_Txofre%27_%2867_de_79%29_-_Fondo_Mar%C3%ADn-Kutxa_Fototeka_%28cropped%29.jpg","page_title":"Luis Miguel Dominguín","context_page_description":"Luis Miguel González Lucas, más conocido como Luis Miguel Dominguín fue un torero español.​"},{"page_url":"https://en.wikipedia.org/wiki/The_Story_So_Far_(band)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Olgas_Rock_2015_The_Story_So_Far_02.jpg","page_title":"The Story So Far (band)","context_page_description":"The Story So Far is an American pop punk band from Walnut Creek, California, formed in 2007. They are currently signed to Pure Noise Records and have released 4 studio albums."},{"page_url":"https://en.wikipedia.org/wiki/Mkrtich_Khrimian","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Aivazovsky_-_Catholicos_Khrimyan_Airik_near_Echmiadzin.jpg","page_title":"Mkrtich Khrimian","context_page_description":"Mkrtich Khrimian was an Armenian Apostolic Church leader, educator, and publisher who served as Catholicos of All Armenians from 1893 to 1907. During this period he was known as Mkrtich I of Van.\\nA native of Van, one of the largest cities in Turkish Armenia, Khrimian became a celibate priest in 1854 after the death of his wife and daughter. In the 1850s and 1860s he served as the abbot of two important monasteries in Turkish Armenia: Varagavank near Van and Surb Karapet Monastery near Mush. During this period he established schools and journals in both monasteries. He served as Patriarch of Constantinople—the most influential figure within the Ottoman Armenian community—from 1869 to 1873 and resigned due to pressure from the Ottoman government which saw him as a threat. He was the head of the Armenian delegation at the 1878 Congress of Berlin. Returning from Europe, he encouraged Armenian peasants to follow the example of Christian Balkan peoples by launching an armed struggle for autonomy or independence from the Ottoman Turks.\\nBetween 1879 and 1885 he served as prelate of Van, after which he was forced into exile to Jerusalem."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Sauveur-Lendelin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/FranceNormandieSaintSauveurLendelinEgliseMairie.jpg","page_title":"Saint-Sauveur-Lendelin","context_page_description":"Saint-Sauveur-Lendelin is a former commune in the Manche department in Normandy in north-western France. On 1 January 2019, it was merged into the new commune Saint-Sauveur-Villages."},{"page_url":"https://es.wikipedia.org/wiki/Rub%C3%A9n_Magdalena","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Rub%C3%A9n_Magdalena_%28Boca%29_-_El_Gr%C3%A1fico_2306.jpg","page_title":"Rubén Magdalena","context_page_description":"Rubén Alfredo Magdalena también conocido por su apodo «Gato» fue un futbolista argentino que se desempeñaba en la posición de defensor central.\\nSurgido de las inferiores del Club Atlético Boca Juniors, dio sus primeros pasos en Arsenal de Llavallol, quien contaba con un acuerdo de fillal con el «xeneize». De esta manera llegó a la institución para terminar de formarse.\\nPrevio a su llegada a Boca Juniors, fue tentador a jugar en River Plate, llegando a formar parte de la reserva de aquel equipo, sin embargo se decantó para formar parte del «xeneize».\\nDebutó en la Primera División de Argentina en el año 1963. En el club «xeneize» disputó un total de 83 partidos y no logró convertir goles. A nivel colectivo, se consagró campeón de la Primera División de Argentina en dos oportunidades, en los campeonatos de 1964 y 1965, logrando así el bicampeonato.\\nSe caracterizaba por ser un defensor que anteponía la buena técnica y la agilidad a la reciedumbre. Sus movimientos mostraban capacidad de anticipo y buena coordinación de tiempo y distancia."},{"page_url":"https://en.wikipedia.org/wiki/1847_Pennsylvania_gubernatorial_election","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/FrancisShunk.jpg","page_title":"1847 Pennsylvania gubernatorial election","context_page_description":"The Pennsylvania gubernatorial election of 1847 occurred on October 12, 1847. Incumbent Democratic governor Francis R. Shunk defeated Whig candidate James Irvin to win re-election."},{"page_url":"https://sv.wikipedia.org/wiki/Johan_Jakob_Tikkanen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Johan_Jakob_Tikkanen.jpg","page_title":"Johan Jakob Tikkanen","context_page_description":"Johan Jakob Tikkanen, född 7 december 1857 i Helsingfors, död där 20 juni 1930, var en finlandssvensk konsthistoriker. Han var Finlands första professor i konsthistoria. Han var son till Paavo Tikkanen och farfar till Henrik Tikkanen.\\nTikkanen blev student 1876, filosofie kandidat 1880, docent i estetik och konsthistoria vid Helsingfors universitet 1884, extra ordinarie professor i samma ämne 1897 och ordinarie professor 1920–26. Efter en tvåårig resa i Tyskland och Italien skrev han sitt första konsthistoriska arbete, Der malerische Styl Giottos, som följdes av en ikonografisk undersökning, Die Genesismosaiken von S. Marco in Venedig, och av det stora verket Die Psalterillustration im Mittelalter. Venedig och dess konst är en populärt hållen överblick. Sedan 1892 var han Finska konstföreningens sekreterare; vid dennas 50-åriga jubileum utgav han en historik, Finska konstföreningen 1846–1896. Han skrev många artiklar i finländska och utländska tidskrifter. Större arbeten från de senare åren är specialstudien Die Beinstellung in der Kunstgeschichte och Madonnabildens historia och den kristna konsten."},{"page_url":"https://en.wikipedia.org/wiki/Abantiades_hyalinatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Abantiades_hyalinatus.jpg","page_title":"Abantiades hyalinatus","context_page_description":"Abantiades hyalinatus is a moth of the family Hepialidae. It is found in Australia, from southern Queensland to Tasmania.\\nThe wingspan is 10–12 cm."},{"page_url":"https://cs.wikipedia.org/wiki/Katr%C3%A1ni%C4%8Dka_r%C5%AFznolist%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Crambe_corvini_Sturm31.jpg","page_title":"Katránička různolistá","context_page_description":"Katránička různolistá je planě rostoucí rostlina s drobnými bílými květy, je to jediný druh monotypického rodu katránička."},{"page_url":"https://en.wikipedia.org/wiki/Guatemala_at_the_2008_Summer_Olympics","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Beijing_Workers_Arena.jpg","page_title":"Guatemala at the 2008 Summer Olympics","context_page_description":"Guatemala competed in the 2008 Summer Olympics, held in Beijing, People's Republic of China from August 8 to August 24, 2008. In what was the country's fourteenth Summer Olympics since its debut at the 1952 Summer Olympics in Helsinki, Finland. A total of twelve athletes competed in nine sports and twelve distinct events. It was the lowest number of participants for Guatemala since the 1980 Games in Moscow, USSR. Three of the twelve athletes were taking part in their second Olympics, and one of them, race walker Luis García, participated in his fourth. In any event that involved a progression through rounds, the Guatemalan athletes did not advance past the first round; as of the Beijing Olympics, there had yet to be a Guatemalan medalist. At the opening ceremony, badminton player Kevin Cordón bore Guatemala's flag."},{"page_url":"https://fr.wikipedia.org/wiki/Vadencourt_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Vadencourt25.jpg","page_title":"Vadencourt (Aisne)","context_page_description":"Vadencourt est une commune française située dans le département de l'Aisne, en région Hauts-de-France.\\nSes habitants sont les Vadencourtois et les Vadencourtoises."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A2%D9%84%D8%A8%D8%A7%D9%86%DB%8C%D8%8C_%D8%A7%D9%88%D8%B1%D9%82%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Downtown_Albany_Oregon.JPG","page_title":"آلبانی، اورقن","context_page_description":"آلبانی، اورقن آمریکانین اورقن ایالتیندا یئر آلان بیر شهردیر و ۴۵٫۹۷ کیلومتر موربّع ساحه سی وار. ۲۰۱۰-جی ایلين نۆفوس ساییمی اساسیندا ۵۰۱۵۸ نفر و اها‌لی سیخلیغی ۱۱۰۴٫۱ اینسان کیلومتر موربّع دیر. بۇ شهر متر دنیز سئوییه‌سیندن اۇجالیقیدا یئرلشیر. ایالتین % ۴۶ مئشه‌لر ایحاطه ائدیب. بۇ مشه‌لرین ۶۰٪ - فدرال دؤولتین مۆلکودور.\\n۲۰۰۸-جی ایلین رقملرینه گؤره ۳۳٫۰۰۰ قدر موستانق آت بۇ مشه‌لرده واردیر."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%A1%E3%83%AA%E3%82%AB%E5%90%88%E8%A1%86%E5%9B%BD%E5%B7%9E%E7%9F%A5%E4%BA%8B%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Gov-Mike-DeWine_%28cropped%29.jpg","page_title":"アメリカ合衆国州知事一覧","context_page_description":"アメリカ合衆国州知事一覧は、アメリカ合衆国の州知事の一覧。全50州のうち26人が共和党、24人が民主党の知事である。また下記に、アメリカ合衆国の海外領土の行政組織体の知事一覧も含む。"},{"page_url":"https://jv.wikipedia.org/wiki/Kaktus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Cephalocereus_columna-trajani_rev.jpg","page_title":"Kaktus","context_page_description":"Kaktus iku jeneng kang diwènèhaké kanggo anggota tetuwuhan ngembang famili Cactaceae.\\nKaktus bisa tuwuh ing wektu kang suwé tanpa banyu. Kaktus biyasa tinemu ing laladan-laladan kang garing. Tembung jamak kanggo kaktus ya iku kakti. Kaktus duwé oyot kang dawa kanggo golèk banyu lan ngambakaké panyerepan banyu sajeroning lemah. Banyu kang diserep kaktus disimpen sajeroning ruwang ing batangé. Kaktus uga duwé godhong kang malih wangun dadi eri saéngga bisa ngurangi panguapan banyu liwat godhong.{ Mula, kaktus bisa tuwuh kanthi wektu kang suwé tanpa banyu."},{"page_url":"https://fr.wikipedia.org/wiki/Mon_ex-femme_d%C3%A9tective","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Robert_Armstrong.JPG","page_title":"Mon ex-femme détective","context_page_description":"Mon ex-femme détective est un film américain réalisé par Stephen Roberts, sorti en 1936."},{"page_url":"https://en.wikipedia.org/wiki/Sassetti_Chapel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Cappella_Sassetti_Resurrection_of_the_Boy.jpg","page_title":"Sassetti Chapel","context_page_description":"The Sassetti Chapel is a chapel in the basilica of Santa Trinita in Florence, Italy. It is especially notable for its frescoes of the Stories of St. Francis, considered Domenico Ghirlandaio's masterwork."},{"page_url":"https://en.wikipedia.org/wiki/Conscience-in-Media_Award","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/Jonathan_Kozol_at_Pomona_College_17_April_2003.jpg","page_title":"Conscience-in-Media Award","context_page_description":"The Conscience-in-Media Award is presented by the American Society of Journalists and Authors to journalists that the society deems worthy of recognition for their distinctive contributions. The award is not given out often, and is awarded to those journalists which the ASJA feels have demonstrated integrity to journalistic values, while enduring personal costs to themselves. Candidates are decided by an initial vote of the ASJA's First Amendment Committee, which must then be confirmed by a separate vote of the ASJA's Board of Directors.\\nThe award has been presented a total of twelve times since the first award was given out in 1975. Notable recipients have included Jonathan Kozol, for work researching homelessness while writing his book Rachel and Her Children, Richard Behar and Paulette Cooper, for separate pieces investigating the Church of Scientology, and Anna Rosmus, for her investigation into the Nazi history of her hometown in Passau, Germany. In 2005, the committee voted to present the Award to Judith Miller, but this vote was later overturned by a unanimous decision of the board not to honor Miller with the award."},{"page_url":"https://en.wikipedia.org/wiki/Grade_II*_listed_buildings_in_Kettering_(borough)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Redundant_church_used_as_Field_Centre%2C_Newton_in_the_Willows_-_geograph.org.uk_-_151243.jpg","page_title":"Grade II* listed buildings in Kettering (borough)","context_page_description":"There are over 20,000 Grade II* listed buildings in England. This page is a list of these buildings in the district of Kettering in Northamptonshire."},{"page_url":"https://ceb.wikipedia.org/wiki/Warsaw_(kapital_sa_kondado_sa_Tinipong_Bansa,_Indiana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/US-IN-Warsaw.png","page_title":"Warsaw (kapital sa kondado sa Tinipong Bansa, Indiana)","context_page_description":"Kapital sa kondado ang Warsaw sa Tinipong Bansa. Nahimutang ni sa kondado sa Kosciusko County ug estado sa Indiana, sa sidlakang bahin sa nasod, 800 km sa kasadpan sa Washington, D.C. 252 metros ibabaw sa dagat kahaboga ang nahimutangan sa Warsaw, ug adunay 13,559 ka molupyo. Warsaw nga nahimutang sa lanaw sa Center Lake ang ulohan sa nasod.\\nAng yuta palibot sa Warsaw kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 271 ka metro ug 3.3 km sa habagatan sa Warsaw. Dunay mga 19 ka tawo kada kilometro kwadrado sa palibot sa Warsaw may gamay nga populasyon. Warsaw ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Warsaw. Sa rehiyon palibot sa Warsaw, mga kanal, ug mga lanaw talagsaon komon.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Enero, sa -8 °C. Ang kasarangang pag-ulan 1,194 milimetro matag tuig. Ang kinabasaan nga bulan Abril, sa 137 milimetro nga ulan, ug ang kinaugahan Marso, sa 60 milimetro."},{"page_url":"https://es.wikipedia.org/wiki/Savigny_(Mancha)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/FranceNormandieSavignyEglise.jpg","page_title":"Savigny (Mancha)","context_page_description":"Savigny es una población y comuna francesa, situada en la región de Baja Normandía, departamento de Mancha, en el distrito de Coutances y cantón de Cerisy-la-Salle."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%99%E1%83%9D%E1%83%A0%E1%83%9D%E1%83%9C%E1%83%98%E1%83%93%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Apollo_and_Coronis_LACMA_M.83.119.2.jpg","page_title":"კორონიდა","context_page_description":"კორონიდა — აპოლონის საყვარელი და ერთ-ერთი სტიქიური ძალის ნიმფა ბერძნულ მითოლოგიაში. იგი ლაპითელთა მეფის, ფლეგიასის ქალიშვილია. ზოდი ვერსიით, მისი მამა იყო აზანი, არკადიის მეფე. მისი ვაჟი, ასკლეპიოსი, არის ბერძნული მედიცინის ღმერთი. ორსულობის დროს მან უღალატა აპოლონს მოკვდავ მამაკაცთან, სახელად ისქისთან, რის გამოც არტემიდამ ამ საქციელისთვის დასაჯა და ისარი ესროლა. როცა ისრით სასიკვდილოდ დაჭრილი კორონიდა კოცონზე იწვოდა, აპოლონმა გადაარჩინა მათი შვილი საკეისრო კვეთით, თუმცა საყვარლის შველა ვეღარ მოახერხა. ამის გამო ფლეგიასმა აპოლონს არ აპატია ასულის შერცხვენა. კორონიდა გარდაცვალების შემდეგ თანავარსკვლავედად გადაიქცა, ხოლო ჩვილი აპოლონმა გასაზრდელად კენტავრ ქირონს მიაბარა, რომელმაც ექიმობა და ნადირობა ასწავლა."},{"page_url":"https://id.wikipedia.org/wiki/Sean_Patrick_Maloney","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Sean_Patrick_Maloney_talks_to_a_voter_in_Walden%2C_NY.jpg","page_title":"Sean Patrick Maloney","context_page_description":"Sean Patrick Maloney adalah seorang politikus asal Amerika Serikat. Ia adalah perwakilan distrik ke-18 New York dalam Dewan Perwakilan Amerika Serikat. Ia adalah anggota perwakilan Amerika Serikat dari Negara Bagian New York pertama yang secara terbuka mengatakan bahwa dirinya menyukai sesama jenis.\\nMaloney kini juga bergabung dalam komite-komite seperti House Permanent Select Committee on Intelligence, House Transportation and Infrastructure Committee, dan House Agriculture Committee. Dalam House Permanent Select Committee on Intelligence, ia bertanggung jawab dalam mengawasi agensi intelejen negara termasuk komponen-komponen dari Depatermen Pertahanan, Keamanan Tanah Air, Peradilan, Negara, Perbendaharaan, dan Tenaga. Dalam House Transportation and Infrastructure Committee, ia berperan sebagai Ketua Subkomite Penjagaan Pantai dan Transportasi Laut yang bertugas mengawasi dan mendukung penjagaan pantai, mengatur pelayaran, pelabuhan, dan jalan air, serta melindungi lingkungan. Sementara dalam House Agriculture Committee, ia berperan dalam memperjuangkan perlindungan program-program yang penting dan unik, yang dapat membawa keuntungan kepada para petani lokal di Lembah Hudson."},{"page_url":"https://pt.wikipedia.org/wiki/Klaus_Lindenberger","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Klaus_Lindenberger_-_LASK_Linz.jpg","page_title":"Klaus Lindenberger","context_page_description":"Klaus Lindenberger é um futebolista austríaco que atua como goleiro.\\nDedicou 9 anos de sua carreira ao LASK Linz, equipe que defendeu entre 1979 e 1988, com um breve retorno em 2004. Jogou também pelo Swarovski Tirol, entre 1988 e 1991.\\nSe despediu pela primeira vez do futebol em 1993, de volta ao LASK, aos 35 anos. Ainda atuaria em clubes amadores de seu país e da Alemanha até se aposentar novamente, desta vez com 52 anos de idade. Porém, retomou a carreira novamente em 2013, agora para defender o SV Urfahr, time amador que disputa a \\"1. Klasse Mitte\\", em paralelo com a função de treinador de goleiros da Seleção Israelense. Também foi treinador do LASK entre 2008 e 2009."},{"page_url":"https://ur.wikipedia.org/wiki/%DA%88%DB%8C%D9%86%D8%A8%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Denbigh_Library_-_geograph.org.uk_-_666848.jpg","page_title":"ڈینبی","context_page_description":"ڈینبی ویلز کا ایک رہائشی علاقہ ہے۔"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%9E%E0%AF%8D%E0%AE%9A%E0%AE%BE%E0%AE%AA%E0%AE%BF%E0%AE%A4%E0%AF%8D_%E0%AE%A4%E0%AE%BF%E0%AE%B0%E0%AF%81%E0%AE%B5%E0%AE%BF%E0%AE%B4%E0%AE%BE%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Haryali_Teej.jpg","page_title":"பஞ்சாபித் திருவிழாக்கள்","context_page_description":"பஞ்சாபியர் ஓரளவுச் சமயநீக்கப் பொருண்மையுள்ள பல திருவிழாக்களைக் கொண்டாடி வருகின்றனர், இவை பண்பாட்டுத் திருவிழாக்களாக அனைத்து சமய மக்களாலும் கொண்டாடப்படுகின்றன. திருவிழா கொண்டாட்ட நாள் பஞ்சாபியர் கால அட்டவணைப்படி முடிவு செய்யப்படுகின்றன.\\nபஞ்சாபித் திருவிழாக்கள் கீழே பட்டியலிடப்படுகின்றன."},{"page_url":"https://cs.wikipedia.org/wiki/Doc_Pomus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Uffe_Bode%2C_Doc_Pomus%2C_Sol_Yaged%2C_John_Levy_and_Rex_William_Stuart_1947.jpg","page_title":"Doc Pomus","context_page_description":"Doc Pomus, vlastním jménem Jerome Solon Felder, byl americký zpěvák a autor písní. Narodil se do židovské rodiny v Brooklynu, jeho mladším bratrem byl právník Raoul Felder. Fanouškem bluesové hudby se stal poté, co uslyšel desku Big Joe Turnera. Jako teenager přijal pseudonym Doc Pomus a začal vystupovat po klubech. Později napsal řadu písní ve spolupráci s Mortem Shumanem. Jeho písně hráli například Brian Wilson, Bob Dylan či anglická kapela Status Quo. V roce 1992 byl uveden do Rokenrolové síně slávy a o dvacet let později do její bluesové obdoby."},{"page_url":"https://fr.wikipedia.org/wiki/Forces_arm%C3%A9es_luxembourgeoises","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Nato_awacs.jpg","page_title":"Forces armées luxembourgeoises","context_page_description":"L’Armée luxembourgeoise, est le nom des forces militaires du Grand-Duché de Luxembourg. Elle comprend des unités terrestres, regroupant moins de mille hommes. Le Luxembourg possède un petit navire de marine basé à Zeebruges, et depuis peu un gros avion de transport militaire de type Airbus. Par ailleurs, plusieurs avions-radars américains \\"Awacs\\" affectés à l'OTAN sont immatriculés au Grand-Duché.\\nLe chef de l'armée est le grand-duc de Luxembourg, mais le contrôle effectif revient au ministre de la Défense sous l'égide du ministre des Affaires étrangères."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Geschichte_Finnlands","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Ville_Ritola_1928.jpg","page_title":"Olympische Geschichte Finnlands","context_page_description":"Die olympische Geschichte Finnlands begann 1906 mit der privaten Teilnahme vier finnischer Athleten bei den inoffiziellen Olympischen Zwischenspielen 1906 in Athen. 1907 wurde der Finne Baron Reinhold Felix von Willebrand in das Internationale Olympische Komitee gewählt, kurz darauf gründete Finnland sein Nationales Olympisches Komitee Suomen Olympiakomitea und nahm an den Olympischen Sommerspielen 1908 in London erstmals offiziell teil. Bis zu den Spielen im Jahr Sommerspielen 1912 gehörte Finnland als Autonomes Großfürstentum noch zum Russischen Reich; die Ergebnisse wurden jedoch von denen Russlands getrennt. Erst 1920 nahm Finnland als eigenständiges Land teil und war seither bei allen Olympischen Sommerspielen und den ab 1924 stattfindenden Winterspielen immer präsent. Jugendliche Athleten traten bei allen bislang ausgetragenen Olympischen Jugendspielen an."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B2%D5%B8%D6%82%D5%AC%D5%AB%D5%B6%D5%B5%D5%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Town_hall_of_Bouligneux.JPG","page_title":"Բուլինյո","context_page_description":"Բուլինյո, կոմունա Ֆրանսիայում, մտնում է Ռոն Ալպեր մարզի կազմի մեջ։ Մտնում է Վիլլար դե դոմբ կանտոնի կազմի մեջ։ Կոմունայի օկրուգը Բուրկ ան Բրեսն է։\\nԿոմունայի INSEE կոդը՝ 01052։"},{"page_url":"https://vi.wikipedia.org/wiki/H%E1%BB%8D_C%C3%A1_%C4%91%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Synanceia_nana.JPG","page_title":"Họ Cá đá","context_page_description":"Họ Cá đá hay họ Cá mao mặt quỷ, tên khoa học Synanceiidae, là một họ cá theo truyền thống xếp trong bộ Cá mù làn, nhưng gần đây được một số tác giả xếp trong bộ Cá vược, được tìm thấy tại Ấn Độ Dương - Thái Bình Dương. Chúng chủ yếu là cá biển, mặc dù một số loài được biết là sống ở vùng nước ngọt hoặc nước lợ. Các loài khác nhau của họ này được gọi không chính thức như cá đá, cá mao tiên, cá mao quỷ, cá mặt quỷ. Chi điển hình của họ này là Synanceia Bloch & Schneider, 1801. Họ này đôi khi được đặt trong họ Scorpaenidae như là phân họ Synanceiinae. Loài điển hình của họ này là cá mặt quỷ."},{"page_url":"https://es.wikipedia.org/wiki/Midway_(condado_de_Washington,_Pensilvania)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/Map_of_Midway%2C_Washington_County%2C_Pennsylvania_Highlighted.png","page_title":"Midway (condado de Washington, Pensilvania)","context_page_description":"Midway es un borough ubicado en el condado de Washington en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 982 habitantes y una densidad poblacional de 859 personas por km².​"},{"page_url":"https://es.wikipedia.org/wiki/N%C3%A1poles","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Giambattista_Basile.jpg","page_title":"Nápoles","context_page_description":"Nápoles es la ciudad más poblada del sur de Italia, capital de la región de Campania, y de la Ciudad metropolitana de Nápoles. Dentro de los términos del municipio de Nápoles viven algo menos de un millón de habitantes, ​ que, unidos a los de la ciudad metropolitana, se elevan a más de tres millones. Está situada a medio camino entre el monte Vesubio y otra área volcánica, los Campos Flégreos. Da nombre al golfo a cuyas orillas se asienta.\\nTiene una enorme riqueza histórica, artística, cultural y gastronómica, lo que llevó a la Unesco a declarar su centro histórico​, Patrimonio de la Humanidad.​ Griegos, romanos, bizantinos, normandos, franceses y españoles han dejado su huella en Nápoles. Estuvo brevemente bajo dominación austríaca en las primeras décadas del siglo XVIII, tras la cual se convirtió en el centro político del reino independiente de Nápoles y, posteriormente, de las Dos Sicilias, gobernado por los Borbones. En el año 1861 pasó a formar parte del Reino de Italia. En el siglo XX, durante la etapa fascista y en la reconstrucción subsiguiente a la Segunda Guerra Mundial se edificó gran parte de la periferia."},{"page_url":"https://it.wikipedia.org/wiki/Catena_dell%27Alaska","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Mountains_of_Denali_National_Park_ENBLA02.jpg","page_title":"Catena dell'Alaska","context_page_description":"La Catena dell'Alaska è una catena montuosa situata nella regione centro-meridionale dello Stato americano dell'Alaska. In questo gruppo montuoso è presente la montagna più alta del Nord America, il Monte Denali.63°04′10″N 151°00′21″W"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9C%D7%9E%D7%91%D7%95%D7%A8%D7%92%D7%99%D7%A0%D7%99_400_GT","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Paris_-_RM_Sotheby%E2%80%99s_2018_-_Lamborghini_400_GT_2%2B2_-_1967_-_010.jpg","page_title":"למבורגיני 400 GT","context_page_description":"למבורגיני 400 GT היא מכונית ספורט בסגנון גראן טוריסמו מתוצרת יצרנית מכוניות הספורט האיטלקית למבורגיני אשר יוצרה בין השנים 1966 – 1968 בעיירה Sant'Agata Bolognese במטרופולין של בולוניה במחוז אמיליה-רומאניה באיטליה."},{"page_url":"https://nl.wikipedia.org/wiki/George_Nevinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/WaterPoloNevinson.jpg","page_title":"George Nevinson","context_page_description":"George Wilfred Nevinson was een Brits waterpolospeler.\\nGeorge Nevinson nam als waterpoloër eenmaal deel aan de Olympische Spelen; in 1908. In 1908 maakte hij deel uit van het Britse team dat het goud wist te veroveren."},{"page_url":"https://no.wikipedia.org/wiki/EuroBonus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/SAS_Boeing.png","page_title":"EuroBonus","context_page_description":"EuroBonus er et bonusprogram og konkurransevirkemiddel som tilbys av ni europeiske flyselskap. Programmet ble lansert av Scandinavian Airlines i 1992. De hadde ca. 3,4 millioner medlemmer i 2014."},{"page_url":"https://fi.wikipedia.org/wiki/Paimionjoki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Hirsj%C3%A4rvi.jpg","page_title":"Paimionjoki","context_page_description":"Paimionjoki on Paimionjoen vesistön Varsinais-Suomessa virtaava 110 kilometriä pitkä laskujoki, jonka valuma-alue rajoittuu Aurajoen, Kokemäenjoen, Karjaanjoen, Uskelanjoen ja Halikonjoen vesistöalueisiin. Paimionjoki on Saaristomereen laskevista joista suurin sekä valuma-alueeltaan että virtaamaltaan ja se laskee Paimionlahteen. Lounais-Suomen vesistöalueista Paimionjoki on neljänneksi suurin.\\nJoki saa alkunsa Somerniemeltä Somerolta ja virtaa siitä eteenpäin Hämeen Härkätien tuntumassa, Koski Tl:n kautta Marttilaan ja edelleen Tarvasjoelle, kulkee lyhyen matkaa Liedon alueella ja päätyy Paimioon, jossa se laskee Paimionlahteen. Joen vesistöalueeseen kuuluu myös suuri osa entisestä Karinaisten kunnasta nykyisellä Pöytyällä ja osia eteläisestä Tammelasta.\\nPaimionjoki on ollut tärkeä vararaakavesilähde Turun vesilaitokselle, joka otti ennen siitä vettä ja säännösteli sitä veden riittävyyden turvaamiseksi. Tämän takia joki on padottu kahdesta kohtaa ylä- ja keskijuoksulta. Joki on lisäksi padottu alajuoksulta kolmesta kohtaa vesivoiman tarpeisiin."},{"page_url":"https://en.wikipedia.org/wiki/The_Voice_Project_(music)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Voice_Project%2C_I_Reach_Right_Up_To_The_Sun_-_5796.jpg","page_title":"The Voice Project (music)","context_page_description":"The Voice Project is an open-access singing project, based in Norwich, England. It is a Registered Charity and a Limited Company. It was created by singers Siân Croose and Jonathan Baker in 2008 and since then it has involved hundreds of singers in performances of new vocal music as well as workshops designed to build vocal confidence and explore a wide variety of uplifting and inspiring vocal music. In 2018, it established a choir in Brighton and has run two projects with performances in Sussex since then.\\nMusic is taught by ear, and there is no need to be able to read music. Scores and sound files are provided to support individual learning, outside of rehearsals. Typically, two performances are given each year, one in the late Spring / early Summer, the other in December or January. Performances are often site-specific, making use of the all the space available to tell a story.\\nSiân Croose is a singer, conductor and performance maker with over 30 years experience creating and directing music projects in the UK. After an apprenticeship in bands and alternative theatre, she trained on the Community Music programme founded by John Stevens."},{"page_url":"https://it.wikipedia.org/wiki/Ch%C3%A2lus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/M%C3%A9galithe_de_Ch%C3%A2lus_Chabrol.JPG","page_title":"Châlus","context_page_description":"Châlus è un comune francese di 1718 abitanti situato nel dipartimento dell'Alta Vienne nella regione della Nuova Aquitania. Era capoluogo dell'omonimo cantone, soppresso nel 2015.\\nÈ nota come il luogo in cui il re di Inghilterra Riccardo Cuor di Leone fu ferito a morte nel 1199."},{"page_url":"https://en.wikipedia.org/wiki/Johannes_Brinkman","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/StadionFeyenoord.jpg","page_title":"Johannes Brinkman","context_page_description":"Johannes Andreas Brinkman, also known as Jan Brinkman, was a Dutch architect and exponent of Nieuwe Bouwen, modern architecture in the Netherlands."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%A1%E7%93%A6%E7%BA%B3%E5%A4%A7%E5%8E%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Kavanagh_building_15-11-2005.jpg","page_title":"卡瓦纳大厦","context_page_description":"卡瓦纳大厦 位于阿根廷布宜诺斯艾利斯雷蒂罗区佛罗里达街1065号，俯瞰圣马丁广场。"},{"page_url":"https://fr.wikipedia.org/wiki/RAAF_Command","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/OG2415RAAFCommand.jpg","page_title":"RAAF Command","context_page_description":"Le RAAF Command est la principale formation opérationnelle de la Force aérienne royale australienne, chargée de la défense du pays et des intérêts australiens contre les offensives aériennes japonaises dans la région ouest de l'océan Pacifique sud. Il est créé en septembre 1942. En avril 1943, il comprend 27 escadrons et inclut des unités des Pays-Bas, du Royaume-Uni et des États-Unis en plus des unités australiennes. Dépendant de l'autorité opérationnelle du commandement des forces aériennes alliées dans le Pacifique Sud-Ouest, le RAAF Command exerce un contrôle de ses unités pour la zone de l'Australie et, plus tard, pour le Territoire de Nouvelle-Guinée. Il contrôle également de grandes formations mobiles tel que l'Australian First Tactical Air Force. Le RAAF Command atteint un effectif de 41 escadrons en octobre 1944. De sa création, jusqu'à sa dissolution en septembre 1945, il est dirigé par le Air Vice Marshal William Bostock."},{"page_url":"https://sk.wikipedia.org/wiki/Hubovo","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Hubovo_-_Reformovan%C3%BD_kostol_-_interi%C3%A9r_-f.jpg","page_title":"Hubovo","context_page_description":"Hubovo je obec na Slovensku v okrese Rimavská Sobota."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B9%D0%B4%D0%BB,_%D0%AD%D1%80%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Eric_Idle.jpg","page_title":"Айдл, Эрик","context_page_description":"Эрик Айдл — британский актёр, сценарист, один из комиков группы «Монти Пайтон»."},{"page_url":"https://de.wikipedia.org/wiki/Josefstadt_(Wiener_Bezirksteil)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Josefstadt_%28Wien%29_-_Piaristenkirche.JPG","page_title":"Josefstadt (Wiener Bezirksteil)","context_page_description":"Die Josefstadt war eine Vorstadt Wiens und ist seit ihrer Eingemeindung 1850/61 der namensgebende Bezirksteil des 8. Wiener Gemeindebezirks Josefstadt."},{"page_url":"https://de.wikipedia.org/wiki/Atomium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/2007_07_Belgium_Brussels_07.JPG","page_title":"Atomium","context_page_description":"Das Atomium ist ein in Brüssel für die Expo 58 errichtetes 102 m hohes Bauwerk. Es ist ein auf einer Ecke stehendes Modell der aus neun Atomen bestehenden kubisch raumzentrierten Elementarzelle der Kristalle. In dieser regelmäßigen Würfelform kristallisiert u. a. das Eisen. Die Atome sind als Hohlkugeln ausgeführt, und das Gitter, das sie zur gedachten Elementarzelle vereinigt, besteht aus Rohren.\\nZwei in der Raumdiagonale gegenüberliegende Atome und das zentrale Atom bilden zusammen mit zwei Gitterstäben einen Aussichtsturm, um den herum die anderen sechs Atome und die übrigen Gitterstäbe angeordnet sind. Die drei äußeren unteren Atome werden zusätzlich vom Boden aus gestützt.\\nDas Atomium wurde als Symbol für das Atomzeitalter und die friedliche Nutzung der Kernenergie vom Ingenieur André Waterkeyn entworfen und von den Architekten André und Jean Polak ausgearbeitet und errichtet."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Jahrgang_2005_der_Bundesrepublik_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/DPAG-2005-Fecht-WM-Leipzig.jpg","page_title":"Briefmarken-Jahrgang 2005 der Bundesrepublik Deutschland","context_page_description":"Der Briefmarken-Jahrgang 2005 der Bundesrepublik Deutschland umfasste 53 einzelne Sondermarken, eine Blockausgabe mit einer Einzelmarke, sechs selbstklebende Sondermarken und die ersten zehn Dauermarken der neuen Serie Blumen. Der Nominalwert für die Sondermarken inklusive Zuschlag betrug 58,15 Euro.\\nAnlässlich des Todes von Papst Johannes Paul II., am 2. April, wurde am 12. Mai kurzfristig eine Sondermarke ins Ausgabeprogramm aufgenommen."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A8%D9%88%D9%84%D9%88%D9%86%DB%8C%D8%A7","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6c/Palazzo_del_Podesta.01.jpg","page_title":"بولونیا","context_page_description":"بولونیا ایتالیانین امیلیا-رومانیا بؤلگه سینده یئر آلان بیر شهردیر. ۲۰۱۶-جی ایلین نۆفوس ساییمی اساسیندا ۳۸۷ ۴۲۳ نفر دیر. بۇ باخیم‌دان اۆلکه‌نین ۷_اینجی شهری سایاگلیر.\\nبولونیا — ایتالیانین قوزئین‌دا یئرلشه‌ن شهه‌دیر، عئینی آدلی ویلایتین و املیا رومانیا بؤلگه‌سینین اینضیباطی مرکزی‌دیر. اهالینین سایی ۳۸۱ مین اینسان‌دیر. توسعه ائتمیش سانه‌یه‌سینه گؤره و بیر نئچه نقلیات دهلیزینین بۇ شهردن کئچدیینه گؤره، بولونیا اؤلکه‌ده هئیات سئوییه‌سینه گؤره بیرینجیلردن‌دیر. بولونیانی همچینین ایتالیانین آشپازلیق باشکندی‌دا آدلان‌دیریرلار."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%84%8A%E6%A4%8E%E5%8A%A8%E7%89%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Squirrel_%28PSF%29.png","page_title":"脊椎动物","context_page_description":"脊椎動物亞門，是動物界脊索動物門下的一個亞門。目前所知最早的脊椎動物是中國雲南省昆明發現的豐嬌昆明魚，距今約5.2億年前。\\n和節肢動物殼長在體外或軟體動物無骨骼不同，脊椎動物亞門的動物的脊椎都包在骨頭裡面，是脊索動物門中最大和最多樣化的亞門。這個亞門的成員擁有的肌肉大多數是一對一對的肌肉。神經系統有一部分在脊梁骨中間。循環系統較完善，有心臟可以促進血液循環。脂肪組織是絕大多數脊椎動物特有的構造，可以使之一段時間不進食，而不會能量耗竭而死。\\n脊椎動物亞門動物的脊椎是體內骨，有軟骨也有硬骨。在動物成長時，這個骨架支持體型。因此脊椎動物可以比無脊椎動物長得大，而且平均體量也比較大。"},{"page_url":"https://pt.wikipedia.org/wiki/De_Steeg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Postkantoor_De_Steeg.jpg","page_title":"De Steeg","context_page_description":"De Steeg é um vilarejo holandês da municipalidade de Rheden, pertencente à província da Guéldria. O vilarejo possui uma área de 0.294 km², e uma população aproximada de 975 habitantes em janeiro de 2011. Em função de sua localização central na municipalidade, De Steeg abriga a prefeitura. Uma das construções mais conhecidas do vilarejo é o Castelo Middachten, mansão medieval que consta hoje como um dos cem principais monumentos do patrimônio holandês. Em seu estado atual, possui uma construção realizada no final do século XVII, todavia, já havia menções ao castelo desde o século XII. O turismo em De Steeg gira em torno, principalmente, da visitação de construções antigas e da exploração da beleza natural a céu aberto, como as trilhas para caminhada no Nationaal Park Veluwezoom."},{"page_url":"https://cs.wikipedia.org/wiki/Jan_Vil%C3%ADmek","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Jan_Vil%C3%ADmek_-_Franti%C5%A1ek_Pravda.jpg","page_title":"Jan Vilímek","context_page_description":"Jan Vilímek byl český ilustrátor a malíř. V 80. letech 19. století se zaměřil na portréty významných českých i zahraničních osobností, které publikoval v Humoristických listech a Světozoru. Mnohé z nich vyšly souhrnně v knize České album, kterou vydal jeho strýc Josef Richard Vilímek starší. Později se přestěhoval do Vídně, kde portrétoval osobnosti spojené s divadlem, zejména v časopise Der Humorist. Za 1. světové války v něm uveřejňoval portréty rakouských a německých vojevůdců."},{"page_url":"https://de.wikipedia.org/wiki/Kirow-Klasse_(1936)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Kirov1941-2.jpg","page_title":"Kirow-Klasse (1936)","context_page_description":"Die Kirow-Klasse war eine sechs Schiffe umfassende Klasse Schwerer Kreuzer der sowjetischen Marine. Namensgeber der in den 1930er Jahren konzipierten Klasse war der sowjetischer Staats- und Parteifunktionär Sergei Mironowitsch Kirow. Alle sechs Einheiten dieses Typs – die nach russischen oder sowjetischen Politikern, Militärangehörigen oder Kulturschaffenden benannt wurden – wurden kurz vor oder während des Zweiten Weltkrieges in Dienst genommen, wobei je zwei Kreuzer für die Baltische Flotte, für die Schwarzmeerflotte und für die Pazifische Flotte fertiggestellt wurden. Die Schiffe überstanden sämtliche den Zweiten Weltkrieg und wurden schließlich in den 1960er und 1970er Jahren außer Dienst gestellt. Die Kreuzer der Kirow-Klasse waren die ersten großen Kriegsschiffe, die in der Sowjetunion nach Ende des Russischen Bürgerkrieges geplant und gebaut wurden. Zudem handelte es sich um die einzige Klasse von Schweren Kreuzern, von der zeitweise geplanten Fertigstellung des im Deutschen Reich angekauften Kreuzers Petropawlowsk abgesehen, die für die sowjetische Marine gebaut wurde."},{"page_url":"https://tr.wikipedia.org/wiki/Ponal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Ponal1.jpg","page_title":"Ponal","context_page_description":"Ponal Düsseldorf merkezli Henkel Group'un beyaz tutkalı ve yapıştırıcılar için bir markadır. Ürün yelpazesi ahşap, parke ve laminat için yapıştırıcıların yanı sıra diğer malzemelerle ahşap ve ahşap esaslı malzemeler içerir."},{"page_url":"https://pt.wikipedia.org/wiki/Peffingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Huwelslay.jpg","page_title":"Peffingen","context_page_description":"Peffingen é um município da Alemanha localizado no distrito de Bitburg-Prüm, na associação municipal de Verbandsgemeinde Irrel, no estado da Renânia-Palatinado."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A9sar_Nicol%C3%A1s_Penson","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/C%C3%A9sar_Nicol%C3%A1s_Penson.jpeg","page_title":"César Nicolás Penson","context_page_description":"César Nicolás Penson fue un escritor, abogado y poeta dominicano. Su obra Cosas añejas es considerada una de las obras representativas de la literatura dominicana del siglo XIX.​"},{"page_url":"https://it.wikipedia.org/wiki/James_Crichton","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/James_Crichton.png","page_title":"James Crichton","context_page_description":"James Crichton, conosciuto anche col nome di Admirable Crichton, è stato uno scienziato, poeta e matematico scozzese, famoso per la sua straordinaria conoscenza delle lingue, delle arti e delle scienze.\\nParlava correttamente almeno dieci lingue e aveva una cultura sterminata che lo portava ad avere un grosso ascendente sulle donne e le gelosie gli furono fatali."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90%E1%BA%A1i_h%E1%BB%8Dc_Villanova","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Corr_Hall.jpg","page_title":"Đại học Villanova","context_page_description":"Viện Đại học Villanova hay Đại học Villanova là một viện đại học tư thục ở Radnor Township, phía tây bắc vùng ngoại ô Philadelphia, Pennsylvania, Hoa Kỳ. Được đặt tên theo Thánh Thomas xứ Villanova, đây là cơ sở giáo dục đại học Công giáo lâu đời nhất trong Thịnh vượng chung Pennsylvania.\\nĐược thành lập năm 1842 bởi Dòng Thánh Augustine, nguồn gốc của trường bắt nguồn từ nhà thờ Thánh Augustine, Philadelphia, vốn được các tu sĩ Augustinô thành lập vào năm 1796, và học viện Thánh Augustine, vốn được thành lập vào năm 1811."},{"page_url":"https://en.wikipedia.org/wiki/The_Container_Store","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Containerstore.jpg","page_title":"The Container Store","context_page_description":"The Container Store Group, Inc. is an American specialty retail chain company that operates The Container Store, which offers storage and organization products.\\nThe company has made Fortune's list of \\"100 Best Companies to Work For\\" in each of the past 17 years, through 2016.\\nIn February 2007, its owners announced that they were \\"exploring alternatives,\\" including selling the company to private investors, in order to fund future growth. They stated that they would not sell unless they received guarantees that the corporate culture would be preserved. On July 2, 2007, the company announced that they had closed a deal with a private equity firm based in Los Angeles, Leonard Green & Partners, which obtained a majority stake."},{"page_url":"https://nl.wikipedia.org/wiki/Tapelibrary","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Adic_scalar_100.jpg","page_title":"Tapelibrary","context_page_description":"Een tapelibrary is een gerobotiseerd systeem waarin een robotarm tapes van een bewaarplaats in de library naar de ingebouwde tapedrives brengt en vice versa. Een tapelibrary wordt gebruikt voor massaopslag van gegevens en back-ups."},{"page_url":"https://de.wikipedia.org/wiki/Eduard_M%C3%BCller_(M%C3%A4rtyrer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Eduard_Mueller%2C_L%C3%BCbeck.jpg","page_title":"Eduard Müller (Märtyrer)","context_page_description":"Eduard Müller war ein deutscher römisch-katholischer Priester. Er wurde als einer der Lübecker Märtyrer hingerichtet. 2011 wurde er seliggesprochen."},{"page_url":"https://cs.wikipedia.org/wiki/Jaz%C3%BD%C4%8Dkov%C3%BD_kontakt","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Reed_switch_%28aka%29.jpg","page_title":"Jazýčkový kontakt","context_page_description":"Jazýčkový kontakt je mechanický spínač ovládaný magnetickým polem. Byl vynalezen roku 1936 v Bell Telephone Laboratories. Jazýčkový kontakt se skládá z dvou feromagnetických jazýčků umístěných v hermeticky utěsněné skleněné trubičce. Kontakty jsou v klidovém stavu otevřeny a k jejich propojení dojde po přiblížení magnetického pole. Feromagnetický materiál jazýčků zesílí intenzitu přiloženého magnetického pole, čímž dojde k vytvoření dvou magnetů, které se svými protikladnými póly přitáhnou a vytvoří vodivé spojení. Po odstranění magnetického pole se jazýčky vrátí do své výchozí rozpojené pozice.\\nOvládací magnetické pole může být generováno permanentním magnetem, nebo elektromagnetickou cívkou. Řešení s permanentním magnetem se využívá například pro detekci otevření dveří u zabezpečovacích systémů budov, nebo jako snímač přiblížení. Při ovládání jazýčkového kontaktu elektromagnetickým polem cívky vznikne jazýčkové relé."},{"page_url":"https://ht.wikipedia.org/wiki/Poultney,_Vermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Lower_Main_Street%2C_Poultney%2C_VT.jpg","page_title":"Poultney, Vermont","context_page_description":"Poultney se yon vil nan eta Vermont, nan Etazini.\\nLi nan konte, rejyon Rutland\\nNan lane 2000, popilasyon l te konte 3633 moun.\\nSifas li se 116.0 km²"},{"page_url":"https://hr.wikipedia.org/wiki/Longyearbyen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Longyearbyen4.jpg","page_title":"Longyearbyen","context_page_description":"Longyearbyen je najveće naselje i glavni grad norveškog prekomorskog teritorija Svalbarda. Naselje se nalazi na Spitsbergenu, najvećem otoku svalbardskog otočja, a u njemu trenutno živi oko 1.800 ljudi, uglavnom Norvežana i Rusa.\\nNaselje je 1906. godine osnovao John Munroe Longyear, po kojem je i dobilo ime koje na norveškom znači Longyearov grad. Naselje je 1943. bilo razrušeno od strane Nijemaca, ali je ubrzo nakon Drugog svjetskog rata obnovljeno. Do početka devedesetih godina 20. stoljeća glavna djelatnost u naselju je bilo ugljeno rudarstvo. Danas Longyearbyen nudi široku ponudu aktivnosti i ustanova, pa se u njemu nalaze zatvoreni bazeni, sportska dvorana, trgovina s kućnim potrepštinama, tri hotela, crkva, suvenirnice itd. 1993. godine u naselju je otvoren i sveučilišni centar.\\nLongyearbyen je najsjevernije naselje na svijetu kojem se može pristupiti bez ikakvih problema, jer se u njegovoj okolici nalazi zračna luka u koju se može doći redovitim letovima iz norveških gradova Tromsøa i Osla. Budući da se nalazi sjeverno od Arktičkog kruga, u naselju polarna noć traje od kraja listopada do sredine veljače, a polarni dan od sredine travnja do sredine kolovoza."},{"page_url":"https://de.wikipedia.org/wiki/Waldfriedhof_Stuttgart","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Waldfriedhof_Stuttgart%2C_067.jpg","page_title":"Waldfriedhof Stuttgart","context_page_description":"Der Waldfriedhof Stuttgart wurde 1913 kurz vor Ausbruch des Ersten Weltkriegs nach den Plänen des Stuttgarter Stadtbaudirektors Albert Pantle angelegt. Auf dem Friedhof, der im Stuttgarter Stadtbezirk Degerloch liegt, sind zahlreiche Prominente bestattet. Der Name des Friedhofs verweist darauf, dass er mitten im Mischwaldbestand des Degerlocher Walds errichtet wurde.\\nDer Friedhof besteht aus zwei Teilen:\\ndem älteren und größeren westlichen Hauptteil\\nund dem jüngeren, östlich gelegenen Waldfriedhof-Viereichenhau.\\nMit 30,7 Hektar ist er der flächenmäßig größte und mit seinen 15.000 Grabstellen der drittgrößte Stuttgarter Friedhof. Er ist in die Abteilungen 1-35 und 50-75 aufgeteilt.\\nAuf dem Friedhofsgelände befinden sich eine Feierhalle, ein Verwaltungsgebäude, ein Leichenhaus und drei Ehrenmale für die Gefallenen der beiden Weltkriege. Dem Friedhof benachbart ist der weiter östlich gelegene Dornhaldenfriedhof, der 1974 angelegt wurde.\\nEine Standseilbahn aus dem Jahre 1929 verbindet den Südheimer Platz mit dem 100 Meter höher gelegenen Friedhof."},{"page_url":"https://es.wikipedia.org/wiki/Turismo_en_Bogot%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Mus%C3%A9e_del_Oro_%2815%29.JPG","page_title":"Turismo en Bogotá","context_page_description":"La ciudad de Bogotá es la capital de la República de Colombia y el principal destino turístico del país, ​​​​ pues cuenta con diversas actividades y acervos culturales, es sede de importantes universidades, y acoge eventos de nivel internacional. La ciudad también ofrece una amplia variedad de restaurantes de comida internacional y sitios especializados en el esparcimiento nocturno, destacan igualmente sus parques, museos, centros comerciales y su arquitectura.​ La ciudad se localiza en el altiplano de la sabana de Bogotá, desde la cual se pueden ver los picos nevados de la cordillera Central. A pocos minutos de la ciudad, en las afueras de Facatativa también es posible apreciar una vista panorámica del valle del río Magdalena así como parte del trayecto del río Magdalena y vistas panorámicas de las poblaciones ubicadas en las faldas de la cordillera Oriental."},{"page_url":"https://nl.wikipedia.org/wiki/Mill_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Mill_Green_Brewery%2C_The_White_Horse_Pub%2C_Edwardstone_-_geograph.org.uk_-_1332399.jpg","page_title":"Mill Green","context_page_description":"Mill Green is een gehucht in het Engelse graafschap Suffolk. Het maakt deel van de civil parish Edwardstone, en tevens deel uit van district Babergh. De plaats telt 9 monumentale panden, te weten Crossways, Earls Cottages, General Stores, Mill Green Cottage, Mill Green End, Moat Farm Cottage, Sans Souci, The Thatched Cottage en Tudor Cottage."},{"page_url":"https://en.wikipedia.org/wiki/Fundidora_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Fundidora7.jpg","page_title":"Fundidora Park","context_page_description":"Fundidora Park is an urban park located in the Mexican city of Monterrey, build in what once where the grounds of the Fundidora Monterrey steel foundry company."},{"page_url":"https://fr.wikipedia.org/wiki/Frederick_Sturrock","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Frederick_Sturrock.jpg","page_title":"Frederick Sturrock","context_page_description":"Frederick Claud Sturrock est un homme d'affaires et un homme politique d'Afrique du Sud, membre du Parti uni, membre du parlement, ministre sans portefeuille dans le gouvernement Hertzog puis ministre des transports et brièvement ministre des finances dans le gouvernement Smuts."},{"page_url":"https://da.wikipedia.org/wiki/Patruljefart%C3%B8j","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Danish_Vessel_P521.jpg","page_title":"Patruljefartøj","context_page_description":"Et patruljefartøj er en skibstype der som oftes blive brugt af en marine, kystvagt, politi eller et toldvæsen.\\nDefinitionen på en patruljebåd er noget vag. En patruljebåd kan variere i størrelse, lige fra en RHIB til et større skib som eksempelvis et inspektionsskib af Thetis-klassen. Tidligere var store patruljefartøjer ikke nødvendige, men efter de fleste lande er begyndt at hævde en eksklusiv økonomisk zone som typisk strækker sig 200 sømil ud i havet, er det blevet nødvendigt at kunne håndhæve disse, derfor behøvede man større fartøjer med større udholdenhed. De større skibe betød at der nu også var plads til at medbringe en helikopter, hvorved skibes indsatsområde pludselig kunne mangedobles.\\nEt patruljefartøjs fredstidsopgaver er typisk suverænitetshåndhævelse, fiskeriinspektion, SAR-beredskab, toldinspektioner, kunne indsættes mod miljøproblemer indtil et miljøskib kan nu frem samt udøve politimyndighed til havs. I krigstid vil patruljebådene ofte blive benyttet til at opklare kystnære områder, da de er små og fleksible, i forhold til store, dyre deciderede kampenheder."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%A5%BF%E7%9B%B8%E7%94%9F%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Nishi-Aioi_Sta.jpg","page_title":"西相生駅","context_page_description":"西相生駅は、兵庫県相生市千尋町にある、西日本旅客鉄道赤穂線の駅である。"},{"page_url":"https://en.wikipedia.org/wiki/Oxalyl-CoA_decarboxylase","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Oxalyl-CoA_Mechanism.jpg","page_title":"Oxalyl-CoA decarboxylase","context_page_description":"In enzymology, an oxalyl-CoA decarboxylase is an enzyme primarily produced by the gastrointestinal bacterium Oxalobacter formigenes that catalyzes the chemical reaction\\noxalyl-CoA formyl-CoA + CO₂\\nOXC belongs to the family of lyases, specifically the carboxy-lyases, which cleave carbon-carbon bonds. The systematic name of this enzyme class is oxalyl-CoA carboxy-lyase. Other names in common use include oxalyl coenzyme A decarboxylase, and oxalyl-CoA carboxy-lyase. This enzyme participates in glyoxylate and dicarboxylate metabolism. It employs one cofactor, thiamin diphosphate, and plays a key role in catabolism of oxalate, a highly toxic compound that is a product of the oxidation of carbohydrates in many bacteria and plants. Oxalyl-CoA decarboxylase is extremely important for the elimination of ingested oxalates found in human foodstuffs like coffee, tea, and chocolate, and the ingestion of such foods in the absence of Oxalobacter formigenes in the gut can result in kidney disease or even death as a result of oxalate poisoning."},{"page_url":"https://de.wikipedia.org/wiki/K%C5%99inec","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/P%C5%99%C3%ADrodn%C3%AD_pam%C3%A1tka_Chotuc_-_kaple_Nejsv%C4%9Bt%C4%9Bj%C5%A1%C3%AD_Trojice.jpg","page_title":"Křinec","context_page_description":"Křinec ist ein Městys in Tschechien. Er liegt zwölf Kilometer nordöstlich von Nymburk und gehört zum Okres Nymburk."},{"page_url":"https://nn.wikipedia.org/wiki/Kand%C3%A1ra-festninga","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Castle_of_Kantara.jpg","page_title":"Kandára-festninga","context_page_description":"Kandára-festninga er ei middelalderborg i Kyríniafjella på Kypros, like ved landsbyen Kandára.\\nDenne artikkelen er eit frø. Du kan hjelpe Nynorsk Wikipedia gjennom å utvide han."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D1%96%D1%80%D1%83%D1%81_%D1%96%D0%BC%D1%83%D0%BD%D0%B0%D0%B4%D1%8D%D1%84%D1%96%D1%86%D1%8B%D1%82%D1%83_%D1%87%D0%B0%D0%BB%D0%B0%D0%B2%D0%B5%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/%D0%93%D0%B5%D0%BD%D0%BE%D0%BC-%D0%92%D0%98%D0%A7.png","page_title":"Вірус імунадэфіцыту чалавека","context_page_description":"Ві́рус іму́надэфіцы́ту чалаве́ка — рэтравірус з роду ленцівірусаў, які выклікае захворванне, якое павольна прагрэсіруе — ВІЧ-інфекцыю.\\nВірус паражае клеткі імуннай сістэмы, якія маюць на сваёй паверхні рэцэптары CD4: Т-хелперы, манацыты, макрафагі, клеткі Лангерганса, дэндрытныя клеткі, клеткі мікрагліі. У выніку праца імуннай сістэмы прыгнятаецца і развіваецца сіндром набытага імуннага дэфіцыту, арганізм хворага страчвае магчымасць абараняцца ад інфекцый і пухлін, узнікаюць другасныя апартуністычныя захворванні, якія не характэрныя для людзей са звычайным імунным статусам. Без доктарскага ўмяшання апартуністычныя захворванні выклікаюць смерць пацыента ў сярэднім праз 9—11 гадоў пасля заражэння. Пры правядзенні антырэтравіруснай тэрапіі працягласць жыцця пацыента можа быць падоўжана да 70—80 гадоў."},{"page_url":"https://it.wikipedia.org/wiki/Specie_di_Betula","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Betula_humilis_Fruchtstand.jpg","page_title":"Specie di Betula","context_page_description":"Elenco delle Specie di Betula:"},{"page_url":"https://fr.wikipedia.org/wiki/Ville-Neuve_du_Temple","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Villeneuve_du_Temple_vers_1550.png","page_title":"Ville-Neuve du Temple","context_page_description":"La Villeneuve-du-Temple est un micro-quartier au nord du Marais délimité par la rue de Bretagne au nord-est, la rue des Archives, la rue des Quatre-Fils puis la rue Vieille-du-Temple à l’est, la rue des Francs-Bourgeois et la rue Rambuteau au sud, la rue du Temple à l’ouest, créé vers 1300 par le lotissement d’une partie du domaine de la Maison du Temple.\\nCe territoire correspond à des fractions des quartiers administratifs des Enfants-Rouges, de Sainte-Avoye et des Archives."},{"page_url":"https://fr.wikipedia.org/wiki/Butrint","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Butrint_Albania_12_baptistery.jpg","page_title":"Butrint","context_page_description":"Butrint est une ville d'Albanie, située à proximité de la ville de Saranda et de la frontière Illyrian. C'est aussi un site archéologique, autrefois connu sous le nom de Buthrotum.\\nButrint est accessible depuis Saranda, par une route construite en 1959 pour accueillir Nikita Khrouchtchev."},{"page_url":"https://en.wikipedia.org/wiki/Effie_Gray","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Euphemia_Millais_Gray.jpg","page_title":"Effie Gray","context_page_description":"Euphemia Chalmers Millais, Lady Millais was a Scottish painter and the wife of Pre-Raphaelite painter John Everett Millais. She had previously been married to the critic John Ruskin, but the marriage was annulled, and she left him without it having been consummated. This famous Victorian \\"love triangle\\" has been dramatised in plays, films and an opera."},{"page_url":"https://sh.wikipedia.org/wiki/Popis_nadglednika_Jerseyja","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Michael_Cameron_St._John_Birt.jpg","page_title":"Popis nadglednika Jerseyja","context_page_description":"Ovdje je naveden Popis nadglednika Jerseyja.\\nTitula datira od godine 1290. kada su uvedeni posebni nadglednici za Guernsey i Jersey.\\nPopis nadglednika se sa sigurnošću može ustanoviti tek od 1277. godine kada je imenovan Philippe L’Evesque, iako se neka imena spominju i prije 1204 godine.\\nV. također: popis nadglednika Guernseyja, popis gospodara Sarka."},{"page_url":"https://en.wikipedia.org/wiki/Matchbox_Twenty","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/MatchBox_Twenty_4_-2013-04-30..JPG","page_title":"Matchbox Twenty","context_page_description":"Matchbox Twenty is an American rock band, formed in Orlando, Florida, in 1995. The group currently consists of Rob Thomas, Brian Yale, Paul Doucette, and Kyle Cook.\\nMatchbox Twenty rose to international fame with their debut album, Yourself or Someone Like You, which was certified 12× Platinum in the United States and multi-platinum in Australia, Canada, and New Zealand. Their second album, Mad Season, released in 2000, charted in the top three on the Billboard 200 and was certified 4× Platinum in the United States. Their third album, More Than You Think You Are, released in 2002, was only certified 2× Platinum in the United States, despite its singles receiving significant airplay.\\nThe band then went on hiatus in 2004 after rhythm guitarist Adam Gaynor's departure. As a result, Paul Doucette took over rhythm guitar when the band reunited in 2007. They released a compilation album, Exile on Mainstream, which was certified Gold in the United States. After the release, the band toured to support it. Matchbox Twenty then took another hiatus while Rob Thomas embarked on a successful solo career but reunited again in 2010."},{"page_url":"https://sv.wikipedia.org/wiki/V%C3%A4stra_city","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Klarastrandsleden.jpg","page_title":"Västra city","context_page_description":"Västra city är projektnamnet på den nya bebyggelsen på Norrmalm och i Vasastaden i centrala Stockholm som planeras att byggas ovanpå järnvägsspåren som löper längs Klara sjös strand från Tegelbacken till Karlberg. Plats för den nya bebyggelsen kommer att skapas genom att järnvägsspåren täcks över. Det nya området ska enligt planerna få en varierad bebyggelse med kontor, bostäder och butikslokaler.\\nDrivande bakom projektet är förutom Stockholms kommun det statliga bolaget Jernhusen som äger marken i området, arkitekt bakom förslaget är Rosenbergs Arkitekter i samarbete med WSP, Space Scape och Paju Arkitektur & Landskap. Byggandet av det nya området beräknas påbörjas 2012 och inte slutföras förrän på 2030-talet."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%B0%E0%A8%BE%E0%A8%AC%E0%A8%B0%E0%A8%9F_%E0%A8%B5%E0%A8%BE%E0%A8%A1%E0%A8%B0%E0%A8%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/RahulPriyankaRobert.png","page_title":"ਰਾਬਰਟ ਵਾਡਰਾ","context_page_description":"ਰਾਬਰਟ ਵਾਡਰਾ ਇੱਕ ਭਾਰਤੀ ਵਪਾਰੀ, ਅਤੇ ਪ੍ਰਿਯੰਕਾ ਗਾਂਧੀ ਦਾ ਪਤੀ ਹੈ। ਉਹ ਸੋਨੀਆ ਗਾਂਧੀ ਅਤੇ ਰਾਜੀਵ ਗਾਂਧੀ ਦਾ ਜਵਾਈ ਹੈ ਅਤੇ ਰਾਹੁਲ ਗਾਂਧੀ ਦਾ ਜੀਜਾ ਹੈ।"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D0%BF%D1%80%D1%8F%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D1%81%D0%B4%D0%B2%D0%B8%D0%B3%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Shear_scherung.svg","page_title":"Напряжение сдвига","context_page_description":"Напряжение сдвига — механическое напряжение, которое возникает при деформации чистого сдвига. Свойство материала сопротивляться напряжению сдвига называется модулем сдвига.\\nЭто напряжение можно выразить, как, где:\\n— касательная сила;\\n— площадь, на которую действует сила.\\nВ международной системе единиц напряжение сдвига измеряется в паскалях."},{"page_url":"https://az.wikipedia.org/wiki/Qara_qar%C4%9Fa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Rabenkr%C3%A4he_im_flug_2.jpg","page_title":"Qara qarğa","context_page_description":"Qara qarğa — qarğalar fəsiləsinin qarğa cinsinə aid quş növü."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%87%AA%E6%88%91%E5%A4%8D%E5%88%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/A_rep-tile-based_setiset_of_order_4.png","page_title":"自我复制","context_page_description":"自我複製 是動力系統的一種行為，這種行為可以產生出和自身相同的結構。在適當的環境下，細胞會通過細胞分裂進行自我複製。在細胞分裂的過程中，DNA完成了自我複製，並且可以通過繁殖傳遞給後代。生物病毒也可以自我複製，但是必須在感染過程中使用寄主細胞內的複製機制。有害的朊毒體是一種蛋白質，它可以通過將正常的蛋白質變為有害的朊毒體而自我複製。電腦病毒可以使用電腦的軟體和硬體自我複製。自我複製是機器人學中的研究課題，也是科學幻想中的熱門主題。自我複製機制常常不會完美地複製個體，而是通過遺傳變異來產生各種差異。這些變異會成為自然選擇的基礎，其中一些有利於在現有環境下生存的變異會保留下來，而其他的會被淘汰。"},{"page_url":"https://de.wikipedia.org/wiki/Claus_von_Ahlefeldt_(Feldmarschall)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Ahlefeldts_partisan_vertical.jpg","page_title":"Claus von Ahlefeldt (Feldmarschall)","context_page_description":"Claus von Ahlefeldt war Feldmarschall und Befehlshaber aller dänischen Streitkräfte in Norwegen. Er war Erbherr der Herrschaft Bramstedt, Schierensee, Klein Nordsee und Ritter des Elefanten-Ordens und des Dannebrog-Ordens."},{"page_url":"https://it.wikipedia.org/wiki/Ogcocephalus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Red-lipped_Bat_fish.jpg","page_title":"Ogcocephalus","context_page_description":"Ogcocephalus Fischer, 1813 è un genere di pesci della famiglia Ogcocephalidae."},{"page_url":"https://de.wikipedia.org/wiki/RuPaul%E2%80%99s_Drag_Race/Staffeln","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Shea_Coule%C3%A9_at_RuPaul%27s_Dragcon_2017_by_dvsross.jpg","page_title":"RuPaul’s Drag Race/Staffeln","context_page_description":"RuPaul’s Drag Race ist eine seit 2009 jährlich erscheinende Reality-Castingshow von und mit der Dragqueen RuPaul als Moderator und Jurorin, in der Dragqueens im Wettbewerb antreten. Bislang haben an 12 Staffeln, bei denen jeweils eine Gewinnerin als America’s Next Drag Superstar und meist durch die Zuschauer eine Miss Congeniality gekürt wurde, insgesamt 153 verschiedene Dragqueens teilgenommen. Von diesen traten bislang vier Teilnehmerinnen in mehreren Staffeln an.\\nDie Kandidatinnen scheiden aus, indem am Ende jeder Episode die beiden Schlechtesten in einem Lipsync-Duell antreten, nach dem RuPaul bestimmt, welche gehen soll. Dabei kann auch vorkommen, dass beide bleiben dürfen oder gehen müssen. Neben diesem regulären Ausscheidungsprozess ist bislang eine Kandidatin innerhalb der aufgezeichneten Episoden disqualifiziert worden und eine wegen Verletzung in der Show ausgeschieden. Mit Sherry Pie in Staffel 12 wurde eine Queen während der Ausstrahlung der aufgezeichneten Episoden disqualifiziert.\\nSeit 2012 erscheinen neben den regulären Staffeln auch All Stars-Staffeln, in denen Teilnehmerinnen der regulären Staffeln erneut antreten."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BC%D0%B0%D0%BB%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/2013_04_15_Clinic_D.jpg_%288654738668%29.jpg","page_title":"Сомалі","context_page_description":"Сомалі́ — Федеративна Республіка Сомалі — країна на північному сході Африки, на узбережжі Індійського океану на так званому Африканському розі. Межує на північному заході з Джибуті, на заході — з Ефіопією, на південному заході — з Кенією.\\nЗараз єдиною законною владою в країні є Федеральний уряд Сомалі, який визнається міжнародним співтовариством, проте цей уряд донедавна контролював лише частину столиці країни — міста Могадішо. Значна частина території Сомалі досі перебуває під контролем невизнаних державних утворень або є самокерованими територіями, керівництво яких має різні, іноді протилежні погляди з питання об'єднання під владою Могадішо.\\nПлоща країни — 637 700 км². Населення 1990 року становило 8,415 млн мешканців, включаючи 350 тисяч біженців з Ефіопії й 50 тисяч із Джибуті. На 2010 за оцінками населення перевищує 10 млн. У країні існує полігамія."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_in_Essen-Ostviertel","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Zeche_Graf_Beust_Essen-Ostviertel.jpg","page_title":"Liste der Straßen in Essen-Ostviertel","context_page_description":"Die Liste der Straßen in Essen-Ostviertel beschreibt das Straßensystem im Essener Stadtteil Ostviertel mit den entsprechenden historischen Bezügen."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_podurilor_din_Vene%C8%9Bia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Ponte_de_le_Scuole_%28Venice%29.jpg","page_title":"Lista podurilor din Veneția","context_page_description":"Centrul istoric al Veneției conține 121 de insule legate între ele prin 435 de poduri. Această listă prezintă denumirile venețiene ale principalelor poduri din Veneția pe sestiere sau insule."},{"page_url":"https://en.wikipedia.org/wiki/List_of_City_of_Pittsburgh_historic_designations","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/WestEndCarnegieLibraryofPittsburgh.jpg","page_title":"List of City of Pittsburgh historic designations","context_page_description":"Historic designations in the City of Pittsburgh are awarded following nominations for districts and individual structures that are reviewed and recommended to Pittsburgh City Council, which makes the final decision, by the city's Historic Review Commission and the City Planning Commission. This list is not to be confused with the list of landmarks designated by the Pittsburgh History and Landmarks Foundation. City Historic Designation establishes a regulatory process for the review of all changes and alterations by the Historic Review Commission to the publicly viewable exterior and appearance of all buildings that are designated, either individually or as part of a district. As of 2011, there were 12 designated districts in the city, two historic objects, one historic site, and 87 individual structures."},{"page_url":"https://sh.wikipedia.org/wiki/Lete%C4%87i_Holandez_(jedrenje)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/FD_H125.jpg","page_title":"Leteći Holandez (jedrenje)","context_page_description":"Klasa leteći Holandez je veoma brza laka jedrilica sa 3 jedra za dvije osobe. Od 1960. do 1992. takmičenje u ovoj klasi je bilo na programu Olimpijskih igara.\\nPrvi primjerak jedrilice ove klase su 1951. u Nizozemskoj izradili Conrad Gülcher i Uus Van Essen. Leteći Holandez je otvorena klasa, što znači da je dozvoljeno modificirati ovu jedrilicu, osim njenih osnovnih dimenzija. Ta mogućnost je uzrokovala da je ovo danas jedna od najskupljih jedrilica, posebno otkad se njeni dijelovi izrađuju od fiberglasa."},{"page_url":"https://fr.wikipedia.org/wiki/San_Severino_Lucano","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Chiesa_Madre%2C_San_Severino_Lucano.jpg","page_title":"San Severino Lucano","context_page_description":"San Severino Lucano est une commune italienne d'environ 1 700 habitants, située dans la province de Potenza, dans la région Basilicate, en Italie méridionale."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D0%B3%D0%B0%D1%80%D0%B8%D1%84%D0%BC%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D1%81%D0%B8%D1%81%D1%82%D0%B5%D0%BC%D0%B0_%D1%81%D1%87%D0%B8%D1%81%D0%BB%D0%B5%D0%BD%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c1/Gaussian_logarithm.svg","page_title":"Логарифмическая система счисления","context_page_description":"Логарифмическая система счисления — это арифметическая система, иногда используемая для представления вещественных чисел в компьютере и в цифровых аппаратных средствах, особенно в цифровой обработке сигналов."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9D%92%E6%B5%A6%E5%8C%BA%E6%96%87%E7%89%A9%E4%BF%9D%E6%8A%A4%E5%8D%95%E4%BD%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Qingpuchenghuangmiao_Toumen%2C_xitai_he_niangniangdian.jpg","page_title":"青浦区文物保护单位","context_page_description":"本表列出的是青浦区区级文物保护单位及登记不可移动文物，关于青浦区境内的全国重点文物保护单位和上海市市级文物保护单位，请分别参见上海全国重点文物保护单位列表和上海市文物保护单位。"},{"page_url":"https://de.wikipedia.org/wiki/Camillo_Benso_von_Cavour","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Francesco_Hayez_041.jpg","page_title":"Camillo Benso von Cavour","context_page_description":"Camillo Benso Graf von Cavour war ein italienischer Staatsmann und Unternehmer. Als Ministerpräsident des Königreichs Sardinien trieb er die italienische Einheit voran, war danach Architekt der italienischen Verfassung und erster Ministerpräsident des neuen Königreiches Italien."},{"page_url":"https://pt.wikipedia.org/wiki/Convento_dos_Capuchos_(Sintra)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Convento-dos-Capuchos_Refeitorio_17-08-08.jpg","page_title":"Convento dos Capuchos (Sintra)","context_page_description":"O Convento dos Capuchos é um antigo convento da Ordem de São Francisco que fica localizado na Serra de Sintra, na freguesia de São Martinho, concelho de Sintra, distrito de Lisboa, Portugal."},{"page_url":"https://en.wikipedia.org/wiki/Pecherskyi_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/%D0%9A%D0%B8%D1%97%D0%B2%2C_%2885%29.JPG","page_title":"Pecherskyi District","context_page_description":"Pecherskyi District is an urban district of Kiev, the capital of Ukraine. It line within the eponymous historical neighborhood, while also including some other historical areas. The Pechersk neighborhood is located on the hills adjoining the right bank of the Dnieper River. The two geographic entities are often confused together. The Pecherskyi District can be considered as the very heart of Ukraine."},{"page_url":"https://es.wikipedia.org/wiki/T%C4%9Bn%C4%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/T%C4%9Bn%C4%9B%2C_znak.jpg","page_title":"Těně","context_page_description":"Těně es una localidad del distrito de Rokycany en la región de Pilsen, República Checa, con una población estimada a principio del año 2018 de 280 habitantes.\\nSe encuentra ubicada al noreste de la región, en la cuenca hidrográfica del río Berounka —un afluente izquierdo del río Moldava que, a su vez, lo es del Elba—, y cerca de la frontera con la región de Bohemia Central.​"},{"page_url":"https://cs.wikipedia.org/wiki/Preslava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Preslava-Na-tebe-ne-otkazvam.JPG","page_title":"Preslava","context_page_description":"Preslava Koleva Ivanova je bulharská pop-folková zpěvačka známá je pod jménem Preslava. Narodila se v bulharském Dobriči, zde dokončila své hudební vzdělání. Její hudební kariéra začala v roce 2004. Jedná se o jednu z nejúspěšnějších bulharských pop-folkových zpěvaček."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D9%88%D9%84%D9%8A%D9%86_%D9%85%D9%86_%D8%A8%D8%A7%D8%AF%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Stieler_-_Amalie_Auguste_of_Bavaria_-_Galerie_Neue_Meister.jpg","page_title":"كارولين من بادن","context_page_description":"كارولين من بادن ؛ كانت أخر ناخبة بافاريا وأول ملكة بافاريا من خلال زواجها من ماكسيمليان الأول يوزف."},{"page_url":"https://en.wikipedia.org/wiki/Eric_B._%26_Rakim_discography","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Eric_B._featuring_Rakim_-_Eric_B._is_President-My_Melody_%28Zakia_Records-1986%29_%28Side_A%29.jpg","page_title":"Eric B. & Rakim discography","context_page_description":"The discography of Eric B. & Rakim, an American hip hop duo, consists of four studio albums, five compilation albums, 15 singles, and nine music videos. Eric B. & Rakim formed and signed a record deal with Zakia Records in 1985. The following year, the duo signed a deal with 4th & B'way Records. Their debut album Paid in Full was released in 1987. In the United States, it peaked at number 58 on the Billboard 200, number 8 on R&B/Hip-Hop Albums, and was certified platinum by the Recording Industry Association of America. It appeared on the Dutch, New Zealand, and UK Albums Chart. Paid in Full produced five singles, four of which appeared on Hot R&B/Hip-Hop Songs. The fifth single \\"Paid in Full\\" peaked in the top five of the Dutch and New Zealand Singles Chart.\\nIn 1988, Eric B. & Rakim released their second studio album Follow the Leader. It peaked at number 22 on the Billboard 200, number 7 on R&B/Hip-Hop Albums, and was certified gold by the RIAA. The album peaked at 25 on the UK Albums Chart, and appeared on the Swedish, Dutch, and New Zealand Albums Chart."},{"page_url":"https://en.wikipedia.org/wiki/Ecovolis","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Tirana_Bikes.jpg","page_title":"Ecovolis","context_page_description":"Ecovolis is a community based bike sharing program in Tirana, Albania, launched on March 22nd 2011, from an environmental NGO called Social Stimulating Alternatives Program. The system is based on 6 bike stations, respectively staffed by two employees in two shifts. Ecovolis program has proven successful in significantly increasing bicycle use in Tirana."},{"page_url":"https://lv.wikipedia.org/wiki/Nokia_1800","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Nokia_1800.jpg","page_title":"Nokia 1800","context_page_description":"Nokia 1800 ir GSM mobilais telefons, kuru ražoja Nokia. Tas ietilpst firmas visvienkāršāko telefonu sērijā, un ražošanā nonāca 2009. gada novembrī. 1800 izmanto Nokia programmatūras platformu Series 30. 1800 ir viens no funkcionālākajiem sērijas telefoniem, un tajā ir iebūvēts radio uztvērējs, kā arī putekļu noturīga klaviatūra.Telefons ir speciāli optimizēts izmantošanai ar priekšapmaksas operatoru un tam ir skrāpējumu noturīgi vāciņi."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC%D1%96%D1%82_G-20_%D0%B2_%D0%9E%D1%81%D0%B0%D1%86%D1%96_(2019)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/President_Macri_%282016%29.jpg","page_title":"Саміт G-20 в Осаці (2019)","context_page_description":"Саміт G20 в Осаці — це чотирнадцята зустріч керівників країн Великої двадцятки. Він пройде 28-29 червня 2019 року в Осаці.\\nЦе буде перший в історії саміт G20, який пройде в Японії.\\nПрем'єр-міністр Японії Сіндзо Абе написавши текст у колонці ProjectSyndicate визначив три ключових питаннях, кожне з яких особливо важливе для країн Азії:\\n1) Робота над збереженням і, в кінцевому підсумку, зміцненням міжнародного режиму вільної та справедливої торгівлі. Для лідерів країн Азії це означає формування Всестороннього регіонального економічного партнерства — передової угоди про вільну торгівлю між десятьма членами Асоціації держав Південно-Східної Азії і шістьма країнами Індо-Тихоокеанського регіону.\\n2) Цифровізація економіки уможливила появу унікальних і безпрецедентних бізнес-моделей, але одночасно вона створила нові проблеми, такі як, наприклад, подвійне неоподаткування транснаціональних компаній. Ми можемо вирішити подібні проблеми лише за допомогою міжнародного співробітництва.\\n3) Значення інновацій у боротьбі з глобальними екологічними проблемами."},{"page_url":"https://es.wikipedia.org/wiki/Citro%C3%ABn_Junior_Team","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/S%C3%A9bastien_Ogier_-_2009_Rally_Australia.jpg","page_title":"Citroën Junior Team","context_page_description":"El Citroën Junior Team fue un equipo privado de la marca Citroën que compitió en el Campeonato Mundial de Rally durante los años 2009 y 2010. Sirvió como equipo satélite y relanzamiento de jóvenes promesas para el equipo oficial Citroën WRT. A pesar de ser privado compitió en el campeonato de constructores logrando una tercera posición en 2010, así como la única victoria que fue en el Rally de Portugal del mismo año, gracias al francés Sébastien Ogier.\\nEl equipo fue dirigido por el preparador francés PH Sport, junto con las tecnologías de Citroën Racing."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%9A%D0%BE%D0%B1%D1%83%D0%BB%D0%B5%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/%D0%9D%D0%B0%D0%B1%D0%B5%D1%80%D0%B5%D0%B6%D0%BD%D0%B0%D1%8F_%D0%B2_%D0%9A%D0%BE%D0%B1%D1%83%D0%BB%D0%B5%D1%82%D0%B8.jpg","page_title":"Кобулети","context_page_description":"Кобуле́ти — Аджари курорт хули, Батумирен 21 çм çурçĕрелле вырнаçнă."},{"page_url":"https://war.wikipedia.org/wiki/Mediaster_australiensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/BIOL._RESULTS_ENDEAVOUR%2C_Vol._IV%2C_part_I._Plate_IX_Mediaster_australiensis.jpg","page_title":"Mediaster australiensis","context_page_description":"An Mediaster australiensis in uska species han Asteroidea nga ginhulagway ni Hubert Lyman Clark hadton 1916. An Mediaster australiensis in nahilalakip ha genus nga Mediaster, ngan familia nga Goniasteridae.\\nMabibilngan ini ha New Zealand Exclusive Economic Zone. Waray hini subspecies nga nakalista."},{"page_url":"https://es.wikipedia.org/wiki/Olimpiada_Juvenil_Internacional_de_Ciencia","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Abertura_2008.jpg","page_title":"Olimpiada Juvenil Internacional de Ciencia","context_page_description":"La Olimpiada Juvenil Internacional de Ciencia es una competencia en Ciencias Naturales para estudiantes de hasta 15 años que ocurre todos los años desde 2004.\\nCincuenta países estuvieron en Corea del Sur en diciembre de 2008, con delegaciones compuestas de seis estudiantes y tres profesores."},{"page_url":"https://en.wikipedia.org/wiki/Lou_Henry_Hoover_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Lou_Henry_Hoover_House_from_E.jpg","page_title":"Lou Henry Hoover House","context_page_description":"The Hoover House, formally known as the Lou Henry Hoover House or the Lou Henry and Herbert Hoover House, is a historic house located on the campus of Stanford University in Stanford, California, United States. Completed in 1920, it is the former house of Herbert Hoover, 31st President of the United States, and his wife Lou Henry Hoover, who designed it. It is now the official home of the president of Stanford. In addition to its importance as a residence of the Hoovers, the house is a significant early example of the International Style of architecture. It was designated a National Historic Landmark in 1985."},{"page_url":"https://pl.wikipedia.org/wiki/Halwill_Junction","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Halwill._Railway_Station.jpg","page_title":"Halwill Junction","context_page_description":"Halwill Junction – wieś w Anglii, w Devon. Leży 48,4 km od miasta Exeter, 45,4 km od miasta Plymouth i 300 km od Londynu. W 2015 miejscowość liczyła 611 mieszkańców."},{"page_url":"https://sv.wikipedia.org/wiki/Trenal","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Map_commune_FR_insee_code_39537.png","page_title":"Trenal","context_page_description":"Trenal är en kommun i departementet Jura i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen Lons-le-Saunier-Sud som tillhör arrondissementet Lons-le-Saunier. År 2009 hade Trenal 366 invånare."},{"page_url":"https://ru.wikipedia.org/wiki/ICL-%D0%9A%D0%9F%D0%9E_%D0%92%D0%A1","image_url":"https://upload.wikimedia.org/wikipedia/ru/c/c1/%D0%9B%D0%BE%D0%B3%D0%BE%D1%82%D0%B8%D0%BF_ICL_%D0%9A%D0%9F%D0%9E_%D0%92%D0%A1.jpg","page_title":"ICL-КПО ВС","context_page_description":"ICL—КПО ВС — российская ИТ-компания, действующая в Казани. До середины 2014 года предприятие было интегрировано с японской корпорацией «Fujitsu»."},{"page_url":"https://ceb.wikipedia.org/wiki/Ch%C3%B3ra_Sfak%C3%ADon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Chora_Sfakion_banner.JPG","page_title":"Chóra Sfakíon","context_page_description":"Kapital sa munisipyo ang Chóra Sfakíon sa Gresya. Nahimutang ni sa prepektura sa Nomós Chaniás ug rehiyon sa Crete, sa habagatang bahin sa nasod, 300 km sa habagatan sa Athens ang ulohan sa nasod. 23 metros ibabaw sa dagat kahaboga ang nahimutangan sa Chóra Sfakíon, ug adunay 243 ka molupyo.\\nAng yuta palibot sa Chóra Sfakíon kay kabukiran sa amihang-kasadpan, apan sa amihang-sidlakan nga kini mao ang kabungtoran. Sa habagatan, dagat ang pinakaduol sa Chóra Sfakíon. Ang kinahabogang dapit sa palibot dunay gihabogon nga 482 ka metro ug 1.4 km sa amihanan sa Chóra Sfakíon. Ang kinadul-ang mas dakong lungsod mao ang Myriokéfala, 16.2 km sa sidlakan sa Chóra Sfakíon. Sa rehiyon palibot sa Chóra Sfakíon, kabukiran, ug mga lawis talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 19 °C. Ang kinainitan nga bulan Agosto, sa 28 °C, ug ang kinabugnawan Enero, sa 10 °C. Ang kasarangang pag-ulan 802 milimetro matag tuig. Ang kinabasaan nga bulan Disyembre, sa 169 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 7 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/East_Feliciana_Parish","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/East_Feliciana_Parish_Courthouse_Clinton_La1.jpg","page_title":"East Feliciana Parish","context_page_description":"Das East Feliciana Parish ist ein Parish im US-Bundesstaat Louisiana der Vereinigten Staaten. Im Jahr 2010 hatte das Parish 20.267 Einwohner und eine Bevölkerungsdichte von 17,3 Einwohner pro Quadratkilometer. Der Verwaltungssitz ist Clinton, benannt nach dem New Yorker Gouverneur DeWitt Clinton."},{"page_url":"https://pt.wikipedia.org/wiki/Forte_de_S%C3%A3o_Br%C3%A1s_de_Ponta_Delgada","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/ca/Forte_de_S%C3%A3o_Br%C3%A1s%2C_Museu%2C_Ponta_Delgada%2C_ilha_de_S%C3%A3o_Miguel%2C_A%C3%A7ores.JPG","page_title":"Forte de São Brás de Ponta Delgada","context_page_description":"O Forte de São Brás, oficialmente Prédio Militar nº 001/Ponta Delgada, também referido como Castelo de São Brás, localiza-se na freguesia de São José, na cidade e concelho de Ponta Delgada, na ilha de São Miguel, nos Açores.\\nConsiderado o mais importante exemplar de arquitectura militar do século XVI e a mais poderosa fortificação da ilha, foi erguido sobre uma ponta no primitivo ancoradouro de ponta Delgada, com a função de sua defesa contra os ataques de piratas e corsários, outrora frequentes nesta região do Oceano Atlântico."},{"page_url":"https://fr.wikipedia.org/wiki/Orm%C3%A1ns%C3%A1g","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Orm%C3%A1ns%C3%A1gi_n%C3%A9pviselet_Feszty.jpg","page_title":"Ormánság","context_page_description":"L'Ormánság est une petite région culturelle du sud de la Hongrie, comprise dans le comitat de Baranya autour des localités de Sellye et Vajszló. Cette région est considérée comme une des plus pauvres du pays."},{"page_url":"https://es.wikipedia.org/wiki/Municipio_de_Middlesex_(condado_de_Butler,_Pensilvania)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Map_of_Middlesex_Township%2C_Butler_County%2C_Pennsylvania_Highlighted.png","page_title":"Municipio de Middlesex (condado de Butler, Pensilvania)","context_page_description":"El municipio de Middlesex es un municipio ubicado en el condado de Butler en el estado estadounidense de Pensilvania. En el año 2000 tenía una población de 5.586 habitantes y una densidad poblacional de 93.9 personas por km².​"},{"page_url":"https://br.wikipedia.org/wiki/Anctoville-sur-Boscq","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Anctoville-sur-Boscq_-_Manoir.JPG","page_title":"Anctoville-sur-Boscq","context_page_description":"Anctoville-sur-Boscq a zo ur gumun eus departamant ar Manche e Bro-C'hall."},{"page_url":"https://zh.wikipedia.org/zh-cn/2009%E5%B9%B4%E7%BE%8E%E6%B4%B2%E9%87%91%E7%9B%83","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6f/Gillette_Stadium01.jpg","page_title":"2009年美洲金盃","context_page_description":"2009年美洲金杯是中北美洲及加勒比海足球协会举办的第十届美洲金杯，决赛周于2009年7月3日至7月26日在美国举行。是届赛事并无邀请其他洲份球队参与。决赛当日，墨西哥以 5–0 击败美国，第五度捧走美洲金杯，并自1963年来第八次成为中北美洲及加勒比海冠军。"},{"page_url":"https://ro.wikipedia.org/wiki/Suillus_bovinus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Boletus_rubellus_20080913wb.JPG","page_title":"Suillus bovinus","context_page_description":"Suillus bovinus din încrengătura Basidiomycota în familia Suillaceae și de genul Suillus, este o ciupercă comestibilă care coabitează, fiind un simbiont micoriza. Buretele este numit în popor lumânărică sau sfârcuri uscate. Apare în România, Basarabia și Bucovina de Nord foarte des, numai sub pini pe soluri sărace și acide, dar câteodată și pe cele calcaroase, prin păduri de conifere sau mixte, bărăgan și mlaștini, mai frecvent întâlnit în zonele de câmpie, mai rar se găsește în regiunile subalpine. Apare deseori în mase, dezvoltându-se în grupuri de tufe în apropierea pomului simbiont, din iulie până în octombrie."},{"page_url":"https://pl.wikipedia.org/wiki/Kleszczowate","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Ixodholcapit.jpg","page_title":"Kleszczowate","context_page_description":"Kleszczowate – rodzina pajęczaków z podgromady roztoczy i rzędu kleszczy. Liczy ponad 700 opisanych gatunków. Takson kosmopolityczny. Przedstawiciele są obligatoryjnymi pasożytami zewnętrznymi kręgowców lądowych. Mają w cyklu życiowym trzy stadia rozwoje: larwę, nimfę i postać dorosłą oraz 1–3 żywicieli. Larwy mają trzy, a pozostałe stadia cztery pary odnóży. Samce mają grzbietową stronę idiosomy w całości, a samice i stadia młodociane w przedniej części przykrytą tarczką grzbietową. W zapisie kopalnym znane od kredy.\\nPajęczaki te żerując mogą wywoływać różne choroby, jak również są przenosicielami innych organizmów chorobotwórczych. Wskutek tego mają duże znaczenie medyczne i weterynaryjne."},{"page_url":"https://en.wikipedia.org/wiki/Culling","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/At_the_drafting_race_from_The_Powerhouse_Museum_Collection.jpg","page_title":"Culling","context_page_description":"In biology, culling is the process of segregating organisms from a group according to desired or undesired characteristics. In animal breeding, it is the process of removing or segregating animals from a breeding stock based on specific trait. This is done to exaggerate desirable characteristics, or to remove undesirable characteristics by altering the genetic diversity of the population. For livestock and wildlife, culling often refers to the act of killing removed animals based on their individual characteristics, such as their sex or species membership.\\nIn fruits and vegetables, culling is the sorting or segregation of fresh harvested produce into marketable lots, with the non-marketable lots being discarded or diverted into food processing or non-food processing activities. This usually happens at collection centres located at, or close to farms."},{"page_url":"https://ckb.wikipedia.org/wiki/%D8%A8%DA%95%DB%8C%D8%A7%D8%B1%D9%86%D8%A7%D9%85%DB%95%DB%8C_%D9%A5%D9%A4%D9%A1%DB%8C_%D8%A6%DB%95%D9%86%D8%AC%D9%88%D9%85%DB%95%D9%86%DB%8C_%D8%A6%D8%A7%D8%B3%D8%A7%DB%8C%D8%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/TRNC_location.png","page_title":"بڕیارنامەی ٥٤١ی ئەنجومەنی ئاسایش","context_page_description":"بڕیارنامەی ٥٤١ی ئەنجومەنی ئاسایشی نەتەوە یەکگرتووەکان کە لە ڕێکەوتی ١٨ی تشرینی دووەمی ١٩٨٣دا پەسندکرا، بەڵگەیەکی نێونەتەوەیییە لەمەڕ قوبرس. ئەم بڕیارنامەیە لە دوای کۆبوونەوەی ژمارەی ٢٬٥٠٠‌ەم، بە ١٣ دەنگی لەگەڵ، ١ی دژ و ١ی بێ‌لایەن پەسندکرا."},{"page_url":"https://fr.wikipedia.org/wiki/Louis_de_Cambac%C3%A9r%C3%A8s","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Bouguereau_-_Z%C3%A9na%C3%AFde_de_Cambac%C3%A9r%C3%A8s_%281857-1932%29.jpg","page_title":"Louis de Cambacérès","context_page_description":"Louis-Joseph-Napoléon, comte de Cambacérès, est un homme politique français."},{"page_url":"https://vi.wikipedia.org/wiki/Pitcairnia_elvirae","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Pitcairnia_elvirae_%28TS%29_2-001023.jpg","page_title":"Pitcairnia elvirae","context_page_description":"Pitcairnia elvirae là một loài thực vật có hoa trong họ Bromeliaceae. Loài này được D.C.Taylor & H.Rob. miêu tả khoa học đầu tiên năm 1999."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%B8%D0%BA%D0%BE%D1%81%D0%BD%D0%BE%D0%B2%D0%B5%D0%BD%D0%B8%D0%B5_%D0%B0%D0%BD%D0%B3%D0%B5%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Touched_by_an_Angel.jpg","page_title":"Прикосновение ангела","context_page_description":"«Прикосновение ангела» — американский драматический сериал, который транслировался на CBS с 21 сентября 1994 года по 27 апреля 2003 года. Созданный Джоном Масиусом и произведенный Мартой Уильямсон, сериал рассказывал об ангеле Монике, которую играла Рома Дауни, помогающей различным людям в трудных ситуациях под наставничеством Тесс в исполнении Деллы Риз. В более поздних сезонах к сериалу присоединился Джон Дай в роли ангела смерти Эндрю и Валери Бертинелли в роли ещё одного ангела — Глории.\\nСериал добился коммерческого успеха и благоприятных отзывов от критиков. «Прикосновение ангела» был одним из самых рейтинговых сериалов канала CBS в девяностых годах. Сериал достиг пика популярности в сезоне 1997-98 гг., когда его смотрело в среднем более 21 миллиона зрителей. В период между 1997—2000 годами сериал одиннадцать раз выдвигался на соискание премии «Эмми», однако не выиграл ни одной премии. Также сериал неоднократно номинировался на премии «Золотой глобус» и Гильдии киноактёров США. В 1996 году был запущен спин-офф сериала под названием «Земля обетованная», который просуществовал три сезона."},{"page_url":"https://en.wikipedia.org/wiki/Kes_(Star_Trek)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Star_Trek_Voyager_costume_-_Kes.jpg","page_title":"Kes (Star Trek)","context_page_description":"Kes is a fictional character on the American science fiction television show Star Trek: Voyager. She is portrayed by actress Jennifer Lien. Set in the 24th century of the Star Trek universe, the series follows the crew of the starship USS Voyager, stranded far from home and struggling to get back to Earth. Kes is a member of the Ocampa who joins the crew in the series' premiere episode along with her Talaxian boyfriend, Neelix. She subsequently works as the Doctor's medical assistant and develops her mental abilities with Tuvok's assistance.\\nKes' storylines focus on her relationships with Neelix, the Doctor, Tuvok, Tom Paris, and Captain Janeway. Her psionic powers are also central and secondary themes of some episodes. Lien was removed from the series in the fourth season, but reprised her role in a season six episode, \\"Fury\\". Kes has been featured in non-canon novels and short stories adapted from the show.\\nCritical response to Kes was mostly negative, though some critics praised Lien's performance. Although Kes' relationship with Neelix was panned, critics had a more mixed-to-positive reaction to her friendships with Tuvok and Tom Paris."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%B2%D0%B5%D1%80%D1%85%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%B2%D1%8B%D1%80%D0%B0%D0%B2%D0%BD%D0%B8%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Vasyugan.jpg","page_title":"Поверхность выравнивания","context_page_description":"Поверхность выравнивания — выровненная поверхность в горах и на равнинах различного генезиса, главным образом — денудационного и аккумулятивного.\\nПоверхности выравнивания заканчивают развитие рельефа в заключительных стадиях геоморфологического цикла, который может быть полным, а может и прерываться. Полный, или законченный, геоморфологический цикл завершается образованием денудационных равнин, в том числе пенеплена. Более дробные хронологические интервалы являются незаконченными или прерванными, в результате чего формируется ступенчатый рельеф педипленов, а также мелкохолмисто-грядовый рельеф. Ещё более короткие циклы оставляют после себя ещё более расчленённый рельеф разных типов.\\nПоскольку одновременно со сносом из областей тектонических поднятий происходит и заполнение отрицательных форм рельефа, в которых образуются аккумулятивные поверхности выравнивания, Ю. А. Мещеряков предложил объединить их в единые цикловые полигенетические поверхности.\\nПолноцикловые поверхности выравнивания, имеющие, как полагают сейчас, раннемеловой и даже — мел-палеогеновый возраст, являются наиболее древними и исходными для формирования современного рельефа."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%84%AD%E8%97%BB%E5%A6%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/CHENG_TSAO_JU_%28Zheng_Zaoru%29_Signature_in_Chinese.png","page_title":"鄭藻如","context_page_description":"鄭藻如，字志翔，號豫軒、玉軒，廣東省廣州府香山縣人，清朝政治人物。"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B0%E0%A4%A4%E0%A4%A8%E0%A4%97%E0%A5%81%E0%A4%82%E0%A4%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Adenanthera_pavonina.jpg","page_title":"रतनगुंज","context_page_description":"रतनगुंज\\nरतनगुंज, वालगुंज\\nशिस्तबद्ध वाढणाऱ्या झाडांच्या घोळक्यात ज्याच्या बेशिस्त वाढीमुळे ओळखता येईल असे झाड म्हणजे रतनगुंज. एक झाड दुसऱ्यासारखं दिसत नाही. कोणाचेही लक्ष वेधून घेण्यासारखे या वृक्षात तसे काहीच नाही. या झाडाच्या लाल चुटूक गुंज बिया जेव्हा झाडाखाली पडलेल्या असतात तेव्हा कोणीही वाकून त्या उचलतोच.\\nचीन मलायाचा हा मूळ रहिवासी वृक्ष. भारतात कुठेच आढळत नाही. जे काही वृक्ष आहेत, ते बागेत किंवा रस्त्याच्या कडेला लावलेले आहेत. साधारणत: ३० ते ५० फुट उंच वाढणारा हा वृक्ष. पाने संयुक्त, फुले लंब तुऱ्यात सोनेरी रंगाची, फारशी आकर्षक नसलेली. लांब चपट्या शेंगा घोसात येतात. त्या बियांच्या जागी टपोऱ्या व इतर ठिकाणी चपट असतात. शेंगा सुकल्यावर गुंडाळल्या जातात आणि त्यातील बिया काही काळ तशाच राहून मग खाली पडतात.\\nझाडाचे लाकूड टणक असते आणि गाभा लालसर रंगाचा असतो. म्हणून त्याला लाल चंदन म्हणून संबोधले जाते. खऱ्या रक्तचंदनात भेसळ करण्यासाठी कधी कधी याचा उपयोग केला जातो. जिजामाता उद्यान, सागर उपवन, हॅंगिंग गार्डन या ठिकाणी हा वृक्ष आपल्याला बघायला मिळतो. त्याचप्रमाणे मुंबई येथे मेयो रोडवरील विज्ञान संस्थेच्या कोपऱ्यात एक झाड आहे."},{"page_url":"https://ja.wikipedia.org/wiki/%E6%9D%BF%E6%A9%8B%E9%A7%85_(%E6%96%B0%E5%8C%97%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/First_Floor_Concourse_of_Banqiao_Station.JPG","page_title":"板橋駅 (新北市)","context_page_description":"板橋駅は台湾新北市板橋区にある、台湾鉄路管理局縦貫線・台湾高速鉄道・台北捷運の駅。"},{"page_url":"https://et.wikipedia.org/wiki/Galiitsia-Vol%C3%B5%C3%B5nia_v%C3%BCrstiriik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Hungary%2C_Croatia%2C_Bosnia_and_Galicia_in_the_12th_century.jpg","page_title":"Galiitsia-Volõõnia vürstiriik","context_page_description":"Galiitsia-Volõõnia vürstiriik ehk Rus'i kuningriik oli Vene riik ajaloolistel Galiitsia ja Volõõnia aladel, mis tekkis Galiitsia ja Volõõnia vürstiriikide ühendamisel.\\nRiik eksisteeris aastatel 1199–1349 ning oli koos Novgorodi ja Vladimiri-Suzdaliga üks kolmest tähtsamast võimukeskusest, mis tekkisid Kiievi-Vene riigi lagunemisel.\\nPärast mongolite sissetungi Kiievi-Venesse 1239–1241 oli Danilo Romanovitš 1246. aastal sunnitud vanduma truudust Batu-khaanile ja Kuldhordile. Sellegipoolest üritas ta Mongolite ikke alt vabaneda ja ebaõnnestunult sõlmida sõjalisi liitlassuhteid teiste Euroopa valitsejatega. Poola kuningas vallutas vürstiriigi 1349. aastal ja sellega lõppesid ka vasallisuhted Kuldhordiga.\\nGaliitsia-Volõõnia territoorium paiknes läänes Sani ja Wieprzi jõe vahel tänapäeva Kagu-Poolas, idaalad katsid Pinski raba tänapäeva Valgevenes ja lõunas ulatus see Lõuna-Bugi jõeni tänapäeva Ukrainas. Vürstiriigi ümber paiknesid Must-Vene, Leedu suurvürstiriik, Turovi-Pinski vürstiriik, Kiievi vürstiriik, Kuldhord, Ungari kuningriik, Poola kuningriik, Moldova vürstiriik ja Saksa ordu valdused Preisimaal."},{"page_url":"https://en.wikipedia.org/wiki/List_of_H%C5%8Dry%C5%AB-ji_Treasures_at_Tokyo_National_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Heart_Sutra_on_Palm_Leaves_1_%28TNM_N-8%29.jpg","page_title":"List of Hōryū-ji Treasures at Tokyo National Museum","context_page_description":"This list is of the Treasures of Hōryū-ji at Tokyo National Museum."},{"page_url":"https://no.wikipedia.org/wiki/Den_tyrkiske_rivieraen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Fethiye_Amyntas.jpg","page_title":"Den tyrkiske rivieraen","context_page_description":"Den tyrkiske rivieraen er et begrep som blir benyttet til å beskrive et område sørvest i Tyrkia som omfatter provinsene Antalya, Muğla og deler av Aydın, det sørlige İzmir og det vestlige Mersin. Området trekker til seg mange turister fra både Tyrkia og utlandet.\\nAv arkeologiske steder finnes to av de syv underverker; ruinene av Mausoleet i Halikarnassos og Artemistempelet i Efesos.\\nKysten har vævrt hjemsted for vitenskapsfolk, helgener, krigere, konger og helter, samt åsted for mange kjente myter. Marcus Antonius av Romerriket skal ha valgt Den tyrkiske rivieraen som den vakreste bryllupsgaven til Kleopatra av Egypt. St. Nikolas, senere kjent som julenissen, ble født i Demre, en liten by nær dagens Antalya. Herodotos, som blir regnet som den første historikeren, ble født i Bodrum i ca. år 484 f.kr. Vulkanfjellene vest for Antalya, nær Dalyan, skal ha vært inspirasjon for den mytiske Kimære - det ildsprutende monsteret som Bellerofon drepte."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_di_San_Matteo_(Bisceglie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Bisceglie_chiesa_San_Matteo_3.JPG","page_title":"Chiesa di San Matteo (Bisceglie)","context_page_description":"La chiesa di San Matteo, è una chiesa di Bisceglie edificata nell'XI secolo all'interno della cinta muraria, nell'omonimo largo, e ricostruita nel XVII secolo."},{"page_url":"https://de.wikipedia.org/wiki/Mert_Nobre","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Nobre%2713-14.JPG","page_title":"Mert Nobre","context_page_description":"Márcio Ferreira Nobre, auch bekannt als Mert Nobre in der Türkei, ist ein brasilianischer Fußballtrainer und ehemaliger -spieler, der seit August 2006 auch die türkische Staatsangehörigkeit besitzt."},{"page_url":"https://tr.wikipedia.org/wiki/Riverside_M%C3%BCzesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Class_15F_Locomotive_3007_in_George_Square_in_2007.jpg","page_title":"Riverside Müzesi","context_page_description":"Riverside Müzesi Glasgow, İskoçya'nın kentsel dönüşüme uğramış ilçesinde Glasgow Limanı'ndaki Pointhouse Quay'de bulunan müzedir. Müze Haziran 2011'de açılmıştır. 18 Mayıs 2013 tarihinde, müzenin 2013 yılındaki Avrupa Yılın Müzesi Ödülü sahibi olduğu açıklanmıştır.\\n2015'te, yıl boyunca müze 1,131,814 ziyaretçiye sahip olmuştur ki bu durum da müzeyi İskoçya'daki en popüler beşinci yer yapmıştır."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AD%D9%88%D8%B0%D8%A7%D9%86_%D9%85%D8%B5%D9%82%D9%88%D9%84_%D8%A7%D9%84%D8%A3%D9%88%D8%B1%D8%A7%D9%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Adders_tongue_spearwort.jpg","page_title":"حوذان مصقول الأوراق","context_page_description":"الحوذان مصقول الأوراق نوع نباتي يتبع جنس الحوذان من الفصيلة الحوذانية."},{"page_url":"https://nl.wikipedia.org/wiki/3_juli","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Pim_Jacobs.png","page_title":"3 juli","context_page_description":"3 juli is de 184ste dag van het jaar in de gregoriaanse kalender. Hierna volgen nog 181 dagen tot het einde van het jaar."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%D8%B1%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/CERN1969.png","page_title":"سرن","context_page_description":"یورپی ادارہ برائے جوہری تحقیق جس کا مخفف سرن ہے اور اسی نام سے مشہور ہے، یورپ کا ایک تحقیقی ادارہ ہے جس نے 1954ء سے جنیوا میں ذراتی طبیعیات کی سب سے بڑی تجربہ گاہ قائم کی۔ یہ تجربہ گاہ جنیوا کے شمال مغربی مضافاتی علاقے میں فرانس سوئس سرحد پر قائم ہے۔ اس وقت اس کے 21 رکن ممالک ہیں۔ اسرائیل پہلا غیر یورپی ملک ہے، جسے مکمل رکنیت دی گئی ہے۔ جب کہ پاکستان اور ترکی معاون رکن ہیں۔\\nعام طور پر سرن کی اصطلاح اس تجربہ گاہ کے لیے استعمال کی جاتی ہے جس میں 2013ء تک 608 جامعات و تحقیقی اداروں کا، 2،513 افراد پر مشتمل عملہ، 12,313 معاونین عملہ، شاگرد، مہمان سائنسدان اور انجینئرز شریک ہو چکے تھے۔"},{"page_url":"https://bar.wikipedia.org/wiki/Angkor_Thom","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Bantay_srei.jpg","page_title":"Angkor Thom","context_page_description":"Angkor Thom woa de oide Haubtstood vo de oidn Khmea in Kambodscha. Eigentli woans merare Städ, de ned weid ausanaunda aglegt woan. Den merare Kini hom se a neiche Stod beim Tonle-Sapsee baud mid de Tempön und große Wossaschpeicha und umadum woan de Hittn vom Voik. De oidn Zentren san owa ned afgebn wuan, de Leid hom jo weida doat glebd und so hod se a oazige Stood mid oan Umfaung vo 35 km² eagem. Des is owa a de Gschicht vo de Khmea vom easchtn Großkini Jayavaraman II. bis za eanan Untagaung 1431/32 unta eanan leztn Kini Jayavarman Paramesvara."},{"page_url":"https://pt.wikipedia.org/wiki/Vijaya_Stambha","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Vijay_Stamb_View_from_Chittor.jpg","page_title":"Vijaya Stambha","context_page_description":"A Vijaya Stambha é uma torre localizada em Chittorgarh Fort Village, em Chittorgarh, no distrito do Rajastão, Índia. A torre foi construída pelo sultão de Mewar, Rana Kumbha em dezembro de 1448 para comemorar sua vitória sobre os exércitos combinados de Malwa e Gujarat, liderados por Mahmud Khilji. A torre é dedicada a Vishnu, que encontra-se em um pedestal de 10 m e decorada à coluna do templo. Sua estrutura de forma quadrangular desenvolve-se em uma altura de 9 andares, perfurada com aberturas e varandas e orientada para os quatro cantos cardinais de acordo com a tradição da Mongólia. Os 157 degraus da escada interna levam ao terraço, alternando entre os quartos centrais e a galeria externa. Sua estrutura de arenito vermelho é revestida de mármore branco, decorada com numerosas representações de deuses e deusas hindus, além de alegorias das estações, armas e instrumentos musicais, um verdadeiro inventário de livros de estatuária e escultura, da iconografia hindu.\\nAo pé da torre, a esplanada, é acessível por dois portões monumentais, que serviu para a cremação dos soberanos e suas esposas."},{"page_url":"https://de.wikipedia.org/wiki/Josef_Steiner_(Maler)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/386_Schnitter_und_badende_Frauen_am_See.jpg","page_title":"Josef Steiner (Maler)","context_page_description":"Josef Steiner war ein deutscher Maler und Grafiker, Expressionist und Mitglied der Berliner Secession.\\nDer Meisterschüler von Karl Hofer stellte um 1930 mit den wichtigsten Künstlern der modernen Kunst wie Otto Dix, Alexej von Jawlensky und Wassily Kandinsky aus und pflegte Freundschaften mit Max Pechstein, Willy Jaeckel und George Grosz. Max Liebermann ernannte Josef Steiner zum Juror für Kunstausstellungen in Berlin. Von 1928 bis 1937 erlebte Josef Steiner seine künstlerische Berliner Hochblütezeit und wurde in renommierten Kunstzeitschriften häufig publiziert und auf Titelseiten neben Ernst Barlach und Lyonel Feininger präsentiert. Auf dem Höhepunkt seiner Karriere verlor er unter dem NS-Regime sein Werk und wurde wegen Hochverrats und staatsfeindlicher Gesinnung verhaftet und in einem Hinrichtungsgefängnis inhaftiert. Es folgte die endgültige „Entartung“ mit Berufsverbot. Josef Steiner lebte ab 1940 zwanzig Jahre in bitterster Armut in München und arbeitete als freischaffender Künstler."},{"page_url":"https://it.wikipedia.org/wiki/(S,S)-butanodiolo_deidrogenasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/3a28.jpg","page_title":"(S,S)-butanodiolo deidrogenasi","context_page_description":"La (S, S)-butanodiolo deidrogenasi è un enzima appartenente alla classe delle ossidoreduttasi, che catalizza la seguente reazione:\\n(S, S)-butano-2,3-diolo + NAD⁺ ⇄ acetoina + NADH + H⁺"},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%A4%E0%A9%8B%E0%A8%B2%E0%A9%87%E0%A8%A6%E0%A9%8B,_%E0%A8%B8%E0%A8%AA%E0%A9%87%E0%A8%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/1_toledo_spain_aerial_panorama_2014.jpg","page_title":"ਤੋਲੇਦੋ, ਸਪੇਨ","context_page_description":"ਤੋਲੇਦੋ ਕੇਂਦਰੀ ਸਪੇਨ ਵਿੱਚ ਸਥਿੱਤ ਇੱਕ ਨਗਰਪਾਲਿਕਾ ਹੈ ਜੋ ਮਾਦਰਿਦ ਤੋਂ 70 ਕਿਲੋਮੀਟਰ ਦੱਖਣ ਵੱਲ ਪੈਂਦੀ ਹੈ। ਇਹ ਸਪੇਨੀ ਸੂਬੇ ਤੋਲੇਦੋ ਅਤੇ ਖ਼ੁਦਮੁਖ਼ਤਿਆਰ ਭਾਈਚਾਰੇ ਕਾਸਤੀਲੇ-ਲਾ ਮਾਂਚਾ ਦੀ ਰਾਜਧਾਨੀ ਹੈ। ਇਸਨੂੰ 1986 ਵਿੱਚ ਯੂਨੈਸਕੋ ਦੁਆਰਾ ਵਿਸ਼ਵ ਵਿਰਾਸਤ ਟਿਕਾਣਾ ਘੋਸ਼ਿਤ ਕੀਤਾ ਗਿਆ।"},{"page_url":"https://it.wikipedia.org/wiki/OOPArt","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Moai_Rano_raraku.jpg","page_title":"OOPArt","context_page_description":"OOPArt è un termine coniato dal naturalista e criptozoologo americano Ivan T. Sanderson per dare un nome a una categoria di oggetti che sembrerebbero avere una difficile collocazione storica, ossia rappresenterebbero un anacronismo. Vengono classificati come OOPArt tutti quei reperti archeologici o paleontologici che, secondo comuni convinzioni riguardo al passato, si suppone non sarebbero potuti esistere nell'epoca a cui si riferiscono le datazioni iniziali.\\nDa questi ritrovamenti, è nato il filone dell'archeologia misteriosa o pseudoarcheologia. La comunità scientifica non ha mai ritrovato in tali oggetti elementi o prove che le facessero apparire come \\"fuori dal tempo\\", relegando le interpretazioni volte a sottolineare presunti anacronismi nell'ambito della pseudoscienza. Molti OOPArt hanno infatti ricevuto un'interpretazione del tutto coerente con le attuali conoscenze archeologiche e scientifiche."},{"page_url":"https://pt.wikipedia.org/wiki/M%C3%A9todo_de_Euler","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Numerical_integration_illustration%2C_h%3D1.png","page_title":"Método de Euler","context_page_description":"Em matemática e ciência computacional, o método de Euler, cujo nome relaciona-se com Leonhard Euler, é um procedimento numérico de primeira ordem para solucionar equações diferenciais ordinárias com um valor inicial dado. É o tipo mais básico de método explícito para integração numérica para equações diferenciais ordinárias."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B2%E0%A5%80_%E0%A4%AE%E0%A4%BF%E0%A4%A8-%E0%A4%B9%E0%A5%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Lee_Minho_LG.jpg","page_title":"ली मिन-हो","context_page_description":"ली मिन-हो एक दक्षिण कोरियाई अभिनेता और गायक है। उन्होंने पहली बार 2009 में बॉयज़ ओवर फ्लॉवर में गु जून-पाययो के रूप में उनकी भूमिका के साथ कोरिया और एशिया के कुछ हिस्सों में व्यापक प्रसिद्धि प्राप्त की। इस भूमिका ने उन्हें 45 वें बाकसांग कला पुरस्कारों में सर्वश्रेष्ठ अभिनेता का पुरस्कार जीता। वह सिटी हंटर, द हीर्स और लीजेंड ऑफ द ब्लू सी में उनकी प्रमुख भूमिकाओं के लिए प्रसिद्ध हैं। पूरे एशिया में ली के टेलीविजन नाटकों की सफलता ने उन्हें शीर्ष हल्ली स्टार के रूप में स्थापित किया। ली ने गैंगनाम ब्लूज़ के साथ फिल्म में अपनी पहली प्रमुख भूमिका में अभिनय किया, इसके बाद उनकी पहली चीन निर्मित फिल्म बाउंटी हंटर थी। हंगुल: 이민호; हांजा: 李敏鎬"},{"page_url":"https://de.wikipedia.org/wiki/Bezirk_Hartberg-F%C3%BCrstenfeld","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Rohr_bei_Hartberg_im_Bezirk_HF.png","page_title":"Bezirk Hartberg-Fürstenfeld","context_page_description":"Der Bezirk Hartberg-Fürstenfeld ist ein politischer Bezirk des Landes Steiermark. Die größte Stadt ist Fürstenfeld, dicht gefolgt von Hartberg und Pöllau.\\nEr grenzt im Nordwesten und Westen an den Bezirk Weiz und im Süden an den Bezirk Südoststeiermark. Im Osten grenzt er an die burgenländischen Bezirke Oberwart, Güssing und Jennersdorf sowie im Norden an die niederösterreichischen Bezirke Neunkirchen und Wiener Neustadt-Land."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%87%D5%A1%D5%BC%D5%AC_%D5%96%D6%80%D5%A5%D5%B5%D5%BD%D5%AB%D5%B6%D5%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Freycinet%2C_de_Saulces_de%2C_Charles%2C_Nadar%2C_Gallica.jpg","page_title":"Շառլ Ֆրեյսինե","context_page_description":"Շառլ Ֆրեյսինե, ֆրանսիացի քաղաքական և պետական գործիչ, չորս անգամ գլխավորել Է Ֆրանսիայի նախարարների կաբինետը:"},{"page_url":"https://es.wikipedia.org/wiki/Browning_M2","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0a/M2_Machine_gun_on_flak.JPG","page_title":"Browning M2","context_page_description":"La M2 o ametralladora Browning calibre .50 es una ametralladora pesada diseñada a finales de la Primera Guerra Mundial por John Browning. Su diseño es similar a la ametralladora Browning M1919, que dispara el cartucho .30-06 Springfield. La M2 dispara el cartucho más grande y potente 12,7 x 99 OTAN, que fue desarrollado paralelamente con el arma y toma su nombre a partir de esta. Los soldados la apodaron «Ma Deuce», ​ por el M2 de su designación. Esta ametralladora tiene varias designaciones específicas; la designación oficial estadounidense para el modelo de infantería es Ametralladora Browning, Calibre .50, M2, HB, Flexible. Es un arma efectiva contra infantería, vehículos y embarcaciones sin blindaje o ligeramente blindados, fortificaciones ligeras y aviones a baja altitud.\\nLa Browning M2 fue ampliamente utilizada como armamento de vehículos y aviones por Estados Unidos desde la década de 1930 al presente. Fue utilizada en la Segunda Guerra Mundial, la Guerra de Corea, la Guerra de Vietnam, la Guerra de las Malvinas, la Guerra de Irak y la Guerra de Afganistán. Es la principal ametralladora pesada de los países miembros de la OTAN, además de ser empleada por varios países."},{"page_url":"https://war.wikipedia.org/wiki/Turbo_castanea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Turbo_castanea_002.jpg","page_title":"Turbo castanea","context_page_description":"Turbo castanea in uska species han Gastropoda nga ginhulagway ni Gmelin hadton 1791. An Turbo castanea in nahilalakip ha genus nga Turbo, ngan familia nga Turbinidae. Nag-uusahan nga subspecies: T. c. crenulatus."},{"page_url":"https://simple.wikipedia.org/wiki/Robert_J._Walker","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/WALKER%2C_Robert_J-Treasury_%28BEP_engraved_portrait%29.jpg","page_title":"Robert J. Walker","context_page_description":"Robert John Walker was an American lawyer, economist and politician. He was in the Democratic Party. He was a senator from Mississippi from 1835 until 1845. He was the Secretary of the Treasury from 1845 to 1849 under President James K. Polk. He was the Territorial Governor of Kansas in 1857."},{"page_url":"https://vi.wikipedia.org/wiki/Navoiy_(t%E1%BB%89nh)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Navoiy_districts.png","page_title":"Navoiy (tỉnh)","context_page_description":"Tỉnh Navoiy là một tỉnh của Uzbekistan. Tỉnh nằm ở phía tây bắc của đất nước. Sa mạc Kyzyl-Kum chiếm một phần lớn lãnh thổ của mình, là lớn nhất của các tỉnh Uzbekistan trừ Cộng hòa Tự trị Qaraqalpaqstan. Navoiy giáp biên giới với Kazakhstan, tỉnh Samarqand, tỉnh Buxoro và Cộng hòa Qaraqalpaqstan. Tỉnh có diện tích 110.800 km2. Dân số được ước tính là khoảng 767.500 người, với khoảng 60% sống ở nông thôn.\\nTỉnh Navoiy được chia thành 8 huyện hành chính. Thủ đô là Navoiy. Các thị trấn lớn khác bao gồm Qiziltepa, Nurota, Uchquduq, Zarafshon, và Yangirabot.\\nKhí hậu khu vực là lục địa thường khí hậu bán sa mạc.\\nTỉnh Navoiy có nguồn tài nguyên thiên nhiên quan trọng, đặc biệt là khí đốt tự nhiên, dầu khí, và kim loại quý, cộng với nguyên liệu để xây dựng. Nền kinh tế của tỉnh là phụ thuộc nhiều vào khai thác mỏ lớn, luyện kim, và các khu phức hợp sản xuất hóa chất. Các mỏ Navoi và Zarafshan sản xuất một số vàng tinh khiết nhất của thế giới.\\nSản phẩm nông nghiệp hàng đầu bông và cừu Karakul. Khoảng 90% của toàn bộ khu vực được coi là có tiềm năng đất nông nghiệp giàu có, nếu một nguồn nước cho thủy lợi có thể được đặt."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%94%BF%E6%B2%BB%E5%8D%8F%E5%95%86%E4%BC%9A%E8%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Zhengxielitang.jpg","page_title":"政治协商会议","context_page_description":"政治协商会议，指的是1945年至1946年中华民国大陆时期由中国国民党、中国共产党以及各民主党派为抗战后的和平整顿国内事务在重庆召开的对中国近现代史和当今中国有重要而深远影响的会议。\\n20世纪40年代末，中国国民党和中国共产党两支政治力量围绕着中国的前途和未来，在政治上和军事上展开激烈较量。政治协商会议恰是这次政治较量的最高潮。它不仅很大程度上决定中国近现代史的进程，也为中国的政府结构和政治形式留下很深的影响。\\n1949年9月由中国共产党主导的中国人民政治协商会议经过多党协商，通过与1946年政协决议之《和平建国纲领》类似的《共同纲领》。中共将1949年的政协称为“新政协”或“人民政协”，而将1946年政治协商会议称为“旧政协”。"},{"page_url":"https://it.wikipedia.org/wiki/Miguel_Fisac","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Altar_de_la_Iglesia_del_Colegio_Padres_Dominicos_%28Valladolid%29.jpg","page_title":"Miguel Fisac","context_page_description":"Miguel Fisac Serna è stato un architetto, urbanista e pittore spagnolo."},{"page_url":"https://eu.wikipedia.org/wiki/La_Latina_geltokia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Madrid_Metro_-_La_Latina.jpg","page_title":"La Latina geltokia","context_page_description":"La Latina geltokia, Madrilgo metroaren geltoki bat da, Espainiako Madril hiriburuko Centro barrutiko Latina auzoan.\\n1968ko ekainaren 5ean inauguratu zen.\\nDatuak: Q1115250\\nMultimedia: Estación de La Latina"},{"page_url":"https://de.wikipedia.org/wiki/Sebastian_Castellio","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Sebastian_Castellio.jpg","page_title":"Sebastian Castellio","context_page_description":"Sebastian Castellio war ein französischer humanistischer Gelehrter, Philosoph und protestantischer Theologe. Als Verteidiger der Glaubens- und Gewissensfreiheit gegen Johannes Calvin entwickelte er in seinen Schriften eine Theorie der religiösen und allgemeinen geistigen Toleranz."},{"page_url":"https://hu.wikipedia.org/wiki/Oxoanion","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Ammonium-metavanadate-chains-3D.png","page_title":"Oxoanion","context_page_description":"Az oxoanionok AₓOz−y általános képlettel leírható összetett anionok, ahol A valamely kémiai elem, O pedig oxigénatom. Az elemek nagy többsége képez oxoaniont. Az egyszerű oxoanionok képletét az oktettszabály határozza meg. A kondenzációs reakcióval keletkező oxoanionok szerkezete leírható éleken vagy csúcsokon érintkező AOₙ poliéder egységekkel. Az adenozin-monofoszfát, adenozin-difoszfát és adenozin-trifoszfát foszfát- és polifoszfát-észterek nagy biológiai jelentőséggel rendelkeznek."},{"page_url":"https://fr.wikipedia.org/wiki/Arum_maculatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Arum_maculatum_MS_8006.JPG","page_title":"Arum maculatum","context_page_description":"L’Arum tacheté ou le Gouet tacheté est une plante herbacée des régions tempérées de la famille des Araceae. L'inflorescence sapromyophile émet de la chaleur et diffuse des odeurs d'excréments pour attirer de petites mouches qui assurent la pollinisation. Il est parfois appelé la Chandelle, le Pied-de-veau, le Manteau de la Sainte-Vierge, la Pilette ou la Vachotte."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D8%B3%D8%A7%D8%AA%D8%B1%D9%86_(%D8%A7%DB%8C%E2%80%8C%DA%A9%DB%8C-%DB%B4%DB%B9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/USS_Saturn_%28F40%29_before_refitting_to_become_AF49_at_Norfolk%2C_VA.JPG","page_title":"یواس‌اس ساترن (ای‌کی-۴۹)","context_page_description":"یواس‌اس ساترن (ای‌کی-۴۹) یک کشتی بود که طول آن ۳۹۸٫۳ فوت بود. این کشتی در سال ۱۹۳۹ ساخته شد."},{"page_url":"https://gl.wikipedia.org/wiki/Penicilina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Penicillin_G.svg","page_title":"Penicilina","context_page_description":"As penicilinas son antibióticos do grupo dos betalactámicos empregados profusamente no tratamento de infeccións provocadas por bacterias sensibles. A maioría das penicilinas son derivados do ácido 6-aminopenicilánico, diferindo entre si segundo a substitución na cadea lateral do seu grupo amino. A bencilpenicilina ou penicilina G foi o primeiro antibiótico empregado amplamente en medicina; o seu descubrimento foi atribuído a Alexander Fleming en 1928, quen xunto cos científicos Ernst Boris Chain e Howard Walter Florey -que crearon un método para producir en masa o fármaco- obtivo o Premio Nobel de Medicina en 1945.\\nNon se coñece por completo o mecanismo de acción das penicilinas, aínda que a súa analoxía á D-alanil-D-alanina terminal, situada na cadea lateral peptídica da subunidade do peptidoglicano, suxire que o seu carácter bactericida deriva da súa intervención como inhibidor do proceso de transpeptidación durante a síntese daquel. Deste xeito, a penicilina actúa debilitando a parede bacteriana e favorecendo a lise osmótica da bacteria durante o proceso de multiplicación.\\nExiste unha gran diversidade de penicilinas."},{"page_url":"https://en.wikipedia.org/wiki/William_W._Kimball_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/20070110_United_States_Soccer_Federation.JPG","page_title":"William W. Kimball House","context_page_description":"The William W. Kimball House is a private residence located at 1801 Prairie Avenue in the Near South Side neighborhood of Chicago, Illinois. It was added to the National Register of Historic Places on December 9, 1971."},{"page_url":"https://nn.wikipedia.org/wiki/Skjelgribb","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Gyps_rueppellii_-Mara_river_crossing_-Africa.jpg","page_title":"Skjelgribb","context_page_description":"Skjelgribb er ein stor gribb i haukefamilien med utbreiing i det sentrale Afrika, inklusive Etiopia, Sudan, Tanzania og Guinea. Han har fått vitskapleg namn etter den tyske forskaren Eduard Rüppell."},{"page_url":"https://fr.wikipedia.org/wiki/Charles_O%27Bannon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Charles_o%27bannon.jpg","page_title":"Charles O'Bannon","context_page_description":"Charles O'Bannon, né le 22 février 1975 à Lakewood, aux États-Unis, est un joueur américain de basket-ball. Il évolue aux postes d'arrière et d'ailier. Son frère Ed est également basketteur."},{"page_url":"https://en.wikipedia.org/wiki/Hall,_Bishop%27s_Tawton","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/SirJohnIIIChichester1669OfHallQuarterings.JPG","page_title":"Hall, Bishop's Tawton","context_page_description":"Hall is a large estate within the parish and former manor of Bishop's Tawton, Devon. It was for several centuries the seat of a younger branch of the prominent and ancient North Devon family of Chichester of Raleigh, near Barnstaple. The mansion house is situated about 2 miles south-east of the village of Bishop's Tawton and 4 miles south-east of Barnstaple, and sits on a south facing slope of the valley of the River Taw, overlooking the river towards the village of Atherington. The house and about 2,500 acres of surrounding land continues today to be owned and occupied by descendants, via a female line, of the Chichester family. The present Grade II* listed neo-Jacobean house was built by Robert Chichester between 1844 and 1847 and replaced an earlier building. Near the house to the south at the crossroads of Herner the Chichester family erected in the 1880s a private chapel of ease which contains mediaeval woodwork saved from the demolished Old Guildhall in Barnstaple."},{"page_url":"https://sv.wikipedia.org/wiki/Schilda","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Schilda_in_EE.png","page_title":"Schilda","context_page_description":"Schilda är en kommun och ort i Landkreis Elbe-Elster i förbundslandet Brandenburg i Tyskland.\\nKommunen ingår i kommunalförbundet Amt Elsterland tillsammans med kommunerna Heideland, Rückersdorf, Schönborn och Tröbitz."},{"page_url":"https://nl.wikipedia.org/wiki/Caf%C3%A9_De_Unie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Rotterdam_mauritsweg_de_unie2011.jpg","page_title":"Café De Unie","context_page_description":"Café De Unie is een gebouw in Rotterdam naar ontwerp van architect J.J.P. Oud uit 1925. Het oorspronkelijke pand bevond zich aan het Calandplein en werd in 1940 verwoest. In 1986 kwam aan de Mauritsweg een replica van de markante gevel. Dat pand was vervolgens in gebruik als horecagelegenheid met theater en debatcentrum. Van 2014 t/m 2017 was het een homo-uitgaanscentrum en nadien een algemene horecazaak."},{"page_url":"https://cs.wikipedia.org/wiki/Perizonium","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Uk%C5%99i%C5%BEov%C3%A1n%C3%AD_z_T%C5%99ebon%C4%9B_%28detail_rou%C5%A1ky%29.jpg","page_title":"Perizonium","context_page_description":"Perizonium, též Perizoma je tkanina, která sloužila ve starověku jako spodní prádlo. Byl to pruh látky, který se protáhl mezi nohama a zavázal u pasu. Nejstarší zmínka sahá zpět do mínojské civilizace na ostrově Kréta."},{"page_url":"https://en.wikipedia.org/wiki/Grevillea_juniperina","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Grevillea_New_Blood_W155919.jpg","page_title":"Grevillea juniperina","context_page_description":"Grevillea juniperina, commonly known as juniper- or juniper-leaf grevillea or prickly spider-flower, is a plant of the family Proteaceae native to eastern New South Wales and south-eastern Queensland in Australia. Scottish botanist Robert Brown described the species in 1810, and seven subspecies are recognised. One subspecies, G. j. juniperina, is restricted to Western Sydney and environs and is threatened by loss of habitat and housing development.\\nA small prickly leaved shrub between 0.2 and 3 m high, G. juniperina grows generally on clay-based or alluvial soils in eucalypt woodland. The flower heads, known as inflorescences, appear from winter to early summer and are red, orange or yellow. Birds visit and pollinate the flowers. Grevillea juniperina plants are killed by bushfire, regenerating afterwards from seed. Grevillea juniperina adapts readily to cultivation and has been important in horticulture as it is the parent of many popular garden hybrids."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A4%91%EC%95%99%EB%B3%B4%ED%9B%88%EB%B3%91%EC%9B%90%EC%97%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Q16256810_VHS_Medical_Center_A02.jpg","page_title":"중앙보훈병원역","context_page_description":"중앙보훈병원역은 서울특별시 강동구 둔촌동에 위치한 서울 지하철 9호선의 전철역이다. 이 역부터 김포공항역까지 지하 구간이다. 심야에 4편성이 주박한다."},{"page_url":"https://he.wikipedia.org/wiki/Baojun_560","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Baojun_560_01_China_2016-04-01.jpg","page_title":"Baojun 560","context_page_description":"Baojun 560 הוא קרוסאובר קומפקטי המוגדר SUV, מתוצרת יצרנית הרכב הסינית Baojun אשר יוצר בין השנים 2015–2018.\\nהיצרן \\"Baojun\\" הוא חברת בת של \\"SAIC-GM-Wuling\\" בשליטה ובשיתוף קונצרן הרכב האמריקאי ג'נרל מוטורס, ויצרן הרכב הסיני \\"SAIC Motor\\"."},{"page_url":"https://en.wikipedia.org/wiki/Cassock","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/By_Grace_of_God%2C_Ignatius_Zakka_I_Iwas.jpg","page_title":"Cassock","context_page_description":"The cassock or soutane is a Christian clerical clothing coat used by the clergy of the Catholic Church and the Eastern Orthodox Church, in addition to certain Protestant denominations such as Anglicans and Lutherans. \\"Ankle-length garment\\" is the literal meaning of the corresponding Latin term, vestis talaris. It is related to the habit, which is traditionally worn by nuns, monks, and friars.\\nThe cassock derives historically from the tunic of classical antiquity that in ancient Rome was worn underneath the toga and the chiton that was worn beneath the himation in ancient Greece. In religious services, it has traditionally been worn underneath vestments, such as the alb.\\nIn the West, the cassock is little used today except for religious services, save for traditionalist Catholic clergy who continue to wear the cassock as their standard clerical attire. However, in many countries it was the normal everyday wear of the clergy until the 1960s, when it was largely replaced by clerical suits, distinguished from lay dress by being generally black and by a black shirt incorporating a clerical collar."},{"page_url":"https://pl.wikipedia.org/wiki/Ulica_Podzamcze_w_Lublinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Panorama_Stare_Miasto_i_Zamek_2.JPG","page_title":"Ulica Podzamcze w Lublinie","context_page_description":"Ulica Podzamcze w Lublinie - jedna z dużych arterii w centrum Lublina o długości 400 m. Jest częścią drogi wojewódzkiej nr 835. Trasa stanowi granicę dzielnic Śródmieście i Kalinowszczyzna. W pobliżu ronda im. metropolity Piotra Mohyły ulica jest dwujezdniowa, na pozostałym odcinku jednojezdniowa po jednym pasie ruchu w każdym kierunku. Niedaleko ulicy znajduje się Dworzec Główny PKS oraz wzgórze Czwartek, a nieco na południe Zamek Lubelski, od którego nazwa ulicy pochodzi. Obecnie wybudowano trakcję trolejbusową, z której korzysta linia nr 154."},{"page_url":"https://it.wikipedia.org/wiki/Ugliano","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Ugljan_7_from_st_Mihovila.jpg","page_title":"Ugliano","context_page_description":"Ugliano è un'isola della Dalmazia settentrionale, in Croazia, situata di fronte a Zara. Amministrativamente appartiene alla regione zaratina, suddivisa nei comuni di Oltre, Cuclizza e Calle.\\nL'isola è tra le più densamente popolate dell'Adriatico, nel 2011 contava 6 049 abitanti; le principali località sono: Ugliano, Lucorano, Sant'Eufemia, Pogliana, Oltre, Calle e Cuclizza."},{"page_url":"https://de.wikipedia.org/wiki/Trieste","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/31/Trieste_nh96807.svg","page_title":"Trieste","context_page_description":"Die Trieste war ein von Auguste Piccard konstruierter Bathyscaph, ein U-Boot, das speziell für die Tiefseeforschung gebaut wurde. Erste Pläne für dieses Unterwasserfahrzeug entwickelte Piccard im Jahr 1952, es wurde in Italien hergestellt und am 26. August 1953 vom Stapel gelassen. Dieses Fahrzeug war anfangs für Tauchtiefen bis zu 20.000 Fuß konzipiert.\\nBereits am 30. September 1953 führte die Trieste im Tyrrhenischen Meer bei Ponza einen Rekordtauchgang durch. Auguste Piccard und sein Sohn Jacques Piccard stießen dabei in ihrem Tauchgerät auf eine Tiefe von 3150 Meter vor. Dieser Rekord wurde jedoch 1954 durch den französischen Bathyscaphen FNRS-3 überboten, der vor der Küste des Senegal 4050 Meter tief tauchte.\\n1958 wurde das Boot von der US-Marine übernommen und war an mehreren Suchaktionen nach verschollenen Schiffen und U-Booten beteiligt, unter anderem an der Suche nach dem verlorenen Atom-U-Boot USS Thresher. Ab 1958 wurde das Fahrzeug umgerüstet, um für Tauchgänge in größeren Tiefen geeignet zu sein.\\nDie eigentliche Bathysphäre wurde vom Unternehmen Krupp-Maschinenbau in Essen hergestellt. Sie ließ nunmehr Tauchfahrten bis zu maximal 36.000 Fuß zu."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%85%E0%AE%A9%E0%AF%8D%E0%AE%9F%E0%AE%BF%E0%AE%AE%E0%AF%86%E0%AE%9A%E0%AF%81%E0%AE%95%E0%AF%8D%E0%AE%95%E0%AF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/%D8%A7%D9%86%D8%AF%DB%8C%D9%85%D8%B4%DA%A9_andimeshk.jpg","page_title":"அன்டிமெசுக்கு","context_page_description":"அன்டிமெசுக்கு என்ற இந்த நகரம், ஈரானின் கூசத்தான் மாகாணத்தின் அன்டிமெசுக்குக் கவுன்டியின் தலைநகரம் ஆகும். அன்டிமெசுக்கு நகரமானது, சூசு நகருக்கு வடக்கே, சுமார் 34 கிலோமீட்டர்கள் தொலைவில் அமைந்துள்ளது. தெகுரானுக்கும் அகுவாசுக்கும் இடையிலான தொடருந்து பாதைக்கருகில் அமைந்துள்ளது. இந்த பெயரானது, பொத்தேமியாவிலிருந்து உர் III காலத்திலிருந்து, கி.மு. 21 முதல் 20 ஆம் நூற்றாண்டு வரையில், \\"ஆடம்ஷாக்\\" வடிவத்தில், \\"முதலை நகரம்\\" என்று பொருள்படும் பெயரில் அழைக்கப்பட்டது. பின்னர், \\"ஏராளமான வெண்ணெய்\\" என்ற பொருள்படும் சொல்லில் அழைக்கப்பட்டது. அதன் பிறகு, உள்ளூர் கிராமங்களான கெய்ல்-ஏபி, லூர், இரண்டு கோட்டைகள் ஆகியன, இந்நகருடன் இணைக்கப் பட்டன.\\n1956 ஆம் ஆண்டு இந்த நகராட்சி என்ற நகராண்மைக் கழகம் தோற்றுவிக்கப்பட்டது."},{"page_url":"https://en.wikipedia.org/wiki/Gino_Severini","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Gino_severini%2C_mosaico%2C_1949_ca..JPG","page_title":"Gino Severini","context_page_description":"Gino Severini was an Italian painter and a leading member of the Futurist movement. For much of his life he divided his time between Paris and Rome. He was associated with neo-classicism and the \\"return to order\\" in the decade after the First World War. During his career he worked in a variety of media, including mosaic and fresco. He showed his work at major exhibitions, including the Rome Quadrennial, and won art prizes from major institutions."},{"page_url":"https://de.wikipedia.org/wiki/Johannes_Benk","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Kaiser_Franz_Joseph_Denkmal_.jpg","page_title":"Johannes Benk","context_page_description":"Johannes Benk war ein österreichischer Bildhauer."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%A1%D5%B4%D5%A1%D6%80%D5%A1%D5%B5%D5%AB_%D5%AF%D5%A1%D5%B4%D5%B8%D6%82%D6%80%D5%BB%D5%B6%D5%A5%D6%80","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bf/Sok_bridge_Samara.JPG","page_title":"Սամարայի կամուրջներ","context_page_description":"Ստորև ներկայացված են Սամարայի քաղաքային շրջանի կամուրջների և անցուղիների ցուցակը: Քաղաքում գործում են երեք կամուրջներ՝ ավտոմոբիլներ համար, և մեկ երկաթուղային կամուրջ, որոնք կառուցված են Սամարա գետի վրա: Մնացած կամուրջները հիմնականում կառուցված են անցուղիներում ու գետնանցումներում, որոնց մեծ մասը տեղակայված է Սամարա-Տոլյատի երկաթուղային ճանապարհի վերին և ստորին հատվածներում: Սամարայում սկսվել է երկար սպասված Ֆրունզեի կամրջի շինարարությունը: Կիրովի կամուրջը կապում է Սամարան Չերնոռեչե ավանին, որը կարճացրել է ճանապարհը, հասցնելով 10 րոպե ժամանակահատվածի: Այսօր համակարգված են տրանսպորտի ուղևորման և վերադարձի ժամերը:"},{"page_url":"https://sv.wikipedia.org/wiki/Hartzviller","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Map_commune_FR_insee_code_57299.png","page_title":"Hartzviller","context_page_description":"Hartzviller är en kommun i departementet Moselle i regionen Grand Est i nordöstra Frankrike. Kommunen ligger i kantonen Sarrebourg som tillhör arrondissementet Sarrebourg. År 2009 hade Hartzviller 905 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/Cotinus","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b0/Inflorescence.JPG","page_title":"Cotinus","context_page_description":"Le genre Cotinus comprend au moins deux espèces originaires des régions tempérées de l'hémisphère nord. Ce genre est proche du sumac. Les plus connus sont :\\nCotinus coggygria originaire d'Eurasie, dont la variété aux feuilles rouges est utilisée comme ornementation dans les espaces verts.\\nCotinus obovatus originaire d'Amérique du Nord.\\nCe sont des arbustes ou des petits arbres aux feuilles entières caduques. Ils sont aussi appelés « arbres à perruques », impression donnée par l'inflorescence femelle légère et filandreuse faite d'une multitude de pédoncules plumeux en larges panicules."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Frank_Gehry","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fd/IAC_building.jpg","page_title":"List of works by Frank Gehry","context_page_description":"Frank Gehry is a Pritzker Prize-winning architect. His buildings, including his private residence, have become tourist attractions. His style is sometimes described as Deconstructivist or postmodern, although he has rejected the second term."},{"page_url":"https://no.wikipedia.org/wiki/Praj%C3%B1%C4%81p%C4%81ramit%C4%81s%C5%ABtraen_i_100_000_vers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Status_of_Kuan_Yin.jpg","page_title":"Prajñāpāramitāsūtraen i 100 000 vers","context_page_description":"Prajñāpāramitāsūtraen i 100 000 vers er en mahāyānasūtra, en hellig tekst innenfor mahāyānabuddhismen. Den er den største av alle mahāyānatekstene, og er en del av den omfattende litteraturen som kalles prajñāpāramitā. Noen ganger brukes den upresise benevnelsen «den store prajñāpāramitāsūtraen».\\nUtgaven på 100 000 vers er bevart på sanskrit, og i oversettelser til tibetansk, kinesisk og mongolsk, hvorav den eldste er fra år 663 e.Kr. I tillegg finnes en eksegetisk tradisjon som omfatter kommentarer av indiske, tibetanske, sentralasiatiske og kinesiske forfattere.\\nPrajñāpāramitā er sanskrit og oversettes gjerne med «visdommens perfeksjon». En mer ordrett oversettelse er «visdommen som har trengt hinsides eller transcendert verdens lidelse». Dette er et teknisk begrep som står sentralt i buddhismens ontologiske lære om «tomheten». Det er også den sjette av de seks pāramitās i mahāyānabuddhismen.\\nPrajñāpāramitā er også navnet på en bodhisattva eller «kommende Buddha», som personifiserer denne visdommen. I Kina er hun kjent som Guānyīn. Som en kvinnelig frelseskikkelse eller symbol på moderlighet, spiller hun en sentral rolle i retningen Det rene land."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A8%D1%82%D0%B5%D1%84%D1%84%D0%B8%D1%81%D0%B1%D1%83%D1%80%D0%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Steffisburg_blick.jpg","page_title":"Штеффисбург","context_page_description":"Штеффисбург — город в Швейцарии, в кантоне Берн.\\nВходит в состав округа Тун. Население составляет 15 447 человек. Официальный код — 0939."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Grand-Fort-Philippe","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a0/Map_commune_FR_insee_code_59272.png","page_title":"Grand-Fort-Philippe","context_page_description":"Grand-Fort-Philippe sī ūi-tī Hoat-kok Nord-Pas-de-Calais toā-khu Nord koān ê chi̍t ê commune."},{"page_url":"https://sk.wikipedia.org/wiki/Cirkev_%C4%8Deskoslovensk%C3%A1_husitsk%C3%A1","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Hostivice-husitsky_kostel.jpg","page_title":"Cirkev československá husitská","context_page_description":"Cirkev československá husitská je kresťanská protestantská cirkev, pôsobiaca na území bývalého Česko-Slovenska. Na Slovensku je registrovaná pod názvom Cirkev československá husitská na Slovensku. Pri sčítaní ľudu v roku 2011 sa k nej hlásilo 39 276 obyvateľov Česka a 1 782 obyvateľov Slovenska.\\nCirkev vznikla v roku 1920 oddelením od Rímskokatolíckej cirkvi nadväzujúce na husitské hnutie."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BB%D0%B0%D1%84%D0%BE%D0%BD","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Salla_dell%60olimpo%2C_Paolo_Veronese%2C_Villa_Barbaro.jpg","page_title":"Плафон","context_page_description":"Плафо́н — різновид живопису, що прикріпляють на стелю. Плафоном називають як розпис, мозаїку чи ліпнину на стелі, так і саму стелі прикрашену розписом, мозаїкою або ліпниною.\\nМав поширення в 17-18-19 століттях як коштовна оздоба стель в палацах і церквах. Зазвичай використовувався для пласких чи циліндричних склепінь і мав сюжетне чи безсюжетне зображення."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%B9%BF%E5%B7%9E%E8%B4%AD%E4%B9%A6%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Guangzhou_Book_Centre_Atrium_2019.jpg","page_title":"广州购书中心","context_page_description":"廣州購書中心是中國廣東省大型購書中心，隸屬廣州市新華書店集團公司，成立於1994年11月23日，位於天河區天河路123號。現時營業面積共1.8萬平方米，主要經營圖書、音像製品、電子出版物及文化用品為主。\\n廣州購書中心旗下有兩個分店，分別是黃埔分店和肇慶端州時代廣場分店。"},{"page_url":"https://en.wikipedia.org/wiki/Roberts-Vaughan_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Roberts-Vaughan_House.jpg","page_title":"Roberts-Vaughan House","context_page_description":"Roberts-Vaughan House is a historic home located in the Murfreesboro Historic District at Murfreesboro, Hertford County, North Carolina. It was built about 1805, as a two-story, five bay, Federal style frame dwelling with a gable roof. The front facade features a large three bay tetrastyle pedimented portico in the Greek Revival style. It was built by Benjamin Roberts, a prominent local merchant.\\nIt was listed on the National Register of Historic Places in 1971.\\nThe house is owned by the Murfreesboro Historical Association and houses its offices and the Chamber of Commerce. The Association also operates the Brady C. Jefcoat Museum, William Rea Museum, Dr. Walter Reed House, John Wheeler House, shops and the Agriculture and Transportation Museum."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%90%E1%83%A0%E1%83%A2%E1%83%98%E1%83%9C%E1%83%90_%E1%83%9C%E1%83%90%E1%83%95%E1%83%A0%E1%83%90%E1%83%A2%E1%83%98%E1%83%9A%E1%83%9D%E1%83%95%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Navratilova-PragueOpen2006-05_cropped.jpg","page_title":"მარტინა ნავრატილოვა","context_page_description":"მარტინა ნავრატილოვა — ჩეხოსლოვაკი და მოგვიანებით ამერიკელი ყოფილი პროფესიონალი ჩოგბურთელი, მსოფლიოს ყოფილი პირველი ჩოგანი. აღიარებულია ერთ-ერთ საუკეთესო ქალ ჩოგბურთელად ისტორიაში. 1975 წლიდან გამოდიოდა აშშ-ის სახელით მას შემდეგ, რაც პოლიტიკური თავშესაფარი მოითხოვა.\\nნავრატილოვას ერთეულებში 18 დიდი სლემის ტურნირი აქვს მოგებული – რეკორდული 9 უიმბლდონი, 4 აშშ-ის ღია პირველობა, 3 ავსტრალიის ღია პირველობა და 2 საფრანგეთის ღია პირველობა. იგი ზედიზედ 9 წლის განმავლობაში გადიოდა უიმბლდონის ფინალში და ზედიზედ 6-ში გაიმარჯვა. მან მოიგო რეკორდული 8 წლის შემაჯამებელი ტურნირი. 1982–86 წლებში, ნავრატილოვამ 442-დან 428 მატჩი მოიგო, 1983 წელი კი დაასრულა შედეგით 86–1. ჯამში მას WTA-ის 167 ტურნირი აქვს ერთეულთა თანრიგში მოგებული, რაც რეკორდია. იგი 332 კვირის განმავლობაში იკავებდა ერთეულთა რეიტინგში პირველ ადგილს.\\nწყვილებში ნავრატილოვას რეკორდული 31 დიდი სლემის ტურნირი აქვს მოგებული, აქედან 9 აშშ-ის ღია პირველობა, 8 ავსტრალიის ღია პირველობა, 7 საფრანგეთის ღია პირველობა და 7 უიმბლდონი. მან 13 წლის შემაჯამებელი ტურნირი მოიგო, რაც რეკორდული მაჩვენებელია. ჯამში ნავრატილოვამ 177 წყვილთა ტურნირი მოიგო, რაც ასევე საუკეთესო შედეგია. ტიტულების დიდი ნაწილი მან ამერიკელ პემ შრაივერთან ერთად მოიგო."},{"page_url":"https://id.wikipedia.org/wiki/Sela","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Stralsund%2C_Germany%2C_Nikolaikirche%2C_T%C3%BCr_zur_Semlower_Stra%C3%9Fe%2C_Detail_%282006-09-29%29.JPG","page_title":"Sela","context_page_description":"Sela adalah kata yang digunakan dalam Kitab Mazmur dan Kitab Habakuk di Alkitab Ibrani dan Perjanjian Lama dalam Alkitab Kristen. Berbeda dengan kata Ibrani sela‘ yang berarti \\"batu\\". Artinya tidak diketahui. Dianggap sebagai tanda musik ibadah atau petunjuk pembacaan teks, seperti \\"berhenti dan dengarkan\\". \\"Selah\\" juga dipakai untuk mengindikasikan jeda antara bagian-bagian mazmurAmplified Bible menyatakan Selah sebagai \\"pause, and think of that\\". Dapat juga ditafsirkan semacam garis bawah sebagai persiapan alinea berikutnya."},{"page_url":"https://sv.wikipedia.org/wiki/Esperantoplatsen","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4c/Esperantoplatsen-G%C3%B6teborg1.JPG","page_title":"Esperantoplatsen","context_page_description":"Esperantoplatsen är en plats i stadsdelen Inom Vallgraven i centrala Göteborg. Den är cirka 100 meter lång och sträcker sig mellan Rosenlundsgatan 2 och Kungsgatan 1."},{"page_url":"https://es.wikipedia.org/wiki/Manganita","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Manganite-180085.jpg","page_title":"Manganita","context_page_description":"La manganita es la forma mineral del oxihidróxido de manganeso (III) Mn³⁺O(OH).\\nFue descubierto en 1827 en Ilfeld, en el sur de Harz, siendo descrito por primera vez por el mineralogista alemán Wilhelm Karl Ritter von Haidinger.​\\nOtros nombres de este mineral, rara vez utilizados, son newkirkita y esfenomanganita.​"},{"page_url":"https://simple.wikipedia.org/wiki/Horseshoe_bat","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Nose-leaf_diagram.jpg","page_title":"Horseshoe bat","context_page_description":"Rhinolophidae is a family of bats commonly known as horseshoe bats. There is also an extinct genus of bats, Palaeonycteris. Horseshoe bats are closely related to the Hipposideridae. Horseshoe bats are divided into six subgenera and many species groups. The common ancestor of all horseshoe bats lived 34–40 million years ago. Horseshoe bats are found mostly in tropical or subtropical areas, including Africa, Asia, Europe, and Oceania.\\nHorseshoe bats are a source of disease. Several species are the source of SARS coronavirus. Some evidence suggests that some species could be the source of SARS-CoV-2, which causes coronavirus disease 2019. The bats are hunted for food in several regions, particularly Sub-Saharan Africa, but also Southeast Asia. Some species or their guano are used in traditional medicine in Nepal, India, Vietnam, and Senegal."},{"page_url":"https://pt.wikipedia.org/wiki/Mittenwald","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Wappen_Mittenwald.png","page_title":"Mittenwald","context_page_description":"Mittenwald é um município da Alemanha, localizado no distrito de Garmisch-Partenkirchen, no estado de Baviera.\\nNa época medieval aparece mencionada como 'in media silva'. Desde o século XVI é conhecida pela fabricação de instrumentos musicais de corda."},{"page_url":"https://eo.wikipedia.org/wiki/Yagi-Uda-anteno","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Lang-yagi-70cm.JPG","page_title":"Yagi-Uda-anteno","context_page_description":"Jagi-Uda-anteno estas anteno kun dipolo, reflektilo kaj minimume unu direktilo. Ĝi estis inventita en 1926 de profesoro Uda Shintaro de Imperia Universitato Tohoku en Sendajo. Anglalingva raporto unue aperis de Prof. Yagi Hidetsugu.\\nLa anteno havas gajnon, pli fortan radiadon kaj ricevon en la direkto de la direktilo kompare al simpla dipolo. Tial ĝi aparte apreziĝas en amatora radioastronomio. Kutimaj antenoj por televido estas Jagi-Uda-antenoj kun multaj direktiloj."},{"page_url":"https://de.wikipedia.org/wiki/St._Clemens_(Olk)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Ralingen-Olk%2C_St._Clemens_01.JPG","page_title":"St. Clemens (Olk)","context_page_description":"St. Clemens ist eine römisch-katholische Kapelle im Ortsteil Olk der Ortsgemeinde Ralingen im Landkreis Trier-Saarburg."},{"page_url":"https://es.wikipedia.org/wiki/Rubus_saxatilis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/309_Rubus_saxatilis.jpg","page_title":"Rubus saxatilis","context_page_description":"Rubus saxatilis o zarza de piedra es una especie botánica de plantas del género Rubus."},{"page_url":"https://en.wikipedia.org/wiki/Levi_Watkins","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Levi_Watkins_%28cropped%29.jpg","page_title":"Levi Watkins","context_page_description":"Levi Watkins Jr. was an American heart surgeon and civil rights activist. On February 4, 1980, he and Vivien Thomas were the first to successfully implant an automatic defibrillator in a human patient at Johns Hopkins University. This took place only a mere seven months after Watkins completed his surgical education at Johns Hopkins. Today, millions of patients everywhere use this device, which detects irregular heart beats and corrects them.\\nWatkins was known to be a determined, passionate, and caring individual. He used this compassion to fuel his movement for minorities within the medical field. Today, people still use his wisdom and ideas based on civil rights activism to make medical schools more representative of the diversity of the human race. Vanderbilt University even has a lecture series held annually in his honor, in order to discuss the importance of inclusivity within the university."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Sainte-Madeleine_de_Menti%C3%A8res","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Sainte-Madeleine_Menti%C3%A8res_2.jpg","page_title":"Église Sainte-Madeleine de Mentières","context_page_description":"L'église Sainte-Madeleine est une église catholique d'origine romane située à Mentières, dans le département français du Cantal et la région Auvergne-Rhône-Alpes.\\nElle fait l'objet d'une inscription au titre des monuments historiques depuis le 10 novembre 1997."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D0%BE%D0%B8%D0%BD%D0%B3_787_%D0%94%D1%80%D0%B8%D0%BC%D0%BB%D0%B0%D1%98%D0%BD%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Boeing_787-8_N787BA_cockpit.jpg","page_title":"Боинг 787 Дримлајнер","context_page_description":"Боинг 787 Дримлајнер Боингов је широкотрупни авион дугуг долета, који је опремљен са два турбомлазна мотора. У предњем делу, препознатљива су четири панела ветробрана и блага контура носа. Мотори имају шевроне који самњују буку током њиховог рада. У зависности од варијанте, може да превезе између 210 и 290 путника.\\nНа њему су развијене и примењене модерне технологије, у циљу постизања једноставнијег авиона, уз већу функционалност, ефикасност и комфор. Према изјавама компаније Боинг, ово је њихов најекономичнији авион који су произвели. Више од 50% примарне конструкције сачињено је од композитних материјала, укључујући труп и крила. Захваљујући композитима потрошња горива је мања и до 20% у односу на авионе из његове класе, као што је Боинг 767. Мотори имају шевроне који самњују буку током њиховог рада. У предњем делу, препознатљива су четири панела ветробрана и блага контура носа. Због сличности модела, уз краћу обуку, авионом може да управља и посада Боинга 777.\\nДо јануара 2005. године, цео пројекат је вођен под називом Боинг 7E7. Први примерци Боинга 787 јавности су представљени 8. јула 2007. године, испред Боингове фабрике Еверет у Еверету."},{"page_url":"https://en.wikipedia.org/wiki/Circle_MRT_line","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/CC15_Bishan_MRT_Platform_B.jpg","page_title":"Circle MRT line","context_page_description":"The Circle MRT Line is a medium-capacity Mass Rapid Transit line in Singapore operated by SMRT Corporation. It runs a currently incomplete loop from Dhoby Ghaut station in the city area of Singapore to HarbourFront station in the south via Bishan station in Central Singapore. It also has a branch to Marina Bay station from Promenade station, which will be extended to Harbourfront station in the future to form a complete loop. Coloured orange on the rail map, the fully-underground line is 35.5 kilometres long with 30 stations. Travelling from one end of the line to the other takes about an hour.\\nThe line is the fourth MRT line to be opened, with the first stage commencing operations on 28 May 2009 after delays due to the Nicoll Highway collapse. The next stage to Dhoby Ghaut station was completed on 17 April 2010 and the next stage to Harbourfront opened on 8 October 2011. A two-station extension to Marina Bay station was completed on 14 February 2012. The last stage of the line from Harbourfront to Marina Bay will be completed in 2025, completing the loop."},{"page_url":"https://cs.wikipedia.org/wiki/M%C3%BDdeln%C3%ADkovit%C3%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/Sapindus_mukorossi2.jpg","page_title":"Mýdelníkovité","context_page_description":"Mýdelníkovité je čeleď vyšších dvouděložných rostlin z řádu mýdelníkotvaré, která obsahuje asi 150 rodů a okolo 2000 druhů, rozšířených hlavně v tropech, subtropech a temperátní oblasti. Část těchto rostlin je významná svými jedlými plody, jiné plody slouží k průmyslovému zpracování, další poskytují cenné dřevo. Některé druhy jsou pro svůj vzhled považovány za okrasné."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%89%84%E9%81%93%E4%BF%A1%E5%8F%B7%E6%A9%9F","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Railway_signals.jpg","page_title":"鉄道信号機","context_page_description":"鉄道信号機は、鉄道の線路脇に設置されて前方の状況を運転士に伝える装置である。信号機は、運転士に列車が安全に進行できる速度を指示し、または停止を指示する。運転士は信号機の現示を確認してそれに従って運転を行う。"},{"page_url":"https://sv.wikipedia.org/wiki/Villa_Kivi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Villa_Kivi_21aug13-12.JPG","page_title":"Villa Kivi","context_page_description":"Villa Kivi är Finska författarförbundets hus, som ligger vid Tölövikens strand i centrala Helsingfors. Ursprungligen var det en privatvilla, som Nikolaij \\"Niilo\\" Michelsson lät bygga år 1890. Det var ursprungligen tänkt som ett \\"hyreshus för herrskap\\", och villan låg då långt utanför den dåvarande stadskärnan.\\nÅr 1984 köpte Helsingfors stad villan för kulturella ändamål, och 1990 fick den namnet Villa Kivi för att hedra Finlands nationalförfattare Aleksis Kivi. I huset har numera 14 författare sina arbetsrum, och i bottenplanet finns gemensamma utrymmen för olika litteraturevenemang och fester. I strandbyggnaden bredvid Villa Kivi finns bland annat tre gästrum, som i första hand hyrs ut till författare och översättare som gästar Helsingfors."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Marshall_Thundering_Herd_in_the_NFL_Draft","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Byron_Leftwich.jpg","page_title":"List of Marshall Thundering Herd in the NFL Draft","context_page_description":"The Marshall Thundering Herd football team, representing Marshall University, has had 42 players drafted into the National Football League since the league began holding drafts in 1936. This includes three players taken in the first round. The New England Patriots have drafted the most Marshall players with five. Four former Thundering Herd have been selected to a Pro Bowl, six former Thundering Herd have won a league championship with their respective teams, and one former Thundering have been selected to both a Pro Bowl and won a league championship.\\nEach NFL franchise seeks to add new players through the annual NFL Draft. The draft rules were last updated in 2009. The team with the worst record the previous year picks first, the next-worst team second, and so on. Teams that did not make the playoffs are ordered by their regular-season record with any remaining ties broken by strength of schedule. Playoff participants are sequenced after non-playoff teams, based on their round of elimination.\\nBefore the merger agreements in 1966, the American Football League operated in direct competition with the NFL and held a separate draft."},{"page_url":"https://bar.wikipedia.org/wiki/Franklin_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/BenFranklinDuplessis.jpg","page_title":"Franklin County, Ohio","context_page_description":"Franklin County is a County in Ohio in da USA."},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_Zv%C4%9Bstov%C3%A1n%C3%AD_P%C3%A1n%C4%9B_(Dobr%C5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Pomn%C3%ADk_F._de_Waldt_r.2002.jpg","page_title":"Kostel Zvěstování Páně (Dobrš)","context_page_description":"Kostel Zvěstování Páně či Zvěstování Panny Marie je římskokatolický farní kostel v obci Dobrš, okres Strakonice. Původně románský, goticky přestavěný jednolodní kostel byl postaven v polovině 13. století a přestavěn po poškození okolo roku 1430. Z původní stavby se dochovala část zdiva lodi a portál na její západní straně."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%DB%8C%DA%A9%D9%84%D9%87_%D8%B1%DB%8C%D9%88%D9%86%D8%AF%DB%8C%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Michele_Riondino_al_Giffoni_Film_Festival_2010.jpg","page_title":"میکله ریوندینو","context_page_description":"میکله ریوندینو یک هنرپیشه اهل ایتالیا است.\\nاز فیلم‌ها یا برنامه‌های تلویزیونی که وی در آن نقش داشته‌است می‌توان به لئوپاردی و بوکاچیوی شگفت‌انگیز اشاره کرد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9D%D0%B0%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5_%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/%D0%A7%D0%B8%D1%81%D0%BB%D0%B5%D0%BD%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D1%8D%D0%BC%D0%B8%D0%B3%D1%80%D0%B0%D0%BD%D1%82%D0%BE%D0%B2_%D0%B8_%D0%B8%D0%BC%D0%BC%D0%B8%D0%B3%D1%80%D0%B0%D0%BD%D1%82%D0%BE%D0%B2%2C_%D0%B0_%D1%82%D0%B0%D0%BA%D0%B6%D0%B5_%D1%81%D0%B0%D0%BB%D1%8C%D0%B4%D0%BE_%D0%BC%D0%B8%D0%B3%D1%80%D0%B0%D1%86%D0%B8%D0%B8_%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D1%82%D0%B0%D0%BD%D0%B0_%D0%B7%D0%B0_1992-2015_%D0%B3%D0%B3.png","page_title":"Население Казахстана","context_page_description":"Общая численность населения Казахстана по данным на 1 января 2020 года составляет 18 632 169 человек.\\nЗанимает 64-е место в списке стран по численности населения. Средняя плотность чуть менее 6,84 человек на км²."},{"page_url":"https://zh.wikipedia.org/wiki/2012%E5%B9%B4%E5%A4%8F%E5%AD%A3%E5%A5%A7%E6%9E%97%E5%8C%B9%E5%85%8B%E9%81%8B%E5%8B%95%E6%9C%83%E7%94%B7%E5%AD%90%E8%B6%B3%E7%90%83%E6%AF%94%E8%B3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/2012_Olympic_Football_-_Spain_v_Japan.jpg","page_title":"2012年夏季奧林匹克運動會男子足球比賽","context_page_description":"2012年夏季奧林匹克運動會男子足球比賽於2012年7月26日至8月11日進行，會在溫布萊球場、老特拉福球場、千禧球場、聖詹姆斯公園球場、咸普頓公園球場及理光體育場進行足球比賽，比賽共分兩個階段進行，共16支球隊參加總比賽場數為32場，其中小組賽階段，16支球隊被分為4個小組，進行單循環賽，共24場比賽，獲得小組前兩名的球隊晉級四分之一決賽，四分之一決賽勝者進入半決賽，半決賽負者進行銅牌爭奪戰，勝者進行決賽。\\n國際足總只允許年齡23歲或以下的運動員參加奧運會足球比賽，但每隊可以有三名超齡球員參加。\\n本屆奧運男子足球賽是2012年夏季奧林匹克運動會第二個舉行的比賽項目，於開幕禮前一日已經展開。比賽共有16支男子足球代表隊參加，包括主辦國英國自1960年後首次組成英國代表隊參加，雅典奧運及北京奧運金牌得主阿根廷意外地於資格賽出局。16支男子足球代表隊有4隊是首次參賽。\\n墨西哥在決賽以2-1擊敗巴西首次奪得此項目的金牌。"},{"page_url":"https://en.wikipedia.org/wiki/Bellville,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Bellville_Ohio.JPG","page_title":"Bellville, Ohio","context_page_description":"Bellville is a village in Richland County in the U.S. state of Ohio. It is part of the Mansfield, Ohio Metropolitan Statistical Area. The population was 1,918 at the 2010 census."},{"page_url":"https://en.wikipedia.org/wiki/Ch%C3%A2teau_de_la_Verrerie_(Cher)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Sir_JohnStewart_Of_Darnley_1stSeigneurD%27Aubigny_Arms_GrantedBy_KingCharlesVII_OfFrance_1427.svg","page_title":"Château de la Verrerie (Cher)","context_page_description":"The Château de la Verrerie is a château in Oizon, in the ancient province of Berry in France. It is an historic ancestral seat of a junior branch of the Scottish House of Stewart, known by the territorial title Seigneur d'Aubigny. It is situated about 14 miles south-east of Aubigny-sur-Nère, and the Château d'Aubigny, the original seat of its owners."},{"page_url":"https://de.wikipedia.org/wiki/Aim%C3%A9_Millet","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Aim%C3%A9_Millet_by_Nadar_c1856-58.png","page_title":"Aimé Millet","context_page_description":"Aimé Millet war ein französischer Bildhauer."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD_%D0%94%D0%B8%D0%BD%D0%B0%D0%BC%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/%D0%A1%D1%82%D0%B0%D0%B4%D0%B8%D0%BE%D0%BD_%D0%94%D0%B8%D0%BD%D0%B0%D0%BC%D0%BE.jpg","page_title":"Легион Динамо","context_page_description":"«Легио́н Дина́мо» — российский футбольный клуб из Махачкалы, выступающий в Первенстве ПФЛ. Основан 1 октября 2015 года под названием «Легион»."},{"page_url":"https://de.wikipedia.org/wiki/St._Vitus_(Heckfeld)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Kreuzweg_in_St._Vitus_in_Heckfeld_-_Station_03.jpg","page_title":"St. Vitus (Heckfeld)","context_page_description":"Die römisch-katholische Pfarrkirche St. Vitus wurde 1604 in Heckfeld durch den Würzburger Fürstbischof Julius Echter erbaut."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9A%D0%BE%D0%BD%D1%82%D0%B8%D0%BD%D0%B5%D0%BD%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Laurasia-Gondwana-ru.svg","page_title":"Континент","context_page_description":"Континент — ҙур өлөшө океан менән ҡапланмаған, ситтәре океан кимәленән түбән урынлашҡан ер ҡабығының ҙур массивы.\\nГеологик мәғәнәлә континент материк ситен, шельф һәм тирә-яҡтағы утрауҙарҙы үҙ эсенә ала. Континет формаһы геологик ваҡыт арауығында үҙгәрә. Ерҙәге элекке дәүерҙәге континенттар палеоконтиненттар тип атала.\\nКонтинент төшөнсәһенә яҡын мәғәнәлә «матери́к» һүҙе лә ҡулланыла."},{"page_url":"https://eo.wikipedia.org/wiki/Ma%C5%9Dino","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Polea-simple-fija.jpg","page_title":"Maŝino","context_page_description":"Maŝino estas kompleksa ilo el moveblaj kaj nemoveblaj eroj, kies ĉefa celo estas transformi energion ĉefe cele al intencita ago.\\nLaŭ Francisko Azorín maŝino estas Aparato por reguligi mekanike fortojn, diverscele. Li indikas etimologion el la greka makĥane kaj de tie la latina machina\\nMaŝino kapablas funkcii kiel memstara unuo, esence sendepende de la ĉirkaŭaĵo. Ĝiaj unuopaj eroj ne estas celkonvene uzeblaj ekster la tutaĵo de la maŝino. Maŝino estas komplika establaĵo. Por ĝusta kaj efika laboro havas ĉiu elemento, ĉiu parto, sian difinitan funkcion, taskon. Maŝino estas sistemo de elementoj farantaj devigajn movojn kaj produktantaj utilan laboron aŭ ŝanĝantaj energion. Se temas nur pri movo sen produktiva laboro, oni parolas pri mekanismo.\\nMaŝinoj estas funkciigitaj danke al energio havigita per mekanikaj, kemiaj, termikaj, aŭ elektraj rimedoj, kaj estas ofte motorenhavaj. Historie, ankaŭ energiilo postulas moveblajn partojn por klasiĝi kiel maŝino. Tamen, la alveno de elektroniko kondukis al disvolvigo de energiiloj sen moveblaj partoj kiuj estas konsiderataj maŝinoj."},{"page_url":"https://en.wikipedia.org/wiki/Reine_Minoru","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Reine-Minoru_IMG_2210-1_20161211.jpg","page_title":"Reine Minoru","context_page_description":"Reine Minoru is a Japanese Thoroughbred racehorse. As a two-year-old in 2016 she showed great promise by winning her first two races including the Kokura Nisai Stakes and went on to be placed in both the Keio Hai Nisai Stakes and the Hanshin Juvenile Fillies. In the following spring she ran fourth in the Daily Hai Queen Cup and second in the Fillies' Revue before recording an upset victory over a strong field in the Oka Sho. She failed to win in thirteen subsequent races, running her last race in February 2019."},{"page_url":"https://fr.wikipedia.org/wiki/William_Boyd_(4e_comte_de_Kilmarnock)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Archibald_Campbell%2C_3rd_duke_of_Argyll_%281682%E2%80%931761%29%2C_by_Allan_Ramsay.jpg","page_title":"William Boyd (4e comte de Kilmarnock)","context_page_description":"William Boyd, 4ᵉ comte de Kilmarnock, est un pair écossais qui a rejoint la rebellion jacobite de 1745, a été capturé à Culloden et exécuté par la suite pour trahison à Tower Hill."},{"page_url":"https://fr.wikipedia.org/wiki/Alexandra_Kollonta%C3%AF","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/Alexandra_Kollontai.jpg","page_title":"Alexandra Kollontaï","context_page_description":"Alexandra Mikhaïlovna Kollontaï, née le 19 mars 1872 à Saint-Pétersbourg et morte le 9 mars 1952 à Moscou, est une femme politique socialiste, communiste et militante féministe soviétique. Elle est la première femme de l'Histoire contemporaine à avoir été membre d'un gouvernement et l'une des premières diplomates femmes du XXᵉ siècle."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D1%80%D0%BD%D0%B4%D0%BE%D1%80%D1%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Irndorf_in_TUT.svg","page_title":"Ирндорф","context_page_description":"Ирндорф општина је у њемачкој савезној држави Баден-Виртемберг. Једно је од 34 општинска средишта округа Тутлинген. Према процјени из 2010. у општини је живјело 783 становника. Посједује регионалну шифру 8327027."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_downtown_Denver","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Ghost_Building_ws_relocated_to_18th_and_Stout_Street_in_1979..JPG","page_title":"National Register of Historic Places listings in downtown Denver","context_page_description":"This is a list of the National Register of Historic Places listings in Downtown Denver, Colorado.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in downtown Denver, Colorado, United States. Downtown Denver is defined as being the neighborhoods of Capitol Hill, Central Business District, Civic Center, Five Points, North Capitol Hill, and Union Station. The locations of National Register properties and districts may be seen in an online map.\\nThere are 300 properties and districts listed on the National Register in Denver, including 1 National Historic Landmark. Downtown Denver includes 147 of these properties and districts, including the National Historic Landmark and 2 that extend into other regions; the city's remaining properties and districts are listed elsewhere. Another 7 properties in downtown Denver were once listed but have been removed.\\nThis National Park Service list is complete through NPS recent listings posted August 21, 2020."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%98%E1%83%A3%E1%83%9C%E1%83%94%E1%83%A1%E1%83%99%E1%83%9D%E1%83%A1_%E1%83%9B%E1%83%A1%E1%83%9D%E1%83%A4%E1%83%9A%E1%83%98%E1%83%9D_%E1%83%9B%E1%83%94%E1%83%9B%E1%83%99%E1%83%95%E1%83%98%E1%83%93%E1%83%A0%E1%83%94%E1%83%9D%E1%83%91%E1%83%98%E1%83%A1_%E1%83%AB%E1%83%94%E1%83%92%E1%83%9A%E1%83%94%E1%83%91%E1%83%98_%E1%83%90%E1%83%A0%E1%83%92%E1%83%94%E1%83%9C%E1%83%A2%E1%83%98%E1%83%9C%E1%83%90%E1%83%A8%E1%83%98","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Talampaya_NP.jpg","page_title":"იუნესკოს მსოფლიო მემკვიდრეობის ძეგლები არგენტინაში","context_page_description":"2014 წლის მონაცემებით არგენტინაში იუნესკოს მსოფლიო მემკვიდრეობის 9 ძეგლია."},{"page_url":"https://es.wikipedia.org/wiki/Floortje_Mackaij","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Floortje_Mackaij_-_2018_UEC_European_Road_Cycling_Championships_%28Women%27s_road_race%29.jpg","page_title":"Floortje Mackaij","context_page_description":"Floortje Mackaij es una ciclista profesional y patinadora neerlandesa que debutó como ciclista profesional a finales de 2013.​"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%A7%DA%A9%D8%B3%D9%88%D9%81%D9%88%D9%86_%D8%B3%D9%88%D9%BE%D8%B1%D8%A7%D9%86%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Yamaha_Saxophone_YSS-875_EX.jpg","page_title":"ساکسوفون سوپرانو","context_page_description":"ساکسوفون سوپرانو سازی در اندازه ای کوچک از خانواده ساکسوفون است. این ساز از دسته سازهای انتقالی در «سی بمل» محسوب می‌شود و بر خلاف دیگر خانواده ساکسوفون دهانهٔ آن انحنا ندارد و صاف است."},{"page_url":"https://nl.wikipedia.org/wiki/Amazonen-Werke","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Amazone_Hauptsitz_Hasbergen-Gaste.jpg","page_title":"Amazonen-Werke","context_page_description":"Amazonen-Werke H Dreyer GmbH & Co. KG is een Duitse fabrikant van agrarische machines. Het bedrijf en de fabriek zijn gegrondvest in 1883 door Heinrich Dreyer en de locatie van de hoofdfabriek is in Hasbergen-Gaste, vlak bij Osnabrück.\\nOp dit moment produceert Amazone een breed programma van producten, kunstmeststrooiers, spuitmachines, zaaimachines, grondbewerkingsmachines, machines voor beheer van sportvelden en parken en meer. Het logo is een Amazone met pijl-en-boog op een paard. De agrarische machines worden voorgesteld door een oranje logo en de hovenierslijn door een groen logo. De agrarische machines hebben een groen-oranje kleurschema, de hovenierslijn is groen met beige."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A5%D0%B5%D1%80%D0%B0%D0%BA%D0%BB%D0%B5%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/PtolemyVIIIStela.jpg","page_title":"Хераклейон","context_page_description":"Хераклейон, известен и като Тонис, е античен египетски град край Александрия, чиито руини са разположени на дъното на Абукирския залив, днес отдалечени от брега на 2.5 km. Градът носи името на Херакъл, като се е смятало, че той сам е посещавал града в античността. Основан е около 12 век пр. Хр. и се споменава в трудовете на античните автори Диодор Сицилийски, Страбон и Херодот. Важността му нараства през късния период на управлението на фараоните в Египет, когато заедно с Навкратис е главно пристанище на държавата. Хераклейон е построен върху разположени на Нилската делта острови, прорязани от канали, като е снабден с редица пристани, кейове и други съоръжения. Информация за града дава Херодот, който описва голям храм на мястото, където Херакъл за първи път стъпил в Египет. Също според него Парис и Елена от Троя са избягали в Хераклейон преди началото на Троянската война. Четири века след Херодот географът Страбон описва града, разположен на изток от Канопос на устието на едноименния ръкав на Нил, в който имало храм на Херакъл.\\nХераклейон процъфтява особено между 6 – 4 век пр. Хр., към което сочат множеството открити археологически находки."},{"page_url":"https://de.wikipedia.org/wiki/Essigbaum","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Essigbaum%28Rhus_hirta%29.jpg","page_title":"Essigbaum","context_page_description":"Der Essigbaum oder Hirschkolbensumach ist eine Pflanzenart innerhalb der Familie Sumachgewächse. Sie stammt aus dem östlichen Nordamerika. Der Essigbaum wurde um 1620 in Europa eingeführt und ist wegen seiner ausgeprägten Herbstfärbung ein weit verbreitetes Ziergehölz. Die Blätter werden dabei gelb, später orange und im Oktober leuchtend karmesinrot. Sein deutscher Trivialname Hirschkolbensumach wie auch der englische Name staghorn sumac beruhen auf dem kennzeichnenden Merkmal der Art: den kräftigen, braunen und filzig behaarten jungen Zweigen, die an ein mit Bast bewachsenes Hirschgeweih erinnern."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%8E%D0%B2%D1%96%D0%BB%D0%B5%D0%B9%D0%BD%D0%B8%D1%85_%D1%82%D0%B0_%D0%BF%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D1%85_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%B8_%D0%B7_%D0%BD%D0%B5%D0%B4%D0%BE%D1%80%D0%BE%D0%B3%D0%BE%D1%86%D1%96%D0%BD%D0%BD%D0%B8%D1%85_%D0%BC%D0%B5%D1%82%D0%B0%D0%BB%D1%96%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/%D0%A5%D0%B0%D1%80%D0%BA%D1%96%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%B7%D0%BE%D0%BE%D0%BF%D0%B0%D1%80%D0%BA_%D0%B0%D0%B2%D0%B5%D1%80%D1%81.jpeg","page_title":"Список ювілейних та пам'ятних монет України з недорогоцінних металів","context_page_description":"Спи́сок ювіле́йних та па́м'ятних моне́т Украї́ни з недорогоці́нних мета́лів — це список пам'ятних та ювілейних монет, випущених Національним банком України, які є за матеріалом виготовлення нейзильберовими або біметалевими. Всього ювілейних та пам'ятних монет за час незалежності України станом на 19 березня 2020 року було випущено 848. З них 467 з недорогоцінних металів. Ювілейні і пам'ятні монети почали випускатися Національним банком з 1995 року, з 848 монет — 21 монета номінована в карбованцях і 827 у гривнях.\\nНижче наведена класифікація недорогоцінних монет за датою випуску."},{"page_url":"https://lt.wikipedia.org/wiki/Europos_alkoholini%C5%B3_g%C4%97rim%C5%B3_juostos","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/VodkaBelt.png","page_title":"Europos alkoholinių gėrimų juostos","context_page_description":"Europos alkoholinių gėrimų juostos – Europos regionai, kuriuose, manoma, vyrauja tam tikrų alkoholinių gėrimų vartojimas.\\nTerminas vodka belt pirmą kartą pasirodė 1964 m. žurnalo Time straipsnyje apie smarkų gėrimą Lenkijoje."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B2%D1%87%D0%B0%D0%BD%D0%BD%D1%8F_%D0%B0%D1%81%D0%BE%D1%86%D1%96%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B8%D1%85_%D0%BF%D1%80%D0%B0%D0%B2%D0%B8%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/FrequentItems.png","page_title":"Навчання асоціативних правил","context_page_description":"Навчання асоціативних правил — метод машинного навчання заснованого на правилах для знаходження цікавих відношень між змінними у великих базах даних. Метою є ідентифікація сильних правил, які виявляються в базах даних з використанням деяких вимірів зацікавленості.\\nҐрунтуючись на концепції сильних правил, Ракеш Агравал, Томаш Імієлінський та Арун Свамі запровадили асоціативні правила для виявлення закономірностей між продажами продуктів, які фіксуються через торгові точки у супермаркетах і всі ці транзакції зберігаються у величезній базі даних. Наприклад, правило, що містяться в даних про продажі супермаркету, вказує на те, що якщо споживач купує цибулю та картоплю разом, то, ймовірно, також буде придбано олію для смаження картопельки з цибулею. Така інформація може бути використана як підґрунтя для прийняття рішень щодо маркетингової діяльності, наприклад, рекламних цін або вибору місць для розташування товарів.\\nОкрім вищезгаданого прикладу з аналізу ринкових кошиків, асоціативні правила застосовуються сьогодні у багатьох областях, включаючи Web mining, виявлення вторгнень, безперервне виробництво та біоінформатику."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Anseriformes_by_population","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Philippine_duck.jpg","page_title":"List of Anseriformes by population","context_page_description":"This is a list of Anseriformes species by global population. While numbers are estimates, they have been made by the experts in their fields.\\nAnseriformes is the taxonomic order to which the ducks, geese, swans, and screamers belong. BirdLife International has assessed 166 species; 89 have had their population estimated. A variety of methods are used for counting waterfowl. For example, in North America, national and sub-national agencies use planes and helicopters to make aerial transects of breeding populations, and extrapolate these counts over the species' known ranges. Methodologies are continuously being refined; thus estimates can be expected to become more accurate over time. Forecasts can be made by studying habitat condition trends and by interviewing local experts.\\nThe first bird in this list, the crested shelduck, retains a status of Critically Endangered on the IUCN Red List but may in fact be extinct. The last confirmed reporting was in 1964 near Vladivostok. North Korea claimed a sighting in March 1971, but this record is highly suspect."},{"page_url":"https://it.wikipedia.org/wiki/Viale_Rustaveli","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Tbsyouthpalace.jpg","page_title":"Viale Rustaveli","context_page_description":"Il Viale Rustaveli è una strada del centro di Tbilisi, in Georgia. Deve il proprio nome al grande poeta medievale Shota Rustaveli. La strada inizia dalla Piazza della Libertà e si estende per circa 1.5 km, prima di trasformarsi in un'estensione della via Kostava. È sovente considerata la principale strada della capitale georgiana, in virtù della presenza di numerosi edifici governativi, culturali e storici."},{"page_url":"https://pl.wikipedia.org/wiki/Spring_Heeled_Jack","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Marquess_of_Waterford.jpg","page_title":"Spring Heeled Jack","context_page_description":"Spring Heeled Jack jest postacią z angielskiego folkloru epoki wiktoriańskiej, charakterystyczną z powodu zdolności do wykonywania niezwykle wysokich i długich skoków. Pierwsza relacja ze spotkania ze Spring Heeled Jackiem pojawiła się w 1837. Późniejsze obserwacje pochodzą z różnych miejsc w Anglii, od Londynu do Sheffield i Liverpoolu.\\nPowstało wiele teorii mających na celu wyjaśnić jego prawdziwą naturę lub tożsamość, żadna z nich jednak nie wyjaśniła w pełni tego fenomenu. Do dziś stanowi on zagadkę.\\nLegenda miejska o Spring Heeled Jacku uzyskała szeroką popularność z powodu opowieści o jego dziwacznym wyglądzie i o zdolności do wykonywania niesamowitej długości susów. Postać ta stała się jednym z motywów wielu utworów literackich, często zawierających spekulacje na temat możliwej paranormalnej natury tego fenomenu."},{"page_url":"https://nn.wikipedia.org/wiki/Ole_Colbj%C3%B8rnsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Ole-colbj%C3%B8rnsen.jpg","page_title":"Ole Colbjørnsen","context_page_description":"Ole Colbjørnsen var ein norsk journalist, økonom og politikar frå Vegårshei. Han var ein av dei fyrste leiande planøkonomane i Noreg. Perioden 1937-40 møtte han på Stortinget frå Oslo, som varamann for statsråd Oscar Torp."},{"page_url":"https://en.wikipedia.org/wiki/.eco","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/.eco_top-level_domain_logo.png","page_title":".eco","context_page_description":".eco is a top-level domain. It was proposed in ICANN's new generic top-level domain program and became available to the general public on April 25, 2017.\\nBig Room is the registry for the domain and names can be registered at go.eco. The company won the rights through a community application after assembling a coalition of more than 50 environmental organizations. The registry is advised by a council of these organizations."},{"page_url":"https://fr.wikipedia.org/wiki/Litt%C3%A9rature_italienne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Pietro_Bembo_-_Titian.jpg","page_title":"Littérature italienne","context_page_description":"La littérature italienne naît avec les œuvres poétiques écrites en diverses langues régionales de l'Italie et qui se développent aux environs du XIᵉ siècle. Au XIIIᵉ siècle seulement débute la tradition littéraire en langue italienne, c'est-à-dire dans le dialecte toscan, de Florence, Pise et Sienne, qui s'est imposé et enrichi, sous l'influence et les apports romans, principalement de la langue d'oc et de la langue d'oïl, même si certains considèrent le Cantique des créatures de saint François d'Assise, écrit dans le dialecte italien de l'Ombrie autour de 1220, comme le premier document littéraire italien.\\nAprès les grands fondateurs du Trecento : Dante, Pétrarque et Boccace, on remarque au XVIᵉ siècle les figures de L'Arioste, de Machiavel et du Tasse. Plus tard la comédie italienne connaît son maître avec Carlo Goldoni au XVIIIᵉ siècle, tandis que la période romantique voit apparaître le grand romancier Alessandro Manzoni et le poète Giacomo Leopardi."},{"page_url":"https://en.wikipedia.org/wiki/Aransas_Pass,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Bay-View_Hotel%2C_Aransas_Pass%2C_TX.jpg","page_title":"Aransas Pass, Texas","context_page_description":"Aransas Pass is a city in Aransas, Nueces, and San Patricio Counties in the U.S. state of Texas. The population was 8,204 at the 2010 Census."},{"page_url":"https://fr.wikipedia.org/wiki/Antoine_Laville_(musicien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Antoine_Laville_et_By_the_Gospel_River.jpg","page_title":"Antoine Laville (musicien)","context_page_description":"Antoine Laville est un musicien professionnel, pianiste et harmoniciste, et il est également professeur et compositeur. Il est né à Annecy en 1970 et a fait son premier concert en 1983, à l'âge de 13 ans. Il ne s'est jamais arrêté depuis et totalise aujourd'hui plus de 2000 concerts. Il joue différentes catégories de musique, ses domaines de prédilection restant cependant le jazz, le blues et le gospel."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D0%B3%D1%80%D0%B0%D1%87%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Decje_igracke_%2819._vek%29_-_Pedagoski_muzej_2.jpg","page_title":"Играчка","context_page_description":"Играчке представљају сва средства којима се деца служе у игри. Овај појам се обично везује за децу или кућне љубимце, мада и одрасле особе и животиње у природи понекад користе играчке. Оне могу бити направљене од дрвета, пластике, метала и других материјала. Поред фабрички произведених играчака, често се у игри употребљавају и предмети са другом основном наменом. Играчке су важне за развој деце, јер се кроз игру развија моторика, координација и уче и стичу различите вештине и знања.\\nИграчка је материјални елемент игре који својим особинама битно утиче на њен ток и садржаје. Играчка је нужни пратилац игре, чак и када у њој није реално присутна, јер егзистира у дечјем сећању, машти и представама.\\nМноштво игара, се обавља уз помоћ материјала који није посебно направљен за ту сврху. Једно од најомиљенијих прибора за игру је кухињско посуђе, затим поједини апарати или њихови делови, старе конзерве...\\nИграчке, у ужем смислу речи, представљају предмете који су произведени занатски или индустријски да би послужили за игру."},{"page_url":"https://en.wikipedia.org/wiki/Flags_of_cities_of_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Flag_of_Jennings%2C_Missouri_%281964-1996%29.png","page_title":"Flags of cities of the United States","context_page_description":"The flags of the cities of the United States exhibit a wide variety of regional influences and local histories, as well as widely different styles and design principles."},{"page_url":"https://eu.wikipedia.org/wiki/Monico_(Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/WIMap-doton-Monico.png","page_title":"Monico (Wisconsin)","context_page_description":"Monico Ameriketako Estatu Batuetako inkorporatutako herri bat da. Oneida konderrian kokatuta dago, Wisconsin estatuan. 364 biztanle ditu, 54,6 kilometro koadroko azaleran banatuta."},{"page_url":"https://pt.wikipedia.org/wiki/Esta%C3%A7%C3%A3o_Nuevo_Circo","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Nuevo_Circo_%28Caracas_metro%29.jpg","page_title":"Estação Nuevo Circo","context_page_description":"A Estação Nuevo Circo é uma das estações do Metrô de Caracas, situada no município de Libertador, entre a Estação Teatros e a Estação Parque Central. Administrada pela C. A. Metro de Caracas, faz parte da Linha 4.\\nFoi inaugurada em 18 de julho de 2006. Localiza-se no cruzamento da Avenida Lecuna com a Avenida Sur 9. Atende as paróquias de La Vega e de San Agustín."},{"page_url":"https://ms.wikipedia.org/wiki/Yamaguchi,_Yamaguchi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Flag_of_Yamaguchi%2C_Yamaguchi.png","page_title":"Yamaguchi, Yamaguchi","context_page_description":"Yamaguchi ialah ibu wilayah bagi wilayah Yamaguchi yang terletak di Kawasan Chūgoku, Jepun."},{"page_url":"https://it.wikipedia.org/wiki/Nicolas_Minorsky","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Portrait_of_Nicolas_Minorsky.jpg","page_title":"Nicolas Minorsky","context_page_description":"Nicolas Minorsky, nato Nikolai Fyodorovich Minorsky, è stato un ingegnere e matematico statunitense di origine russa.\\nFu noto soprattutto per i suoi studi di teoria del controllo e per la prima proposta d'applicazione di controller PID nei sistemi di governo automatico per le navi della Marina statunitense."},{"page_url":"https://nl.wikipedia.org/wiki/Citosa","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Citosa1107HBMKKloosterman.jpg","page_title":"Citosa","context_page_description":"N.V. Autobusonderneming \\"Citosa\\" te Waddinxveen was een streekvervoeronderneming die van 1922 tot 1968 heeft bestaan. In 1968 fuseerde het bedrijf met de WSM tot de NV Verenigd Streekvervoer Westnederland."},{"page_url":"https://en.wikipedia.org/wiki/Neolicaphrium","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Neolicaphrium_recens_fossil_locations.jpg","page_title":"Neolicaphrium","context_page_description":"Neolicaphrium is an extinct genus of ungulate mammal belonging to the extinct order Litopterna. This animal lived from the Late Pliocene to the Late Pleistocene in southern South America, being the last survivor of the family Proterotheriidae."},{"page_url":"https://fy.wikipedia.org/wiki/Kurasau","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Pontonbrug_Willemstad.jpg","page_title":"Kurasau","context_page_description":"Kurasau is in lân binnen it Keninkryk fan de Nederlannen. It wie it grutste eilân fan de eardere Nederlânske Antillen. It grutste plak op it eilân, en ek de haadstêd, is Willemstêd. Kurasau hie yn 2008 mear as 140.000 ynwenners.\\nIt eilân is ek nammejouwer foar de Kurasau-likeur, dy't fan oarsprong makke wurdt op it Karibyske eilân."},{"page_url":"https://ce.wikipedia.org/wiki/NGC_5512","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/NGC5512_-_SDSS_DR14.jpg","page_title":"NGC 5512","context_page_description":"NGC 5512 — Дохкаллин а, седарчийн гуламийн а керла юкъара каталогехь ягарйина галактикаш."},{"page_url":"https://it.wikipedia.org/wiki/Monterrey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/MonterreyCollage.jpg","page_title":"Monterrey","context_page_description":"Monterrey è una città di 1 130 960 abitanti del Messico nord-orientale, capoluogo dello Stato del Nuevo León. Conosciuta come la Città delle Montagne e Sultana del Norte, è la terza città del Messico per popolazione e per importanza.\\nModerno centro industriale e commerciale situato ai piedi della Sierra Madre Orientale, Monterrey fu fondata da Diego de Montemayor nel 1596."},{"page_url":"https://ceb.wikipedia.org/wiki/Gilman_(lungsod_sa_Tinipong_Bansa,_Wisconsin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Gilman_Municipal_Building.JPG","page_title":"Gilman (lungsod sa Tinipong Bansa, Wisconsin)","context_page_description":"Lungsod ang Gilman sa Tinipong Bansa. Ang Gilman nahimutang sa kondado sa Taylor County ug estado sa Wisconsin, sa sidlakang bahin sa nasod, 1,300 km sa amihanan-kasadpan sa ulohang dakbayan Washington, D.C. 376 metros ibabaw sa dagat kahaboga ang nahimutangan sa Gilman, ug adunay 410 ka molupyo.\\nAng yuta palibot sa Gilman kay patag, ug nga tinakpan sa ubos sa kasadpan. Ang kinahabogang dapit sa palibot dunay gihabogon nga 487 ka metro ug 15.2 km sa sidlakan sa Gilman. Dunay mga 4 ka tawo kada kilometro kwadrado sa palibot sa Gilman may kaayo gamay nga populasyon. Gilman ang kinadak-ang lungsod sa maong dapit. Hapit nalukop sa kaumahan ang palibot sa Gilman. Sa rehiyon palibot sa Gilman, mga lanaw talagsaon komon.\\nAng klima hemiboreal. Ang kasarangang giiniton 5 °C. Ang kinainitan nga bulan Hulyo, sa 20 °C, ug ang kinabugnawan Enero, sa -14 °C. Ang kasarangang pag-ulan 1,155 milimetro matag tuig. Ang kinabasaan nga bulan Hunyo, sa 179 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 47 milimetro."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1985/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Aage_M._%2C_kop%2C_Bestanddeelnr_928-8203.jpg","page_title":"Lijst van personen overleden in 1985/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1985.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://nl.wikipedia.org/wiki/Edewecht","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/2013-05-03_Fotoflug_Leer_Papenburg_DSCF6855.jpg","page_title":"Edewecht","context_page_description":"Edewecht is een gemeente in de Duitse deelstaat Nedersaksen. De gemeente is gelegen in de Landkreis Ammerland. Edewecht telt 22.400 inwoners."},{"page_url":"https://fy.wikipedia.org/wiki/Stonehenge","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Stonehenge.jpg","page_title":"Stonehenge","context_page_description":"Stonehenge is in megalitysk momumint út de Prehistoarje. It leit tichtby it plakje Amesbury, op de Salisbury Plain, yn it Ingelske greefskip Wiltshire. It monumint bestiet út grutte stiennen dy't yn in sirkel steane. It wurd henge yn \\"Stonehenge\\" is fan Germaanske komôf en betsjut sokssawat as \\"hingje\\". Nei alle gedachten waard Stonehenge boud tusken 3500 en 1500 f.Kr., in krekte datearring is lykwols net te meitsjen. Wat de bouwers mei de konstruksje fan doel wienen is tsjuster. Der binne guons dy't tinke dat it brûkt waard troch prehistoaryske astronomen, oaren hâlde it derop dat it te krijen hat mei religy."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%A8%E0%B5%80%E0%B4%B2%E0%B4%A4%E0%B5%8D%E0%B4%A4%E0%B4%B5%E0%B4%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Dendrobates_azureus_rect.jpg","page_title":"നീലത്തവള","context_page_description":"സൂറിനാം സാവന്നക്കാടുകളിൽ കാണപ്പെടുന്ന വിഷമുള്ള ഒരിനം തവളയാണ് നീലത്തവള. ഇവയെ തെക്കൻ സൂറിനാം മുതൽ വടക്ക്, മദ്ധ്യ ബ്രസീൽ വരെ കാണപ്പെടുന്നു. നീല വിഷത്തവള എന്നാണ് പൊതുവെ വിളിക്കുന്നത്. പ്രാദേശിക ആളുകൾ ഇവയെ ഒക്കൊപിപി എന്നും വിളിക്കുന്നു. ശരീരം മുഴുവൻ നീല നിറമായതിനാലാണ് ഇവയെ നീലത്തവളയെന്നു വിളിക്കുന്നത്. കാഴ്ച്ചയിൽ ആകർഷകമായത് എന്നതിലുപരി ഇവയ്ക്ക് മറ്റു ജീവികളെ വശീകരിക്കാനുള്ള കഴിവും കൂടുതലാണ്."},{"page_url":"https://de.wikipedia.org/wiki/St._Theresia_(M%C3%BClheim-Selbeck)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Orgel_alt.jpg","page_title":"St. Theresia (Mülheim-Selbeck)","context_page_description":"Die Selbecker Kirche St. Theresia von Avila ist eine römisch-katholische Kirche in Mülheim-Selbeck. Die Kirche des Bistums Essen gehörte von 1303 bis 1927 zur Pfarre Mintard. Der starke industrielle Umschwung durch die Selbecker Erzbergwerke und der damit verbundene Zuzug von Bergleuten sorgte für die Planung einer katholischen Kirche. Graf Hubertus Spee zu Linnep schenkte das erforderliche Grundstück und der „Selbecker Bergwerksverein“ finanzierte den geplanten Kirchenbau. Im Wandel der Zeiten wurden auch die Grenzen der Gemeinden oft verändert. Am 27. Juni 1890 begannen die Bauarbeiten nach den Plänen des Straßburger Baumeisters Franz Schmitz. Am 8. September 1892 konsekrierte Kardinal Philipp Krementz die Selbecker Kirche."},{"page_url":"https://en.wikipedia.org/wiki/Johnston_County,_Oklahoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Administration_with_North_Lawn_at_Murray_State_College.jpg","page_title":"Johnston County, Oklahoma","context_page_description":"Johnston County is a county located in the U.S. state of Oklahoma. As of the 2010 census, the population was 10,957. Its county seat is Tishomingo. It was established at statehood on November 16, 1907 and named for Douglas H. Johnston, a governor of the Chickasaw Nation.\\nJohnston County is part of the Texoma Region."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Highways_in_Queensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Australian_Alphanumeric_State_Route_A1.png","page_title":"Liste der Highways in Queensland","context_page_description":"Queensland, als flächenmäßig der zweitgrößte Bundesstaat in Australien ist gleichzeitig der am meisten dezentralisierte. So überspannt das Netzwerk der Highways den größten Teil des Staates, anders als beispielsweise im spärlich besiedelten Western Australia. Sogar die Outback Tracks in Queensland werden gut erhalten da sie durch vergleichsweise dicht besiedeltes Gebiet führen.\\nDer Ausbauzustand des Straßennetzes variiert vom 8-spurigen Pacific Motorway, der Brisbane mit der Gold Coast verbindet, bis hin zu nicht asphaltierten Tracks im Outback. Diese Vielfalt der unterschiedlichen Fernstraßentypen spiegelt neben der Bevölkerungsdichte auch die Unterschiede im Gelände und andere klimatische Bedingungen wider. Ebenso vielfältig sind die Auszeichnungen der verschiedenen Fernstraßen. In Queensland kommen alle im Laufe von Jahrzehnten eingesetzten Schemata gleichzeitig vor. Neben dem alten National Route System und dem State Route System, erkennbar an den blau hinterlegten Schildern, bis zu den modernen alphanumerischen Bezeichnungen und der speziellen Notation in der Metropolregion Brisbane werden alle parallel verwendet."},{"page_url":"https://nv.wikipedia.org/wiki/T%C3%B3_w%C3%B3naan%C3%ADd%C4%99%CC%81%C4%99%CC%81%CA%BC_hasb%C3%ADd%C3%AD%C5%82b%C3%A1h%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/African_mourning_dove_%28Streptopelia_decipiens_shelleyi%29.jpg","page_title":"Tó wónaanídę́ę́ʼ hasbídíłbáhí","context_page_description":"Tó wónaanídę́ę́ʼ hasbídíłbáhí éí yótʼáahdi tsídii dah yikahjí atah daasdzoh, áádóó éí Tó Wónaanídi Bilagáana Bikéyahdi dóó Binááʼádaałtsʼózíidi dóó Naakaii Łizhiní Bikéyahdi dahólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Streptopelia\\" deiłníigo deiyózhí. Tó wónaanídę́ę́ʼ hasbídíłbáhí éí 11 ałʼąą ádaatʼé.\\nDíí hasbídí éí łibáago ndaashchʼąąʼ łeh; bitsʼíís éí 9–14di asdzoh ádaníłtso łeh."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%88%AA%E7%A9%BA%E6%AF%8D%E8%89%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/HMS_Audacity_%28D10%29.jpg","page_title":"航空母艦","context_page_description":"航空母艦（簡稱航母、航艦）係一種以搭載艦載機為主要武器嘅軍艦，艦體通常擁有供固定翼飛機起降使用嘅巨大甲板同座落於左右其中一側嘅島式艦橋（一般稱為「艦島」）。航艦係航空母艦戰鬥群嘅核心，艦隊中嘅其它船隻提供其保護同供給畀，而航母則提供空中支援同遠程打擊能力。航空母艦係目前最大嘅武器系統平台，發展至今已係現代藍水海軍唔可或缺嘅武器，亦係海戰最重要嘅作戰艦艇之一。\\n航空母艦起源於第一次世界大戰期間飛機作戰能力實用化後嘅影響，喺各國航空技術進步、進而使陸基飛機有能力攻擊地面目標嘅同時，海軍亦用飛機來進行偵查與攻擊敵軍偵察機，因此出現咗專門供水上飛機整備與其它雙翼機起飛嘅水上飛機母艦。一戰後，各大海軍強國主要仍維持著崇尚排水量大、裝載大口徑艦砲軍艦嘅大艦巨砲主義，但即使如此仲係有唔少軍事理論家提倡將飛機用於攻擊軍艦嘅作法，因此研製出多種形式嘅航空母艦、奠定未來海空兵力嘅發展。 第二次世界大戰爆發後，航艦嘅重要性日益浮現，而喺珍珠港事件以及馬來亞海戰嘅結果中顯示，大型軍艦喺飛機嘅空中攻擊下十分脆弱，大艦巨砲主義亦因此走向終結，到咗戰爭後期仲出現瞭如雷伊泰灣海戰此類嘅航艦大戰。\\n二戰結束後，航空母艦嘅地位一度因為核武器嘅出現而產生爭議與討論，特別係喺受到核子武器攻擊下嘅生存能力，但到咗韓戰後又恢復咗其重要性，世界形成以美國為首嘅航艦武力對抗蘇聯水面艦艇部隊嘅格局，航空母艦更係參與咗世界各地嘅局部衝突與代理戰爭。冷戰結束後，世界各國軍備緊縮，目前僅美國、俄羅斯、英國、法國、印度、巴西、義大利、西班牙、中國、泰國擁有或計畫建造航空母艦，由於其造價與維護費用巨大，擁有航空母艦亦係顯示國力強大嘅表現，喺呢方面美國海軍即擁有世界上冚唪唥已服役航艦總數嘅一半，排水量則佔咗超過80％，其相關科技亦係世界領先。"},{"page_url":"https://da.wikipedia.org/wiki/Dyrehavsbakken","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Pjerrots_hus.jpg","page_title":"Dyrehavsbakken","context_page_description":"Dyrehavsbakken er verdens ældste eksisterende forlystelsespark. Den ligger i Dyrehaven ved Klampenborg ca. 10 km nord for København.\\nDer er 32 kørende forlystelser og en friluftsscene med bl.a. musikalsk underholdning. Bakken er hjemsted for Cirkusrevyen, der begyndte i 1935.\\nOmrådet sorterer under Jægersborg Statsskovdistrikt og er underlagt Dyrehavens fredning, hvilket sætter rammerne for varigheden af sæsonen, og hvor højt der må bygges."},{"page_url":"https://es.wikipedia.org/wiki/Sean_Newcomb","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Sean_Newcomb%2C_Sept_18_2018.jpg","page_title":"Sean Newcomb","context_page_description":"Sean William Newcomb es un lanzador estadounidense de béisbol profesional que juega para los Atlanta Braves de las Grandes Ligas. Debutó en 2017 con los Bravos, aunque fue seleccionado en la primera ronda del draft de 2014 por Los Angeles Angels of Anaheim."},{"page_url":"https://no.wikipedia.org/wiki/Dalruner","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Dalrunor.svg","page_title":"Dalruner","context_page_description":"Dalruner er en type runer som ble brukt i deler av Dalarna i Sverige, hvor de ble anvendt til begynnelsen av 1900-tallet. De fleste kjente og bevarte innskrifter med dalruner er skåret ut i tre, og de eldste av disse er fra 1500-tallet. Størstedelen av innskriftene er funnet i bygdene ved Älvdalen i landskapets nordlige del. Med tiden fikk flere av runene stadig større likhet med tilsvarende tegn i det latinske alfabetet. Til og med Å, Ä og Ö ble lånt inn. De siste kjente tekstene skrevet med dalruner stammer fra 1906 og 1907."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%A0%9C%EC%9D%B4%EB%AF%B8_%EB%A3%A8%EB%84%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Jamie_Luner_2014.jpg","page_title":"제이미 루너","context_page_description":"제이미 루너는 미국의 배우이다."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BC-%D0%9E%D0%BC%D0%B1%D0%B5%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Bleicher%C3%B6der_Berge-Hasenburg.jpg","page_title":"Ам-Омберг","context_page_description":"Ам-Омберг — громада в Німеччині, розташована в землі Тюрингія. Входить до складу району Айхсфельд.\\nПлоща — 31,34 км². Населення становить 3681 ос."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%9A%E3%83%B3%E3%82%B7%E3%83%AB%E3%83%99%E3%83%8B%E3%82%A2%E7%BE%8E%E8%A1%93%E3%82%A2%E3%82%AB%E3%83%87%E3%83%9F%E3%83%BC%E3%81%AE%E4%BA%BA%E7%89%A9%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Rae_Sloan_Bredin_-_Reverie_1915.jpg","page_title":"ペンシルベニア美術アカデミーの人物一覧","context_page_description":"ペンシルベニア美術アカデミーの人物一覧は、アメリカ合衆国、フィラデルフィアの美術団体、美術学校のペンシルベニア美術アカデミーに関連する人物の一覧である。美術学校で 教えたり、学んだりした人物や、会員に選ばれた人物を示す。"},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A9lula_LE","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/LECell.jpg","page_title":"Célula LE","context_page_description":"Se denomina célula LE o a veces célula del lupus a una célula fagocítica del sistema inmune que ha fagocitado el material nuclear desnaturalizado de algún otro tipo de célula. Por lo general esta célula fagocítica es un macrófago o un neutrófilo.​ El núcleo desnaturalizado puede ser observado ocupando la porción central de la célula fagocítica, mientras que el propio núcleo de la célula fagocítica por lo general queda extendido en forma de herradura en la periferia.​\\nEl observar este tipo de células en un extendido de médula ósea o incluso a veces en uno de sangre periférica es característico del lupus eritematoso sistémico, ​ aunque no patognomónico del mismo, pues también pueden ser observadas en otras patologías autoinmunes del tejido conectivo.\\nLas células LE fueron descubiertas en 1948 por Hargraves y colaboradores.​"},{"page_url":"https://de.wikipedia.org/wiki/Pilz_des_Jahres","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Leccinum_quercinum.jpg","page_title":"Pilz des Jahres","context_page_description":"Der Pilz des Jahres wird seit 1994 jährlich durch die Deutsche Gesellschaft für Mykologie ausgerufen, um auf die Gefährdung heimischer Pilze aufmerksam zu machen.\\nDie Auswahl des Pilzes des Jahres erfolgt nach der Gefährdung der Art oder ihres Lebensraumes durch den Menschen. Meist werden sehr auffällige Arten gewählt, damit auch für den mykologischen Laien die Wiedererkennung gewährleistet ist."},{"page_url":"https://ast.wikipedia.org/wiki/Matanzas","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Drawbridge_in_the_Matanzas_City.jpg","page_title":"Matanzas","context_page_description":"San Carlos y San Severino de Matanzas ye una ciudá de Cuba, capital de la provincia del mesmu nome. Foi fundada n'ochobre de 1693 nun sitiu privilexáu de la xeografía norte de Cuba ente la desaguada de los ríos Yumurí, San Juan y Canímar."},{"page_url":"https://en.wikipedia.org/wiki/Agboville","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Axe_Divo-Agboville.jpg","page_title":"Agboville","context_page_description":"Agboville is the town in south-eastern Ivory Coast. It is a sub-prefecture of and the seat of Agboville Department. It is also a commune and the seat of Agnéby-Tiassa Region in Lagunes District.\\nAgboville is north of Abidjan. The local ethnic group is the Abbey. The Abbey is one of over 60 ethnic groups in Ivory Coast, and are usually considered to be an Akan subgroup. The Abbey people have many traditions related to family and friends. One important holiday for the Abbeys is \\"La fête des ignames\\" or the \\"Yam Festival\\". Historically, the festival is a celebration of a good harvest of yams because yams have been the greatest resource for the Abbey region of Agboville.\\nAgboville is the seat of the Roman Catholic Diocese of Agboville."},{"page_url":"https://nl.wikipedia.org/wiki/Madonie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Madonie-map-bjs.jpg","page_title":"Madonie","context_page_description":"De Madonie is een gebergte dat tamelijk nauwkeurig in het midden van de Siciliaanse noordkust ligt. De Madonie bevindt zich ten zuiden van de badplaats Cefalù en behoort tot de Metropolitane Stad Palermo. De bergwegen in dit gebergte dienden onder de naam Circuito Piccolo delle Madonie van 1906 tot 1977 als evenementlocatie voor de Targa Florio.\\nIn sneeuwrijke winters worden de Madonie door de Palermitanen gebruikt voor wintersport. Tegelijkertijd fungeert het gebergte als belangrijk drinkwaterreservoir voor Palermo."},{"page_url":"https://de.wikipedia.org/wiki/Keinohrhasen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Nora_Tschirner_Berlinale_2009_crop.jpg","page_title":"Keinohrhasen","context_page_description":"Keinohrhasen ist eine deutsche Liebeskomödie von und mit Til Schweiger. Die Produktion entstand nach einem Drehbuch Schweigers und der Autorin Anika Decker und handelt vom Berliner Boulevardreporter Ludo Decker, der nach einem öffentlichen Fauxpas zu 300 Sozialstunden in einem Kinderhort verurteilt wird und dort auf seine ehemalige Mitschülerin Anna, gespielt von Nora Tschirner, trifft. Der Film startete am 20. Dezember 2007 in den deutschen Kinos. Der Film belegt Platz 13 der Liste der erfolgreichsten deutschen Filme in Deutschland seit Beginn der offiziellen Zuschauerzählung 1968."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D1%80%D0%B5%D0%B1%D1%86%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Gray_111_-_Vertebral_column-coloured.png","page_title":"Хребці","context_page_description":"Хребці́ — кісткові або хрящові елементи хребта хребетних тварин. Хребець складається з тіла, верхніх дуг, остистого і поперечного відростків. Будова хребців суттєво варіює у різних тварин та у різних відділах хребта."},{"page_url":"https://es.wikipedia.org/wiki/Parroquia_San_Agust%C3%ADn_(Caracas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/El_Conde_y_San_Agust%C3%ADn_del_Sur.jpg","page_title":"Parroquia San Agustín (Caracas)","context_page_description":"La Parroquia San Agustín es una de las 22 parroquias del Municipio Libertador del Distrito Capital de Venezuela y una de las 32 parroquias de Caracas."},{"page_url":"https://ro.wikipedia.org/wiki/Sk%C3%A1lav%C3%ADk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Sk%C3%A1lav%C3%ADk_Faroe_Islands_2012.JPG","page_title":"Skálavík","context_page_description":"Skálavík este un oraș din Insulele Faroe."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%97%90%EB%94%94_%EB%A0%88%EB%93%9C%EB%A9%94%EC%9D%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Eddie_Redmayne_at_TIFF_2014.jpg","page_title":"에디 레드메인","context_page_description":"에드워드 존 데이비드 \\"에디\\" 레드메인은 잉글랜드의 배우이다. 런던 웨스트민스터에서 태어나 성장한 레드메인은 케임브리지 대학교 트리니티 칼리지에서 미술사학을 공부했고, 이후 그는 잠시 동안 모델로 일하였다. 레드메인은 그의 영화 데뷔를 하기 전에 청소년 배우로 텔레비전의 게스트 출연과 런던 극장에서 자신의 전문적인 연기 경력을 시작했다. 그는 2006년 첫 영화 《라이크 마인드》와 《굿 셰퍼드》에 데뷔했고, 그는 《세비지 그레이스》, 《골든 에이지》, 《천일의 스캔들》의 여러 편의 영화에 조연 역할로 출연하였다.\\n레드메인은 연극에서도 활발히 활동하며, 《레드》과 《리차드 2세》 로 그의 연기에 대한 찬사를 받았다. 그는 토니상 남우조연상을 수상했다. 레드메인은 콜린 클라크를 연기한 전기 드라마 《마릴린 먼로와 함께한 일주일》과, 마리우스 퐁메르시를 연기한 톰 후퍼 감독의 뮤지컬 《레 미제라블》로 영화에서 주목을 받기 시작했다. 2014년, 레드메인은 스티븐 호킹을 연기한 영화 《사랑에 대한 모든 것》으로 그의 연기가 비평가들의 찬사를 받아 미국 아카데미상, 영국 아카데미 영화상, 골든 글로브상과 미국 배우 조합상 남우주연상을 수상해 세계적으로 큰 명성을 얻으며 스타덤에 올랐다. 다음 해, 그는 성전환 수술을 처음으로 받은 사람 중 한 명으로 알려진 에이나르 베게너 / 릴리 엘베를 연기한 《대니쉬 걸》 으로 미국 아카데미상 남우주연상에 두 번째로 후보 지명 되었다. 그는 5부작 판타지 영화 신비한 동물 시리즈에서 뉴트 스캐맨더를 연기하고 있다.\\n레드메인은 영화와 연극에 대한 공로를 인정받아 대영 제국 훈장 4등급을 받았다. 레드메인은 연기 경력 이외에, 그는 LGBT의 권리를 포함한 여러 사회 운동을 지원하고 있다."},{"page_url":"https://fr.wikipedia.org/wiki/Himerometra","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Himerometra_robustipinna.jpg","page_title":"Himerometra","context_page_description":"Himerometra est un genre de crinoïdes de la famille des Himerometridae."},{"page_url":"https://fr.wikipedia.org/wiki/Mycteroperca","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Tiger_Grouper_%285295762630%29.jpg","page_title":"Mycteroperca","context_page_description":"Mycteroperca est un genre de poissons de la famille des Serranidae dont les plus connus sont les « mérous »."},{"page_url":"https://pt.wikipedia.org/wiki/Pruchnik","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Pruchnik_domy_w_zabudowie_rynku2_31.12.2013_p.jpg","page_title":"Pruchnik","context_page_description":"Pruchnik é um município da Polônia, na voivodia da Subcarpácia, condado de Jarosław e sede da comuna de Pruchnik. Estende-se por uma área de 19,9 km², com 3 757 habitantes, segundo os censos de 2016, com uma densidade de 188,7 hab/km².\\nEncontra-se na terra histórica de Przemyśl."},{"page_url":"https://lv.wikipedia.org/wiki/Stacijas_de%C5%BEurants_un_vilcienu_dispe%C4%8Ders","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Ufficio_Movimento_1JPG.png","page_title":"Stacijas dežurants un vilcienu dispečers","context_page_description":"Stacijas dežurants un vilcienu dispečers ir dzelzceļa atbildīgie darbinieki par drošu vilcienu kustības organizāciju. Pirmajā gadījumā vilcienu kustību vada atsevišķā sadales punktā un tam tieši piekļaujošajos posmos, bet otrajā - veselā iecirknī vai pat vairākos iecirkņos vienlaicīgi, kur ietilpst vairāki sadales punkti un posmi. Nejaukt ar stacijas ēkas dežurantu, kurš lielās stacijās ir atbildīgs par kārtību stacijas ēkā. Stacijas dežurants pilda visus vilcienu dispečera rīkojumus pat, ja vilcienu dispečera rīcībā neatrodas centralizācijas iekārta ierīču tiešai darbināšanai. Kad SCB iekārtu attīstība bija zemā līmenī, katrā sadales punktā uz vietas atradās stacijas dežurants, kurš parasti strādāja diennakti dalot maiņās, bet vilcienu dispečers norādījumus par vicienu palaišanas priekšrocībām deva pa telefonu. Toties līdz ar tehnoloģisko SCB iekārtu progresu radās iespēja visas stacijas dzežuranta funkcijas pārlikt uz vilcienu dispečera pleciem un daļēji atteikties no stacijas dežurantiem, kas deva darba algas fonda ietaupījumu un rīkojumu veiktspējas operativitāti."},{"page_url":"https://en.wikipedia.org/wiki/Academy_of_Athens_(modern)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Academia4.jpg","page_title":"Academy of Athens (modern)","context_page_description":"The Academy of Athens is Greece's national academy, and the highest research establishment in the country. It was established in 1926, and operates under the supervision of the Ministry of Education. The Academy's main building is one of the major landmarks of Athens."},{"page_url":"https://de.wikipedia.org/wiki/Curtis_Mayfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Curtis_Mayfield.png","page_title":"Curtis Mayfield","context_page_description":"Curtis Lee Mayfield war ein US-amerikanischer Soulmusiker."},{"page_url":"https://hu.wikipedia.org/wiki/Botrugno","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Piazza_Indipendenza_Botrugno.jpg","page_title":"Botrugno","context_page_description":"Botrugno község Olaszország Puglia régiójában, Lecce megyében."},{"page_url":"https://sv.wikipedia.org/wiki/Sofia_F%C3%B6lster","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Sofia_F%C3%B6lster.jpg","page_title":"Sofia Fölster","context_page_description":"Sofia Catharina Margarita Fölster, född 17 december 1991 i Nacka i Stockholms län, är en svensk civilekonom och politiker för Moderaterna. Hon var riksdagsledamot åren 2014–2018. Hon var förste vice förbundsordförande för Moderata Ungdomsförbundet från oktober 2016 till november 2018.\\nHon är utbildad civilekonom vid Handelshögskolan i Stockholm.\\nHon är dotter till nationalekonomen Stefan Fölster och således barnbarn till Kaj Fölster och barnbarns barn till de socialdemokratiska politikerna Gunnar Myrdal och Alva Myrdal."},{"page_url":"https://sw.wikipedia.org/wiki/Nikwata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Flat-tailed_House_Gecko_%28Cosymbotus_platyurus%297.jpg","page_title":"Nikwata","context_page_description":"Nikwata ni spishi za mijusi-kafiri katika jenasi Hemidactylus ya familia Gekkonidae. Wamepewa jina hili kwa sababu huishi katika nyumba za watu mara nyingi. Spishi nyingine za Hemidactylus huitwa mijusi-kafiri vidole-majani na hawa wanatokea porini au msituni.\\nKama mijusi-kafiri takriban wote nikwata hawana kope na hulamba macho mara kwa mara kuzuia yasikauke. Hukiakia usiku wakikamata wadudu.\\nNikwata, na spishi nyingine zote za Hemidactylus, wana vidole vyenye ncha zilizopanuka. Ncha hizi za vidole zinashika uso wowote, hata nyuso laini. Kwa hivyo wanaweza kutembea bila shida kwa ukuta na dari na hata kioo."},{"page_url":"https://es.wikipedia.org/wiki/Cameron_Wright","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Cameron_Wright.JPG","page_title":"Cameron Wright","context_page_description":"Cameron Robin Wright es un jugador sudafricano de rugby que se desempeña como medio scrum y juega en los Sharks, franquicia sudafricana del Super Rugby.​"},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_ponts_du_Br%C3%A9sil","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Ponte_Gercino_Coelho_2_%28Rio_S%C3%A3o_Francisco%29.JPG","page_title":"Liste de ponts du Brésil","context_page_description":"Cette liste de ponts du Brésil a pour vocation de présenter une liste de ponts remarquables du Brésil, tant par leurs caractéristiques dimensionnelles, que par leur intérêt architectural ou historique.\\nLa liste peut être triée selon les différentes entrées du tableau pour voir ainsi les ponts en arc ou les ouvrages les plus récents par exemple."},{"page_url":"https://de.wikipedia.org/wiki/Roussillon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Paysage_aux_abords_de_C%C3%A9ret%2Cdans_les_Pyr%C3%A9n%C3%A9es_Orientales.jpg","page_title":"Roussillon","context_page_description":"Das Roussillon ist eine alte Kulturlandschaft und eine historische Provinz im Süden Frankreichs. Das Gebiet entspricht etwa dem heutigen Département Pyrénées-Orientales mit der Großstadt Perpignan als Hauptort."},{"page_url":"https://en.wikipedia.org/wiki/Clan_na_Gael","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Joseph_McGarrity.jpg","page_title":"Clan na Gael","context_page_description":"The Clan na Gael was an Irish republican organization in the United States in the late 19th and 20th centuries, successor to the Fenian Brotherhood and a sister organization to the Irish Republican Brotherhood. It has shrunk to a small fraction of its former size in the 21st century."},{"page_url":"https://da.wikipedia.org/wiki/Skaraborgs_l%C3%A4n","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/SverigesL%C3%A4n1997Skaraborg.svg","page_title":"Skaraborgs län","context_page_description":"Skaraborgs län var i perioden 1634-1998 et län i Västergötland i Sverige, mellem søerne Vänern og Vättern. Länsbogstavet var R og residensby var Mariestad, mens Skövde var länets største by."},{"page_url":"https://pl.wikipedia.org/wiki/Wielki_Meczet_w_Tajpej","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/%E5%8F%B0%E5%8C%97%E6%B8%85%E7%9C%9F%E5%A4%A7%E5%AF%BA.jpg","page_title":"Wielki Meczet w Tajpej","context_page_description":"Wielki Meczet w Tajpej – najważniejszy meczet Tajwanu, znajdujący się w dzielnicy Da’an w Tajpej.\\nPowstanie meczetu było ściśle związane z masową emigracją powiązanych z Kuomintangiem muzułmanów na Tajwan w 1949 roku. Jego bryłę zaprojektował słynny tajwański architekt C.C. Yang. Meczet został uroczyście otwarty 13 kwietnia 1960 roku. Budowę sfinansował rząd tajwański oraz państwa arabskie. W 1971 roku w świątyni gościł saudyjski król Fajsal ibn Abd al-Aziz Al Su’ud.\\nBudowla zajmuje powierzchnię 2747 m². Kopuła ma 15 m wysokości oraz 15 m średnicy i została wykonana bez żebrowania. Meczet posiada dwa minarety o wysokości 20 metrów. Wnętrze zdobią perskie dywany i ozdobne żyrandole."},{"page_url":"https://en.wikipedia.org/wiki/Kfar_Hasidim_Bet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Israel_outline_haifa.png","page_title":"Kfar Hasidim Bet","context_page_description":"Kfar Hasidim Bet is a community settlement in northern Israel. Located near Nesher, it falls under the jurisdiction of Zevulun Regional Council. In 2018 it had a population of 335.\\nThe village was founded in 1950 by residents of Kfar Hasidim, and was recognised by the state in 1959."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B5%D0%BC%D0%BD%D0%BE%D1%82%D0%B5%D0%BB%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Peltis.grossa.-.calwer.14.18.jpg","page_title":"Темнотелки","context_page_description":"Темнотелки, или щитовидки — семейство насекомых из отряда жесткокрылых."},{"page_url":"https://de.wikipedia.org/wiki/Basilika_St._Johann_(Saarbr%C3%BCcken)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Saarbr%C3%BCcken_Basilika_St._Johann_Sakristei.JPG","page_title":"Basilika St. Johann (Saarbrücken)","context_page_description":"Die Basilika St. Johann in Saarbrücken ist eine katholische Kirche in der Nähe des St. Johanner Marktes. Der Kirchenbau entstand nach Plänen und unter Leitung des Architekten Friedrich Joachim Stengel im Stil des Barock. Die im Jahr 1975 von Papst Paul VI. zur Basilika minor erhobene Kirche steht an der Stelle der ersten mittelalterlichen Kapelle des ehemaligen Fischerdorfes St. Johann a.d. Saar, die der Überlieferung nach durch den Metzer Bischof Arnulf von Metz im 7. Jahrhundert dem hl. Johannes dem Täufer geweiht worden war. In der Denkmalliste des Saarlandes ist die Kirche als Einzeldenkmal aufgeführt. Die Kirche ist dem Bistum Trier zugeordnet. Patroziniumstag der Kirche ist das Hochfest der Geburt des hl. Johannes des Täufers."},{"page_url":"https://it.wikipedia.org/wiki/Opel_Astra_J","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/2013_Opel_Astra_%2812261340845%29.jpg","page_title":"Opel Astra J","context_page_description":"L'espressione Astra J indica la quarta generazione dell'Opel Astra, un'autovettura del segmento C prodotta a partire dalla fine del 2009 al 2018 dalla Casa automobilistica tedesca Opel. Dal 2015 in poi, sono rimaste in listino solo la versione coupé, denominata semplicemente GTC, e la berlina a 3 volumi."},{"page_url":"https://en.wikipedia.org/wiki/Notebook_of_William_Blake","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Blake_manuscript_-_Notebook_-_page_013.jpg","page_title":"Notebook of William Blake","context_page_description":"The Notebook of William Blake was used by William Blake as a commonplace book from c. 1787 to 1818."},{"page_url":"https://en.wikipedia.org/wiki/2007%E2%80%9308_Minnesota_Wild_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/122007-WildXcel-Gaborik5goalperformance.jpg","page_title":"2007–08 Minnesota Wild season","context_page_description":"The 2007–08 Minnesota Wild season began October 4, 2007. It was the Wild's eighth season in the National Hockey League. They won their first Northwest Division title this season.\\nKey dates prior to the start of the season:\\nThe 2007 NHL Entry Draft took place in Columbus, Ohio, on June 22–23\\nThe free agency period began on July 1."},{"page_url":"https://eu.wikipedia.org/wiki/Santa_Maria_della_Pace","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Ponte-_Chiesa_di_S.Maria_della_Pace.jpg","page_title":"Santa Maria della Pace","context_page_description":"Santa Maria della Pace Erromako eliza bat da, Ponte rionean kokaturik dagoena."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%83%D0%B4%D0%B5%D1%8F%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Ivan_print.jpg","page_title":"Кудеяр","context_page_description":"Кудеяр — легендарный разбойник, персонаж русского фольклора с XVI века. В некоторых версиях легенды, брат Ивана Грозного или сын Жигмонда Батори.\\nТакже словом «кудеяр» называли кудесника, волшебника."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%97%D0%B0%D0%B2%D0%B8%D1%87%D0%B0%D1%98%D0%BD%D0%B8_%D0%BC%D1%83%D0%B7%D0%B5%D1%98_%E2%80%9E%D0%93%D0%BB%D0%B0%D0%B2%D0%B0%D1%88%D0%B5%D0%B2%D0%B0_%D0%BA%D1%83%D1%9B%D0%B0%E2%80%9D_%D1%83_%D0%9D%D0%BE%D0%B2%D0%BE%D0%BC_%D0%91%D0%B5%D1%87%D0%B5%D1%98%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/%D0%A1%D1%82%D0%B0%D0%BC%D0%B1%D0%B5%D0%BD%D0%B0_%D0%B7%D0%B3%D1%80%D0%B0%D0%B4%D0%B0_%D0%88%D0%BE%D1%81%D0%B8%D1%84%D0%B0_%D0%9C%D0%B0%D1%80%D0%B8%D0%BD%D0%BA%D0%BE%D0%B2%D0%B8%D1%9B%D0%B0_013.JPG","page_title":"Завичајни музеј „Главашева кућа” у Новом Бечеју","context_page_description":"Завичајни музеј „Главашева кућа” у Новом Бечеју је основан 16. фебруара 2009. године и смештен је у родној кући др Владимира Главаша, у улици Јосифа Маринковића 69, у насељу Врањево. Зграда у којој се музеј налази под заштитом је Републике Србије као споменик културе од великог значаја."},{"page_url":"https://en.wikipedia.org/wiki/Graphical_timeline_of_plesiosaurs","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Trinacromerum_BW.jpg","page_title":"Graphical timeline of plesiosaurs","context_page_description":null},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolper-_und_Gedenksteine_in_Prag-Josefov","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Stolperstein_f%C3%BCr_Alois_Bergmann.jpg","page_title":"Liste der Stolper- und Gedenksteine in Prag-Josefov","context_page_description":"Die Liste der Stolpersteine in Prag-Josefov listet die Stolpersteine im Verwaltungsbezirk Josefov in Prag, dem ehemaligen jüdischen Viertel, auf. Die Stolpersteine erinnern an das Schicksal der Menschen, welche von den Nationalsozialisten ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Stolpersteine werden auf tschechisch stolpersteine genannt, alternativ auch kameny zmizelých.\\nDas tschechische Stolpersteinprojekt Stolpersteine.cz wurde 2008 durch die Česká unie židovské mládeže ins Leben gerufen und stand unter der Schirmherrschaft des Prager Bürgermeisters. Die Stolpersteine liegen in der Regel vor dem letzten selbstgewählten Wohnort des Opfers. Die erste Verlegung fand am 8. Oktober 2008 statt, an diesem Tag wurde der Stolperstein für Max Eckstein verlegt."},{"page_url":"https://hr.wikipedia.org/wiki/Vi%C5%A1njevac_(Subotica,_Srbija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Flag_of_Subotica%2C_Serbia.png","page_title":"Višnjevac (Subotica, Srbija)","context_page_description":"Višnjevac je naselje u općini Subotica u Sjevernobačkom okrugu u Vojvodini."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Zeist","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Den_Dolder_Willem_Arntzhoeve_Camper.jpg","page_title":"Lijst van gemeentelijke monumenten in Zeist","context_page_description":"De gemeente Zeist telt 1538 gemeentelijke monumenten. Deze zijn verdeeld over 494 monumentencomplexen."},{"page_url":"https://nl.wikipedia.org/wiki/Uni%C3%B3n_La_Calera","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Estadio_Nicol%C3%A1s_Chahu%C3%A1n_Nazar.JPG","page_title":"Unión La Calera","context_page_description":"Deportes Unión La Calera is een Chileense voetbalclub uit de stad La Calera, gelegen in de provincie Quillota. De club werd opgericht op 26 januari 1954 na een fusie van vijf clubs: Tifón, Minas Navío, Cóndor, Cemento Melón en Calera Comercio. De voornaamste rivaal is San Luis Quillota.\\nUnión La Calera speelt zijn thuiswedstrijden in het Estadio Municipal Nicolás Chahuán, dat plaats biedt aan 15.000 toeschouwers. De clubkleuren zijn rood-wit. Unión La Calera promoveerde in 2010 naar de hoogste afdeling van het Chileense profvoetbal, de Primera División."},{"page_url":"https://de.wikipedia.org/wiki/Humbaur","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Humbaur_Ulrich.jpg","page_title":"Humbaur","context_page_description":"Die Humbaur GmbH ist ein deutscher Hersteller von Anhängern, Aufbauten und Aufliegern aus Gersthofen. Mit über 1.000.000 verkauften Einheiten zählt Humbaur zu den führenden Nutzfahrzeugherstellern Europas. Die Geschäfte werden von dem Gersthofener Unternehmer Ulrich Humbaur geführt. 2010 wurde er zum „Botschafter“ für das Augsburger Land ernannt."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%96%B0%E7%94%B0_(%E9%A6%99%E6%B8%AF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/HK_LokMaChau_HaWanFishermenSanTsuen.jpg","page_title":"新田 (香港)","context_page_description":"新田或新田乡位于香港元朗区东北部，是一片冲积平原，新田乡以新田为中心，覆盖东面的落马洲和西面的米埔，其东面至洲头、潘屋，北面至下湾，濒临深圳河，西南面至壆围，而西北则连接后海湾。\\n新田亦是新界五大氏族之一的文氏其中一个聚居地。新田与屏山、厦村、十八乡、八乡和锦田合称“元朗六乡”。"},{"page_url":"https://en.wikipedia.org/wiki/Reog","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Reog_Ponorogo_-_Singo_Barong.jpg","page_title":"Reog","context_page_description":"Reog or Réyog is a traditional Indonesian dance in an open arena that serves as folk entertainment, contains magical elements, the main dancer is a lion-headed person with a peacock feather decoration, plus several masked dancers and Kuda Lumping. Reog is one of the performing arts from the northwestern region of East Java and Ponorogo is the region where Reog originated. The city gate of Ponorogo is decorated with warok and gemblak, two characters who were present at the time when Reog is performed. Reog is one of Indonesian culture that is still very strong with mystical elements and mysticism."},{"page_url":"https://war.wikipedia.org/wiki/Platichthys_stellatus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Starry_Flounder.JPG","page_title":"Platichthys stellatus","context_page_description":"An Platichthys stellatus in uska species han Actinopterygii nga syahan ginhulagway ni Peter Simon Pallas hadton 1787. An Platichthys stellatus in nahilalakip ha genus nga Platichthys, ngan familia nga Pleuronectidae. Waray hini subspecies nga nakalista."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B9%E3%83%9D%E3%82%A4%E3%83%A9%E3%83%BC_(%E8%88%AA%E7%A9%BA%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Hidari_senkai_boeing_737.jpg","page_title":"スポイラー (航空機)","context_page_description":"航空工学におけるスポイラーは、航空機の揚力を減少させる装置である。スピード・ブレーキまたはリフト・ダンパーとも呼ばれている。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%8A%92%E9%80%9A%E6%B2%B3%E7%95%94%E5%9C%A3%E8%A5%BF%E5%B0%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/90/Map_commune_FR_insee_code_01343.png","page_title":"芒通河畔圣西尔","context_page_description":"芒通河畔圣西尔，是法国东部安省的一个市镇。面积 16.93平方公里，人口1314，人口密度77.61人／平方公里。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%BF%AA%E5%A3%AB%E5%B0%BC%E5%8A%A0%E5%B7%9E%E5%A4%A7%E9%A3%AF%E5%BA%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/RoomViewCaliforniaAdventure.JPG","page_title":"迪士尼加州大飯店","context_page_description":"迪士尼加州大飯店是一間位於美國加州安那翰迪士尼樂園度假區內的度假村飯店。飯店在2001年間迪士尼樂園度假區大幅擴建時落成，是度假區中的主要飯店之一，由華特迪士尼樂園及度假區負責營運。飯店的建築設計與裝潢以20世紀美國藝術與工藝美術運動為主題，展示了北加利福尼亞州的建築樣式。飯店內也設有一棟迪士尼假期俱樂部會館，於2009年9月開幕。"},{"page_url":"https://zh.wikipedia.org/wiki/%E7%AB%8B%E6%B3%95%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Chun-hsian_Building%2C_Legislative_Yuan_20090919.jpg","page_title":"立法院","context_page_description":"立法院是中華民國的最高立法機關，同時為中華民國國會，簡稱立院。其前身為民國初年立法機構之衆議院。國民政府時期以恢復法統爲由，立法院於民國17年成立於南京。最初為國民政府的附屬機關，民國37年因應行憲而在制度上脫離行政權，成為正式的議會機關。現在是一院制之議會，設有113個席位。1992年，立法院開始全面定期改選至今。現任之第十屆立法委員於2020年2月1日宣誓就職，任期屆滿日為2024年1月31日。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B0%D0%BC%D1%8B%D1%85_%D0%BF%D1%80%D0%BE%D0%B4%D0%B0%D0%B2%D0%B0%D0%B5%D0%BC%D1%8B%D1%85_%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%BE%D0%B1%D0%B8%D0%BB%D0%B5%D0%B9_%D0%B2_%D0%95%D0%B2%D1%80%D0%BE%D0%BF%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Brand_new_Ford_Focus_1.0_Ecoboost_%282014%29_%2816063440736%29.jpg","page_title":"Список самых продаваемых автомобилей в Европе","context_page_description":"Приведены списки десяти самых продаваемых легковых автомобилей в Европе за соответствующий календарный год. Цветом отмечены новички списков."},{"page_url":"https://es.wikipedia.org/wiki/R%C3%ADo_Elba","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Lauf_der_Elbe.png","page_title":"Río Elba","context_page_description":"El río Elba es uno de los principales ríos de la Europa central, el segundo más largo de los que desembocan en el mar del Norte, tras el Rin. Se encuentra íntegramente en el territorio de la Unión Europea. Tiene una longitud de 1165 km​ y drena una gran cuenca de 144 060 km²​ que corresponde a Alemania, República Checa, Austria y Polonia. El sistema fluvial más largo de la cuenca corresponde al Elba–Moldava, con 1231 km.\\nEl Elba nace en el norte de la República Checa, a 1386 m de altitud, en la vertiente meridional de los montañas de los Gigantes, y tras discurrir primero en dirección sureste y virar al noroeste, desemboca no lejos de Hamburgo en el mar del Norte. El Elba discurre por cuatro de las trece regiones de la República Checa —Hradec Králové, Bohemia Central, Pardubice y Ústí nad Labem— y cinco de los 16 estados federados de Alemania —Sajonia, Sajonia-Anhalt, Baja Sajonia y Schleswig Holstein, así como la ciudad-estado de Hamburgo—. En ambos países, el Elba es la segunda vía fluvial navegable —después del Moldava y del Rin— y está en el centro de un conjunto de canales que forman una red de comunicaciones entre el Rin y el mar Báltico."},{"page_url":"https://en.wikipedia.org/wiki/Three-star_rank","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Laksdya_maritim.png","page_title":"Three-star rank","context_page_description":"An officer of three-star rank is a senior commander in many of the armed services holding a rank described by the NATO code of OF-8. The term is also used by some armed forces which are not NATO members. Typically, three-star officers hold the rank of vice admiral, lieutenant general, or in the case of those air forces with a separate rank structure, air marshal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B7%D0%BB%D0%BE%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Germany_in_XXI_century._Criminal_police.jpg","page_title":"Взлом","context_page_description":"Взлом:\\nВзлом:\\nВзлом — испанский триллер 1981 года, режиссёр Хосе Луис Гарси\\nВзлом — французская криминальная драма 1983 года, режиссёр Даниэль Дюваль\\nВзлом — немецкая криминальная комедия 1988 года, режиссёр Франк Байер\\nВзлом — финская короткометражная драма 1993 года, режиссёр Еса Илли\\nВзлом — американский триллер 2000 года, режиссёр Джо Чэппелл\\nВзлом — американский триллер 2006 года, режиссёр Майкл Нанкин\\nВзлом — американский фильм ужасов 2014 года, режиссёр Шон Картер\\nВзлом — российский телевизионный художественный фильм 2016 года, режиссёр Максим Кубринский\\nВзлом замка\\nКража со взломом — уголовно наказуемое деяние.\\nКража со взломом — пьеса Кант Минна.\\nВзлом сетей\\nВзлом пароля\\nВзлом программного обеспечения\\nВзлом PlayStation Network\\nВзлом телефонных автоматов\\nВзлом окружающей жизни"},{"page_url":"https://sv.wikipedia.org/wiki/Salix_caroliniana","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Pollen_Dusted_Bee_%26_Blooming_Willow_%28Salix_caroliniana%29_%286738986329%29.jpg","page_title":"Salix caroliniana","context_page_description":"Salix caroliniana är en videväxtart som beskrevs av André Michaux. Salix caroliniana ingår i släktet viden, och familjen videväxter. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pl.wikipedia.org/wiki/Australia_na_zimowych_igrzyskach_olimpijskich","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Saguenay_500m.jpg","page_title":"Australia na zimowych igrzyskach olimpijskich","context_page_description":"Australia na zimowych igrzyskach olimpijskich pojawiła się po raz pierwszy w 1936 w Garmisch-Partenkirchen i uczestniczyła odtąd we wszystkich kolejnych oprócz tych, które miały miejsce w 1948 w Sankt Moritz.\\nAustralia zdobyła swój pierwszy medal z zimowych igrzysk olimpijskich, brązowy, w 1994 w short tracku w sztafecie na dystansie 5000 metrów. Pierwszy medal indywidualny dla Australii zdobyła Zali Steggall, był to brązowy medal w 1998 w slalomie narciarskim kobiet. Podczas igrzysk w 2002 złote medali zdobyli Steven Bradbury w short tracku na dystansie 1000m i Alisa Camplin w narciarskich skokach akrobatycznych, dzięki czemu Australia stała się jedynym państwem z półkuli południowej, które kiedykolwiek zdobyło złote medale na Zimowych Igrzyskach Olimpijskich.\\nNa Zimowych Igrzyskach Olimpijskich 2006 w Turynie Australię reprezentowało 40 zawodników, najwięcej w całej historii startów sportowców z tego kraju. Pierwszy raz też z góry założonym celem było zdobycie medalu, co udało się Daleowi Begg-Smithowi, który zdobył złoty medal w narciarstwie dowolnym. Medal zdobyła także, drugi raz w swojej karierze, Alisa Camplin, zajmując trzecie miejsce w skokach akrobatycznych."},{"page_url":"https://de.wikipedia.org/wiki/Santa_Maria_sopra_Minerva_(Rom)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Santa_Maria_sopra_Minerva_Orgel.JPG","page_title":"Santa Maria sopra Minerva (Rom)","context_page_description":"Santa Maria sopra Minerva, vollständig Basilica di Santa Maria sopra Minerva, ist der einzig bedeutende Kirchenbau Roms aus der Zeit der Gotik und eine der Hauptkirchen des Dominikanerordens in Rom. Seit 1566 ist die Basilica minor eine Titelkirche der römisch-katholischen Kirche. Sie befindet sich an der Piazza della Minerva im Rione Pigna im historischen Zentrum Roms, dem Marsfeld südöstlich des Pantheon. Südlich grenzt die Straße Via di S. Caterina da Siena an, benannt nach der Heiligen Katharina von Siena, deren Grab sich unter dem Hauptaltar der Kirche befindet.\\nDie Kirche wurde über den Ruinen der Saepta Julia und in der Nähe eines römischen Minerva-Tempels errichtet, daher der Name.\\nUnter Papst Nikolaus III. begann ca. 1280 die Entstehungsgeschichte des heute existierenden Kirchenbaus, der innen endgültige 1453 und die Fassade 1725 unter Papst Benedikt XIII. fertig gestellt wurde. Umbauten im Barock und im 19. Jahrhundert verleihen der Kirche ihr heutiges Aussehen. Sie ist Grabeskirche der Päpste Leo X., Clemens VII., Paul IV., Benedikt XIII. und Urban VII., zahlreicher Kardinäle sowie Künstler."},{"page_url":"https://da.wikipedia.org/wiki/Naturpark_Westensee","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d3/Der_Brahmsee_in_der_Gemeinde_Langwedel.JPG","page_title":"Naturpark Westensee","context_page_description":"Naturpark Westensee ligger i trekanten mellem byerne Kiel–Neumünster–Rendsburg i morænelandskabet Østholstenske Bakkeland. Naturparken administreres af Kreis Rendsburg-Eckernförde."},{"page_url":"https://it.wikipedia.org/wiki/Theraphosidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Grammostola_cf._porteri_adult_male.jpg","page_title":"Theraphosidae","context_page_description":"Theraphosidae Thorell, 1870 è una famiglia di ragni appartenente all'infraordine Mygalomorphae, i cui membri sono noti come migale o \\"volgarmente\\" chiamate tarantole."},{"page_url":"https://nl.wikipedia.org/wiki/Trypoxylon_attenuatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/SaundersHymenopteraAculeataPlate11_Trypoxylon_attenuatum.jpg","page_title":"Trypoxylon attenuatum","context_page_description":"Trypoxylon attenuatum is een vliesvleugelig insect uit de familie van de graafwespen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1851 door F. Smith."},{"page_url":"https://sk.wikipedia.org/wiki/WBSC_Premier_12_2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/%E9%9B%B2%E6%9E%97%E7%B8%A3%E6%96%97%E5%85%AD%E6%A3%92%E7%90%83%E5%A0%B4.JPG","page_title":"WBSC Premier 12 2015","context_page_description":"WBSC Premier 12 2015 bol 1. ročník WBSC Premier 12, elitnej súťaže národných družstiev v bejzbale mužov, ktorú organizuje Svetová bejzbalová a softbalová konfederácia. WBSC Premier 12 nahradila zaniknutú súťaž – majstrovstvá sveta. Súťaž sa konala sa v šiestich mestách Taiwanu a Japonska: Tchaj-čung, Tchaj-pej, Thao-jüan, Tou-liou, Sapporo a Tokio. Turnaja sa zúčastňuje 12 družstiev, ktoré sa naň kvalifikovali na základe umiestnenia vo svetovom rebríčku. Víťazom sa stala Kórejská republika, ktorá vo finálovom stretnutí zvíťazila nad Spojenými štátmi."},{"page_url":"https://pl.wikipedia.org/wiki/W%C4%99ze%C5%82_ratowniczy","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/As_de_guia_2.jpg","page_title":"Węzeł ratowniczy","context_page_description":"Węzeł ratowniczy lub węzeł skrajny tatrzański – jeden z węzłów stosowanych we wspinaczce, żeglarstwie oraz ratownictwie. Szczególnie przydatny w sytuacjach, gdy wokół danego przedmiotu należy zawiązać niezaciskającą się pętlę."},{"page_url":"https://nl.wikipedia.org/wiki/La_Monumental","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/050529_Barcelona_027.jpg","page_title":"La Monumental","context_page_description":"La Monumental is een voormalige arena voor stierengevechten in de stad Barcelona in Spanje. Het gebouw bevindt zich op de kruising van Gran Via de les Corts Catalanes en de Carrer de la Marina. Metrostation Monumental, naast het gebouw, is ernaar vernoemd.\\nHet gebouw is op 12 april 1914 in gebruik genomen en biedt plaats aan een kleine twintigduizend toeschouwers. De arena werd in moderne stijl ontworpen door Manuel Joaquim Raspall i Mayol, een latere toevoeging in neo-Moorse stijl was van Ignasi Mas i Morell en Domènec Sugrañes i Gras. De arena behoorde met Las Ventas in Madrid en la Maestranza in Sevilla tot de drie belangrijkste in Spanje en werd onder andere bespeeld door de toptorero José Tomás.\\nOp 25 september 2011, drie maanden voor de afschaffing van stierengevechten in de regio Catalonië, vonden er de laatste stierengevechten plaats. Sindsdien wordt het gebouw gebruikt voor circusvoorstellingen en concerten. Al eerder traden grootheden op als de Beatles, de Rolling Stones, Bob Marley, Tina Turner, Dire Straits en Bruce Springsteen.\\nLes Arenes, een van de twee andere voormalige stierenarena's in Barcelona, is nu een winkelcentrum. De derde werd al eerder afgebroken."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%86%D8%AA%DB%8C%D8%AA%D8%B3%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Sentice_vlajka.jpg","page_title":"سنتیتسه","context_page_description":"سنتیتسه یک منطقهٔ مسکونی در جمهوری چک است که در ناحیه برنو-تسوونتری واقع شده‌است. سنتیتسه ۹٫۲۷ کیلومتر مربع مساحت و ۵۸۶ نفر جمعیت دارد و ۳۰۸ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://nl.wikipedia.org/wiki/William_Strang","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/William_Strang11.jpg","page_title":"William Strang","context_page_description":"William Strang was een Schots etser en kunstschilder."},{"page_url":"https://tr.wikipedia.org/wiki/Concepcion,_%C5%9Eili","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Biobus01.jpg","page_title":"Concepcion, Şili","context_page_description":"Concepción, Şili'de 220.000 nüfuslu bir şehir.\\nBaşkent Santiago ve Valparaíso ile beraber ülkenin en önemli üç şehrinden biridir. Santiago'dan sonra ülkenin ikinci önemli ekonomi merkezidir."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84%D9%8A_%D9%85%D9%88%D9%86%D8%AA%D9%8A%D8%AC%D9%86%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Map_commune_FR_insee_code_62133.png","page_title":"بيلي مونتيجني","context_page_description":"بيلي مونتيجني ‏ هي بلدية تقع في إقليم باد كاليه من منطقة نور با دو كاليه في شمال فرنسا. تبلغ مساحة هذه المدينة 2.71، وترتفع عن سطح البحر م، يبلغ عدد سكانها 8104 نسمة حسب إحصاء المعهد الوطني للإحصاء والدراسات الاقتصادية سنة 2009 م. وترأس Bruno Troni البلدية خلال فترة."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%98%D1%80%D0%BE%D0%BD_%D0%A0%D0%B8%D0%B2%D0%B5%D1%80_(%D0%9C%D0%B8%D1%87%D0%B8%D0%B3%D0%B5%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Iron_River_MI_Town_Hall.jpg","page_title":"Ајрон Ривер (Мичиген)","context_page_description":"Ајрон Ривер (Мичиген) град је у америчкој савезној држави Мичиген. По попису становништва из 2010. у њему је живело 3.029 становника."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A5%D0%B5%D0%BD%D1%96%D0%BD%D0%B3_%D0%9C%D0%B0%D0%BD%D0%BA%D0%B5%D0%BB%D1%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Henning_Mankell_lecturing_at_Parkteateret.jpg","page_title":"Хенінг Манкель","context_page_description":"Хенінг Манкель — шведскі тэатральны рэжысёр і пісьменнік, аўтар дэтэктыўных раманаў пра камісара Курта Валандэра."},{"page_url":"https://ro.wikipedia.org/wiki/Spadice","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Arum_maculatum_MS_8006.JPG","page_title":"Spadice","context_page_description":"În botanică, un spadice sau spadix este un tip de inflorescență racemoasă cu flori mici, sesile, dispuse pe un rahis îngroșat și cărnos. Spadicele este în mod obișnuit protejat de o hipsofilă exagerat de mare, în formă de cornet, numită spată. Spadicele este inflorescența caracteristică a familiei Arecaceae.\\nSpadicele de la Arum maculatum are florile unisexuate: cele bărbătești dispuse superior, iar cele femeiești inferior. Atât între acestea, cât și deasupra celor bărbătești se află flori sterile, rudimentare, globuloase, cu vârful filiform. Spadicele se întâlnește și la Typha sp. Știuletele de la Zea mays poate fi considerat spadice, dar axa este lignificată, iar florile sunt femeiești și protejate de bractee mari numite pănuși."},{"page_url":"https://hu.wikipedia.org/wiki/Nevada_korm%C3%A1nyz%C3%B3inak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Henry_Goode_Blasdel.jpg","page_title":"Nevada kormányzóinak listája","context_page_description":"Ez a lista az Amerikai Egyesült Államok Nevada államának kormányzóit sorolja föl. Nevada neve a spanyol „hóval borított” kifejezésből ered. Az államot a „harcban született” néven is emlegetik, utalva arra, hogy Nevada a polgárháború idején lépett be az Unióba. Az Egyesült Államok nyugati területén helyezkedik el. Fővárosa Carson City, legnagyobb városa Las Vegas. Az állam beceneve \\"az ezüst állam\\", mivel sok ezüstlelőhelyet fedeztek fel itt. Az első település Mormon Station volt.\\nNevada a hetedik legnagyobb állam, mely magában foglalja délen a Mojave sivatagot és északon a Great Basint. Az állam területének megközelítőleg 86 százaléka a központi kormány tulajdonában van, mind polgári, mind katonai szempontból. Az első fehér ember – a spanyol Escalante misszionárius – 1755-ben járt erre, de az indiánok által is gyéren lakott víztelen, sivatagos területet nem tartotta érdemesnek misszió megalapítására. A 19. század kezdetén az északi erdősebb területeken prémvadászok jelentek meg."},{"page_url":"https://en.wikipedia.org/wiki/Diffuser_(automotive)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/SplitterNASCARKaseyKahneFront.jpg","page_title":"Diffuser (automotive)","context_page_description":"A diffuser, in an automotive context, is a shaped section of the car underbody which improves the car's aerodynamic properties by enhancing the transition between the high-velocity airflow underneath the car and the much slower freestream airflow of the ambient atmosphere. It works by providing a space for the underbody airflow to decelerate and expand so that it does not cause excessive flow separation and drag, by providing a degree of \\"wake infill\\" or more accurately, pressure recovery. The diffuser itself accelerates the flow in front of it, which helps generate downforce. This is achieved by creating a change in velocity of the air flowing under the diffuser by giving it a rake angle which in turn generates a change in pressure and hence increases downforce."},{"page_url":"https://sv.wikipedia.org/wiki/Euthalia_phemius","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/EuthaliaPhemius238_1.jpg","page_title":"Euthalia phemius","context_page_description":"Euthalia phemius är en fjärilsart som beskrevs av Doubleday 1848. Euthalia phemius ingår i släktet Euthalia och familjen praktfjärilar. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://eo.wikipedia.org/wiki/P%C5%99%C3%ADbor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/P%C5%99%C3%ADbor_%283%29.jpg","page_title":"Příbor","context_page_description":"Příbor estas urbo en Ĉeĥio en Moravia-Silezia Regiono, situanta 11 km nordoriente de Nový Jičín. En 2018 ĝi havis 8 437 loĝantojn. Ĝi konatas precipe kiel naskiĝloko de Sigmund Freud. Por esperantistoj ĝi gravas ankaŭ kiel loko de la supozeble plej malnova neformala Esperanto-rondeto en la tiama Aŭstrio-Hungario."},{"page_url":"https://fr.wikipedia.org/wiki/Modak","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ukadiche_Modak_%28Rice%29.jpg","page_title":"Modak","context_page_description":"Le modak est une douceur d'origine indienne populaire dans de nombreuses régions de l'Inde en particulier au Maharashtra. La garniture sucrée à l'intérieur d'un modak se compose de noix de coco fraîchement râpée et de jagré. L'extérieur de consistance molle est faite de farine de riz ou de farine de blé.\\nLe modak est également fabriqué et consommé au Japon."},{"page_url":"https://es.wikipedia.org/wiki/Aurelia_V%C3%A9lez_S%C3%A1rsfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Aurelia_velez.jpg","page_title":"Aurelia Vélez Sársfield","context_page_description":"Aurelia Vélez Sarsfield fue una escritora, hija del legislador Dalmacio Vélez Sársfield y de Manuela Velázquez Piñero. Era la segunda hija del legislador. Desde sus primeros años recibió una formidable educación, que junto con las enseñanzas de su padre, servirían para que este decidiese asociarla a sus trabajos en calidad de secretaria —que posteriormente serviría para la redacción del Código Civil de Argentina en 1869. A la edad de diecisiete años, en 1857, se casó con su primo hermano, el doctor Pedro Ortiz Vélez, hijo del secretario de Facundo Quiroga.​ Por causas desconocidas, su matrimonio duró sólo unos pocos meses; sin embargo, una de las causas relacionadas con la separación es que Pedro Ortiz mató al secretario de Aurelia luego de que los viese abrazados.​​ Tras la ruptura, Aurelia regresó a la casa de sus padres.\\nLa desunión de Domingo Faustino Sarmiento y su esposa Benita Martínez Pastoriza se concretó cuando esta sorprendió la correspondencia que su esposo mantenía con Aurelia:​\\nHe debido meditar mucho antes de responder a su sentida carta de usted, como he necesitado tenerme el corazón a dos manos para no ceder a mis impulsos."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%B8%EB%82%98%EB%AF%B8_%EB%A5%98%EC%8A%A4%EC%BC%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/LM-Ryusuke-Minami.jpg","page_title":"미나미 류스케","context_page_description":"미나미 류스케는 일본의 프로 야구 선수이자, 퍼시픽 리그 전 지바 롯데 마린스의 선수이다."},{"page_url":"https://it.wikipedia.org/wiki/Ammonoidea","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Didymoceras_stevensoni.jpg","page_title":"Ammonoidea","context_page_description":"Le ammoniti sono un gruppo di Molluschi cefalopodi estinti, comparsi nel Devoniano Inferiore ed estintisi intorno al limite Cretaceo Superiore-Paleocene senza lasciare discendenti noti.\\nSi tratta di animali di ambiente marino, caratterizzati da una conchiglia esterna composta prevalentemente di carbonato di calcio, sotto forma di aragonite, e in parte di una sostanza organica di natura proteica. La conchiglia era suddivisa internamente da setti in diverse camere, di cui il mollusco occupava solo l'ultima. Le altre, che componevano il fragmocono, erano utilizzate come \\"camere d'aria\\", riempite di gas e liquido camerale per controllare il galleggiamento dell'organismo. La pressione dei fluidi camerali era controllata da una sottile struttura organica tubolare riccamente vascolarizzata, in parte mineralizzata, che attraversava tutti i setti e permetteva lo scambio di fluidi dal sangue e dai tessuti molli dell'animale alle camere tramite un processo di osmosi. L'ammonite poteva così variare la propria profondità in maniera simile ai nautiloidi tuttora viventi."},{"page_url":"https://en.wikipedia.org/wiki/Shutter_priority","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Shutter_priority_mode.svg","page_title":"Shutter priority","context_page_description":"Shutter priority, also called time value, refers to a setting on some cameras that allows the user to choose a specific shutter speed while the camera adjusts the aperture to ensure correct exposure. This is different from manual mode, where the user must decide both values, aperture priority where the user picks an aperture with the camera selecting the shutter speed to match, or program mode where the camera selects both."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B0%D0%BF%D0%B8%D0%BB%D0%BB%D0%B8","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/67/PuuPuaiLapilli_large.jpg","page_title":"Лапилли","context_page_description":"Лапи́лли — многоформенные вулканические выбросы размером от 2 до 64 мм."},{"page_url":"https://de.wikipedia.org/wiki/Backsteinbauwerke_der_Gotik/Verteilung_in_Mittelj%C3%BCtland","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/Location_dot_sky_blue.png","page_title":"Backsteinbauwerke der Gotik/Verteilung in Mitteljütland","context_page_description":"Dies ist eine der sechs Verteilungskarten zur Liste der Backsteinbauwerke der Gotik in Dänemark:\\nBacksteinbauwerke der Gotik/Verteilung in Dänemark\\nBacksteinbauwerke der Gotik/Verteilung in Nordjütland\\nBacksteinbauwerke der Gotik/Verteilung in Mitteljütland\\nBacksteinbauwerke der Gotik/Verteilung in der Region Süddänemark\\nBacksteinbauwerke der Gotik/Verteilung auf der Insel Seeland\\nBacksteinbauwerke der Gotik/Verteilung in der Region Seeland\\nDie Regionseinteilung Dänemarks erfolgte 2007 nach technokratischen Gesichtspunkten, die Regionsgrenzen bilden keine historischen Grenzen ab. Darum wurden hier bei Nord- und Mitteljütland jeweils die angrenzenden Gemeinden der südlichen Nachbarregion mit dargestellt.\\nIn Dänemark machen Kirchen den weitaus größten Teil der Bauwerken aus, die in gotischem Stil aus Backstein errichtet oder modernisiert wurden. Die meisten Kirchen in diesem Land haben einen romanischen Kern, nicht nur Grundmauern, sondern auch aufragendes Mauerwerk. Oft besteht dieses nicht aus einfachem Feldstein, sondern aus sorgfältig bearbeiteten Steinquadern. In Nord- und Mitteljütland sind das großenteils Granitquader, in Südwestjütland nicht selten rheinischer Eifeltuff."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Zirkel_von_Studentenverbindungen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Zirkel_Silesia_Breslau.jpg","page_title":"Liste der Zirkel von Studentenverbindungen","context_page_description":"Die Liste der Zirkel von Studentenverbindungen dient der Übersicht aller unterschiedlichen Zirkel."},{"page_url":"https://eu.wikipedia.org/wiki/Ivana_Trump","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Ivana_Trump.jpg","page_title":"Ivana Trump","context_page_description":"Ivana Marie Trump, jaiotza-izenaz Ivana Marie Zelníčková, txeko-estatubatuar modelo ohi, enpresaburu eta idazlea da. 1977tik 1992ra Donald Trumpekin ezkonduta egon zen."},{"page_url":"https://et.wikipedia.org/wiki/FC_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Dembele170727-2_%28cropped%29.jpg","page_title":"FC Barcelona","context_page_description":"Futbol Club Barcelona, tihti ka Barcelona või Barça, lühendatult FCB, on elukutseliste jalgpalliklubi Barcelonas Kataloonias.\\nKlubi asutas 1899. aastal grupp šveitsi, inglise ja katalaani jalgpallureid, seda juhtis šveitslane Joan Gamper. Klubi on saanud Kataloonia kultuuri ja katalanismi sümboliks, seepärast ka klubi moto \\"Més que un club\\". Erinevalt paljudest teistest klubidest on FC Barcelona omanikeks fännid ja toetajad. Klubi ametlik hümn on Jaume Picase ja Josep Maria Espinàse kirjutatud \\"Cant del Barça\\".\\n2016. aasta seisuga oli klubi väärtuselt maailmas teine sporditiim ja selle väärtuseks hinnati 3,56 miljardit dollarit. Hooajal 2014/15 oli Barcelona 560,8-miljonilise aastase käivega müügitulu poolest samuti Madridi Reali järel maailmas teisel kohal. 2018. aastal oli klubi käive 990 miljonit eurot ja 2019. aastal prognoositakse selleks 1,047 miljardit eurot, millega sellest saab esimene spordiklubi, kelle aastane käive ületab miljardi euro piiri.\\nBarcelona on võitnud 26 korda La Liga ning võitnud 30 Hispaania karikat, 13 Hispaania superkarikat, 3 Eva Duarte karikat ja 2 Hispaania liigakarikat."},{"page_url":"https://en.wikipedia.org/wiki/Seleucia_Pieria","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Roman_Sarcophagus%2C_Seleucia_Pieria.jpg","page_title":"Seleucia Pieria","context_page_description":"Seleucia in Pieria, also known in English as Seleucia by the Sea, and later named Suedia, was a Hellenistic town, the seaport of Antioch ad Orontes, the Seleucid capital, modern Antakya. The city was built slightly to the north of the estuary of the river Orontes, between small rivers on the western slopes of the Coryphaeus, one of the southern summits of the Amanus Mountains.\\nAccording to Pausanias and Malalas, there was a previous city here named Palaeopolis. At present, it is located at the seaside village of Çevlik\\nnear the town of Samandağ in the Hatay Province of Turkey. Seleucia, Apamea, Laodicea, and Antioch formed the Syrian tetrapolis."},{"page_url":"https://lt.wikipedia.org/wiki/Pagausantys_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Jurbarko_rajono_zemelapis.png","page_title":"Pagausantys I","context_page_description":"Pagausantys I – kaimas Jurbarko rajone, Juodaičių seniūnijoje, 3 km į pietus nuo Juodaičių. Per kaimą teka Gausantė."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_im_K%C3%B6lner_Stadtteil_Riehl","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/K%C3%B6ln_Sprengelstra%C3%9Fe_2.jpg","page_title":"Liste der Baudenkmäler im Kölner Stadtteil Riehl","context_page_description":"Die folgende Liste enthält die in der Denkmalliste ausgewiesenen Baudenkmäler auf dem Gebiet des Stadtteils Köln-Riehl, Stadtbezirk Köln-Nippes, Nordrhein-Westfalen.\\nHinweis: Die Reihenfolge der Baudenkmäler in dieser Liste orientiert sich an den Straßennamen und ist alternativ nach Hausnummern, Denkmallistennummer oder Bezeichnung sortierbar.\\nBasis ist die offizielle Kölner Denkmalliste, die Baudenkmäler und Denkmalbereiche auflistet. Dabei kann es sich beispielsweise um Sakralbauten, Wohn- und Fachwerkhäuser, historische Gutshöfe und Adelsbauten, Industrieanlagen, Wegekreuze und andere Kleindenkmäler sowie Grabmale und Grabstätten, die eine besondere Bedeutung für die Geschichte Kölns haben, handeln. Grundlage für die Aufnahme in die offiziellen Denkmallisten ist das Denkmalschutzgesetz Nordrhein Westfalens."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%8A%D8%B1%D9%8A%D9%86%D9%8A%D9%88_%DA%86%D8%A7%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Autoritratto_Ireneo_Janni.jpg","page_title":"ايرينيو چانى","context_page_description":"ايرينيو چانى مهندس من ايطاليا."},{"page_url":"https://en.wikipedia.org/wiki/Agust%C3%ADn_Fern%C3%A1ndez_(director)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/AGUSTIN_Y_MARTIN_SHEEN_on_the_set_of_BADGE_OF_HONOR.jpg","page_title":"Agustín Fernández (director)","context_page_description":"Agustín Fernández Santana III, known professionally simply as Agustín, La Habana, Cuba, March, 1976), is an American film and television writer, director and producer.\\nAgustin's is known for El Vacilon: the movie, Gabriel, amor Inmortal, and Falling Awake. He is also the founder of Duende Films and Duende Media, both located in Universal City, California."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B2%D0%B8_(%D0%9A%D1%83%D1%8F%D0%B2%D1%81%D1%8C%D0%BA%D0%BE-%D0%9F%D0%BE%D0%BC%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D0%B5_%D0%B2%D0%BE%D1%94%D0%B2%D0%BE%D0%B4%D1%81%D1%82%D0%B2%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/%C5%81awy_gm._Rypin.JPG","page_title":"Лави (Куявсько-Поморське воєводство)","context_page_description":"Лави — село в Польщі, у гміні Рипін Рипінського повіту Куявсько-Поморського воєводства.\\nНаселення — 136 осіб.\\nУ 1975-1998 роках село належало до Влоцлавського воєводства."},{"page_url":"https://en.wikipedia.org/wiki/Arrondissement_of_Briey","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Locator_map_of_Arrondissement_Briey_2019.png","page_title":"Arrondissement of Briey","context_page_description":"The arrondissement of Briey is an arrondissement of France in the Meurthe-et-Moselle department in the Grand Est region. It has 128 communes. Its population is 166,309, and its area is 1,142.7 km²."},{"page_url":"https://de.wikipedia.org/wiki/Bahnhof_Hohenstein-Ernstthal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Bahnhof_Hohenstein-Ernstthal_abriss_2007.JPG","page_title":"Bahnhof Hohenstein-Ernstthal","context_page_description":"Der Bahnhof Hohenstein-Ernstthal ist der Bahnhof der Stadt Hohenstein-Ernstthal in Südwestsachsen. Der Bahnhof gehört der Bahnhofskategorie 5 der DB Station&Service an und besitzt drei Gleise. Er wird täglich von etwa 85 Zügen bedient und liegt an der Bahnstrecke Dresden–Werdau. Der Bahnhof wird ausschließlich von Regional- und Nahverkehrszügen angefahren."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B9%BE%E5%9D%A4%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/%E5%B0%BE%E5%BC%B5%E5%90%8D%E6%89%80%E5%9B%B3%E4%BC%9A._%E5%89%8D%E7%B7%A8_%E5%B7%BB%EF%BC%96_%E7%9F%A5%E5%A4%9A%E9%83%A1_%E4%B9%BE%E5%9D%A4%E9%99%A2.jpg","page_title":"乾坤院","context_page_description":"乾坤院は、愛知県知多郡東浦町にある曹洞宗の寺院。寺格は中本山別格地。山号は宇宙山。"},{"page_url":"https://gl.wikipedia.org/wiki/Susana","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Meister_von_Moulins_007.jpg","page_title":"Susana","context_page_description":"Susana é un nome propio feminino de orixe exipcia na súa variante en galego."},{"page_url":"https://nl.wikipedia.org/wiki/Georges_Gaudy","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Georges_Gaudy_-_Mors.jpg","page_title":"Georges Gaudy","context_page_description":"Georges Gaudy was een Belgisch graficus en kunstschilder."},{"page_url":"https://en.wikipedia.org/wiki/Inverie","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d4/Inverie_from_PS_Waverley.jpg","page_title":"Inverie","context_page_description":"Inverie is the main village on the peninsula of Knoydart in the Scottish Highlands and is concentrated on the north side of Loch Nevis. Although on the mainland of Britain, the few miles of single-track road are not connected to the rest of the national road network. Inverie is only reachable, aside from a 17-mile hike over very rough terrain, by a regular 7 mi ferry from Mallaig, giving the place a Guinness National Record for remoteness."},{"page_url":"https://en.wikipedia.org/wiki/Papal_Basilica_of_Saint_Mary_of_the_Angels_in_Assisi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Portiuncula_on_the_Feast_of_the_Pardon.jpg","page_title":"Papal Basilica of Saint Mary of the Angels in Assisi","context_page_description":"The Basilica of Saint Mary of the Angels is a Papal minor basilica situated in the plain at the foot of the hill of Assisi, Italy, in the frazione of Santa Maria degli Angeli.\\nThe basilica was constructed in the Mannerist style between 1569 and 1679, enclosing the 9th century little church, the Porziuncola, the most sacred place for the Franciscans. It was here that the young Francis of Assisi understood his vocation and renounced the world in order to live in poverty among the poor, and thus started the Franciscan movement."},{"page_url":"https://en.wikipedia.org/wiki/Orange_Tree_Theatre","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Orange_Tree_Theatre%2C_Kew_Road%2C_Richmond._-_geograph.org.uk_-_46374.jpg","page_title":"Orange Tree Theatre","context_page_description":"The Orange Tree Theatre is a 180-seat theatre at 1 Clarence Street, Richmond in south-west London, which was built specifically as a theatre in the round. It is housed within a disused 1867 primary school, built in Victorian Gothic style.\\nThe theatre was founded in 1971 by its previous artistic director, Sam Walters, and his actress wife Auriol Smith in a small room above the Orange Tree pub opposite the present building, which opened in 1991.\\nPaul Miller, previously associate director at the Crucible Theatre in Sheffield, is the artistic director. He succeeded Walters, the UK's longest-serving theatre director, who retired from the Orange Tree Theatre in June 2014.\\nThe Orange Tree Theatre specialises in staging new plays and rediscovering classics. It has an education and participation programme that reaches over 10,000 people every year.\\nSince 2014 the theatre has won ten Offies, five UK Theatre Awards and the Alfred Fagon Audience Award. It won the Empty Space Peter Brook Award in 2006 and 2015."},{"page_url":"https://en.wikipedia.org/wiki/Besturn_B70","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Besturn_B70_II_China_2016-04-07.jpg","page_title":"Besturn B70","context_page_description":"The Besturn B70 is a mid-size sedan or Large family car produced by the Chinese car manufacturer Besturn FAW Group. The engine of this car was made by Mazda."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Utrecht_(stad)/Binnenstad","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Predikherenstraat.5.Utrecht.jpg","page_title":"Lijst van rijksmonumenten in Utrecht (stad)/Binnenstad","context_page_description":"De stad Utrecht telt in totaal 1402 inschrijvingen in het rijksmonumentenregister, de Binnenstad bevat hiervan het grootste aantal.\\nDe straten met de meeste rijksmonumenten hebben een aparte lijst, deze zijn:\\nLijst van rijksmonumenten in Utrecht (stad)/Achter de Dom\\nLijst van rijksmonumenten in Utrecht (stad)/Achter Sint Pieter\\nLijst van rijksmonumenten in Utrecht (stad)/Boothstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Breedstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Brigittenstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Choorstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Domplein\\nLijst van rijksmonumenten in Utrecht (stad)/Drift\\nLijst van rijksmonumenten in Utrecht (stad)/Hamburgerstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Herenstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Janskerkhof\\nLijst van rijksmonumenten in Utrecht (stad)/Kromme Nieuwegracht\\nLijst van rijksmonumenten in Utrecht (stad)/Lange Nieuwstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Lijnmarkt\\nLijst van rijksmonumenten in Utrecht (stad)/Mariaplaats\\nLijst van rijksmonumenten in Utrecht (stad)/Minrebroederstraat\\nLijst van rijksmonumenten in Utrecht (stad)/Nieuwegracht"},{"page_url":"https://fr.wikipedia.org/wiki/Erika_Lechner","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Erika_Lechner.jpg","page_title":"Erika Lechner","context_page_description":"Erika Lechner est une ancienne lugeuse italienne."},{"page_url":"https://sl.wikipedia.org/wiki/Voja%C5%A1nica_Edvarda_Peperka","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Voja%C5%A1nica_Franca_Rozmana_-_Staneta.jpg","page_title":"Vojašnica Edvarda Peperka","context_page_description":"Vojašnica Edvarda Peperka je bila vojašnica JLA, od osamosvojitve Slovenije pa vojašnica Slovenske vojske; zgrajena je bila leta 1975. Nahaja se na Leskoškovi 7 v Ljubljani.\\nLeta 2012 jo je Vlada Janeza Janše preimenovala po Edvardu Peperku, eni prvih žrtev vojne za Slovenijo."},{"page_url":"https://es.wikipedia.org/wiki/RMS_Titanic","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Captain_Archibald_Willingham_Butt%2C_half-length_portrait%2C_standing%2C_facing_slightly_left%2C_in_uniform_LCCN96503572.jpg","page_title":"RMS Titanic","context_page_description":"El RMS Titanic​ fue un transatlántico británico, el mayor barco de pasajeros del mundo al finalizar su construcción, que se hundió en la noche del 14 a la madrugada del 15 de abril de 1912 durante su viaje inaugural desde Southampton a Nueva York. En el hundimiento del Titanic murieron 1496 personas de las 2208 que iban a bordo, lo que convierte a esta tragedia en uno de los mayores naufragios de la historia ocurridos en tiempo de paz. Construido entre 1909 y 1912 en los astilleros de Harland & Wolff en Belfast, el Titanic era el segundo de los tres buques que formaban la clase Olympic, propiedad de la naviera White Star Line, junto al RMS Olympic y, posteriormente, el HMHS Britannic.\\nEntre sus pasajeros estaban algunas de las personas más ricas del mundo, además de cientos de inmigrantes irlandeses, británicos y escandinavos que iban en busca de una mejor vida en Norteamérica. El barco fue diseñado para ser lo último en lujo y comodidad, y contaba con gimnasio, piscina, biblioteca, restaurantes de lujo y opulentos camarotes para los viajeros de primera clase."},{"page_url":"https://fr.wikipedia.org/wiki/Tabasco_(%C3%89tat)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Para%C3%ADso.Artesan%C3%ADas_2.jpg","page_title":"Tabasco (État)","context_page_description":"L'État de Tabasco est un État situé dans le sud-est du Mexique, sur le golfe du Mexique. Entouré par les États de Veracruz, de Chiapas et de Campeche, ainsi que par le Guatemala, il est peuplé de 2,238 millions d'habitants, et a une superficie de 25 267 km². L'État est divisé en 17 municipalités, sa capitale est Villahermosa."},{"page_url":"https://de.wikipedia.org/wiki/Cambodunum","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Notitia_Dignitatum_-_Dux_Raetiae.jpg","page_title":"Cambodunum","context_page_description":"Cambodunum war der Name der kaiserzeitlichen römischen Stadt auf dem Gebiet der heutigen Stadt Kempten im Allgäu. In der frühen und hohen Kaiserzeit war Cambodunum eine der bedeutendsten Römerstädte der Provinz Raetia und wahrscheinlich vor Augsburg erste Hauptstadt der Provinz. Kempten kann wegen der frühesten schriftlichen Erwähnung einer Stadt in Deutschland neben Trier und Köln zu den ältesten Städten Deutschlands gerechnet werden. Die ausgegrabenen und restaurierten Überreste der römischen Stadt werden vor Ort als Archäologischer Park Cambodunum präsentiert. Funde aus dem Stadtgebiet wurden teilweise auch im Römischen Museum Kempten im Zumsteinhaus ausgestellt, nach der Schließung im Jahr 2015 wurden diese jedoch in die Depots der Stadtarchäologie Kempten verlegt. Die spätrömische Kastellsiedlung im Flusstal westlich der kaiserzeitlichen Stadt trug den Namen Cambidanum."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%99%E3%83%AB%E3%83%8A%E3%83%8B%E3%83%9E%E3%83%AB%E3%82%AD%E3%83%A5%E3%83%A9","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Vernanimalcula_sketch.jpg","page_title":"ベルナニマルキュラ","context_page_description":"ベルナニマルキュラ は6億-5億8000万年前の地層から発見されたアクリタークの一つ。大きさは0.1-0.2 mmで、髪の毛の太さ程度である。学名 Vernanimalcula は”小さな春の動物”を意味する。これは、この化石がマリノア氷期の終わりの層から発見されたこと、また、発見当初は動物だと考えられていたことによる。\\n本種の化石は中国の陡山沱累層から発見された。この層は、軟組織や微細構造を残した化石が発掘される、数少ないラーガーシュテッテである。この化石は感覚器官とされる1対の孔・消化器・口・肛門を備えた、体腔を持つ三胚葉構造を持つと解釈され、最初期の左右相称動物であると考えられた。\\n本種が真の左右相称動物だと解釈されていた頃は、これほど古い層から左右相称動物の化石が見つかることは重要な意味を持つと考えられていた。動物の様々な門への分化が顕微鏡的な大きさの内に起こったのだとすれば、カンブリア爆発での多くの動物門の突然の出現は、すでに存在する動物が、単に突然の体サイズの増大と、容易に化石化する構造を手に入れたことに帰着できるからである。\\n現在では、本種を左右相称動物であるとする解釈は非常に疑わしいものとなっている。別の研究者は、この化石はアクリタークのような球状物の周囲にリン酸塩の結晶が成長したもので、化石生成過程におけるアーティファクトであり、よって動物ですらないと繰り返し主張している。これに対しChen et al. は、自身の解釈を弁護している。Petryshyn et al. は本種に似た化石を調査し、”おそらく生物由来のもの”と結論している。"},{"page_url":"https://pl.wikipedia.org/wiki/Hans_Egede","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Hans_Nielsen_Egede.jpg","page_title":"Hans Egede","context_page_description":"Hans Nielsen Egede – norweski misjonarz luterański, nazywany Apostołem Grenlandii. Pochodził z jednej z wysp położonego na północy Norwegii archipelagu Lofotów. Usłyszał tam opowieści o zielonym lądzie, na którym osiedlali się wikingowie, z którymi kontakt został utracony wiele lat przedtem. W maju 1721 poprosił króla duńskiego Fryderyka IV o pozwolenie na założenie kolonii i misji, zakładając, że zamieszkujący Grenlandię oddalili się od chrześcijańskiej religii. Fryderyk udzielił tego zezwolenia.\\nEgede wylądował na zachodnim wybrzeżu Grenlandii 3 lipca. Poszukiwał wioski wikingów, ale nie odnalazł żadnych potomków skandynawskich osadników. Zamiast tego spotkał Inuitów, pośród których rozpoczął działalność misyjną. Studiował język mieszkańców Grenlandii, na który przełożył chrześcijańskie teksty. Wymagało to pewnych zmian – spowodowanych np. przez to, że Inuici nie mieli chleba ani żadnego o nim wyobrażenia. Z tego powodu w tekście modlitwy Ojcze nasz, fragment chleba naszego powszedniego... przełożył na daj nam naszą codzienną fokę...\\nEgede założył osadę Godthåb, która w późniejszym czasie stała się stolicą Grenlandii. W 1724 ochrzcił pierwsze tamtejsze dziecko."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8D%D5%A1%D5%B6_%D4%B1%D5%A3%D5%B8%D6%82%D5%BD%D5%BF%D5%AB%D5%B6_%D5%A4%D5%A5_%D4%BC%D5%B5%D5%B8%D6%82%D5%BD%D5%A1%D5%B6%D5%A5%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Sant_Agust%C3%AD_de_Llu%C3%A7an%C3%A8s.jpg","page_title":"Սան Ագուստին դե Լյուսանես","context_page_description":"Սանտ Ագուստի դե Լյուսանես կամ Սան Ագուստին դե Լյուսանես, քաղաք և մունիցիպալիտետ Իսպանիայում։ Մտնում է Բարսելոնա պրոնվիցիայի մեջ՝ Կատալոնիա ինքնավար համայնքում։ Մունիցիպալիտետը գտնվում է Օսոնա շրջանում։ Զբաղեցնում է 13,38 կմ² տարածք։ Բնակչության թվաքանակը 2004 թվականի տվյալներով եղել է 103, խտությունը՝ 7,70 մարդ/կմ²։"},{"page_url":"https://de.wikipedia.org/wiki/Louis_I._de_Bourbon,_comte_de_Vend%C3%B4me","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Louis_Blanche2.jpg","page_title":"Louis I. de Bourbon, comte de Vendôme","context_page_description":"Louis de Bourbon war von 1403 bis zu seinem Tod Graf von Vendôme. Er war der zweite Sohn Jeans de Bourbon, Graf von La Marche, und dessen Ehefrau Catherine, Gräfin von Vendôme und Castres.\\nLouis regierte seit dem Tod seines Vaters gemeinsam mit seiner Mutter in der Grafschaft Vendôme, während sein älterer Bruder Jacques in La Marche und Castres die Nachfolge antrat. Seit 1403 regierte er selbständig, nachdem er dem Herzog Ludwig II. von Anjou gehuldigt hatte. Seit 1406 war er in Besitz der Baronie von Mondoubleau im Maine, die er Charles de la Rivière abgekauft hatte."},{"page_url":"https://ast.wikipedia.org/wiki/Campeonatu_del_Mundu_de_Baloncestu_de_la_FIBA_2010","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/Kadir_Has_Kongre_ve_Spor_Merkezi_Kayseri.jpg","page_title":"Campeonatu del Mundu de Baloncestu de la FIBA 2010","context_page_description":"El Campeonatu del Mundu de Baloncestu de la FIBA 2010 tien llugar en Turquía ente'l 28 d'agostu y el 12 de setiembre de 2010. La competición ye organizada n'andecha ente la FIBA, la Federación Turca de Baloncestu y el Comité Organizador 2010. El campeonatu ye tan importante como'l Tornéu Olímpicu de Baloncestu.\\nNel campeonatu participen por tercer vegada, 24 seleiciones nacionales. Poro, la fase grupos ta siendo xugada en cuatru ciudaes distintes, y les eliminatories n'Estambul.\\nEl sortéu del calendariu fízose'l 15 d'avientu de 2009 n'Estambul. N'él, les seleiciones dividiéronse en cuatro grupos pa la fase grupos, con seis seleiciones en caún. Dempués, los cuatro meyores equipos de cada grupu van empareyase nuna fase d'eliminatories."},{"page_url":"https://sk.wikipedia.org/wiki/Allianz","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Allianz_rgb_72.jpg","page_title":"Allianz","context_page_description":"Allianz SE je globálna spoločnosť poskytujúca finančné služby, so sídlom v Mníchove v Nemecku. Jej hlavným zameraním je poistenie. Od roku 2010 je 12. najväčšou skupinou poskytujúcou finančné služby na svete a 23. najväčšou spoločnosťou, podľa zložitého kritéria časopisu Forbes.\\nAllianz predala v novembri 2008 Dresdner Bank banke Commerzbank. Ako výsledok tohto spojenia, Allianz získal 14% podiel v novej Commerzbank Group."},{"page_url":"https://es.wikipedia.org/wiki/Talagante","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Iglesia_Talagante_Chile.jpg","page_title":"Talagante","context_page_description":"Talagante es una ciudad y comuna chilena, capital de la provincia homónima de la Región Metropolitana de Santiago.\\nIntegra, junto con las comunas de Alhué, Curacaví, Isla de Maipo, María Pinto, Melipilla, El Monte, Padre Hurtado, Peñaflor y San Pedro, el Distrito Electoral N° 31 y pertenece a la Circunscripción Senatorial 7ª de la XIII región Metropolitana. Su actual alcalde es Carlos Álvarez."},{"page_url":"https://en.wikipedia.org/wiki/Mount_(heraldry)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Vaclav3_pecetzadnistr.jpg","page_title":"Mount (heraldry)","context_page_description":"In heraldry, a mount is a representation of a hill or mountain as a curved terrace in base. When the mount is included in the lower part of the shield, it may be considered an ordinary rather than a charge.\\nA trimount, also described as a mount mounted, or shapournet shapourned, is a representation of a mount with three tops. For mounts with more than three tops, the number of tops is blazoned as coupeaux.\\nThe trimount can be found in all heraldic traditions, but it is especially common in Switzerland.\\nA design of six hills can also be found in Swiss and Italian heraldry. In medieval German heraldry, mounts could have ten or more tops. Mounts with more than three tops are blazoned as a mount of N coupeaux, e.g. German Sechsberg would be a mount of six coupeaux, German Zehnberg as a mount of ten coupeaux. A mount with more than six tops can also be blazoned as Schroffen in German heraldry."},{"page_url":"https://sv.wikipedia.org/wiki/Nycerella","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Nycerella_aprica_cropped.jpg","page_title":"Nycerella","context_page_description":"Nycerella är ett släkte av spindlar. Nycerella ingår i familjen hoppspindlar.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://de.wikipedia.org/wiki/Glash%C3%BCtte_(Lamspringe)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Glash%C3%BCtte_bei_Lamspringe_Strassenansicht.jpg","page_title":"Glashütte (Lamspringe)","context_page_description":"Glashütte ist ein Ortsteil der Gemeinde Lamspringe im niedersächsischen Landkreis Hildesheim."},{"page_url":"https://no.wikipedia.org/wiki/STS-30","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/ISD_highres_STS030_STS030-76-31.jpg","page_title":"STS-30","context_page_description":"STS-30 var en romferd, arrangert av NASA, med romfergen Atlantis. Atlantis ble skutt opp den 4. mai 1989 og landet 8. mai samme år. STS-30 var den 29. romferden til NASA og Atlantis fjerde."},{"page_url":"https://hu.wikipedia.org/wiki/Boyoma-v%C3%ADzes%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Africa_relief_location_map.jpg","page_title":"Boyoma-vízesés","context_page_description":"A Boyoma-vízesés a Kongói Demokratikus Köztársaság Tshopo tartományában, a Lualaba-folyó 10 km-es szakaszán fekvő hét vízesés, zúgó. A vízesés korábbi nevét Henry Morton Stanley újságíróról, Afrika-kutatóról kapta, aki a Kongó útját a forrásától a torkolatáig végigkövette. Az egymás után következő egyes vízesések magassága nem haladja meg a 4,5 m-t. A Lualaba-folyónak ez az ívet leíró szakasza Ubundu és Kisangani városok közé esik. A vízesés aljától, Kisangani városától a folyót Kongó-folyónak nevezik. A Lualaba-folyó ezen a szakaszon átlagosan 1300 m szélességű, teljes esése kb. 60 m. A vízesés átlagos vízhozama 17 000 m³/s. Legnagyobb mért vízhozama eddig 52 000 m³/s volt. A vízesést a két várost összekötő áthidaló vasútvonal kerüli meg."},{"page_url":"https://fr.wikipedia.org/wiki/Iris_laevigata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Kakitsubata1.jpg","page_title":"Iris laevigata","context_page_description":"L'Iris d'eau japonais est une plante herbacée vivace de la famille des Iridacées originaire de Sibérie.\\nNom en Russe : Ирис гладкий"},{"page_url":"https://de.wikipedia.org/wiki/Luftstreitkr%C3%A4fte_(Deutsches_Kaiserreich)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Albatros_D.V_Jasta_79b_Seite_li._klein72.jpg","page_title":"Luftstreitkräfte (Deutsches Kaiserreich)","context_page_description":"Die Luftstreitkräfte des Deutschen Kaiserreichs während des Ersten Weltkrieges bestanden aus Verbänden des Kontingentsheeres; Seeflieger und Marineluftschiffe unterstanden dagegen der Kaiserlichen Marine.\\nDie Luftstreitkräfte bestanden bis 1918 aus:\\nder Fliegertruppe\\nder Luftschiffertruppe\\ndem Wetterdienst\\nder Flugabwehrartillerie\\ndem militärischen Luftschutz\\nZu ihnen zählten die entsprechenden Einheiten des Heeres unter dem Inspekteur der Flieger und der Luftschiffer, später zusammengefasst unter dem Kommandierenden General der Luftstreitkräfte. Die Einheiten der Marine unterstanden dagegen dem Reichsmarineamt.\\nIm Ersten Weltkrieg kämpften ihre Flieger und Luftschiffer an allen Fronten, in den Kolonien und, gestützt auf Kriegsschiffe, auf hoher See.\\nSie führten Luftkrieg; die Aufklärung von Bodenzielen aus der Luft beeinflusste die Kriegsführung stark.\\nMit der militärischen Niederlage Ende 1918 und der Auflösung des deutschen Kaiserreichs wurden alle Flieger- und Luftschiffertruppen in Heer und Marine demobilisiert. Bis 1919 dienten einzelne Flieger und Einheiten noch in den Freikorps sowie im Baltikum und im Grenzschutz."},{"page_url":"https://vi.wikipedia.org/wiki/Ga_Mutsumi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Tobu-railway-TD29-Mutsumi-station-platform-20130523-145106.jpg","page_title":"Ga Mutsumi","context_page_description":"Ga Mutsumi là ga đường sắt nằm ở Matsudo, Chiba, Nhật Bản, được quản lý bởi Tobu Railway."},{"page_url":"https://pt.wikipedia.org/wiki/San_Carlo_alle_Quattro_Fontane","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/San_Carlo_alle_Quattro_Fontane_%28Rome%29_-_Dome.jpg","page_title":"San Carlo alle Quattro Fontane","context_page_description":"San Carlo alle Quattro Fontane ou Igreja de São Carlos nas Quatro Fontes, chamada também de San Carlino por causa de seu tamanho diminuto, é uma igreja de Roma, Itália, a primeira encomenda independente de Francesco Borromini na cidade. É uma obra-prima da arquitetura barroca, construída como parte de um complexo de edifícios monásticos no Monte Quirinal habitado por trinitários espanhóis, uma ordem dedicada à libertação de escravos cristãos. Ele recebeu a encomenda em 1634 do cardeal Francesco Barberini, cujo palácio ficava do outro lado da rua. Porém, o dinheiro acabou e o projeto sofreu muitas dificuldades financeiras. É uma entre pelo menos três igrejas em Roma dedicadas a São Carlos, incluindo San Carlo ai Catinari e San Carlo al Corso."},{"page_url":"https://it.wikipedia.org/wiki/Fl%C3%B6rsheim_am_Main","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/29/Floersheim-Mainstein1.jpg","page_title":"Flörsheim am Main","context_page_description":"Flörsheim am Main è un comune tedesco di 19.950 abitanti, situato nel land dell'Assia."},{"page_url":"https://ca.wikipedia.org/wiki/Calor_de_reacci%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Reac_exo.png","page_title":"Calor de reacció","context_page_description":"En termoquímica, la calor de reacció o entalpia de reacció és la quantitat d'energia en forma de calor absorbida o cedida per una reacció química.\\nUna reacció química consisteix en el trencament dels enllaços en les molècules dels reactius i la formació d'enllaços nous en les molècules dels productes. Les molècules dels reactius contenen energia en forma d'energia d'enllaç entre els seus àtoms o energia de vibració. Les molècules dels productes contenen també energia. En produir-se la reacció i convertir-se els reactius en productes, la diferència d'energia entre uns i altres s'intercanvia amb el medi. Aquest intercanvi es produeix habitualment en forma de calor, encara que pot fer-se també d'altres maneres.\\nNormalment les reaccions químiques es realitzen a pressió constant, i s'acostuma a considerar que la temperatura es manté també constant. Per això, la calor de reacció s'anomena també entalpia de reacció i es representa per ∆H.\\nLa calor de reacció fa referència habitualment a 1 mol de la substància més rellevant o que es pot considerar objectiu de la reacció, i és un valor característic de la reacció per a una pressió i temperatura determinades."},{"page_url":"https://fr.wikipedia.org/wiki/Repr%C3%A9sentation_figur%C3%A9e_dans_les_arts_de_l%27Islam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Caligrafia_arabe_pajaro.jpg","page_title":"Représentation figurée dans les arts de l'Islam","context_page_description":"La représentation figurée dans les arts de l'Islam, c'est-à-dire, la production d'images figuratives d'êtres vivants, et en particulier des prophètes, dont Mahomet, fait l'objet de débats complexes dans la civilisation islamique, à l'intersection de facteurs artistiques, religieux, sociaux, politiques et philosophiques.\\nProduits dans le monde islamique entre l'hégire et le XIXᵉ siècle, les arts de l'Islam sont le résultat d'une culture influencée par la religion musulmane. Or, en tant que religion du Livre, l'islam s'inscrit dans la continuité de la tradition judaïque de l'aniconisme. Pourtant, si les représentations animales et humaines sont, à quelques exceptions près, toujours absentes des espaces et objets religieux musulmans, on en trouve un grand nombre dans les objets produits dans le monde islamique. Qu'il s'agisse d'œuvres profanes ou relevant d'une autre religion que l'islam, ces représentations figurées existent depuis les origines de la civilisation islamique. Elles sont d'une grande variété : animaux, personnages de cour, scènes de genre, personnages religieux comme Mahomet, etc. Dieu, par contre, n'est jamais représenté sous une forme figurée."},{"page_url":"https://ml.wikipedia.org/wiki/%E0%B4%85%E0%B4%B8%E0%B4%BE%E0%B4%AE%E0%B4%BE_%E0%B4%AA%E0%B5%BC%E0%B4%B5%E0%B5%8D%E0%B4%B5%E0%B4%A4%E0%B4%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Mt_asama.jpg","page_title":"അസാമാ പർവ്വതം","context_page_description":"ജപ്പാനിലെ ഒരു പ്രധാന ദ്വീപായ ഹോൻഷൂവിന്റെ മധ്യഭാഗത്ത് സ്ഥിതി ചെയ്യുന്ന ഒരു സജീവ അഗ്നിപർവ്വതമാണ് അസാമാ പർവ്വതം. ജപ്പാനിലെ പ്രധാനപ്പെട്ട 100 പർവ്വതങ്ങളിലൊന്നാണിത്."},{"page_url":"https://sv.wikipedia.org/wiki/Visby_ringmur","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Sankt_G%C3%B6ransporten.jpg","page_title":"Visby ringmur","context_page_description":"Visby ringmur är en stadsmur kring den medeltida delen av Visby på Gotland. Ringmuren är upp till elva meter hög på sina ställen och hade ursprungligen 29 marktorn och 22 eller 23 sadeltorn. Idag finns 27 av marktornen kvar samt nio sadeltorn. Muren har i väsentlig grad bidragit till att Visby utsetts till världsarvstad."},{"page_url":"https://en.wikipedia.org/wiki/Embassy_of_Norway_in_Washington,_D.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Embassy_of_Norway.JPG","page_title":"Embassy of Norway in Washington, D.C.","context_page_description":"The Embassy of Norway in Washington, D.C. is the diplomatic mission of the Kingdom of Norway to the United States. Norway established an embassy in the United States in 1906, a year after Norwegian independence from Sweden. It is presently located at 2900 K Street, Suite 500, Northwest, Washington, D.C. The Embassy in Washington, D.C. is Norway's largest, with a staff of approximately 50, including representatives from a number of Norwegian ministries.\\nThe Ambassador is Kåre Aas."},{"page_url":"https://az.wikipedia.org/wiki/Trentino-Alto_Adice","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/S%C3%BCd_Tirol_1.JPG","page_title":"Trentino-Alto Adice","context_page_description":"Trentino-Alto Adice və ya Trentino-Cənubi Tirol — İtaliya muxtar vilayətlərindən biri.\\n1972-ci ildən əsas inzibati idarə funksiyası 2 muxtar əyalətə verilərək bölünmüşdür: Boltsano-Botsen-Cənubi-Tirol və Trento."},{"page_url":"https://en.wikipedia.org/wiki/SIMH","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Version_6_Unix_SIMH_PDP11_Emulation_KEN.png","page_title":"SIMH","context_page_description":"SIMH is a highly portable, multi-system emulator which runs on Windows, Linux, macOS, FreeBSD, OpenBSD, NetBSD and OpenVMS. It is maintained by Bob Supnik, a former DEC engineer and DEC vice president, and has been in development in one form or another since the 1960s."},{"page_url":"https://fr.wikipedia.org/wiki/Otarie_%C3%A0_fourrure_d%27Afrique_du_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Arctocephalus_pusillus_%28Cape_fur_seals%29.jpg","page_title":"Otarie à fourrure d'Afrique du Sud","context_page_description":"L'otarie à fourrure d'Afrique du Sud est un mammifère marin. Ces otaries se reproduisent sur les côtes d'Afrique du Sud, d'Australie et de Tasmanie. Ces otaries passent le plus clair de leur temps dans l'eau, les mères peuvent rester plusieurs jours en mer pour se nourrir, revenant régulièrement pour alimenter leurs petits. Cette espèce vit dans les mers, les océans et les régions côtières. Un individu peut peser 360 kg."},{"page_url":"https://de.wikipedia.org/wiki/Briefmarken-Ausgaben_der_amerikanischen_und_britischen_Zone_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Bi_Zone_1945_35_DE_M-Serie.jpg","page_title":"Briefmarken-Ausgaben der amerikanischen und britischen Zone in Deutschland","context_page_description":"Die Briefmarken-Ausgaben aus der Amerikanisch-Britischen Besatzungszone wurden zunächst ab dem 19. März 1945 bis Anfang 1946 in der Währung Reichsmark herausgegeben. Ab Februar 1946 bis Anfang 1947 wurden Briefmarken des Kontrollrats, also für die Bizone und die Sowjetische Besatzungszone gemeinsam ausgegeben. Nach dem Bruch der Alliierten im Mai 1948, wurden ab dem 21. Juni 1948 neue, bzw. alte Kontrollratsausgaben mit Aufdruck, in der Währung DM ausgegeben. Die letzten Ausgaben der Bizone aus Anlass des 200. Geburtstages von Johann Wolfgang von Goethe kamen am 15. August 1949 heraus, denen ab dem 7. September die ersten Ausgaben der neu gegründeten Bundesrepublik Deutschland folgten.\\nDie insgesamt 20 Briefmarken von 1945 unterscheiden sich in drei Serien nach dem Druck in den drei Ländern USA, Großbritannien und Deutschland, wobei diese eindeutig zugeordnet werden können und in der Standardliteratur für Briefmarkensammler auch getrennt gelistet werden. Auch in den 61 Ausgaben der Dauermarken von 1948 bis 1949 gab es auf Grund des allgemeinen Mangels der Nachkriegszeit viele unterscheidbaren Varietäten der gleichen Marken."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%9E%97%E5%B8%83%E8%98%AD%E6%92%9E%E6%93%8A%E5%9D%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Rembrandt_Messenger.jpg","page_title":"林布蘭撞擊坑","context_page_description":"林布蘭撞擊坑是水星上的一個大型撞擊坑，直徑 715 公里，是水星上第二大撞擊坑，僅次於卡洛里盆地，也是太陽系中最大的撞擊坑之一。於2008年10月6日信使號第二次飛掠水星時發現。該撞擊坑年齡約 39 億年，於後期重轟炸期形成。在林布蘭撞擊坑外環周圍的撞擊坑密度和直徑代表這是水星上最年輕的撞擊盆地之一。\\n該撞擊坑以荷蘭知名畫家林布蘭命名。"},{"page_url":"https://eo.wikipedia.org/wiki/Brestovec_(distrikto_Kom%C3%A1rno)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Brestovec1.JPG","page_title":"Brestovec (distrikto Komárno)","context_page_description":"Brestovec, hungare Szilas estas malgranda vilaĝeto en Slovakio en regiono Nitra, en distrikto Komárno."},{"page_url":"https://lv.wikipedia.org/wiki/Di%C4%81na_Rasimovi%C4%8D%C5%ABte","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Diana_Rasimoviciute_Ostersund_2008.jpg","page_title":"Diāna Rasimovičūte","context_page_description":"Diāna Rasimovičūte ir lietuviešu biatloniste. Piedalījusies piecās olimpiskajās spēlēs, augstāko — 18. vietu 7,5 km sprinta distancē — ieguvusi 2006. gadā Turīnā. Savukārt Pasaules čempionātos labākā iegūtā vieta ir 11. 2009. gadā Phjončhanā, Dienvidkorejā. 2010. gadā Otepē, Igaunijā viņa izcīnīja divas sudraba medaļas Eiropas čempionātā sportistiem, kas nav sasnieguši 26 gadu vecumu.\\nD. Rasimovičiūte ir Latvijas biatlonista un trenera Ilmāra Briča draudzene, savulaik trenējas kopā ar Latvijas vīriešu izlasi Vitālija Urbanoviča vadībā."},{"page_url":"https://de.wikipedia.org/wiki/Ary_Barroso","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/AryBarroso.jpg","page_title":"Ary Barroso","context_page_description":"Ary Evangelista Barroso war Jurist, Sportreporter und einer der populärsten brasilianischen Komponisten und Sänger der 1940er- und 1950er-Jahre."},{"page_url":"https://eo.wikipedia.org/wiki/Krucumita_Kristo_en_arto","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Vitrail_de_la_crucifixion._Poitiers._Cath%C3%A9drale_Saint-Pierre.jpg","page_title":"Krucumita Kristo en arto","context_page_description":"Vidi ankaŭ Krucumo de Jesuo\\nLa rolo de la ikonografio de la krucumo de Jesuo en la kulturo de la kristanaro estas fundamenta, ĉar samtempe kaj simbolo kaj emblemo de la naskiĝo de kristanismo kaj fakta reprezentado de enorma kultura agento en la historio. Krome, la formala signo mem de la krucumo, la kruco, fariĝis simbolo disvatigita en la tuta mondo\\nLa krucumo de Jesuo, aŭ simple “krucumo” kiu interalie havas plikorekton filologian ĉar plipreciza lingvistika paŭso, kie la vorto ‘’crux’’ estas dativforma, kun la sinsekva ‘’’morto sur la kruco’’’, estas la fina evento de la tera vivo de Jesuo.\\nTiu evento, kune kun la Resurekto el morto post tri tagoj, estas konsiderata de kristanoj la kulmina pinto de la homa historio – ĉar ĝi malkaŝas tion kio estas la homo kaj kion li bezonas por la fina savo. La evento krucumo estas priskribita en ĉiuj kvar kanonaj evangelioj."},{"page_url":"https://vi.wikipedia.org/wiki/Ng%C6%B0%E1%BB%9Di_cao_tu%E1%BB%95i","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%D7%9E%D7%A9%D7%94_%D7%9E%D7%A8%D7%93%D7%9B%D7%99_%D7%94%D7%9C%D7%95%D7%99_%D7%A9%D7%95%D7%9C%D7%96%D7%99%D7%A0%D7%92%D7%A8.jpg","page_title":"Người cao tuổi","context_page_description":"Người cao tuổi hay người cao niên hay người già là những người lớn tuổi, thường có độ tuổi khoảng từ 60 trở lên. Pháp lệnh người cao tuổi ở Việt Nam nhận định: \\"người cao tuổi có công sinh thành, nuôi dưỡng, giáo dục con cháu về nhân cách và vai trò quan trọng trong gia đình và xã hội\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Sauc%C3%A8de","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Eglise_de_Sauc%C3%A8de.JPG","page_title":"Saucède","context_page_description":"Saucède är en kommun i departementet Pyrénées-Atlantiques i regionen Nouvelle-Aquitaine i sydvästra Frankrike. Kommunen ligger i kantonen Oloron-Sainte-Marie-Est som tillhör arrondissementet Oloron-Sainte-Marie. År 2009 hade Saucède 130 invånare."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D1%8B%D0%B9_%D0%AF%D1%80_(%D0%9A%D1%80%D0%B0%D1%81%D0%BD%D0%BE%D1%8F%D1%80%D1%81%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD,_%D0%A1%D0%B0%D0%BC%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Krasniy_Yar_%28Samara%29_9914.JPG","page_title":"Красный Яр (Красноярский район, Самарская область)","context_page_description":"Красный Яр — село Самарской области России, административный центр Красноярского муниципального района и одноимённого сельского поселения."},{"page_url":"https://en.wikipedia.org/wiki/Kadijken","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/Entrepotdok.jpg","page_title":"Kadijken","context_page_description":"The Kadijken, also known as Kadijkseiland or Kadijkenbuurt, is a neighbourhood to the north of Artis zoo in the centre of Amsterdam. The name \\"Kadijken\\" is the plural form of Kadijk and refers to the two main streets that traverse the neighbourhood, Hoogte Kadijk and Laagte Kadijk."},{"page_url":"https://hr.wikipedia.org/wiki/Klement_XI.","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/ClemensXI.jpg","page_title":"Klement XI.","context_page_description":"Klement XI., lat. Clemens PP. XI., rođen kao Giovanni Francesco Albani, 243. nasljednik apostola Petra, papa od 23. studenog 1700. do smrti 1721."},{"page_url":"https://sv.wikipedia.org/wiki/Harmonil%C3%A4ra_(musik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Hugo_Riemann_Ugglan.jpg","page_title":"Harmonilära (musik)","context_page_description":"Harmonilära är ett delområde inom musikteori. Harmoniläran behandlar harmonier eller ackord, vilka traditionellt brukar definieras som tre eller flera samtidigt klingande toner. Genom att undersöka hur harmonierna är uppbyggda, hur de interagerar med andra harmonier samt med musikaliska element som tonart, melodi och rytm försöker harmoniläran systematisera hur man fortskrider från en samklang till nästa. Harmonilära har nära kopplingar till andra musikteoretiska delområden som satslära, kontrapunkt, arrangering och komposition. Som en del av harmoniläran ingår ett antal olika beskrivnings- och analyssystem för ackord och ackordprogressioner, exempelvis generalbas, steganalys, funktionsanalys och ackordanalys."},{"page_url":"https://no.wikipedia.org/wiki/Pierella","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Pierella_astyoche_MHNT_ventre.jpg","page_title":"Pierella","context_page_description":"Pierella er en slekt av sommerfugler som hører til gruppen Haeterini i underfamilien ringvinger i den store familie flikvinger. De finnes bare i skogområder i Sør- og Mellom-Amerika. I motsetning til de fleste andre Haeterini har denne slekten ikke gjennomsiktige vinger."},{"page_url":"https://hu.wikipedia.org/wiki/Big_Show","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Big_Show_with_Andre_the_Giant_trophy.jpg","page_title":"Big Show","context_page_description":"Paul Donald Wight Jr., ismertebb nevén Big Show amerikai profi birkózó, profi pankrátor. Korábbi ringneve a The Giant volt. Pályafutása alatt 7x volt világbajnok: Kétszer megnyerte a WCW nehézsúlyú világbajnoki címet, kétszer a WWE világbajnoki címet, egyszer az ECW világbajnoki címet és kétszer a nehézsúlyú világbajnoki címet. Emellett egyszeres WWE interkontinentális bajnok, egyszeres WWE országos bajnok, kétszeres WWE Tag Team bajnok, háromszoros Tag Team világbajnok és háromszoros WCW Tag Team bajnok. 2015-ben megnyerte az „André the Giant” emlék trófeát a WrestleMania 31-en. Jelenleg a WWE-vel áll szerződésben."},{"page_url":"https://pl.wikipedia.org/wiki/Dostojka_akwilonaris","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Boloria.aquilonaris.1.jpg","page_title":"Dostojka akwilonaris","context_page_description":"Dostojka akwilonaris – gatunek motyla dziennego z rodziny rusałkowatych."},{"page_url":"https://fr.wikipedia.org/wiki/Noroy-le-Bourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Noroy_le_Bourg_-_Ecole%2C_mairie%2C_justice_de_paix_d%C3%A9tail_1.jpg","page_title":"Noroy-le-Bourg","context_page_description":"Noroy-le-Bourg est une commune française située dans le département de la Haute-Saône, en région Bourgogne-Franche-Comté."},{"page_url":"https://zh.wikipedia.org/zh-cn/JR%E6%9D%B1%E8%A5%BF%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/JRW_series321_Tozai.jpg","page_title":"JR東西線","context_page_description":"JR东西线是一条连结日本大阪府大阪市城东区的京桥站至兵库县尼崎市的尼崎站的铁路线。第三种铁道事业者的关西高速铁道保有轨道等铁路设施，第二种铁道事业者的西日本旅客铁道进行旅客运送。"},{"page_url":"https://de.wikipedia.org/wiki/Meininger_Prinzipien","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Georg_II._Sachsen-Meiningen.jpg","page_title":"Meininger Prinzipien","context_page_description":"Als Meininger Prinzipien werden die bedeutenden Neuerungen der Meininger in der Theater- und Orchesterarbeit bezeichnet, die Ende des 19. Jahrhunderts mit einer tiefgreifenden und bis heute wirkenden Reform vollzogen wurden. Sie sind bis heute Bestandteil der Lehrpläne an Schauspielschulen."},{"page_url":"https://sv.wikipedia.org/wiki/Sarsina_(djur)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/Foro_romano%2C_Sarsina.JPG","page_title":"Sarsina (djur)","context_page_description":"Sarsina är ett släkte av fjärilar. Sarsina ingår i familjen tofsspinnare.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://nl.wikipedia.org/wiki/Buriton","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/The_Manor_House%2C_Buriton_-_geograph.org.uk_-_66569.jpg","page_title":"Buriton","context_page_description":"Buriton is een civil parish in het bestuurlijke gebied East Hampshire, in het Engelse graafschap Hampshire met 785 inwoners."},{"page_url":"https://hu.wikipedia.org/wiki/Nyerges_mad%C3%A1r","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Saddleback_tiritiri.jpg","page_title":"Nyerges madár","context_page_description":"A nyerges madár vagy régebbi nevén a madarak osztályába a verébalakúak rendjébe és a kokakófélék családjába tartozó Philesturnus nem egyetelen faja."},{"page_url":"https://be-tarask.wikipedia.org/wiki/%D0%90%D0%BD%D0%B4%D1%80%D1%8D%D0%B9_%D0%9C%D0%B0%D0%BA%D0%B0%D1%80%D1%8D%D0%B2%D1%96%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/MIBF2013_img_06_Andrey_Makarevich.jpg","page_title":"Андрэй Макарэвіч","context_page_description":"Андрэй Вадзімавіч Макарэвіч — савецкі і расейскі музыка, сьпявак, паэт, кампазытар, мастак, прадусар, тэлевядоўца, лідэр рок-гурту «Машина времени». Заслужаны артыст РСФСР, Народны артыст Расеі."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%93%D7%9C%D7%99%D7%99%D7%AA_%D7%94%D7%94%D7%92%D7%A0%D7%94_(1945-1940)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Deltagermedaljen_revers_det.jpg","page_title":"מדליית ההגנה (1945-1940)","context_page_description":"מדליית ההגנה הוא העיטור הניתן לחיילים ולאזרחים שנטלו חלק במאבק נגד פלישת גרמניה הנאצית לנורווגיה ובמהלך תקופת הכיבוש במלחמת העולם השנייה.\\nנכון ל-17 באפריל 2017 חולקו 1208 מדליות."},{"page_url":"https://pt.wikipedia.org/wiki/Campagna","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/A%27_Chiena8.jpg","page_title":"Campagna","context_page_description":"Campagna é uma comuna italiana da região da Campania, província de Salerno, com cerca de 15.518 habitantes. Estende-se por uma área de 135 km², tendo uma densidade populacional de 115 hab/km². Faz fronteira com Acerno, Contursi Terme, Eboli, Olevano sul Tusciano, Oliveto Citra, Postiglione, Senerchia, Serre."},{"page_url":"https://en.wikipedia.org/wiki/Manhi%C3%A7a_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Administra%C3%A7%C3%A3o_Distrital_Manhi%C3%A7a.jpg","page_title":"Manhiça District","context_page_description":"Manhiça District is a district of Maputo Province in southern Mozambique. The principal town is Manhiça. The district is located in the north of the province, and borders with Magude District in the north, Bilene Macia District of Gaza Province in the northeast, Marracuene District and the city of Maputo in the south, and with Moamba District in the west. In the east, the district is limited by the Indian Ocean. The area of the district is 2,373 square kilometres. It has a population of 159,812 as of 2007."},{"page_url":"https://sr.wikipedia.org/wiki/PMEG","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/PMEG.png","page_title":"PMEG","context_page_description":"PMEG je organsko jedinjenje, koje sadrži 8 atoma ugljenika i ima molekulsku masu od 289,185 Da."},{"page_url":"https://en.wikipedia.org/wiki/Al_Bangura","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/AlBangura%40FGRFC.jpg","page_title":"Al Bangura","context_page_description":"Alhassan \\"Al\\" Bangura is a Sierra Leonean footballer who plays as a midfielder for National League North side Nuneaton Town.\\nBangura played for the Sierra Leone national team and is notable for having been the victim of human trafficking when he was a teenager and also the subject of a deportation case in the United Kingdom in 2007."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B8%E3%82%A7%E3%83%83%E3%83%88%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/JAL_B777-200%28JA8983%29_%283892873998%29.jpg","page_title":"ジェット機","context_page_description":"ジェット機とは、ジェットエンジンを用い、その推力によって飛行する飛行機である。\\nジェットエンジンにはターボプロップエンジンも含まれるが、ターボプロップエンジンでプロペラを駆動する飛行機は一般にプロペラ機に分類される。一方、高バイパス比のターボファンエンジンは推力のほとんどを燃焼ガスによるジェット噴流ではなくエンジン前方のファンによって得るが、この場合はジェット機に分類される。\\n航空法ではパイロットや整備士の資格は発動機で区別されており、プロペラの有無は問われない。"},{"page_url":"https://cy.wikipedia.org/wiki/Rockland,_Massachusetts","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Rockland_Union_Street.jpg","page_title":"Rockland, Massachusetts","context_page_description":"Tref yn Plymouth County, yn nhalaith Massachusetts, Unol Daleithiau America yw Rockland, Massachusetts. ac fe'i sefydlwyd ym 1673.\\nCeir 9 cylchfa amser yn UDA, ac mae hon yn perthyn i'r cylchfa amser a elwir yn: Cylchfa Amser y Dwyrain."},{"page_url":"https://ast.wikipedia.org/wiki/Spinus_spinus","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Rangemap-tarin.PNG","page_title":"Spinus spinus","context_page_description":"Spinus spinus ye una especie d'ave paseriforme de la familia de los frinxílidos. Ye bien común por toa Europa y Asia, alcuéntrase-y en zones montiegues, tantu de coníferes como en montes mistos, onde s'alimenta de granes de too tipu, especialmente d'omeros y coníferes.\\nYe un páxaru pequeñu de plumaxe pardu-amarellentáu, diferenciable d'otros frinxílidos paecíos pol so patrón de colores: nales negres, obispillo mariellu y lladrales llistaos. Machu y fema son distintes. El machu tien parte de la cabeza negra y la fema tien un aspeutu más llistáu y de color más verdusco. Ye una especie bien confiada, sociable y activa. Por esto, pol so aspeutu y pol so cantar apreciar y críase en cautividá.\\nSigue un patrón estrañu de migración: cada pocos años, pel hibiernu, muévese masivamente al sur, por causes non del tou conocíes pero que tienen que ver con factores climáticos y sobremanera de disponibilidad d'alimentu. Asina zones onde nun ye bien abondosa les sos poblaciones invernantes multiplíquense."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%84%D9%88%D9%86%DA%AF%DB%8C_%D8%A2%D8%B0%D8%B1%D8%A8%D8%A7%DB%8C%D8%AC%D8%A7%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Cuce-levengisi.jpg","page_title":"لونگی آذربایجانی","context_page_description":"لونگی غذای ملی جمهوری آذربایجان می‌باشد. این غذا دو نوع چون لونگی ماهی و لونگی مرغی را دارا ست. به نحوه پر کردن شکم ماهی یا مرغ با ادویجات و گردو درست می‌شود."},{"page_url":"https://zh.wikipedia.org/zh-cn/2018%E5%B9%B4%E9%A6%99%E6%B8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Andy-Chan_talk_Pro_China_camp_protest_outside_FCC_20180814.jpg","page_title":"2018年香港","context_page_description":"行政长官：林郑月娥\\n政务司司长：张建宗\\n财政司司长：陈茂波\\n律政司司长：袁国强 → 郑若骅"},{"page_url":"https://da.wikipedia.org/wiki/Lavra","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/RUS-2016-Aerial-SPB-Alexander_Nevsky_Lavra.jpg","page_title":"Lavra","context_page_description":"Ordet lavra kommer fra græsk: Λαύρα tr. Laura er en type kloster bestående af en klynge af celler eller huler for eneboere, med en kirke og undertiden et refektorium i centrum.\\nDen måske mest kendte betydning af ordet er dog den som anvendes indenfor den russisk-ortodokse kirke om de vigtigste klostre.\\nEksempeler på er Petjerska lavra i Kijev, grundlagt af munkene Feodosij Petjerskij og Antonij Petjerskij, og Troitse-Sergijeva lavra, grundlagt af munken Sergij Radonezjskij.\\nKijevo-Petjerska blev lavra i 1688 og Troitse-Sergijeva blev udråbt som lavra i 1744 af Elisabeth af Rusland."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%97%D0%B0%D1%80%D0%B5%D0%BC%D0%B1%D0%B0_%D0%92%D0%BB%D0%B0%D0%B4%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%86%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Vladyslav_Zaremba.jpg","page_title":"Заремба Владислав Іванович","context_page_description":"Владисла́в Іва́нович Заре́мба — український композитор, піаніст і педагог."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_ponts_sur_la_Seine","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Aisey-sur-Seine_Bridge_of_Troubles.JPG","page_title":"Liste des ponts sur la Seine","context_page_description":"Cette liste contient les ponts présents sur la Seine et ses bras. Elle est donnée par département de l'aval du fleuve vers son amont et précise, après chaque pont, le nom des communes qu'elle relie, en commençant par celle située sur la rive gauche du fleuve.\\nOn en dénombre environ 257, de toutes sortes :\\nvoies routières ou autoroutières +\\nvoies ferrées\\npasserelles piétonnes\\nponts mixtes +\\nCertains relient une berge à une île et ne franchissent donc qu'un bras. D'autres sont en ruine et infranchissables.\\nCertains ponts sont inscrits ou classés aux monuments historiques, ou encore répertoriés dans l’inventaire général du patrimoine culturel du Ministère de la Culture :\\npont inscrit\\npont classé\\nCette liste n'indique pas les ponts présents au-dessus des affluents de la Seine."},{"page_url":"https://en.wikipedia.org/wiki/Jowett_Cars","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Jowett_Jupiter.jpg","page_title":"Jowett Cars","context_page_description":"Jowett was a manufacturer of light cars and light commercial vehicles in Bradford, West Riding of Yorkshire, England from 1906 to 1954."},{"page_url":"https://en.wikipedia.org/wiki/Baron_Wharton","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/DukeOfWharton.jpg","page_title":"Baron Wharton","context_page_description":"Baron Wharton is a title in the Peerage of England, originally granted by letters patent to the heirs male of the 1st Baron, which was forfeited in 1729 when the last male-line heir was declared an outlaw. The Barony was erroneously revived in 1916 by writ of summons, thanks to an 1844 decision in the House of Lords based on absence of documentation. As such, the current Barony of Wharton could more accurately be listed as a new Barony, created in 1916, with the precedence of the older Barony."},{"page_url":"https://en.wikipedia.org/wiki/Protection_motivation_theory","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Protection_motivation_theory.png","page_title":"Protection motivation theory","context_page_description":"Protection motivation theory is a theory that was originally created to help clarify fear appeals. The protection motivation theory proposes that people protect themselves based on four factors: the perceived severity of a threatening event, the perceived probability of the occurrence, or vulnerability, the efficacy of the recommended preventive behavior, and the perceived self efficacy. Protection motivation stems from both the threat appraisal and the coping appraisal. The threat appraisal assesses the severity of the situation and examines how serious the situation is. The coping appraisal is how one responds to the situation. The coping appraisal consists of both efficacy and self-efficacy. Efficacy is the individual's expectancy that carrying out recommendations can remove the threat. Self-efficacy is the belief in one's ability to execute the recommended courses of action successfully. PMT is one model that explains why people engage in unhealthy practices and offers suggestions for changing those behaviors. It is educational and motivational. Primary prevention: taking measures to combat the risk of developing a health problem."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Saint-Laurent_(Belgique)","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Kerk_van_Waterland-Oudeman.jpg","page_title":"Liste des monuments historiques de Saint-Laurent (Belgique)","context_page_description":"Cette page regroupe l'ensemble des monuments classés de la ville belge de Saint-Laurent."},{"page_url":"https://no.wikipedia.org/wiki/Leonaert_Bramer","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Leonard_Bramer_-_Het_Gulden_Cabinet.png","page_title":"Leonaert Bramer","context_page_description":"Leonaert/Leonard Bramer var en nederlandsk kunstmaler, designer og en av få freskomalere i den nederlandske gullalderen. Malestilen var inspirert av Adam Elsheimer og Caravaggio.\\nI Italia hvor han oppholdt seg i en lengre periode, var han kjent som Leonardo della Notte, på grunn av sine mange malerier med nattescener.\\nBlant Bramers mange beskyttere og kunder var medlemmer av huset Oranien, men lokale kunder i Delft kjøpte også malerier i stort antall.\\nI dag er Bramer hovedsakelig kjent for å ha vært venn, inspirator og muligens læremester for Johannes Vermeer selv om Bramers og Vermeers malerstil var vidt forskjellig.\\nBramer ble medlem av Sint-Lucasgildet i Delft i 1629.\\nBramer giftet seg aldri og fortsatte med å være svært produktiv inntil han døde i Delft i 1674, da en stor del av hans verk ble lagt ut på auksjon."},{"page_url":"https://af.wikipedia.org/wiki/Benjamin_Mountfort","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/ChristChurchCathedral1_gobeirne.jpg","page_title":"Benjamin Mountfort","context_page_description":"Benjamin Woolfield Mountfort was 'n Engelse emigrant na Nieu-Seeland waar hy een van dié land se mees prominente 19de eeuse argitekte geword het. Hy het groot aandeel gehad in die vorming van die stad Christchurch. Hy is aangestel as die eerste amptelike provinsiale argitek in die ontwikkelende provinsie Canterbury. Hy is baie beïnvloed deur die Anglo-Katolieke filosofie agter Viktoriaanse argitektuur, en die invoer van die Gotiese hernuwing in Nieu-Seeland word aan hom toegeskryf. Sy Gotiese ontwerpe in beide hout en klip in die provinsie word geag as uniek aan Nieu-Seeland. Hy word vandag as die stigtersargitek van Canterbury gesien."},{"page_url":"https://fi.wikipedia.org/wiki/Toinen_sortokausi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Konni_Zilliacus.jpg","page_title":"Toinen sortokausi","context_page_description":"Toinen sortokausi oli Suomen historiassa sortokausiksi kutsutun ajanjakso\uFEFFn jälkimmäinen vaihe vuosina 1908–1917, jolloin Venäjä pyrki merkittävästi kaventamaan Suomen autonomiaa.\\nToinen sortokausi alkoi \uFEFFPjotr Stolypinin tultua Venäjän pääministeriksi ja hänen toteuttaessaan 1908 Suomen asiain esittelyjärjestyksen, jonka jälkeen Suomea \uFEFFhallittiin enemmän Venäjän ministerineuvoston kautta. Aikaisemman käytännön mukaan suomalainen ministerivaltiosihteeri oli esittänyt Venäjän keisarille ne \uFEFFSuomea koskevat lakiasiat, jotka tulkittiin kuuluviksi yleisvaltakunnallisiin asioihin. Uuden esittelyjärjestyksen jälkeen tämä valta oli Venäjän ministerineuvostolla. Vuonna 1910 annettiin laki yleisvaltakunnallisesta lainsäädännöstä, joka käytännössä riisti Suomen senaatilta ja eduskunnalta lähes kaiken lainsäädäntövallan. Sen turvin säädettiin vuonna 1912 myös yhdenvertaisuuslaki, joka antoi Venäjän kansalaisille Suomessa samat oikeudet kuin Suomen alamaisilla oli, äänioikeutta lukuun ottamatta. Tämä mahdollisti venäläisten nimittämisen korkeisiin virkoihin Suomessa."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BF%E3%82%B7%E3%83%AB%E3%83%B3%E3%83%9D%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Entrance_to_Tashilhunpo_Monastery.jpg","page_title":"タシルンポ寺","context_page_description":"タシルンポ寺はチベット・シガツェ市サムドゥプツェ区にあるゲルク派最大の寺院である。吉祥須弥寺、扎什倫布寺、タシルンボ寺。\\nラサの3大寺院であるガンデン寺、セラ寺、デプン寺と合わせてゲルク派四大寺院、それに青海省のタール寺と甘粛省のラプラン寺と合わせてゲルク派六大寺院と呼ばれる。\\n4世以降のパンチェンラマはここで宗教活動と政治活動を主に行った。シガツェの街の西にある尼色日山の山腹に建設され、50あまりの経堂と200あまりの部屋をもつ。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%BD%D1%81%D1%82%D0%B8%D1%82%D1%83%D1%82_%D0%BC%D0%B5%D0%B4%D0%B8%D1%86%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D1%85_%D0%B8%D1%81%D1%81%D0%BB%D0%B5%D0%B4%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D0%B9_%D0%93%D0%B0%D1%80%D0%B2%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Garvan_Institute_Helical_Staircase.jpg","page_title":"Институт медицинских исследований Гарвана","context_page_description":"Институт медицинских исследований Гарвана — австралийский биомедицинский научно-исследовательский институт расположенный в Сиднее, Австралия. Основанный в 1963 году, на сегодняшний день это один из самых больших медицинских научно-исследовательских институтов Австралии со штатом примерно 650 ученых, своими студентами и вспомогательным персоналом. Директором института с 2012 года является австралийский молекулярный биолог, профессор Джон Маттик, член Европейской Организации Молекулярной Биологии, известный тем, что первым отстаивал полезную роль так называемой «мусорной ДНК».\\nВ 2014 году, после покупки оборудования Illumina HiSeqX Ten для секвенирования генома, институт был одной из всего трех организаций в мире и первой организацией за пределами США — способной секвенировать геном человека по цене ниже 1000$."},{"page_url":"https://fr.wikipedia.org/wiki/Saill%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Saill%C3%A9_maison_paludiers_1.JPG","page_title":"Saillé","context_page_description":"Saillé est un village français situé sur la commune de Guérande, dans le département de la Loire-Atlantique, en Pays de la Loire.\\nIl est situé au cœur des marais salants de Guérande dont l'exploitation est jusqu'au XXᵉ siècle la principale activité économique."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_distinctions_d%27Amy_Adams","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Amy_Adams_at_NYFF_2013.jpg","page_title":"Liste des distinctions d'Amy Adams","context_page_description":"Cet article traite des récompenses et nominations reçues par l'actrice américaine Amy Adams."},{"page_url":"https://hr.wikipedia.org/wiki/Ostwaldov_proces","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Wilhelm_Ostwald.jpg","page_title":"Ostwaldov proces","context_page_description":"Ostwaldov proces je kemijski proces za proizvodnju dušične kiseline, kojeg je razvio njemački kemičar i nobelovac Wilhelm Ostwald. Ovaj proces jedan je od najvažnijih temelja moderne kemijske industrije. Povijesno i praktično usko je povezan s Haberovim procesom, koji osigurava potrebnu sirovinu, amonijak."},{"page_url":"https://vi.wikipedia.org/wiki/%C4%90i%E1%BB%87n_%E1%BA%A3nh_Indonesia","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Nurman_hakim.jpg","page_title":"Điện ảnh Indonesia","context_page_description":"Điện ảnh Indonesia bắt đầu từ năm 1926 và là một trong những nền Điện ảnh lớn nhất khu vực Đông Nam Á."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D8%B3%D9%8A%D8%A7%D8%AD%D8%A9_%D9%81%D9%8A_%D9%85%D8%B5%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/El_Shatby-_view_from_Saint_Marc_dorms.JPG","page_title":"السياحة في مصر","context_page_description":"تعدّ السياحة في مصر أحد أهم مصادر الدخل القومي بما توفره من عائدات دولارية سنوية، وعوائد العملة الأجنبية التي مكنتها من المشاركة بشكل كبير بالناتج الإجمالي المحلي، ومكافحة البطالة عن طريق توظيف شريحة واسعة من القوى العاملة في مصر. وتعد مصر من أبرز الدول السياحية في العالم بما تستحوذ عليه من أعداد السائحين الوافدين في العالم، وتميزها بوفرة المزارات السياحية على اختلاف أنواعها، وانتشار المعابد والمتاحف والآثار والمباني التاريخية والفنية والحدائق الشاسعة على أرضها، وامتلاكها لبنية تحتية قوية تقوم على خدمة قطاع السياحة بما في ذلك الغرف الفندقية والقرى والمنتجعات السياحية وشركات السياحة ومكاتب الطيران. وتعد مناطق الأقصر،و أسوان،و القاهرة،و الإسكندرية،و الساحل الشمالي،و البحر الأحمر،و جنوب سيناء من أكثر المناطق جذباً للسياح بشكل عام. ويعود تاريخ السياحة في مصر إلى المصريين القدماء، واستمرت كوجهة ومقصد سياحي مرغوب على مدار القرون الماضية وخلال التاريخ المعاصر. واختارت منظمة اليونسكو ست مواقع تراثية ثقافية مصرية متنوعة ما بين مصرية قديمة وقبطية وإسلامية بالإضافة إلى موقع للتراث الطبيعي وذلك ضمن قائمة مواقع التراث العالمي."},{"page_url":"https://de.wikipedia.org/wiki/Girija_Prasad_Koirala","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Girija_Prasad_Koirala.jpg","page_title":"Girija Prasad Koirala","context_page_description":"Girija Prasad Koirala war ein nepalesischer Politiker und mehrfacher Premierminister sowie von Januar 2007 bis Juli 2008 auch amtierendes Staatsoberhaupt seines Landes. Er war der jüngste Sohn von Krishna Prasad Koirala und Divya Koirala, und Bruder der früheren nepalesischen Premierminister Bishweshwar Prasad Koirala und Matrika Prasad Koirala sowie der Cousin des früheren nepalesischen Premierministers Man Mohan Adhikari."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Pfarren_im_Dekanat_Gro%C3%9Fwarasdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Kroatisch_Minihof_-_Kirche.JPG","page_title":"Liste der Pfarren im Dekanat Großwarasdorf","context_page_description":"Das Dekanat Großwarasdorf, kroatisch Veliki Borištof, ist ein Dekanat der römisch-katholischen Diözese Eisenstadt. Es umfasst neun Pfarren und beherbergt die Kroatische Minderheit im Burgenland."},{"page_url":"https://de.wikipedia.org/wiki/Bl%C3%B6cktach","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Bl%C3%B6cktach_%E2%80%94_Ortsschild_und_Schilder_mit_den_Aufschriften_der_Partnegemeinden.jpg","page_title":"Blöcktach","context_page_description":"Blöcktach ist ein Ortsteil der Gemeinde Friesenried im schwäbischen Landkreis Ostallgäu. Das Pfarrdorf liegt etwa zwei Kilometer nördlich von Friesenried. Der Ort hat circa 400 Einwohner. Das einzige Kirchengebäude ist St. Wolfgang.\\nDie Eingemeindung nach Friesenried erfolgte am 1. Januar 1978."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%95%E0%A8%BE%E0%A8%B0%E0%A8%B2_%E0%A8%AE%E0%A8%BE%E0%A8%B0%E0%A8%95%E0%A8%B8_%E0%A8%B8%E0%A8%AE%E0%A8%BE%E0%A8%B0%E0%A8%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Karl_Marx_memorial.jpg","page_title":"ਕਾਰਲ ਮਾਰਕਸ ਸਮਾਰਕ","context_page_description":"ਕਾਰਲ-ਮਾਰਕਸ-ਸਮਾਰਕ 7.10 ਮੀਟਰ ਉੱਚਾ ਅਤੇ ਡਿਊਟੀ ਪਲਾਸਟਿਕ ਦਾ ਲਗਪਗ 40 ਟਨ ਭਾਰਾ ਕਾਰਲ ਮਾਰਕਸ ਦਾ ਵਿਲੱਖਣ ਅੰਦਾਜ਼ ਵਾਲਾ ਸਿਰ ਹੈ। ਇਹ ਕੇਮਨਿਤਜ਼ ਦੇ ਅੰਦਰਲੇ ਸ਼ਹਿਰ ਵਿੱਚ ਸਥਿਤ ਹੈ ਅਤੇ ਇਹ ਉਲਾਨ-ਉਦੇ ਵਿੱਚ ਲੈਨਿਨ ਦੇ ਇਸ ਨਾਲੋਂ 60 ਸੈਂਟੀਮੀਟਰ ਉੱਚੇ ਸਿਰ ਤੋਂ ਬਾਅਦ, ਸੰਸਾਰ ਵਿੱਚ ਦੂਜਾ ਸਭ ਤੋਂ ਵੱਡਾ ਬਸਟ ਹੈ। ਸਮਾਰਕ ਦੇ ਪਿੱਛੇ ਕੰਧ ਉੱਪਰ, ਸ਼ਬਦ \\"ਦੁਨੀਆਂ ਭਰ ਦੇ ਮਜ਼ਦੂਰੋ ਇੱਕ ਹੋ ਜਾਓ!\\" ਜਰਮਨ, ਅੰਗਰੇਜ਼ੀ, ਫਰਾਂਸੀਸੀ ਅਤੇ ਰੂਸੀ ਚਾਰ ਭਾਸ਼ਾਵਾਂ ਵਿੱਚ ਲਿਖੇ ਹੋਏ ਹਨ।"},{"page_url":"https://lt.wikipedia.org/wiki/Naningas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Four_linked_pottery_jars.jpg","page_title":"Naningas","context_page_description":"Naningas – miestas pietryčių Kinijoje, prie Judziango upės; Guangsi autonominio regiono administracinis centras, džuangų tautos kultūrinis, ekonominis centras. Yra Vusu tarptautinis oro uostas, greitojo geležinkelio linija į Guangdžou. Metalurgijos, mašinų gamybos, tekstilės, maisto pramonė; turizmas. Veikia keli universitetai, menų kolegija. Yra Guangsi muziejus, botanikos sodas, zoologijos sodas, arbatmedžių parkas. Apylinkėse yra senovinio Jangmėjaus miesto liekanos, Guilino kalvos."},{"page_url":"https://pt.wikipedia.org/wiki/Rubena","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Rubena_-_Iglesia_-BT-_01.jpg","page_title":"Rubena","context_page_description":"Rubena é um município da Espanha na província de Burgos, comunidade autónoma de Castela e Leão, de área 9,769 km² com população de 187 habitantes e densidade populacional de 18,00 hab/km²."},{"page_url":"https://es.wikipedia.org/wiki/Robert_Buron","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Robert_Buron_Buste_Laval_France.jpg","page_title":"Robert Buron","context_page_description":"Robert Buron fue un político francés que ocupó los cargos de Ministro de Finanzas y alcalde de Laval.​"},{"page_url":"https://pl.wikipedia.org/wiki/Ludwik_III_Wirtemberski_(ksi%C4%85%C5%BC%C4%99)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/114Lexikon_W%C3%BCrttemberg.jpg","page_title":"Ludwik III Wirtemberski (książę)","context_page_description":"Ludwik III Wirtemberski – książę Wirtembergii.\\nBył synem Krzysztofa I i Anny Marii Hohenzollern. Jego dziadkami byli Ulryk Wirtemberski i Sabina Wittelsbach oraz Jerzy Hohenzollern-Ansbach i Beatrycze de Frangepan.\\nPo śmierci ojca do momentu uzyskania pełnoletniości władzę w księstwie sprawowali: matka, książę Palatynatu Dwóch Mostów Wolfgang Wittelsbach, margrabia Brandenburgii-Ansbach Jerzy Fryderyk Hohenzollern, margrabia Badenii-Durlach Karol II i Henryk hrabia Castell.\\nLudwik III Wirtemberski zmarł w wieku 39 lat, nie pozostawiając następcy. Żonaty był dwukrotnie: z Dorotą, córką Karola II margrabiego Badenii, oraz Urszulą z Lützelstein, córką Jerzego Jana Wittelsbacha księcia Palatynatu-Veldenz."},{"page_url":"https://lt.wikipedia.org/wiki/Alasdair_MacIntyre","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Alasdair_MacIntyre.jpg","page_title":"Alasdair MacIntyre","context_page_description":"Alasdair Chalmers MacIntyre – moralės ir politikos filosofas, taip pat žinomas savo darbais filosofijos istorijos ir teologijos srityse.\\nMacIntyre veiklos temos – ideologijos kritika, psichoanalizė, moralės istorija; vėliau moralės filosofija. Pagrindinis veikalas – „After Virtue. A Study in Moral Theory“, kuriame kritikuojama „racionalistinė“ Švietimo moralė nuo Kanto, nesuteikianti žmogui jokių pamatų, šaknų. Sąsajos su Nikomacho etika, norima atgaivinti etinių vertybių tradicijas."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B2%D0%B8%D1%86%D1%8B_(%D0%92%D0%BE%D0%BB%D0%BE%D0%B3%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5d/Ivitsy%2C_Kirillovsky_District.JPG","page_title":"Ивицы (Вологодская область)","context_page_description":"Ивицы — деревня в Кирилловском районе Вологодской области.\\nВходит в состав Алёшинского сельского поселения, с точки зрения административно-территориального деления — в Мигачевский сельсовет.\\nРасположена на правом берегу Шексны. Расстояние до районного центра Кириллова по автодороге — 27 км, до центра муниципального образования Шиндалово по прямой — 9 км. Ближайшие населённые пункты — Кабачино, Мыс, Сосуново, Каргач.\\nПо переписи 2002 года население — 16 человек."},{"page_url":"https://fi.wikipedia.org/wiki/Martti_Jylh%C3%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Martti_Jylh%C3%A4_FIS_Cross-Country_World_Cup_2012_Quebec.jpg","page_title":"Martti Jylhä","context_page_description":"Martti Samuel Jylhä on uransa jo lopettanut suomalainen maastohiihtäjä. Jylhä voitti nuorten MM-kisoissa vuonna 2007 kultaa ja hopeaa. SM-kisoista hänellä on 15 kultaa: kahdeksan viestistä, viisi parisprintistä ja kaksi sprintistä. Hän sijoittui Liberecin MM-kisojen 2009 sprintissä sijalle 33, Oslon MM-kilpailuissa 2011 sijalle 22, Sotšin olympialaisissa 2014 21:nneksi ja Lahden MM-kilpailuissa 2017 seitsemänneksi. Falunin MM-kilpailuissa 2015 hän oli vapaan hiihtotavan parisprintissä Ville Nousiaisen kanssa viides. Pyeongchangin olympialaisissa 2018 hän sijoittui perinteisen hiihtotavan sprintissä kymmenenneksi ja vapaan parisprintissä yhdeksänneksi.\\nJylhä kilpaili maastohiihdon maailmancupissa ensimmäisen kerran maaliskuussa 2006 sijoittuen Borlängen vapaan hiihtotavan sprintissä 27:nneksi. Kymmenen parhaan joukkoon hän sijoittui ensimmäisen kerran Valdidentrossa helmikuussa 2009 oltuaan vapaan hiihtotavan sprintissä yhdeksäs. Joulukuussa 2013 Jylhä sijoittui toiseksi Davosin vapaan hiihtotavan sprintissä, ja oli karsinnan nopein."},{"page_url":"https://es.wikipedia.org/wiki/Universidad_de_Oriente_(Cuba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Edificio_Rectorado_Universidad_de_Oriente.jpg","page_title":"Universidad de Oriente (Cuba)","context_page_description":"La Universidad de Oriente es una institución cubana de carácter público, dedicada a la educación e investigación a nivel superior y postgrado.\\nEs la segunda institución superior pública de Cuba. Fue fundada en 1947 en la ciudad de Santiago de Cuba, al oriente del país y de ahí su nombre."},{"page_url":"https://en.wikipedia.org/wiki/Cobalt(II)_acetate","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Nickel%28II%29-acetate-tetrahydrate-3D-balls.png","page_title":"Cobalt(II) acetate","context_page_description":"Cobalt(II) acetate is the cobalt salt of acetic acid. It is commonly found as the tetrahydrate Co(CH₃CO₂)₂·4 H₂O, abbreviated Co(OAc)₂·4 H₂O. It is used as a catalyst."},{"page_url":"https://fr.wikipedia.org/wiki/Sazilly","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Sazilly_%C3%A9glise.jpg","page_title":"Sazilly","context_page_description":"Sazilly est une commune française du département d'Indre-et-Loire, dans la région Centre-Val de Loire."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_desastres_mar%C3%ADtimos","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/48/Afundamento_do_Principessa_Mafalda_outubro_1927.jpg","page_title":"Lista de desastres marítimos","context_page_description":"Esta é uma lista de desastres marítimos envolvendo embarcações civis e militares, inclusive uma plataforma de exploração de petróleo, ordenados pelo número de vítimas fatais até o limite mínimo de 100 pessoas.\\nAdotou-se a expressão \\"Desastres marítimos\\" em vez de \\"Naufrágios\\", uma vez que aquela é mais abrangente que esta, sobretudo pelo fato que, em diversos casos aqui listados, não houve efetivamente o naufrágio da embarcação. Além disso, em alguns desses desastres, a maioria das mortes ocorreu em terra. Também foram listados os eventos ocorridos em lagos, rios e outros corpos d´água interiores.\\nSomente foram considerados nesta lista, os desastres cujas causas diretas tenham sido não intencionais, mesmo que tivessem ocorrido com navios militares em tempos de guerra e, até mesmo, envolvidos no esforço de guerra.\\nOs afundamentos e desastres causados por atos de guerra, ver Lista de desastres marítimos por atos de guerra."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B2%D1%82%D0%BE%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Bus_station_Moscow.jpg","page_title":"Автовокзал","context_page_description":"Автовокза́л — объект транспортной инфраструктуры, включающий в себя размещённый на специально отведённой территории комплекс зданий и сооружений, предназначенных для оказания услуг пассажирам и перевозчикам при осуществлении перевозок пассажиров и багажа, обеспечивающий возможность отправления более 1000 человек в сутки. Подобный объект, обеспечивающий возможность отправления от 250 до 1000 человек в сутки, определяется как автостанция."},{"page_url":"https://war.wikipedia.org/wiki/Ashmunella_levettei","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/AshLevAngAll.jpg","page_title":"Ashmunella levettei","context_page_description":"Ashmunella levettei in uska species han Gastropoda nga syahan ginhulagway ni bland hadton 1881. An Ashmunella levettei in nahilalakip ha genus nga Ashmunella, ngan familia nga Polygyridae. Waray hini subspecies nga nakalista."},{"page_url":"https://vi.wikipedia.org/wiki/Th%E1%BA%BF_gi%E1%BB%9Bi_Naruto","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Otogakure_Symbol.svg","page_title":"Thế giới Naruto","context_page_description":"Bộ manga và anime Naruto diễn ra trong một thế giới tưởng tượng với nhiều đất nước và địa điểm."},{"page_url":"https://fr.wikipedia.org/wiki/Grand_autel_de_Pergame","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Pergamonmuseum_-_Antikensammlung_-_Pergamonaltar_19.jpg","page_title":"Grand autel de Pergame","context_page_description":"Le grand autel de Pergame, ou autel de Zeus à Pergame ou encore le Grand Autel, est un monument religieux élevé à l’époque hellénistique sur l’acropole de la ville de Pergame, sans doute au début du règne d’Eumène II. Ses frises monumentales, représentant une gigantomachie et l’histoire de Télèphe, constituent l’un des chefs-d’œuvre de la sculpture grecque antique et représentent l’apogée du « baroque hellénistique ». L’autel fit, à une époque, partie de la liste des merveilles du monde.\\nDécouvert en 1871 par l’ingénieur allemand Carl Humann, il est transporté et reconstitué à Berlin en 1886, aux termes d’un accord de 1879 entre l’Allemagne et l’Empire ottoman ; il est désormais conservé au musée de Pergame, l'un des Musées d'État de Berlin. Depuis plusieurs décennies, l’État turc réclame sa restitution, en vain.\\nLa restauration du monument est en cours. La réouverture est prévue pour 2023, dans le cadre d’un grand plan de rénovation des Staatliche Museen."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B3%D6%80%D5%A5%D5%B4%D5%B4%D5%AB_%D5%AC%D5%A1%D5%BE%D5%A1%D5%A3%D5%B8%D6%82%D5%B5%D5%B6_%D6%83%D5%B8%D6%83_%D5%BE%D5%B8%D5%AF%D5%A1%D5%AC%D5%A1%D5%B5%D5%AB%D5%B6_%D5%A1%D5%AC%D5%A2%D5%B8%D5%B4%D5%AB_%D5%B0%D5%A1%D5%B4%D5%A1%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Justin_Timberlake.jpg","page_title":"Գրեմմի լավագույն փոփ վոկալային ալբոմի համար","context_page_description":"«Գրեմմի» մրցանակ լավագույն փոփ վոկալային ալբոմի համար, «Գրեմմի» երաժշտական մրցանակաբաշխության մրցանակներից մեկը, որը տրվում է փոփ ժանրում լավագույն երաժշտական ալբոմի համար: Մրցանակաբաշխությունը հաստատվել է 1958 թվականին և սկզբնապես անվանվել է «Գրամոֆոն»: Մրցանակն ամեն տարի շնորհվում է Ձայնագրման ակադեմիայի կողմից «գեղարվեստական նվաճումների, տեխնիկական վարպետության և ձայնագրման ոլորտում նշանակալից ներդրման համար՝ բացառությամբ վաճառքները և չարթերում դիրքերը»:\\nԱռաջին անգամ տրվել է 1968 թվականին\` Գրեմմիի 10-րդ մրցանակաբաշխության ժամանակ, Բիթլզ խմբի «Sgt. Pepper’s Lonely Hearts Club Band» ալբոմին որպես «Լավագույն ժամանակակից ալբոմ»: Հետագայում մրցանակը չի հանձնվել մինչև 1995 թվականը, որտեղ այն հայտնվել է նոր անվամբ\` «Լավագույն փոփ ալբոմ»: 2001 թվականին մրցանակի անվանումը փոխվել է և անվանվել է «Լավագույն փոփ վոկալային ալբոմ»: Գրեմմիի 52-րդ մրցանակաբաշխության ժամանակ ղեկավարները հաղորդել են, որ մրցանակը տրվում է այն արտիստներին, «որոնց ալբոմները պարունակում են վերջերս ձայնագրված փոփ վոկալային երգերի առնվազն 51%-ը»:"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%86%D8%B1%D9%88%D9%86_%D9%84%D9%8A%D8%A8%D9%8A%D9%86%D8%A8%D9%8A%D8%B1%D8%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/2012_Paralympics_Women%27s_400m_T46_Victory_Ceremony.jpg","page_title":"انرون ليبينبيرج","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nانرون ليبينبيرج منافسه العاب قوى من جنوب افريقيا."},{"page_url":"https://hr.wikipedia.org/wiki/Microraptor","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Microraptor_gui_holotype.png","page_title":"Microraptor","context_page_description":"Microraptor je rod malenih dromeosaurida koji su imali četiri krila. U Liaoningu u Kini je pronađeno dvadesetak primjeraka. Potiču iz perioda rane krede, prije oko 120 milijuna godine.\\nKao i Archaeopteryx, Microraptor nam daje važne dokaze o evolucijskoj vezi između ptica i dinosaura. Microraptor je imao duga pokrivna pera koja su stvarala aerodinamične površine na rukama i repu, ali ih je također imao i na nogama. Ovo je navelo Xua da ga opiše kao \\"dinosaura s četiri krila\\" i da špekulira da je možda jedrio koristeći sva četiri krila za uzdizanje. Do sada su imenovane dvije vrste, M. zhaoianus i M. gui, ali je daljnje istraživanje predložilo da se svi primjerci svrstaju u jednu vrstu, M. zhaoianus. Cryptovolans pauli, još jedan dinosaur s četiri krila, možda je također vrsta Microraptora ili sinonim za M. zhaoianus.\\nMicroraptor je bio među najčešćim dinosaurima u svom ekosustavu i predstavlja ga više fosila od bilo kojeg drugog dromeosaurida, s možda više od 300 fosilnih primjeraka u raznim muzejskim kolekcijama."},{"page_url":"https://sh.wikipedia.org/wiki/Bijeli_tigar","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/72/Singapore_Zoo_Tigers.jpg","page_title":"Bijeli tigar","context_page_description":"Bijeli tigar je obojena varijanta bengalskog tigra. Može biti ostvarena samo ako oba roditelja imaju recesivne gene za bijelu boju. U prirodi su rijetki; može ih se naći samo u zoološkim vrtovima. Vjeruje se da je prvi bijeli tigar nađen 1951."},{"page_url":"https://uz.wikipedia.org/wiki/Bernaville","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/41/Map_commune_FR_insee_code_80086.png","page_title":"Bernaville","context_page_description":"Bernaville Fransiyaning Pikardiya mintaqasida joylashgan kommunadir. Somme departamenti Amiens tumani tarkibiga kiradi."},{"page_url":"https://es.wikipedia.org/wiki/Rosse_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/Rosse_lunar_crater_map.jpg","page_title":"Rosse (cráter)","context_page_description":"Rosse'' es un cráter de impacto lunar en forma de cuenco situado en la parte sur del Mare Nectaris. Al suroeste se halla el gran cráter inundado de lava Fracastorius.\\nEl interior del cráter tiene un albedo más alto que el mar lunar circundante, por lo que es fácilmente visible. Aunque carece de su propio sistema de marcas radiales, los rayos del distante cráter Tycho lo atraviesan. Pequeñas crestas se levantan sobre el mare entre Rosse y Fracastorius, situado al suroeste."},{"page_url":"https://de.wikipedia.org/wiki/Jaunjelgava","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b7/Daugava_pie_Jaunjelgavas.JPG","page_title":"Jaunjelgava","context_page_description":"Jaunjelgava ist eine Stadt in Lettland am linken Ufer der Daugava, sie liegt etwa 80 km südöstlich von Riga. Im Jahre 2016 zählte Jaunjelgava 2127 Einwohner."},{"page_url":"https://bs.wikipedia.org/wiki/Tvr%C4%91ava_Teo%C4%8Dak","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Teocak-Grad-i-dzamija.jpg","page_title":"Tvrđava Teočak","context_page_description":"Tvrđava Teočak nastala je u periodu srednjeg vijeka na području općine Teočak, u sjeveroistočnom dijelu Bosne i Hercegovine.\\nNalazi se na obroncima planine Majevice, u naselju Stari Teočak. Uz nju je Fethija džamija ili Božija kuća, sagrađena 1548. godine. Ispred džamije se nalaze i kamene kugle, čije se porijeklo i starost ne znaju.\\nKao dio župe Soli utvrđeni grad Teočak se u historijskim izvorima prvi put spominje 1432. u vezi sa srpskim despotom Đurađem Brankovićem. Potom je bio i glavni grad Nikole Iločkog, kojeg je Ugarska proglasila “bosanskim kraljem”, a u njemu je kratko stolovao i Matija Vojsalić, kojeg je Turska proglasila “kraljem Bosne”. U nedostatku historijskih izvora i arheoloških istraživanja, tvrđavu prate legende o zakopanom blagu, herojskim pogibijama i nesretnim ljubavima. Legenda kaže i da je građena istovremeno kada i tvrđava u Zvorniku i da je kamen do Zvornika prenošen rukama.\\nPretpostavlja se da je tadašnja tvrđava imala trougaonu osnovu, po ugledu na tvrđavu Smederevo. Danas je ostala samo jedna kula. Prije rata 1992-1995 tvrđava je bila spomenik pod zaštitom države."},{"page_url":"https://nl.wikipedia.org/wiki/Welvarend_Suzhou","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Xu_Yang_-_Examination_hall.jpg","page_title":"Welvarend Suzhou","context_page_description":"Welvarend Suzhou, oorspronkelijk Ontluikend leven in een luisterrijk tijdperk getiteld, is een Chinese schildering op handrol, die de hofschilder Xu Yang in 1759 voltooide. Het beeldt het dagelijkse leven van Suzhou af tijdens de Qing-dynastie. De schildering is uitgevoerd met Oost-Indische inkt en pigmenten op zijde en is 35,8 hoog en 1225 centimeter lang. Het bevindt zich in de collectie van het Provinciaal Museum Liaoning in Shenyang."},{"page_url":"https://sv.wikipedia.org/wiki/Stj%C3%A4rtflugor","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Europ%C3%A4ischenZweifl%C3%BCgeligen1790TafCCXX.jpg","page_title":"Stjärtflugor","context_page_description":"Stjärtflugor är en familj av tvåvingar. Stjärtflugor ingår i ordningen tvåvingar, klassen egentliga insekter, fylumet leddjur och riket djur. Enligt Catalogue of Life omfattar familjen Lonchaeidae 504 arter.\\nKladogram enligt Catalogue of Life och Dyntaxa:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Wappen_in_Vorarlberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Wappen_at_gaschurn.png","page_title":"Liste der Wappen in Vorarlberg","context_page_description":"Liste der Wappen in Österreich"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D0%B0_%D0%A1%D1%8C%D0%B5%D1%80%D1%80%D0%B0-%D0%9B%D0%B5%D0%BE%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Sierra_Leone-Mappa.gif","page_title":"Города Сьерра-Леоне","context_page_description":"Города Сьерра-Леоне — список наиболее крупных населённых пунктов Сьерра-Леоне. По данным интернет-сайта World Gazeteer, в Сьерра-Леоне есть 97 городов с численностью более 2 000 человек."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B8%AF%E7%81%A3%E9%81%93%E8%8A%B1%E5%9C%92","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Harbour_Road_Garden_Seats_area_201408.jpg","page_title":"港灣道花園","context_page_description":"港灣道花園是香港一個仿中國古式的園林公園，位於香港島灣仔港灣道，佔地約40,000平方呎，由康樂及文化事務署管理。"},{"page_url":"https://en.wikipedia.org/wiki/Transport_in_Pakistan","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Pakistan_Nationalhighways.PNG","page_title":"Transport in Pakistan","context_page_description":"Transport in Pakistan is extensive and varied, and serves a population of over 212.2 million people. In recent years, new national highways have been built, with the addition of motorways which have improved trade and logistics within the country. Pakistan's rail network owned by Pakistan Railways is also undergoing expansion in recent years. Airports and seaports have been built with the addition of foreign and domestic funding."},{"page_url":"https://eu.wikipedia.org/wiki/M%C3%B3nica_Oltra","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/M%C3%B2nica_Oltra_2015.jpg","page_title":"Mónica Oltra","context_page_description":"Mónica Oltra Jarque valentziar politikari ezkertiarra da. Iniciativa del Poble Valencià eta Coalició Compromís erakunde politikoetako bozeramalea da egun. 2007 urtetik Valentziar Gorteetan diputatua da. Diputatu izan den urteetan, ustelkeriaren eta murrizketa sozialen aurka erakutsitako jarreragatik nabarmendu da.\\nDatuak: Q3067773\\nMultimedia: Mónica Oltra"},{"page_url":"https://fi.wikipedia.org/wiki/Tateyama","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Tateyama_Station_%28Chiba%29%2C_nishiguchi.JPG","page_title":"Tateyama","context_page_description":"Tateyama on Japanin kaupunki Honshūn saarella Kantōn alueella Chiban prefektuurissa. Se sijaitsee prefektuurin lounaisosassa Tyynenmeren ja Uragan kanaalin rannikolla Bōsōn niemimaan eteläkärjessä. Kaupungin keskusta on rakentunut Tateyamanlahden pohjukan tasangolle, joka rajautuu etelässä Sunosakin niemeen. Tateyamassa on 44 915 asukasta ja sen pinta-ala on 110,15 neliökilometriä.\\nTateyama kehittyi historiallisesti satamakaupunkina. Keskiajalla aluetta hallitsi Satomi-klaani, joka rakennutti sinne linnan vuonna 1590. Sittemmin Edo-kaudella 1600–1800-luvuilla kaupunki oli pääosin suoraan Tokugawa-bakufun hallussa. Meiji-kaudelta lähtien Tateyamaan sijoitettiin keisarillisen Japanin laivaston toimintoja. Kaupunkioikeudet osana Japanin nykyistä kunnallishallintoa Tateyama sai vuonna 1939, kun Tateyama-Hōjōn, Funakatan ja Nagon maaseutukaupungit liitettiin yhteen. Kaupunkiin johtavan rautatieyhteyden valmistuttua vuonna 1914 Tateyama on kehittynyt rantalomakohteena. Turismin lisäksi merkittäviä elinkeinoja ovat kauppa, boniitin ja makrillin kalastus, Engraulis japonicus -kalojen vesiviljely, riisin, vihannesten ja koristekukkien viljely sekä maidon tuotanto."},{"page_url":"https://hu.wikipedia.org/wiki/Mary_(T%C3%BCrkmeniszt%C3%A1n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/TurkmenistanMaryMosque.jpg","page_title":"Mary (Türkmenisztán)","context_page_description":"Mari vagy türkménül: Mary város Türkmenisztán keleti részén, a Karakum-sivatag egyik kiterjedt oázisában, a Murgáb folyó mentén. Az azonos nevű régió székhelye. A város elődje, az ősi Merv egy fontos oázisváros volt a Selyemúton. Romjai a várostól keletre találhatók. A kulturális világörökség része."},{"page_url":"https://en.wikipedia.org/wiki/Iowa%E2%80%93Kosovo_National_Guard_Partnership","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Iowa_Kosovo_03.jpg","page_title":"Iowa–Kosovo National Guard Partnership","context_page_description":"The Iowa–Kosovo National Guard Partnership is one of 22 European partnerships that make-up the U.S. European Command State Partnership Program and one of 65 worldwide partnerships that make-up the National Guard State Partnership Program. The partnership was created on March 11, 2011 with the long-term goal of developing the Kosovo Security Force and fostering mutually-beneficial interests across all levels of society. Establishing a strong relationship with the government of Kosovo, this partnership represents a critical step toward the reform development of Kosovo's security forces along Euro-Atlantic standards. The relationship lead to a sister state agreement."},{"page_url":"https://pnb.wikipedia.org/wiki/%D9%85%D9%86%D9%85%D9%88%DB%81%D9%86_(%D8%B4%D8%A7%D8%B9%D8%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Manmohan_%2CPunjabi_writer_and_an_IPS_officer%2CPunjab%2CIndia.jpg","page_title":"منموہن (شاعر)","context_page_description":"من موہن پنجابی شاعر، نقاد اتے ناول کار اے۔ اس دے ناول نروان نوں 2013 ساہت اکیڈمی انعام ملیا اے۔ ایہہ اس دا پہلا ناول اے۔ اس وچّ اوہ \\"پچھلے کجھ ورھیاں وچ جیویا، پڑھیا تے ہنڈھایا اوہی حقیقت، فکشن راہیں ‘نروان’ دے پاٹھ روپ ’چ پاٹھکاں دے ساہمنے لیایا اے۔\\"کِتے وجوں من موہن بھارتی پولیس وچّ اک اچّ اہلکار اے"},{"page_url":"https://nl.wikipedia.org/wiki/Argiocnemis_rubescens","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Argiocnemis_rubescens_5492.jpg","page_title":"Argiocnemis rubescens","context_page_description":"Argiocnemis rubescens is een libellensoort uit de familie van de waterjuffers, onderorde juffers.\\nDe soort staat op de Rode Lijst van de IUCN als niet bedreigd, beoordelingsjaar 2009.\\nDe wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1877 door Selys."},{"page_url":"https://pl.wikipedia.org/wiki/NGC_881","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/NGC881_-_SDSS_DR14.jpg","page_title":"NGC 881","context_page_description":"NGC 881 – galaktyka spiralna, znajdująca się w gwiazdozbiorze Wieloryba. Odkrył ją William Herschel 10 września 1785 roku.\\nW galaktyce tej zaobserwowano do tej pory jedną supernową – SN 2011hk."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BC%8A%E6%8B%89%E5%85%8B%E5%9B%BD%E6%97%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Flag_of_Iraq_%281924%E2%80%931959%29.svg","page_title":"伊拉克国旗","context_page_description":"伊拉克國旗是曾經多次更換過圖案的國旗，自伊拉克於1921年建國以來，先後使用過4種不同的設計風格。現在的款式於1963年開始使用，國旗中間的阿拉伯文字الله اكبر據說是由前總統薩達姆在1991年海灣戰爭前夕親自所題，意為「真主至大」，2004年，文字由書寫體改為印刷體。2008年1月22日，伊拉克議會通過有效期一年的修改國旗的臨時法案，將旗上代表復興黨口號的3顆綠星除去。\\n由於「真主至大」是伊斯蘭教的重要短語，因此伊拉克人將國旗視為神聖，故此有一些重要規定：例如不可降半旗；在正式場合使用時，為避免背面的文字呈鏡面方向，需將兩面旗背對背縫在一起使用。\\n伊拉克國旗豎式懸掛時，注意紅色部分位於左側，且國旗中間的綠色「真主至大」阿拉伯文字也應拆分為兩行，並壓縮於國旗正中央。"},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B7%BC%EB%B3%B8%EC%A3%BC%EC%9D%98%EC%9E%90-%ED%98%84%EB%8C%80%EC%A3%BC%EC%9D%98%EC%9E%90_%EB%85%BC%EC%9F%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/LymanStewart.jpg","page_title":"근본주의자-현대주의자 논쟁","context_page_description":"근본주의자–현대주의자 논쟁 은 1920년대와 1930년대에 미국 북장로교회 안에서 분열을 말한다. 기독교의 근본적인 주제들에 대한 논쟁이었는데 성경의 권위, 예수의 십자가의 죽음, 예수의 부활, 대속에 대한 것들이었다. 두개의 세력으로 형성되어 전통적인 기독교 정통주의자인 복음주의자들과 시대에 맞게 변화된 신앙체계를 주장하는 현대주의자들이 충돌하였다. 첫번째 분열은개혁주의 기독교와 프린스턴 신학교가 중심이 되었는데 곧 미국 전체 기독교의 모든 교파로 퍼져나갔다. 처음에는 영향을 받지 않던 루터교회도 논쟁으로 분열되었다. 1930년 끝에서 신학적 자유주의를 지지하는 자들이 효과적으로 논쟁에서 승리하고 주된 개신교 신학교와 출판사를 지배하였다. 이에 주된 교단으로부터 탈퇴한 보수주의 기독교인들은 존더반 출판사와 바올라 대학교, 리버티 대학교, 달라스 신학교, 풀러 신학교, 그리고 웨스트민스터 신학교를 설립하였다. 1970년에 와서는 보수적 기독교의 남 침례교회와 장로교회가 다시 부활하였다."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%B0_%D0%9C%D0%B0%D1%80%D0%B8%D1%98%D0%B0_(%D0%98%D1%81%D1%82%D0%B0%D0%BD%D0%B1%D1%83%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/SaintMaryOfBlachernae20072612_01.jpg","page_title":"Црква Света Марија (Истанбул)","context_page_description":"Црквата Света Марија е христијански храм кој се наоѓа во Истанбул, Турција.\\nМалиот православен храм бил изграден во 1867 година, на местото на поранешен храм кој датирал од 5 век, и кој бил разрушен во 1434 година. Овој храм бил еден од најважните светелишта на православието.\\nЦрквата се наоѓа во Истанбул, во областа на Фатих."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B5%D1%84%D1%80%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Grefrath%2C_die_katholische_Pfarrkirche_Sankt_Laurentius_DmGr20_IMG_3124_2018-05-06_14.01.jpg","page_title":"Грефрат","context_page_description":"Грефрат — коммуна в Германии, в земле Северный Рейн-Вестфалия.\\nПодчиняется административному округу Дюссельдорф. Входит в состав района Фирзен. Население составляет 15 564 человека. Занимает площадь 30,98 км². Официальный код — 05 1 66 008.\\nКоммуна подразделяется на 4 сельских округа."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%B7%B1%E5%9C%B3%E5%B7%B4%E5%A3%AB%E8%B7%AF%E7%BA%BF%E5%88%97%E8%A1%A8/1-999%E5%8F%8AM%E5%AD%97%E5%A4%B4%E7%BA%BF%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/XBBQ_M235_1.jpg","page_title":"深圳巴士路线列表/1-999及M字头线路","context_page_description":"本列表列出所有于中国广东省深圳市境内营运的公共汽车线路中的M字头巴士。"},{"page_url":"https://es.wikipedia.org/wiki/Mimotonidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Gomphos.jpg","page_title":"Mimotonidae","context_page_description":"Mimotonidae es una familia extinta de mamíferos Glires, muy próxima a los lagomorfos aunque no dentro de este orden."},{"page_url":"https://gl.wikipedia.org/wiki/Universidade_de_Cantabria","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Santander.Universidad.Facultad.de.Ciencias.jpg","page_title":"Universidade de Cantabria","context_page_description":"A Universidade de Cantabria, fundada como Universidade de Santander, é unha universidade pública situada na comunidade autónoma de Cantabria. Ten quince centros distribuídos en tres campus, un localizado en Santander, outro situado en Torrelavega e un terceiro en Comillas. No curso 2015-2016 contaba con 13 454 alumnos, 1 273 profesores e 1 088 persoas en administración e servizos. O seu orzamento para o ano 2016 ascendía a 105 974 462 €. A Universidade de Cantabria obtivo a cualificación definitiva como Campus de Excelencia Internacional polo Goberno de España en decembro de 2014.\\nForma parte como membro fundador do Grupo 9 de Universidades españolas, creado en 1997 co obxectivo de promover a colaboración entre as institucións universitarias que o integran, tanto no que respecta ás actividades docentes e investigadoras como ás de xestión e servizos.\\nAnualmente a UC publica a súa memoria de actividades."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1923","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Charles_Yeager_photo_portrait_head_on_shoulders_left_side.jpg","page_title":"Lijst van personen geboren in 1923","context_page_description":"Dit is een lijst van personen die geboren zijn in 1923.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%AD%E3%83%BC%E3%83%86%E3%83%BB%E3%83%9E%E3%83%AB%E3%82%AF%E3%83%88_(%E3%82%A2%E3%83%B3%E3%83%88%E3%82%A6%E3%82%A7%E3%83%AB%E3%83%9A%E3%83%B3)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Het_stadshuis_%28The_city_hall%29.jpg","page_title":"グローテ・マルクト (アントウェルペン)","context_page_description":"グローテ・マルクト は、ベルギー・アントウェルペンの旧市街地内に位置する広場。サイケルライ の通りを経由すれば、スヘルデ川も徒歩圏にある。この広場に面して、ギルドハウス がいくつも立ち並んでいる。\\n日本語では、音写表記の揺れによる「フローテマルクト広場」などのほか、「マルクト広場」、「市庁舎前広場」として言及されることもある。"},{"page_url":"https://pl.wikipedia.org/wiki/Mandryl_r%C3%B3wnikowy","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1f/Drill_male.png","page_title":"Mandryl równikowy","context_page_description":"Mandryl równikowy, dryl – gatunek ssaka z rodziny koczkodanowatych, blisko spokrewniony z mandrylem barwnolicym, od którego różni się głównie jednolitym ubarwieniem twarzy."},{"page_url":"https://cs.wikipedia.org/wiki/Jo%C5%BEe_Ple%C4%8Dnik","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Le_triple_pont_%28Ljubljana%29_%289380933958%29.jpg","page_title":"Jože Plečnik","context_page_description":"Jože Plečnik, v Česku známý spíše jako Josip Plečnik, byl slovinský architekt a urbanista, který svou prací ve 20. a 30. letech 20. století pro československou prezidentskou kancelář významně přispěl k současnému vzhledu Pražského hradu."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83%D1%80%D0%B8%D0%B7%D0%BC_%D0%B2_%D0%90%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D1%82%D0%B8%D0%B4%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Basler_south_pole_2.jpg","page_title":"Туризм в Антарктиде","context_page_description":"Туризм в Антарктиде начался с организации морских круизов в 1960-х годах, включая поездки на частных яхтах с конца 1960-х. Авиаперелёты в Антарктиду начались в 1970-х годах с экскурсионных полетов из Австралии и Новой Зеландии, и были возобновлены в 1990-х годах. Туристический сезон в Антарктиде проходит во время лета в Южном полушарии и длится с ноября по март. В сезон 1999/2000 годов Антарктиду посетило 14762 туриста, большинство из них — в морских круизах, в сезон 2009/2010 годов — почти 40 тысяч туристов."},{"page_url":"https://sv.wikipedia.org/wiki/Mikul%C4%8Dice","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c2/Mikul%C4%8Dice_vlajka.jpg","page_title":"Mikulčice","context_page_description":"Mikulčice är en ort i Tjeckien. Den ligger i kommunen Okres Hodonín och länet Södra Mähren, i den sydöstra delen av landet, 240 km sydost om huvudstaden Prag. Mikulčice ligger 163 meter över havet och antalet invånare är 1 881.\\nTerrängen runt Mikulčice är platt. Den högsta punkten i närheten är 200 meter över havet, 1,1 km nordväst om Mikulčice. Runt Mikulčice är det ganska tätbefolkat, med 83 invånare per kvadratkilometer. Närmaste större samhälle är Hodonín, 7,0 km nordost om Mikulčice. Trakten runt Mikulčice består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 9 °C. Den varmaste månaden är juli, då medeltemperaturen är 22 °C, och den kallaste är januari, med -6 °C. Genomsnittlig årsnederbörd är 841 millimeter. Den regnigaste månaden är september, med i genomsnitt 103 mm nederbörd, och den torraste är mars, med 42 mm nederbörd."},{"page_url":"https://no.wikipedia.org/wiki/Egg","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Sea_urchin_eggs.jpg","page_title":"Egg","context_page_description":"Egg er en ikke-bevegelig forplantningsstruktur der fosterutviklingen foregår, og som ikke mottar næring fra moren etter at den er ferdig dannet. Begrepet egg brukes bare om eggceller i dyreriket. Tilsvarende forplantningsstrukturer i andre riker kalles sporer eller frø.\\nEgget består i utgangspunktet av én eneste celle, eggcellen, som befruktes av en spermie. Unntaket er partenogenetiske arter, der egget får et fullt gensett på andre måter. Befruktningen kan skje internt i morens kropp eller ekstern i vannmassene. Hos de fleste dyregrupper vil et egg ha en form for ytre hinne eller skall og plomme i tillegg til selve eggcellen.\\nDen relative mengden plomme vil påvirke hvordan cellekløyvingen kan dele opp egget. Bare egg med lite plomme jevnt fordelt i egget kan gjennomføre full celledeling; i egg med mye plomme vil fosteret dannes på toppen av plommen og først senere omslutte plommemassen. Mengden plomme og delingsmønstrene er typiske trekk ved forskjellige dyregrupper. Typen egg avgjør hvor lenge fosterutviklingen kan vare og derved hvilke dyregrupper som vil ha et larvestadie og hvilke som vil ha direkte utvikling.\\nDyr som legger frie egg kalles eggleggende."},{"page_url":"https://it.wikipedia.org/wiki/Rete_tranviaria_di_Reims","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Tramway_de_Reims.jpg","page_title":"Rete tranviaria di Reims","context_page_description":"La rete tranviaria di Reims è la rete tranviaria che serve la città francese di Reims. È composta da due linee."},{"page_url":"https://en.wikipedia.org/wiki/List_of_palaces_and_manor_houses_in_Estonia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/K%C3%B5ima_m%C3%B5isa_peahoone.jpg","page_title":"List of palaces and manor houses in Estonia","context_page_description":"This is the List of palaces and manor houses in Estonia. This list does not include castles, which are listed in a separate article. As there are at least 400 manor houses in Estonia, this list is incomplete."},{"page_url":"https://it.wikipedia.org/wiki/Monumenti_degli_scavi_archeologici_di_Ercolano","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Terrazza_di_Marco_Nonio_Balbo_1.JPG","page_title":"Monumenti degli scavi archeologici di Ercolano","context_page_description":"Nella lista seguono i monumenti degli scavi archeologici di Ercolano."},{"page_url":"https://ceb.wikipedia.org/wiki/Terradillos_de_Esgueva_(munisipyo)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/TerradillosDeEsgueva20110909104307P1130348.jpg","page_title":"Terradillos de Esgueva (munisipyo)","context_page_description":"Munisipyo ang Terradillos de Esgueva sa Espanya. Nahimutang ni sa lalawigan sa Provincia de Burgos ug rehiyon sa Castilla y León, sa sentro nga bahin sa nasod, 150 km sa amihanan sa Madrid ang ulohan sa nasod. Adunay 104 ka molupyo.\\nAng klima baybayon. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Disyembre, sa 1 °C. Ang kasarangang pag-ulan 735 milimetro matag tuig. Ang kinabasaan nga bulan Abril, sa 88 milimetro nga ulan, ug ang kinaugahan Agosto, sa 10 milimetro."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%8C%A2%E5%90%89%E8%AB%BE%E6%8B%89%E5%8D%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/El_Empame_Changuinola.JPG","page_title":"錢吉諾拉區","context_page_description":"錢吉諾拉區，是巴拿馬的一個行政區，位於該國西北部，由博卡斯德爾托羅省負責管轄，始建於1970年，面積4,016.5平方公里，2010年人口82,604，人口密度每平方公里20.57人。"},{"page_url":"https://ur.wikipedia.org/wiki/%D9%84%D8%A7%D8%A8%D8%B1%D8%A7%DA%88%D9%88%D8%B1%D8%8C_%D9%BE%D8%A7%D9%86%DA%AF%D8%A7%D8%B3%DB%8C%D9%86%D8%A7%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Ph_locator_pangasinan_labrador.png","page_title":"لابراڈور، پانگاسینان","context_page_description":"لابراڈور، پانگاسینان فلپائن کا ایک رہائشی علاقہ جو ایلوکوس علاقہ میں واقع ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Faune_d%27Iran","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Gr%C3%BCnspecht_Picus_viridis.jpg","page_title":"Faune d'Iran","context_page_description":"Étant donnée la grande taille du pays et les variétés climatiques dues à des facteurs divers les différences d'altitude, le niveau des précipitations et de l'évaporation, les types de sols etc. le territoire de l'Iran possède une grande quantité de biomes et de biotopes, ce qui revient à dire une importante variété dans la flore et la faune autochtone."},{"page_url":"https://en.wikipedia.org/wiki/Volkmann%27s_canals","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Osso_por_Descalcifica%C3%A7%C3%A3o2_%E2%80%93_HE_%E2%80%93_100x.JPG","page_title":"Volkmann's canals","context_page_description":"Volkmann's canals, also known as perforating holes or channels, are anatomic arrangements in cortical bones. Volkmann's canals are inside osteons. They interconnect the haversian canals with each other and the periosteum. They usually run at obtuse angles to the haversian canals and contain anastomosing vessels between haversian capillaries. They were named after German physiologist Alfred Volkmann.\\nVolkmann's canals are any of the small channels in the bone that transmit blood vessels from the periosteum into the bone and that communicate with the haversian canals.\\nThe perforating canals provide energy and nourishing elements for osteons."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%B7%B4%E8%A5%BF%E6%B5%B7%E8%BB%8D%E8%88%AA%E7%A9%BA%E5%85%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/SH-3s_USN_Brazil_1987.JPEG","page_title":"巴西海軍航空兵","context_page_description":"巴西海军航空兵 是巴西海军的航空部队。这支部队是在1916年8月后，由海军航空学校所训练的航空舰队它的任务包括保护航母，舰队防空，侦察，海洋运筹和反潜作战。它还负责支援巴西海军陆战队的空中作战。"},{"page_url":"https://da.wikipedia.org/wiki/U_20","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/U_20_grounded_Denmark_1916.JPG","page_title":"U 20","context_page_description":"U 20 var en tysk ubåd, der blev søsat den 18. december 1912 på værftet i Danzig, i dag Gdańsk.\\nDet var en dobbeltskroget, oceangående ubåd, der var blandt de første undervandsbåde med dieselmotorer.\\nU 20's aktionsområde lå i Atlanterhavet vest for England og Irland. I december 1914 blev kaptajn Walther Schwieger chef for ubåden. Han nåede som chef for U 20 at sænke 36 skibe med en samlet tonnage på 144.300 tons, heraf det 31.550 tons tunge passagerskib RMS Lusitania i 1915.\\nU 20 endte sine dage med en grundstødning ved den jyske vestkyst ved Harboøre kyst ud for Vejlby 4. november 1916 ved ca. 22-tiden. Her blev den sprængt dagen efter lidt over kl. 12 af bådens egen besætning, idet man lod en af bådens torpedoer eksplodere inde i selve ubåden.\\nI 1925 besluttede Marineministeriet, at vraget af U 20 skulle bortsprænges af hensyn til navigationssikkerheden, som det hed sig, og med hjælp fra 600 kg sprængstof lykkedes det at fjerne de historiske rester fra havets overflade.\\nI dag kan flere effekter fra ubåden beses på Strandingsmuseet i Thorsminde, herunder en 88 mm kanon."},{"page_url":"https://en.wikipedia.org/wiki/Gary_Moore","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Gary_Moore_2010-11-23_01_25_9152.jpg","page_title":"Gary Moore","context_page_description":"Robert William Gary Moore was a Northern Irish musician and singer-songwriter. Over the course of his career, Moore played in various groups and performed many different styles of music, including blues, heavy metal, hard rock and jazz fusion.\\nMoore began his career in the late 1960s when he joined Skid Row, with whom he released two albums. After Moore left the group, he joined Thin Lizzy, which featured his former Skid Row bandmate and frequent collaborator Phil Lynott. Moore began his solo career in the 1970s, achieving his first major success with 1978's \\"Parisienne Walkways\\", which is considered his signature song. During the 1980s, Moore transitioned into playing hard rock and heavy metal with varying degrees of success around the world. By the decade's end, however, he had grown tired of his own music and decided to return to his roots with 1990's Still Got the Blues, which became the most successful album of his career. Moore continued to release new music consistently throughout the rest of his career, as well as collaborate with other artists from time to time. Moore died on 6 February 2011 from a heart attack while on vacation in Spain."},{"page_url":"https://nl.wikipedia.org/wiki/Johannes_Hunyadi","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Coa_Hungary_Family_Hunyadi_J%C3%A1nos_Extended_%281453%29.svg","page_title":"Johannes Hunyadi","context_page_description":"Johannes Hunyadi was een Hongaars veldheer en staatsman.\\nHunyadi was de zoon van Vajk en Elisabeth Morsinai. Vajk was een Wallachijse heer die in 1409 door Sigismund van Luxemburg in de Hongaarse adelstand werd geheven en begiftigd werd met het comitaat Hunyad in Transsylvanië. Johannes dankt zijn familienaam aan het district dat zijn vader van Sigismund ten geschenke kreeg.\\nIn zijn jonge jaren onderscheidde Johannes Hunyadi zich als ridder van Sigismund en zijn opvolger koning Albrecht van Habsburg zo zeer in de strijd tegen de Turken dat hij zeer veel landgoed en titels verwierf. Toen koning Albrecht in het jaar 1439 overleed, waren de Hongaarse magnaten verdeeld over wie Albrecht zou opvolgen: Albrechts zoon Ladislaus Posthumus of de Poolse koning Władysław III. Johannes steunde de kandidatuur van de Poolse koning terwijl zijn aartsrivaal Ulrich van Cilli de kant van Ladislaus Posthumus koos. Uiteindelijk werd de Poolse koning Władysław in 1440 koning van Hongarije en Johannes sloeg de daaropvolgende opstand van de Ladislaus Posthumus gezinde edelen neer."},{"page_url":"https://fi.wikipedia.org/wiki/Nokia_105","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Nokia_105_%282015%29.jpg","page_title":"Nokia 105","context_page_description":"Nokia 105 on Nokian toukokuussa 2013 esittelemä matkapuhelin."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%B8%D6%82%D5%BD%D5%A5%D5%AC%D5%AB%D5%A1_%D5%8D%D5%A1%D5%B6%D5%A9%D5%B8%D6%82%D5%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Lucelia_Santos_9_cropped.jpg","page_title":"Լուսելիա Սանթուս","context_page_description":"Լուսելիա Սանթուս, բրազիլացի դերասանուհի և պրոդյուսեր:"},{"page_url":"https://fi.wikipedia.org/wiki/Luettelo_Nobelin_fysiologian_tai_l%C3%A4%C3%A4ketieteen_palkinnon_saaneista","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Ronald_Ross.jpg","page_title":"Luettelo Nobelin fysiologian tai lääketieteen palkinnon saaneista","context_page_description":"Tämä on luettelo Nobelin fysiologian tai lääketieteen palkinnon saaneista. Luettelo on kronologinen."},{"page_url":"https://de.wikipedia.org/wiki/Laurin_%26_Klement","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/Laurin_%26_Klement_Typ_TI_1903.jpg","page_title":"Laurin & Klement","context_page_description":"Laurin & Klement war ein Fahrrad-, Motorrad- und Automobilhersteller in Böhmen und der Tschechoslowakei, der 1925 vom Maschinenbauer Škoda übernommen und in Laurin & Klement – Škoda, später nur Škoda, umbenannt wurde."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D1%80%D0%B5%D0%BC%D0%B1%D0%B5%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Aremberg.jpg","page_title":"Аремберг","context_page_description":"Аремберг — громада в Німеччині, розташована в землі Рейнланд-Пфальц. Входить до складу району Арвайлер. Складова частина об'єднання громад Аденау.\\nПлоща — 9,62 км². Населення становить 226 ос."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_munic%C3%ADpios_do_Brasil_por_empresas_ativas","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Bandeira_de_Goian%C3%A9sia.jpg","page_title":"Lista de municípios do Brasil por empresas ativas","context_page_description":"Esta é uma lista dos municípios do Brasil classificados por empresas ativas existentes até 18 de novembro de 2016 segundo o site Empresômetro. Todos os municípios desta lista tem mais de 4.200 empresas ativas."},{"page_url":"https://tr.wikipedia.org/wiki/G%C3%BCrcistan_ba%C5%9Fbakan%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Noeramishvilipic.jpg","page_title":"Gürcistan başbakanı","context_page_description":"Gürcistan başbakanı, Gürcistan Parlamentosu tarafından seçilip Gürcistan devlet başkanı tarafından atanan Gürcistan Bakanlar Kurulunun en kıdemli bakanıdır. Gürcistan Hükûmeti Başkanının resmi unvanı tarih boyunca değişmiştir, ancak liderin görev ve işlevleri sadece marjinal olarak değişmiştir. Gürcistan'ın ilk başbakanı Noe Ramişvili, görevdeki başbakanı Mamuka Bakhtadze'dir. Gürcistan'da 1918 yılından beri 39 başbakan değişmiştir.\\nBaşbakanlık kurumu, 1918'de Gürcistan Demokratik Cumhuriyeti'nin bağımsızlık ilanından kısa bir süre sonra kuruldu. Gürcistan Demokratik Cumhuriyeti'nin varlığı sırasında başbakanlık görevi, hükûmet başkanı olarak adlandırıldı. Sovyet birlikleri Gürcistan'a girdikten sonra başbakanlık kaldırıldı, bunun yerine Halk Komiserleri Konseyi Başkanı ardından da Bakanlar Kurulu Başkanı olarak adlandırıldı. Modern bir anlayışla, başbakanlık görevi Ağustos 1991'de restore edilmiş, ancak Aralık 1995'te kaldırılmıştır. Başbakanlık görevi yerine, Devlet Bakanlığı görevi getirildi. 6 Şubat 2004'te anayasa reformları gerçekleştirildi, sonuç olarak, Bakanlar Kurulu ve Başbakanlık kurumu restore edildi."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D1%80%D0%B8%D0%BB%D1%8C%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Torre_Insignia%2C_desde_la_Torre_Latinoamericana.JPG","page_title":"Карильон","context_page_description":"Карильон — механический музыкальный инструмент, распространённый в Европе и обычно устанавливаемый на колокольнях или муниципальных зданиях. Инструмент содержит не менее 23 бронзовых колоколов, которые ударяются поочерёдно или аккордами. На традиционном карильоне играют с помощью клавиатуры, представляющей собой набор рычагов по которым ударяют кулаками, а также педальной клавиатуры. Рычаги с помощью проволочных тяг связаны с языками колоколов, позволяя исполнителю менять громкость ноты в зависимости от силы, приложенной к клавише.\\nИнструмент является одним из самых тяжёлых, уступая только духовым органам.\\nСамый тяжёлый карильон в мире находится в Нью-Йорке в Риверсайдской церкви, его колокольный набор весит 91 тонну.\\nИнструмент может работать в автоматическом режиме посредством музыкального барабана со штифтами, расположение которых определяет время и высоту исполняемых нот. При вращении барабана штифты приводят в действие рычаги, которые связаны с колоколами, за счёт чего и происходит исполнение заданной мелодии. Такой барабан может соединяться с часовым механизмом, что даёт возможность перед боем часов воспроизводить короткие мелодии."},{"page_url":"https://fr.wikipedia.org/wiki/Chevaliers_de_la_couronne","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Antoine_Philippe_de_La_Tr%C3%A9moille%2C_Prince_of_Talmont_by_L%C3%A9on_Cogniet_%28Mus%C3%A9e_d%27art_et_d%27histoire_de_Cholet%29.jpg","page_title":"Chevaliers de la couronne","context_page_description":"Les Chevaliers de la couronne sont une unité de cavalerie de l'Armée de Condé. Ils ont l'habit bleu liseré de rouge de la cavalerie noble, à une seule rangée de boutons dorés, gilet, ceinturon, culotte blanche, casque or couvert de peau de phoque de Kerguelen et fourrure de panthère, queue et pompons. Le premier nom exact de ce corps est Chevaliers-dragons de la couronne? de 1791 à 1795."},{"page_url":"https://no.wikipedia.org/wiki/Magnus_av_%C3%98sel","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f8/Magnus_1563.jpg","page_title":"Magnus av Øsel","context_page_description":"Prins Magnus eller Magnus av Øsel, prins av Danmark-Norge, hertug av Holsten, fyrstbiskop av Øsel-Wiek, konge av Livland, nest eldste sønn av kong Christian III og dronning Dorothea av Sachsen-Lauenburg."},{"page_url":"https://zh.wikipedia.org/zh-tw/CD4%E5%8F%97%E4%BD%93","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/46/T_Cell_Surface_Glycoprotein_CD4_-_PDB_1CDH.jpg","page_title":"CD4受体","context_page_description":"CD4受體，全稱「表面抗原分化簇4受體」。在分子生物中，CD4是免疫細胞表面的醣蛋白分子。它在1970年代晚期被發現，在1984年以前被稱為leu-3和T4。人類的CD4蛋白質是由CD4基因所製造。\\nCD4受體是輔助T細胞的表面標記之一，也是輔助T細胞行使其功能的重要受體。當抗原呈遞細胞將外來病菌分解，把抗原與主要組織相容性複合體結合後，呈遞給輔助T細胞，輔助T細胞再接著刺激B細胞產生抗體，此即體液性免疫反應的基本過程。\\nCD4+的輔助T細胞在人類免疫系統中為極重要的白血球。它們通常被稱為「CD4細胞」、「輔助T細胞」或「T4細胞」。它們被稱為「輔助細胞」是因為其中一個主要功能是將訊號送到其他免疫細胞，包括可以殺死感染細胞的CD8胞殺細胞。如果沒有CD4細胞，人體將無法對抗大量的病原菌並暴露於危險中。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BB%D0%BE%D1%89%D0%B0_%D0%9F%D0%B5%D1%80%D0%B5%D0%BC%D0%BE%D0%B3%D0%B8_(%D1%81%D1%82%D0%B0%D0%BD%D1%86%D1%96%D1%8F_%D0%BC%D0%B5%D1%82%D1%80%D0%BE,_%D0%9C%D1%96%D0%BD%D1%81%D1%8C%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Ppobedy_06.jpg","page_title":"Площа Перемоги (станція метро, Мінськ)","context_page_description":"Пло́ща Перемо́ги — станція Мінського метрополітену Московської лінії. Розташована між станціями «Жовтнева» та «Площа Якуба Коласа». Відкрита 30 червня 1984 року у складі першої ділянки метрополітену."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%BB%B6%E6%9A%A6%E5%AF%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Enryakuji_Kaidanin01n3200.jpg","page_title":"延暦寺","context_page_description":"延暦寺は、滋賀県大津市坂本本町にあり、標高848mの比叡山全域を境内とする寺院。比叡山、または叡山と呼ばれることが多い。平安京の北にあったので南都の興福寺と対に北嶺とも称された。平安時代初期の僧・最澄により開かれた日本天台宗の本山寺院である。住職は天台座主と呼ばれ、末寺を統括する。1994年には、古都京都の文化財の一部として、ユネスコ世界文化遺産にも登録された。寺紋は天台宗菊輪宝。"},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9B%E1%83%9D%E1%83%9C%E1%83%A2%E1%83%94%E1%83%9C%E1%83%94%E1%83%92%E1%83%A0%E1%83%9D%E1%83%A1_%E1%83%90%E1%83%93%E1%83%9B%E1%83%98%E1%83%9C%E1%83%98%E1%83%A1%E1%83%A2%E1%83%A0%E1%83%90%E1%83%AA%E1%83%98%E1%83%A3%E1%83%9A%E1%83%98_%E1%83%93%E1%83%90%E1%83%A7%E1%83%9D%E1%83%A4%E1%83%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/Municipalities_of_Montenegro.svg","page_title":"მონტენეგროს ადმინისტრაციული დაყოფა","context_page_description":"მონტენეგრო ადმინისტრაციულად შედგება 23 მუნიციპალიტეტის, ძველი სამეფო დედაქალაქი ცეტინიეს და დედაქალაქ პოდგორიცისაგან. პოდგორიცას თავის მხრივ გააჩნია ორი ქვედანაყოფი — ურბანული მუნიციპალიტეტები.\\nბოლო დროს შექმნილი:\\nპეტნიცა\\nგუსინიე\\nურბანული მუნიციპალიტეტები:\\nპოდგორიცის მუნიციპალიტეტი\\nგოლუბოვცი\\nტუზი"},{"page_url":"https://ba.wikipedia.org/wiki/%D2%A0%D0%BE%D1%8F%D1%88_%D1%8D%D0%BD%D0%B5%D1%80%D0%B3%D0%B5%D1%82%D0%B8%D0%BA%D0%B0%D2%BB%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/SolarGIS-Solar-map-Europe-en.png","page_title":"Ҡояш энергетикаһы","context_page_description":"Ҡояш энергетикаһы — ҡояш нурында булған энергия. Был энергияны кешелек меңдәрсә йылдар элек төрлө ысулдар менән файҙаланған. Йылытыу, кулинария, киптереүҙән тыш, бөгөн ҡояш энергияһынан электр, алыҫ райондарҙа һәм космоста файҙаланыу өсөн электр энергияһы алына. Ҡояштан электр энергияһын алыу күп осраҡта осһоҙораҡ, күмер йәки нефть яндырыуға ҡарағанда конкуренцияға һәләтлерәк булып сыға."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%85%E4%BC%AF%E7%89%B9%C2%B7%E5%A4%9A%E5%BE%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Robert_Dold_official_portrait_114th_Congress.jpg","page_title":"羅伯特·多德","context_page_description":"小罗伯特·詹姆斯·多德是美国的一位政治人物。自2015年开始，他是伊利诺伊州第10选举区选出的美国众议院议员。他的党籍是共和党。在他当选议员之前，多德是一位商人，经营自己的公司。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Bergwerken_im_Saarland","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/R%C3%B6sche_Gresaubach.jpg","page_title":"Liste von Bergwerken im Saarland","context_page_description":"Die Liste von Bergwerken im Saarland führt die Gruben, Bergwerke, Stollen und andere unter das Bergrecht fallende Betriebspunkte im Saarland auf. Der Bergbau im Saarland existierte bereits in keltischer Zeit und ist seit 1429 urkundlich nachgewiesen. Überwiegend wurde Steinkohle abgebaut. Mit der einsetzenden Industrialisierung Deutschlands ab 1850 sorgte die stark gestiegene Nachfrage nach Kohle für eine enorme Ausdehnung des Bergbaus an der Saar. Im Juni 2012 endete der Bergbau im Saarland mit der Schließung des Bergwerks Saar."},{"page_url":"https://it.wikipedia.org/wiki/Aston_Martin_Racing","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Blancpain_Endurance_Series_-_Aston_Martin_DBRS9_-_011.jpg","page_title":"Aston Martin Racing","context_page_description":"L'Aston Martin Racing è il reparto sportivo della casa automobilistica britannica Aston Martin."},{"page_url":"https://de.wikipedia.org/wiki/F%C3%A4hre_Sandau","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Sandau_Faehre_2015.jpg","page_title":"Fähre Sandau","context_page_description":"Die Fähre Sandau ist eine Gierfähre über die Elbe bei Sandau in Sachsen-Anhalt."},{"page_url":"https://it.wikipedia.org/wiki/Forte_Lisser","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Forte_Lisser_2017.jpg","page_title":"Forte Lisser","context_page_description":"Il forte Lisser è stata una fortezza militare costruita a difesa del confine italiano contro l'Impero austro-ungarico a 1.633 metri di altitudine, sulla sommità dell'omonimo monte. Il forte si trova nel territorio comunale di Enego, in provincia di Vicenza."},{"page_url":"https://hu.wikipedia.org/wiki/Bol%C3%ADvia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Cactos_Ilha_do_Pescado.jpg","page_title":"Bolívia","context_page_description":"Bolívia ország Dél-Amerikában. Északon és keleten Brazíliával, délen Paraguayjal és Argentínával, nyugaton Chilével és Peruval határos.\\nBelvidéki ország, azaz nincs tengerpartja. 1879-ig volt tengeri kijárata a Csendes-óceánra Chile és Peru között, de ezt a területet a chilei kormány erőszakkal elvette az ott található guanólelőhely miatt.\\nBolívia a legek országa:\\na világ egyik legmagasabban fekvő nagyvárosa, a korábbi főváros: La Paz\\na világ legmagasabban fekvő hajózható tava: Titicaca-tó\\na Föld legkiterjedtebb sósivataga: Salar de Uyuni\\nDél-Amerikában itt a legnagyobb az indián őslakosság aránya\\nDél-Amerika legszegényebb országa"},{"page_url":"https://en.wikipedia.org/wiki/Palio_di_Legnano","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Corso-garibaldi.jpg","page_title":"Palio di Legnano","context_page_description":"The Palio di Legnano is a folk event generally held on the last Sunday of May in the City Of Legnano, Italy, to recall the Battle of Legnano held on May 29, 1176 by the Lombard League and the Holy Roman Empire of Frederick Barbarossa. This Palio is composed by a medieval pageant and a horse race. Until 2005 the whole event was named Sagra del Carroccio.\\nLegnano is subdivided into eight contrade, each of which takes part both in the medieval pageant and in the horse race held at the stadio Giovanni Mari. This is considered one of the most important non-competitive events of this type in Italy. In 2003 the historic pageant was shown at the Columbus Day in New York City.\\nA lot of Palio-centric events take place in Legnano during May and July, such as the choral exhibition La Fabbrica del Canto '' born in 1992 from an idea of the musical association Jubilate. In 2015, institutions made 29 May a holiday for the whole of Lombardy."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D1%83-141","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Tu-141-5222.JPG","page_title":"Ту-141","context_page_description":"Ту-141 «Стриж» — многоразовый советский оперативно-тактический разведывательный беспилотный летательный аппарат разработки ОКБ им. Туполева, входил в состав комплекса ВР-2 «Стриж»."},{"page_url":"https://en.wikipedia.org/wiki/Ringgold_County,_Iowa","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/02/USA_Ringgold_County%2C_Iowa_age_pyramid.svg","page_title":"Ringgold County, Iowa","context_page_description":"Ringgold County is a county located in the U.S. state of Iowa. As of the 2010 census, the population was 5,131, making it the Iowa county with the second-smallest population. The county seat is Mount Ayr. The county is named after Maj. Samuel Ringgold, a hero of the Battle of Palo Alto fought in May 1846, during the Mexican–American War. It is one of the 26 Iowa counties with a name that is unique across the nation."},{"page_url":"https://en.wikipedia.org/wiki/Paleontology_in_Oregon","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Oncorhynchus_rastrosus.JPG","page_title":"Paleontology in Oregon","context_page_description":"Paleontology in Oregon refers to paleontological research occurring within or conducted by people from the U.S. state of Oregon. Oregon's geologic record extends back approximately 400 million years ago to the Devonian period, before which time the state's landmass was likely submerged under water. Sediment records show that Oregon remained mostly submerged until the Paleocene period. The state's earliest fossil record includes plants, corals, and conodonts. Oregon was covered by seaways and volcanic islands during the Mesozoic era. Fossils from this period include marine plants, invertebrates, ichthyosaurs, pterosaurs, and traces such as invertebrate burrows. During the Cenozoic, Oregon's climate gradually cooled and eventually yielded the environments now found in the state. The era's fossils include marine and terrestrial plants, invertebrates, fish, amphibians, turtles, birds, mammals, and traces such as eggs and animal tracks.\\nOregon has a long tradition of paleontological research. Local Native Americans devised myths to explain fossils."},{"page_url":"https://en.wikipedia.org/wiki/Wyrzysk","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Synagoga_w_Wyrzysku%2C_m.JPG","page_title":"Wyrzysk","context_page_description":"Wyrzysk is a town in Poland with 5,263 inhabitants, situated in Piła County, Greater Poland Voivodeship."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%95%D1%80-%D0%95%D1%80%D0%BA%D0%B5%D0%BD%D1%88%D0%B2%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Oer-Erkenschwick_Rathaus.jpg","page_title":"Ер-Еркеншвик","context_page_description":"Ер-Еркеншвик град је у њемачкој савезној држави Северна Рајна-Вестфалија. Једно је од 10 општинских средишта округа Реклингхаузен. Према процјени из 2010. у граду је живјело 30.303 становника. Посједује регионалну шифру 5562028, NUTS и LOCODE код."},{"page_url":"https://sv.wikipedia.org/wiki/Garat,_Charente","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Map_commune_FR_insee_code_16146.png","page_title":"Garat, Charente","context_page_description":"Garat är en kommun i departementet Charente i regionen Nouvelle-Aquitaine i västra Frankrike. Kommunen ligger i kantonen Soyaux som ligger i arrondissementet Angoulême. År 2009 hade Garat 1 838 invånare."},{"page_url":"https://fi.wikipedia.org/wiki/Kristinuskon_historia","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Christianity_dev_1300.jpg","page_title":"Kristinuskon historia","context_page_description":"Kristinuskon historia alkoi ensimmäisellä vuosisadalla Rooman valtakunnassa. Kristinusko perustuu Jeesus Kristukseen, joka ristiinnaulittiin Jerusalemissa noin vuonna 30. Jeesuksen seuraajat jatkoivat hänen kuoltuaan hänen opetustensa noudattamista ja ryhtyivät julistamaan hänen ylösnousemistaan. Tärkeimpiä kristinuskon varhaisista levittäjistä oli Paavali.\\nKristinusko keräsi kannattajia Rooman valtakunnassa ja erkaantui juutalaisuudesta. Siitä tuli Rooman valtionuskonto vuonna 390. Kristinuskon pyhäksi kirjaksi koottiin Raamattu ja Uusi testamentti.\\nKeskiajalla 1000-luvulla kristinusko jakaantui läntiseen katoliseen kirkkoon, jota johtaa paavi, ja itäiseen ortodoksiseen kirkkoon. Katolisesta kirkosta erkaantui 1500-luvun uskonpuhdistuksessa protestanttinen liike.\\nKristinusko levisi 1400-luvulta alkaen Välimeren seudulta ja Euroopasta myös Afrikkaan, Aasiaan ja Amerikkaan. Nykyajan kristinuskoa luonnehtii hyvin voimakas jakautuminen."},{"page_url":"https://es.wikipedia.org/wiki/Beatos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Beatos_stemma.jpg","page_title":"Beatos","context_page_description":"Se denominan Beatos a los distintos códices manuscritos, copias de aquel Comentario al Libro del Apocalipsis de San Juan que en el año 776 realizara Beato de Liébana, abad del monasterio de Santo Toribio, en el valle de Liébana.\\nEs un género librario específicamente hispano."},{"page_url":"https://de.wikipedia.org/wiki/Veia_Traversina","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/30/Thusis.jpg","page_title":"Veia Traversina","context_page_description":"Die Veia Traversina ist ein Wanderweg im Kanton Graubünden, der die Viamala für Fussgänger erschliesst. Die Strecke folgt dem römischen Fussweg durch die Viamala und ist Teil des Projekts „Ecomuseum Viamala“.\\nTouristisch erschlossen und vermarktet wird die Veia Traversina vom Verein Kulturraum Viamala."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%82%A9%E3%83%83%E3%82%AB%E3%83%BC_%E3%82%A2%E3%82%A4%E3%83%B3%E3%83%87%E3%83%83%E3%82%AB%E3%83%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3c/Fokker_Eindecker_takeoff_profile_view.jpg","page_title":"フォッカー アインデッカー","context_page_description":"フォッカー アインデッカーは、オランダ人技術者アントニー・フォッカーが設計した第一次世界大戦時のドイツの単座単葉戦闘機である。「アインデッカー」とは単葉機を意味するドイツ語である。フォッカー E.IからE.IVまでの機体を指す。\\n当機は、パイロットがプロペラを打ち抜くことなくその回転面を通して機関銃を発射することのできる同調装置を備え、対空戦闘を目的に量産された最初の戦闘機でもあった。その威力は「フォッカーの懲罰」として連合国から恐れられた。"},{"page_url":"https://no.wikipedia.org/wiki/Paul_Keres","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/1991_CPA_6284.jpg","page_title":"Paul Keres","context_page_description":"Paul Keres var en estisk og sovjetisk sjakkspiller, en av de sterkeste spillerne noensinne som aldri ble verdensmester. Han ble kalt «sjakkens kronprins».\\nPaul Keres ble født i Narva i Estland. Fra 1937 til 1941 studerte han matematikk ved universitetet i Tartu.\\nI 1938 vant han AVRO-turneringen, en meget sterkt besatt turnering. Den opprinnelige planen var at vinneren av denne turneringen skulle få spille utfordrermatch mot verdensmesteren, men utbruddet av annen verdenskrig satte en stopper for forhandlingene med den gjeldende verdensmesteren, Aleksandr Alekhin. I VM-turneringen i 1948, som ble arrangert for å kåre en ny verdensmester etter Alekhins død i 1946, kom Keres på fjerdeplass med 10,5 av 20 poeng.\\nKeres vant det russiske mesterskapet tre ganger, i 1947, 1950 og 1951.\\nHan døde i Helsingfors i Finland i 1975.\\nPaul Keres er portrettert på den estiske 5 kroon-seddelen. Det står en statue av ham på Tõnismägi i Tallinn."},{"page_url":"https://eo.wikipedia.org/wiki/Bercy_(pariza_metrostacio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Metro_de_Paris_-_Ligne_14_-_Bercy_02.jpg","page_title":"Bercy (pariza metrostacio)","context_page_description":"Bercy [bɛʁsi] estas stacio de la Metroo de Parizo sur linioj 6 kaj 14, en la 12-a arondismento de Parizo."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Murnau_am_Staffelsee","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Katholische_Filialkirche_St._Martin_D-1-80-124-127.jpg","page_title":"Liste der Baudenkmäler in Murnau am Staffelsee","context_page_description":"Auf dieser Seite sind die Baudenkmäler des oberbayerischen Marktes Murnau a.Staffelsee zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://sh.wikipedia.org/wiki/Seaside_Park,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Seaside_park_nj_029.png","page_title":"Seaside Park, New Jersey","context_page_description":"Sisajd Park je grad u američkoj saveznoj državi Nju Džerzi."},{"page_url":"https://en.wikipedia.org/wiki/Santiago_Municipal_Literature_Award","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Miguel_Castillo_Didier_cr.jpg","page_title":"Santiago Municipal Literature Award","context_page_description":"The Santiago Municipal Literature Award is one of the most important literary prizes of Chile. Created on 5 February 1934 by the municipality of Santiago, the first awards were given in the genres of novel, poetry, and theater; in 1941 essay was added, and in 1954, short story. 2013 saw the addition of children's and young adult literature, referential, journalistic research, and editing. The following year it was decided to extend the recognition of the works directed to minors, and to award children's and young adult literature separately, thus making a total of ten categories in competition.\\nThe oldest literary award in Chile, it consists of the delivery of a sum of money, which in 2016 was 2,000,000 pesos for each genre, and a corresponding diploma. The works published in the first edition the year prior to the contest may be submitted; in each genre, a jury selects three finalists from which it subsequently chooses the winner.\\nThis award has suffered some interruptions during its history. It was not granted in the first three years after the military coup led by General Augusto Pinochet, who overthrew the socialist government of Salvador Allende in September 1973."},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_the_London_Borough_of_Harrow","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Junction_of_High_Street_and_West_Street%2C_Harrow_on_the_Hill%2C_Middlesex_-_geograph.org.uk_-_365023.jpg","page_title":"List of public art in the London Borough of Harrow","context_page_description":"This is a list of public art in the London Borough of Harrow."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Melitopol_Ko%C4%81n","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/%D0%9A%D0%BE%D0%BD%D1%82%D1%83%D1%80%D0%BD%D0%B0%D1%8F_%D0%BA%D0%B0%D1%80%D1%82%D0%B0_%D0%9C%D0%B5%D0%BB%D0%B8%D1%82%D0%BE%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0_%D0%97%D0%B0%D0%BF%D0%BE%D1%80%D0%BE%D0%B6%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8.png","page_title":"Melitopol Koān","context_page_description":"Melitopol Koān sī Ukraina Zaporizhia Chiu ê chi̍t ê koān."},{"page_url":"https://pa.wikipedia.org/wiki/%E0%A8%A6%E0%A8%BF%E0%A8%B8%E0%A8%BC%E0%A8%BE_%E0%A8%AA%E0%A8%BE%E0%A8%9F%E0%A8%A8%E0%A9%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Disha_Patani_snapped_at_Spider_Man_Homecoming_screening.jpg","page_title":"ਦਿਸ਼ਾ ਪਾਟਨੀ","context_page_description":"ਦਿਸ਼ਾ ਪਾਟਨੀ ਇੱਕ ਭਾਰਤੀ ਫਿਲਮ ਅਦਾਕਾਰਾ ਅਤੇ ਮਾਡਲ ਹੈ, ਜੋ ਕੀ ਹਿੰਦੀ ਅਤੇ ਤੇਲਗੂ ਫਿਲਮ ਦੀ ਅਦਾਕਾਰਾ ਹੈ। ਪਾਟਨੀ ਦਾ ਜਨਮ ਬਰੇਲੀ, ਭਾਰਤ ਵਿੱਚ ਹੋਇਆ।\\nਉਹ ਇੰਡੋਰ ਵਿੱਚ ਹੋਈ ਮਿਸ ਇੰਡੀਆ ਫੇਮਿਨਾ 2013 ਦੀ ਪਹਿਲੀ ਰਨਰ-ਅੱਪ ਰਹੀ। ਉਸ ਨੇ ਆਪਣੀ ਫਿਲਮ ਕਰੀਅਰ ਦੀ ਸ਼ੁਰੂਆਤ ਪੁਰੀ ਜਗਨਨਾਥ ਲੋਫ਼ਰ."},{"page_url":"https://es.wikipedia.org/wiki/C%C3%A2mara_de_Lobos_(freguesia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/CMT1.png","page_title":"Câmara de Lobos (freguesia)","context_page_description":"Câmara de Lobos es una freguesia portuguesa del concelho de Câmara de Lobos, con 7,62 km² de superficie y 16.842 habitantes. Su densidad de población es de 2 210,2 hab/km²."},{"page_url":"https://sv.wikipedia.org/wiki/Prada","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Galleria_Vittorio_Emanuele_II_%28Milan%292.jpg","page_title":"Prada","context_page_description":"Prada är ett italienskt modehus inom haute couture och accessoarer samt glasögon, grundat 1913 i Milano av Mario Prada."},{"page_url":"https://en.wikipedia.org/wiki/Gonville_and_Caius_College,_Cambridge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Cambridge_Gonville_and_Caius_College.jpg","page_title":"Gonville and Caius College, Cambridge","context_page_description":"Gonville & Caius College is a constituent college of the University of Cambridge in Cambridge, England. The college is the fourth-oldest college at the University of Cambridge and one of the wealthiest. The college has been attended by many students who have gone on to significant accomplishment, including fifteen Nobel Prize winners, the second-most of any Oxbridge college.\\nThe college has long historical associations with medical teaching, especially due to its alumni physicians: John Caius and William Harvey. Other famous alumni in the sciences include Francis Crick, James Chadwick and Howard Florey. Stephen Hawking, previously Cambridge's Lucasian Chair of Mathematics Emeritus, was a fellow of the college until his death in 2018. The college also maintains reputable academic programmes in many other disciplines, including law, economics, English literature and history.\\nSeveral streets in the city, such as Harvey Road, Glisson Road and Gresham Road, are named after alumni of the College."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D9%84%D8%B3%D9%88%D9%86%D8%8C_%D9%84%D8%A7%D9%86%DA%A9%D8%A7%D8%B4%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Marsden_Park.jpg","page_title":"نلسون، لانکاشر","context_page_description":"نلسون، لانکاشر یک منطقهٔ مسکونی در انگلستان است که در شمال غربی انگلستان واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Political_ideologies_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Multi-axis_political_spectrum.svg","page_title":"Political ideologies in the United States","context_page_description":"Political ideologies in the United States refers to the various ideologies and ideological demographics in the United States. Citizens in the United States generally classify themselves as adherent to positions along the political spectrum as either liberal, progressive, moderate, or conservative. Modern American liberalism aims at the preservation and extension of human, social and civil rights as well as the government guaranteed provision of positive rights. It combines social progressivism and to some extent ordoliberalism and is highly similar to European social liberalism. American conservatism commonly refers to a combination of economic liberalism and libertarianism and social conservatism. It aims at protecting the concepts of small government and individual liberty while promoting traditional values on some social issues.\\nThe ideological position a person or party takes may be explained in terms of social and economic policy. The ideological positions a person assumes on social and economic policy issues may differ in their position on the political spectrum."},{"page_url":"https://es.wikipedia.org/wiki/Songthaew","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Isuzu_N-Series_songthaew_01.jpg","page_title":"Songthaew","context_page_description":"Un songthaew es un vehículo de tipo camioneta o pickup acondicionada para el transporte informal de pasajeros, habitualmente utilizada como taxi o autobús en países del Sudeste Asiático.​​\\nEstas camionetas tienen generalmente dos filas enfrentadas de asientos en la parte trasera, donde viajan los pasajeros. Deben su nombre precisamente a la disposición de los asientos, ya que su traducción tanto del tailandés como del malayo o laosiano es, literalmente, \\"dos filas\\".​\\nLos songthaews son parte del transporte público informal, por lo que no tienen una tarifa oficial y el precio del viaje suele variar, aunque es más barato que el transporte público oficial. En países como Tailandia son muy populares en las grandes ciudades y en las islas con mayor afluencia turística.​​\\nHabitualmente tienen un recorrido fijo, con variaciones de precio dependiendo del punto en que desciende el pasajero. En Tailandia se acostumbra a abonar el viaje una vez concluido el trayecto.​"},{"page_url":"https://de.wikipedia.org/wiki/Stra%C3%9Fenbahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Safety_measures_of_a_tram_door.jpg","page_title":"Straßenbahn","context_page_description":"Eine Straßenbahn, auch Trambahn oder auch Tramway beziehungsweise kurz die respektive das Tram, ist ein schienengebundenes, fast immer mit elektrischer Energie betriebenes öffentliches Personennahverkehrsmittel im Stadtverkehr, das den speziellen Bedingungen des Straßenverkehrs angepasst ist.\\nBedingt durch den in der Frühzeit üblichen Betrieb mit Zugtieren, die einen festen und hindernisfreien Untergrund benötigen, mussten die Gleise in den Straßenbelag eingebaut werden. Deshalb und aus Platzgründen im dichtbebauten Stadtgebiet verlaufen klassische Straßenbahnstrecken noch heute vielfach im öffentlichen Straßenraum. Als innerstädtisches Verkehrsmittel oder als Überlandstraßenbahn wurden sie aber in verschiedener Weise weiterentwickelt. Die Verlegung von Strecken auf eigene Bahnkörper oder in Tunnel erhöhte die Reisegeschwindigkeit. Derartige Systeme werden häufig als Stadtbahnen bezeichnet, besonders wenn die Züge auch Tunnelstrecken befahren, die Unterscheidung ist fließend."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A8%D8%B2%D8%B1%DA%AF%E2%80%8C%D8%B3%DB%8C%D8%A7%D9%87%D8%B1%DA%AF_%D8%B2%D8%A8%D8%B1%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Heart_numlabels.png","page_title":"بزرگ‌سیاهرگ زبرین","context_page_description":"بزرگ سیاهرگ زبرین و، در بالای قلب قرار دارد و از به هم پیوستن سیاهرگ‌های بازویی‌سری چپ و راست تشکیل می‌شود که حامل خون برگشتی از سر و بازوها هست.\\nسیاهرگ تک نیز به این سیاهرگ می‌ریزد.\\nبزرگ سیاهرگ زبرین خون نیمه فوقانی بدن را به دهلیز راست منتقل می کند."},{"page_url":"https://ja.wikipedia.org/wiki/FIFA%E3%82%B3%E3%83%B3%E3%83%95%E3%82%A7%E3%83%87%E3%83%AC%E3%83%BC%E3%82%B7%E3%83%A7%E3%83%B3%E3%82%BA%E3%82%AB%E3%83%83%E3%83%972017","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/The_opening_of_the_Confederations_Cup_2017_in_St._Petersburg_08.jpg","page_title":"FIFAコンフェデレーションズカップ2017","context_page_description":"FIFAコンフェデレーションズカップ2017 は、2017年6月17日から7月2日まで、FIFAワールドカップ・ロシア大会のプレ大会としてロシアで行われた第10回目のFIFAコンフェデレーションズカップである。"},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_patrim%C3%B3nio_edificado_no_distrito_de_Aveiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Capela_de_Madre_de_Deus_-_Aveiro.jpg","page_title":"Lista de património edificado no distrito de Aveiro","context_page_description":"Esta lista é uma sublista da Lista de património edificado em Portugal para o Distrito de Aveiro, ordenada alfabeticamente por concelho, baseada nas listagens do IPPAR de Março de 2005 e atualizações.\\nLegenda:\\nOs monumentos podem eventualmente ter várias designações, sendo estas separadas nesse caso pela conjunção \\"ou\\";\\nPor vezes vários edifícios fazem parte de uma mesma classificação patrimonial, sendo nesse caso separados pela conjunção \\"e\\";\\nA existência de dois graus de classificação diferente para um mesmo monumento significa que este aguarda uma classificação definitiva, se bem que tenha sido homologado com o grau indicado.\\nObservação: São preservadas as denominações adoptadas pelo IPPAR, mesmo que elas apresentem outras alternativas. Nestes casos há redireccionamento para aquela em que o artigo está redigido, podendo ou não esta designação aparecer na lista."},{"page_url":"https://hu.wikipedia.org/wiki/Vardzia","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Vardzia.jpg","page_title":"Vardzia","context_page_description":"Vardzia barlangváros és barlangkolostor Grúzia déli részén a Szamche-Dzsavaheti régióban, a Kura folyó bal partján. 1993 óta szepel a világörökségi javaslati listán."},{"page_url":"https://en.wikipedia.org/wiki/3Dconnexion","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/3D-Maus_Baujahr_2000.JPG","page_title":"3Dconnexion","context_page_description":"3Dconnexion manufactures a line of human interface devices for manipulating and navigating computer-generated 3D imagery. These devices are often referred to as 3D motion controllers, 3D navigation devices, 6DOF devices or a 3D mouse.\\nCommonly utilized in CAD applications, 3D modeling, animation, 3D visualization and product visualization, users can manipulate the controller's pressure-sensitive handle to fly through 3D environments or manipulate 3D models within an application. The appeal of these devices over a mouse and keyboard is the ability to pan, zoom and rotate 3D imagery simultaneously, without stopping to change directions using keyboard shortcuts or a software interface. 3Dconnexion devices are compatible with over 100 applications including Autodesk Inventor, Solid Edge, Blender, Google Earth, Second Life, NASA World Wind, Virtual Earth 3D, Geomagic, Google SketchUp 6, Cinema4D, Maya, SolidWorks, T-FLEX CAD, Photoshop, and more"},{"page_url":"https://gl.wikipedia.org/wiki/Girolamo_Savonarola","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/SavonarolaPlaque_crop_gobeirne.jpg","page_title":"Girolamo Savonarola","context_page_description":"Girolamo Maria Francesco Matteo Savonarola, nado en Ferrara, Italia o 21 de setembro de 1452 e finado en Florencia o 23 de maio de 1498, foi un relixioso dominico e predicador italiano, confesor do gobernador de Florencia, Lourenzo de Medici, organizador das soadas fogueiras das vaidades onde os florentinos estaban convidados a guindar os seus obxectos de luxo e os seus cosméticos, ademais de libros que consideraba licenciosos, como os de Giovanni Boccaccio. Predicou contra o luxo, o lucro, a depravación dos poderosos e a corrupción da Igrexa católica, contra a procura da gloria e contra a sodomía, sospeitando que estaba en toda a sociedade de Florencia, onde el viviu.\\nPredixo que un novo rei Ciro atravesaría o país para pór orde nos costumes dos sacerdotes e do pobo e a entrada do exército francés de Carlos VIII, en 1494, na Toscana confirmou a súa profecía. As súas críticas violentas contra a familia que gobernaba Florencia neses anos, os Medici, acusándoos de corruptos, contribuíron á expulsión do gobernador Piero de Medici polos florentinos en 1495."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Bodendenkmale_in_Malschwitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Gleina_Steinkreuz.jpg","page_title":"Liste der Bodendenkmale in Malschwitz","context_page_description":"In der Liste der Bodendenkmale in Malschwitz sind die Bodendenkmale der Gemeinde Malschwitz und ihrer Ortsteile nach dem Stand der Auflistung von Harald Quietzsch und Heinz Jacob aus dem Jahr 1982 aufgelistet. Eventuelle Änderungen und Ergänzungen, insbesondere aus der Zeit nach der Wende, sind nicht berücksichtigt, da für Sachsen aktuell keine neueren allgemein zugänglichen Bodendenkmallisten vorliegen. Die Baudenkmale sind in der Liste der Kulturdenkmale in Malschwitz aufgeführt."},{"page_url":"https://fr.wikipedia.org/wiki/Friends","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Friends_Central_Perk_couch.jpg","page_title":"Friends","context_page_description":"Friends [fɹɛnz] est une sitcom américaine en 10 saisons, avec 236 épisodes de 22 minutes, créée par Marta Kauffman et David Crane, et qui a rencontré un large succès dans de nombreux pays.\\nLa série a été diffusée entre le 22 septembre 1994 et le 6 mai 2004 sur le réseau NBC.\\nEn Belgique et au Luxembourg a été diffusée fin octobre 1994 sur RTL TVI et RTL TV puis RTL9 en France, la diffusion a débuté le 16 avril 1996 sur Canal Jimmy en version originale sous-titrée. France 2 diffuse d'abord les épisodes 12 et 13 de la saison 2 le 25 juin 1997, lors d'une soirée spéciale Sitcom: reflets ou parodie de la vie puis la série sera programmée à partir du premier épisode dès le 8 septembre 1997 sur France 2. Rediffusion sur M6, W9, France 4, NRJ 12, C8, RTL9, Comédie+, AB1, TMC, TFX, Elle Girl TV, Warner TV et dès le 1ᵉʳ avril 2019 sur Série Club en intégralité HD et en version multilingue. Au Québec, elle est diffusée depuis le 14 mai 2012 sur Mˡˡᵉ. Elle est également diffusée sur VRAK à partir du 13 mai 2019."},{"page_url":"https://en.wikipedia.org/wiki/Institut_Ramon_Llull","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Le_pavillon_de_la_Catalogne_%28Biennale_d%27architecture_2014%2C_Venise%29_%2815643743159%29.jpg","page_title":"Institut Ramon Llull","context_page_description":"The Institut Ramon Llull is a consortium consisting of the Generalitat de Catalunya, the Govern de les Illes Balears and the Ajuntament de Barcelona. Its purpose is to project and disseminate abroad Catalan language and culture in all of its forms of expression. To do this, the Institut Ramon Llull provides support for external relations in the cultural ambit of its member organisations."},{"page_url":"https://ru.wikipedia.org/wiki/(736)_%D0%93%D0%B0%D1%80%D0%B2%D0%B0%D1%80%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/ru/2/26/%D0%9E%D1%80%D0%B1%D0%B8%D1%82%D0%B0_%D0%B0%D1%81%D1%82%D0%B5%D1%80%D0%BE%D0%B8%D0%B4%D0%B0_736.png","page_title":"(736) Гарвард","context_page_description":"(736) Гарвард — крупный астероид Главного пояса, который был открыт 16 ноября 1912 года американским астрономом Джоэлом Меткалфом в американском городе Винчестер и назван в честь Гарвардского университета."},{"page_url":"https://ca.wikipedia.org/wiki/Ratchanok_Intanon","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Yonex_IFB_2013_-_Quarterfinal_-_Wang_Shixian_vs_Ratchanok_Intanon_02.jpg","page_title":"Ratchanok Intanon","context_page_description":"Ratchanok Intanon és una jugadora de bàdminton tailandesa que va arribar a ser la primera jugadora tailandesa número 1 del rànquing mundial. El 2013 es va proclamar campiona mundial."},{"page_url":"https://en.wikipedia.org/wiki/Rambler_(automobile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/1964_Rambler_Classic_770_wagon-green.jpg","page_title":"Rambler (automobile)","context_page_description":"Rambler was an automobile brand name used by the Thomas B. Jeffery Company between 1900 and 1914, then by its successor, Nash Motors from 1950 to 1954, and finally by Nash's successor, American Motors Corporation from 1954 to 1969 in the United States and 1983 in international markets. It was often nicknamed the \\"Kenosha Cadillac\\" after its place of manufacture."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A2%D0%B5%D1%80%D0%BC%D0%BE%D0%BC%D0%B8%D0%BD%D0%B5%D1%80%D0%B0%D0%BB%D0%BD%D0%B8_%D0%B8%D0%B7%D0%B2%D0%BE%D1%80%D0%B8_%D0%9D%D0%B8%D1%88%D0%BA%D0%B5_%D0%91%D0%B0%D1%9A%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/%C5%A0kolska_%C4%8Desma_N.Banja.jpg","page_title":"Термоминерални извори Нишке Бање","context_page_description":"Термоминерални извори Нишке Бање су значајни хидрографски објекти и природно добро од националног значаја за Републику Србију, пре свега због физичких и хемијских одлика вода са тих извора. Права балнеолошка вредност Нишке Бање није била позната све до 1909. године, када је физичко-хемијски састав и радиоактивност њених термоминералних вода установио доктор Марко Леко.\\nРазноврсност хемијског састава и значајна радиоактивност, термоминералних вода Нишке Бање има велику медицинску, балнеолошку и туристичку вредност пре свега због њихове примене у лечењу и рехабилитацији различитих болести, и других стања здравља, по чему су термоминерални извори Нишке Бање познати и ван граница Србије."},{"page_url":"https://en.wikipedia.org/wiki/Molo_(Genoa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Muramologe.jpg","page_title":"Molo (Genoa)","context_page_description":"Molo is a neighbourhood in the old town of the Italian city of Genoa. It was one of the six sestieri of ancient Genoa. At present is part of the Genoa's city Municipio I.\\nLocated close to the old harbour it had been for many centuries the seat of political and religious power of the city."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B0%D0%BB%D0%B4_%D0%90%D0%BC%D1%83%D0%BD%D0%B4%D1%81%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Amundsen_in_fur_skins.jpg","page_title":"Роалд Амундсен","context_page_description":"Роалд Енгелбрегт Гравинг Амундсен је био норвешки истраживач поларних предела. Он је предводио Антарктичку експедицију од 1910. до 1912. која је прва стигла до Јужног пола, 14. децембра 1911. Он је био кључни вођа експедиција током доба истраживања Антарктика. Године 1926, он је био приви вођа ваздушне експедиције преко Северног пола, те је био прва особа која је досегла до оба пола. Он је исто признат као вођа прве експедиције која је прошла кроз Северозападни пролаз у Арктику.\\nАмундсен је рођен у породици норвешких бродовласника и капетана. Инспирисан експедицијом Фритјофа Нансена на Гренланд 1888. године одлучио је да свој живот посвети истраживању.\\nНестао је приликом једне спасилачке мисије 1928. године."},{"page_url":"https://en.wikipedia.org/wiki/2008_New_Mexico_Democratic_presidential_primary","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/New_Mexico_DNC_2008.jpg","page_title":"2008 New Mexico Democratic presidential primary","context_page_description":"The 2008 New Mexico Democratic presidential primary took place on February 5, 2008, with 26 national delegates at stake.\\nOn February 12, 2008, counting was officially finished and Hillary Clinton was declared the winner."},{"page_url":"https://en.wikipedia.org/wiki/Via_Domitia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/St-Thibery-Pont-Romain1.JPG","page_title":"Via Domitia","context_page_description":"The Via Domitia was the first Roman road built in Gaul, to link Italy and Hispania through Gallia Narbonensis, across what is now southern France. The route that the Romans regularised and paved was ancient when they set out to survey it, so old that it traces the mythic route travelled by Heracles.\\nThe construction of the road was commissioned by Gnaeus Domitius Ahenobarbus, whose name it bore, following the defeat of the Allobroges and Averni by himself and Quintus Fabius Maximus Allobrogicus. Gnaeus Domitius also established a fortified garrison at Narbo on the coast, near Hispania, to guard its construction. It soon developed into a full Roman colony Colonia Narbo Martius. The lands on the western part of the route, beyond the River Rhône had been under the control of the Averni who, according to Strabo, had stretched their control to Narbo and the Pyrenees.\\nCrossing the Alps by the easiest passage, the Col de Montgenèvre, it followed the valley of the Durance, crossed the Rhône at Beaucaire passed through Nîmes then followed the coastal plain along the Gulf of Lion. At Narbonne, it met the Via Aquitania."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E4%B8%99%E4%BA%8C%E9%85%B8%E4%BA%8C%E4%B9%99%E9%85%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Diethyl-malonate.png","page_title":"丙二酸二乙酯","context_page_description":"丙二酸二乙酯是丙二酸的二乙醇酯，無色有蘋果味的液體，天然存在於葡萄和草莓中。屬於β-二羰基化合物，用作有機合成和藥物合成的中間體，可以合成巴比妥酸、維生素B1、維生素B6和人工香料等。類似的化合物還有乙醯乙酸乙酯、丙二酸二甲酯、乙酸乙酯、乙醯丙酮等。\\n丙二酸二乙酯可通過用氯乙酸為原料，用氰離子增碳生成氰乙酸，再與乙醇酯化製得：\\n丙二酸二乙酯或取代的丙二酸二乙酯經過「酮式分解」或「酸式分解」，可以得到乙酸或乙酸的衍生物。"},{"page_url":"https://fa.wikipedia.org/wiki/%D9%85%D8%AD%D9%85%D8%AF_%D8%AC%D9%87%D8%A7%D9%86%E2%80%8C%D8%A2%D8%B1%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Jahan_ara.jpg","page_title":"محمد جهان‌آرا","context_page_description":"محمد جهان‌آرا فرمانده نظامی ایرانی عضو سپاه پاسداران انقلاب اسلامی در جنگ ایران و عراق بود. جهان‌آرا در سال‌های نخست از جنگ ایران و عراق به عنوان فرمانده سپاه پاسداران خرمشهر فعالیت می‌کرد و در عملیات‌هایی چون نبرد خرمشهر و حصر آبادان، نقشی کلیدی ایفا نمود.\\nجهان‌آرا در تاریخ ۷ مهر ۱۳۶۰ در پی اصابت موشک ضدهوایی به پرواز هرکولس سی-۱۳۰ نیروی هوایی ارتش، توسط پدافند خودی و سقوط هواپیما در منطقه کهریزک در جنوب تهران، کشته شد. به‌علت خدمات وی در دفاع و شکستن حصر آبادان، بعد از سال ۱۳۶۰ به او درجه سرلشکری اعطا گردید."},{"page_url":"https://es.wikipedia.org/wiki/Tour_de_Dubai_2015","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/Duba%C3%AF_Tour_2015_%28A2%29.jpg","page_title":"Tour de Dubai 2015","context_page_description":"La 2.ª edición del Tour de Dubai se celebró entre el 4 y el 7 de febrero en el emirato de Dubái.\\nLa carrera formó parte de calendario UCI Asia Tour 2015 en su máxima categoría 2.HC.\\nEl ganador de la clasificación final fue Mark Cavendish que además ganó el maillot rojo de la clasificación por puntos y obtuvo dos victorias de etapa. Le acompañaron en el podio John Degenkolb y Juan José Lobato, respectivamente.\\nEn las clasificaciones secundarias se impusieron Alessandro Bazzana y Michael Valgren."},{"page_url":"https://ru.wikipedia.org/wiki/11-%D0%B9_%D0%B0%D1%80%D0%BC%D0%B5%D0%B9%D1%81%D0%BA%D0%B8%D0%B9_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81_%D0%A1%D0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Bundesarchiv_Bild_183-J30798%2C_Volkssturm-M%C3%A4nner_in_der_Ausbildung.jpg","page_title":"11-й армейский корпус СС","context_page_description":"11-й армейский корпус СС — создан 24 июля 1944 года на юге Польши на основе остатков штаба разгромленного в Крыму 5-го армейского корпуса.\\nВ составе корпуса не было частей или подразделений СС, приставка «СС» в именовании корпуса объясняется только тем, что командующим корпуса был назначен не генерал вермахта, а обергруппенфюрер СС."},{"page_url":"https://pl.wikipedia.org/wiki/Ivan_Kl%C3%ADma","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Ivan_Kl%C3%ADma_-_podpis.png","page_title":"Ivan Klíma","context_page_description":"Ivan Klíma – czeski prozaik i dramatopisarz.\\nW latach 70 i 80 mógł publikować tylko w wydawnictwach niezależnych. Problematykę psychologiczną i etyczną, związaną głównie ze środowiskiem młodzieży, przedstawił w opowiadaniach Bezvadný den, Milenci na jednu noc. W powieści Godzina ciszy dokonał rozrachunku z okresem kultu jednostki, analizując postawy moralne mieszkańców powojennej wsi słowackiej. Wątek dyskusji wokół historii, egzystencjalne rozterki, oraz absurdalne obserwacje w powieści Ani święci ani anioły. Elementy dramatu absurdu zastosował w sztukach Zamek i Klára a dva páni.\\nW 2002 został odznaczony Medalem Za zasługi I stopnia. W tym samym roku otrzymał również Nagrodę Franza Kafki"},{"page_url":"https://tr.wikipedia.org/wiki/Eetu_Muinonen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Eetu_Muinonen_1.jpg","page_title":"Eetu Muinonen","context_page_description":"Eetu Muinonen, Fin futbolcudur. Zulte Waregem'de forma giymektedir."},{"page_url":"https://nn.wikipedia.org/wiki/Slaget_ved_Ledsund","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Ledsund-1720.jpg","page_title":"Slaget ved Ledsund","context_page_description":"Slaget ved Ledsund i 1720 var det siste store sjøslaget i den store nordiske krigen og fann stad i Åland i Ledsund, mellom øyane Föglö og Lemland. Slaget markerte slutten på den russiske og svenske kampen om sjømakta i Austersjøen. Den russiske flåten gjorde eit siste raid langs svenske kysten våren 1721, før freden i Nystad vart signert og slutta krigen."},{"page_url":"https://fi.wikipedia.org/wiki/Giresun","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Giresun_Turkey.jpg","page_title":"Giresun","context_page_description":"Giresun on samannimisen maakunnan pääkaupunki Turkin pohjoisosassa. Vuoden 2015 lopussa kaupungin arvioitu väkiluku oli 105 748.\\nKaupungissa toimii yliopisto, joka perustettiin vuonna 2006. Sen edeltäjä oli tyttökoulunopettajien seminaari, joka toimi jo vuodesta 1962."},{"page_url":"https://ast.wikipedia.org/wiki/FC_Lada_Toliatti","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Torpedo_-_TLT.jpg","page_title":"FC Lada Toliatti","context_page_description":"El FC Lada Toliatti ye un club de fútbol rusu de la ciudá de Toliatti, fundáu en 1970. El club apuesta los sos partíos como llocal nel estadiu Torpedu y xuega na Segunda División de Rusia, el tercer nivel nel sistema de lligues rusu.\\nEn marzu de 2010, el club foi escluyíu de la Segunda División, al pie de otru equipu de Toliatti, el FC Togliatti, y fundiéronse nel FC Akademiya Togliatti. Sicasí, el club actual y orixinal Lada Toliatti foi refundado en 2012 y siguió compitiendo."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A2%D0%B5%D1%80%D0%B8_%D0%91%D0%B0%D0%BB%D1%81%D0%B0%D0%BC%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Evanescence_Terry.jpg","page_title":"Тери Балсамо","context_page_description":"Теренс Патрик Дејвид Балсамо е американски гитарист. Тој е еден од оние кои го формирале бендот Cold, a е сегашен гитарист на рок групата Evanescence."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Germain-du-Bois","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Saint-Germain-du-Bois_-_clocher_%28Sa%C3%B4ne-et-Loire_-_France%29.JPG","page_title":"Saint-Germain-du-Bois","context_page_description":"Saint-Germain-du-Bois är en kommun i departementet Saône-et-Loire i regionen Bourgogne-Franche-Comté i östra Frankrike. Kommunen ligger i kantonen Saint-Germain-du-Bois som tillhör arrondissementet Louhans. År 2009 hade Saint-Germain-du-Bois 1 935 invånare."},{"page_url":"https://fr.wikipedia.org/wiki/%C5%92uf_de_Faberg%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Faberge_Train_Egg_Kremlin_April_2003.jpg","page_title":"Œuf de Fabergé","context_page_description":"Les œufs de Fabergé sont des objets précieux créés par le joaillier Pierre-Karl Fabergé.\\nLes œufs les plus célèbres ont été fabriqués pour Alexandre III et Nicolas II de Russie, qui les offraient à leurs épouses respectives, Maria Feodorovna et Alexandra Feodorovna, pour la fête de Pâques. Sur les 54 réalisés, 6 ont été perdus, tandis que 2 autres œufs ont été créés mais non livrés, les œufs Constellation et Bouleau de Carélie pour l'année 1918.\\nSept gros œufs ont aussi été fabriqués pour la famille Kelch de Moscou.\\nLes œufs sont faits de métaux précieux ou de pierres dures décorées avec des combinaisons d'émail et de pierres précieuses.\\nLe terme « œuf de Fabergé » est devenu synonyme de luxe et les œufs sont considérés comme des chefs-d'œuvre de la joaillerie. Les œufs de Pâques Pierre-Karl Fabergé impériaux sont considérés comme la dernière grande série de commissions pour objets d'art."},{"page_url":"https://fr.wikipedia.org/wiki/Vilmos_Vancz%C3%A1k","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Vilmos_Vancz%C3%A1k_-_Lausanne_vs_Sion_02_may_2012.jpg","page_title":"Vilmos Vanczák","context_page_description":"Vilmos Vanczák, né le 20 juin 1983 à Miskolc, est un footballeur professionnel hongrois défenseur central avec le club de Puskás Akadémia."},{"page_url":"https://en.wikipedia.org/wiki/Genesis_the_Greykid","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Genesis_during_interview.jpg","page_title":"Genesis the Greykid","context_page_description":"Russell McGee Jr, better known as Genesis the Greykid, is a fine artist, poet, creative, and underground hip-hop artist who was co-signed by the Media Label Creative Control TV by filming duo/CEO's Coodie & Chike. Genesis became one of the few emerging Fine Art Poets in 2016, selling over $12,000 in poems his first two-hour exhibition in Chattanooga, Tennessee titled \\"Through the Grey\\". He is also behind the 48 x 48 inch painting created for the song \\"Brothers\\" by rapper Kanye West, featuring vocals from singer Charlie Wilson, produced by Seven, Irv Gotti, and Bink!. The song was previewed alongside the season 2 premiere of American drama show Tales and was released on July 5, 2019."},{"page_url":"https://en.wikipedia.org/wiki/Hwaseong_Fortress","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Seonodae_20081002.JPG","page_title":"Hwaseong Fortress","context_page_description":"Hwaseong Fortress or Suwon Hwaseong is a fortification surrounding the centre of Suwon, the provincial capital of Gyeonggi-do, in South Korea. It was built from 1794 to 1796 by King Jeongjo of the Joseon dynasty to house and honour the remains of his father, Prince Sado. Sado had been executed by being locked alive inside a rice chest by his own father King Yeongjo after failing to obey a command to commit suicide. Located 30 kilometres south of Seoul and enclosing much of central Suwon, the fortress includes King Jeongjo's palace Haenggung. The fortress and enclosed palace were designated as a World Heritage site by UNESCO in 1997. It comprises among many other features the palace, a perimeter wall, four main gates, and two sluicegates over the Suwoncheon, Suwon's main stream, which flows through the centre of the fortress."},{"page_url":"https://en.wikipedia.org/wiki/Twinsburg_Township,_Summit_County,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Summit_County_Ohio_incorporated_and_unincorporated_areas_Twinsburg_Township_highlighted.svg","page_title":"Twinsburg Township, Summit County, Ohio","context_page_description":"Twinsburg Township is one of the nine townships of Summit County, Ohio, United States. The 2010 census found 2,282 people in the unincorporated portions of the township."},{"page_url":"https://tr.wikipedia.org/wiki/Palmira","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Palmyrasheikh.jpg","page_title":"Palmira","context_page_description":"Palmira orta Suriye'de antik zamanların önemli dini ve ticari merkezi olan, UNESCO tarafından 1980 yılında Dünya Miras Listesi'ne alınan şehir.\\nKent, Humus Valiliği'nin, Palmira İli'ne bağlı bulunmaktadır. Şam'ın 215 km kuzeydoğusunda, Humus'un 155 km doğusunda ve Fırat'ın 120 km güneybatısında bir vaha üzerinde kurulmuştur. Suriye çölünün ticari kervanlarının geçiş noktasında olması sebebiyle \\"Çölün Gelini\\" de denilen şehrin isminin bulunan ilk bilgilere göre Tedmur, Tedmür, Tadmur veya Tudmur olduğu Mari'de bulunan Babil tabletlerindeki kayıtlardan anlaşılmıştır. Fransız arkeologlar tarafından 1933 yılından itibaren antik Mari şehrinden çıkarılan 25.000 tabletten anlaşıldığına göre Palmira'nın tarihi MÖ 19. yüzyıla kadar gerilere gitmektedir. Yunan ve Roma kaynaklarında ise 1. yüzyıldan itibaren kayıtlara rastlanılmıştır.\\nAntik kent, Suriye İç Savaşı tahrip edildi. Yeniden canlandırılması için 3D modelleri hazırlanmış ve bazı eserleri restore edilmiştir."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_des_Alpes-Maritimes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Saint-Dalmas-le-Selvage_-_Eglise_paroissiale_Saint-Dalmas_-088.jpg","page_title":"Liste des monuments historiques des Alpes-Maritimes","context_page_description":"La liste qui suit présente les édifices du département des Alpes-Maritimes protégés au titre des monuments historiques et répertoriés dans la base Mérimée du ministère français de la Culture, à l'exception de ceux des communes de Nice et Grasse présentés respectivement dans la liste des monuments historiques de Nice et dans la liste des monuments historiques de Grasse. Les édifices de la commune de Cannes sont également présentés dans la liste des monuments historiques de Cannes."},{"page_url":"https://zh-yue.wikipedia.org/wiki/Dan_Wilson_(%E9%9F%B3%E6%A8%82%E4%BA%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Dan_Wilson.jpg","page_title":"Dan Wilson (音樂人)","context_page_description":"Daniel Dodd Wilson（1961年5月20號—），係美國音樂人、歌手、詞曲作家、音樂製作人、表演者。"},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Gr%C3%A8zes_(Loz%C3%A8re)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/Map_commune_FR_insee_code_48072.png","page_title":"Grèzes (Lozère)","context_page_description":"Grèzes sī ūi-tī Hoat-kok Languedoc-Roussillon toā-khu Lozère séng ê chi̍t ê commune."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%A8%D7%99_%D7%9C%D7%95%D7%91%D7%A8%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Luberon_topographic_map-fr.png","page_title":"הרי לוברון","context_page_description":"הרי לוברון הם רכס הרים בדרום צרפת, במרכז פרובאנס, המהווים חלק מרכס האלפים. שטח הרכס כ-600 קמ\\"ר, אורכו הכולל כ-60 ק\\"מ ורוחבו הממוצע הוא כ-5 קילומטר. רכס הרי לוברון מחולק לשלושה רכסים שכיוונם מזרח-מערב. המערבי ביותר הוא ה\\"לוברון הקטן\\", מזרחה לו ה\\"לוברון הגדול\\" והמזרחי ביותר הוא ה\\"לוברון המזרחי\\". הפסגה הגבוהה ביותר היא ״מור נגר״, בגובה 1,265 מטר מעל פני הים.\\nבעמקים שמצפון ומדרום לרכסים קיימים שטחים חקלאיים ומספר ערים וכפרים.\\nרוב שטחם של הרי לוברון נכלל בתוך השמורה הביוספרית של לוברון-לור."},{"page_url":"https://fr.wikipedia.org/wiki/Magnat-Debon","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/99/Magnat_Debon_flat.jpg","page_title":"Magnat-Debon","context_page_description":"Magnat-Debon était un constructeur de motos et un constructeur de vélos français. L'entreprise a ouvert ses portes en 1893 et a cessé ses activités en 1962.\\nL'entreprise a eu plusieurs slogans :\\n« La marque du connaisseur »\\n« La marque de qualité »\\n« La première marque du tourisme »\\n« La motocyclette de qualité »\\n« La première marque de tourisme »"},{"page_url":"https://pl.wikipedia.org/wiki/Model_European_Union","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Social_event.jpg","page_title":"Model European Union","context_page_description":"Model European Union – symulacje procesów polityki europejskiej, które odbywają się w pomieszczeniach Parlamentu Europejskiego w Strasburgu. Około 180 uczestników z całej Europy może odgrywać role nie tylko ministrów w Radzie czy europarlamentarzystów, ale również lobbystów, dziennikarzy albo tłumaczy.\\nMEU zazwyczaj odbywa się w miesiącach wiosennych, między marcem a majem."},{"page_url":"https://cs.wikipedia.org/wiki/Bejt_Ja%27akov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Bait_yaakov4.JPG","page_title":"Bejt Ja'akov","context_page_description":"Bejt Ja'akov je městská čtvrť v centrální části Jeruzaléma v Izraeli."},{"page_url":"https://en.wikipedia.org/wiki/Someshwara_Temple,_Kolar","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Main_mantapa_%28hall%29_in_Someshvara_Temple_at_Kolar.JPG","page_title":"Someshwara Temple, Kolar","context_page_description":"The Someshwara temple, situated in Kolar town of Karnataka state, India, is an ornate 14th century Vijayanagara era Dravidian style construction. Someshwara, another name for the Hindu god Shiva is the presiding deity in the temple. The temple is protected by the Archaeological Survey of India as a monument of national importance."},{"page_url":"https://lmo.wikipedia.org/wiki/Hallau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Hallau-Dorf.jpg","page_title":"Hallau","context_page_description":"Hallau a l'è un cumün svizzer del Canton Sciafüsa. Al gh’ha pressapoch 2035 abitant e una süperfiss de 15.32 km², e al se tröva a una altitüden de 421 meter sura al livel del mar.\\nEl cumün de Hallau a l'è tacaa ai cumün de Eggingen, Neunkirch, Oberhallau, Stühlingen, Trasadingen, Wilchingen."},{"page_url":"https://fr.wikipedia.org/wiki/Si%C3%A8ge_de_Tourane","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/French_ships_at_Danang_1858.jpg","page_title":"Siège de Tourane","context_page_description":"Le siège de Tourane, de septembre 1858 à mars 1860, est un épisode mineur de la campagne de Cochinchine. Il s'agit d'une expédition punitive franco-espagnole dirigée par l'amiral Charles Rigault de Genouilly. Elle réussit à s'emparer des forts de la baie de Tourane, mais fut obligée de réembarquer après vingt mois sur place, sans succès décisif."},{"page_url":"https://la.wikipedia.org/wiki/Moulins-l%C3%A8s-Metz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Eglise_Moulins_Metz.jpg","page_title":"Moulins-lès-Metz","context_page_description":"Moulins-lès-Metz est commune 5084 incolarum praefecturae Mosellae in Franciae orientalis regione Lotharingia."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9B%B7%E6%9D%B0%C2%B7%E5%90%89%E5%B0%94%E9%87%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Reggie_Geary.jpg","page_title":"雷杰·吉尔里","context_page_description":"雷杰·埃利奥特·吉尔里，美国NBA联盟职业篮球运动员。他在1996年的NBA选秀中第2轮第27顺位被克利夫兰骑士选中。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D1%96%D1%8F_%D0%B2_%D0%9A%D0%B8%D1%80%D0%B3%D0%B8%D0%B7%D1%81%D1%82%D0%B0%D0%BD%D1%96_(2010)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/ba/Prosecutors_office_burned_bishkek.JPG","page_title":"Революція в Киргизстані (2010)","context_page_description":"Революція в Киргизстані, що відбулася у квітні 2010 року, почалася масовими заворушеннями у вівторок 6 квітня 2010 року в місті Таласі, які наступного дня поширилися на решту території країни. Унаслідок революції уряд Даніяра Усенова пішов у відставку."},{"page_url":"https://cs.wikipedia.org/wiki/Hamr_(okres_Jind%C5%99ich%C5%AFv_Hradec)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Hamr%2C_v%C3%BDklenkov%C3%A1_kapli%C4%8Dka.JPG","page_title":"Hamr (okres Jindřichův Hradec)","context_page_description":"Obec Hamr se nachází v okrese Jindřichův Hradec v Jihočeském kraji. Žije v něm 367 obyvatel."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%DB%8C%D9%84%D8%AA%D8%B1_%DA%A9%D8%B1%D8%A8%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Activated_Carbon.jpg","page_title":"فیلتر کربنی","context_page_description":"فیلتر کربنی که به فیلتر زغال فعال یا فیلتر کربن فعال نیز نامیده می‌شود.\\nکربن یا زغال فعال شده با نام‌هایی مانند کربن اکتیو شده- زغال فعال نیز شناخته می‌گردد.\\nبه کربنی گفته می‌شود که توسط اکسیژن عمل آورده و فرآوری شده‌است به شکلی که سوراخ‌های ریز بی شماری در میان اتم‌های آن به وجود آمده‌است.\\nکربن عمل آورده فوق به قراری فعال می‌گردد که با مقدار جزئی از آن می‌توان سطح بسیار وسیعی را برای ساخت فیلتر آماده ساخت. به‌طور نمونه یک گرم کربن اکتیو برای آماده‌سازی پانصدمتر مربع فیلتر هوا به منظور جذب فیزیکی یا صورت گرفتن واکنش جذب شیمیایی برای فیلتر کردن گازهای آلاینده کافی می‌باشد. فیلتر آماده شده توان جذب مقدار قابل اندازه‌گیری از گاز نیتروژن را داراست. جذب نیتروژن با تغییر فیزیکی و پس از تبدیل آن به مایع صورت می‌گیرد.\\nفیلترهای کربن اکتیو توانایی جذب بازمانده‌های واکنش‌های شیمیایی و بسیاری دیگر از گازهای آلاینده محیط نظیر No۲. No. Co۲, Co و همچنین ترکیبات آلی فرار سرب وSo۲ نیز توسط کربن اکتیو از هوا حذف می‌گردند."},{"page_url":"https://ca.wikipedia.org/wiki/P%C3%A8ndol_simple_equivalent","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Moglfm2111pendulo_fisico.jpg","page_title":"Pèndol simple equivalent","context_page_description":"És sempre possible trobar un pèndol simple el període sigui igual al d'un pèndol físic o compost donat; tal pèndol simple rep el nom de pèndol simple equivalent i la seva longitud λ rep el nom de longitud reduïda del pèndol físic."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%96%D2%91%D0%BE%D1%82%D0%B0-%D2%90%D1%83%D1%80%D0%BD%D0%B0_(%D0%9A%D0%BB%D1%8E%D1%87%D0%B1%D0%BE%D1%80%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B2%D1%96%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/SM_Ligota_G%C3%B3rna_Kaplica_cmentarna_%283%29_ID_610792.jpg","page_title":"Ліґота-Ґурна (Ключборський повіт)","context_page_description":"Ліґота-Ґурна — село в Польщі, у гміні Ключборк Ключборського повіту Опольського воєводства.\\nНаселення — 443 особи.\\nУ 1975-1998 роках село належало до Опольського воєводства."},{"page_url":"https://en.wikipedia.org/wiki/De_Vishal","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Haarlem_vishal.jpg","page_title":"De Vishal","context_page_description":"De Vishal is a historical building dating from 1769 on the Grote Markt in Haarlem, the Netherlands.\\nIt is built up against the St. Bavochurch. As the name Vishal literally indicates, it was constructed as a hall for selling fish to replace a much more extensive fish market that extended further into the town square and which dated from 1603, the same year as the Vleeshal across the square. It was originally an open air market in the middle and the roof with skylight was installed in 1899. It functioned as a fish market until 1941. Today it serves as a gallery for temporary exhibitions of modern art."},{"page_url":"https://en.wikipedia.org/wiki/List_of_people_killed_by_and_disappeared_during_the_Brazilian_military_dictatorship","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Cel._Alfeu_Alc%C3%A2ntara.jpg","page_title":"List of people killed by and disappeared during the Brazilian military dictatorship","context_page_description":"This is a list of the killed and politically disappeared people during the Brazilian military dictatorship. It brings together the political dead and disappeared in the Brazilian military dictatorship of 1964. The murders and disappearances of opponents of the military regime in Brazil were investigated by the National Truth Commission, by state truth commissions, by human rights entities and by victims' own relatives. In these various investigations, there is a discrepancy in the numbers of deaths and missing persons computed. The CNV, in its final report, recognized 434 political deaths and disappearances between 1964 and 1985, of which the majority occurred during the dictatorship.\\nIncluded in the list are cases found by:\\nSpecial Commission on Political Deaths and Disappearances, established in 1995 and linked to the Human Rights Secretariat of the Presidency of the Republic, which accounted for 362 cases of political deaths and disappearances;\\nDocumentation Center Eremias Delizoicov and the Commission of Family Members of the Dead and Missing Politicians, which, in 2010, organized a website listing 383 political dead and missing persons;"},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_West_Sussex","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Trotton_Bridge_2.jpg","page_title":"Grade I listed buildings in West Sussex","context_page_description":"The county of West Sussex in South East England has 176 Grade I listed buildings. Such buildings are described by English Heritage, the authority responsible for their designation, as \\"of exceptional interest [and] sometimes considered to be internationally important\\". Grade I is the highest of the three grades of listed status in England: about 2.5% of the country's 374,000 listed buildings have this designation."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%95%E0%B9%89%E0%B8%99%E0%B8%AA%E0%B8%A1%E0%B8%B1%E0%B8%A2%E0%B8%81%E0%B8%A5%E0%B8%B2%E0%B8%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Theodora_mosaik_ravenna.jpg","page_title":"ต้นสมัยกลาง","context_page_description":"ต้นสมัยกลาง เป็นสมัยหนึ่งในประวัติศาสตร์ยุโรป เริ่มขึ้นหลังจากการล่มสลายของจักรวรรดิโรมันและดำเนินต่อเนื่องกันเป็นเวลาประมาณห้าร้อยปีโดยเริ่มตั้งแต่ราวปี ค.ศ. 500 จนกระทั่งมาถึงราวปี ค.ศ. 1000 ต้นสมัยกลางสิ้นสุดแล้วจึงต่อด้วยสมัยกลางยุครุ่งโรจน์"},{"page_url":"https://da.wikipedia.org/wiki/Polona_Hercog","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Polona_Hercog_in_Prague_2009.jpg","page_title":"Polona Hercog","context_page_description":"Polona Hercog er en kvindelig tennisspiller fra Slovenien. Polona Hercog startede sin karriere i 2006.\\n13. september 2010 opnåede Polona Hercog sin højeste WTA single rangering på verdensranglisten som nummer 43."},{"page_url":"https://en.wikipedia.org/wiki/Scottish_religion_in_the_eighteenth_century","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f5/David_Dale7a.jpg","page_title":"Scottish religion in the eighteenth century","context_page_description":"Scottish religion in the eighteenth century includes all forms of religious organisation and belief in Scotland in the eighteenth century. This period saw the beginnings of a fragmentation of the Church of Scotland that had been created in the Reformation and established on a fully Presbyterian basis after the Glorious Revolution. These fractures were prompted by issues of government and patronage, but reflected a wider division between the Evangelicals and the Moderate Party. The legal right of lay patrons to present clergymen of their choice to local ecclesiastical livings led to minor schisms from the church. The first in 1733, known as the First Secession and headed by figures including Ebenezer Erskine, led to the creation of a series of secessionist churches. The second in 1761 led to the foundation of the independent Relief Church.\\nIn 1743, the Cameronians established themselves as the Reformed Presbyterian Church, remaining largely separate from religious and political debate. Of independent churches from England that were established in the seventeenth century only the Quakers managed to endure in to the eighteenth century."},{"page_url":"https://hu.wikipedia.org/wiki/Szolonyesnojei_j%C3%A1r%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/%D0%90%D0%BD%D1%83%D0%B9_%D0%B7%D0%B8%D0%BC%D0%BE%D0%B9.jpg","page_title":"Szolonyesnojei járás","context_page_description":"A Szolonyesnojei járás Oroszország egyik járása az Altaji határterületen. Székhelye Szolonyesnoje."},{"page_url":"https://es.wikipedia.org/wiki/Gran_Sello_del_Estado_de_Arizona","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Arizona_Territory_seal.jpg","page_title":"Gran Sello del Estado de Arizona","context_page_description":"El Gran Sello del Estado de Arizona se adoptó en 1674. El anillo que lo rodea porta las palabras en inglés \\"Great Seal of the State of Arizona\\" en la parte superior, y el año 1912 en la parte inferior, que recuerda la fecha de adhesión de Arizona a la Unión. El lema Ditat Deus se encuentra en el centro del sello. Al fondo está una cadena montañosa, y detrás de sus cumbres se puede ver una puesta de sol. A la derecha de las montañas se ubican una presa y su embalse, campos irrigados y huertos. En primer plano se ve a la derecha pacer el ganado, y a la izquierda se encuentra una mina de cuarzo y un minero con su pico y su pala.\\nEl sello representa los cinco elementos que antaño fueron la base de la economía de Arizona: el ganado, el algodón, el cobre, los cítricos y el clima. Aparecen de la siguiente manera: el ganado pace abajo a la derecha, los cítricos están representados por el huerto irrigado de la izquierda y el algodón está representado por los campos irrigados de la derecha; el cobre está representado por el minero de la izquierda, y el clima, que también se expresa en la flora y la fauna, está representado por una puesta de sol en el desierto."},{"page_url":"https://an.wikipedia.org/wiki/Newton_(unidat)","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Mariner_3_and_4.jpg","page_title":"Newton (unidat)","context_page_description":"O newton ye una unidat derivata de fuerza d'o Sistema Internacional d'Unidatz. O suyo simbolo ye N y recibió lo suyo nombre en honor d'Isaac Newton, en reconoiximiento a los suyos treballos en mecanica clasica. Fue emplegato por primera vegata arredol de l'anyo 1904, pero no estió dica 1948 quan o newton fue adoptato oficialment por a Conferencia Cheneral de Pesos y Mesuras como nombre ta la unidat de fuerza mks."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_Bene%C5%A1ov%C4%9B_nad_Plou%C4%8Dnic%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Sloup_Ben._nad_Pl..JPG","page_title":"Seznam kulturních památek v Benešově nad Ploučnicí","context_page_description":"Tento seznam nemovitých kulturních památek ve městě Benešov nad Ploučnicí v okrese Děčín vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Oberfranken","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Ehemaliger_Rittersitz_in_Heckenhof_%28D-4-72-115-6%29_01.jpg","page_title":"Liste von Burgen und Schlössern in Oberfranken","context_page_description":"Die Liste von Burgen und Schlössern in Oberfranken ist ein Verzeichnis von historischen Orten, wie Burgen, Schlössern, Herrensitzen, Festungen, Motten, Burgställen und Wehrkirchen auf dem Territorium des heutigen Regierungsbezirks Oberfranken, aufgeteilt in kreisfreie Städte und Landkreise. Es gibt weitere Listen für die Regierungsbezirke Oberbayern, Niederbayern, Oberpfalz, Mittelfranken, Unterfranken und Schwaben. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%91%E3%83%B3%E3%83%95%E3%83%AC%E3%83%83%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/A_sermon_preached_at_Fort_St._George_on_the_coast_of_Chormandel_in_East_India%2C_February_21_1668.jpg","page_title":"パンフレット","context_page_description":"パンフレット は製本されていない、つまり装丁がされたりハードカバーがつけられていない冊子のことである。両面に印刷された1枚の紙を複数回折りたたむものと、何枚かをたたんで折り目で綴じて、簡単な本の体裁にするものがある。パンフレットの定義として定期刊行物とは異なる出版物が「表紙を除いて5ページから48ページまでのもの」というのがUNESCOによる定義であり、それ以上は「書籍」となる。"},{"page_url":"https://en.wikipedia.org/wiki/Childhood","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Malagasy_girls_Madagascar_Merina.jpg","page_title":"Childhood","context_page_description":"Childhood is the age span ranging from birth to puberty. It may also include adolescence, but precedes adulthood regardless. According to Piaget's theory of cognitive development, childhood consists of two stages: preoperational stage and concrete operational stage. In developmental psychology, childhood is divided up into the developmental stages of early childhood, middle childhood, and adolescence. Various childhood factors could affect a person's attitude formation.\\nThe concept of childhood emerged during the 17th and 18th centuries, particularly through the educational theories of the philosopher John Locke and the growth of books for and about children. Previous to this point, children were often seen as incomplete versions of adults."}]`),T={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const a=this.searchQuery.trim().toLowerCase();return a?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(a)||e.context_page_description&&e.context_page_description.toLowerCase().includes(a)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(a=>setTimeout(a,1e3)),this.visibleCount+=4,this.isLoading=!1}}},L={class:"search-container"},F={class:"card-container"},G